INSERT INTO `website_shop_objects_templates` VALUES (200, 4, 'God Rod', 'Le God Rod est une arme terrible. Très puissant, il permet à son porteur de se montrer digne des meilleurs lorsqu\'il a une petite baisse de régime.', 7, 67, '64#b#f#0#1d5+10,6e#28#0#0#0d0+40,6f#1#0#0#0d0+1,73#1#0#0#0d0+1,7c#19#0#0#0d0+25,9a#28#0#0#0d0+40');
INSERT INTO `website_shop_objects_templates` VALUES (201, 4, 'Hook', 'Le Hook a été retrouvé sur un cadavre, près d\'un énorme Crocodaille en décomposition.', 4, 55, '64#9#d#0#1d5+8,75#1#0#0#0d0+1,7b#28#0#0#0d0+40,7c#1e#0#0#0d0+30,9d#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (202, 6, 'Razielle', 'Cette épée a été bénie par les larmes de l\'ange Raziel. Terriblement destructrice elle est suffisamment puissante pour permettre à son porteur d\'affronter le plus terrible des adversaires.', 16, 52, '64#1a#28#0#1d15+25,6e#28#0#0#0d0+40,76#1e#0#0#0d0+30,77#28#0#0#0d0+40,9b#a#0#0#0d0+10,9c#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (203, 10, 'Ceinture du Tot', 'Si vous avez ce formidable objet autour des reins, c\'est que vous êtes l\'un des héros les plus chanceux de cet univers. Cette ceinture appartenait au héros barbu le plus fort et séduisant de tous les temps.', 10, 33, '6e#1f#32#0#1d20+30,73#4#0#0#0d0+4,9b#b#1e#0#1d20+10');
INSERT INTO `website_shop_objects_templates` VALUES (204, 4, 'Kryst O\'Boul', 'Ce bâton vivant a traîné dans les endroits les plus sombres de l\'univers d\'Amakna. Il se réveille tous les 300 ans pour changer d\'endroit ou de propriétaire, préférant emprunter les petits tunnels tout sombres, qui ne sentent pas très bon.', 63, 59, '64#10#14#0#1d5+15,73#1#5#0#1d5+0,77#15#1e#0#1d10+20,7c#15#1e#0#1d10+20,7e#15#1e#0#1d10+20,99#b#14#0#1d10+10');
