INSERT INTO `website_shop_objects_templates` VALUES (218, 5, 'Bashers', 'Les Bashers sont de redoutables dagues d\'assassin. Celui qui les possède est capable de rivaliser avec le plus sanguinaire des guerriers.', 5, 29, '64#a#e#0#1d5+9,77#28#0#0#0d0+40,9b#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (219, 5, 'Blessdags', 'Les Blessdags viennent du célèbre Ogre la Main Sombre qui périt en affrontant un paladin du Bimd\'Oule. Il paraît que son sang anime ces dagues malsaines.', 55, 64, '64#c#12#0#1d7+11,7d#1f#28#0#1d10+30,73#2#6#0#1d5+1,77#1f#28#0#1d10+30,7b#1f#28#0#1d10+30,9d#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (220, 5, 'Chakra Style', 'Chakra Style est une paire de dagues ayant appartenu à l\'une des plus grandes voleuses de tous les temps. Chakra fut la première à pouvoir forcer les portes du temple d\'Osaroth et à y dérober de précieuses reliques.', 8, 73, '64#a#e#0#1d5+9,6e#1e#0#0#0d0+30,6f#1#0#0#0d0+1,70#3#0#0#0d0+3,7b#1e#0#0#0d0+30,9c#a#0#0#0d0+10');
