INSERT INTO `website_shop_objects_templates` VALUES (233, 7, 'Kaiser', 'Kaiser est le nom d\'un Dragon Cochon qui jadis dévasta le village de Bounkaïda. Lorsque la milice eut enfin raison du monstre, les forgerons créèrent de nombreuses armes à partir des restes de la bête. Ce marteau en fait partie.', 10, 82, '64#10#19#0#1d10+15,77#15#1e#0#1d10+20,7d#33#46#0#1d20+50,7e#15#1e#0#1d10+20,76#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (234, 7, 'Ragnarok', 'Le Ragnarok est un marteau très puissant, capable de déchaîner des tempêtes ou les foudres de vos alliés si vous leur tapez dessus.', 55, 66, '64#10#17#0#1d8+15,7c#24#2d#0#1d10+35,7e#24#2d#0#1d10+35,7d#b#14#0#1d10+10,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (235, 7, 'Cerberus', 'Ce marteau était détenu par le gardien de la Porte des Enfers. Il empêchait les vivants d\'y entrer, les morts d\'en sortir et les morts-vivants de bouger.', 7, 16, '64#10#14#0#1d5+15');
INSERT INTO `website_shop_objects_templates` VALUES (236, 7, 'Barabas', 'Barabas est redoutable : il permet à son porteur de se déplacer plus facilement, et surtout d\'être plus efficace en combat rapproché.', 11, 23, '64#6#a#0#1d5+5,77#1e#0#0#0d0+30,9d#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (237, 7, 'Sargasse', 'Sargasse était détenue par un enfant aux terribles pouvoirs. On ne sait pas ce qu\'est devenue cette arme lorsqu\'elle fut échangée à un aventurier contre un sac de billes.', 8, 27, '64#10#14#0#1d5+15,7b#28#0#0#0d0+40,9d#14#0#0#0d0+20');
