INSERT INTO `website_shop_objects_templates` VALUES (250, 8, 'Ares', 'Mi-hache, mi-pelle, Ares fut l\'une des sept armes utilisées par le démon Kajlir pour venir à bout de la Confrérie des Enutrofs collectionneurs de Dofus Pourpres.', 9, 72, '7b#10#1e#0#1d15+15,73#3#5#0#1d3+2,7d#1f#32#0#1d20+30,6f#1#0#0#0d0+1,60#7#d#0#1d7+6,70#2#3#0#1d2+1,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (251, 8, 'Barbe Grise', 'Barbe Grise était l\'arme favorite du démon nain Assan Cehef, qui terrorisa de nombreux villageois, attaquant sans crier \"gare\", ni \"train\".', 11, 20, '64#10#14#0#1d5+15,6e#a#0#0#0d0+10,9c#2#0#0#0d0+2,31b#1#0#0#0d0+1');
