INSERT INTO `website_shop_objects_templates` VALUES (270, 2, 'Xaveur', 'Le Xaveur est un arc efficace. Il appartenait au grand Xavier le Boulanger. Entre deux fournées, il partait distribuer des pains aux monstres entourant sa boulangerie.', 5, 60, '64#10#19#0#1d10+15,7d#1f#28#0#1d10+30,77#15#1e#0#1d10+20,8a#b#f#0#1d5+10,9d#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (271, 7, 'Le Marteau du Chafer', 'Une belle arme étrange et fascinante, elle vous permettra de vous battre au corps à corps comme le ferait le meilleur des Chafers.', 9, 21, '64#6#a#0#1d5+5,73#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (272, 2, 'Nomoon', 'Cet arc est assez puissant pour envoyer une flèche sur la lune.', 9, 28, '64#4#8#0#1d5+3,6e#14#0#0#0d0+20,73#1#0#0#0d0+1,9d#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (273, 2, 'La Corde de Yamato', 'La Corde de Yamato a fait vibrer plus d\'un coeur de monstre. Arme fine, elle est capable de diriger sa flèche dans les endroits les plus cachés.', 10, 33, '64#1#f#0#1d15+0,75#1#0#0#0d0+1,76#14#0#0#0d0+20,9b#e#0#0#0d0+14');
INSERT INTO `website_shop_objects_templates` VALUES (274, 51, 'Pièce du Puzzle de la Griffe', 'Une pièce très rare du trésor de Dodge, l\'un des plus grands Ecaflip d\'Amakna.', 267, 12, '');
INSERT INTO `website_shop_objects_templates` VALUES (276, 15, 'Pièce du Trésor du Badoul', 'Une pièce très rare d\'un trésor caché par le célèbre Dodge, l\'un des plus grands guerriers Ecaflip d\'Amakna.', 268, 12, '');
INSERT INTO `website_shop_objects_templates` VALUES (278, 9, 'Anneau des Rocheuses', 'Anneau serti d\'une pierre rare. Il doit son nom aux différentes pierres nécessaires à sa confection.', 4, 15, '6e#4#0#0#0d0+4,77#4#0#0#0d0+4');
INSERT INTO `website_shop_objects_templates` VALUES (279, 1, 'La Larme du Bouftou', 'Selon un illustre aventurier, cette amulette contient une larme de Bouftou, à l\'odeur et aux propriétés semblables à celles des décoctions de cuir de bouftou.', 7, 2, '6e#4#0#0#0d0+4');
INSERT INTO `website_shop_objects_templates` VALUES (280, 1, 'Collier de l\'Arc en Ciel', 'Ce collier est recherché par les collectionneurs, vous en tirerez un bon prix.', 11, 6, '7b#6#0#0#0d0+6');
INSERT INTO `website_shop_objects_templates` VALUES (281, 42, 'Pomme', 'Cette pomme restaure quelques points de vie perdus. Posée sur la tête d\'un ami, elle pourra vous servir de cible.', 1, 1, '6e#1e#0#0#0d0+30');
INSERT INTO `website_shop_objects_templates` VALUES (282, 12, 'Fiole de Soin supérieure', 'Cette fiole restaure quelques points de vie perdus.', 39, 20, '6e#33#64#0#1d50+50');
INSERT INTO `website_shop_objects_templates` VALUES (283, 12, 'Fiole de Soin', 'Cette fiole restaure quelques points de vie perdus.', 3, 10, '6e#1f#3c#0#1d30+30');
INSERT INTO `website_shop_objects_templates` VALUES (284, 48, 'Sel', 'Le sel est un minéral, moulu, il vous permet de donner du goût à vos pains.', 260, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (285, 52, 'Farine de Blé ', 'La farine s\'obtient en écrasant des grains de blé, elle est très utile pour faire du pain, des crêpes, des gaufres et de délicieux gâteaux, mais surtout pour enfariner vos ennemis d\'enfance.', 251, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (286, 48, 'Levure de Boulanger', 'C\'est un ingrédient indispensable pour la fermentation du pain.', 137, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (287, 58, 'Graine de Sésame', 'Cette graine extrêmement riche en protéines permet de réaliser de délicieux pains, mais la culture du sésame est délicate sous le climat d\'Amakna, ce qui en fait une graine rare et chère.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (288, 58, 'Graine de Tournesol sauvage', 'Cette graine riche en protéines permet de donner une saveur très particulière aux pains. La seule façon d\'en trouver c\'est de tuer un Tournesol sauvage ou de l\'acheter !', 6, 12, '');
INSERT INTO `website_shop_objects_templates` VALUES (289, 34, 'Blé ', 'Le Blé est depuis la nuit des temps un ingrédient indispensable dans l\'alimentation des habitants d\'Amakna et des Tofus.', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (290, 15, 'Champignon', 'Avec ou sans crème, les champignons sont toujours aussi bons. La manière la plus simple de s\'en procurer reste de tuer un Champ-Champ.', 1, 5, '');
INSERT INTO `website_shop_objects_templates` VALUES (291, 54, 'Poils du Mulou', 'Ces poils ne sont pas comme tous les poils, ils disposent de propriétés particulières qui les rendent très appréciés des alchimistes.', 8, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (292, 15, 'Testicules du Mulou', 'Ces énormes testicules sont recouverts d\'un étrange duvet particulièrement doux et chaud. Il est presque impossible de les récupérer intacts après un combat face à un Mulou, ce qui explique en partie leur prix scandaleux.', 10, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (293, 8, 'Petite Pelle du Craqueleur', 'La seule chose qui soit aussi solide qu\'un Craqueleur, c\'est un Craqueleur, voilà pourquoi cette pelle, destinée à la chasse aux craqueleurs, est en Pierre de Craqueleur.', 7, 20, '64#6#a#0#1d5+5,77#5#0#0#0d0+5,7c#5#0#0#0d0+5,9b#9#0#0#0d0+9');
