INSERT INTO `website_shop_objects_templates` VALUES (295, 8, 'Grande Pelle du Craqueleur', 'La seule chose qui soit aussi solide qu\'un Craqueleur, c\'est un Craqueleur, voilà pourquoi cette pelle destinée à la chasse aux craqueleurs est en Pierre de Craqueleur.', 7, 26, '64#8#c#0#1d5+7,77#9#0#0#0d0+9,7c#9#0#0#0d0+9,9b#9#0#0#0d0+9');
INSERT INTO `website_shop_objects_templates` VALUES (296, 8, 'Puissante Pelle du craqueleur', 'La seule chose qui soit aussi solide qu\'un Craqueleur, c\'est un Craqueleur, voilà pourquoi cette pelle destinée à la chasse aux craqueleurs est en Pierre de Craqueleur.', 7, 29, '64#9#d#0#1d5+8,77#b#0#0#0d0+11,7c#b#0#0#0d0+11,9b#9#0#0#0d0+9');
INSERT INTO `website_shop_objects_templates` VALUES (297, 11, 'Bottes du Petit Bouftou', 'Ces bottes sont confectionnées en cuir de Bouftou, elles permettent aux éleveurs de s\'approcher plus facilement des Bouftous pour les tuer, grâce à l\'odeur qu\'elles dégagent.', 3, 1, '77#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (298, 11, 'Sandales Tofuesques', 'Ces sandales sont faites à partir de plumes de Tofu bouilli, et la semelle est en Bec de Tofu inusable. Pour des raisons encore inexpliquées, elles rendent parfois leur porteur un peu débile...comme un Tofu.', 4, 1, '7b#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (299, 11, 'Bottes de Faillete', 'La meilleure défense c\'est l\'attaque, ces bottes anti-agression vous permettront d\'exterminer un groupe d\'agresseurs sans aucune difficulté.', 8, 24, '73#3#6#0#1d4+2');
INSERT INTO `website_shop_objects_templates` VALUES (300, 58, 'Graine de Pavot', 'Cette graine confère des vertus hallucinogènes aux pains prisés des aventuriers qui désirent se reposer après un combat difficile.', 11, 5, '');
INSERT INTO `website_shop_objects_templates` VALUES (301, 53, 'Plumes de Tofu', 'Les plumes de Tofu sont très utilisées en couture pour les rembourrages divers. Et surtout, n\'oubliez pas, un kilo de plumes de Tofu pèse autant qu\'un kilo de plomb.', 14, 4, '');
INSERT INTO `website_shop_objects_templates` VALUES (302, 68, 'Citrouille', 'Les citrouilles poussent dans les champs, à peine plus grosses que les testicules de mulou, elles ont en revanche bien meilleur goût.', 12, 15, '');
INSERT INTO `website_shop_objects_templates` VALUES (303, 38, 'Bois de Frêne', 'Le Bois de Frêne n\'est pas un bois de qualité, mais il est abondant et pousse relativement vite. Attention tout de même à ne pas le stocker près d\'une forte source de chaleur, il est inflammable.', 17, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (304, 56, 'Cuir de Bouftou', 'Ce cuir très résistant constitue la principale ressource des tanneurs qui en font des bottes, des ceintures et même des lanières de fouet. Son seul inconvénient, c\'est d\'avoir l\'odeur de la sueur de Bouftou en rut... ce qui ne favorise pas les rencontres.', 16, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (305, 47, 'Dent de Wabbit', 'Abîmées à force de ronger des cawottes, les dents de Wabbit sont tout de même très utiles lors de la confection de potions grâce à leurs propriétés revigorantes.', 13, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (306, 35, 'Fleur de Pissenlit Diabolique', 'Correctement bouillie puis séchée, cette fleur perd ses propriétés toxiques et peut se consommer en tisane, mais la fleur de Pissenlit Diabolique est surtout utilisée pour amuser la jeunesse en quête de romantisme. En effet, qui n\'a jamais soufflé sur une fleur de Pissenlit Diabolique pour envoyer dans le cou de l\'être tant convoité, ces magnifiques graines, douces comme la caresse d\'une éclaircie sur les feuilles d\'un charme encore imprégnées de rosée ? Peut-être les Iops, qui au lieu de souffler, ont tendance à aspirer les graines et à s\'étouffer lamentablement dans d\'atroces convulsions.', 18, 5, '');
INSERT INTO `website_shop_objects_templates` VALUES (307, 104, 'Ailes de Moskito', 'Ces ailes très fines ont la particularité de favoriser la réflexion des personnes qui osent les mâcher. Leur goût est assez proche des oeufs de Kwak pourris, c\'est pour cela qu\'elles sont essentiellement utilisées pour les potions de sagesse.', 19, 2, '');
INSERT INTO `website_shop_objects_templates` VALUES (308, 111, 'Coquille de Dragoeuf Blanc', 'Cette coquille est presque incassable, cependant, en la polissant pendant des générations, les meilleurs Bijoutiers peuvent utiliser ses facultés magiques pour confectionner des amulettes aux pouvoirs exceptionnels.', 21, 64, '');
INSERT INTO `website_shop_objects_templates` VALUES (309, 35, 'Pétale de Rose Démoniaque', 'Ces pétales ont des vertus aphrodisiaques très puissantes, ce qui en fait le cadeau idéal pour conquérir l\'élu(e) de votre coeur. Éviter de les consommer en infusion est une sage décision dans la mesure où leurs effets se retrouvent être inversés.', 20, 6, '');
INSERT INTO `website_shop_objects_templates` VALUES (310, 47, 'Os de Chafer', 'Cet os est presque incassable, mais au contact de l\'eau, il devient tout mou, ce qui facilite son utilisation par les alchimistes.', 15, 34, '');
INSERT INTO `website_shop_objects_templates` VALUES (311, 15, 'Eau', 'L\'eau est utile pour de nombreuses choses, et plus elle est trouble, plus elle donnera de goût à la bière (méfiez-vous tout de même, l\'eau bue explose).', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (312, 39, 'Fer', 'Le fer est très utile pour les forgerons et pour ceux qui utilisent du métal, certains s\'en servent même pour repasser.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (313, 39, 'Or', 'L\'or est un métal rare et précieux, ses qualités intrinsèques en font un métal de choix pour la conception d\'armes ou d\'objets particulièrement puissants et d\'esthétique raffinée.', 22, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (315, 50, 'Diamant', 'Tous les bijoutiers d\'Amakna raffolent de cette pierre qui demande une excellente dextérité pour être travaillée. Il faut souvent s\'aventurer dans de dangereuses mines pour les trouver, mais heureusement, les diamants sont éternels.', 25, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (316, 50, 'Emeraude', 'Avec son vert intense, cette magnifique pierre précieuse peut facilement transformer un thon en princesse, sans l\'utilisation d\'une quelconque magie occulte.', 23, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (317, 4, 'Bâton du Petit Tabi', 'Ce bâton servait à l\'origine aux éleveurs d\'Amakna qui voulaient contrôler plus facilement leurs troupeaux de Tabis, ce bâton est en effet si léger, qu\'il permet à son porteur de courir après les Tabis égarés sans se fatiguer.', 6, 30, '64#6#a#0#1d5+5,6e#5#0#0#0d0+5,77#1e#0#0#0d0+30');
INSERT INTO `website_shop_objects_templates` VALUES (318, 4, 'Bâton du Tabi', 'Ce bâton servait à l\'origine aux éleveurs d\'Amakna qui voulaient contrôler plus facilement leurs troupeaux de Tabis, ce bâton est en effet si léger, qu\'il permet à son porteur de courir après les Tabis égarés sans se fatiguer.', 6, 34, '64#7#b#0#1d5+6,6e#a#0#0#0d0+10,77#23#0#0#0d0+35');
INSERT INTO `website_shop_objects_templates` VALUES (319, 4, 'Bâton du Grand Tabi', 'Ce bâton servait à l\'origine aux éleveurs d\'Amakna qui voulaient contrôler plus facilement leurs troupeaux de Tabis, ce bâton est en effet si léger, qu\'il permet à son porteur de courir après les Tabis égarés sans se fatiguer.', 6, 37, '64#8#c#0#1d5+7,6e#f#0#0#0d0+15,77#28#0#0#0d0+40');
INSERT INTO `website_shop_objects_templates` VALUES (320, 4, 'Bâton du Puissant Tabi', 'Ce bâton servait à l\'origine aux éleveurs d\'Amakna qui voulaient contrôler plus facilement leurs troupeaux de Tabis, ce bâton est en effet si léger, qu\'il permet à son porteur de courir après les Tabis égarés sans se fatiguer.', 6, 40, '64#9#d#0#1d5+8,6e#a#0#0#0d0+10,77#2d#0#0#0d0+45');
INSERT INTO `website_shop_objects_templates` VALUES (323, 1, 'Amulette du Kam Assutra', 'Cette amulette donne des facultés très particulières à son porteur, en effet ce dernier se voit comme transporté par une aura mystérieuse parcourant son corps, ce qui généralement a pour effet de décupler ses capacités physiques.', 4, 43, '6f#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (324, 1, 'Amulette de Krokette', 'Cette amulette a la faculté de devenir rose les jours où son porteur est d\'humeur guillerette. On raconte qu\'elle décuple également vos chances de trouver de bons objets.', 7, 6, '7b#6#0#0#0d0+6');
INSERT INTO `website_shop_objects_templates` VALUES (325, 1, 'Amulette du Sram', 'Cette amulette confectionnée à partir de petits crânes taillés dans de l\'os, par un des plus grands bijoutiers Sram, est unique en son genre. Elle permet à son porteur de s\'évader plus facilement lors des situations périlleuses.', 3, 2, '77#4#0#0#0d0+4');
INSERT INTO `website_shop_objects_templates` VALUES (326, 1, 'Amulette Deulegarnoulle', 'Cette amulette provient des régions nordiques, elle confère a son porteur la capacité d\'invoquer plus facilement des créatures.', 2, 33, 'b6#2#0#0#0d0+2,b7#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (327, 6, 'Lame du Chevaucheur de Karne', 'Cette lame forgée à l\'origine pour les Chevaucheurs de Karne, était en fait bien trop lourde pour ces faibles gobelins. Elle n\'en reste pas moins très légère pour un individu normal, ce qui lui permet de frapper très vite.', 3, 16, '64#10#14#0#1d5+15,76#10#0#0#0d0+16,99#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (328, 6, 'Koupe-koupe', 'Cette lame double à la forme bien étrange servait à l\'origine à élaguer les arbres pour progresser dans les forêts denses. Les bûcherons se sont vite aperçus qu\'elle constituait une arme de choix pour exterminer toute forme de menace.', 4, 18, '64#b#f#0#1d5+10,73#1#2#0#1d2+0,77#b#1e#0#1d20+10,9b#b#1e#0#1d20+10');
INSERT INTO `website_shop_objects_templates` VALUES (329, 2, 'Arc de Triomphe', 'Comme son nom l\'indique, cet arc permet de gagner facilement un combat. Un grand architecte Crâ sans imagination a même utilisé le nom de cet arc pour nommer une de ses constructions.', 11, 30, '64#6#a#0#1d5+5,73#1#0#0#0d0+1,77#a#0#0#0d0+10,7b#a#0#0#0d0+10,9b#4#0#0#0d0+4,9d#4#0#0#0d0+4');
INSERT INTO `website_shop_objects_templates` VALUES (331, 2, 'Arc Hancihaile', 'C\'est l\'arc le plus recherché de tout Amakna, on raconte que là où ses flèches retombent, on peut trouver un trésor. Étrangement, il ne semble être efficace que lorsque pluie et rayons de soleil se mêlent.', 16, 22, '64#2#6#0#1d5+1,7b#1e#0#0#0d0+30');
INSERT INTO `website_shop_objects_templates` VALUES (332, 2, 'Arc de Jeanne', 'Jeanne était un peu folle, elle entendait des Tabis roter dans sa tête. Pour éviter qu\'elle ne se blesse avec son arc, il lui a été confisqué et on a décidé de la brûler vive pour réchauffer l\'ambiance lors de l\'inauguration de la taverne.', 15, 30, '64#2#10#0#1d15+1,75#1#0#0#0d0+1,31b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (333, 3, 'Baguette Deuh-Pain', 'A l\'origine destinée à être mangée, cette baguette est devenue une arme redoutée. En effet, Xavier le Boulanger l\'a oubliée dans son four pendant 234 ans alors qu\'il était parti distribuer des pains aux monstres autour de sa boulangerie.', 9, 50, '64#6#a#0#1d5+5,75#1#0#0#0d0+1,7b#5#0#0#0d0+5,7c#1e#0#0#0d0+30,9d#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (334, 3, 'Baguette de Liriel', 'Cette baguette appartenait à l\'Eniripsa Liriel qui mourût d\'une overdose de fraises dans d\'atroces souffrances, perdant ses ailes dans un râle de douleur à vous glacer le sang. Les collectionneurs s\'arrachent cette baguette réputée maudite.', 5, 20, '64#10#14#0#1d5+15,73#1#0#0#0d0+1,31b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (335, 4, 'Bâton du Bwork Mage', 'Sans leur bâton, les Bwork Mages sont aussi inoffensifs que les Tofus sans leur Bécos. Voilà qui en dit long sur la puissance de ce bâton.', 1, 58, '64#10#14#0#1d5+15,73#2#5#0#1d4+1,75#1#0#0#0d0+1,7b#b#1e#0#1d20+10,9d#14#0#0#0d0+20,b0#2#5#0#1d4+1');
INSERT INTO `website_shop_objects_templates` VALUES (336, 4, 'Bâton du Grand Pa Wabbit', 'Ce bâton a la faculté de pouvoir faire léviter les Cawottes, on se demande bien à quoi cela peut servir en combat.', 1, 32, '64#2#6#0#1d5+1,73#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (337, 2, 'Arc du Bwork Archer', 'C\'est un arc très simple à utiliser, il a été conçu pour s\'adapter à l\'intelligence d\'un Bwork Archer, ce qui le rend presque utilisable par un Tofu. En revanche, il nécessite une force de Craqueleur pour être bandé.', 4, 20, '64#6#a#0#1d5+5,76#a#0#0#0d0+10,9b#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (338, 6, 'Lame du Petit Bwork', 'Cette épée d\'apparence rudimentaire est très appréciée des Bworks les plus débiles, qui ne savent pas se servir d\'un arc ou d\'un bâton, certains confondent même la lame et le manche ce qui ne manque pas de faire rire leurs adversaires.', 13, 21, '64#10#14#0#1d5+15,77#a#0#0#0d0+10,99#4#0#0#0d0+4');
INSERT INTO `website_shop_objects_templates` VALUES (339, 6, 'Lame du Chafer', 'Cette lame appartenaît à Metzger le boucher, elle avait été forgée pour découper les os. Le Chafer a cependant réussi à lui dérober son outil, devenu maintenant une arme très redoutée qui est à l\'origine de nombreuses amputations.', 5, 27, '64#10#14#0#1d5+15,73#2#3#0#1d2+1,7b#10#14#0#1d5+15,9b#10#14#0#1d5+15');
INSERT INTO `website_shop_objects_templates` VALUES (340, 5, 'Leurnettes', 'Ces dagues permettent selon la légende de voler tout et n\'importe quoi, mais surtout n\'importe quoi à n\'importe qui, où l\'inverse, mais plus personne ne se souvient de la légende avec exactitude.', 9, 12, '64#1#3#0#1d3+0,77#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (341, 5, 'Dagues Eurfolles', 'Ces dagues légendaires constituent de vraies pièces de collection pour tout Sram qui se respecte, elles sont tellement vénérées, que certains Srams se refusent à les voler.', 10, 46, '64#5#7#0#1d3+4,80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (342, 7, 'Marteau Pickeur', 'Ce marteau très particulier a été confectionné à partir de becs de Kwaks, ce qui explique pourquoi il pique très fort lorsque l\'on se prend un coup de ce marteau.', 12, 18, '64#6#a#0#1d5+5,76#14#0#0#0d0+20,98#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (345, 8, 'Petite Pelle Teuze', 'Après une soirée un peu trop arrosée à la taverne qui a débouché sur une bagarre, un Enutrof s\'est aperçu que cette pelle conçue à l\'origine pour les grands travaux de construction était une excellente arme.', 8, 25, '64#b#f#0#1d5+10,73#1#0#0#0d0+1,76#a#0#0#0d0+10,99#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (346, 9, 'Anneau Rak', 'Selon certaines légendes, cet anneau protège son porteur des intempéries. Mais ceci n\'a jamais encore pu être prouvé, puisqu\'il ne pleut jamais en Amakna.', 34, 17, '6e#8#0#0#0d0+8,7b#8#0#0#0d0+8');
INSERT INTO `website_shop_objects_templates` VALUES (347, 8, 'Rhizome Doré ', 'Cette pelle de jardinier est particulièrement efficace pour couper les rhizomes, des mauvaises herbes. C\'est également une excellente arme dès qu\'il s\'agit de couper autre chose que des rhizomes.', 10, 40, '64#10#14#0#1d5+15,7b#28#0#0#0d0+40,7d#28#0#0#0d0+40,9b#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (348, 11, 'Bottes de Céleri-Thé ', 'Ces bottes appartenaient à un cuisinier très pressé, qui allait chercher son céleri et son thé à toute vitesse à travers la campagne d\'Amakna.', 5, 53, '80#1#0#0#0d0+1,7b#b#1e#0#1d20+10,b0#2#5#0#1d4+1,9d#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (350, 39, 'Argent', 'L\'argent est un métal brillant très apprécié des bijoutiers, contrairement à ce que certaines personnes essaient de vous faire croire, il n\'a aucun effet particulier sur les vampires.', 28, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (351, 37, 'Bière d\'Amakna', 'Cette bière vous permettra de restaurer vos points de vie. Et comme le dit un brillant dicton paternel : \"Il vaut mieux la bière dans le corps que le corps dans la bière\".', 4, 1, '6e#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (352, 6, 'Petite Epée Sacrée', 'Une épée sainte distribuée aux jeunes guerriers durant leur formation.', 1, 13, '64#6#a#0#1d5+5,7d#8#c#0#1d5+7');
INSERT INTO `website_shop_objects_templates` VALUES (353, 6, 'Epée du Petit Chevalier', 'L\'épée du  Petit Chevalier est une épée solide et efficace, bien utilisée elle peut causer de gros dommages à vos ennemis.', 9, 21, '64#b#19#0#1d15+10,7b#a#0#0#0d0+10,99#4#0#0#0d0+4');
INSERT INTO `website_shop_objects_templates` VALUES (354, 6, 'La Klebik', 'Ce type d\'épée était forgé pour les gardes d\'un commerçant aussi riche que réputé. Plutôt destinée à effrayer les voleurs, elle n\'en reste pas moins redoutable pour achever les voleurs ou les clients honnêtes, mais un peu usants.', 11, 25, '64#b#f#0#1d5+10,7c#10#14#0#1d5+15,98#10#14#0#1d5+15');
INSERT INTO `website_shop_objects_templates` VALUES (355, 9, 'L\'Anneau de Valeur', 'Cet anneau apporte force et courage à son porteur.', 7, 12, '76#4#0#0#0d0+4,7b#4#0#0#0d0+4');
INSERT INTO `website_shop_objects_templates` VALUES (356, 10, 'Ceinture d\'Endurance', 'Cette ceinture rend son porteur plus résistant et endurant.', 3, 27, '6e#1e#0#0#0d0+30,76#1e#0#0#0d0+30,9a#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (357, 6, 'La Queue', 'Epée symbolisant la partie de leur corps dont les Ecaflips sont le plus fier. Cette épée résume bien la façon de faire des joueurs.', 18, 13, '64#1#19#0#1d25+0');
INSERT INTO `website_shop_objects_templates` VALUES (358, 6, 'La Queue Infernale', 'La Queue Infernale est vraiment infernale... De quoi rendre votre adversaire ou vos coéquipiers complètement fous, et surtout de transformer vos coéquipiers en adversaires si vous vous y prenez mal. En revanche, le cas inverse ne semble jamais se produire.', 18, 21, '64#1#23#0#1d35+0,98#b#f#0#1d5+10,77#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (359, 9, 'L\'Ecaliseur', 'Cet anneau a été offert il y bien longtemps à Isidor, un chat malin, par le roi Allister, qui reconnu l\'agilité inégalable de cet Ecaflip.', 35, 29, '6e#4#0#0#0d0+4,70#2#0#0#0d0+2,7b#4#0#0#0d0+4');
INSERT INTO `website_shop_objects_templates` VALUES (360, 106, 'Oreilles du Tiwabbit', 'Ces petites oreilles recouvertes de poils bruns sentent le mulou mort une fois bouillies. Elles sont en revanche très appréciées lorsqu\'elles sont fourrées avec de la gelée royale.', 30, 11, '');
INSERT INTO `website_shop_objects_templates` VALUES (361, 68, 'Cawotte', 'C\'est l\'unique nourriture du Tiwabbit Kiafin, ce qui explique peut-être l\'origine de sa débilité profonde.', 31, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (362, 59, 'Peau de Larve Bleue', 'Cette peau toute lisse constitue un très bon ingrédient pour les potions magiques.', 32, 2, '');
INSERT INTO `website_shop_objects_templates` VALUES (363, 59, 'Peau de Larve Orange', 'Cette peau toute lisse constitue un excellent ingrédient pour les potions magiques.', 33, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (364, 59, 'Peau de Larve Verte', 'Cette peau toute lisse constitue un excellent ingrédient pour les potions magiques.', 34, 7, '');
INSERT INTO `website_shop_objects_templates` VALUES (365, 103, 'Patte d\'Arakne', 'Une patte très fine, mais très poilue. Très prisée des alchimistes pour ses propriétés euphorisantes, c\'est la petite faiblesse qui les perdra.', 35, 2, '');
INSERT INTO `website_shop_objects_templates` VALUES (366, 47, 'Bec du Tofu', 'Ce ridicule petit bec de Tofu, d\'apparence anodine, est cependant très aiguisé. Les archers d\'Amakna les utilisent depuis des lustres comme pointes de flèches.', 37, 4, '');
INSERT INTO `website_shop_objects_templates` VALUES (367, 105, 'Oeuf de Tofu', 'Cet oeuf a la particularité de sentir l\'oeuf pourri même lorsqu\'il n\'est pas pourri, imaginez un peu ce qu\'il sent lorsqu\'il est réellement pourri. Personne ne sait en revanche, qui du Tofu ou de l\'Oeuf de Tofu est arrivé en premier en Amakna.', 38, 4, '');
INSERT INTO `website_shop_objects_templates` VALUES (368, 110, 'Gelée à la Fraise', 'Cette délicieuse gelée à la fraise a rendu plus d\'un aventurier un peu trop gourmand malade. Comme le dit si bien le fameux dicton, \"tout est poison, rien n\'est poison, c\'est la dose qui compte\". Dans le cas de la gelée à la fraise, évitez l\'overdose.', 40, 28, '');
INSERT INTO `website_shop_objects_templates` VALUES (369, 110, 'Gelée à la Menthe', 'Cette délicieuse gelée à la menthe a rendu plus d\'un aventurier un peu trop gourmand malade. Elle a un effet apaisant sur le moral de toute votre équipe si vous la consommez en cas de mauvaise haleine.', 41, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (370, 110, 'Gelée Bleutée Royale', 'Cette délicieuse gelée est issue de la digestion et de la fermentation de miel par une Gelée Royale. Immangeable sous sa forme brute, cette gelée n\'en reste pas moins, un ingrédient de choix pour les confiseries.', 407, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (371, 15, 'Sourcil de Moskito', 'Le Moskito dispose de longs et fins sourcils qui mettent en valeur son regard de grand charmeur. La grande sensibilité du moskito fait que ses sourcils sont souvent imprégnés de larmes aux propriétés méconnues.', 44, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (372, 15, 'Bandeau du Black Tiwabbit', 'Ce bandeau donne une allure de guerrier au Black Tiwabbit qui le porte. Cette tradition de porter un bandeau vient paraît-il du Wabbit Wambo.', 29, 11, '');
INSERT INTO `website_shop_objects_templates` VALUES (373, 36, 'Tige de Pissenlit Diabolique', 'Cette tige, souple comme le roseau, se plie, mais ne casse pas, ce qui en fait un composant de choix pour la réalisation des fouets et autres martinets, indispensables à l\'éducation d\'un enfant.', 45, 6, '');
INSERT INTO `website_shop_objects_templates` VALUES (374, 36, 'Langue du Pissenlit Diabolique', 'La couleur verte de cette langue provient de la consommation abusive de gelée à la menthe dont le Pissenlit Diabolique est friand.', 555, 5, '');
INSERT INTO `website_shop_objects_templates` VALUES (375, 47, 'Dent du Tofu Maléfique', 'Le Tofu Maléfique a troqué son ridicule petit bec de Tofu contre de ridicules grandes dents. Il est difficile de savoir ce qui est le plus dangereux sans tester soi-même.', 47, 3, '');
INSERT INTO `website_shop_objects_templates` VALUES (376, 104, 'Aile du Tofu Maléfique', 'Cette ridicule petite aile ne sert pas à grand-chose au Tofu Maléfique, si ce n\'est à brasser de l\'air pour déséquilibrer les Moskitos.', 48, 3, '');
INSERT INTO `website_shop_objects_templates` VALUES (377, 15, 'Epine du Champ Champ', 'Cette épine venimeuse protège le Champ Champ des attaques au corps à corps, mais l\'empêche en revanche de faire des câlins sans tuer ceux qu\'il aime. Heureusement pour lui, le Champ Champ utilise du Sporme qu\'il envoie à distance pour se reproduire.', 49, 5, '');
INSERT INTO `website_shop_objects_templates` VALUES (378, 15, 'Sporme du Champ Champ', 'Cette sporme est la \"petite graine\" qui permet au Champ Champ de disséminer ses petits un peu partout, et surtout n\'importe où. Attention, les spormes du Champ Champ sont attirées par les pieds malodorants et l\'odeur des Bottes du Bowisse.', 50, 5, '');
INSERT INTO `website_shop_objects_templates` VALUES (379, 47, 'Pince du Crabe', 'Cette pince de taille démesurée est presque creuse, elle permet juste au Crabe d\'épater la galerie et de se faire passer pour un boss. Elle est en revanche réputée incassable.', 51, 4, '');
INSERT INTO `website_shop_objects_templates` VALUES (380, 36, 'Feuille de Menthe Sauvage', 'C\'est l\'aliment de base de la Gelée Verte, si vous sentez une odeur de menthe, n\'en déduisez donc pas obligatoirement qu\'il y a de la menthe près de vous.', 52, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (381, 46, 'Fraise', 'C\'est l\'aliment de base de la Gelée à la fraise, si vous sentez une odeur de fraise, vous êtes peut-être sur son territoire de chasse.', 53, 28, '');
INSERT INTO `website_shop_objects_templates` VALUES (382, 47, 'Ongle de Chevaucheur de Karne', 'Cet ongle sale et usé a traîné n\'importe où, mais surtout dans des endroits peu recommandables. Il est donc préférable de ne pas à votre tour le mettre n\'importe où et encore moins dans des endroits peu recommandables.', 54, 16, '');
INSERT INTO `website_shop_objects_templates` VALUES (383, 47, 'Corne de Bouftou', 'Les Cornes de Bouftou sont luisantes et douces comme du cuir, pour des raisons inconnues, les Osamodas les affectionnent particulièrement.', 55, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (384, 57, 'Laine de Bouftou', 'Cette laine épaisse sent le Bwork qui se néglige, elle est cependant très chaude et surtout, elle ne démange pas les peaux sensibles, ce que les Eniripsa ne manquent pas d\'apprécier pour leurs sous-vêtements.', 56, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (385, 15, 'Bave de Bouftou', 'Cette bave purulente tire son odeur du fait que le Bouftou passe son temps à se lécher la laine, ce qui est également à l\'origine de l\'haleine exécrable du Bouftou.', 57, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (386, 15, 'Groin du Sanglier', 'Ce groin est un ustensile de choix pour débusquer les plus gros glands qui traînent dans les sous-bois. Contrairement au groin du Dragon Cochon, celui-ci est immangeable du fait de son odeur répugnante.', 58, 14, '');
INSERT INTO `website_shop_objects_templates` VALUES (387, 47, 'Défense du Sanglier', 'Cette défense permet au Sanglier de se défendre et accessoirement de curer son groin débusqueur de glands. N\'oubliez donc pas de les nettoyer à l\'eau vive avant d\'en faire de la poudre.', 59, 14, '');
INSERT INTO `website_shop_objects_templates` VALUES (388, 54, 'Poils du Sanglier', 'Ces poils particulièrement résistants sont utilisés entre autres pour la confection de pinceaux et de balais. Certaines personnes subissent d\'importantes allergies au contact de ces poils, il est donc recommandé de ne pas s\'y frotter avec vigueur.', 60, 14, '');
INSERT INTO `website_shop_objects_templates` VALUES (389, 60, 'Huile de Tournesol Sauvage', 'Cette huile est fortement recommandée par les diététiciens en raison de la forte proportion d\'acides gras essentiels qu\'elle contient. De plus, son contenu élevé en gras polyinsaturé et faible en gras saturé en fait un choix judicieux.', 61, 12, '');
INSERT INTO `website_shop_objects_templates` VALUES (390, 60, 'Huile de Noix', 'Huile au goût très fruité, utilisée en pâtisserie pour parfumer certains gâteaux. Cette huile faible en gras saturé se conserve peu de temps, même dans une bouteille qui n\'a pas été ouverte.', 62, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (391, 58, 'Noix de Cajou', 'Cette Noix de Cajou permet de faire de l\'huile si elle est récoltée encore verte. Une fois séchée, elle peut toujours servir de jouet pour les enfants de Iop un peu simplets.', 63, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (392, 58, 'Noix de Pécan', 'Cette Noix de Pécan permet de faire de l\'huile, mais il est préférable de la consommer séchée au regard des effets laxatifs de son huile.', 64, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (393, 58, 'Gland', 'Les sangliers adorent les glands, et tout le monde ou presque se demande bien pourquoi.', 65, 14, '');
INSERT INTO `website_shop_objects_templates` VALUES (394, 58, 'Noisette', 'Cette petite Noisette est délicieuse lorsqu\'elle est associée à une barre chocolatée. Dommage que le chocolat n\'existe pas à Amakna.', 66, 14, '');
INSERT INTO `website_shop_objects_templates` VALUES (395, 36, 'Trèfle à 5 feuilles', 'Ce trèfle constitue un élément essentiel de la nourriture des Tabis. Les éleveurs font tout de même attention dans la mesure où le Trèfle à 5 feuilles provoque des ballonnements chez les tabis.', 67, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (396, 60, 'Huile de Palme', 'De goût et parfum légers, cette huile convient bien pour tous les usages, de la friture à la préparation de vinaigrettes.', 68, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (397, 60, 'Huile de Koode', 'Cette huile très rare est un vrai élixir. Elle est si lubrifiante qu\'elle permet aux rouages et aux engrenages de ne jamais s\'user. Elle est issue d\'un savant mélange de diverses huiles.', 69, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (398, 46, 'Fruit de Palme', 'Ce fruit étrange permet d\'obtenir une huile raffinée une fois pressé. Dommage que ce fruit soit presque impressable à cause de sa coquille aussi dure que la semelle des bottes du Bowisse.', 81, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (399, 60, 'Huile de Sésame', 'Cette huile extraite des grains de sésame se distingue par son goût riche et délicat de noisettes grillées. Dommage que son odeur se rapproche plus de celle du Bouftou grillé que de la feuille de menthe sauvage.', 71, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (400, 34, 'Orge', 'L\'orge est une céréale utilisée pour la bière mais aussi pour le bétail et parfois pour les bétails buveurs de bière.', 82, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (401, 34, 'Houblon', 'La fleur du plant femelle de Houblon renferme les principes actifs utiles au brasseur, notamment les résines amères et les huiles essentielles. \"Cela me rappelle mes cours de Biologie, sauf que je n\'ai jamais suivi de cours de Biologie\". Tels étaient les mots de Gabrielle Naye à la vue de cette description, il faut bien l\'avouer légèrement romancée.', 80, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (405, 34, 'Malt', 'C\'est le nom donné à l\'Orge germée. C\'est un ingrédient de choix pour les bières de qualité. Attention cependant, le malt est vicieux et a tendance à absorber la bière lors de sa germination, un peu comme le Tot après une dure journée de chasse aux Tofus.', 83, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (406, 15, 'Estomac de Wo Wabbit', 'Cet estomac a la faculté de se dilater très facilement, ce qui simplifie grandement les digestions difficiles du Wo Wabbit qui a tendance à abuser des liqueurs de Cawottes fermentées.', 146, 39, '');
INSERT INTO `website_shop_objects_templates` VALUES (407, 47, 'Pic du Prespic', 'Pour se curer les dents ou se créer une nouvelle pointe de flèche, rien de mieux que le Pic du Prespic.', 134, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (408, 47, 'Dentier du Chafer d\'élite', 'Le Chafer d\'élite a les dents moisies par l\'alcool, c\'est pour cela qu\'il utilise un dentier. Ce dentier coûte une fortune car ses dents sont en or et l\'haleine fétide du Chafer d\'élite a doté ses dents de pouvoirs imprévisibles.', 129, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (409, 54, 'Poils de Barbe du Bwork Mage', 'Ces poils roux sentent très mauvais lorsqu\'il pleut, pour des raisons assez obscures. Cependant, les Bworks Mages semblent tirer une partie de leurs pouvoirs magiques de ces poils de barbe, ce qui pourrait intéresser certains alchimistes.', 131, 23, '');
INSERT INTO `website_shop_objects_templates` VALUES (410, 25, 'Livre du Bwork Mage', 'Ce livre est une vraie pièce de collection, c\'est de là que le Bwork Mage puise toute son inspiration et sa vigueur. Chaque page de ce livre recèle de nombreux secrets quant à l\'anatomie de certaines créatures d\'Amakna.', 130, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (411, 47, 'Bec du Kwak de Glace', 'Ce bec extraordinairement solide permet au Kwak de Glace de faire des trous dans la glace, juste pour le plaisir de faire des trous dans la glace. Les kwaks de Glace sont décidément bien étranges...', 133, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (412, 47, 'Bec du Kwak de Flamme', 'Ce bec extraordinairement solide permet au Kwak de Flamme d\'éteindre des braises entre son bec, juste pour le plaisir d\'éteindre des braises entre son bec. Les kwaks de Flamme sont décidément bien étranges...', 132, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (413, 47, 'Bec du Kwak du Vent', 'Ce bec extraordinairement solide permet au Kwak du Vent de se prendre des vents sans broncher, juste pour le plaisir de se prendre des vents sans broncher. Les kwaks du vent sont décidément bien étranges...', 110, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (414, 53, 'Plume du Kwak de Glace', 'Cette plume a la particularité de résister au givre. C\'est pour cela qu\'on ne rencontre jamais de Kwak de Glace givré.', 112, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (415, 53, 'Plume du Kwak de Flamme', 'Cette plume a la particularité de résister aux flammes. C\'est pour cela qu\'on ne rencontre jamais de Kwak de Flamme enflammés.', 111, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (416, 53, 'Plume du Kwak de Vent', 'Cette plume a la particularité de résister aux bourrasques de vent. C\'est pour cela que le Kwak de Vent peut encaisser de multiples vents jour après jour sans jamais voir son moral ni son ardeur affaiblis.', 113, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (417, 15, 'Boue du Boo', 'La Boo est très agressive, elle est constituée de morceaux de boue mis bout à bout, le seul moyen d\'en venir à bout c\'est de la dessécher, mais elle est tellement humide que vous n\'êtes pas près d\'en voir le bout.', 116, 17, '');
INSERT INTO `website_shop_objects_templates` VALUES (418, 54, 'Poils de Barbe du Grand Pa Wabbit', 'Le Grand Pa Wabbit possède une barbe postiche qui sent très mauvais, un peu comme le Père Nowel, mais en pire. A force de baver sans cesse devant les Grand Ma Wabbit, ses poils de barbe ont fini par s\'imprégner de sa bave aux pouvoirs méconnus.', 114, 39, '');
INSERT INTO `website_shop_objects_templates` VALUES (419, 106, 'Oreille du Grand Pa Wabbit', 'Les oreilles du Grand Pa Wabbit sont pointues et rigides, mais sont recouvertes d\'une épaisse fourrure zébrée du plus bel effet. C\'est sans conteste une des fourrures les plus recherchées, ne serait-ce que parce qu\'elle ne sent absolument rien.', 115, 39, '');
INSERT INTO `website_shop_objects_templates` VALUES (420, 15, 'Ficelle en Lin', 'La ficelle de lin est très solide, elle permet de faire de jolies coutures bien solides ou alors de ligoter ses amis pour leur montrer qui est réellement le chef de la guilde.', 118, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (421, 35, 'Fleur de Lin', 'La Fleur de Lin peut être bleue ou blanche, suivant la période de l\'année à laquelle la graine a été semée. En décoction ou en infusion, elle procure une sensation de bien-être peu commune.', 117, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (422, 58, 'Graine de Lin', 'Cette toute petite graine contient énormément de bonnes choses. Les chasseurs de Kwaks savent que ces derniers en sont friands et n\'hésitent pas à les attirer dans leurs pièges avec ces graines luisantes.', 119, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (423, 34, 'Lin', 'La tige de Lin n\'a rien de spécial, si ce n\'est qu\'elle est capable de se redresser 7 fois après avoir été pliée par les tempêtes. C\'est sûrement pour cela que sa fibre est si souple.', 122, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (424, 55, 'Fibre de Lin', 'C\'est la fibre idéale pour confectionner les plus belles étoffes, elle est rare et chère mais tellement supérieure aux fibres classiques qu\'aucun tisserand ne pourrait s\'en passer.', 120, 46, '');
INSERT INTO `website_shop_objects_templates` VALUES (425, 34, 'Chanvre', 'La Tige de Chanvre peut être utilisée lors de la recherche d\'effets hallucinogènes, mais également par les tisserands qui exploitent leurs fibres pour des raisons toutes autres.', 121, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (426, 55, 'Fibre de Chanvre', 'Cette fibre n\'est pas très belle, mais elle est particulièrement résistante. De plus, dans des moments d\'introspection sur soi-même, il est toujours possible de la fumer.', 123, 46, '');
INSERT INTO `website_shop_objects_templates` VALUES (427, 58, 'Graine de Chanvre', 'La Graine de Chanvre est très utilisée pour calmer les troupeaux de Tabis en rut, il suffit de leur en administrer quelques-unes et ces derniers deviennent soudainement moins farouches.', 157, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (428, 35, 'Fleur de Chanvre', 'Cette fleur permet de faire des potions aux effets aléatoires, qui peuvent aller de la paralysie totale à l\'invulnérabilité aux gaz de Wabbits.', 156, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (429, 15, 'Pointe de Flèche du Bwork Archer', 'Cette pointe de flèche rouillée est faite à partir d\'un métal rare, qu\'on ne trouve que sur ces pointes de flèche.', 125, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (430, 47, 'Os Invisible du Chafer Invisible', 'Cet os est invisible, grâce aux propriétés magiques qui lui ont été conférées. Il doit sûrement pouvoir être utilisé pour des potions magiques...', 126, 23, '');
INSERT INTO `website_shop_objects_templates` VALUES (431, 51, 'Pierre du Craqueleur', 'Cette pierre est presque vivante, elle tire sa vie des pierres précieuses qu\'elle renferme. Elle est quasiment incassable, sauf par un Craqueleur. Il n\'y a pas mieux pour se faire un bon gros marteau en pierre.', 127, 31, '');
INSERT INTO `website_shop_objects_templates` VALUES (432, 47, 'Côtes du Rib', 'Les côtes du Rib sont vraiment très bonnes une fois grillées, il n\'y a pas beaucoup à manger autour, mais c\'est tellement fin, que ça se mange sans fin.', 158, 33, '');
INSERT INTO `website_shop_objects_templates` VALUES (433, 47, 'Fémur du Chafer Archer', 'Voilà un os bien étrange, il est particulièrement friable, et dégage une odeur de curry éventé lorsqu\'il est brûlé, voilà qui pourrait bien arranger certains cuisiniers peu scrupuleux.', 101, 34, '');
INSERT INTO `website_shop_objects_templates` VALUES (434, 96, 'Ecorce d\'Abraknyde', 'Ce morceau d\'écorce est rugueux, crevassé, recouvert de petites aspérités et sent étrangement bon, un peu comme la peau des pieds d\'un Enutrof.', 103, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (435, 98, 'Racine d\'Abraknyde', 'Ce morceau de racine a connu divers substrats à force d\'accompagner l\'Abraknyde lors de promenades dans les sous-bois. Mais ça n\'explique pas pourquoi ce morceau de racine est magique.', 102, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (436, 4, 'Bâton en Racine d\'Abraknyde', 'Ce bâton taillé dans une grosse racine d\'Abraknyde est très efficace au corps à corps, attention à ne pas le laisser au contact de l\'eau, il pourrait reprendre racines et se retourner contre son maître.', 1, 30, '64#2#4#0#1d3+1,73#3#0#0#0d0+3,7b#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (437, 108, 'Bourgeon d\'Abraknyde', 'Lors de la puberté, les Abraknydes se recouvrent de vilains bourgeons gorgés de sève juteuse riche en vitamines. Plus tard, ces bourgeons donnent naissance à de nouvelles pousses qui elles-mêmes donneront naissance à des bourgeons.', 104, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (438, 65, 'Queue du Mulou', 'La queue du Mulou ressemble à s\'y méprendre à une énorme bûche velue, et pourtant, il n\'en est rien, ne vous méprenez pas.', 105, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (439, 47, 'Canine du Mulou', 'Cette canine tranchante est surtout recherchée en tant que porte bonheur, pourtant, elle n\'apporte à son porteur que des mauvaises odeurs.', 106, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (440, 15, 'Griffe du Mulou', 'Cette griffe bien sale permet de faire des armes redoutables.', 107, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (441, 39, 'Cuivre', 'Le Cuivre est un métal très utile pour confectionner les armes bon marché, c\'est presque un ersatz de l\'or si on fait abstraction de toutes les qualités de l\'or.', 108, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (442, 39, 'Bronze', 'Ce métal entre souvent dans la fabrication d\'articles ornementaux, pour embellir vos armes à moindre frais, c\'est le métal idéal.', 109, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (443, 39, 'Kobalte', 'Le nom « Kobalte » signifie « cuivre du diable » en Sadida ancien, c\'est un métal adapté à la forge d\'armes légères et élégantes, mais avant tout mortelles.', 77, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (444, 39, 'Etain', 'L\'Etain est un métal mou et lourd, un peu comme le Wo Wabbit, mais en pire.', 78, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (445, 39, 'Manganèse', 'Contrairement à ce que tout le monde pense, ce métal ne sert pas à faire des gouttières, mais plutôt à faire des armes terrifiantes, comme le redoutable \"Tranchant Manganésien\" qui a estourbi plus d\'un Tofu lors des fêtes du Boulgour.', 397, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (446, 39, 'Bauxite', 'Ce métal est très apprécié pour sa couleur argentée et pour son tranchant lorsqu\'il est correctement aiguisé.', 76, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (447, 39, 'Charbon', 'Le Charbon ne dispose d\'aucune propriété magique particulière, contrairement à ce que l\'on pourrait croire. Cependant, il a une fâcheuse tendance à attirer la foudre, à la contenir, et à la libérer au mauvais moment.', 75, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (448, 51, 'Silex', 'Ce caillou est particulièrement tranchant, il a égorgé plus d\'une taupe imprudente.', 74, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (449, 38, 'Bois d\'Ebène', 'Ce bois tient son nom d\'un malentendu, il y a bien longtemps, la seule famille de Bûcherons qui savait où se trouvaient ces arbres, s\'appelait Baine, et partout, on parlait du \"Bois des Baine\", à force d\'écrire n\'importe comment voici ce qui arrive.', 73, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (450, 51, 'Pierre de Granit', 'Ce minéral est presque inusable, mais aussi très lourd, ce qui limite son utilisation dans la forge d\'armes. En le travaillant longtemps, on peut parfois en extraire des pierres précieuses.', 1, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (454, 19, 'Hache de Bûcheron', 'Cette hache est indispensable au bûcheron s\'il veut correctement exercer son métier. Le cas échéant, elle peut également lui permettre de se débarrasser de quelques monstres...', 1, 1, '64#2#4#0#1d3+1');
INSERT INTO `website_shop_objects_templates` VALUES (455, 7, 'Marteau de l\'Aurore', 'Ce ridicule petit marteau servait à Zokrim le paysan, qui s\'en servait pour planter ses piquets de clôtures à l\'aurore. Personne ne sait pourquoi Zokrim plantait ses piquets à l\'aurore, mais la légende raconte qu\'il avait de bonnes raisons.', 2, 26, '64#3#7#0#1d5+2,76#a#0#0#0d0+10,7b#a#0#0#0d0+10,7d#a#0#0#0d0+10,9a#f#0#0#0d0+15');
INSERT INTO `website_shop_objects_templates` VALUES (456, 19, 'Tueuse de Chênes', 'Cette hache permet de couper facilement les arbres, même les plus gros. Elle est surtout appréciée pour son poids important qui lui permet de couper un Bwork en trois facilement, pour peu que son porteur soit capable de la soulever.', 2, 33, '64#b#f#0#1d5+10,76#1a#23#0#1d10+25,77#1a#23#0#1d10+25,99#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (458, 1, 'Amulette du Chafer', 'Le Chafer est quelqu\'un de sensible et distingué, il garde toujours avec lui une amulette faite des crânes de ses cousins tombés au combat. Le plus étrange, c\'est que le Chafer n\'a jamais eu de cousins.', 3, 19, '73#1#0#0#0d0+1,7b#4#0#0#0d0+4,7c#4#0#0#0d0+4');
INSERT INTO `website_shop_objects_templates` VALUES (459, 95, 'Planche en Frêne', 'Cette planche en Frêne permet aux bricoleurs de construire des trucs en bois, comme un cercueil en planches par exemple.', 93, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (460, 38, 'Bois de Chêne', 'Ce bois d\'excellente qualité est particulièrement résistant, il permet de faire presque tout, des gourdins, des maisons ou encore des bateaux, mais la meilleure façon d\'utiliser ce bois reste d\'en faire des fûts à bière (Hips !).', 92, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (461, 38, 'Bois d\'If', 'Ce bois particulièrement souple ne casse jamais, ce qui en fait un bois de choix pour la réalisation d\'arcs. Il est en revanche difficile à trouver, les paysans d\'Amakna ayant tendance à tuer les jeunes pousses d\'If qui rendent malades leurs Bouftous.', 94, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (462, 2, 'Arc en Racine d\'Abraknyde', 'Le bois d\'Abraknyde étant toujours vivant une fois coupé, cet arc est très difficile à utiliser. Cependant, il n\'y a pas mieux pour ridiculiser un Abraknyde, que de le tuer avec un arc issu des racines de ses propres frères.', 1, 28, '64#3#7#0#1d5+2,6f#1#0#0#0d0+1,7c#f#0#0#0d0+15,99#42#0#0#0d0+66');
INSERT INTO `website_shop_objects_templates` VALUES (463, 50, 'Ambre', 'Cette magnifique pierre précieuse est constituée de résine d\'arbre fossilisée. On y trouve parfois à l\'intérieur, un petit Moskito pris au piège il y a des lustres, ce qui ne manque pas de rajouter de la valeur à cette pierre.', 96, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (464, 50, 'Ambre d\'Abraknyde', 'Cette magnifique pierre précieuse est constituée de résine d\'Abraknyde fossilisée. On y trouve parfois à l\'intérieur, une Arakne prise au piège il y a des lustres dans la sève de son Maître. Voilà une mort bien méritée pour ce genre de Monstre.', 97, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (465, 50, 'Cristal', 'Le Cristal est une pierre translucide, mais très cassante. Et oui, même chez les pierres précieuses, rien n\'est parfait.', 98, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (466, 50, 'Saphir', 'Cette pierre précieuse toute bleue est bien adaptée à la fabrication d\'armes aux effets magiques, peut-être parce que les créateurs de jeu en mal d\'inspiration utilisent toujours le bleu pour représenter le mana.', 99, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (467, 50, 'Rubis', 'Cette pierre précieuse aux couleurs rougeoyantes comme les plumes du Kwak de Flammes est froide au toucher comme les plumes du Kwak de Glace.', 100, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (468, 33, 'Pain d\'Amakna', 'Ce petit pain tout chaud à la mie bien molle et à la croûte dorée permet de regagner des points de vie perdus au combat. C\'est le pain le plus populaire, car généralement le moins cher.', 13, 1, '6e#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (469, 3, 'Baguette en Racine d\'Abraknyde', 'Cette baguette utilise les propriétés magiques de la Racine d\'Abraknyde qui est encore vivante, méfiez-vous des effets néfastes de cette baguette, il lui arrive parfois de se retourner contre son maître.', 3, 33, '64#10#14#0#1d5+15,7c#1e#0#0#0d0+30,98#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (470, 38, 'Bois d\'Orme', 'Le Bois d\'Orme est un des bois les plus recherchés, courant autrefois, il a été décimé il y a des lustres par la Grafioze, une sorte d\'envoûtement terrible lancé par un Puissant Bwork Mage des Cavernes de la pire espèce.', 140, 90, '');
INSERT INTO `website_shop_objects_templates` VALUES (471, 38, 'Bois d\'Erable', 'Les feuilles d\'Erable ont permis à des gens peu inspirés de se faire un drapeau original, le sirop d\'Erable a permis de donner du goût aux crêpes. Quant à son bois, on cherche encore à quoi il peut bien servir.', 153, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (472, 38, 'Bois de Charme', 'Le Bois de Charme doit son nom aux Sadidas, qui s\'accouplent toujours sous les Charmes, pour des raisons qui ne sont révélées que dans le livre du Bwork Mage.', 138, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (473, 38, 'Bois de Châtaignier', 'L\'odeur du Bois de Châtaignier repousse les mouches, sauf celles qui aiment les châtaignes et celles qui ont perdu l\'odorat, ce qui explique pourquoi l\'odeur du bois de Châtaignier ne repousse en fait aucune mouche.', 86, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (474, 38, 'Bois de Merisier', 'Ce bois est recherché en ébénisterie du fait de sa texture compacte et de sa couleur brun rougeâtre qu\'il acquiert avec le temps.', 139, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (476, 38, 'Bois de Noyer', 'Le Bois de Noyer est très utilisé pour confectionner des meubles. Pour des raisons obscures, certains charpentiers se refusent à l\'utiliser pour leurs bateaux.', 95, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (477, 15, 'Sang de Dragon Cochon', 'Cette fiole est remplie d\'un sang qui conférait au Dragon Cochon des pouvoirs diaboliques. A consommer avec modération, ou a faire cuire si vous aimez le boudin noir de Dragon Cochon.', 544, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (478, 19, 'Elagueuse de Charme', 'Cette hache doit son nom à Woodee la Bûcheronne, qui savait user de ses charmes pour détourner l\'attention des autres Bûcherons et ainsi garder secret l\'emplacement des rares Charmes dont elle voulait préserver l\'existence.', 3, 47, '64#10#14#0#1d5+15,7b#1a#23#0#1d10+25,7c#14#0#0#0d0+20,7e#1a#23#0#1d10+25,9d#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (479, 47, 'Ivoire', 'L\'Ivoire est très recherché par les collectionneurs, pour sa blancheur légendaire, et par les Forgerons, pour sa capacité à rendre les armes mortelles. Ce qui est certain, c\'est que dans la région d\'Amakna, l\'Ivoire a vraiment la côte.', 88, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (480, 39, 'Minerai Etrange', 'Ce Minerai a été extrait d\'une mystérieuse carrière inconnue. Contrairement à tous les objets étranges d\'Amakna, celui-ci n\'est pas magique du tout.', 90, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (481, 47, 'Crâne du Dragon Cochon', 'Malgrès sa faible contenance, ce crâne est une vraie pièce de collection, sa relative ressemblance avec un crâne de Iop, a permis à de nombreux étudiants en médecine d\'expliquer l\'origine des faiblesses intellectuelles de certains Iop.', 91, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (482, 8, 'Pelle Teuze', 'Après une soirée un peu trop arrosée à la taverne qui a débouché sur une bagarre, un Enutrof s\'est aperçu que cette pelle conçue à l\'origine pour les grands travaux de construction était une excellente arme.', 8, 27, '64#c#10#0#1d5+11,73#1#0#0#0d0+1,76#14#0#0#0d0+20,99#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (483, 8, 'Grande Pelle Teuze', 'Après une soirée un peu trop arrosée à la taverne qui a débouché sur une bagarre, un Enutrof s\'est aperçu que cette pelle conçue à l\'origine pour les grands travaux de construction était une excellente arme.', 8, 29, '64#d#11#0#1d5+12,73#1#0#0#0d0+1,76#19#0#0#0d0+25,99#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (484, 8, 'Puissante Pelle Teuze', 'Après une soirée un peu trop arrosée à la taverne qui a débouché sur une bagarre, un Enutrof s\'est aperçu que cette pelle conçue à l\'origine pour les grands travaux de construction était une excellente arme.', 8, 31, '64#e#12#0#1d5+13,73#1#0#0#0d0+1,76#1e#0#0#0d0+30,99#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (485, 56, 'Slip en cuir du Chafer Lancier', 'Lorsque vient l\'hiver, le Chafer Lancier ne sort jamais sans son slip en cuir, qui lui permet de garder ses articulations bien au chaud ou de distraire ses adversaires le cas échéant.', 152, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (486, 56, 'Cuir de Sanglier', 'Ce cuir est particulièrement résistant, mais sent le sanglier mâle en rût, ce qui explique pourquoi les paysans locaux s\'en servent pour piéger les femelles sangliers, qui sont trop stupides pour déjouer un stratagème si fourbe.', 16, 14, '');
INSERT INTO `website_shop_objects_templates` VALUES (487, 56, 'Cuir du Dragon Cochon', 'A force de se prendre pour un Dragon, le Dragon Cochon s\'est brûlé les poils de la couenne, ce qui explique en partie l\'odeur de cochon grillé que dégage ce cuir.', 142, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (489, 20, 'Loupe', 'La loupe permet d\'examiner avec attention les éléments du décor pour y déceler des trésors.', 3, 1, '64#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (490, 20, 'Fiole', 'Cette fiole, vitale à tout alchimiste qui se respecte, permet de réaliser les meilleures potions.', 2, 1, '64#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (491, 5, 'Sertisseur', 'Cet objet permet au Bijoutier de travailler ses joailleries.', 16, 1, '64#2#4#0#1d3+1,ae#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (492, 20, 'Le Pétrisseur', 'Outil indispensable si vous voulez exercer le métier de boulanger-pâtissier.', 1, 1, '64#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (493, 7, 'Marteau de Forgeur de Marteaux', 'Outil indispensable à la création de marteaux.', 2, 1, '64#2#4#0#1d3+1,ae#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (494, 7, 'Marteau de Forgeur d\'Epées', 'Outil indispensable à la création d\'épées.', 2, 1, 'ae#a#0#0#0d0+10,64#2#4#0#1d3+1');
INSERT INTO `website_shop_objects_templates` VALUES (495, 7, 'Marteau de Forgeur de Dagues', 'Outil indispensable à la création de dagues.', 2, 1, '64#2#4#0#1d3+1,ae#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (496, 7, 'Marteau de Forgeur de Pelles', 'Outil indispensable à la création de pelles.', 2, 1, 'ae#a#0#0#0d0+10,64#2#4#0#1d3+1');
INSERT INTO `website_shop_objects_templates` VALUES (497, 21, 'Pioche du Mineur', 'Outil indispensable à la collecte des minerais.', 1, 1, '64#2#4#0#1d3+1');
INSERT INTO `website_shop_objects_templates` VALUES (498, 5, 'Tailladeuse de Bâton', 'Outil indispensable à la création des bâtons.', 17, 1, '64#2#4#0#1d3+1,ae#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (499, 5, 'Tailladeuse de Baguette', 'Outil indispensable à la création des baguettes.', 17, 1, 'ae#a#0#0#0d0+10,64#2#4#0#1d3+1');
INSERT INTO `website_shop_objects_templates` VALUES (500, 5, 'Tailladeuse d\'Arc', 'Outil indispensable à la création des arcs.', 17, 1, '64#2#4#0#1d3+1,ae#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (501, 15, 'Sève d\'Abraknyde Retravaillée', 'Cette sève sirupeuse a été retravaillée par un Alchimiste de renom, pour lui permettre de redonner vie aux Racines d\'Abraknydes. De toute évidence, ce genre de sève ne doit être manipulée que par des mains expertes.', 162, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (502, 19, 'Trancheuse d\'If', 'Cette hache est une des seules à pouvoir couper des arbres envoûtés, on peut donc par extension, affirmer qu\'elle peut trancher tout ce qui est envoûté, vivant ou non.', 4, 17, '64#b#f#0#1d5+10,7e#23#0#0#0d0+35,99#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (515, 19, 'Boulgourde des Clairières', 'Cette hache a appartenu à Brouce Boulgoure le fameux Bûcheron, marié jadis avec Kassiopée Baine, fille d\'un autre grand Bûcheron. Cette arme lui permit de se défendre maintes fois lorsqu\'il partait la nuit couper des forêts entières.', 5, 62, '64#1f#2d#0#1d15+30,73#5#0#0#0d0+5,7b#1e#0#0#0d0+30,7d#14#0#0#0d0+20,7e#1e#0#0#0d0+30,9a#1e#0#0#0d0+30');
INSERT INTO `website_shop_objects_templates` VALUES (519, 48, 'Poudre de Perlinpainpain', 'Comme son nom l\'indique cette poudre est faite à partir de graines de Lin et de Pain. Mais ça n\'explique pas pourquoi cette poudre est magique.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (520, 33, 'Pain aux Graines de Pavot', 'La confection de ce pain est délicate, car les boulangers qui en respirent les fumées lors de la cuisson, sont victimes de symptômes étranges et se mettent à danser autour de leur boulangerie.', 10, 20, '6e#33#64#0#1d50+50');
INSERT INTO `website_shop_objects_templates` VALUES (521, 33, 'Pain aux Graines de Sésame', 'Les Kwaks les plus audacieux n\'hésitent pas à se déguiser en boulanger pour subtiliser les Graines de Sésame, mais cette supercherie ne fonctionne jamais sauf chez les Iop Boulangers.', 11, 20, '6e#1e#0#0#0d0+30');
INSERT INTO `website_shop_objects_templates` VALUES (522, 33, 'Pain aux Graines de Lin', 'Ce pain est riche en protéines, mais pauvre en goût. Et oui, la vie est toujours une question de choix.', 12, 20, '6e#28#0#0#0d0+40');
INSERT INTO `website_shop_objects_templates` VALUES (524, 33, 'Pain aux Noisettes', 'Ce pain au goût subtil est garanti sans colorants, ni conservateurs, tout le contraire de la Gelée Royale.', 12, 20, '6e#2d#0#0#0d0+45');
INSERT INTO `website_shop_objects_templates` VALUES (526, 33, 'Pain aux Céréales', 'Ce pain composé d\'une variété de céréales sans précédent, est suffisamment riche en protéines pour rendre la vie à un Chafer.', 6, 60, '6e#64#0#0#0d0+100');
INSERT INTO `website_shop_objects_templates` VALUES (527, 33, 'Pain aux Noix', 'Ce pain est cuit avec du bois de Noyer et les noix sont grillées avant d\'être fourrées dans la mie.', 8, 40, '6e#32#0#0#0d0+50');
INSERT INTO `website_shop_objects_templates` VALUES (528, 33, 'Pain au Blé Complet', 'Ce pain est enrichi en blé complet, ce qui en fait un pain de qualité pour les gens exigeants.', 7, 20, '6e#32#0#0#0d0+50');
INSERT INTO `website_shop_objects_templates` VALUES (529, 52, 'Farine d\'Orge', 'Cette farine s\'obtient au moulin, en écrasant des grains d\'orge, elle permet de donner une légèreté à la mie de pain qui n\'a pas d\'équivalent, à moins, bien entendu, de faire emploi d\'une magie occulte lors de la cuisson de vos pains.', 256, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (530, 52, 'Farine de Seigle', 'Cette farine hérite de tous les bienfaits du Seigle. Selon la légende, le Seigle qui germe à l\'aurore, ne mûrit jamais. Par extension, certains paysans font leur enfants à l\'aurore en espérant qu\'ils ne vieillissent jamais.', 257, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (531, 52, 'Farine d\'Avoine', 'Cette farine ne lève pas à la cuisson, ce qui permet de faire des pains vraiment denses, particulièrement utiles lorsqu\'il faut distribuer des pains aux monstres.', 250, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (532, 34, 'Seigle', 'Cette céréale sombre a la faculté de pousser dans des conditions difficiles, c\'est une des rares céréales à subsister après de fortes sécheresses.', 82, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (533, 34, 'Avoine', 'Cette céréale est utilisée pour nourrir les jeunes Tabis, lorsqu\'ils n\'ont pas encore les dents assez solides pour ruminer. Les paysans font tout de même attention dans la mesure où l\'avoine cause parfois des crises d\'aérophagie chez le bétail sensible.', 154, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (534, 52, 'Farine de Malt', 'Cette farine blanche est obtenue en écrasant des grains d\'Orge germés, ce qui donne un goût parfois acidulé au pain, et dans le meilleur des cas, un goût de bière éventée, utile pour les sevrages progressifs des amateurs de bière. Une fois cuite, cette farine permet en effet de mieux supporter les cuites.', 255, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (535, 52, 'Farine de Houblon', 'Cette farine permet de donner un délicieux goût de bière au pain, sans avoir à utiliser de la bière pour faire son pain. Il faut parfois reconnaître que la nature est bien faite.', 253, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (536, 33, 'Pain aux Flocons d\'Avoine', 'Ce pain à la mie particulièrement légère est parfait pour les personnes qui n\'ont pas été gâtées par Mère Nature, et qui n\'ont qu\'un tout petit estomac.', 5, 10, '6e#1e#0#0#0d0+30');
INSERT INTO `website_shop_objects_templates` VALUES (537, 68, 'Pomme de Terre', 'De manière générale, lorsque vous tombez sur cet objet, c\'est que vous êtes soit au milieu d\'un champ, soit au fond d\'un cachot.', 135, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (538, 68, 'Pommes de Terre épluchées', 'Cette Pomme de terre est dépourvue de sa pelure, ce qui en fait une denrée commestible.', 136, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (539, 33, 'Pain de Seigle', 'Ce pain est fait à partir de farine de Seigle, ce qui lui donne à la mie, une couleur brune particulière, mais surtout un léger goût sucré.', 9, 20, '6e#32#0#0#0d0+50');
INSERT INTO `website_shop_objects_templates` VALUES (543, 51, 'Pierre de Diamant', 'Correctement polie, cette pierre peut donner un magnifique Diamant.', 144, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (544, 51, 'Pierre d\'Emeraude', 'Correctement polie, cette pierre peut donner une magnifique Emeraude.', 145, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (545, 51, 'Pierre de Cristal', 'Correctement polie, cette pierre peut donner un magnifique Cristal.', 141, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (546, 51, 'Pierre de Saphir', 'Correctement polie, cette pierre peut donner un magnifique Saphir', 151, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (547, 51, 'Pierre de Rubis', 'Correctement polie, cette pierre peut donner un magnifique Rubis.', 150, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (548, 12, 'Potion de Rappel', 'Cette potion permet de revenir au dernier point de sauvegarde.', 17, 1, '258#0#0#1#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (577, 22, 'Faux du Paysan', 'Cette faux n\'est pas très aiguisée et surtout un peu rouillée, ce qui en fait une arme peu dangereuse. En revanche, pour faucher, c\'est l\'outil idéal.', 1, 1, '64#2#4#0#1d3+1');
INSERT INTO `website_shop_objects_templates` VALUES (578, 51, 'Pierre à Aiguiser', 'Je ne vous jette pas la pierre Pierre !', 127, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (579, 5, 'Coupe Cuir', 'Outil indispensable à la création de chaussures et de ceintures.', 18, 1, '64#2#4#0#1d3+1,ae#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (580, 12, 'Potion Ghetto Raide', 'Cette potion permet de retrouver quelques points d\'énergie.', 18, 10, '8b#65#c8#0#1d100+100');
INSERT INTO `website_shop_objects_templates` VALUES (582, 52, 'Farine Blanche', 'Cette farine nécessite plusieurs céréales pour être obtenue, elle est cependant très appréciée pour sa qualité panifiable. Et pourtant au premier regard, rien ne la distingue d\'une farine classique.', 7, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (583, 52, 'Farine Bise', 'Cette farine mi-blanche tire son nom de son inventeur, une jolie paysanne qui aimait faire des bises, les joues pleines de farine. Quelle coquine.', 7, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (586, 52, 'Farine Paysanne', 'C\'est en affrontant la femme de Brouce Boulgoure à coups de sacs de farine, que Shika Ingalsse a eu l\'idée de créer cette farine devenue populaire. Les combats de femmes apportent parfois beaucoup plus que de la distraction pour la plèbe.', 258, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (587, 52, 'Farine Complète', 'Cette farine est issue d\'une multitude de céréales, ce qui en fait une farine particulièrement complète, très utile pour les pains complets.', 259, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (592, 2, 'Corde d\'Ivan Nowé ', 'Cet arc a appartenu à Ivan Nowé, un Crâ téméraire, qui a pourfendu plus d\'un Tofu égaré. Cet arc a la particularité de faire des coups pour le moins surprenants qui laissent perplexes puis agonisants les ennemis.', 1, 36, '64#4#8#0#1d5+3,76#a#0#0#0d0+10,7b#f#0#0#0d0+15,7e#f#0#0#0d0+15,99#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (593, 35, 'Orchidée Freyesque', 'Cette fleur est d\'une rareté et d\'une beauté inimaginable, mais elle est presque introuvable. En effet, les Crapauds ont tendance à les ramener dans leur campement pour nourrir leur progéniture.', 192, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (594, 35, 'Edelweiss', 'Cette fleur est d\'une rareté et d\'une beauté inimaginable, mais elle est presque introuvable. Pour cause, sa magie est si puissante qu\'elle serait capable de faire revivre certains morts.', 191, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (596, 20, 'Canne à Pêche Courte', 'Cette petite canne à pêche est idéale pour s\'amuser à pêcher les petits poissons dans les mares d\'eau.', 8, 1, '60#1#4#0#1d4+0');
INSERT INTO `website_shop_objects_templates` VALUES (597, 99, 'Filet simple de capture', 'Ce filet très résistant permet de capturer la plus sauvage des montures, à condition d\'avoir réussi à l\'hypnotiser ou à la distraire un peu avant.', 1, 1, '2c2#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (598, 41, 'Greu-Vette', 'Les Greu-Vettes sont appréciées pour leur couleur rose et leur goût raffiné. Elles sont cependant détestées pour leur mauvais caractère légendaire et leurs antennes gominées.', 292, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (600, 41, 'Kralamoure', 'Le Kralamoure est un grand romantique, ses yeux de petit Tofu lui donnent un air un peu niais, mais ne vous y méprenez pas, le Kralamoure est très agressif envers les étrangers.', 309, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (602, 41, 'Requin Marteau-Faucille', 'Ce Requin rouge est un requin militant, d\'instinct grégaire, l\'individu n\'existe pas au sein du groupe, même si leur chef, le Requin Stakanoviou est porté au rang d\'idole.', 322, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (603, 41, 'Poisson Chaton', 'Ce poisson a la particularité d\'avoir des moustaches et de ronronner sous l\'eau, ce qui ne manque pas de faire peur aux Poissons Volants.', 277, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (607, 41, 'Truite Vaseuse', 'La Truite Vaseuse est une cousine éloignée du Saumoon agressif de l\'île de Moon. Cette truite est aussi bonne cuite que crue, qui l\'eut cru ?', 395, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (610, 1, 'Amulette en Crabe', 'Cette amulette blanchâtre est confectionnée avec du Crabe, ce qui en fait une amulette très fragile mais originale.', 30, 24, '75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (616, 1, 'Amulette du Marin', 'Cette amulette, sertie d\'écailles de poisson, est censée porter chance à son propriétaire lorsqu\'il part en mer les jours de tempête.', 29, 22, '7b#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (617, 1, 'Amulette du Pirate', 'Cette amulette terrifiante a impressionné plus d\'un marin, la porter sur soi suffit à faire de vous une personne redoutée.', 20, 41, '73#2#0#0#0d0+2,76#10#19#0#1d10+15,7d#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (619, 4, 'Bâton du Maître des Bouftous', 'Ce bâton permettait à Farle Ingalsse, éleveur de Bouftous, d\'invoquer plus facilement des Tofus gardiens de troupeaux. Au fil du temps, ce bâton s\'est révélé être une excellente arme de combat.', 6, 85, '73#2#6#0#1d5+1,70#3#7#0#1d5+2,64#b#f#0#1d5+10,77#1f#32#0#1d20+30,9d#1#a#0#1d10+0,b6#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (620, 6, 'Découpeuse de Kralamoure', 'Cette épée a permis au célèbre marin Mobby Diqueriveurse, de découper en tranches, les tentacules du célèbre Kralamoure Géant de l\'île de Moon, réputé pour étouffer les marins saouls et saouler les marins étouffés.', 8, 61, '64#1f#2d#0#1d15+30,70#4#6#0#1d3+3,73#1#2#0#1d2+0,76#15#1e#0#1d10+20,9b#1#14#0#1d20+0');
INSERT INTO `website_shop_objects_templates` VALUES (629, 16, 'Chapeau Pointu', 'Ce magnifique chapeau permettra à votre héros d\'être la plus belle pour aller danser au bal masqué (hohé hohé).', 1, 21, '6e#15#23#0#1d15+20');
INSERT INTO `website_shop_objects_templates` VALUES (638, 1, 'Amulette du Pêcheur de Somoon', 'Pêcher un Somoon relève de l\'exploit, mais avec cette amulette sur soi, plus rien n\'est impossible.', 24, 35, '7b#c#29#0#1d30+11');
INSERT INTO `website_shop_objects_templates` VALUES (639, 1, 'Amulette des Abîmes', 'Cette amulette a été retrouvée dans l\'épave échouée du célèbre pêcheur de Kralamoure, Moby Diqueriveurse, qui était également populaire pour ses boutades vaseuses au bar des pirates.', 22, 47, '73#5#0#0#0d0+5,7b#14#0#0#0d0+20,7c#2#15#0#1d20+1');
INSERT INTO `website_shop_objects_templates` VALUES (640, 2, 'Arc des Rivages', 'Cet arc permettait aux pêcheurs de nettoyer les rivages de toute la vermine environnante sans avoir à se lever de leur siège, et cela depuis la fenêtre du bar des pirates.', 38, 46, '64#1#f#0#1d15+0,77#b#1e#0#1d20+10,8a#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (641, 15, 'Coton Ancestral', 'Ce Coton est doux comme le pelage d\'une jeune Ecaflipette, blanc comme un nuage de printemps, mais fragile comme une plume de Tofu.', 657, 6, '');
INSERT INTO `website_shop_objects_templates` VALUES (642, 15, 'Cocon de Ver à Soie', 'Cet énorme cocon blanchâtre, peut être déroulé pour obtenir un magnifique fil de soie. \\nL\'aventurier Harry Hane l\'aurait même utilisé pour pouvoir sortir du labyrinthe du Dark Vlad.', 489, 6, '');
INSERT INTO `website_shop_objects_templates` VALUES (643, 15, 'Fil de Soie', 'Ce fil est d\'une finesse et d\'une souplesse sans équivalent. C\'est de loin la matière préférée du Chafer dès qu\'il s\'agit de s\'équiper en sous-vêtements de combat.', 486, 5, '');
INSERT INTO `website_shop_objects_templates` VALUES (646, 54, 'Poils de Black Tiwabbit', 'Ce poil tout noir à l\'avantage ne de pas être salissant, ce qui ne manquera pas d\'intéresser les héros peu portés sur l\'hygiène et la coquetterie. Attention cependant, ce poil a tendance à déteindre au contact d\'une sueur abondante et corrosive.', 195, 11, '');
INSERT INTO `website_shop_objects_templates` VALUES (648, 54, 'Poils de Wabbit', 'Ce poil n\'est pas très prisé par les Tailleurs expérimentés qui lui préfèrent le poil des autres Wabbits, mais il a le mérite de faire fuir les Moskitos à cause de son odeur de Citronnelle Sauvage.', 196, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (649, 54, 'Poils de Wo Wabbit', 'Ce poil est si gras, qu\'il permet de garder les étoffes imperméables aux intempéries.', 197, 39, '');
INSERT INTO `website_shop_objects_templates` VALUES (650, 54, 'Poils de Grand Pa Wabbit', 'Ce poil malodorant est délicat à utiliser en couture à cause de sa tendance à friser au contact du jus de Cawotte.', 198, 39, '');
INSERT INTO `website_shop_objects_templates` VALUES (651, 55, 'Etoffe du Mulou', 'Cette étoffe en Poils de Mulou est très rare, mais sa constitution lui permet de résister à toutes formes d\'agressions physiques et parfois même magiques.', 199, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (652, 55, 'Etoffe du Sanglier', 'Cette étoffe en Poils de Sanglier est rugueuse et malodorante, mais protège efficacement des attaques physiques.', 220, 13, '');
INSERT INTO `website_shop_objects_templates` VALUES (653, 55, 'Etoffe du Prespic', 'Sous ses pics, le Prespic dispose d\'une fourrure rousse très douce, qui dégage une odeur désagréable lorsqu\'il pleut. Heureusement pour vous, il ne pleut jamais en Amakna, mais évitez d\'utiliser cette étoffe pour vous confectionner un caleçon de bain.', 661, 17, '');
INSERT INTO `website_shop_objects_templates` VALUES (654, 55, 'Etoffe du Wabbit', 'Cette étoffe en Poils de Barbe du Grand Pa Wabbit est très touffue, mais également irritante, un peu comme une grosse chenille urticante.', 15, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (657, 4, 'Bâton du Maître des Tofus', 'Ce bâton permettait à Shika Ingalsse, éleveuse de Tofus, d\'invoquer plus facilement des Tofus gardiens de troupeaux. Au fil du temps, ce bâton s\'est révélé être une excellente arme de combat.', 6, 56, '64#7#b#0#1d5+6,7c#10#19#0#1d10+15,98#b#14#0#1d10+10,b6#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (658, 4, 'Bâton du Maître des Tabis', 'Ce bâton permettait à Gramine Ingalsse, éleveuse de Tabis, d\'invoquer plus facilement des Tofus gardiens de troupeaux. Au fil du temps, ce bâton s\'est révélé être une excellente arme de combat.', 6, 34, '64#6#a#0#1d5+5,7d#b#14#0#1d10+10,9d#1#14#0#1d20+0,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (673, 19, 'Mangeuse de Châtaignier', 'Cette hache n\'a rien de particulier si ce n\'est que la légèreté naturelle du Bois de Châtaignier, permet à cette hache d\'avoir un manche aussi léger qu\'une plume de jeune Tofu Maléfique.', 6, 8, '64#6#a#0#1d5+5,77#3#0#0#0d0+3,9b#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (674, 19, 'Fendeuse de Merisier', '\"Cette hache a tout pour plaire\" disait le fameux slogan de Brouce Boulgoure le célèbre bûcheron. En effet, son manche en Bois de Merisier permet d\'amortir les vibrations lors de l\'abattage des arbres ou des bworks au crâne un peu trop solide.', 7, 32, '64#10#14#0#1d5+15,73#1#0#0#0d0+1,7d#1e#0#0#0d0+30,9d#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (675, 19, 'Trancheuse de Noyer', 'Cette hache à l\'aspect rudimentaire, n\'en est pas moins efficace. C\'est avec cet outil que Brouce Boulgoure le Bûcheron a gagné le concours de tranchage de Bworks nains. Voilà qui en dit long sur l\'efficacité de cette hache.', 8, 21, '64#b#f#0#1d5+10,7d#14#0#0#0d0+20,9b#5#0#0#0d0+5,9d#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (676, 19, 'Mangeuse d\'Erable', 'Cette hache a la particularité de ne jamais rouiller, pour éviter de désagréables surprises lorsque les Bûcherons gourmands décident de lécher le sirop d\'érable sur la lame après une éprouvante journée d\'abattage d\'érables.', 10, 25, '64#b#f#0#1d5+10,77#1e#0#0#0d0+30,99#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (677, 17, 'Cape du Pirate', 'Cette cape a appartenu à un vieux pirate du nom de Zokrim. Il devait être plutôt malchanceux...', 11, 1, '7f#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (678, 13, 'Parchemin d\'Ivoire', '(Double clic pour gagner de l\'expérience) \\nCe parchemin permet de gagner de l\'expérience sans prendre de risques.', 3, 25, '25d#1#3e8#0#1d1000+0');
INSERT INTO `website_shop_objects_templates` VALUES (679, 13, 'Parchemin Blanc', '(Double clic pour gagner de l\'expérience) \\nCe parchemin permet de gagner de l\'expérience sans prendre de risques.', 3, 1, '25d#1#64#0#1d100+0');
INSERT INTO `website_shop_objects_templates` VALUES (680, 13, 'Parchemin Doré ', '(Double clic pour gagner de l\'expérience) \\nCe parchemin permet de gagner de l\'expérience sans prendre de risques.', 3, 50, '25d#2#2710#0#1d9999+1');
INSERT INTO `website_shop_objects_templates` VALUES (683, 76, 'Petit Parchemin de Force', '(Double clic pour gagner de la force) \\nCe parchemin permet de gagner de la force de manière définitive sans prendre de risque. \\nAttention cependant, vous ne pourrez l\'utiliser que si votre force est inférieure à 25.', 21, 1, '25f#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (684, 76, 'Parchemin de Sorts', '(Double clic pour gagner des Points de Sorts) \\nCe parchemin permet de gagner des Points de Sorts de manière définitive sans prendre de risques.', 3, 1, '265#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (686, 76, 'Petit Parchemin d\'Intelligence', '(Double clic pour gagner des Points d\'Intelligence) \\nCe parchemin permet de gagner des Points d\'Intelligence de manière définitive sans prendre de risques. \\nAttention cependant, vous ne pourrez l\'utiliser que si votre intelligence est inférieure à 25.', 23, 1, '263#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (690, 52, 'Farine de Lin', 'Cette farine est très étrange, car elle est n\'est pas issue d\'une céréale, ce qui explique pourquoi elle ne ressemble à aucune autre farine.', 254, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (692, 33, 'Pain Consistant', 'Ce pain est fait à partir de Farine de Lin, ce qui explique pourquoi il est si gras, et pourquoi sa mie est brune. Très riche en huiles essentielles, il faut cependant avouer qu\'il a très mauvais goût.', 12, 1, '6e#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (694, 23, 'Dofus Pourpre', 'C\'est le Dragon du Feu Ignemikhal qui créa le Dofus Pourpre, un Œuf dont le moins qu\'on puisse dire, c\'est qu\'il sent le soufre - mais il sent bien d\'autres choses encore...', 1, 6, '8a#1a#32#0#1d25+25');
INSERT INTO `website_shop_objects_templates` VALUES (695, 13, 'Parchemin de Bûcheron', '(Double clic pour gagner des Points d\'expérience)', 3, 1, '266#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (696, 16, 'La Coiffe du Ploukosse', 'La Coiffe du Ploukosse, sous ses dehors \"has been\", est très efficace lors des combats pour un simple chapeau de paille.', 2, 20, '8a#6#14#0#1d15+5');
INSERT INTO `website_shop_objects_templates` VALUES (697, 16, 'Makroute', 'Makroute est un chien très affectueux... Le problème, c\'est que lorsqu\'il trouve un nouveau copain, il ne le lâche plus... Il a bien dû se faire 30 millions d\'amis de cette façon...', 3, 6, '76#6#14#0#1d15+5,7c#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (698, 16, 'Choipo Podlard', 'Le Choipo Podlard vient d\'une grande école de magie. Créature vivante, il a rencontré les plus grands magiciens de notre temps, tels que Mme Magoa AlaGale, Mr Doublegore et le célèbre Remy Krokeur.', 4, 33, '75#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (699, 16, 'Le Troma', 'Le Troma est aussi craignos qu\'un Rasboul en poil de Bitouf. (Pour ceux qui ne savent pas ce qu\'est un Rasboul en poil de bitouf, référez-vous aux grands livres des Craps à Poules).', 5, 22, '6e#b#32#0#1d40+10');
INSERT INTO `website_shop_objects_templates` VALUES (700, 16, 'Pandawa', 'Ah le Pandawa, vraiment quelle grosse tête il a. Comme son pote Makroute, il passe son temps sur la tête de son maître. Nul besoin de se déplacer, lorsqu\'il est motivé, il arrive même à subtiliser la nourriture de son porteur.', 6, 6, 'b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (701, 16, 'Le Oiram', 'Le Oiram a fait de nombreux adeptes de part le monde, du fait de son côté très classieux... Ce chapeau a longtemps été porté par un plombier qui passait son temps à sauter et courir...', 7, 22, '7b#b#32#0#1d40+10');
INSERT INTO `website_shop_objects_templates` VALUES (702, 16, 'Kritter', 'Ce crâne de démon reconstruit à partir d\'ossements divers et variés apporte grâce et élégance à son porteur... Vos amies vont vous jalouser...', 8, 30, '73#3#a#0#1d8+2');
INSERT INTO `website_shop_objects_templates` VALUES (703, 16, 'Dora', 'Ce chapeau, en forme de corbeille à fruits en osier renversée, est en fait une corbeille à fruits renversée magique. Ce qui ne manquera pas d\'impressionner votre entourage, surtout s\'il est composé d\'apprentis Bworks Mages.', 9, 36, '76#b#3c#0#1d50+10,7e#b#3c#0#1d50+10');
INSERT INTO `website_shop_objects_templates` VALUES (704, 16, 'Dantgoule', 'Ce chapeau, confectionné à partir de Slips en cuir de Chafer Lancier tressés entre eux, vous rendra de toute évidence irrésistible auprès des femelles Bwork Mages, réputées pour leur féminité débordante, accentuée par leur barbe rousse.', 10, 36, '6e#b#3c#0#1d50+10,77#b#3c#0#1d50+10');
INSERT INTO `website_shop_objects_templates` VALUES (705, 16, 'Masque Tromatisant', 'Si vous voulez être traumatisé, il vous faut absolument cette magnifique noix de coco trouée. Nous rappelons à l\'utilisateur que l\'intérieur est équipé d\'une paille et de boissons rafraîchissantes.', 11, 47, '70#3#5#0#1d3+2,76#15#3c#0#1d40+20');
INSERT INTO `website_shop_objects_templates` VALUES (706, 16, 'Crystal O\'Boul', 'Hugne \"le sans mémoire\" possédait une magnifique boule de crystal que lui avait donné son pépé. Bien décidé à la conserver toute sa vie, il la plaça sur son chapeau, qu\'il ne quittait jamais... Il est mort de fatigue, en essayant de la retrouver.', 12, 24, '6e#15#32#0#1d30+20');
INSERT INTO `website_shop_objects_templates` VALUES (707, 16, 'Minotokorno', 'Ce chapeau en Corne de Minotoror est très efficace pour impressionner ses adversaires en se faisant passer pour un Minotoror. Cette ruse ne semble fonctionner que sur les adversaires simplets. Un Iop ou un Tofu devrait faire l\'affaire.', 13, 33, '76#b#32#0#1d40+10,8a#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (708, 16, 'Houde', 'Ce chapeau en peau de larve verte magique donne à son porteur une allure guillerette, mais également un peu stupide. On ne peut pas tout avoir dans la vie, le porteur de ce chapeau en est d\'ailleurs un excellent exemple.', 14, 30, '73#1#2#0#1d2+0,7b#b#32#0#1d40+10');
INSERT INTO `website_shop_objects_templates` VALUES (709, 16, 'Lorko Kasko', 'Ce chapeau en écorce enchantée appartenait à Lorko, un Bûcheron réputé qui n\'a pas hésité à défier le célèbre Bûcheron Brouce Boulgoure, lors d\'un fameux duel de déracinage d\'Orme à mains nues dans la clairière de Liroye Merline.', 15, 37, '6e#b#28#0#1d30+10,76#b#28#0#1d30+10,7e#b#28#0#1d30+10');
INSERT INTO `website_shop_objects_templates` VALUES (710, 16, 'Korko Klako', 'Lo Korko Klako ost ouno chapo kilo bo. Tros ostotiko, tros bolo, il so porto par los plus bo dos Sadida.', 16, 17, 'b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (711, 16, 'Jouik Krampe', 'Ce magnifique masque en cuir appartenait à Jouik Krampe, cousin de Zeurg. Tous deux étaient très portés sur les vêtements en cuir moulant. Un peu comme le Captain Chafer, la perversité en moins.', 17, 26, '7e#b#32#0#1d40+10,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (712, 16, 'Gulliver', 'Ce chapeau confectionné à partir d\'oreilles cousues entre elles, vous rendra tout simplement unique tant il est original. On raconte qu\'il a jadis permis à Rakmar Bilgout de séduire la reine des Bouftous, pour ensuite l\'égorger plus facilement.', 18, 33, '7c#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (713, 13, 'Parchemin de Forgeur d\'épée', '(Double clic pour gagner des Points d\'expérience)', 3, 1, '266#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (714, 13, 'Parchemin de Forgeur de dagues', '(Double clic pour gagner des Points d\'expérience)', 3, 1, '266#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (715, 13, 'Parchemin de Sculpteur d\'arcs', '(Double clic pour gagner des Points d\'expérience)', 3, 1, '266#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (716, 13, 'Parchemin de Sculpteur de bâtons', '(Double clic pour gagner des Points d\'expérience)', 3, 1, '266#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (717, 13, 'Parchemin de Sculpteur de baguettes', '(Double clic pour gagner des Points d\'expérience)', 3, 1, '266#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (718, 75, 'Parchemin de Sort Flamiche', '(Double click pour apprendre le sort) \\nCe parchemin vous permettra d\'apprendre le sort élémentaire Flamiche.', 1, 1, '25c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (719, 75, 'Parchemin de Sort Libération', '(Double click pour apprendre le sort) \\nCe parchemin vous permettra d\'apprendre le sort élémentaire Libération.', 3, 1, '25c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (720, 75, 'Parchemin de Sort Foudroiement', '(Double click pour apprendre le sort) \\nCe parchemin vous permettra d\'apprendre le sort élémentaire Foudroiement.', 3, 1, '25c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (721, 75, 'Parchemin de Sort Invocation d\'Arakne', '(Double click pour apprendre le sort) \\nCe parchemin vous permettra d\'apprendre le sort d\'invocation d\'Arakne.', 3, 1, '25c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (724, 73, 'Sort Maîtrise du Bâton', '(Double clic pour apprendre le sort) \\nCe parchemin vous permettra de faire plus de dégâts en utilisant un bâton.', 2, 20, '25c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (725, 73, 'Sort Maîtrise de l\'Epée', '(Double clic pour apprendre le sort) \\nCe parchemin vous permettra de faire plus de dégâts en utilisant une épée.', 1, 20, '25c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (726, 73, 'Sort Maîtrise de l\'Arc', '(Double clic pour apprendre le sort) \\nCe parchemin vous permettra de faire plus de dégâts en utilisant un arc.', 3, 20, '25c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (727, 73, 'Sort Maîtrise du Marteau', '(Double clic pour apprendre le sort) \\nCe parchemin vous permettra de faire plus de dégâts en utilisant un marteau.', 4, 20, '25c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (728, 73, 'Sort Maîtrise de la Baguette', '(Double clic pour apprendre le sort) \\nCe parchemin vous permettra de faire plus de dégâts en utilisant une baguette.', 5, 20, '25c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (729, 73, 'Sort Maîtrise des Dagues', '(Double clic pour apprendre le sort) \\nCe parchemin vous permettra de faire plus de dégâts en utilisant une dague.', 6, 20, '25c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (730, 73, 'Sort Maîtrise de la Pelle', '(Double clic pour apprendre le sort) \\nCe parchemin vous permettra de faire plus de dégâts en utilisant une pelle.', 7, 20, '25c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (731, 75, 'Parchemin de Sort Spécial Brokle', '(Double clic pour apprendre le sort) \\nCe parchemin vous permet d\'apprendre le sort Brokle... Réservé aux Iops uniquement.', 4, 1, '25c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (732, 9, 'Alliance de Silimelle', 'Cette magnifique alliance a été volée à Silimelle la Brasseuse de Bière, lors d\'une soirée un peu trop arrosée à la taverne. Voilà ce qui arrive lorsque l\'on paie des coups à des inconnus...', 30, 26, '7c#19#0#0#0d0+25,9b#5#0#0#0d0+5,9d#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (733, 11, 'Bottes de Ragalde', 'Ragalde était sûrement un des Guerriers Iop les plus téméraires, ces bottes magiques lui ont permis d\'occire bon nombre d\'indésirables.', 7, 49, '7e#b#14#0#1d10+10,77#b#14#0#1d10+10,76#b#14#0#1d10+10,7b#b#1e#0#1d20+10,7d#15#1e#0#1d10+20,b0#2#5#0#1d4+1');
INSERT INTO `website_shop_objects_templates` VALUES (734, 10, 'Ceinture de Sécurité ', 'Cette ceinture permettait aux gardes du Château d\'Amakna de contenir les émeutes et autres débordements lors des fêtes populaires.', 7, 17, '76#19#0#0#0d0+25,99#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (737, 23, 'Dofus Emeraude', 'Plus vert qu\'un Tofu malade, le Dofus Emeraude fut créé par Aerafal, le Dragon de l\'Air. Pour créer quelque chose d\'aussi vert, il devait avoir le mal de l\'air. Un comble, non ?', 2, 6, '7D#33#64#0#1d50+50');
INSERT INTO `website_shop_objects_templates` VALUES (739, 23, 'Dofus Turquoise', 'Le Dofus Turquoise fut créé par Aguabrial, le Dragon de l\'Eau. Quand on y pense, c\'est fou ce qu\'un Dragon peut faire avec de l\'eau...', 3, 6, '73#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (742, 4, 'Bâton Cornu', '\"Ce bâton a dû faire, toutes les guerres, pour être aussi fort aujourd\'hui\" tels ont été les derniers mots de Francisque Kabroule, le célèbre Ménestrel Forgeur de Haches, avant de périr écrasé par un œuf de Tofu géant.', 1, 29, '64#b#f#0#1d5+10,7b#28#0#0#0d0+40,9a#a#0#0#0d0+10,31b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (743, 33, 'Brioche Dorée', 'La recette de cette Brioche a été élaborée par Xavier le Boulanger en personne qui voulait en faire une brioche délicieuse et légère à la fois. On peut sans se tromper, dire qu\'il a réussi.', 8, 60, '6e#c8#0#0#0d0+200,8b#3e8#0#0#0d0+1000');
INSERT INTO `website_shop_objects_templates` VALUES (744, 17, 'Cape de Bowisse', 'Cette cape est comme son porteur, unique en son genre et trop souvent sous-estimée. \\nElle est constituée d\'un assemblage de peaux de larves vertes, ce qui lui donne un aspect rugueux des plus sympathique.', 1, 20, '7b#b#28#0#1d30+10');
INSERT INTO `website_shop_objects_templates` VALUES (745, 40, 'Lingot d\'Or', 'Ce lingot est obtenu en faisant fondre de l\'Or à l\'état brut.', 241, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (746, 40, 'Ebonite', 'Cet alliage très rare permet de fabriquer des objets très rares et souvent mortels. En effet, l\'Ebonite est un métal qui une fois rouillé, devient un véritable poison.', 658, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (747, 40, 'Aluminite', 'Cet alliage est d\'une légèreté impressionnante, ce qui en fait un métal de choix pour les petites dagues ou les épées courtes.', 660, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (748, 40, 'Magnésite', 'Cet alliage original est presque magique, il brille et vibre la nuit, ce qui peut être suffisant pour effrayer un Bwork un peu trop crédule.', 659, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (749, 40, 'Bakélélite', 'Cet alliage n\'est pas des plus solide, mais correctement aiguisé, il devient aussi tranchant que la Lame d\'un Chafer.', 487, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (750, 40, 'Kouartz', 'Cet alliage très étrange est capable de renfermer une énergie impressionnante, le rendant très instable dans certaines conditions. Les meilleurs Forgerons raffolent de cet alliage, qui leur permet de forger des armes aux pouvoirs presque légendaires.', 664, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (752, 15, 'Sang du Vampire', 'Ce sang est magique, ce qui en fait un ingrédient indispensable pour le Boudin Noir magique. Les effets secondaires sont cependant encore inconnus.', 89, 15, '');
INSERT INTO `website_shop_objects_templates` VALUES (754, 17, 'Cape du Vampire', 'Cette cape rouge sang a baigné dans le sang pendant des années. Ce type de cape est très prisée lors des Fêtes Dalouhines.', 17, 29, 'b7#3#7#0#1d5+2');
INSERT INTO `website_shop_objects_templates` VALUES (756, 56, 'Slip en Cuir Moulant du Vampire', 'Pour se protéger des coups critiques aux endroits critiques, le Vampire utilise parfois son Slip en Cuir lorsqu\'il doit partir en chasse. Ce Slip lui permet également de protéger les endroits critiques des coups de soleil.', 622, 15, '');
INSERT INTO `website_shop_objects_templates` VALUES (757, 110, 'Gelée Bleutée', 'Cette gelée est particulièrement collante, un peu comme une Bloqueuse enragée. Étrangement, elle colle particulièrement bien les plumes de Tofus. On se demande bien à quoi cela peut bien servir...', 42, 3, '');
INSERT INTO `website_shop_objects_templates` VALUES (758, 17, 'Cape du Justicier', 'Cette cape ne peut être portée que par les grands justiciers d\'Amakna, c\'est à dire presque personne.', 2, 30, '8a#15#1e#0#1d10+20,7d#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (759, 17, 'Cape du Poolay Chogrelotant', 'Cette magnifique cape a été confectionnée avec les plumes du dernier Poolay d\'Amakna. Véritable rareté, les collectionneurs rêvent de l\'avoir dans leur collection.', 3, 33, '7f#1#0#0#0d0+1,b7#4#c#0#1d9+3,b8#4#c#0#1d9+3');
INSERT INTO `website_shop_objects_templates` VALUES (760, 33, 'Pain au curry sans curry', 'Un prototype de Kwaker Vans, son goût et son efficacité sont toujours une surprise, malheureusement l\'odeur, elle, est toujours la même.', 12, 1, '6e#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (761, 54, 'Poils de souris', 'Ces poils de souris sont très fins et doux, et sont de ce fait très recherchés pour la confection de manteaux. Le manteau en peau et poils de souris fait fureur dans la haute société d\'Amakna, il paraît que ça fait classe d\'en porter.', 549, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (764, 1, 'Amulette du Petit Hibou', 'Cette petite amulette ravira les héros débutants.', 1, 1, '7e#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (765, 22, 'Faux de Farle Ingalsse', 'Cette Faux a appartenu à Farle Ingalsse en personne, elle est suffisamment aiguisée pour faucher tous les types de céréales et tous les types de monstres qui se cachent dans les champs de céréales.', 1, 13, '64#6#a#0#1d5+5,7b#b#0#0#0d0+11,9d#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (766, 1, 'Koliet Aclou', 'Cette amulette permet d\'occasionner plus de dégâts pour les aventuriers qui débutent.', 34, 1, '70#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (767, 9, 'Gantie Royal', 'Malgré un nom pompeux, cet anneau rend juste un peu plus fort, et un peu plus bête.', 8, 1, '76#2#6#0#1d5+1,9b#2#6#0#1d5+1');
INSERT INTO `website_shop_objects_templates` VALUES (768, 9, 'Camaïneux', 'Cet anneau influe sur le cours de votre destinée, il vous rend plus résistant, mais moins chanceux. Vous augmentez vos chances de vivre longtemps en diminuant vos chances de vivre heureux.', 33, 1, '6e#2#6#0#1d5+1,98#2#6#0#1d5+1');
INSERT INTO `website_shop_objects_templates` VALUES (769, 11, 'Einekeineux', 'Les bottes qui portent chance. Le problème c\'est qu\'elles vous rendent moins résistant en combat.', 5, 2, '7b#6#a#0#1d5+5,99#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (770, 11, 'Fecaflip', 'Cette magnifique paire de bottes convertit un peu de votre force en intelligence.', 3, 2, '7e#6#a#0#1d5+5,9d#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (771, 19, 'Mangeuse de Frêne', 'Cette hache n\'a rien d\'exceptionnel, mais elle reste tout de même appréciée des Bûcherons débutants, qui l\'aiment pour sa simplicité d\'utilisation .', 9, 8, '64#6#a#0#1d5+5,7b#a#0#0#0d0+10,9c#7#0#0#0d0+7');
INSERT INTO `website_shop_objects_templates` VALUES (772, 17, 'Cape Edépée', 'On prétend que cette cape légendaire permet de devenir presque invincible si on la combine à l\'épée légendaire des escrimeurs, le Dard Tagnan et au chapeau légendaire des Six Rameaux de Bergers Rahks.', 4, 22, 'b8#2#4#0#1d3+1');
INSERT INTO `website_shop_objects_templates` VALUES (773, 17, 'Cape Ellinie', 'Cette cape vient du pays des Patitaliennes, un endroit où l\'on parle avec les mains. Cela explique la grande liberté de mouvement laissée par celle-ci. Elle est en outre d\'une légèreté surprenante.', 5, 14, '77#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (774, 17, 'Cape Ulais', 'Venant du Mont Taigüe ou du monde Aigüe selon la manière dont vous le prononcez, cette cape a conduit à l\'empoisonnement de son ancienne propriétaire, mais bizarrement elle augmente la résistance de son porteur.', 7, 14, '6e#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (775, 17, 'Cape Abilité ', 'Tissée magiquement avec un soin infini, la Cape Abilité permet à son porteur de discerner les points faibles de ses adversaires pour leur porter des coups destructeurs.', 9, 17, '73#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (776, 17, 'Cape Sulcorpe', 'Ayant appartenu à une certaine Mulba, qui s\'en servait pour transporter des objets encombrants dans sa quête des Sept Poules de Cristal venues des étoiles, cette cape augmente considérablement la force.', 8, 14, '76#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (777, 17, 'Cape du Coq Hû ', 'Le Coq ayant donné ses plumes pour la confection de cette cape s\'est débattu pendant plusieurs jours et plusieurs nuits avant de finalement tomber à bout de force et de se laisser déplumer. \"Hû !\" s\'exclama son propriétaire, lui aussi à bout de souffle.', 10, 44, '7b#b#14#0#1d10+10,80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (778, 17, 'Cape de Mori Arty', 'Cette authentique cape de méchant est une preuve de votre appartenance à la bande du diaboliquement génial Mori Arty, dont on raconte que seule sa malchance égalait sa stupéfiante intelligence. Ne peut être portée que par les plus grands méchants.', 11, 6, '7e#a#0#0#0d0+10,98#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (779, 17, 'Cape Maj\'Hic', 'Cette cape d\'apparence quelconque n\'est en fait pas tout à fait quelconque. Elle rendrait invisible son porteur aux yeux de ceux qui ne le regardent pas. Impressionnant !', 12, 34, '8a#6#a#0#1d5+5,b7#3#7#0#1d5+2');
INSERT INTO `website_shop_objects_templates` VALUES (781, 17, 'Cape Itou Lascione', 'Cette superbe cape a appartenu au Grand Stratéquerre. Ce célèbre seigneur de guerre et fin stratège, avide de conquête de l\'univers, a bien vite abandonné tous ses projets après avoir revêtu cette cape. Étrange !', 7, 21, '7e#15#23#0#1d15+20');
INSERT INTO `website_shop_objects_templates` VALUES (782, 19, 'Agride', 'Cette hache est assez particulière, elle est à la base destinée à l\'apprentissage du métier de Bûcheron. Correctement utilisée, elle peut sectionner en deux un jeune Abraknyde trop insouciant, ce qui avouons-le, est très rare.', 11, 27, '64#8#c#0#1d5+7,7c#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (783, 1, 'Amulette du Bûcheron', 'Cette amulette, exclusivement fabriquée à partir de bois précieux, est très prisée des Bûcherons qui lui attribuent bien souvent des pouvoirs qu\'elle n\'a pas.', 9, 22, '77#f#0#0#0d0+15,7b#f#0#0#0d0+15');
INSERT INTO `website_shop_objects_templates` VALUES (784, 11, 'Bottes du Chat Buté ', 'Le Chat Buté est le surnom donné à un célèbre Ecaflip. Aucun Ecaflip n\'aura été plus têtu que lui, et en combat seule sa chance le sauvait de son inexistante intelligence.  \\n\"Qui qu\'c\'est qu\'y\'est buté comme un caillou ?\", s\'exclamait-il souvent.', 3, 2, '7b#6#a#0#1d5+5,9b#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (785, 9, 'Anneau Fortifiant', 'Cet anneau, transmis de Grand père Enutrof en Père Enutrof, procure à son porteur une formidable force. Celui-ci n\'en est qu\'une pâle copie, mais il saura tout de même satisfaire les collectionneurs, qu\'ils soient Enutrof ou non.', 29, 11, '76#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (786, 1, 'Pendentif du Hibou Chétif', 'Née d\'une erreur de manipulation d\'un bijoutier, cette amulette augmente l\'intelligence de son porteur. En revanche, elle donne généralement un puissant mal de crâne qui a pour effet d\'amoindrir la condition physique de son propriétaire.', 1, 2, '7e#6#a#0#1d5+5,99#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (787, 9, 'Anneau Rexik', 'Cet étrange petit anneau a la faculté d\'augmenter l\'agilité de son porteur, pourtant étrangement frappé d\'un manque de chance.', 31, 1, '77#2#6#0#1d5+1,98#2#6#0#1d5+1');
INSERT INTO `website_shop_objects_templates` VALUES (789, 10, 'Ceinture du Kobeer', 'Cette ceinture fait fureur auprès de la jeune population d\'Amakna. Un couturier Sadida en est à l\'origine. Lors de sa première vente, il s\'exclama : \"La vie est courte, jouez durement !\".', 9, 1, '76#2#0#0#0d0+2,9a#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (790, 17, 'Cape de Bonne Espérance', 'Les effets magiques de cette cape sont souvent surestimés, ce qui a causé la perte de nombreux aventuriers, notamment, le tristement célèbre Ménestrel Francisque Kabroule.', 5, 30, '70#1#2#0#1d2+0,7b#b#1e#0#1d20+10');
INSERT INTO `website_shop_objects_templates` VALUES (791, 4, 'Abraknydi Vivitus', 'C\'est un Bâton en racines d\'Abraknyde encore vivantes. Attention, ce dernier a une fâcheuse tendance à se retourner contre son maître. Il peut être très efficace lorsqu\'il décide de s\'attaquer à la même cible que celle de son maître.', 1, 34, '64#6#a#0#1d5+5,7b#f#0#0#0d0+15,7c#f#0#0#0d0+15,7e#f#0#0#0d0+15,9d#1e#0#0#0d0+30');
INSERT INTO `website_shop_objects_templates` VALUES (792, 15, 'Sève d\'Abraknyde', 'Cette sève sirupeuse ne sert à rien sauf si vous être prêt à attendre qu\'elle se fossilise en Ambre. On raconte cependant, qu\'une Enutrofette astucieuse et particulièrement séduisante a trouvé un moyen pour accélérer ce processus.', 162, 45, '');
INSERT INTO `website_shop_objects_templates` VALUES (793, 12, 'Potion de Vieillesse', 'Cette potion permet d\'accélérer certains processus chimiques, comme la formation de précipités. C\'est un peu comme une levure surpuissante, le mauvais goût en moins.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (795, 76, 'Parchemin de Force', '(Double click pour gagner de la force) \\nCe parchemin permet de gagner de la force de manière définitive sans prendre de risques. \\nAttention cependant, vous ne pourrez l\'utiliser que si votre force est inférieure à 50.', 21, 1, '25f#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (796, 76, 'Grand Parchemin de Force', '(Double click pour gagner de la force) \\nCe parchemin permet de gagner de la force de manière définitive sans prendre de risques. \\nAttention cependant, vous ne pourrez l\'utiliser que si votre force est inférieure à 80.', 21, 1, '25f#1#0#0#0d0+1');
