INSERT INTO `website_shop_objects_templates` VALUES (818, 12, 'Clé en Roche de Ded Aléïcar', 'Cette petite clé en roche vous ouvrira la porte de la grotte de Ded Aléïcar. Mais encore faut-il la trouver...', 14, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (819, 6, 'Epée Sacrée', 'Une épée sainte distribuée aux jeunes guerriers durant leur formation.', 1, 15, '64#7#b#0#1d5+6,6e#9#d#0#1d5+8');
INSERT INTO `website_shop_objects_templates` VALUES (820, 6, 'Grande Epée Sacrée', 'Une épée sainte distribuée aux jeunes guerriers durant leur formation.', 1, 16, '64#8#c#0#1d5+7,6e#4#e#0#1d11+3');
INSERT INTO `website_shop_objects_templates` VALUES (821, 6, 'Puissante Epée Sacrée', 'Une épée sainte distribuée aux jeunes guerriers durant leur formation.', 1, 17, '64#9#d#0#1d5+8,6e#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (822, 6, 'Epée du Chevalier', 'L\'épée du Chevalier est une épée solide et efficace, bien utilisée elle peut causer de gros dommages à vos ennemis.', 9, 23, '64#d#1b#0#1d15+12,7b#c#0#0#0d0+12,99#4#0#0#0d0+4');
INSERT INTO `website_shop_objects_templates` VALUES (823, 6, 'Epée du Grand Chevalier', 'L\'épée du Grand Chevalier est une épée solide et efficace, bien utilisée elle peut causer de gros dommages à vos ennemis.', 9, 24, '64#f#1d#0#1d15+14,7b#e#0#0#0d0+14,99#4#0#0#0d0+4');
