INSERT INTO `website_shop_objects_templates` VALUES (828, 2, 'Arc Sifflant', 'Cet arc tire si rapidement ses flèches, que l\'on entend ces dernières partir de très loin. Pensez donc à l\'équiper d\'un silencieux, si c\'est la discrétion que vous recherchez.', 15, 11, '64#3#5#0#1d3+2');
