INSERT INTO `website_shop_objects_templates` VALUES (836, 9, 'Abranneau', 'Cet anneau, forgé dans de l\'écorce d\'Abraknyde possède de grands pouvoirs et implique donc de grandes responsabilités. Cependant, malgré sa valeur, des rumeurs laissent entendre qu\'il est maudit.', 11, 5, '6f#1#0#0#0d0+1,74#1#0#0#0d0+1,98#4b#0#0#0d0+75,9a#4b#0#0#0d0+75,9b#64#0#0#0d0+100,9d#64#0#0#0d0+100');
INSERT INTO `website_shop_objects_templates` VALUES (837, 11, 'Bottes de Kluh', 'Ces bottes augmentent la force de leur porteur, mais risquent de le rendre un peu idiot au bout d\'un certain temps, voire de le transformer en Iop en cas d\'utilisation régulière et prolongée', 3, 8, '76#b#14#0#1d10+10,9b#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (838, 15, 'Sang d\'Oni', 'Cette fiole de sang d\'Oni est très recherchée par les alchimistes expérimentés qui désirent donner à certaines armes, des propriétés particulièrement effrayantes.', 662, 75, '');
INSERT INTO `website_shop_objects_templates` VALUES (840, 54, 'Poils du Minotoror', 'Ces poils sentent très mauvais, mais sont d\'une résistance à toute épreuve, porter sur soi une étoffe en poils de Minotoror fera de vous une personne redoutée de vos adversaires, et appréciée des mouches.', 201, 125, '');
INSERT INTO `website_shop_objects_templates` VALUES (841, 9, 'Anneau de Satisfaction', 'Cet anneau permettra a votre héros d\'augmenter ses PA, en contrepartie de sa force et de son intelligence.', 12, 8, '6f#1#0#0#0d0+1,98#96#0#0#0d0+150,9a#96#0#0#0d0+150,9b#c8#0#0#0d0+200,9d#c8#0#0#0d0+200');
INSERT INTO `website_shop_objects_templates` VALUES (842, 111, 'Coquille de Dragoeuf Doré ', 'Cette coquille est presque incassable, cependant, en la polissant pendant des générations, les meilleurs Bijoutiers peuvent utiliser ses facultés magiques pour confectionner des amulettes aux pouvoirs exceptionnels.', 202, 64, '');
INSERT INTO `website_shop_objects_templates` VALUES (843, 111, 'Coquille de Dragoeuf Noir', 'Cette coquille est presque incassable, cependant, en la polissant pendant des générations, les meilleurs Bijoutiers peuvent utiliser ses facultés magiques pour confectionner des amulettes aux pouvoirs exceptionnels.', 203, 64, '');
INSERT INTO `website_shop_objects_templates` VALUES (844, 105, 'Oeuf de Dragoeuf de Saphir', 'Cet oeuf étrange donnera naissance à un joli petit Dragoeuf une fois qu\'il sera couvé par une Femelle Dragoeuf de Saphir. En attendant, évitez de le tenir au chaud contre vous, on ne sait pas ce qu\'il pourrait arriver...', 204, 74, '');
