INSERT INTO `website_shop_objects_templates` VALUES (846, 105, 'Oeuf de Dragoeuf Noir', 'Cet oeuf étrange donnera naissance à un joli petit Dragoeuf une fois qu\'il sera couvé par une Femelle Dragoeuf Noir. En attendant, évitez de le tenir au chaud contre vous, on ne sait pas ce qu\'il pourrait arriver...', 206, 74, '');
INSERT INTO `website_shop_objects_templates` VALUES (847, 105, 'Oeuf de Dragoeuf Blanc', 'Cet oeuf étrange donnera naissance à un joli petit Dragoeuf une fois qu\'il sera couvé par une Femelle Dragoeuf Blanc. En attendant, évitez de le tenir au chaud contre vous, on ne sait pas ce qu\'il pourrait arriver...', 38, 74, '');
INSERT INTO `website_shop_objects_templates` VALUES (848, 47, 'Vieil Os de Dragoeuf', 'Ce vieil os est magique, correctement utilisé, il devrait permettre de confectionner des objets très puissants.', 15, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (849, 9, 'Anneau Forcesque', 'Ce petit anneau donne de la Force à son porteur.', 5, 1, '76#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (850, 9, 'Anneau Agilesque', 'Étrangement, les collectionneurs Amaknéens s\'arrachent cet anneau alors qu\'il ne vaut pas tripette.', 1, 1, '77#1#0#0#0d0+1');
