INSERT INTO `website_shop_objects_templates` VALUES (860, 10, 'Ceinture de Chance', 'Cette modeste ceinture augmente la chance de son porteur.', 3, 1, '7b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (861, 11, 'Petites Bottes de Force', 'Ces bottes augmentent la force de leur porteur au détriment de son agilité, ce qui tend à le rendre différent d\'un Tofu, sans pour autant le rendre moins idiot.', 3, 2, '76#6#a#0#1d5+5,9a#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (862, 11, 'Sandales d\'Intelligence', 'Ces bottes permettent d\'augmenter l\'intelligence de leur porteur, tout en lui conférant un style vraiment à la mode par les temps qui courent grâce à leur semelle en Bois de Noyer qui offre une adhérence remarquable.', 4, 8, '7e#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (863, 11, 'Bottes Agilesques', 'Ces bottes permettent d\'augmenter l\'agilité de leur porteur, afin qu\'il puisse se prendre pour un Tofu plus facilement, lorsque l\'envie lui prend de faire l\'idiot.', 5, 8, '77#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (864, 11, 'Bottes de Chance', 'Ces bottes augmentent la chance de leur porteur afin de l\'aider à trouver des objets très puissants, comme de la bave de Bouftou par exemple.', 1, 8, '7b#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (867, 1, 'Dragolyre', 'Cette splendide amulette confectionnée à partir de restes de Dragoeuf, est suffisamment impressionnante pour faire battre en retrait la majorité des ennemis normalement constitués.', 9, 32, '6f#1#0#0#0d0+1,98#23#0#0#0d0+35,9a#23#0#0#0d0+35,9b#23#0#0#0d0+35,9d#23#0#0#0d0+35,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (878, 13, 'Parchemin de Boulanger', '(Double clic pour utiliser) \\nCe parchemin permet de gagner des points d\'expérience dans le métier de Boulanger.', 3, 1, '266#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (879, 13, 'Parchemin de Cordonnier', '(Double clic pour utiliser) \\nCe parchemin permet de gagner des points d\'expérience dans le métier de Cordonnier.', 3, 1, '266#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (880, 57, 'Laine de Bouftou Royal', 'Cette laine est royale, elle est douce et légère, mais a tendance à démanger les peaux sensibles. Cette laine est en revanche très usée donc très fragile, étant donné l\'âge du Bouftou Royal.', 207, 35, '');
INSERT INTO `website_shop_objects_templates` VALUES (881, 57, 'Laine de Boufton Blanc', 'Cette laine est extrêmement douce, car elle provient du duvet d\'un Boufton. Attention tout de même, cette laine est encore imprégnée d\'une odeur qui pourrait inciter la mère du Boufton à vous lécher si vous entrez en contact avec cette laine.', 208, 2, '');
INSERT INTO `website_shop_objects_templates` VALUES (882, 57, 'Laine du Chef de Guerre Bouftou', 'Cette laine sent très mauvais, mais elle a appartenu à un Chef de Guerre Bouftou, ce qui lui confère une grande valeur sentimentale auprès des guerriers.', 209, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (883, 56, 'Cuir de Boufton Blanc', 'Ce cuir très lisse est particulièrement adapté à la confection de sous-vêtements en cuir, le Slip en Cuir du Chafer en est un exemple frappant.', 534, 2, '');
INSERT INTO `website_shop_objects_templates` VALUES (884, 56, 'Cuir de Boufton Noir', 'Ce cuir luisant est très apprécié des Cordonniers et des tailleurs, pour la confection de petites bottes ou de chapeaux.', 16, 2, '');
INSERT INTO `website_shop_objects_templates` VALUES (885, 57, 'Laine de Boufton Noir', 'Cette laine rugueuse n\'est pas très utilisée par les tailleurs, elle est en revanche très appréciée des Enutrofs, qui s\'en servent pour cacher leur calvitie naissante.', 210, 2, '');
INSERT INTO `website_shop_objects_templates` VALUES (886, 56, 'Cuir de Bouftou Royal', 'Ce cuir est royal, il est d\'une souplesse extraordinaire, et les crevasses qu\'il arbore, sont les témoins de la longue vie du Bouftou Royal. Il n\'existe pas meilleur cuir dans toute la province d\'Amakna.', 535, 35, '');
INSERT INTO `website_shop_objects_templates` VALUES (887, 56, 'Cuir du Chef de Guerre Bouftou', '\"Ce cuir a du faire toutes les guerres, pour être aussi dur aujourd\'hui\" telles étaient les paroles du célèbre Ménestrel Francisque Kabroule, juste avant de mourir asphyxié par l\'odeur d\'un Chef de Guerre Bouftou.', 534, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (888, 11, 'Grandes Bottes de Concentration', 'Ces bottes sont si confortables qu\'elles permettent au héros qui les chausse d\'accroître sa concentration.', 6, 26, '73#2#0#0#0d0+2,7e#f#0#0#0d0+15');
