INSERT INTO `website_shop_objects_templates` VALUES (902, 11, 'Petites Bottes de Klime', 'L\'agilité que confère ces bottes permettait à Klime le cordonnier de monter facilement sur le dos de n\'importe quel Bouftou. Il est mort en confondant un Bouftou avec une Gelée, après une soirée trop arrosée passée à la taverne.', 9, 13, '6e#a#0#0#0d0+10,77#a#0#0#0d0+10,9d#a#0#0#0d0+10');
