INSERT INTO `website_shop_objects_templates` VALUES (909, 11, 'Puissantes Bottes de Poursuite', 'Ces bottes permettaient à Hogmeiser de poursuivre les seuls êtres vivants qu\'il ne supportait pas, les enfants. Heureusement pour eux, la lourdeur de ces bottes l\'empêchait de leur botter le derrière.', 10, 39, '65#1#0#0#0d0+1,7b#28#0#0#0d0+40,80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (910, 11, 'Bottes d\'Hogmeiser', 'Ces bottes ont appartenu à Hogmeiser pendant des années, avant qu\'il ne les perdent lors d\'un pari stupide avec Grizmine. La morale de l\'histoire, c\'est qu\'il ne faut jamais jouer avec un Ecaflip.', 11, 76, '7c#1f#28#0#1d10+30,77#1f#28#0#1d10+30,73#5#6#0#1d2+4,70#3#4#0#1d2+2,b6#1#0#0#0d0+1,7d#1f#28#0#1d10+30');
INSERT INTO `website_shop_objects_templates` VALUES (911, 11, 'Bottes Usées d\'Hogmeiser', 'Ces bottes usées ont appartenu à Hogmeiser pendant des années, elles sont tellement usées, qu\'elles sont surtout handicapantes. Un très bon Cordonnier devrait pouvoir les réparer avec de la chance.', 11, 1, '65#1#0#0#0d0+1,7f#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (912, 11, 'Bottes Dorées d\'Hogmeiser', 'Ces magnifiques bottes d\'Hogmeiser sont recouvertes d\'une fine couche de pierres précieuses, pour les rendre insensibles à certaines attaques magiques. C\'est avec ces bottes que Brouce Boulgoure a écrasé la tête du Roi des Abraknydes il y a très longtemps, pour animer l\'ouverture de la foire du Trool.', 12, 99, '7d#33#46#0#1d20+50,70#5#6#0#1d2+4,73#7#8#0#1d2+6,b6#1#2#0#1d2+0,b7#a#c#0#1d3+9,77#24#32#0#1d15+35,7c#1f#28#0#1d10+30');
INSERT INTO `website_shop_objects_templates` VALUES (916, 1, 'Amulette de Silicate', 'Silicate a confectionné cette Amulette un matin d\'hiver, pour un célèbre aventurier du nom de Rimb Vardi, qui pourchassait un vieux Bwork Mage, responsable de plusieurs catastrophes naturelles déclenchées par sa magie trop approximative.', 9, 37, '73#a#0#0#0d0+10,99#14#0#0#0d0+20,9a#1e#0#0#0d0+30,b7#1#0#0#0d0+1,b8#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (917, 1, 'La Feuille d\'Automne', 'Cette Broche a été confectionnée un matin d\'automne au milieu d\'une forêt de Hêtres et d\'Ormes non loin de l\'île d\'Olag-lacustre. Elle est considérée par nombre de bûcherons comme une véritable relique.', 64, 89, '73#6#a#0#1d5+5,75#1#2#0#1d2+0,77#15#32#0#1d30+20,7b#15#32#0#1d30+20,9b#32#0#0#0d0+50,9d#32#0#0#0d0+50,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (918, 50, 'Ambre Ancestrale', 'Cette ambre provient d\'un Abraknyde Ancestral, elle a donc une valeur inestimable, et peut conférer des propriétés magiques à certains objets si elle est travaillée par des mains habiles.', 108, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (919, 5, 'Dagues Ancestrales', 'Ces puissantes dagues, forgées à l\'ancienne à partir d\'Ambre Ancestrale, ont servi pendant la colonisation de l\'île de Moon, avant que cette dernière ne redevienne sauvage.', 8, 34, '64#6#a#0#1d5+5,70#1#0#0#0d0+1,7e#32#0#0#0d0+50,9d#1e#0#0#0d0+30');
INSERT INTO `website_shop_objects_templates` VALUES (920, 38, 'Bois Ancestral', 'Ce bois provient d\'un Orme de l\'île d\'Olag-lacustre, qui a été foudroyé un matin d\'automne, par un Bwork Mage qui maîtrisait assez mal ses sorts élémentaires.', 140, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (922, 7, 'Marteau du Forgeur de Haches', 'Outil indispensable à la création de haches.', 2, 1, '64#2#4#0#1d3+1,ae#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (923, 19, 'Fendeuse d\'Abraknyde', 'Cette hache de guerre a été forgée par Kademlia Boulgoure, pour combattre les plus terrifiants Abraknydes. La légende raconte que cette arme légendaire a tué en une nuit plus d\'Abraknydes qu\'il n\'existe d\'arbres en Amakna.', 12, 74, '64#15#23#0#1d15+20,6e#1e#0#0#0d0+30,76#1e#0#0#0d0+30,7c#1e#0#0#0d0+30,8a#a#0#0#0d0+10,9b#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (924, 11, 'Puissantes Bottes de Klime', 'L\'agilité que confère ces bottes permettait à Klime le cordonnier de monter facilement sur le dos de n\'importe quel Bouftou. Il est mort en confondant un Bouftou avec une Gelée, après une soirée trop arrosée passée à la taverne.', 9, 19, '6e#19#0#0#0d0+25,77#19#0#0#0d0+25,9d#1e#0#0#0d0+30');
INSERT INTO `website_shop_objects_templates` VALUES (926, 38, 'Bois Envoûté ', 'Ce bois a été envoûté par un Mage Abraknyde, pour donner vie à un petit Abraknyde une fois trempé dans l\'eau. Il va de soi que ce bois est extrêmement magique.', 140, 45, '');
INSERT INTO `website_shop_objects_templates` VALUES (927, 19, 'Fendeuse d\'Abraknyde Ancestral', 'Cette hache de guerre a été forgée par Kademlia Boulgoure, pour combattre l\'Abraknyde Ancestral. Seuls les meilleurs guerriers sont à même de pouvoir l\'utiliser.', 13, 93, '64#15#23#0#1d15+20,73#a#0#0#0d0+10,76#1a#23#0#1d10+25,7e#1a#23#0#1d10+25,8a#a#0#0#0d0+10,99#b#14#0#1d10+10,9c#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (928, 6, 'Lame d\'Ogralimde', 'Ogralimde était un grand guerrier qui devait sa force à Adyol son maître, un puissant Bwork Mage d\'une intelligence surprenante. Mais l\'élève n\'a jamais dépassé le maître, contrairement à ce que raconte la légende.', 12, 45, '64#b#1c#0#1d18+10');
INSERT INTO `website_shop_objects_templates` VALUES (929, 50, 'Kristalite', 'Cette pierre magique au nom particulier n\'est pas à mettre en toutes les mains étant donné la puissance qu\'elle peut conférer aux armes ou aux bijoux.', 705, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (930, 24, 'Carte au trésor des Mineurs Sombres', 'Cette carte indique l\'emplacement du coffre des Mineurs Sombres : \\n\"Le coffre est situé sur une île, il faut passer derrière une fonderie pour y accéder\".', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (931, 24, 'Carte au trésor des Boulangers Sombres', 'Cette carte indique l\'emplacement du coffre des Boulangers Sombres: \\n\"Le coffre est situé sur une île au sud d\'Amakna, il faut passer derrière des rochers entre deux petits étangs\".', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (932, 17, 'Petite Cape de Rougeur', 'Cette cape augmente la vie de son porteur.', 13, 8, '6e#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (933, 17, 'Cape de Rougeur', 'Cette cape augmente la vie de son porteur.', 13, 13, '6e#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (934, 17, 'Grande Cape de Rougeur', 'Cette cape augmente la vie de son porteur.', 13, 16, '6e#10#14#0#1d5+15');
INSERT INTO `website_shop_objects_templates` VALUES (935, 17, 'Petite Cape Bleutée', 'Cette cape augmente la chance de son porteur.', 18, 1, '7b#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (936, 17, 'Cape Bleutée', 'Cette cape augmente la chance de son porteur.', 18, 3, '7b#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (937, 17, 'Grande Cape Bleutée', 'Cette cape augmente la chance de son porteur.', 18, 6, '7b#1#f#0#1d15+0');
INSERT INTO `website_shop_objects_templates` VALUES (938, 24, 'Carte au trésor des Forgerons Sombres', 'Cette carte indique l\'emplacement du coffre des Forgerons Sombres: \\n-- a faire --', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (939, 24, 'Carte au trésor des Bworks', 'Cette carte indique l\'emplacement du coffre des Bworks : \\n\"L\'accès au coffre est situé dans une impasse, dans le Sud-Est de la forêt sombre. Il sera certainement protégé par un groupe de Bworks\".', 7, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (940, 16, 'Louffeur', 'Le Louffeur prévient des dégâts physiques.', 20, 1, 'b8#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (941, 16, 'Bandeau Komintot', 'Le Komintot permet d\'augmenter la sagesse de son porteur.', 22, 1, '7c#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (942, 16, 'Lisseur', 'Le Lisseur prévient des dégâts magiques.', 23, 1, 'b7#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (943, 16, 'Petit Bandeau de Vitalité ', 'Ce Bandeau permet d\'augmenter la vitalité de son porteur.', 20, 1, '6e#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (944, 16, 'Bandeau de Vitalité ', 'Ce Bandeau permet d\'augmenter la vitalité de son porteur.', 20, 1, '6e#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (945, 17, 'Petite Cape Sombre', 'Cette cape augmente la sagesse de son porteur.', 15, 8, '7c#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (946, 17, 'Cape Sombre', 'Cette cape augmente la sagesse de son porteur.', 15, 12, '7c#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (947, 17, 'Grande Cape Sombre', 'Cette cape augmente la sagesse de son porteur.', 15, 19, '7c#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (948, 17, 'Abracape', 'Cette magnifique cape est un brillant mélange entre l\'essence d\'Abraknyde et le bon Bouftou des familles.', 16, 10, '6f#1#0#0#0d0+1,7d#1#1e#0#1d30+0,98#b#d2#0#1d200+10,9a#b#d2#0#1d200+10,9b#b#136#0#1d300+10,9d#b#136#0#1d300+10');
INSERT INTO `website_shop_objects_templates` VALUES (949, 16, 'Grand Bandeau de Vitalité ', 'Ce Bandeau permet d\'augmenter la vitalité de son porteur.', 20, 3, '6e#1#f#0#1d15+0');
INSERT INTO `website_shop_objects_templates` VALUES (951, 20, 'Aiguilles et Fil', 'Ces aiguilles et ce fil vous permettront d\'exercer le métier de tailleur.', 4, 1, '64#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (952, 17, 'Cape du Mulou Fou', 'Cette cape a été confectionné grâce à des poils et autres élèments organiques de diverses Mulous... On peut dire qu\'elle respire la puissance.', 3, 33, '6e#15#3c#0#1d40+20,8a#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (953, 17, 'Cape du Tofu Fou', 'Cette cape, cousue main avec des plumes de Tofus, permet au héros qui la porte de courir plus vite et de s\'échapper plus facilement des zones de tacle.', 19, 36, '77#1#64#0#1d100+0,80#1#0#0#0d0+1,98#64#0#0#0d0+100,9b#64#0#0#0d0+100,9d#64#0#0#0d0+100');
INSERT INTO `website_shop_objects_templates` VALUES (954, 17, 'La Samoulaille', 'La Samoulaille est une cape légendaire, brodée par les tailleurs pour les guerriers préférant les combats au corps à corps.', 2, 22, '70#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (955, 17, 'Cape Hilère', 'La cape Hilère est un type de cape très demandée par les coiffeurs. Ils adorent se rouler dedans. Elle rend les cheveux de son porteur plus résistants aux chocs.', 5, 34, '6e#1f#64#0#1d70+30');
INSERT INTO `website_shop_objects_templates` VALUES (956, 17, 'Cape Rice', 'Cette cape augmente la portée de son porteur, lui permettant d\'atteindre des cibles très éloignées, ou d\'impressionner les aventuriers un peu naïfs.', 7, 33, '75#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (957, 17, 'La Boufteuse', 'La Boufteuse augmente les dégâts et la vitalité de son porteur. Cependant elle dégage une forte odeur, et il n\'est pas rare qu\'un bouftou vous prenne pour l\'un des siens.', 12, 23, '6e#b#14#0#1d10+10,8a#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (958, 17, 'Dofusteuse', 'Cette cape est certainement l\'une des plus puissantes au monde. Elle augmente toutes les caractéristiques de son porteur.', 8, 6, '76#1#32#0#1d50+0,77#1#32#0#1d50+0,7b#1#32#0#1d50+0,7c#1#14#0#1d20+0,7d#1#32#0#1d50+0,7e#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (959, 24, 'Carte au trésor 5', '-- a faire --', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (960, 24, 'Potion Wabbit', 'Cette potion est un remède contre la myxomawose. Une gorgée de ce breuvage vous permet de visiter l\'île des wabbits sans craindre pour votre vie.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (961, 24, 'Clé Wabbit', 'Une des trois clés permettant d\'ouvrir la porte du château wabbit.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (962, 24, 'Clé Wabbit', 'Une des trois clés permettant d\'ouvrir la porte du château wabbit.', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (963, 24, 'Clé Wabbit', 'Une des trois clés permettant d\'ouvrir la porte du château wabbit.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (965, 50, 'Pierre de Dopeul', 'Cette pierre vient du monde des Dopeuls. Elle a une très grande valeur auprès de certains habitants d\'Amakna.', 663, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (966, 25, 'Manuel du Tailleur', '(Double clic pour apprendre le métier de Tailleur) \\nCe manuel de tailleur vous permet d\'apprendre les ficelles du métier. Pour ceux dont l\'imagination ferait défaut, les premières pages proposent des patrons simples à découper.', 13, 1, '25b#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (967, 17, 'Cape Fulgurante', 'Cette magnifique cape augmente les points d\'action de son porteur. Elle augmente également sa vitalité et sa sagesse.', 78, 55, '6e#1#1e#0#1d30+0,6f#1#0#0#0d0+1,70#1#3#0#1d3+0,7c#1#14#0#1d20+0');
INSERT INTO `website_shop_objects_templates` VALUES (968, 10, 'Ceinture Fulgurante', 'Cette magnifique ceinture augmente les points d\'action de son porteur. Elle augmente également sa vitalité et sa sagesse.', 10, 30, '6e#1#1e#0#1d30+0,6f#1#0#0#0d0+1,70#1#3#0#1d3+0,7c#1#1e#0#1d30+0');
INSERT INTO `website_shop_objects_templates` VALUES (969, 16, 'Couronne du Wa Wabbit', 'Cette magnifique couronne a appartenu au tristement célèbre Wa Wabbit.', 21, 30, '6e#1#64#0#1d100+0');
INSERT INTO `website_shop_objects_templates` VALUES (970, 4, 'Bâton du Wa Wabbit', 'Ce bâton appartenait au tristement célèbre Wa Wabbit.', 21, 25, '64#b#1e#0#1d20+10,6e#1#64#0#1d100+0');
INSERT INTO `website_shop_objects_templates` VALUES (971, 17, 'Cape du Wa Wabbit', 'Cette cape appartenait au tristement célèbre Wa Wabbit. Elle est encore imprégnée de sa transpiration, ce qui vous permettra de vous remémorer ce magnifique combat à chaque fois que vous la porterez.', 21, 30, '6e#1#64#0#1d100+0');
INSERT INTO `website_shop_objects_templates` VALUES (972, 23, 'Dofus Cawotte', 'Le Dofus Cawotte augmente la sagesse de son porteur.', 6, 6, '7c#6#32#0#1d45+5');
INSERT INTO `website_shop_objects_templates` VALUES (973, 24, 'Patte d\'Araknelle', 'Une patte très fine, mais très poilue. Les meilleurs Alchimistes arrivent à créer de puissants poisons avec le jus qu\'ils arrivent à extraire de ces pattes.', 11, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (974, 24, 'Tête du Paysan en détresse', 'Ce qui devait arriver est arrivé, le Paysan en détresse a fini par perdre la tête.', 12, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (975, 24, 'Canine du Vampire Captif', 'Cette dent très pointue, provient d\'un Vampire. La posséder dans son inventaire ou la porter autour du cou vous permettra d\'impressionner vos amis en leur faisant croire que vous êtes un chasseur de Vampires.', 13, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (976, 16, 'Citwouille', 'La citwouille a la particularité d\'empêcher la dispersion des particules de magie, cela en fait un très bon isolant magique. C\'est d\'ailleurs pour cela que certains guerriers se servent de ce légume comme couvre-chef.', 24, 20, 'b7#1#a#0#1d10+0,b8#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (989, 42, 'Shigekax Citron', 'Retrouvez la saveur et tout le charme des sucreries d\'antan... avec ce bonbon au citron préparé de façon traditionnelle.', 23, 1, '8b#64#0#0#0d0+100');
INSERT INTO `website_shop_objects_templates` VALUES (990, 42, 'Shigekax Fraise', 'Retrouvez la saveur et tout le charme des sucreries d\'antan... avec ce bonbon à la fraise préparé de façon traditionnelle.', 25, 1, '8b#46#0#0#0d0+70');
INSERT INTO `website_shop_objects_templates` VALUES (991, 42, 'Shigekax Menthe', 'Retrouvez la saveur et tout le charme des sucreries d\'antan... avec ce bonbon à la menthe préparé de façon traditionnelle.', 24, 1, '8b#c8#0#0#0d0+200');
INSERT INTO `website_shop_objects_templates` VALUES (992, 42, 'Shigekax Cerise', 'Retrouvez la saveur et tout le charme des sucreries d\'antan... avec ce bonbon à la cerise préparé de façon traditionnelle.', 19, 1, '8b#32#0#0#0d0+50');
INSERT INTO `website_shop_objects_templates` VALUES (993, 42, 'Vertgely', 'Préparé à base de gelée menthe, même si il a rebuté plus d\'un végétarien, il n\'en reste pas moins une des spécialités d\'Amakna.', 21, 1, '6e#33#64#0#1d50+50');
INSERT INTO `website_shop_objects_templates` VALUES (994, 42, 'Rougely', 'Préparé à base de gelée à la fraise, même si il a rebuté plus d\'un végétarien, il n\'en reste pas moins une des spécialités d\'Amakna.', 20, 1, '6e#65#c8#0#1d100+100');
INSERT INTO `website_shop_objects_templates` VALUES (995, 42, 'Blugely', 'Préparé à base de gelée bleue, même s\'il a rebuté plus d\'un végétarien, il n\'en reste pas moins une des spécialités d\'Amakna.', 22, 1, '6e#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (996, 42, 'Multygely', 'La multygely a été interdite à la vente, car elle a provoqué la disparition de nombreux enfants. \\nIl parait qu\'elle envoie la personne qui la mange dans ses pires cauchemars.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (997, 46, 'Noix de Kokoko', 'Aussi ronde qu\'un boulet de canon, cette noix possède en plus 3 trous très pratiques pour la soulever et la lancer au loin.', 159, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (998, 15, 'Caleçon Mignon du Capitaine Pirate', 'Le caleçon du Capitaine Pirate vérifie que le ridicule tue quand même de temps en temps. Mais il semblerait pourtant qu\'il porte chance.', 163, 82, '');
INSERT INTO `website_shop_objects_templates` VALUES (999, 55, 'Toile peu ragoutante', 'Gluant et malodorant, ce large tissu n\'en reste pas moins de qualité. Dommage qu\'il soit percé.', 164, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1000, 15, 'Tonneau vide', 'Ce gros tonneau est vide depuis fort longtemps, on peut quand même deviner tout ce qu\'il a contenu : rhum, kamas, pirates ivres... un peu de tout, mais vraisemblablement jamais d\'eau.', 165, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1001, 95, 'Planche en bois de Kokoko', 'Futur fragment de bateau ? Futur sol de maison ? Dans tous les cas, ça n\'est pour l\'instant qu\'une planche comme les autres.', 166, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (1002, 38, 'Tronc de Kokoko', 'Comme tous les troncs, celui du Kokotier est droit et solide, mais un peu plus fin que la moyenne.', 167, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (1003, 38, 'Poutre en Bois de Kokoko', 'Une poutre de bois solide à ne pas mettre dans l\'oeil.', 168, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (1004, 15, 'Indispensable Corde', 'Tous les aventuriers savent qu\'il faut toujours avoir une corde comme celle-ci sur soi... Pourtant, personne n\'en emporte jamais.', 170, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1005, 24, 'Reçu pour le radeau', 'Un reçu signé de la main de Kib Roche, indiquant que votre radeau sera prêt d\'ici quelque temps.', 176, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1006, 24, 'Chapeau Pirate', 'Chapeau aux formes imposantes, insigne de mort brodé sur le devant, fourrure pour faire joli, ce chapeau de pirate est un classique parmi les capitaines.', 14, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1007, 24, 'Crochet', 'Accessoire indispensable aux pirates en manque de chance, ce crochet remplace avantageusement une main. Sa couleur lui donne en plus un aspect assez chic.', 15, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1008, 24, 'Mâchoire tombante', 'Cette mâchoire en collier provient certainement d\'une colère d\'un capitaine envers un matelot trop hilare à la vue du caleçon de son chef.', 16, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1009, 24, 'Crâne de pirate', 'Ce crâne coiffé d\'un bandeau montre bien qu\'un pirate, même mort, peut encore se cacher d\'être chauve.', 17, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1010, 24, 'Carapace verte', 'La carapace d\'une tortue folle qui se prenait pour un ninja.', 18, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1011, 24, 'Carapace jaune', 'La carapace d\'une tortue folle qui avait abusé sans doute de substances dangereuses.', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1012, 24, 'Carapace Rouge', 'La carapace d\'une tortue folle qui mangeait des tomates et du fromage sur du pain chaud.', 20, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1013, 24, 'Carapace Bleue', 'La carapace d\'une tortue folle qui voulait imiter Zowwo, le Wenard masqué.', 21, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1014, 24, 'Masque Vert', 'Masque de Kanniboul rieur, à l\'image de la Verdure, élément d\'assaisonnement de la viande.', 22, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1015, 24, 'Masque Jaune', 'Masque de kanniboul pleureur, à l\'image de la Foudre, élément qui effraye souvent la jeune viande.', 23, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1016, 24, 'Masque Rouge', 'Masque de kanniboul colérique, à l\'image du Feu, élément de cuisson de la viande.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1017, 24, 'Masque Bleu', 'Masque de Kanniboul surpris, à l\'image de l\'Eau, élément désaltérant entre deux bouchées de viande.', 25, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1018, 15, 'Kole', 'Ce pot de gelée rose à la bonne odeur ne doit surtout pas être goûté. Sinon vous ne pourriez plus jamais parler tant ce liquide est fixant.', 171, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1019, 16, 'Casque', 'Porter ce casque signifie adopter un look unique... A mi-chemin entre le ridicule et le comique.', 25, 20, '7d#b#f#0#1d5+10,7c#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (1020, 15, 'Casque cassé ', 'Ce casque vous a sauvé la vie, mais n\'a pas réussi à sauver la sienne.', 173, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1021, 17, 'Ailes en bois', 'Pour ceux qui ont toujours rêvé de voler comme un Kwak, allez vous recoucher, car ces ailes ne feront de vous qu\'un danger public doublé d\'un idiot.', 22, 20, 'ae#33#64#0#1d50+50,9e#1f#32#0#1d20+30');
