INSERT INTO `website_shop_objects_templates` VALUES (1023, 15, 'Bouteille de rhum', 'L\'étiquette annonce un \"rhum 10 ans d\'age\", mais impossible à vérifier. Une annotation précise aussi de ne pas en abuser sur les routes sous peine de mal de mer.', 177, 1, '');
