INSERT INTO `website_shop_objects_templates` VALUES (1030, 5, 'Queues de Chatons', 'Cette paire de dagues est en fait un jouet magique. Créé pour amuser les jeunes Ecaflips, sa production fut interdite après qu\'un enfant adepte de Sram prit part au jeu.', 20, 25, '60#1#7#0#1d7+0,62#1#7#0#1d7+0,77#6#14#0#1d15+5,7b#6#14#0#1d15+5,99#6#2d#0#1d40+5');
INSERT INTO `website_shop_objects_templates` VALUES (1031, 5, 'Dagues Cruelles d\'Elorie Entuwan', 'Ces magnifiques dagues auraient appartenu à la Sramette la plus cruelle qu\'Amakna ait connu. Enfin, l\'une des plus cruelles... En fait, juste un peu plus que les autres, enfin au moins autant que les autres, ce qui est déjà pas mal !', 7, 40, '64#10#14#0#1d5+15,77#15#28#0#1d20+20,7f#1#0#0#0d0+1,7d#15#28#0#1d20+20,70#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (1032, 5, 'Petite Lame de Fon', 'Cette dague était utilisée autrefois par la confrérie secrète de Fon. Cette guilde voulait plonger Amakna dans le chaos. Finalement, elle coula en premier quand l\'île qui les cachait fut submergée par les flots.', 14, 44, '64#5#b#0#1d7+4,73#1#0#0#0d0+1,77#19#0#0#0d0+25,7b#d#0#0#0d0+13,9c#5#0#0#0d0+5');
