INSERT INTO `website_shop_objects_templates` VALUES (1040, 5, 'Lames Sanglantes D\'Ortimus Contrari', 'Ortimus Contrari est une légende parmi les assassins. Il exécute toujours ses contrats d\'une manière totalement opposée aux méthodes traditionnelles. N\'en demandez pas plus, vous pourriez mourir dans l\'instant.', 19, 80, '64#b#12#0#1d8+10,65#1#0#0#0d0+1,73#3#5#0#1d3+2,77#1f#32#0#1d20+30,7c#b#14#0#1d10+10,80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1041, 5, 'Epée Cassée du Chevalier Malchanceux', 'Cette épée fut donnée à Souzé Schel, un jeune Iop, lors de son adoubement. Malheureusement, lors de sa première mission de chevalier, il glissa sur une pierre qui se trouvait être un craqueleur...', 43, 35, '64#c#1a#0#1d15+11,76#14#0#0#0d0+20,7d#f#0#0#0d0+15,9a#14#0#0#0d0+20');
