INSERT INTO `website_shop_objects_templates` VALUES (1046, 8, 'Petite Pelle Melle', 'Quoi de mieux qu\'une pelle écologique pour mettre un terme aux mauvaises herbes ? Cette pelle est la réponse, avec elle vous pourrez aisément arracher des pissenlits et les faire manger à vos ennemis, en commençant par la racine !', 18, 38, '64#e#14#0#1d7+13,70#1#0#0#0d0+1,76#1e#0#0#0d0+30,7b#14#0#0#0d0+20,9b#1e#0#0#0d0+30');
