INSERT INTO `website_shop_objects_templates` VALUES (1050, 8, 'Petite Pelle Woukuis', 'Cette pelle fut créée et utilisée par la famille Woukuis dans la guerre intestine entre les groupes Elle-Poma et Touge-Woukuis, concurrents directs d\'exportation de tofus grillés. C\'est une arme redoutable, son seul défaut est de rendre les mains grasses.', 21, 49, '64#10#19#0#1d10+15,73#2#0#0#0d0+2,76#23#0#0#0d0+35,7e#23#0#0#0d0+35,99#23#0#0#0d0+35');
