INSERT INTO `website_shop_objects_templates` VALUES (1054, 8, 'Cruelle Pelle-Truelle', 'Croisement entre une pelle et une 1lle, la pelle-1lle perdit son caractère utile pour devenir une arme incontournable. Rapide à manier et à ranger grâce à sa petite taille, c\'est l\'accessoire idéal de tout Enutrof aimant l\'alcool.', 15, 53, '64#6#a#0#1d5+5,70#1#2#0#1d2+0,77#b#28#0#1d30+10,80#1#0#0#0d0+1,9b#29#3c#0#1d20+40,9d#29#3c#0#1d20+40');
