INSERT INTO `website_shop_objects_templates` VALUES (1068, 7, 'Petite Masse Tmosfer', 'Cette masse permet à son porteur de connaître le temps qu\'il fera. Du moins, son inventeur le pensait-il avant de mourir foudroyé. On s\'aperçut bien plus tard que cette masse était aussi habile à recevoir les coups qu\'à les distribuer.', 14, 34, '64#d#11#0#1d5+12,6e#f#0#0#0d0+15,7c#8#0#0#0d0+8,98#f#0#0#0d0+15,b8#1#0#0#0d0+1');
