INSERT INTO `website_shop_objects_templates` VALUES (1072, 7, 'Petit marteau Outar', 'Outar Grand Bwork aurait commandé ces marteaux redoutables à un village Xélor contre un traité de paix: s\'ils étaient efficaces, le village serait épargné. Quand les marteaux furent livrés, le village fut rasé. Après tout, il fallait bien les essayer !', 6, 36, '64#11#18#0#1d8+16,70#1#0#0#0d0+1,76#19#0#0#0d0+25,7b#a#0#0#0d0+10,99#14#0#0#0d0+20');
