INSERT INTO `website_shop_objects_templates` VALUES (1084, 7, 'Marteau à Torts', 'Ce terrible marteau vous permettra enfin de prouver que les personnes pensant que le muscle prime sur le cerveau ont tort! (Ceci n\'est valable uniquement sur des personnes moins fortes, les autres, n\'oubliez pas, ont TOUJOURS raison)', 20, 81, '64#b#14#0#1d10+10,7b#15#28#0#1d20+20,7c#15#1e#0#1d10+20,7e#15#32#0#1d30+20,99#b#28#0#1d30+10');
INSERT INTO `website_shop_objects_templates` VALUES (1085, 7, 'Marteau des Falistos', 'Les Falistos sont des démons Xélors. Ayant renié leurs anciens principes, ils ont développé leur force en forgeant des marteaux toujours plus puissants. Après avoir apporté le chaos, ils furent battus et bannis sous terre. Mais quelques armes subsistèrent.', 19, 79, '64#1f#32#0#1d20+30,7d#1f#32#0#1d20+30,74#1#2#0#1d2+0,76#29#50#0#1d40+40,7c#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (1086, 15, 'Peinture noire', 'Ce pot de peinture vous sera utile pour repeindre n\'importe quoi. Votre maison, votre tofu domestique, vos amis, même vous si vous le voulez.', 175, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1087, 9, 'Anneau du Mental', 'Cet anneau permet d\'augmenter légèrement l\'intelligence de son porteur.', 36, 14, '7e#b#14#0#1d10+10');
