INSERT INTO `website_shop_objects_templates` VALUES (1324, 36, 'Herbe à chat', 'Cette plante fait saliver n\'importe quel Ecaflip.', 46, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1325, 46, 'Coque de Noix', 'Cette coque, naturellement solide, résiste à tout type d\'agression et représente bien l\'idéologie Féca.', 52, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1326, 51, 'Silex Sanglant', 'Cette pierre aussi résistante que coupante semble avoir été utilisé contre quelque chose ou quelqu\'un. Cet aspect brut et dangereux semble illustrer parfaitement la définition d\'un Iop.', 47, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1327, 47, 'Os taillé ', 'Cet objet de mort devient redoutable une fois travaillé, exactement comme un Sram.', 48, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1328, 15, 'Kama énigmatique', 'Ce Kama est orné d\'une tête de tofu coiffé d\'un chapeau étrange.', 182, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1329, 38, 'Bois élastique', 'Cette grande branche de bois, par son retour élastique et sa forme curviligne, fait immédiatement penser aux Crâ.', 49, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1330, 1, 'Amulette Itby', 'Création originale de l\'orfèvre John Les Nonnes, c\'est aujourd\'hui un des bijoux les plus classiques.', 31, 10, '77#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (1331, 1, 'Médaille Oly', 'Oly était une disciple de Iop dont le seul talent était la cuisine. On rapporte que Iop en personne lui aurait donné cette médaille, pour compenser ses trop grandes faiblesses en combat. Cependant seuls les coeurs purs peuvent la porter.', 23, 51, '70#6#0#0#0d0+6,76#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (1332, 36, 'Vieux Trèfle à 4 feuilles', 'Les trèfles à quatre feuilles sont bien plus rares que ceux à cinq feuilles. Lorsque vous en trouvez-un, il est conseillé de le faire sécher entre deux parchemins de sorts.', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1333, 26, 'Potion d\'Etincelle', 'Cette potion chauffante, grâce à la faible magie de feu qu\'elle emprisonne, est généralement utilisée pour enchanter un peu toutes sortes d\'objets.', 1, 1, '2bc#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1334, 48, 'Blague de Soufre', 'Cette petite poche pleine de soufre dégage une odeur insupportable... La même que celle des Osamodas.', 51, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1335, 26, 'Potion de Crachin', 'Cette potion frémissante, grâce à la faible magie d\'eau qu\'elle emprisonne, est généralement utilisée pour enchanter un peu toutes sortes d\'objets.', 2, 1, '2bc#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1336, 36, 'Orties', 'En frottant vivement cette plante contre votre peau, vous souffrirez le martyr. Pourtant, la stimulation provoquée est bénéfique, exactement la philosophie des Sacrieurs', 53, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1337, 26, 'Potion de Courant d\'Air', 'Cette potion soupirante, grâce à la faible magie d\'air qu\'elle emprisonne, est généralement utilisée pour enchanter un peu toutes sortes d\'objets.', 3, 1, '2bc#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1338, 26, 'Potion de Secousse', 'Cette potion vibrante, grâce à la faible magie de terre qu\'elle emprisonne, est généralement utilisée pour enchanter un peu toutes sortes d\'objets.', 4, 1, '2bc#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1339, 35, 'Clochettes', 'Ces fleurs de muguet sont vraiment toutes petites, fragiles et mignonnes. On dit de plus qu\'elles ont le pouvoir de calmer l\'esprit et de guérir certains maux. Elles ont sûrement été conçues par une divinité qui souhaitait voir une plante à l\'image des Eniripsas.', 46, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1340, 26, 'Potion d\'Eboulement', 'Cette potion tremblante, grâce à la magie de terre qu\'elle emprisonne, est généralement utilisée pour enchanter correctement toutes sortes d\'objets.', 4, 25, '2bc#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1341, 26, 'Potion d\'Averse', 'Cette potion clapotante, grâce à la magie d\'eau qu\'elle emprisonne, est généralement utilisée pour enchanter correctement toutes sortes d\'objets.', 2, 25, '2bc#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1342, 26, 'Potion de Rafale', 'Cette potion sifflante, grâce à la magie d\'air qu\'elle emprisonne, est généralement utilisée pour enchanter correctement toutes sortes d\'objets.', 3, 25, '2bc#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1343, 26, 'Potion de Flambée', 'Cette potion crépitante, grâce à la magie de feu qu\'elle emprisonne, est généralement utilisée pour enchanter correctement toutes sortes d\'objets.', 1, 25, '2bc#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1344, 36, 'Verveine', 'Cette plante spéciale permet de faire dormir n\'importe qui bien plus facilement. Cela doit probablement être l\'emblême des Sadida.', 53, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1345, 26, 'Potion d\'Incendie', 'Cette potion fulminante, grâce à la puissante magie de feu qu\'elle emprisonne, est généralement utilisée pour enchanter puissamment toutes sortes d\'objets.', 1, 50, '2bc#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1346, 26, 'Potion de Tsunami', 'Cette potion inondante, grâce à la puissante magie d\'eau qu\'elle emprisonne, est généralement utilisée pour enchanter puissamment toutes sortes d\'objets.', 2, 50, '2bc#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1347, 26, 'Potion d\'Ouragan', 'Cette potion hurlante, grâce à la puissante magie d\'air qu\'elle emprisonne, est généralement utilisée pour enchanter puissamment toutes sortes d\'objets.', 3, 50, '2bc#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1348, 26, 'Potion de Séisme', 'Cette potion embourbante, grâce à la puissante magie de terre qu\'elle emprisonne, est généralement utilisée pour enchanter puissamment toutes sortes d\'objets.', 4, 50, '2bc#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1350, 2, 'Arc Holic', 'Cet arc a été créé par un magicien porté sur la bouteille. Afin de résoudre son problème, il a inventé cet arc spécialisé dans l\'eau.', 4, 15, '60#5#e#0#1d10+4,9a#1#1e#0#1d30+0');
INSERT INTO `website_shop_objects_templates` VALUES (1351, 2, 'Arc du Xueluom', '\"Avec un arc, ça passe ou ça casse\", dit le proverbe. Les sages éviteront cet arc, il serait soi-disant porteur du mauvais oeil...', 51, 30, '60#1#1e#0#1d30+0');
INSERT INTO `website_shop_objects_templates` VALUES (1352, 2, 'Arc de Boo', 'Cet arc prend sa force aussi bien de la terre que de l\'eau. Malheur à ceux qui ne maîtrisent ni l\'un ni l\'autre...', 6, 50, '60#3#a#0#1d8+2,61#3#a#0#1d8+2,7d#1#19#0#1d25+0,98#1#19#0#1d25+0,9a#1#19#0#1d25+0,9b#1#19#0#1d25+0,9d#1#19#0#1d25+0');
INSERT INTO `website_shop_objects_templates` VALUES (1353, 2, 'Arc à Poulie Sciée', 'Cet arc, dont toutes les poulies ont été sciées, était, il y a fort longtemps, le symbole de la lutte du bien contre le mal. \\nEncore aujourd\'hui, on peut sentir en lui la flamme des anciens justiciers.', 10, 41, '63#9#12#0#1d10+8,73#1#0#0#0d0+1,7c#1#a#0#1d10+0,7d#1#28#0#1d40+0');
INSERT INTO `website_shop_objects_templates` VALUES (1354, 2, 'L\'Arc à Hick', 'Hick était un Crâ maudit : il n\'arrivait jamais à se débarrasser de son hoquet. Cependant, il finit un jour par jeter son arc au feu pour le remplacer par une épée, et son mal disparu mystérieusement...', 11, 50, '63#6#f#0#1d10+5,7c#5#0#0#0d0+5,9a#1#1e#0#1d30+0,b8#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (1355, 2, 'Arc Hidsad', 'Le créateur de cet arc, un certain Marc Hidsad, n\'a jamais très bien su s\'en servir. Il pouvait tout autant infliger de sévères blessures à ses ennemis que de se blesser lui-même.', 12, 40, '62#c#2a#0#1d31+11,6c#c#2a#0#1d31+11,99#64#0#0#0d0+100,9b#1#28#0#1d40+0');
INSERT INTO `website_shop_objects_templates` VALUES (1356, 3, 'Demi-Baguette', 'Rika Zarouil la boulangère fut connue pour avoir été l\'eniripsa la plus petite de la contrée. Elle faisait son pain dans des petits-fours en carton et se battait avec des demi-baguettes.', 13, 11, '60#2#6#0#1d5+1,7d#5#0#0#0d0+5,7e#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (1357, 3, 'Daguette', 'Un sculpteur un peu farceur tenta de faire passer ses baguettes pour des dagues. Son stratagème n\'eu aucun succès mais ses baguettes, elles, en eurent.', 17, 35, '62#6#f#0#1d10+5,77#b#14#0#1d10+10,7c#6#a#0#1d5+5,7d#6#14#0#1d15+5,9d#1a#1e#0#1d5+25');
INSERT INTO `website_shop_objects_templates` VALUES (1359, 3, 'Le Tison Fûté ', 'Les origines de cette baguette restent obscures. Cependant, elle a toujours aidé ses heureux possesseurs à trouver les chemins les moins encombrés d\'Amakna, ce qui peut servir les jours de grande influence sur le domaine du bouftou royal.', 12, 59, '63#9#10#0#1d8+8,73#3#4#0#1d2+2,76#6#14#0#1d15+5,77#6#14#0#1d15+5,7e#10#1e#0#1d15+15,98#6#19#0#1d20+5');
INSERT INTO `website_shop_objects_templates` VALUES (1360, 3, 'L\'Hyldegarde', 'Cette baguette fut créée il y a de nombreuses années dans les flammes de la forge de Mort Dur. Cette arme nécessite d\'avoir toujours de l\'eau à côté de soi pour pouvoir maitriser son feu intérieur...', 8, 48, '60#b#17#0#1d13+10,76#3#7#0#1d5+2,7e#10#1e#0#1d15+15,99#1f#3c#0#1d30+30,9c#1f#3c#0#1d30+30');
INSERT INTO `website_shop_objects_templates` VALUES (1361, 3, 'Baguette Sylvien', 'La Baguette Sylvien a l\'étrange pouvoir de conférer une vue perçante à son porteur. Charge ensuite à celui ci d\'être suffisamment agile pour pouvoir fuir le danger.', 15, 43, '62#8#e#0#1d7+7,75#1#0#0#0d0+1,7b#1#a#0#1d10+0,7c#1#a#0#1d10+0,9d#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (1362, 3, 'Pieu Vampirique', 'Le pieu vampirique est en fait la baguette d\'un vampire depuis longtemps retiré de la vie sociale et de la boucherie. Cet étrange bout de bois a cependant gardé quelques uns des avantages de son ancien maître...', 14, 65, '5e#6#f#0#1d10+5,73#1#2#0#1d2+0,7d#1e#0#0#0d0+30,9b#1e#0#0#0d0+30');
INSERT INTO `website_shop_objects_templates` VALUES (1363, 4, 'Bâton Tont\'Ata', 'Outre son nom insupportable, ce bâton possède bien d\'autres moyens de rendre son propriétaire fou de rage.', 5, 40, '61#10#1e#0#1d15+15,7c#b#1e#0#1d20+10,98#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (1364, 4, 'Bâton d\'Oubli', 'Ce bâton fait oublier tous les soucis et les mauvaises pensées de son propriétaire. Malheureusement, il perd aussi parfois une partie de sa mémoire et devient sujet à des pertes de concentration de plus en plus fréquentes. A réserver aux sages...', 11, 30, '62#6#f#0#1d10+5,65#1#0#0#0d0+1,7b#15#1e#0#1d10+20,7c#15#1e#0#1d10+20,9b#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (1365, 4, 'La Canne Hête', 'Hète était vraiment un guerrier redoutable avec son bâton. Il était tellement efficace qu\'on prétendait que son bâton était magique et qu\'il lançait des flammes...', 68, 20, '63#6#d#0#1d8+5,7d#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (1366, 4, 'Bâton de Bouftier', 'Bâton couramment utilisé lors de la transhumance par les bouftiers. Les bworks aiment déguster ces troupeaux de bouftous en fines tranches lors de l\'apéritif (le plat principal étant constitué du bouftier lui-même).', 9, 12, '61#6#a#0#1d5+5,76#1#a#0#1d10+0,7d#1#a#0#1d10+0,7e#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (1367, 4, 'Bâton de Dina, dit \'le Mythe\'', 'Ce bâton a appartenu à la très belle Dina \'Mythe\', qui était surtout connue pour ses formes avantageuses et son caractère explosif... Bref c\'était une vraie bombe.', 6, 40, '62#6#a#0#1d5+5,7e#f#16#0#1d8+14,b8#5#9#0#1d5+4');
INSERT INTO `website_shop_objects_templates` VALUES (1368, 4, 'La Lance à un \"110\"', '\"Les 110\" est le surnom donné aux 110 valeureux pompiers Amakniens, qui ont notamment combattu le feu d\'un Dragonnet en mal de sensations fortes. Cette lance aurait appartenu à l\'un d\'eux. S\'en servir demande courage et force.', 18, 29, '60#8#c#0#1d5+7,b8#2#5#0#1d4+1');
INSERT INTO `website_shop_objects_templates` VALUES (1369, 5, 'Les Lames en Table', 'Ces couteaux étaient à l\'origine censés servir dans un restaurant de luxe. Mais devant leur look plutôt... étrange, le patron du restaurant a préféré les revendre à un lanceur de couteaux ambulant.', 13, 33, '62#1#f#0#1d15+0,77#6#23#0#1d30+5,9c#17#20#0#1d10+22');
INSERT INTO `website_shop_objects_templates` VALUES (1370, 5, 'L\'Ergot Mina', 'La poignée de cette arme est grasse et glissante, mais elle a vraiment un look génial.', 14, 20, '5b#6#8#0#1d3+5,7b#6#f#0#1d10+5,9a#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (1371, 5, 'Dagues Eulasse', 'Eulasse était un bouftier du nord d\'Amakna qui trouva un jour, au milieu du fumier de ses bouftous, une paire de dagues légèrement salies. \\nQue celui qui les porte fasse attention : le manche glisse, il est facile de manquer son coup.', 10, 40, '60#3#5#0#1d3+2,61#3#5#0#1d3+2,b7#2#5#0#1d4+1,b8#2#5#0#1d4+1');
INSERT INTO `website_shop_objects_templates` VALUES (1372, 5, 'Dagues Aj\'Deh\'Là ', 'Qui ne connait pas Aj\'Deh\'Là, l\'ermite, légendaire disciple de Sram qui avait passé sa vie à refuser tout contact avec les autres. À sa mort, on retrouva ses dagues fétiches à côté de son corps, et seuls les plus agiles purent les apprivoiser.', 19, 44, '62#6#a#0#1d5+5,80#1#0#0#0d0+1,9b#32#0#0#0d0+50');
INSERT INTO `website_shop_objects_templates` VALUES (1373, 5, 'Le Rasoir Infernal', 'Krys Razepa était un vieux disciple d\'Enutrof qui portait la barbe, comme tous les disciples d\'Enutrof dignes de ce nom. Lorsque madame Razepa, sa femme, lui offrit un rasoir, il préféra l\'utiliser pour combattre...', 17, 30, '63#8#c#0#1d5+7,99#10#19#0#1d10+15,9c#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (1374, 5, 'Dagues Tylo', 'Tylo était un scribe amaknéen qui vécut il y a des siècles de cela. Il avait la particularité de graver ses cahiers de pierre non pas avec des burins mais avec des dagues. Nous reste de lui cette superbe dague, impressionnante de résistance aux chocs.', 12, 30, '61#4#9#0#1d6+3,9a#15#32#0#1d30+20,b8#1#7#0#1d7+0');
INSERT INTO `website_shop_objects_templates` VALUES (1375, 19, 'Hache Térophyle', 'Térophyle était un disciple de Iop capable de soulever des masses impressionnantes. Mais malheureusement pour lui, comme tous les Iop trop musclés, l\'intelligence n\'était pas son fort...', 14, 15, '61#3#7#0#1d5+2,65#1#0#0#0d0+1,76#15#46#0#1d50+20');
INSERT INTO `website_shop_objects_templates` VALUES (1376, 19, 'Hache Heuvante', 'Cette hache, parfois lourde à manier, est parfaite pour terrasser les Trools : les runes magiques qu\'elle contient permettent en effet de brûler les ennemis.', 15, 35, '63#9#12#0#1d10+8,76#b#14#0#1d10+10,9a#33#50#0#1d30+50');
INSERT INTO `website_shop_objects_templates` VALUES (1377, 19, 'Hache Huré ', 'Huré était un jeune prêtre qui ne reculait pas devant les armes pour faire progresser la foi. Son arme de prédilection était une hache sur laquelle il avait dessiné de nombreux traits, dont la signification est perdue à jamais...', 16, 22, '60#7#b#0#1d5+6,7e#b#1e#0#1d20+10,9d#b#14#0#1d10+10,31b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1378, 19, 'Francisque à Brêles', 'Cette hache de combat, réservée aux jeunes guerriers, comme son nom l\'indique, a la particularité de produire un son strident particulièrement désagréable lorsqu\'elle entrechoque une autre arme.', 17, 28, '62#b#f#0#1d5+10,7d#b#14#0#1d10+10,9c#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (1379, 7, 'Le Scrounnchhh', 'D\'après la légende, ce marteau tirerait son nom du son qu\'il produit lorsqu\'il s\'écrase sur un crâne ennemi. Malheureusement, nul ennemi n\'est là pour confirmer ces dires.', 9, 35, '61#b#19#0#1d15+10,7c#3#4#0#1d2+2,9b#b#28#0#1d30+10');
INSERT INTO `website_shop_objects_templates` VALUES (1380, 43, 'Potion d\'oubli : \'Mot Curatif\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot Curatif\'', 36, 1, '268#0#0#79#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1381, 43, 'Potion d\'oubli : \'Mot Blessant\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot Blessant\'', 36, 1, '268#0#0#7a#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1382, 43, 'Potion d\'oubli : \'Mot Drainant\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot drainant\'', 36, 1, '268#0#0#7b#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1383, 7, 'Marteau Re\'Thu', 'Ce marteau a été forgé pendant des années et des années, par des dizaines de forgerons. Au final, on retrouve une arme splendide, mais qui a malheureusement hérité de ses concepteurs une certaine idée de la vitesse.', 5, 55, '60#10#1e#0#1d15+15,7b#b#f#0#1d5+10,76#b#f#0#1d5+10,77#b#f#0#1d5+10,7c#b#f#0#1d5+10,7d#b#f#0#1d5+10,7f#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (1384, 43, 'Potion d\'oubli : \'Mot Soignant\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot Soignant\'', 36, 1, '268#0#0#7c#0d0+0,2c6#0#0#0#0d0+0');
