INSERT INTO `website_shop_objects_templates` VALUES (1386, 43, 'Potion d\'oubli : \'Mot Stimulant\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot Stimulant\'.', 36, 1, '268#0#0#7e#0d0+0,2c6#0#0#0#0d0+0');
