INSERT INTO `website_shop_objects_templates` VALUES (1391, 43, 'Potion d\'oubli : \'Mot d\'Epine\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot d\'Epine\'.', 36, 1, '268#0#0#84#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1392, 43, 'Potion d\'oubli : \'Mot de Jouvence\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot de Jouvence\'.', 36, 1, '268#0#0#85#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1393, 7, 'Le Matronome', 'Ce marteau a été fabriqué à partir d\'une horloge, la fameuse horloge avalée par le Crocodaille qui avait dévoré la main du Captain\' Brochet. Si on a pu récupérer l\'horloge, on ne sait en revanche pas ce qu\'il est advenu de la main...', 21, 54, '62#a#d#0#1d4+9,75#1#0#0#0d0+1,7c#6#f#0#1d10+5,7e#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (1394, 43, 'Potion d\'oubli : \'Mot Vampirique\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot Vampirique\'.', 36, 1, '268#0#0#86#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1395, 43, 'Potion d\'oubli : \'Mot de Sacrifice\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot de Sacrifice\'.', 36, 1, '268#0#0#87#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1396, 43, 'Potion d\'oubli : \'Mot d\'Amitié\' ', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot d\'Amitié\'.', 36, 1, '268#0#0#81#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1397, 43, 'Potion d\'oubli : \'Mot d\'Immobilisation\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot d\'Immobilisation\'.', 36, 1, '268#0#0#88#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1398, 43, 'Potion d\'oubli : \'Mot d\'Envol\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot d\'Envol\'.', 36, 1, '268#0#0#89#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1399, 7, 'Maillet Aclou', 'Tout comme l\'amulette du même nom, le Maillet Aclou a la particularité de transformer votre énergie vitale en puissance. À consommer avec modération...', 12, 15, '63#8#c#0#1d5+7,70#1#3#0#1d3+0,99#33#64#0#1d50+50');
INSERT INTO `website_shop_objects_templates` VALUES (1400, 43, 'Potion d\'oubli : \'Mot de Silence\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot de Silence\'.', 36, 1, '268#0#0#8a#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1401, 43, 'Potion d\'oubli : \'Mot d\'Altruisme\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot d\'Altruisme\'', 36, 1, '268#0#0#8b#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1402, 43, 'Potion d\'oubli : \'Mot de Reconstitution\'', 'Cette potion permet de désapprendre un niveau du sort des Eniripsa : \'Mot de Reconstitution\'.', 36, 1, '268#0#0#8c#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1403, 7, 'Marteau Tau', 'Ce marteau a appartenu à Tau, un jeune disciple d\'Osamodas qui passait son temps à raconter des blagues stupides. Son marteau, tout comme lui, ne rend pas très intelligent, mais peut parfois détendre l\'atmosphère...', 3, 23, '62#6#11#0#1d12+5,76#6#f#0#1d10+5,7d#6#f#0#1d10+5,9b#15#28#0#1d20+20');
INSERT INTO `website_shop_objects_templates` VALUES (1404, 7, 'Marteau Toh\'Lo', 'Vous aimez les animaux ? Toh\'Lo aussi. Il leur avait même voué sa vie. Ce marteau raconte un peu son histoire , une grande communion avec les bêtes...', 15, 35, '63#10#14#0#1d5+15,9a#1f#50#0#1d50+30,9c#a#0#0#0d0+10,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1405, 12, 'Potion Eau de fée', 'Cette potion parvient à reproduire les mêmes pouvoirs de guérison que le sang d\'une Eniripsa. Plus besoin de les saigner à blanc maintenant.', 41, 60, '6e#4c#96#0#1d75+75');
INSERT INTO `website_shop_objects_templates` VALUES (1406, 12, 'Sang de Likrone', 'Cette potion reproduit fidèlement les effets du sang de Likrone, l\'immortalité en moins. \"Buvez-la et vous serez guéri de tous les maux\" comme disait le célèbre slogan.', 40, 60, '6e#65#c8#0#1d100+100');
