INSERT INTO `website_shop_objects_templates` VALUES (1426, 8, 'Pelle à Thart\'', 'Thart\', le créateur de cette pelle, était un disciple de Iop. Un nom prédestiné, pour un Iop, n\'est-ce pas ?', 8, 24, '60#b#f#0#1d5+10,7b#1#18#0#1d24+0,9b#10#1e#0#1d15+15');
INSERT INTO `website_shop_objects_templates` VALUES (1427, 8, 'Pelle Zébuth', 'Cette pelle est utilisée par les grands prêtres Kannibouls de l\'île de Moon pour invoquer Zébuth, une de leurs divinités souvent représentée sous une forme bovine. Seuls les personnages vils peuvent utiliser cette arme.', 40, 55, '60#10#23#0#1d20+15,7b#b#32#0#1d40+10,99#b#14#0#1d10+10,9a#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (1428, 36, 'Immortelle', 'Cette étrange petite plante pousse dans les milieux arides, et répand une odeur de curry aux alentours. Coriace, elle ne semble pas subir les assauts du temps... Si seulement l\'on pouvait en dire autant de toutes les femmes...', 54, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1429, 8, 'Petite Pelle Mechba', 'Cette pelle est utilisée par les Enutrof pour cueillir des fruits dans les arbres, mais elle peut s\'avérer une arme de combat redoutable. Comme dirait son créateur, Mechba : \'eche est beche, ma pelle\'.', 19, 30, '60#7#f#0#1d9+6,7b#7#9#0#1d3+6,7e#7#9#0#1d3+6,99#d#f#0#1d3+12');
INSERT INTO `website_shop_objects_templates` VALUES (1430, 8, 'Pelle Mechba', 'Cette pelle est utilisée par les Enutrof pour cueillir des fruits dans les arbres, mais elle peut s\'avérer une arme de combat redoutable. Comme dirait son créateur, Mechba : \'eche est beche, ma pelle\'.', 19, 45, '60#e#12#0#1d5+13,7b#b#d#0#1d3+10,7e#b#d#0#1d3+10,99#d#f#0#1d3+12');
INSERT INTO `website_shop_objects_templates` VALUES (1431, 8, 'Grande Pelle Mechba', 'Cette pelle est utilisée par les Enutrof pour cueillir des fruits dans les arbres, mais elle peut s\'avérer une arme de combat redoutable. Comme dirait son créateur, Mechba : \'eche est beche, ma pelle\'.', 19, 60, '60#14#17#0#1d4+19,7b#b#19#0#1d15+10,7e#b#19#0#1d15+10,99#15#28#0#1d20+20');
INSERT INTO `website_shop_objects_templates` VALUES (1432, 8, 'Pelle Houze', 'Gaston Houze, jardinier disciple d\'Enutrof, avait tendance à toujours trop abuser des plantes. Cette arme en est la preuve : puissante, elle aura tendance à vous jouer des tours et à mettre à mal votre intelligence.', 17, 21, '61#b#10#0#1d6+10,76#6#f#0#1d10+5,7d#6#a#0#1d5+5,9b#10#23#0#1d20+15');
INSERT INTO `website_shop_objects_templates` VALUES (1433, 8, 'Pelle Sécutrice', 'Cette pelle fut l\'arme d\'autodéfense d\'un petit groupe d\'Enutrofettes. Ces dames, une fois l\'instrument de puissance entre leurs mains, changèrent du tout au tout et tentèrent de conquérir le monde.', 4, 60, '62#13#1a#0#1d8+18,7b#29#3c#0#1d20+40,7d#10#1e#0#1d15+15,7f#1#0#0#0d0+1,9c#5#c#0#1d8+4');
