INSERT INTO `website_shop_objects_templates` VALUES (1461, 15, 'Poison cinglant', 'Ce poison à base de pattes d\'araknes vous fera perdre la tête. Au propre comme au figuré puisque qu\'après une période de folie la boîte crânienne explose sous la pression sanguine.', 189, 20, '');
