INSERT INTO `website_shop_objects_templates` VALUES (1470, 24, 'Parchemin de recommandation', 'Ce parchemin vous a été remis par Uba Tessé. Il vous recommande chaudement pour devenir alchimiste. Une petite note a été ajouté par Boff Chalon.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1471, 24, 'Parchemin de recommandation et fleur', 'Ce parchemin vous a été remis par Uba Tessé. Il vous recommande chaudement pour devenir alchimiste. Une petite note a été ajoutée par Boff Chalon. Une fleur attachée prouve que vous avez appris la première leçon.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1472, 24, 'Parchemin de demande d\'examen', 'Ce parchemin indique que vous avez passé votre formation d\'alchimiste et que vous êtes apte à tenter l\'examen.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1473, 20, 'Mains Vertes', 'Avec ces gants, vous pourrez facilement et sans risque cueillir n\'importe quelle plante ou fleur.', 5, 1, '64#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (1474, 1, 'Amulette de Xélor', 'Cette amulette surpuissante est le fruit du travail sur la maîtrise du temps d\'un très vieux Xélor.', 28, 52, '6f#1#0#0#0d0+1,70#3#6#0#1d4+2,73#2#3#0#1d2+1,9b#1#1e#0#1d30+0,9d#1#1e#0#1d30+0');
INSERT INTO `website_shop_objects_templates` VALUES (1475, 6, 'La Zulie Lame', 'La Zulie Lame a été forgée par le célèbre forgeron Dave-Lol avant de mourir, pour la plus jolie des iopettes du royaume. On dit que cette lame n\'a d\'égal que la beauté de son porteur.', 15, 60, '64#11#1f#0#1d15+16,77#a#0#0#0d0+10,7b#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (1476, 1, 'Amulette du Craqueleur', 'Cette puissante amulette contient toute la vie du Craqueleur, tous les objets qu\'il a récoltés avant de mourir sous les coups de butoir d\'aventuriers attirés par ses richesses.', 25, 47, '6e#10#19#0#1d10+15,76#10#19#0#1d10+15,77#10#19#0#1d10+15,7e#10#19#0#1d10+15,b7#2#5#0#1d4+1');
INSERT INTO `website_shop_objects_templates` VALUES (1477, 1, 'Chance à Mulette', 'Mulette était une petite Ecaflipette qui n\'a jamais eu de chance dans sa vie, jusqu\'au jour où sa grand-mère lui offrit cette amulette.', 26, 44, '7b#15#1e#0#1d10+20,b0#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (1478, 1, 'Harmonie', 'Ce pendentif aide son porteur à se retrouver en paix avec le monde qui l\'entoure.', 122, 47, '6e#f#0#0#0d0+15,76#f#0#0#0d0+15,77#f#0#0#0d0+15,7b#f#0#0#0d0+15,7c#f#0#0#0d0+15,7e#f#0#0#0d0+15');
INSERT INTO `website_shop_objects_templates` VALUES (1479, 7, 'Le Twote en Carton', 'Ce marteau légendaire a déjà fait ses preuves en Amakna, appartenant au puissant Twote en Carton, qui n\'hésita jamais à s\'en servir, pour réduire ses adversaires en patte à mâcher et confettis.', 6, 46, '64#b#f#0#1d5+10,77#a#14#0#1d11+9,7e#a#1e#0#1d21+9,9d#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (1480, 1, 'Accord', 'Ce pendentif aide son porteur à se retrouver en paix avec le monde qui l\'entoure.', 121, 38, '6e#a#0#0#0d0+10,76#a#0#0#0d0+10,77#a#0#0#0d0+10,7b#a#0#0#0d0+10,7c#a#0#0#0d0+10,7e#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (1481, 1, 'Entente', 'Ce pendentif aide son porteur à se retrouver en paix avec le monde qui l\'entoure.', 11, 26, '6e#5#0#0#0d0+5,76#5#0#0#0d0+5,77#5#0#0#0d0+5,7b#5#0#0#0d0+5,7c#5#0#0#0d0+5,7e#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (1482, 1, 'Emblème Livide', 'Cette amulette est extrêmement utile, mais rend son porteur blanc comme un bouftou.', 32, 41, '70#2#0#0#0d0+2,76#a#0#0#0d0+10,7c#14#0#0#0d0+20,98#14#0#0#0d0+20,9a#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (1483, 1, 'Kabale', 'Symbole mystérieux d\'un organisme mystérieux. D\'ailleurs il n\'existe pas, et vous n\'en avez jamais entendu parler !', 13, 29, '7c#a#0#0#0d0+10,7e#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (1484, 1, 'Amulette Itby remaniée', 'Excellent travail de l\'apprenti-orfèvre Polma Kartnez, cette copie surpasse l\'originale.', 31, 17, '77#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (1485, 1, 'La Reinette', 'Cette amulette, est une amélioration de La Destinée Dorée. Étrangement, elles n\'ont rien en commun, excepté leur aspect assez ridicule, il faut le reconnaître.', 27, 22, '77#a#0#0#0d0+10,7b#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (1486, 1, 'Médaille Holy', 'Holy était une disciple de Iop qui avait juré de terrasser le mal où qu\'il soit. D\'un calme redoutable, elle ne s\'énervait jamais sauf quand on la comparait à une certaine Oly.', 23, 31, '70#1#3#0#1d3+0,76#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (1487, 10, 'L\'Adelus', 'Cette ceinture, en plus d\'habiller d\'une manière élégante, procure à son porteur un effet massant vraiment agréable. L\'heureux propriétaire, moins stressé, est alors plus apte à réfléchir.', 12, 48, '70#2#4#0#1d3+1,7c#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (1488, 1, 'Plimclik', 'Sous ce nom étrange se cache un objet tout aussi étrange, né on ne sait trop comment de précédentes amulettes. On ignore tout des circonstances dans lesquelles elle a été découverte.', 123, 130, '6f#1#0#0#0d0+1,75#1#0#0#0d0+1,80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1489, 1, 'La Broche Hète', 'Hète était l\'un des plus grands guerriers d\'Amakna. La légende dit qu\'il tirait sa sagesse de la broche qu\'il portait toujours sur lui.', 15, 28, '7c#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (1490, 1, 'La Chaîne Nhanor Kibrill', 'Son créateur, un certain Ken Aton, était très célèbre pour ses habitudes assez étranges. Il passait ses journées à chasser le Minotoror pour se fabriquer une moquette pectorale.', 12, 13, '7e#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (1491, 1, 'Chaîne de la Liche', 'La Liche était une sale créature connue pour s\'incruster dans les groupes de valeureux guerriers afin de subtiliser une part du butin. Un jour, son petit manège fut découvert et elle dut prendre la fuite.', 12, 45, '7b#15#1e#0#1d10+20,7c#b#14#0#1d10+10,99#b#32#0#1d40+10,b6#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (1493, 9, 'Blessure du Sacrieur', 'On dit que cet anneau serait issu d\'une des nombreuses blessures reçues par un Sacrieur.', 13, 15, '6e#6#a#0#1d5+5,76#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (1494, 9, 'Le Bagueur', 'Ce joli anneau avait comme fonction première de permettre aux Osamodas de reconnaître leur tofu dans les combats.', 14, 15, '6e#6#a#0#1d5+5,7b#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (1495, 9, 'L\'Anneau Dhyn', 'Ce petit anneau qui ne paye pas de mine a été crée par Degun. Ce bijoutier était plus connu pour ses coups de gueule envers tout le monde et sa cruelle aversion pour la Liche, que pour sa créativité en matière d\'orfévrerie.', 37, 36, '70#2#4#0#1d3+1,73#2#4#0#1d3+1,77#b#f#0#1d5+10,9b#15#1e#0#1d10+20,9d#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (1496, 9, 'Chance d\'Ecaflip', 'Cet anneau a été créé pour augmenter la chance de son porteur lors de parties de cartes.', 32, 20, '7b#b#f#0#1d5+10,7e#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (1497, 9, 'Passé de Xélor', 'Anneaux engendrés lors des voyages temporels de Xélor.', 16, 30, '7c#a#f#0#1d6+9,7e#a#f#0#1d6+9');
INSERT INTO `website_shop_objects_templates` VALUES (1498, 9, 'Souvenir d\'Enutrof', 'Anneaux créés à partir de larmes d\'Enutrof ayant perdu sa pelle. Cela donne une idée du désespoir dans lequel peut être plongé le bonhomme.', 15, 30, '7b#b#f#0#1d5+10,7c#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (1499, 9, 'L\'Enutrofion', 'Cet anneau est destiné aux seuls Enutrofs. Leur dieu l\'a enchanté pour qu\'il ne soit porté que par ses disciples. Il permettra à tout Enutrof qui se respecte, d\'avoir beaucoup plus de chance pour découvrir des trésors.', 39, 59, '7b#b#14#0#1d10+10,b0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (1500, 17, 'La Mokette', 'Cette splendide cape, tissée à partir de divers éléments fibreux de toute nature, est une pièce unique de par sa couleur et ses reflets.', 8, 43, '70#3#7#0#1d5+2');
INSERT INTO `website_shop_objects_templates` VALUES (1501, 9, 'Alliance', 'Cette alliance symbolise l\'union entre deux âmes follement amoureuses l\'une de l\'autre. Inutile de conter fleurette caché derrière les buissons, cette fois c\'est pour de bon, vous allez pouvoir vous afficher sans scrupules.', 27, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1503, 3, 'Baguette de Feu Follesque', 'Pour la fabrication de cette baguette lugubre, on dit qu\'il faut mettre la baguette dans le corps d\'un cadavre frais, et l\'enterrer peu après. Mais personne n\'ose imaginer comment faire.', 14, 20, '63#5#8#0#1d4+4,7b#5#0#0#0d0+5,9a#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (1504, 5, 'Dagues O\'Bert', 'O\'Bert cou rouge était célèbre dans la campagne profonde. Un jour où il chantait à tue-tête il fut tué, la tête tranchée. D\'où son surnom. La dague coupable fut retrouvée, mais personne ne chercha son propriétaire. O\'Bert chantait vraiment trop mal.', 1, 30, '64#6#b#0#1d6+5,7d#b#14#0#1d10+10,77#b#14#0#1d10+10,31b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1505, 20, 'Flûte', 'Cette flûte très rare en bois d\'abraknyde vous permettra de divertir et émouvoir vos amis.', 6, 1, 'a#0#0#7#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1506, 15, 'Symbole de l\'étrange', 'Cette carte à jouer représente...quelque chose. En fait, on ne sait pas trop quoi, mais on est persuadé que c\'est important.', 224, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1507, 15, 'Bon 1000 Kek', 'Un petit slogan est écrit sur ce morceau de papier : \\n\"Bravo, tu as en ta possession un coupon KeK, preuve que tu es un être admirable, viens chez nous pour l\'utiliser, nous t\'attendons !\" \\nSuivis des coordonnées cartographiques -1,-2', 225, 1, '');
