INSERT INTO `website_shop_objects_templates` VALUES (1511, 6, 'Neuf Queues', 'La légende veut qu\'Ecaflip, lors du dantesque combat qui l\'éleva au rang de dieu, utilisa une arme constituée de ses propres queues, chacune issue de l\'une de ses vies.', 19, 80, '64#9#63#0#1d91+8,76#9#0#0#0d0+9,7b#9#0#0#0d0+9,32c#14#0#0#0d0+20');
