INSERT INTO `website_shop_objects_templates` VALUES (1559, 9, 'Abranneau Mou', 'Cet anneau, est en fait une excroissance du Chêne Mou, arrachée lors d\'une tempête. Maintenant il est à vous, mais évitez de trop l\'approcher de son maître, il pourrait décider de se retourner contre vous.', 11, 46, 'b6#1#2#0#1d2+0,75#1#0#0#0d0+1,7d#1f#50#0#1d50+30');
