INSERT INTO `website_shop_objects_templates` VALUES (1619, 1, 'L\'Abramu', 'L\'Abramu est une amulette très élégante. Si vous avez l\'intention de la porter nous vous conseillons de vous promener nu afin de bien mettre en valeur ce précieux bijoux. Vous verrez, les dames n\'y résistent pas.', 16, 46, '6f#1#0#0#0d0+1,70#3#6#0#1d4+2,7c#b#14#0#1d10+10,9d#1#46#0#1d70+0,9b#1#46#0#1d70+0,9a#1#46#0#1d70+0,98#1#46#0#1d70+0');
INSERT INTO `website_shop_objects_templates` VALUES (1620, 2, 'Abrarc', 'Cet arc semble encore vivant et peut presque tirer des flèches tout seul, comme un grand. Il aurait pu être l\'arc idéal des personnes dotées de deux mains gauches, mais malheureusement, il faut toujours encocher la flèche dans le bon sens.', 24, 39, '61#b#f#0#1d5+10,7b#15#1e#0#1d10+20,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1621, 11, 'Bottes de Maîtrise', 'Les bottes de Maîtrise augmentent l\'agilité et l\'intelligence de leur lanceur au détriment de la force et de la chance. Contrairement à ce que l\'on pourrait croire, elle ne vous permettent pas de maitriser votre adversaire.', 14, 22, '77#10#19#0#1d10+15,7e#10#19#0#1d10+15,98#6#f#0#1d10+5,9d#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (1622, 11, 'Bottes de Puissance', 'Les bottes de puissance augmentent la force et la chance de leur lanceur au détriment de l\'intelligence et de l\'agilité. Contrairement à ce que l\'on pourrait croire, elle ne confèrent pas à leur porteur, une puissance démente.', 14, 22, '76#10#19#0#1d10+15,7b#10#19#0#1d10+15,9a#6#f#0#1d10+5,9b#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (1623, 11, 'Bottes d\'Anticipation', 'Les bottes d\'Anticipation augmentent la force et l\'agilité de leur lanceur au détriment de l\'intelligence et de la chance. Contrairement à ce que l\'on pourrait croire, elles ne vous permettent pas d\'anticiper les actions de vos adversaires.', 15, 22, '76#10#19#0#1d10+15,77#10#19#0#1d10+15,98#6#f#0#1d10+5,9b#6#f#0#1d10+5');
