INSERT INTO `website_shop_objects_templates` VALUES (1657, 9, 'Fécaliseur du Guerrier', 'Cet anneau est à même de protéger son porteur des petites attaques physiques et donc par extension, des petits monstres qui jouent sur leur physique pour vous surprendre.', 41, 26, 'b8#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (1660, 50, 'Ambre d\'Abraknyde Sombre', 'Cet ambre splendide contient une vilaine bestiole prisonnière dans la sève de son maître. Une sorte de sarcophage, qui permet à l\'Abraknyde Sombre de garder de bons souvenirs de ses invocations, une fois celles-ci mortes.', 638, 78, '');
INSERT INTO `website_shop_objects_templates` VALUES (1661, 1, 'Ambramulette Moskito', 'Porter autour du cou un Moskito pris dans un ambre, c\'est un peu montrer à vos adversaires, que vous êtes un redoutable chasseur... de Moskitos. De quoi vous rendre ridicule en dehors du Berceau.', 17, 40, '70#3#5#0#1d3+2,7b#b#14#0#1d10+10,9b#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (1662, 1, 'Ambramulette Arackne', 'Porter autour du coup une Arackne prise dans l\'ambre, lorsque vous attaquez une de ses soeurs, peut suffire à la décontenancer. Pauvre bête, on appelle cela l\'ironie du sort.', 18, 34, '9a#b#14#0#1d10+10,9d#b#14#0#1d10+10,b7#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (1663, 59, 'Ecaille de Crocodaille', 'Cette écaille de Crocodaille constitue, pour tout chasseur débutant de Crocodaille qui se respecte, un petit trophée. N\'hésitez pas à la montrer aux ivrognes de la taverne, ils seront de toute évidence impressionnés et vous paieront des coups à boire.', 233, 36, '');
INSERT INTO `website_shop_objects_templates` VALUES (1664, 47, 'Dent de Crocodaille', 'Quand un Crocodaille a une dent contre vous, la meilleure solution consiste à la lui arracher avec vigueur et détermination, tel un dentiste rigoureux.', 234, 36, '');
INSERT INTO `website_shop_objects_templates` VALUES (1665, 11, 'Bottes d\'Apprentissage', 'Ces bottes bien étranges étaient utilisées sur les jeunes disciples un peu limités intellectuellement, pour leur permettre de rattraper leur retard. Elles conviendront particulièrement aux Iops.', 68, 50, '6e#10#19#0#1d10+15,7c#10#19#0#1d10+15,7e#10#19#0#1d10+15,8a#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (1666, 11, 'Bottes de l\'Apprenti Invocateur', 'Ces bottes ont été spécialement conçues pour ceux qui aiment laisser à leurs créatures le plaisir de faire tout le travail pendant les combats.', 14, 51, '80#1#0#0#0d0+1,98#b#14#0#1d10+10,9a#b#14#0#1d10+10,9b#b#14#0#1d10+10,9d#b#14#0#1d10+10,b6#1#0#0#0d0+1,b7#4#8#0#1d5+3');
INSERT INTO `website_shop_objects_templates` VALUES (1667, 10, 'Ceinture Luthuthu', 'Cette ceinture porte le nom ridicule de son créateur, Luthuthu, un cordonnier beaucoup moins connu que Bowisse, mais encore très créatif malgré son âge avancé.', 13, 50, '75#1#0#0#0d0+1,7e#15#1e#0#1d10+20,8a#6#a#0#1d5+5,9a#15#1e#0#1d10+20,b7#3#5#0#1d3+2,7d#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (1668, 10, 'Ceinture du Dodu Trembleur', 'Le Dodu était un Sadida qui s\'obstinait à faire trembler ses ennemis, il a commandé à Bowisse cette ceinture, assortie à la couleur de ses poils, car ne l\'oublions pas, le Dodu en plus d\'être un trembleur était un charmeur.', 14, 55, '70#3#8#0#1d6+2,98#1f#32#0#1d20+30,9a#1f#32#0#1d20+30,b7#3#8#0#1d6+2,b8#3#8#0#1d6+2');
INSERT INTO `website_shop_objects_templates` VALUES (1669, 10, 'Ceinture des Vents', 'Cette ceinture a été créée pour la plus populaire des Crâette, qui aimait donner de son temps pour organiser tout un tas de fêtes et d\'évènements hors du commun, histoire de divertir le peuple entre deux repassages de Slip en Cuir du Captain Chafer.', 15, 84, '70#4#8#0#1d5+3,73#4#8#0#1d5+3,75#1#2#0#1d2+0,7b#15#28#0#1d20+20,7c#b#14#0#1d10+10,7e#15#28#0#1d20+20');
INSERT INTO `website_shop_objects_templates` VALUES (1670, 53, 'Plume Pointue de Kwak du Vent', 'Parfois, un Kwak du Vent dispose d\'une plume pointue différente de toutes les autres, elle est en règle générale magique et peut-être utilisée pour se déguiser en chef indien.', 393, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (1671, 34, 'Avoine Magique', 'Ce fétu de paille d\'Avoine Magique est issu d\'un modeste paysan ensorcelé par un apprenti Bwork Mage, qui tenait son livre à l\'envers.', 550, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (1672, 54, 'Poils Darits', 'Ces poils constituent les derniers restes de Darit, un jeune magicien très prétentieux, qui avait oublié de vérifier si le Prespic avait lancé Contre, avant de lancer son sort Foudre Dépoteuse.', 555, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (1673, 103, 'Patte d\'Arakne Magique', 'Cette patte d\'Arakne, n\'est pas comme toutes les autres, elle bouge toute seule et semble pleine de vie, même une fois arrachée à sa maîtresse. Une nouvelle vie pourrait commencer pour cette patte qui semble attirée par la couture.', 392, 2, '');
INSERT INTO `website_shop_objects_templates` VALUES (1674, 15, 'Champignon Luidegît', 'Ce héros, a été envoûté par le Chêne Mou, mais la magie un peu aléatoire de ce dernier, a fait qu\'il s\'est transformé en champignon. Les Champs étant assez idiots, ils le vénèrent et le protègent jusqu\'à la mort.', 390, 46, '');
INSERT INTO `website_shop_objects_templates` VALUES (1675, 47, 'Os Surprise du Chafer Fantassin', 'Cet Os magique, permet aux chafers fantassins de faire des coups surprenants, comme d\'enlever et de mettre leurs slips sur la tête, sans les mains, en plein combat et en réussissant leurs jets d\'esquive. On ne se lasse jamais de cette prestation.', 15, 35, '');
INSERT INTO `website_shop_objects_templates` VALUES (1676, 15, 'Osier Enchanté ', 'Ce morceau d\'Osier enchanté devrait permettre de fabriquer une magnifique corbeille à fruits magique, alliant élégance et puissance, tout le contraire d\'une méchante Liche.', 123, 69, '');
INSERT INTO `website_shop_objects_templates` VALUES (1677, 12, 'Potion Dantegoulesque', 'Cette potion magique est la seule à même de rendre magiques des Slips en Cuir de Captain Chafer tressés entre eux, voilà qui en dit long sur la puissance d\'une telle potion.', 139, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (1678, 46, 'Noix de Kokoko Traumatisée', 'Cette noix de Kokoko a été traumatisée durant son enfance, elle a accumulé une haine incroyable durant toutes ces années, ce qui en fait une noix de Kokoko très puissante.', 552, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (1679, 50, 'Pierre de Crystaloboule', 'Avec un peu de patience et de travail, cette pierre précieuse peut devenir toute ronde et brillante comme un pompon de chapeau magique. Sa forme lui permettra en outre de se glisser presque n\'importe où.', 240, 16, '');
INSERT INTO `website_shop_objects_templates` VALUES (1680, 47, 'Corne Brûlée du Minotoror', 'Cette Corne de Minotoror a été brûlée par une magie très puissante, ce qui en fait un artéfact magique de choix. Malheureusement, comme beaucoup de choses, elles ne fonctionnent correctement que par paires...', 245, 125, '');
INSERT INTO `website_shop_objects_templates` VALUES (1681, 59, 'Peau de Larve Verte Magique', 'Ne vous y trompez pas, derrière son apparence visqueuse, se cache en fait, un artefact qui s\'il est porté près de la tête, peut vous rendre aussi chanceux, qu\'un Chafer cocu.', 391, 7, '');
INSERT INTO `website_shop_objects_templates` VALUES (1682, 96, 'Ecorce de Liroye Merline', 'Ce morceau d\'écorce provient d\'un arbre de la clairière enchantée de Liroye Merline. \\nCe morceau s\'est décroché lorsque Brouce Boulgoure le bûcheron a cassé sa Boulgourde en tentant d\'abattre un arbre enchanté.', 542, 78, '');
INSERT INTO `website_shop_objects_templates` VALUES (1683, 15, 'Sac à Patates Clair', 'Ce sac magique permettait à un Sadida Roublard de transporter des quantités incroyables de patates déjà épluchées, pour les revendre aux prisonniers. Une fois mort, son sac est transmis de Roublard en Roublard comme une sorte de rituel.', 243, 12, '');
INSERT INTO `website_shop_objects_templates` VALUES (1684, 15, 'Sac à Patates Sombre', 'C\'est à peu près le même sac que le Sac à Patates Clair, si ce n\'est que celui-ci a été trempé dans de la sève d\'Abraknyde Sombre, ce qui lui confère des pouvoirs supplémentaires.', 244, 12, '');
INSERT INTO `website_shop_objects_templates` VALUES (1685, 53, 'Plume du Dernier Poolay', 'Attention, vous avez en votre possession, la dernière plume arrachée au derrière, du dernier Poolay de tout Amakna. Cette plume constituera un très beau cadeau pour vos amis Tailleurs, ou pour les fanatiques du Poolay de plus en plus nombreux au fil du temps.', 247, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (1686, 70, 'Teinture Magique de Rougeur', 'Cette petite potion magique donne une couleur rouge magnifique aux poils sur lesquels elle est appliquée. Accessoirement, il semblerait qu\'elle puisse apporter quelques effets magiques.', 63, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (1687, 70, 'Teinture Magique Verdâtre', 'Cette petite potion magique donne une couleur verte magnifique aux poils sur lesquels elle est appliquée. Accessoirement, il sembleraît qu\'elle puisse apporter quelques effets magiques.', 64, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (1688, 70, 'Teinture Magique Bleutée', 'Cette petite potion magique donne une couleur bleue magnifique aux poils sur lesquels elle est appliquée. Accessoirement, il sembleraît qu\'elle puisse apporter quelques effets magiques.', 65, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (1689, 70, 'Teinture Magique Orange', 'Cette petite potion magique donne une couleur orange magnifique aux poils sur lesquels elle est appliquée. Accessoirement, il semblerait qu\'elle puisse apporter quelques effets magiques.', 66, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (1690, 54, 'Poils du Milimulou', 'Ces poils ressemblent à ceux de Mulou, en un peu plus courts, moins solides, mais plus doux. Malheureusement, l\'odeur elle est la même.', 554, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (1691, 54, 'Poils du Meulou', 'Rares sont les aventuriers à avoir la chance de toucher ces poils vivants. \\nÇa ne fait pas de vous un héros pour autant.', 553, 198, '');
INSERT INTO `website_shop_objects_templates` VALUES (1692, 70, 'Teinture Magique Sombre', 'Cette petite potion magique donne une couleur noire magnifique aux poils sur lesquels elle est appliquée. Accessoirement, il sembleraît qu\'elle puisse apporter quelques effets magiques.', 67, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (1693, 17, 'Cape de Jules Yanos', 'Jules Yanos, célèbre tailleur, était surtout célèbre pour avoir échangé sa femme contre un dé à coudre magique. Comme quoi, il existe encore des gens qui ont le sens des affaires.', 8, 54, '75#1#0#0#0d0+1,80#1#0#0#0d0+1,9c#1#1e#0#1d30+0,b6#1#0#0#0d0+1,b8#3#6#0#1d4+2');
INSERT INTO `website_shop_objects_templates` VALUES (1694, 57, 'Laine du Trool Furieux', 'Ce morceau de laine provient du Trool le plus dangereux d\'Amakna, qui aurait été transformé en couvre-lit, par un tailleur sans scrupules, le même qui aurait soi-disant échangé sa femme contre un dé à coudre magique. Le mystère reste entier.', 27, 115, '');
INSERT INTO `website_shop_objects_templates` VALUES (1695, 17, 'Cape d\'Elya Wood', 'On raconte que le Captain Chafer a tenté de voler cette cape pour remplacer ses célèbres sous-vêtements en cuir. Mais elle ne lui allait pas, elle n\'incarnait pas assez la perversité et la perfidie pour lui.', 9, 80, '70#6#8#0#1d3+5,75#1#2#0#1d2+0,7e#15#23#0#1d15+20,b7#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (1696, 55, 'Etoffe du Meulou', 'Les tailleurs ont trouvé il y a des lustres un moyen de déterminer la valeur d\'une étoffe, plus cette dernière sent mauvais, plus elle est puissante. Celle-ci sent plus mauvais qu\'un pédiluve d\'Enutrofs dans lequel un Chafer aurait lavé son slip.', 14, 198, '');
INSERT INTO `website_shop_objects_templates` VALUES (1697, 81, 'Petit Sac en Laine de Boufton', 'Ce petit sac ne fera pas de vous une célébrité, mais il aura au moins le mérite de vous permettre de ranger quelques effets personnels.', 25, 1, '9e#33#64#0#1d50+50');
INSERT INTO `website_shop_objects_templates` VALUES (1698, 81, 'Sac du Petit Récolteur', 'Ce sac est spécialement étudié pour contenir quelques ressources collectables. \\nSeuls les vrais collecteurs sont à même de pouvoir le porter. (niveau 20 de collecteur requis).', 26, 5, '9e#97#fa#0#1d100+150');
INSERT INTO `website_shop_objects_templates` VALUES (1699, 81, 'Sac du Petit Aventurier', 'Ce sac est destiné à ceux qui ne partent pas trop loin de chez eux, et ont besoin d\'emmener des choses pas importantes du tout, comme des Planches de Frêne par exemple.', 27, 10, '9e#97#c8#0#1d50+150');
INSERT INTO `website_shop_objects_templates` VALUES (1700, 10, 'Ceinture de Célérité ', 'Cette ceinture aérodynamique conçue par Tengra Reufrus vous rend agile comme l\'air, et libre comme un Tofu. A moins que ça ne soit l\'inverse.', 17, 27, '77#10#23#0#1d20+15,9c#6#f#0#1d10+5,d4#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (1701, 10, 'Ceinture de Poche', 'Cette ceinture possède de petites poches permettant de stocker davantage d\'objets dans votre inventaire.', 16, 20, '76#10#19#0#1d10+15,9e#c9#12c#0#1d100+200');
INSERT INTO `website_shop_objects_templates` VALUES (1702, 81, 'Sac du Récolteur', 'Ce sac est spécialement étudié pour contenir des ressources collectables. \\nSeuls les vrais collecteurs sont à même de pouvoir le porter. (niveau 40 de collecteur requis).', 28, 15, '9e#fb#190#0#1d150+250');
INSERT INTO `website_shop_objects_templates` VALUES (1703, 81, 'Sac du Grand Récolteur', 'Ce sac est spécialement étudié pour contenir de nombreuses ressources collectables. \\nSeuls les vrais collecteurs sont à même de pouvoir le porter. (niveau 60 de collecteur requis).', 29, 20, '9e#259#320#0#1d200+600');
INSERT INTO `website_shop_objects_templates` VALUES (1704, 81, 'Sac du Staca Noviste', 'On raconte qu\'un Mineur célèbre était capable de miner sans arrêt pendant des mois dans 4 mines différentes en même temps. Il s\'agit en fait d\'une légende inventée par la guilde du Marteau-Faucille pour inciter ses mineurs à récolter plus.', 30, 20, '9e#3e9#514#0#1d300+1000');
INSERT INTO `website_shop_objects_templates` VALUES (1705, 81, 'Sac de l\'Aventurier', 'C\'est le sac idéal pour ranger tous vos pains et potions lorsque vous partez pour plusieurs mois, dans le labyrinthe par exemple.', 31, 40, '9e#fb#12c#0#1d50+250');
INSERT INTO `website_shop_objects_templates` VALUES (1707, 81, 'Sac du grand aventurier', 'C\'est le sac idéal pour ranger tous vos pains et potions lorsque vous partez en voyage vers des destinations exotiques, comme l\'île de Moon.', 32, 60, '9e#15f#1c2#0#1d100+350');
INSERT INTO `website_shop_objects_templates` VALUES (1709, 47, 'Nonos', '\"Il est pour qui le nonos à sa mémère ?\" Tel fût les derniers mots d\'une Enutrof qui confondit un Meulou avec son animal de compagnie.', 15, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1710, 1, 'Croissant de Lune', 'Les origines de cette amulette, représentant un quartier de lune, sont inconnues de tout le monde...ou presque. Qui sait donc quels secrets ce bijou renferme...', 19, 1, '9d#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1711, 18, 'Chienchien', 'Avec ce petit toutou, vous goûterez aux joies des petites promenades pipi. Fort de ses racines sauvages, il est déconseillé de lui donner à manger, sous peine de perdre une main.  \\n(CE FAMILIER N\'AIME AUCUNE RESSOURCE)', 6, 1, '7c#14#0#0#0d0+20,320#6#0#0#0d0+6');
INSERT INTO `website_shop_objects_templates` VALUES (1712, 12, 'Potion Pahoa Raide', 'Cette potion permet de retrouver quelques points d\'énergie.', 140, 20, '8b#c9#190#0#1d200+200');
INSERT INTO `website_shop_objects_templates` VALUES (1713, 12, 'Potion Raide Boule', 'Cette potion permet de retrouver quelques points d\'énergie.', 141, 40, '8b#1f5#3e8#0#1d500+500');
INSERT INTO `website_shop_objects_templates` VALUES (1715, 25, 'Le don de Nouwel', 'Best seller de la fin d\'année 634, ce livre se doit d\'être lu. Un classique !', 19, 1, '26c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1716, 25, 'La famille DuCiel', 'Deuxième meilleure vente de l\'hiver 634, ce livre est déjà une référence.', 19, 1, '26c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1717, 25, 'Premier Noël', 'L\'outsider du début d\'année 635, ce livre mérite vraiment qu\'on s\'y intéresse.', 19, 1, '26c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1718, 9, 'Force de Crocoburio', 'Cet anneau fut enchanté par le souffle noir de Grougalorasalar, lui conférant un immense pouvoir, hélas aujourd\'hui amoindri. Cette relique était destinée à Crocoburio car lui seul était à même d\'équiper cet anneau sans subir sa domination.', 38, 40, '76#10#1e#0#1d15+15');
INSERT INTO `website_shop_objects_templates` VALUES (1719, 11, 'Esprit de Crocoburio', 'Cette paire de bottes appartiendrait à Crocoburio. Le peu de personnes aptes à les chausser se sentent soudain envahis de pensées machiavéliques et ingénieuses. Ce maléfice étant, selon la légende, dû aux milliers de crânes qu\'elles ont écrasés.', 12, 42, '7e#1a#28#0#1d15+25,d5#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (1720, 10, 'Puissance de Crocoburio', 'Grougalorasalar aimait garder des fragments d\'os appartenant aux ennemis vaincus les plus forts. Son affection pour Crocoburio le poussa à les utiliser pour fabriquer cette ceinture surpuissante.', 18, 34, '7d#33#50#0#1d30+50');
INSERT INTO `website_shop_objects_templates` VALUES (1721, 43, 'Potion d\'oubli : \'Horloge\'', 'Cette potion permet de désapprendre un niveau du sort des Xélor : \'Horloge\'.', 37, 1, '268#0#0#5f#0d0+0,2c6#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1722, 27, 'Transformation Abraknyde', 'La malédiction du Chêne Mou vous a transformé en abraknyde. \\nPour rompre le charme, vous devez vaincre un aventurier égaré dans la forêt des Abraknydes.', 1, 1, 'c5#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1723, 28, 'Bonbon rouge surpuissant', 'Ce bonbon vous booste temporairement.', 1, 1, '32b#1e#0#0#0d0+30,7c#14#0#0#0d0+20,b0#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (1724, 29, 'Courage', 'Cette bénédiction permet de gagner de la Force pour les prochains combats.', 1, 1, '76#19#0#0#0d0+25,32b#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (1725, 30, 'Découragé ', 'Cette malédiction vous enlève de la Force pour le prochain combat.', 1, 1, '9d#19#0#0#0d0+25,32b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1726, 24, 'Touffe de cheveux de Tarche', 'Cette touffe de cheveux prouve votre victoire face à Tarche. Quel exploit !', 30, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1727, 24, 'Lettre de Menaces', 'Une lettre de menaces adressée à Dame Cloude.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1728, 18, 'Chacha', 'Cette petite boule de poil friponne et câline fait craquer la gente féminine toutes classes confondues. Un animal redoutable donc.', 1, 1, '7b#1#50#0#1d80+0,76#1#50#0#1d80+0,7e#1#50#0#1d80+0,77#1#50#0#1d80+0,d6#1#14#0#1d20+0,320#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (1729, 9, 'Anneau Mèr', 'Cet anneau appartenait à Mèr, le plus gros fainéant de toute la contrée d\'Amakna. Il vouait un culte aux doneuths, mais aussi aux côtelettes de ribs.', 28, 25, '6e#2#3d#0#1d60+1,9c#2#b#0#1d10+1');
INSERT INTO `website_shop_objects_templates` VALUES (1730, 48, 'Mesure de sel', 'Cette mesure de sel est la dose idéale pour assaisonner moult plats savoureux. Elle est indispensable pour un repas réussi.', 261, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1731, 15, 'Dose de jus goûtu', 'Ce jus vous apportera les saveurs élémentaires pour avoir un plat parfumé.', 262, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1732, 15, 'Bol', 'Rien de plus pratique qu\'un bol pour boire plus proprement de la soupe, bien que boire proprement n\'altère pas le goût. À moins que vos doigts soient très sales.', 263, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1733, 15, 'Terrine', '\"La terrine, c\'est de la viandasse, ça fait du bien, par ou que qu\'ça passe. Vive la terrine, vive la terrine !\" (Extrait de l\'hymne du boucher couplet 4).', 264, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1734, 46, 'Cerise', 'Ce fruit ressemble à s\'y méprendre à une grosse paire de boules rebondissantes.', 265, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1735, 77, 'Certificat de Mise en Chanil : Chacha', 'Ce certificat décrit les caractéristiques du Chacha que vous avez placé au chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1736, 46, 'Citron', 'Le jus de ce fruit est parfait pour cacher les odeurs de chair en putréfaction. Idéal pour servir des restes de poissons avariés et variés à vos invités.', 266, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1737, 33, 'Pain des Champs', 'Dans la poche ou dans le gosier, ce pain des champs s\'avère un pain très lourd. Mais il faut avouer que son goût a le côté rustique que l\'on attend d\'un bon pain.', 68, 40, '6e#64#0#0#0d0+100');
INSERT INTO `website_shop_objects_templates` VALUES (1738, 33, 'Pain des Villes', 'Sans hésitation, on peut dire que ce pain donne envie de se bricoler un graillou. Il procure aussi une sensation de satiété assez rapidement.', 69, 10, '6e#32#0#0#0d0+50');
INSERT INTO `website_shop_objects_templates` VALUES (1739, 3, 'Baguette Affeulante', 'Cette baguette a d\'étranges propriétés : au toucher, elle est brûlante. Mais le plus énigmatique reste son odeur de cendre, qui laisse à penser que le bois de cette baguette aurait survécu à un feu de forêt.', 24, 80, '63#b#e#0#1d4+10,7e#15#28#0#1d20+20,ae#c9#12c#0#1d100+200,6e#29#3c#0#1d20+40,d3#3#5#0#1d3+2,9d#28#0#0#0d0+40,7c#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (1740, 27, 'Transformation Crocoburio', 'La Crocobur enferme l\'essence de Crocoburio et ne peut être volée à son maître qu\'en lui ôtant la vie.', 2, 1, 'c5#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (1741, 14, 'Sang de Phénix', 'Ce sang de phénix permet de ramener un fantôme à la vie et de lui rendre quelques points d\'énergie.', 3, 10, 'ce#0#0#0#0d0+0');
