INSERT INTO `website_shop_objects_templates` VALUES (1746, 24, 'Sang de Wabbit GM', 'Qui aurait pu imaginer arriver chez les wabbits avec une seringue, dans le but d\'extraire du sang sur la créature la plus modifiée génétiquement de l\'île ? Vous, évidemment.', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1747, 24, 'Analyse de sang de Wabbit GM', 'Les analyses sont formelles, le sang identifié provient d\'un postérieur de Wabbit GM. Les tests ont été si poussés que l\'alchimiste a même su vous dire quelle fesse avait été piquée, en l\'occurrence la droite.', 33, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1748, 18, 'Wabbit', 'Ce petit Wabbit est domestiqué. Il ne vous mordra donc pas. En revanche pour les autres...', 7, 1, '320#a#0#0#0d0+10,77#1#50#0#1d80+0,76#1#50#0#1d80+0,7c#1#1b#0#1d27+0,7b#1#50#0#1d80+0,7e#1#50#0#1d80+0');
