INSERT INTO `website_shop_objects_templates` VALUES (1835, 49, 'Brochet farci **', 'Ah le brochet farci. Tout le monde en mange, mais personne ne sait ce qu\'il y a dedans. S\'ils savaient ...', 132, 1, '6e#28#0#0#0d0+40');
