INSERT INTO `website_shop_objects_templates` VALUES (1837, 49, 'Brochet farci ****', 'Ah le brochet farci. Tout le monde en mange, mais personne ne sait ce qu\'il y a dedans. Ne pas chercher à le savoir démontre la sagesse.', 134, 1, '6e#190#0#0#0d0+400,7c#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1838, 49, 'Requin aux épices **', 'Ce requin, lui, n\'aurait pas eu la bonté de vous saupoudrer d\'épices avant de vous manger.', 103, 1, '6e#96#0#0#0d0+150');
INSERT INTO `website_shop_objects_templates` VALUES (1839, 49, 'Requin aux épices ***', 'Ce requin, lui, n\'aurait pas eu la bonté de vous saupoudrer de riches épices avant de vous manger.', 104, 1, '6e#c8#0#0#0d0+200');
INSERT INTO `website_shop_objects_templates` VALUES (1840, 49, 'Requin aux épices ****', 'Ce requin, lui, n\'aurait pas eu la bonté de vous saupoudrer d\'épices magiques avant de vous manger.', 105, 1, '6e#3e8#0#0#0d0+1000,263#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1844, 41, 'Truite', 'La truite est un poisson assez facile à pêcher et les pêcheurs chevronnés les pêchent trois par trois. Ils décident souvent au même moment s\'il faut les manger crues ou cuites. D\'où leur parfaite prononciation.', 394, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1845, 62, 'Truite vidée', 'Cette truite peut maintenant être utilisée comme ingrédient.', 396, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1846, 41, 'Truite Ancestrale', 'Une des plus vieilles truites du monde. Si le temps qui passe rend plus sage, alors cette truite devrait être une sage parmi les sages... Mais un doute subsiste.', 398, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1847, 41, 'Brochet', 'Ce poisson d\'eau douce de taille moyenne est l\'ami du barbecue du pêcheur.', 400, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (1848, 62, 'Brochet vidé ', 'Ce brochet peut maintenant être utilisé comme ingrédient.', 401, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (1849, 41, 'Brochet Tupe-Halett', 'Issue du croisement entre divers brochets par les scientifiques Halett et Tupe, cette espèce est censée disposer d\'attributs magiques. Destiné à l\'expérimentation, deux spécimens s\'échappèrent lors d\'une violente dispute entre les deux savants.', 402, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (1851, 62, 'Brochet Tupe-Halett vidé ', 'Ce brochet Tupe-Halett peut maintenant être utilisé comme ingrédient.', 403, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (1852, 62, 'Requin marteau-faucille vidé ', 'Ce requin marteau-faucille peut maintenant être utilisé comme ingrédient.', 323, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (1853, 41, 'Requin Marché-Libre', 'Cousin du requin Marteau-Faucille, mais en plus féroce et beaucoup moins organisé. En attraper un est le rêve de tous les pêcheurs ou plutôt, en attraper un et être toujours en vie.', 324, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (1854, 62, 'Requin marché-libre vidé ', 'Ce requin marché-libre peut maintenant être utilisé comme ingrédient.', 325, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (1859, 49, 'Kralamoure grillé ****', 'Une bonne odeur se dégage de ce kralamoure grillé, celui qui le mangera va se régaler.', 91, 1, '6e#1f4#0#0#0d0+500,263#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1860, 20, 'Canne Harpon', 'Cette canne à pêche, ultra resistante, possède un hameçon en forme de harpon spécialement étudié pour la pêche au requin.', 8, 1, '60#1#14#0#1d20+0');
INSERT INTO `website_shop_objects_templates` VALUES (1861, 20, 'La Grande Perche', 'Cette canne à pêche a été étudiée spécialement pour attraper les vives perches.', 8, 1, '60#2#13#0#1d18+1');
INSERT INTO `website_shop_objects_templates` VALUES (1862, 20, 'Le Bâton d\'Amour', 'Le bois de cette canne dégage une résine odorante qui imprègne le fil et l\'hameçon. Cette odeur suave doit ressembler au parfum d\'une Kralamourette car tous les Kralamoures viennent s\'y coller.', 8, 1, '60#1#e#0#1d14+0');
INSERT INTO `website_shop_objects_templates` VALUES (1863, 20, 'Canne à Chô ', 'Chô était le plus fameux cuisinier de la table ronde. Sa particularité était de dénicher les aliments frais en face du client. Cette canne lui permettait de pêcher les poissons indispensables pour son cèlebre plat de carpes à Chô.', 8, 1, '60#1#e#0#1d14+0');
INSERT INTO `website_shop_objects_templates` VALUES (1864, 20, 'L\'aiguille à Tricoter', 'Le fil de cette canne à pêche est exclusivement composé de laine dont la pelote remplace l\'appât. Très peu de poisson-chaton arrivent à y résister.', 8, 1, '60#1#9#0#1d9+0');
INSERT INTO `website_shop_objects_templates` VALUES (1865, 20, 'Canne Cubique', 'Cette canne est spécialement conçue pour s\'adapter à la morphologie si...particulière des poissons panés.', 8, 1, '60#1#8#0#1d8+0');
INSERT INTO `website_shop_objects_templates` VALUES (1866, 20, 'Canne à Pêche Standard', 'Cette canne, de moyenne facture, permettra au jeune pêcheur de pêcher presque n\'importe quoi, s\'il prend la peine d\'être suffisamment patient.', 8, 1, '60#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (1867, 20, 'Grande Canne à Pêche', 'Cette canne à pêche est destinée aux pêcheurs professionnels. Elle leur permettra de lancer leur ligne très loin. Mais il faut savoir la maîtriser pour pêcher quelque chose.', 8, 1, '60#1#6#0#1d6+0');
INSERT INTO `website_shop_objects_templates` VALUES (1868, 20, 'Canne à Pêche Téléscopique', 'Cette canne a pêche peut atteindre des longueurs effarantes. Seul les maîtres pêcheurs savent utiliser leur potentiel.', 8, 1, '60#1#8#0#1d8+0');
INSERT INTO `website_shop_objects_templates` VALUES (1869, 24, 'Arracheur de Dents', 'Cet arracheur de Dents marche principalement sur les bouftous, mais vous pouvez toujours essayer de vous enlever une carie si le coeur vous en dit.', 34, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1870, 24, 'Dent de bouftou', 'Cette dent de bouftou ressemble à s\'y méprendre à une dent humaine.', 35, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1871, 24, 'Collier', 'Le collier que la fille du maire a perdu. Malheureusement, il est en piteux état après avoir séjourné dans l\'estomac d\'un Corbac ...', 36, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1872, 24, 'Poudre à canon', 'De la poudre à canon, une étiquette rappelle son utilisation qui est on ne peut plus simple : \\nPoudre + Flamme = Explosion', 37, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1873, 24, 'Bloc de pierre', 'Un bloc de pierre de Craqueleur des Plaines semblable à ceux qui ont permis de construire les fortifications de Bonta.', 38, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1874, 24, 'Venin de scorbute', 'Du venin de scorbute à ne pas mettre entre toutes les mains.', 39, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1875, 24, 'Faux du Maître Corbac', 'Pourquoi couper du blé avec cette faux, quand on peut couper du granit ?', 40, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1876, 24, 'Formulaire d\'inspection', 'Ce formulaire d\'inspection d\'acte Brâkmarien n° 243 permet de déceler si un homme en est un ou pas ...', 41, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1877, 24, 'Hood troué ', 'L\'ancien propriétaire de ce chapeau a certainement subi des coups, c\'est ce qui arrive quand on se rebelle contre l\'autorité de Bonta ...', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1878, 24, 'Carte spéciale', 'Cette carte à jouer a un aspect particulier, elle est dans un état proche de la perfection. Tout porte à croire qu\'elle est destinée à une collection.', 43, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1879, 24, 'Caisse d\'armes blanches', 'Une caisse d\'armes blanches, remplie d\'objets contondants en tout genre.', 44, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1880, 24, 'Boîte de Chabon', 'Hmm... du chabon, c\'est votre Kanigrou qui va être content.', 45, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1881, 24, 'Boue', 'Voila, ça, c\'est fait.', 46, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1882, 24, 'Fleurs de Blop concassé ', 'Vous avez récupéré une bien belle bouillie.', 47, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1883, 24, 'Collier réparé ', 'Le collier que la fille du maire a perdu, presque comme neuf...', 48, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1889, 53, 'Plume de Corbac', 'Autrefois utilisée pour l\'écriture, cette plume est désormais essentiellement utilisée en haute couture. En effet, les Corbacs sont de moins en moins généreux et n\'offrent plus leurs plumes au premier venu. Tout se perd décidément.', 327, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (1890, 54, 'Poil de Kanigrou', 'Le poil de Kanigrou réfléchit la lumière du soleil d\'une manière assez étrange, comme si il en absorbait une partie avant de la renvoyer.', 359, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (1891, 59, 'Peau de serpentin', 'N\'avez-vous jamais rêvé d\'un magnifique petit sac en peau de Serpentin ? Non ? Vous avez bien raison, car sa résistance laisse à désirer.', 361, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (1892, 53, 'Plume du Maître Corbac', 'Pris de panique, le Maître Corbac ouvrit de larges ailes et laissa tomber cette plume. Pas de quoi casser trois pattes à un Koin-koin, et pourtant...', 362, 160, '');
INSERT INTO `website_shop_objects_templates` VALUES (1893, 65, 'Queue de scorbute', 'Un formidable trophée, dommage qu\'il suinte un liquide nauséabond.', 363, 36, '');
INSERT INTO `website_shop_objects_templates` VALUES (1894, 54, 'Poil de Sanglier des Plaines', 'Ce poil est vraiment répugnant. En regardant de plus près, il y a tout un microcosme qui vit dedans. Quelle chance vous avez.', 364, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (1895, 37, 'Bière du Feubuk', 'Cette bière fortement alcoolisée vous permettra de restaurer vos points de vie.', 4, 1, '6e#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (1896, 63, 'Viande d\'Oiseau', 'Cette cuisse de tofu prouve que les chasseurs savent faire dans la finesse de temps en temps.', 348, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1897, 63, 'Viande d\'Oiseau **', 'Des mini cuisses de kwak pour un maxi goût.', 349, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (1898, 63, 'Chair de Larve', 'Cet amas jaune nauséabond représente la vraie nature de la Larve. On comprend maintenant pourquoi leur peau est si résistante.', 354, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1899, 63, 'Chair de Larve **', 'Cet amas jaune nauséabond représente la vraie nature de la Larve. On comprend maintenant pourquoi leur peau est si résistante.', 354, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (1900, 63, 'Chair de Larve ***', 'Cet amas jaune nauséabond représente la vraie nature de la Larve. On comprend maintenant pourquoi leur peau est si résistante.', 354, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (1901, 63, 'Cuisse de Wabbit ****', 'Cette cuisse est simplement parfaite, on ne peut s\'empêcher de la dévorer des yeux, puis de la bouche.', 368, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (1902, 63, 'Cuisse de Wabbit', 'Cette cuisse de Wabbit semble être parfumée à la cawotte. Idéal pour les pot-au-feu.', 365, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (1903, 63, 'Cuisse de Wabbit **', 'De la bonne cuisse bien musclée qui promet d\'être un régal.', 366, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (1904, 16, 'Dragocoiffe Blanche', 'Une coquille de Dragoeuf Blanc rembourrée de cuir et de laine, rien de tel pour se protéger des attaques classiques et des éclairs d\'un Bwork Mage ivre. En revanche, vous avez l\'air de sortir de l\'oeuf avec un pareil chapeau.', 28, 39, 'd6#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (1905, 63, 'Cuisse de Wabbit ***', 'Une cuisse bien grosse qui devrait remplir la plupart des estomacs.', 367, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (1907, 16, 'Oreilles de Lapineupe', 'Ces oreilles mettront en valeur votre sourire éclatant, tout en vous permettant d\'amplifier les ragots et rumeurs qui circuleront dans votre dos.', 30, 30, '73#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (1908, 16, 'Casque du Chafer', 'Même Spartapine le grand moissonneur, n\'eut pas la chance de porter un tel casque, qui doit sa résistance aux métaux et pierres de qualité utilisés pour sa confection.', 31, 50, '6f#1#0#0#0d0+1,9b#15#46#0#1d50+20,9d#15#46#0#1d50+20,9a#15#46#0#1d50+20,98#15#46#0#1d50+20');
INSERT INTO `website_shop_objects_templates` VALUES (1910, 17, 'Cape Ouginak', 'Cette cape provient d\'un Ouginak, elle sent encore l\'odeur de sa truffe, chaude et humide, un peu comme les mamelles d\'une femelle Bouftou en rût.', 33, 50, '7c#10#19#0#1d10+15,7d#15#28#0#1d20+20,8a#6#23#0#1d30+5');
INSERT INTO `website_shop_objects_templates` VALUES (1911, 63, 'Cuisse de Boufton', 'L\'odeur de cette petite cuisse disparaît à la cuisson.', 334, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (1912, 63, 'Cuisse de Bouftou **', 'Cette cuisse pue la mort bien que cela ne soit pas lié avec le décès prématuré de son propriétaire.', 335, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (1913, 63, 'Cuisse de Bouftou ***', 'Cette cuisse provient d\'un chef de guerre bouftou, dure comme un craqueleur elle pourrait être une massue très puissante s\'il n\'y avait pas l\'odeur.', 336, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (1914, 63, 'Cuisse de Bouftou ****', 'Tendre, mais ferme, pas trop grasse ni trop sèche, cette cuisse est comme un bon vin qui s\'est enrichi et affiné au court de toutes ces années.', 337, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (1915, 63, 'Chair d\'Insecte', 'Il ne faut pas sous-estimer la valeur nutritionnelle de cette chair gluante et asphyxiante.', 370, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1916, 63, 'Chair d\'Insecte **', 'Une chair identique à celle des mosquitos, mais en quantité 10 fois supérieure. Heureusement que certains aiment.', 370, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (1917, 63, 'Carré de Porc', 'Ce morceau de choix de sanglier est un peu sanguinolent pour le moment, mais promet de bons moments.', 331, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (1918, 63, 'Carré de Porc **', 'Un peu plus gros pour un peu plus de bonheur, ce découpage improvisé de Sanglier des plaines ravira tous les carnivores.', 331, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (1919, 63, 'Carré de Porc ****', 'Ce morceau de DragonCochon est si doux et si moelleux qu\'on pourrait en faire un coussin royal. Mais on préfère le manger.', 331, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (1920, 24, 'Badge Bontarien', 'Ce badge permet d\'identifier un milicien lorsqu\'il périt sur un champ de bataille. Il paraît que certains en font collection, à Brâkmar.', 49, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1921, 63, 'Carré de Porc ***', 'Ferme à souhait, le cochon, à qui appartenait ce morceau, devait faire beaucoup d\'exercice.', 331, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (1922, 63, 'DragoViande', 'Viande rare de qualité supérieure, elle garde la chaleur de nombreuses heures après sa cuisson, faisant d\'elle une viande particulièrement pratique pour les voyages.', 371, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (1923, 63, 'DragoViande **', 'Cette dragoviande, en plus de ses qualités thermiques, possède un petit goût naturel de fumé.', 371, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (1924, 63, 'DragoViande ***', 'La dragoviande de dragoeuf est un peu dure à macher, mais bien plus nourrissante que la Dragoviande traditionnelle. Certains pensent même qu\'elle aurait des vertus magiques.', 371, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (1925, 24, 'Permission de 24 heures', 'Cette permission de la milice indique que vous avez quartier libre pendant une journée.', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1926, 63, 'DragoViande ****', 'Cette viande issue des parties dragoniques du dragoncochon (que personne n\'a envie de localiser précisément) \\nest un cadeau du ciel. Ce qui est plutôt logique puisque le dragoncochon vole.', 371, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (1927, 63, 'Museau', 'Ce museau de milimulou, avec ses petites babines fermes, accompagnera avec plaisir toutes vos chalades.', 372, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (1928, 24, 'Défense de sanglier agressif', 'Une bonne dextérité a dû être nécessaire pour extraire cette défense à un Sanglier des plaines.', 51, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1929, 63, 'Museau **', 'Ce museau au goût délicat vous rendra placide. A consommer sans modération.', 373, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (1930, 63, 'Museau ***', 'Cette viande est délicieuse, mais attention à ne pas en abuser. Ce n\'est pas pour rien que le Meulou pue de la gueule.', 374, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (1931, 24, 'Katana ébréché ', 'C\'est l\'arme de Amayiro. Elle a une prise en main étonnante, mais elle semble être légèrement fendue.', 52, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1932, 24, 'Katana rénové ', 'Cette arme, autrefois ébréchée, est à nouveau prête à couper n\'importe quoi. Amayiro ne sera pas déçu.', 53, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1933, 63, 'Viande d\'Oiseau ****', 'Ce petit morceau de corbac est imprégné d\'une magie puissante, probablement celle appliquée par le maître corbac lui-même.', 350, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (1934, 20, 'Couteau de Chasse', 'Ce couteau est la marque typique de reconnaissance des chasseurs. Plus il est gros, coupant, et brillant plus ils se trouvent beaux, du moins selon leurs critères.', 14, 1, '64#4#6#0#1d3+3,8a#2#0#0#0d0+2,31b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1935, 24, 'Chèque de 100000 kamas', 'Qui paye ses dettes s\'enrichit, mais c\'est tout de même une sacrée somme. Mieux vaut éviter les dettes de cette taille, votre porte-feuille vous remerciera.', 54, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1936, 20, 'Hache de chasse', 'Cette hache est particulièrement adaptée pour trancher rapidement et précisément n\'importe quelle partie d\'un animal même encore vivant.', 15, 1, '31b#1#0#0#0d0+1,64#b#f#0#1d5+10,8a#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (1937, 24, 'Rapport d\'espionnage', 'Ce rapport de Bishom Pot doit contenir pas mal de faits et gestes sur les habitants de Brâkmar.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (1938, 20, 'Lame de chasse', 'Cette lame, au nom controversé, fut conçue pour la chasse exclusivement. Un peu délicate à manier, elle sera cependant d\'un grand secours au chasseur habile.', 16, 1, '61#8#11#0#1d10+7,8a#5#0#0#0d0+5,31b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1939, 20, 'Lance de Chasse', 'Pratique contre les groupes de monstres, cette lance demande un certain talent pour être maniée avec dextérité.', 17, 1, '31b#1#0#0#0d0+1,64#b#14#0#1d10+10,8a#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (1940, 20, 'Marteau de chasse', 'Ce marteau n\'a pas une conception classique, il est équilibré de telle sorte qu\'il assome plutôt qu\'il n\'écrase. Très pratique pour chasser, pas du tout pour survivre.', 18, 1, '64#10#1e#0#1d15+15,8a#f#0#0#0d0+15,31b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1941, 20, 'Pelle Chasseuse', 'Cette pelle est particulièrement indiquée pour faucher du monstre sans l\'abîmer. Un accessoire pour chasseur confirmé uniquement.', 9, 1, '31b#1#0#0#0d0+1,60#9#12#0#1d10+8,8a#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (1942, 20, 'Arc de Chasse', 'L\'arc de chasse est considéré comme l\'arme de chasse la plus sure. Un maximum de dégâts sans s\'exposer pour un minimum de traces visibles.', 10, 1, '62#8#c#0#1d5+7,8a#5#0#0#0d0+5,31b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1943, 20, 'Baguette de Chasse', 'Cette baguette brûlera l\'animal visé mais ne déchirera pas ses chairs. En plus de conserver la viande elle permet sa pré-cuisson. Indispensable.', 11, 1, '31b#1#0#0#0d0+1,63#4#8#0#1d5+3,8a#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (1944, 20, 'Crache Boulette', 'Cette arme projette une petite boule de cuivre dans la direction visée. Son efficacité est effrayante mais son bruit ne la destine pas à un autre milieu que celui de la chasse.', 21, 1, '61#6#a#0#1d5+5,63#6#a#0#1d5+5,8a#14#0#0#0d0+20,31b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (1945, 20, 'Hachoir de Boucher', 'Cet énorme couteau permet de découper n\'importe quelle viande.', 12, 1, '64#3#6#0#1d4+2');
INSERT INTO `website_shop_objects_templates` VALUES (1946, 20, 'Hachoir de poissonnier', 'Cet énorme couteau permet de découper n\'importe quel poisson.', 13, 1, '64#3#6#0#1d4+2');
INSERT INTO `website_shop_objects_templates` VALUES (1947, 69, 'Nuggets', 'Ces petits carrés d\'oiseau frit sont un véritable bonheur pour les papilles, mais un grand malheur pour le ventre.', 115, 1, '6e#f#0#0#0d0+15');
