INSERT INTO `website_shop_objects_templates` VALUES (2056, 109, 'Oeil de Corbac', 'Un oeil de corbac est toujours utile, mais attention à ce que le mauvais oeil ne tombe pas sur vous.', 326, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (2058, 15, 'Coeur de Brandon', 'Ce coeur humain vient sûrement du célèbre Lhi, qui était passionné par les corbacs.', 328, 20, '');
