INSERT INTO `website_shop_objects_templates` VALUES (2060, 103, 'Patte de Corbac', 'Pas de quoi casser une patte à un corbac. Surtout qu\'à l\'inverse de la patte de wabbit, la patte de corbac risque de vous porter malheur.', 330, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (2061, 17, 'Cape du Corbac', 'Cette cape, pas très jolie au premier abord est pourtant très efficace, une fois que l\'on s\'habitue à son odeur de Corbac en décomposition.', 15, 45, '7c#6#14#0#1d15+5,d4#6#a#0#1d5+5,b6#1#0#0#0d0+1');
