INSERT INTO `website_shop_objects_templates` VALUES (2063, 11, 'Bottes Volatiles', 'Ces bottes, confectionnées avec de nombreuses parties de cadavre de Corbac, donnent à leur porteur une étrange sensation de légèreté, comparable à celle apportée par la consommation de Bolets grillés.', 17, 41, 'd4#3#5#0#1d3+2,77#1f#28#0#1d10+30,76#1f#28#0#1d10+30,74#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (2064, 14, 'Parchemin de Camouflage', 'Ce parchemin vous permet de vous camoufler au sein du décor, jusqu\'à ce que vous rentriez en combat. Évitez les mouvements brusques et les bruits suspects si vous ne voulez pas être découvert...', 1, 10, 'c1#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2065, 24, 'Casque de chafer d\'élite', 'Ce casque de Chafer est endommagé, mais toujours aussi efficace lorsque l\'on veut faire partie de l\'élite.', 59, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2066, 4, 'Bâton du Kanigrou', 'Ce bâton, est une réplique approximative de celui d\'un Kanigrou. Il réserve quelques surprises, mais pas uniquement de bonnes surprises...', 22, 54, '76#15#23#0#1d15+20,64#b#12#0#1d8+10,7b#15#23#0#1d15+20,77#15#23#0#1d15+20,7d#15#23#0#1d15+20');
