INSERT INTO `website_shop_objects_templates` VALUES (2074, 18, 'Bwak de Feu', 'Ce mignon petit bwak deviendra, plus tard, un affreux kwak. Jusque là n\'ayez pas peur de le garder à vos cotés.', 3, 1, '320#a#0#0#0d0+10,7e#1#50#0#1d80+0,d5#1#14#0#1d20+0');
