INSERT INTO `website_shop_objects_templates` VALUES (2078, 24, 'Testament d\'Ixa Mustam', 'Le testament du père d\'Oto Mustam, il est écrit en ancien Brâkmarien, dommage pour vous, votre connaissance dans cette langue ce résume au mot : \"Guo\'rhalys !\" .', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2079, 24, 'Vin de Gloutovore', 'Il paraît qu\'il faut 20 ans pour arriver à distiller du jus de Gloutovore sans créer un vin toxique.', 62, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2080, 24, 'Jus de Gloutovore', 'Le jus de Gloutovore est aussi toxique que du jus de scorbute. Mais bien distillé il donne un vin au goût incomparable. Cela dit rare sont gens sachant distiller ce jus. Et la plupart du temps se sont des pirates.', 63, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2081, 24, 'Rapport de Finche Aticus', 'Le rapport de l\'espion Finche Aticus indique une liste exhaustive des armes de Bonta et de ses effectifs.', 33, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2082, 32, 'Marcassin', 'Lorsqu\'un jeune marcassin voit ses parents mourir sous ses yeux, il suit l\'assassin pour que ce dernier s\'occupe de lui.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2083, 24, 'Lettre d\'Oto Mustam', 'Une lettre de votre maître adressée à Vil Smisse. Elle est écrite dans un dialecte inconnu pour éviter que les curieux dans votre genre y jettent un oeil.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2084, 24, 'Réponse de Vil Smisse', 'Une réponse de Vil Smisse à Oto Mustam, complètement incompréhensible pour le commun des mortels.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2085, 37, 'Bière de la Tabasse', 'Non seulement elle n\'a aucun goût, mais en plus cette bière est hors de prix. Encore un point commun avec la gente féminine.', 4, 1, '6e#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2086, 37, 'Bière du Alakarte', 'Cette bière aromatisée au Blop Griotte est aussi parfois appelée Manoca.', 4, 1, '8b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2087, 37, 'Bière de la Bagrutte', 'Cette bière vous rend plus vaillant l\'espace d\'un instant... attention cependant à la chute, car l\'instant est vraiment très bref.', 4, 1, '6e#3#0#0#0d0+3');
INSERT INTO `website_shop_objects_templates` VALUES (2088, 37, 'Bière de la Chopenbois', 'Une bière classique, mais la choppe en revanche est superbement sculptée. Pour une fois, le contenant a plus de valeur et d\'importance que le contenu. Une caractéristique partagée avec le crâne des Iops et la presse populaire.', 4, 1, '6e#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2089, 37, 'Bière du Pinchaut', 'Cette bière est chaude ce qui la rend difficilement buvable en été. En revanche, elle dégage une agréable odeur de pain grillé, ce qui en fait une bière parfaite pour les petits déjeuners sans pain.', 4, 1, '6e#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2090, 37, 'Bière du Ferayeur', 'Cette bière a un arrière-goût de ferraille très désagréable, mais est fortement revitalisante, ce qui n\'est pas sans rappeler les bisous de la Momie Nova.', 4, 1, '6e#1#0#0#0d0+1,8b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2091, 25, 'Le Bwak : Bien l\'élever', 'Ce livre explique comment élever un Bwak.', 4, 1, '26c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2092, 25, 'Le Chacha : Bien l\'élever', 'Ce livre explique comment élever un Chacha.', 3, 1, '26c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2093, 25, 'Le Wabbit : Bien l\'élever', 'Ce livre explique comment élever un Wabbit.', 5, 1, '26c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2094, 16, 'Makroute Sombre', 'Le Makroute Sombre est un chapeau qui provient d\'un Makroute Déchiqueté recousu à la main et sans anesthésie. \\nMaintenant, il n\'obéit plus qu\'à son maître et adore mordre les inconnus.', 33, 50, '7d#10#1e#0#1d15+15,b8#3#8#0#1d6+2,b7#3#8#0#1d6+2');
INSERT INTO `website_shop_objects_templates` VALUES (2095, 16, 'Le Ours', 'Le Ours est un chapeau confectionné dans la tête d\'un ours mort. Il a cependant gardé un poil soyeux. Le tailleur qui l\'a confectionné devait être très habile pour avoir réussi a garder l\'expression de mécontentement de l\'ours d\'origine.', 34, 35, '76#b#32#0#1d40+10,7c#b#14#0#1d10+10,9b#1#14#0#1d20+0');
INSERT INTO `website_shop_objects_templates` VALUES (2096, 16, 'Dora Sombre de Brave', 'C\'est le fantôme Brave qui le premier comprit comment utiliser correctement de l\'Osier Sombre à des fins autres que gastronomiques.', 35, 37, '7c#b#14#0#1d10+10,7e#b#32#0#1d40+10');
INSERT INTO `website_shop_objects_templates` VALUES (2097, 16, 'Champo', 'Le Champo appartenait à l\'un des plus grands Maîtres Bolet d\'Amakna. Vaillant et brillant, Gnion le Bolet était le seul de sa race à avoir réussi à se faire respecter des êtres humains.', 36, 43, '6e#1#28#0#1d40+0,70#1#5#0#1d5+0,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2098, 77, 'Certificat de Mise en Chanil : Bwak de Terre', 'Ce certificat décrit les caractéristiques du Bwak de Terre que vous avez placé au chanil.', 21, 1, '');
