INSERT INTO `website_shop_objects_templates` VALUES (2116, 24, 'Recette de la Nocabregor', 'Pour créer de la poudre Nocabregor, il faut 3 mesures de poudre de Perlinpainpain et 1 huile de Koode. \\nSeul un artificier ou un enchanteur est capable de réaliser cette recette à l\'aide d\'un Silex ...', 55, 1, '');
