INSERT INTO `website_shop_objects_templates` VALUES (2118, 17, 'Cape Brâkmarienne', 'Cette cape permet de passer incognito dans un cimetière, ou de se déguiser en Chafeuse lorsque le besoin d\'extrême perversité se fait sentir.', 20, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2119, 17, 'Cape Bontarienne', 'Cette cape vous donne des ailes. La fumée qui s\'en dégage lorsqu\'elle brûle, pourra même vous faire planer.', 34, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2120, 24, 'Paroles d\'Ixa Mustam', '\"Mon testament se trouve au phare d\'Amakna, équipe toi d\'une petite Pelle de Boisaille pour le déterrer. Et donne une claque à mon fils de ma part !\"', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2121, 24, 'Paroles de Tsog', '\"J\'ai caché un coffre à la pointe Est de Sufokia, dans un tunnel, sous des tonneaux de vin. Je te conseille de t\'équiper d\'une petite Pelle de Boisaille pour le déterrer.\"', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2122, 24, 'Lettre d\'invitation pour la cérémonie', 'Cette lettre est cachetée et l\'ouvrir serait malpoli.', 65, 1, '');
