INSERT INTO `website_shop_objects_templates` VALUES (2124, 24, 'Formulaire d\'inspection rempli', 'Un formulaire d\'inspection n°243 rempli par Leonzi Trool, à première vue il n\'en est pas ...', 74, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2127, 24, 'Lettre de Zeurg', 'Cette lettre indique un sortilège capable de détruire les Holbaïds.', 65, 1, '');
