INSERT INTO `website_shop_objects_templates` VALUES (2141, 24, 'Poumon de la plaine', 'Ce collier orné d\'un énorme diamant vert est tellement voyant, que l\'on ne regarde plus que lui et pas la personne qui le porte...Ce qui s\'avère très pratique dans certaines situations.', 66, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2143, 15, 'Clé des Mercenaires', 'Vous avez entre les mains l\'une des clés qui pourra vous faire entrer chez les Mercenaires.', 404, 1, '');
