INSERT INTO `website_shop_objects_templates` VALUES (2159, 14, 'Parchemin de Courage', 'Ce parchemin vous permet d\'améliorer votre Force, ce qui peut servir quand un Kanigrou enragé vous fonce dessus.', 2, 1, 'c1#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2160, 14, 'Parchemin Décourageant', 'Ce parchemin vous permet de réduire la Force d\'une cible unique, ce qui peut servir quand un Kanigrou enragé fonce sur votre ennemi juré.', 4, 1, 'c1#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2161, 14, 'Parchemin de Souplesse', 'Ce parchemin vous permet d\'améliorer votre Agilité, ce qui peut servir quand l\'esquive d\'un meulou est impérative.', 6, 1, 'c1#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2162, 14, 'Parchemin de Raideur', 'Ce parchemin vous permet de réduire l\'Agilité d\'une cible unique, ce qui peut servir quand votre ennemi ne doit pas s\'enfuir à l\'approche d\'un meulou.', 5, 1, 'c1#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2163, 31, 'Armistice', 'Vous êtes inattaquable, jusqu\'à ce que vous rentriez en combat.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2164, 24, 'Echantillon de lave', 'Cet échantillon a été trouvé à l\'Est de la mine.', 37, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2165, 24, 'Echantillon de lave', 'Cet échantillon a été trouvé à l\'Ouest de la mine', 37, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2166, 24, 'Echantillon de lave', 'Cet échantillon a été trouvé près de la mine', 37, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2167, 24, 'Echantillon de lave', 'Cet échantillon a été trouvé au Sud de la mine', 37, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2168, 24, 'Debut de rapport', 'Ce rapport commence à decrire d\'inquietants changements dans la masse magmatique brâkmarienne.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2169, 32, 'Raaga', 'Amener Raaga dans une caverne magmatique.', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2170, 6, 'Epée de Mercenaire', 'Cette longue épée est lourde et peu maniable mais découpe à merveille, un peu comme une longue épée lourde et peu maniable.', 25, 1, '5f#29#3c#0#1d20+40');
INSERT INTO `website_shop_objects_templates` VALUES (2171, 24, 'Rapport de Raaga', 'Ce rapport décrit les changements chaotiques des activités volcaniques de Brâkmar.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2172, 24, 'Liste d\'échantillons à trouver', 'Raaga vous a noté vite fait les indications à suivre pour trouver de bons échantillons de lave : \\nChercher sur un périmètre de 5 lieux. Chercher des petits pics.', 41, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2173, 25, 'Les secrets du langage écureuil', 'Ce dictionnaire vous apprend à dialoguer avec un écureuil, ou tout du moins essayer ...', 6, 1, '26c#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2174, 24, 'Laisser-Passer Quartiers d\'interrogation', 'Ce bout de papier permet d\'entrer librement dans les petits quartiers d\'interrogation de la prison.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2175, 24, 'Menace de l\'intendant', 'Une menace écrite de Danathor, pour ne pas oublier de surveiller ses arrières à l\'avenir.', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2176, 24, 'Adresse de Rimaraf', 'Rimaraf habite une maison en brique rouge au 13 Ruelle de la Découpe dans le quartier de la Boucherie.', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2177, 24, 'Broche de Danathor', 'Cette petite broche vous a été donnée par Danathor.', 69, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2178, 80, 'Formulaire d\'enquête n°36', 'Ce formulaire permet d\'identifier d\'éventuels suspects dans des actes criminels. \\n(Cliquer sur le parchemin, et puis sur quelqu\'un pour l\'utiliser)', 6, 1, 'c1#0#0#0#0d0+0,c1#0#0#0#0d0+0,c1#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2179, 47, 'Dent de Dragodinde', 'Cette Dent paraît bien tranchante. Elle pourrait devenir une arme redoutable entre les mains de n\'importe qui. Heureusement que le dragodinde ne s\'en sert que pour mâcher de la salade.', 419, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (2180, 24, 'Compte-rendu interrogatoire', 'L\'alibi de cette personne semble irréprochable...', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2181, 24, 'Compte-rendu interrogatoire', 'Cette personne est suspecte, son alibi ne tient pas debout.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2182, 24, 'Carte d\'un enqueteur', 'Un enquêteur de la milice vous surveille et vous suspecte du meurtre de Rimaraf. \\nIl vous a laissé sa carte lors de l\'interrogatoire ...', 71, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2183, 44, 'Potion d\'oubli de métier : Pêcheur', 'Cette potion vous fera oublier le métier de Pêcheur', 2, 1, '267#0#0#24#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2184, 44, 'Potion d\'oubli de métier : Poissonnier', 'Cette potion vous fera oublier le métier de Poissonnier', 2, 1, '267#0#0#3a#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2185, 44, 'Potion d\'oubli de métier : Chasseur', 'Cette potion vous fera oublier le métier de Chasseur', 2, 1, '267#0#0#29#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2186, 44, 'Potion d\'oubli de métier : Boucher', 'Cette potion vous fera oublier le métier de Boucher', 2, 1, '267#0#0#38#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2187, 41, 'Pichon Eud\'Compet', 'Ce poisson, pêchable uniquement dans la pichine de Sufokia, est un croisement entre tout plein d\'autres poissons.', 400, 1, '32a#17#a0#0#1d138+22');
INSERT INTO `website_shop_objects_templates` VALUES (2188, 20, 'Canne à Pichon', 'Seule cette canne permet de pêcher les pichons de la pichine de Sufokia.', 8, 1, '60#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (2189, 24, 'Certificat de bon vote', 'Ce petit bout de papier signé par Satirev Refibrom prouve que vous avez voté lors d\'un jugement... Et que vous avez bien voté.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2190, 80, 'Formulaire d\'enquête n°33', 'Ce formulaire permet habituellement de faire avouer un suspect dans des affaires criminels. Il ne reste plus qu\'à le remplir vous-même pour créer un faux interrogatoire de \'Oni Tnec\'. \\n(L\'utiliser sur vous pour l\'utiliser)', 6, 1, 'c1#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2191, 24, 'Certificat de mauvais vote', 'Ce petit bout de papier signé par Satirev Refibrom prouve que vous avez voté lors d\'un jugement... Et que vous avez menti.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2192, 24, 'Documents volés', 'Ces documents top secret sont scellés par une glyphe de mort. Si vous l\'ouvrez vous ne pourrez pas les lire.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2193, 24, 'Touffe de cheveux de Puja', 'Vous avez mis une raclée au fils d\'Oto Mustam. Il n\'appréciera sans-doute pas.', 30, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2194, 24, 'Pense-bête', 'Ramener 10 écorces d\'abraknyde.', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2195, 24, 'Dent', 'Cette dent doit probablement vous appartenir vu la raclé que Oto Mustam vous a mis. \\nIl serait peut-être sage d\'attendre qu\'il se calme avant de lui reparler à moins que vous ne vouliez vous faire massacrer à nouveau.', 35, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2196, 29, 'Connaissance', 'Cette bénédiction permet de gagner de l\'Intelligence pour les prochains combats.', 3, 1, '32b#5#0#0#0d0+5,7e#19#0#0#0d0+25');
INSERT INTO `website_shop_objects_templates` VALUES (2197, 14, 'La Force Divorce', 'Ces anneaux permettent de briser les liens sacrés du mariage.', 13, 1, '7#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (2198, 14, 'Parchemin de Connaissance', 'Ce parchemin vous permet d\'améliorer votre Intelligence, ce qui peut servir pour garder son calme face à deux Bworks.', 7, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2199, 14, 'Parchemin de Stupidité ', 'Ce parchemin vous permet de réduire l\'Intelligence d\'une cible unique, ce qui peut servir quand votre ennemi est prêt à paniquer à l\'approche de deux Bworks.', 8, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2200, 24, 'Menace de Satirev Refibrom', 'Le grand juge de Brâkmar ne veut plus vous voir. Il semble qu\'il ne vous porte pas du tout dans son coeur...enfin il n\'en a pas de toute façon.', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2201, 29, 'Sérénité ', 'Cette bénédiction permet de gagner de la Sagesse pour les prochains combats.', 4, 1, '7c#19#0#0#0d0+25,32b#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (2202, 30, 'Sénilité ', 'Cette malédiction vous enlève de la Sagesse pour le prochain combat.', 4, 1, '9c#19#0#0#0d0+25,32b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2203, 14, 'Parchemin de Modération', 'Ce parchemin vous permet d\'améliorer votre Sagesse, ce qui peut servir pour arriver plus rapidement à la cheville de Dark Vlad.', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2204, 14, 'Parchemin de Sénilité ', 'Ce parchemin vous permet de réduire la Sagesse d\'une cible unique, ce qui peut servir quand votre ennemi essaye d\'arriver plus rapidement à la cheville de Dark Vlad.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2205, 24, 'Changement d\'ordre', 'Ce papier indique que vous avez déjà effectué un changement d\'ordre.', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2206, 29, 'Aubaine', 'Cette bénédiction permet de gagner de la Chance pour les prochains combats.', 5, 1, '7b#19#0#0#0d0+25,32b#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (2207, 24, 'Papier de détention', 'Sur ce papier est indiqué les crimes que vous avez commis, ainsi que la date à laquelle vous avez été incarcéré...', 73, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2208, 30, 'Guigne', 'Cette malédiction vous enlève de la Chance pour le prochain combat.', 5, 1, '98#19#0#0#0d0+25,32b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2209, 14, 'Parchemin d\'Aubaine', 'Ce parchemin vous permet d\'améliorer votre Chance, ce qui peut servir pour trouver plus facilement un tofu dans une botte de foin.', 11, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2210, 14, 'Parchemin de Guigne', 'Ce parchemin vous permet de réduire la Chance d\'une cible unique, ce qui peut servir quand votre ennemi tente de faire fortune.', 12, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2211, 14, 'Costume Iopesque', 'Grâce à cet accoutrement, vous allez briller dans les bals mondains. Le seul souci, c\'est que l\'on va souvent vous dire que vous êtes malin comme un Iop.', 14, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2212, 14, 'Costume Xeloresque', 'Muni de ce chapeau et de quelques ustensiles fournis, la ressemblance est flagrante. Vous êtes un Xelor, cela ne fait aucun doute.', 15, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2213, 14, 'Costume Sadidesque', 'Il suffit de très peu de choses pour ressembler à un sadida: une descente de lit, avoir le regard dans le brouillard et la tête coincée dans le rectum. Effet garanti.', 16, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2214, 31, 'Iop attitude', 'Vous avez la Iop attitude, jusqu\'à ce que vous rentriez en combat.', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2215, 31, 'Xélor attitude', 'Vous avez la Xélor attitude, jusqu\'à ce que vous rentriez en combat.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2216, 31, 'Sadida attitude', 'Vous avez la Sadida attitude, jusqu\'à ce que vous rentriez en combat.', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2217, 14, 'Costume Fecaesque', 'Cette moumoute sort tout droit d\'un vieux placard, cela se voit à l\'aspect un tantinet \"rétro\" de cette coiffe. Par contre, c\'est affolant ce que vous pouvez ressemblez à un féca en la mettant sur votre tête (parce que vous le voulez bien).', 17, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2218, 31, 'Féca attitude', 'Vous avez la Féca attitude, jusqu\'à ce que vous rentriez en combat.', 7, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2219, 14, 'Costume Eniripsesque', 'Ces ailes d\'eniripsa ne vous permettent pas de voler. Ne faites donc pas le fanfaron devant vos camarades avec cet accoutrement, vous risquez d\'avoir l\'air ridicule à l\'atterrissage.', 18, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2220, 31, 'Eniripsa attitude', 'Vous avez l\'Eniripsa attitude, jusqu\'à ce que vous rentriez en combat.', 8, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2221, 14, 'Costume Enutrofesque', 'Cette fausse barbe vous fait ressembler à un Enutrof, certes, mais elle vous donne aussi une haleine digne d\'un Enu de sortie le samedi soir. De quoi donner une sacré fièvre.', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2222, 31, 'Enutrof attitude', 'Vous avez l\'Enutrof attitude, jusqu\'à ce que vous rentriez en combat.', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2223, 14, 'Costume Sacriesque', 'Un peu de sang de tofu ainsi que de fausses cicatrices, un regard de pirate psychotique et le tour est joué. Vous pourrez participer aux réunions de sacrieurs en vous faisant passer pour l\'un d\'eux sans être suspecté.', 20, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2224, 31, 'Sacrieur attitude', 'Vous avez la Sacrieur attitude, jusqu\'à ce que vous rentriez en combat.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2225, 14, 'Costume Sramesque', 'Un Kwane, une cape sur la tête, l\'illusion est parfaite. Si vous portez ce costume, vous aurez l\'air d\'un affreux et abject personnage sortant du fin fond d\'un cimetière: un Sram, tout simplement.', 21, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2226, 31, 'Sram attitude', 'Vous avez la Sram attitude, jusqu\'à ce que vous rentriez en combat.', 11, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2227, 14, 'Costume Osamodesque', 'N\'en déplaise à certains, vous pouvez vous munir de cette queue fourchue et de ces cornes. Une fois équipé, ce costume vous ira comme un gant et vous serez prêt à vous inviter parmis les fêtes très connues \"vie-ail-pie\" que font les Osamodas en cachette.', 22, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2228, 31, 'Osamodas attitude', 'Vous avez l\'Osamodas attitude, jusqu\'à ce que vous rentriez en combat.', 12, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2229, 14, 'Costume Ecaflipesque', 'On peut y trouver des oreilles en poil de wabbit très doux, une queue tigrée et une boîte de puces excitées. Pas de doute, quand vous refilerez ces sales petites bêtes à vos voisins, on ne pourra pas douter de vos talents de transformiste.', 23, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2230, 31, 'Ecaflip attitude', 'Vous avez l\'Ecaflip attitude, jusqu\'à ce que vous rentriez en combat.', 13, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2231, 14, 'Costume Craesque', 'Le Cra, vous l\'aurez remarqué, se promène souvent avec son carquois. Pas étonnant que muni de celui-ci, les gens vous prennent pour un des leurs. Mais ce n\'est qu\'un leurre, quel bonheur de les berner à toute heure.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2232, 31, 'Crâ attitude', 'Vous avez la Crâ attitude, jusqu\'à ce que vous rentriez en combat.', 14, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2233, 10, 'La Croqueuse', 'Cette ceinture fut créée par Xof le Lenald, il eut la bonne idée de ramasser toutes les dents qu\'il pouvait trouver sur un champ de bataille Wabbit. Depuis ce jour, ce geste est devenu une habitude.', 20, 28, '7e#10#1e#0#1d15+15,d5#1#2#0#1d2+0,db#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (2234, 31, 'Bonta Attitude', 'Vous avez La Bonta attitude, jusqu\'à ce que vous rentriez en combat.', 15, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2235, 31, 'Brâkmar Attitude', 'Vous avez La Brâkmar attitude, jusqu\'à ce que vous rentriez en combat.', 16, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2236, 14, 'Costume Bontesque', 'Avec cet accoutrement, un bon nombre de voyageurs vous salueront et vous demanderont leurs chemins.', 25, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2237, 14, 'Costume Brâkmaresque', 'Muni de ces affaires, vous serez redouté de tous.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2239, 48, 'Poudre d\'Eniripsa', 'Cette poudre est produite en petite quantité à partir d\'ailes d\'Eniripsas. Elle semble avoir des vertus curatives sur les familiers.', 260, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2240, 74, 'Petite Fée d\'Artifice Rouge', 'Idéal pour les petites fêtes de mariage, parfait pour la fête du Slip du Captain Chafer.', 28, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2241, 110, 'Gelée Menthe Royale', 'La Gelée Royale a détroussé plus d\'un aventurier un peu trop entreprenant, la voila enfin anéantie. Attention, il est déconseillé de la  consommer comme une vulgaire Gelée Menthe.', 408, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (2242, 110, 'Gelée Fraise Royale', 'Du concentré de Gelée Fraise Royale peut transformer n\'importe quel tabi pacifiste en machine de guerre assoiffée de sang. Attention donc à ne pas en servir en apéritif à vos amis.', 409, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (2245, 47, 'Pince de Scorbute', 'Autrefois utilisée pour se gratter le bas du dos, elle est aussi très pratique une fois accrochée à un mur, pour y faire tenir des capes. Ça marche également si vous vous l\'accrochez dans le bas du dos quoique un poil plus douloureux.', 411, 36, '');
INSERT INTO `website_shop_objects_templates` VALUES (2246, 15, 'Couronne Brisée du Tofu Royal', 'Cette couronne a été brisée par de puissantes attaques magiques, ou par le dernier coup de boule que le Tofu Royal a tenté de vous assener.', 412, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (2247, 53, 'Plume de Tofu Royal', 'Il n\'y a qu\'un Iop pour ne pas se rendre compte que cette plume provient de la croupe d\'un Tofu Royal. Pourtant ça se voit, la plume est plus grosse.', 413, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (2248, 54, 'Poil d\'Ouginak', 'Ce Poil tient chaud, la preuve, votre main est moite depuis que vous l\'observez. A moins que ce ne soit la peur des représailles du prochain Ouginak qui vous verra avec ce poil dans la poche. De quoi aboyer de rage. \\nWa-hoooo.', 414, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (2249, 36, 'Feuille de Tronknyde', 'Cette Feuille doit sûrement fournir au Tronknyde la force nécessaire pour se battre. Encore faut il savoir comment bien l\'utiliser. Ce qui vient tout de suite à l\'idée, c\'est de la hacher et de l\'incorporer à des haricots. Un régal.', 415, 35, '');
INSERT INTO `website_shop_objects_templates` VALUES (2250, 38, 'Bois de Tronknyde', 'Ce morceau de Bois sonne creux. La sève verte qui s\'en échappe vous signale que cette partie n\'était rien d\'autre que le nez du Tronknyde.', 416, 35, '');
INSERT INTO `website_shop_objects_templates` VALUES (2251, 51, 'Méga Pierre du Craqueleur', 'Je ne vous jette pas la Mégapierre Pierre !', 417, 45, '');
INSERT INTO `website_shop_objects_templates` VALUES (2252, 47, 'Dent en Or du Craqueleur', 'Vous venez d\'édenter sans scrupule le Craqueleur qui croisait votre chemin. Dommage qu\'il n\'en possédait qu\'une seule, un dentier aurait facilement couvert les frais de Zaap durant un bon mois.', 418, 31, '');
INSERT INTO `website_shop_objects_templates` VALUES (2253, 35, 'Fleur de Gloutovore', 'Cette Fleur facilite le transit intestinal. Elle est vivement recommandé après un séjour chez votre cuisinier favori.', 420, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (2254, 36, 'Feuille de Fourbasse', 'La feuille de Fourbasse a un goût très particulier, entre la noisette et la salace peu fraiche. Vos plats auront en tout cas un petit parfum de fourbasserie si vous souhaitez toutefois la goûter.', 421, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (2255, 24, 'Rapport de l\'espion', 'Aucune activité dangereuse en ce moment. L\'organisation des miliciens est perturbée par l\'assassinat de l\'un des leurs. Il semblerait que ce soit un bontarien qui ait fait le coup', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2256, 24, 'Carcasse de rat d\'égouts', 'Ce rat n\'est plus que de la viande froide. Un de moins qui traîne dans l\'entrée des égouts.', 121, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2257, 24, 'Morceau de mur d\'égout', 'Ce morceau de mur d\'égout a été retrouvé dans l\'estomac d\'un bidule', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2259, 47, 'Dent de Karne', 'Vous avez dans la main le jeu le plus ancien de la contrée d\'Amakna. les règles sont simples: lancez une Dent et tentez de la ratrapper avec la même main, tout en récupérant une deuxième Dent de Karne au sol.', 13, 16, '');
INSERT INTO `website_shop_objects_templates` VALUES (2260, 24, 'Carte d\'un brâkmarien', 'Quelqu\'un a glissé cette carte de visite dans votre équipement. Il semble que ce soit un brâkmarien. Cette carte annonce que les Guerriers sont intéressés par vos talents d\'assassinat et vous propose de rejoindre la folle aventure brâkmarienne.', 72, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2261, 30, 'Esprit Renifleur', 'Un esprit renifleur vous hante. Il se nourrit de votre odeur et de votre vitalité.', 7, 1, '32b#5#0#0#0d0+5,99#1#14#0#1d20+0');
INSERT INTO `website_shop_objects_templates` VALUES (2262, 24, 'Description de l\'assassin', 'Vous avez trouvé un Bontarien qui empestait l\'odeur du sang. Toutes les informations que vous avez pu rassembler sur ce personnage sont inscrites sur cette feuille de papier.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2263, 80, 'Bâton renifleur de Sang', 'Ce bâton est possédé par un esprit renifleur. On peut libérer cet esprit qui foncera alors tout droit jusqu\'à croiser un objet possédant l\'odeur qu\'il aime. Il hantera alors cette personne quelques temps avant de repartir aux pays des esprits.', 25, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2264, 59, 'Peau de Gobelin', 'Un Gobelin est souvent moqueur et sournois, mais si vous le dépecez, il fera moins le malin ce satané Gobelin.', 422, 16, '');
INSERT INTO `website_shop_objects_templates` VALUES (2265, 24, 'Description d\'un Bontarien', 'Vous avez libéré un esprit renifleur mais il ne s\'est pas fixé sur la personne visée. Vous avez noté quelques informations de la personne sur ce bout de papier afin de vous en souvenir', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2266, 15, 'Lait de Cochon de Lait', 'Ce Lait de Cochon provient d\'un Cochon de Lait. On sait jamais, au cas ou vous pensiez l\'avoir trouvé sur un Tofu, il n\'en est rien.', 423, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2267, 15, 'Dragolait', 'Ce Dragolait est une denrée rare, car personne dans la contrée n\'a encore vu un Dragon Cochon se laisser traire. On imagine aisément qu\'il faut au minimum sept personnes pour tenir la bestiole tandis que la huitième doit traire très très rapidement.', 424, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (2268, 15, 'Scalp de Bwork Archer', 'Voici un Scalp qui pourrait lancer une nouvelle mode chez les Enutrofs : le poustiche. Un peu de produit anti-poux et vous serez prêt à concourir pour l\'Enutrof le plus classe du monde.', 425, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (2269, 24, 'Oeil de Larve bleue', 'Vous venez de récupèrer cet Oeil intact. Bien préparé, des yeux brouillés sont un régal pour un petit déjeuner. Cet oeil de larve prouvera à Oto que vous avez bien tué une larve bleue.', 70, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2270, 24, 'Grappe d\'Oeufs de larve', 'Cette grappe d\'œufs ressemble à une grosse grappe de raisin. Mais il vaut mieux éviter de la manger.', 83, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2271, 56, 'Cuir Violet de Bwork', 'Beaucoup de mystères planent encore autour de cet artisanat Bwork. Certains aventuriers pensent que la teinte violacée proviendrait des Gobelins, mais le cuir a une origine inconnue. Bizarre.', 426, 31, '');
INSERT INTO `website_shop_objects_templates` VALUES (2272, 32, 'Larve Dorée', 'Cette larve vient de naître d\'un oeuf. Son premier regard s\'étant posé sur vous, elle vous considère comme sa mère.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2273, 55, 'Tissu Pourpre', 'Léger et doux au toucher, voila ce que l\'on peut dire de cet étrange Tissu Pourpre. Il est écrit sur une étiquette à l\'intérieur \"made in taille one\".', 427, 23, '');
INSERT INTO `website_shop_objects_templates` VALUES (2274, 15, 'Bougie du Mineur Sombre', 'Prenez un Enutrof. Quand il fait noir dans les mines, on ne le voit plus. Le Mineur Sombre, lorsqu\'il est dans le noir, on ne le voit pas non plus, puisque maintenant vous avez sa bougie.', 428, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (2275, 56, 'Cuir de Porkass', 'Le Porkass a failli disparaître de la chaîne alimentaire. Il a fallut accoupler des Sangliers et des Cochons de Lait pour à nouveau retrouver les Plaines de Cania remplies de Porkass. Depuis, celui-ci en veut à la terre entière. Quel caractère de porc.', 429, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (2277, 55, 'Linceul', 'Pour gagner en crédibilité, les fantômes s\'enrobent d\'un Linceul leur permettant de terroriser les aventuriers perdus.', 430, 65, '');
INSERT INTO `website_shop_objects_templates` VALUES (2278, 55, 'Tissu Invisible', 'Ce tissu servit à Harry Taupeur, chasseur de taupe. Il s\'enroulait dedans afin de piéger les Taupes qui infestaient son jardin. C\'est le charismatique Captain Chafer qui se l\'est approprié avant de disparaître dans des circonstances bien étranges...', 431, 23, '');
INSERT INTO `website_shop_objects_templates` VALUES (2279, 47, 'Dent Pointue', 'Cette Dent appartenait à un Vampire, cela ne fait aucun doute. On peut le constater en observant de près le bout de la Dent qui s\'avère être on ne peut plus pointue.', 432, 15, '');
INSERT INTO `website_shop_objects_templates` VALUES (2280, 15, 'Paille Vampiresque', 'Ne sous-estimez jamais un Vampire surtout avec une paille dans la main, il pourrait vous sucer le sang jusqu\' à plus soif.', 433, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (2281, 55, 'Tissu Sanguin', 'Ce tissu a l\'air vivant, les Vampires s\'en servent souvent pour défiler dans de jolies accoutrements lors des bals costumés.', 434, 15, '');
INSERT INTO `website_shop_objects_templates` VALUES (2282, 15, 'Touffe de Cheveux Blancs', 'Voici la preuve que certains monstres se font beaucoup de soucis.', 435, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (2283, 109, 'Oeil de Kwoan', 'Cet oeil de Kwoan a des effets hypnotiques surprenants, autant dire qu\'il faut toujours garder un oeil sur vous quand vous le manipulez.', 436, 8, '');
INSERT INTO `website_shop_objects_templates` VALUES (2284, 24, 'Note de Harry Stote', 'L\'entrée de la grotte légendaire aux larves dorées se trouve un peu à l\'ouest d\'Amakna. Les pouvoirs latents de la larve dorée te permettront d\'y rentrer. Attention si ta petite larve se prend des dégâts elle se précipitera dans les bras de son père.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2285, 55, 'Tissu Sombre', 'La particularité de ce Tissu n\'est plus sujet à controverse. Cela dit, il est très irritant au toucher, sûrement parce qu\'un Ouginak s\'est dans le meilleur des cas, mouché dessus pendant des années.', 437, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (2286, 15, 'Bandelettes', 'Ces bandelettes sont révolutionnaires : triple épaisseur, parfumées à la violette, ultra résistantes. C\'est vraiment un produit de qualité.', 438, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (2287, 56, 'Cuir Noir', 'Ce cuir est déjà traité, sa provenance n\'est pas certaine mais la couleur provient probablement d\'une teinture spéciale.', 439, 74, '');
INSERT INTO `website_shop_objects_templates` VALUES (2288, 103, 'Patte de Wabbit', 'Bon nombres de touristes vont sur l\'île de Wabbits essentiellement pour se munir d\'une Patte de Wabbit car elle porte bonheur. Malheureusement, ça n\'est pas le cas, mais il ne faut pas le dire, le tourisme en serait fort pénalisé.', 440, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2290, 107, 'Carapace de Scarafeuille Blanc', 'Il ne faut pas grand chose pour avoir un bel abat-jour chez soi. Soit dit en passant, cette carapace doit avoir tout de même une autre utilité. Enfin espérons-le.', 441, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (2291, 107, 'Carapace de Scarafeuille Bleu', 'Il ne faut pas grand chose pour avoir un bel abat-jour chez soi. Soit dit en passant, cette carapace doit avoir tout de même une autre utilité. Enfin espérons-le.', 442, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (2292, 107, 'Carapace de Scarafeuille Rouge', 'Il ne faut pas grand chose pour avoir un bel abat-jour chez soi. Soit dit en passant, cette carapace doit avoir tout de même une autre utilité. Enfin espérons-le.', 443, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (2293, 107, 'Carapace de Scarafeuille Vert', 'Il ne faut pas grand chose pour avoir un bel abat-jour chez soi. Soit dit en passant, cette carapace doit avoir tout de même une autre utilité. Enfin espérons-le.', 444, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (2294, 15, 'Viscères de Scarafeuille', 'Au premier abord, ces viscères ne semblent pas très appétissants. Et pourtant, hâchés avec de fines herbes séchées au soleil, un peu de menthe sauvage, et cuits à l\'étouffée dans un vieux chaudron rouillé, ces viscères combleront de joie le plus gourmet des Chafers.', 445, 32, '');
INSERT INTO `website_shop_objects_templates` VALUES (2295, 15, 'Fragment d\'Epée Reptilienne', 'Avec ce Fragment d\'Epée accroché à votre cheminée, vous pourrez vous vanter de dompter le Crocodaille tel l\'excentrique Mikoule, plus connu sous le nom de Crocodaille Dandi.', 446, 69, '');
INSERT INTO `website_shop_objects_templates` VALUES (2296, 15, 'Bouclier Reptilien', 'A quoi pourrait bien vous servir ce magnifique bouclier orné de pierres précieuses ? En attendant que vous ne trouviez la réponse, il peut déjà vous servir de plateau pour apporter le thé à vos amis.', 447, 69, '');
INSERT INTO `website_shop_objects_templates` VALUES (2297, 15, 'Carreau d\'Arbalète', 'Ce Carreau peut vous servir à confectionner une arme courte mais tranchante. Elle peut aussi faire office de cure-dents, à vous de voir.', 125, 34, '');
INSERT INTO `website_shop_objects_templates` VALUES (2299, 15, 'Epaulette du Dark Vlad', 'Cette épaulette a dû essuyer plus d\'une bataille. Même si d\'apparence elle ne semble pas très résistante, mieux vaux ne pas frapper le Dark Vlad à l\'épaule si vous tenez à votre arme.', 449, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (2300, 47, 'Fragment d\'Os', 'Ce Fragment d\'Os provient soit d\'un reste de Chafer datant du néotilique, soit d\'un repas de Meulou. Mais il y a de grandes chances pour que ce ne soit aucun des deux.', 450, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (2301, 15, 'Moustache de Kolérat', 'Peu résistant, la Moustache pourra vous servir à faire le mariol devant vos amis. Ressembler par exemple à Salve et Torh Bali, Grands peintres Brâkmarien.', 451, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2302, 15, 'Langue de Crabe', 'Les têtes pensantes d\'Amakna se demandent encore quelle est l\'utilité de cette langue pour le crabe. Ils seraient probablement offusqués s\'ils connaissaient la réponse.', 452, 4, '');
INSERT INTO `website_shop_objects_templates` VALUES (2303, 107, 'Carapace vide de Crabe', 'Correctement vidée, cette Carapace de Crabe peut contenir divers objets. Toutefois, les objets en question garderont éternellement une odeur de Crabe plus ou moins troublante.', 453, 4, '');
INSERT INTO `website_shop_objects_templates` VALUES (2304, 51, 'Fragment de Pierre Polie', 'Ce Fragment provient de la fesse gauche d\'un Craqueleur des Plaines. Pour éclater une Arakne, il n\'y a pas mieux, à part le Craqueleur en personne peut-être.', 454, 45, '');
INSERT INTO `website_shop_objects_templates` VALUES (2305, 51, 'Fragment de Pierre Pointue', 'Ce Fragment provient de l\'omoplate droit d\'un Craqueleur des Plaines. A moins que ce ne soit une partie du bas ventre. Dans tous les cas, cette pierre n\'est pas à placer n\'importe où.', 455, 45, '');
INSERT INTO `website_shop_objects_templates` VALUES (2306, 51, 'Coeur de Craqueleur', 'Coeur de pierre, ne vois tu pas en moi l\'amour que je te porte. Si tu continues, je te laisse par terre, je ne vais pas me laisser saouler de la sorte.', 456, 45, '');
INSERT INTO `website_shop_objects_templates` VALUES (2307, 24, 'Bouclier de Chafer Lancier', '...', 75, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2308, 24, 'Badge Brâkmarien', 'Ce badge permet d\'identifier un guerrier lorsqu\'il périt sur un champ de bataille. Il paraît que certains en font collection, à Bonta.', 76, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2309, 24, 'Bougie Rouge', 'Une bougie rouge pas comme les autres...', 77, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2310, 24, 'Bougie Verte', '...', 78, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2311, 24, 'Bougie Bleue', '...', 79, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2312, 24, 'Poudre de Sang', '...', 80, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2313, 24, 'Respirateur Aquatique', '...', 81, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2314, 24, 'Fioles de Jiva', '...', 82, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2315, 54, 'Poils de Crocs Glands', 'Broujitte Fardot lança une interdiction jadis, sur l\'abattage des jeunes Crocs Glands. Depuis son exil, la chasse a repris et les tailleurs se remplissent à nouveau les poches.', 196, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2316, 47, 'Croc Jaune', 'Le Croc Jaune de Croc Gland apporte une peur bleue à tous ceux qui sous estimeraient son pouvoir.', 458, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2317, 106, 'Oreilles de Loup', 'C\'est en observant de près que l\'on se demande comment un Croc Gland entend quelquechose avec toutes les bêtes et autres crasses qu\'il possède dans ses Oreilles.', 459, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2318, 103, 'Patte d\'ours', 'Certains gobelins portent une patte d\'ours autour du cou. Une superstition dont tout le monde a oublié l\'origine et la signification.', 460, 12, '');
INSERT INTO `website_shop_objects_templates` VALUES (2320, 15, 'Collier Cassé d\'Ouginak', 'Comme tout bon Ouginak, son Collier donne des informations. Il est écrit: \"je suis perdu, mon quartier se trouve sur le sentier des Landes de Sidimote, merci de me ramener à mes maîtres Brâkmariens, ils vous offriront des baffes en remerciements.\"', 462, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (2321, 15, 'Babines d\'Ouginak', 'Vous avez l\'impression que ces Babines d\'Ouginak pourraient suinter de la bave indéfiniment. Peut-être parce que cet animal est réputé pour sa gourmandise éternelle.', 463, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (2322, 47, 'Crocs de Rats', 'Ne vous-y méprenez pas, ces petites quenottes sont en fait de vrais crocs aiguisés, malodorants et usés. Ils servent parfois à remplacer les dents en or des Enutrofs un peu trop avares.', 464, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (2323, 47, 'Colonne Vertebrale', 'Voici une Colonne Vertébrale de bonne facture. Ce n\'est pas une raison pour vous éclater le dos non plus.', 465, 34, '');
INSERT INTO `website_shop_objects_templates` VALUES (2324, 46, 'Pastèque', '...', 466, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2325, 46, 'Banane', 'Le célèbre ménestrel Geror Lendorman composa jadis une ode en l\'honneur de ce fruit : \"La banane des gens heureux\".', 467, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2326, 46, 'Orange', '...', 468, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2327, 46, 'Pomme', '...', 469, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2328, 15, 'Petite Perle Dorée', 'Cette perle dorée est un cadeau de la petite larve que vous avez accompagnée. Elle est donc pour vous d\'une grande valeur sentimentale. Sa douceur et sa couleur en font un cadeau parfait pour une personne un tant soit peu féminine.', 483, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2329, 46, 'Poire', '...', 470, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2330, 15, 'Capsule Explosive', 'Cette capsule contient des extraits d\'agrumes magiques. Il est conseillé de l\'agiter avant de l\'utiliser pour que la pulpe ne reste pas dans le fond.', 711, 23, '');
INSERT INTO `website_shop_objects_templates` VALUES (2331, 46, 'Aubergine', 'Pas réellement nutritive, certains accompagnent l\'aubergine avec toutes sortes de condiments. Ce légume fruit a mauvaise réputation mais il est pourtant bénéfique pour la santé. Sauf pour celle des Bworks mais personne ne sait pourquoi.', 472, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2332, 42, 'Bonbon de Consolation', 'Ce bonbon vous a permis de ne pas pleurer.', 135, 1, '6e#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (2333, 42, 'Bonbon Rouge Surpuissant', 'Ce bonbon, augmentera votre attention lors des combats, pas de chance, il a vraiment un goût immonde. (DOUBLE CLIC POUR UTILISER, bonus de 20 en sagesse et de 10 en Prospection pour les 30 prochains combats).', 136, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2336, 47, 'Crâne de chafer', 'Ce crâne-là ne cliquettera plus jamais... quoique.', 480, 16, '');
INSERT INTO `website_shop_objects_templates` VALUES (2337, 25, 'Livre Magique', 'Ce livre semble magique. Très étrange.', 7, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2338, 25, 'Vieux Bouquin', '...', 8, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2339, 24, 'Liste d\'equipements standards', 'Un guerrier de valeur moyenne se doit de porter autre chose que des haillons ou, au contraire, des choses clinquantes, il préfèrera donc: \\n-Un camaieu au majeur \\n-Un bandeau et une ceinture de vitalité \\n-Des bottes de Kluh \\n-Une cape brâkmarienne', 41, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2340, 24, 'Caleçon de milicien', 'Ceci est bien un caleçon de milicien. Vous devez être un sacré fétichiste pour posséder ceci. Ou bien quelqu\'un veut rire de vous.', 84, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2341, 2, 'Arc de Mech Riorraw', 'Cet arc a été conçu par Mech Riorraw, il est calibré pour pouvoir traverser la rivière de lave et atteindre le haut des murailles de Brâkmar, ni plus, ni moins.', 8, 10, '62#1f#32#0#1d20+30,9a#fa#0#0#0d0+250,32c#1#0#1#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2342, 24, 'Bague d\'allégeance', 'Cette bague vous a été donnée par Domen. Lui rendre signifie que vous êtes pour la destruction de toute chose. Ce qui vous place du coté des adorateurs de Djaul.', 86, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2343, 24, 'Bracelet de Djaul', 'Ce bracelet vous a été donné par Djaul. Le porter signifie que vous agréez ses propos.', 85, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2344, 24, 'Lettre pour Oto', 'Cette lettre vous a été remise par Domen pour Oto.', 65, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2345, 24, 'Oeil de tortue', 'Cette tortue ne fera plus la maligne maintenant.', 70, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2346, 14, 'Costume Roublardesque', 'Non, ce n\'est pas le fameux costume du dragovamp, la célèbre chauve-souris volante. Ceci est l\'accoutrement d\'un habitant du cimetière, un Roublard en quelques sortes.', 27, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2347, 24, 'Compte-rendu de mission', 'Ce compte-rendu explique comment s\'est passé l\'assaut de Brâkmar par la muraille Est.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2348, 31, 'Roublard Attitude', 'Vous avez La Roublard attitude, jusqu\'à ce que vous rentriez en combat.', 17, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2349, 24, 'Lettre pour Oto', 'Cette lettre vous a été remise par Domen pour Oto. Mais vous avez oublié de la lui donner.', 65, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2350, 24, 'Touffe de cheveux', 'Il semble que cette touffe de cheveux ait appartenu à l\'un de vos ennemis.', 30, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2351, 33, 'Pain du Pinchaut', 'Dans ce pain, il y a à boire et à manger, en l\'essorant bien, il est possible de remplir une chopine de bière.', 13, 1, '6e#6#0#0#0d0+6');
INSERT INTO `website_shop_objects_templates` VALUES (2352, 24, 'Lettre de Danathor', '\"J\'ai à te parler, viens me voir dès que tu as un moment de libre, à bientôt mon jeune ami.\"', 65, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2353, 24, 'Lettre de Larry Poller', '\"Bonjour, je suis Larry Poller, nous nous sommes rencontrés lors de la libération du Colonel Lyeno. J\'ai un service à vous demander. Venez me voir quand vous aurez un moment. A bientôt.\"', 65, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2354, 24, 'Cervelle de tortue', 'Cette cervelle de tortue, si elle est bien préparé, devient un plat succulent.', 89, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2355, 24, 'Poussière d\'Oni', 'Cette poussière bleutée est un catalyseur magique très puissant.', 88, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2356, 31, 'Miracle', 'Vous avez un pouvoir miraculeux, jusqu\'à ce que vous rentriez en combat.', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2357, 38, 'Bois d\'Oliviolet', 'Ce Bois a l\'air de résister à toutes les températures. En effet, n\'essayez pas de faire un feu pour vous réchauffer, vous risqueriez de mourir de froid avant que le Bois ne prenne.', 481, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (2358, 38, 'Bois de Bombu', 'Ce Bois est le plus tendre de tous. Il est maléable à souhait et procure de réels plaisirs à travailler.', 482, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (2359, 24, 'Broche de Heticili Ufot', 'Cette petite broche vous a été donné par Heticili Ufot.', 69, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2360, 24, 'Acte de propriété ', 'Cet acte de propriété est celui de la maison de Heticili Ufot.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2361, 2, 'Arc de Mulic Bere', 'Cet arc est une invention du génial Mulic Bere. Sa portée maximum est tout bonnement incroyable. Le problème c\'est que la portée minimum est presque aussi grande.', 10, 10, '61#1f#32#0#1d20+30,9d#fa#0#0#0d0+250,32c#0#1#1#1d2+-1');
INSERT INTO `website_shop_objects_templates` VALUES (2362, 24, 'Prédiction de Paro Cabanne', 'La prédiction que Paro Cabanne a donné sur les prochaines éléctions.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2365, 36, 'Feuille de ronce d\'Hestia', 'Cette feuille de ronce, d\'apparence anodine, est une plante indispensable pour certaines recettes étranges.', 415, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2366, 20, 'Canne à Kralamour', 'Cette canne, de métal et de diamant, est la seule canne capable de soutenir le poids du kralamour. Elle est aussi imprégné de l\'odeur de kralamourette afin d\'avoir une petite chance de pêcher ce monstre.', 8, 1, '60#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (2367, 10, 'L\'Ami Léhunui', 'Léhunui savait se faire des amis, il conviait souvent ses camarades à de grandes soirées costumées. Il avait aussi pour réputation de mettre toujours les petits plats dans les grands et d\'offrir de somptueux bijoux pour vous remercier de venir chez lui.', 21, 37, 'da#3#5#0#1d3+2,9f#1#12c#0#1d300+0,d3#1#2#0#1d2+0,7c#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (2368, 10, 'Ramoume l\'Eternelle', 'Ramoume était un ancien ami d\'enfance de Nova, ils se sont perdus de vue quand Ramoume décida de faire une sieste éternelle.', 22, 37, '7c#10#19#0#1d10+15,9f#1#12c#0#1d300+0,d7#3#5#0#1d3+2,d4#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (2369, 10, 'Puissante Ceinture Fulgurante', 'Cette magnifique ceinture a été confectionnée suite à un pari fou. Le défi était d\'améliorer une des plus belles ceintures conçue sur Amakna : la ceinture Fulgurante. Le pari fut réussi par Pakape Prométhé.', 26, 80, '6e#1f#28#0#1d10+30,6f#1#0#0#0d0+1,70#4#5#0#1d2+3,7c#1f#28#0#1d10+30');
INSERT INTO `website_shop_objects_templates` VALUES (2370, 10, 'La Végète Hâtif', 'Equipement d\'une légèreté incompararable, la Végéte Hâtif vous apporte quelques grammes de finesses dans ce monde de Bwork en rût.', 23, 41, '76#b#19#0#1d15+10,77#15#1e#0#1d10+20,d7#3#5#0#1d3+2,d4#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2371, 10, 'La Mouthmou', 'Cette ceinture vous est conseillée par Jiva en personne, pour les nuits froides et rigoureuses. En cas de tâches, elle se lave avec du Rimennelle.', 24, 27, '6e#15#64#0#1d80+20,7f#1#0#0#0d0+1,b6#1#4#0#1d4+0');
INSERT INTO `website_shop_objects_templates` VALUES (2372, 11, 'Bottes de Lymphe a Tik', 'Ces bottes donnent l\'impression de marcher constamment dans l\'herbe fraîche. Elles sont donc idéales pour ceux dont l\'odeur des pieds se rapproche plus du Clakoss, que de la Gelée Menthe.', 18, 39, '9b#1a#28#0#1d15+25,7b#1a#28#0#1d15+25,da#3#5#0#1d3+2,d3#3#5#0#1d3+2,b6#1#0#0#0d0+1,ae#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (2373, 11, 'Moon Boots', 'Le poil de Moon, nécessaire pour cette paire de bottes, est sans aucun doute le poil le plus chaud pour les pieds, même si porter ses bottes en souvenir de Moon vous fera chaud au coeur.', 19, 62, '77#b#14#0#1d10+10,7d#15#32#0#1d30+20,7c#10#1e#0#1d15+15,d4#3#5#0#1d3+2,9b#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (2374, 11, 'Bottes Tarsy', 'Tarsy était un ermite qui n\'appréciait pas trop les visites. Pour preuve, il recevait ses invités en leur montrant de très près la pointure de ses Bottes.', 20, 38, '74#1#0#0#0d0+1,7b#10#23#0#1d20+15,7c#b#f#0#1d5+10,7d#10#14#0#1d5+15,9a#b#f#0#1d5+10,9b#b#f#0#1d5+10,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2375, 11, 'Bottes Orino', 'Grâce à ces bottes, vous serez à même d\'entendre le vent dans les voiles d\'un bateau situé en pleine Mer d\'Asse, ou d\'entendre les gémissements d\'un Chafer Lancier, perdu dans les tréfonds du labyrinthe.', 21, 77, '70#2#3#0#1d2+1,76#15#28#0#1d20+20,7c#6#a#0#1d5+5,d2#3#5#0#1d3+2,80#1#0#0#0d0+1,8a#6#a#0#1d5+5,7d#15#32#0#1d30+20');
INSERT INTO `website_shop_objects_templates` VALUES (2376, 19, 'Hache Hémal', 'Cette hache est la seule capable de résister aux pouvoirs du Kaerlier et, donc, la seule à pouvoir le couper.', 18, 1, '61#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (2379, 38, 'Bois de Kaerlier', 'Ce bois provient du très rare Kaerlier. Ses propriétés sont plutôt...étonnantes.', 140, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (2380, 17, 'Cape de Bou', 'Cette Cape est bien étrange, elle est faite de bouts de boue du Boo, mais elle tient tout de même debout. Une fois sur vos épaules, elle pourra même faire de vous un boute-en-train.', 35, 41, '65#1#0#0#0d0+1,b7#6#14#0#1d15+5');
INSERT INTO `website_shop_objects_templates` VALUES (2381, 17, 'Cape Flotteuse', 'Cette Cape fut découpée dans un fanion, anciennement situé sur la plus haute tour du chateau d\'Amakna. C\'est sûrement pour cela qu\'elle sent le linge séché au grand air.', 36, 61, '7d#15#1e#0#1d10+20,d3#6#a#0#1d5+5,d6#6#a#0#1d5+5,b1#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2382, 17, 'Cape Maimpa', 'Maimpa était un Ecaflip qui se moquait du vide, prétextant qu\'il retomberait toujours sur ses pattes. Mais un jour, il atterrit sur un Trool affamé. Il fût enterré le jour même à l\'endroit où l\'on a trouvé ses restes. Un peu partout en quelques sortes.', 37, 36, 'ae#97#c8#0#1d50+150,77#10#1e#0#1d15+15,7d#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (2383, 17, 'Cape Sanguine', 'A base de tissu sanguin, la Cape Sanguine a un aspect cartonneux au toucher, comme si la teinture rougeâtre avait coagulé.', 38, 50, '7d#15#28#0#1d20+20,d5#3#5#0#1d3+2,b7#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2384, 11, 'Bottes Animales', 'On peut le dire, ces Bottes ont un côté comment dire... Hmmm... Bestial. Ne vous étonnez donc pas si un Mulou tombe amoureux de vos Bottes. C\'est peut-être la pire chose qui puisse vous arriver.', 22, 94, '80#1#0#0#0d0+1,7d#1f#32#0#1d20+30,7c#10#1e#0#1d15+15,b8#6#a#0#1d5+5,7e#15#23#0#1d15+20');
INSERT INTO `website_shop_objects_templates` VALUES (2385, 17, 'La Brouteuse', 'Idéale pour le jardin, la Brouteuse peut aussi servir de paillasson pour votre entrée de maison. Conçue à la base pour les Sadidas, elle n\'abîme pas les poils, même les plus fragiles. Certains vont même jusqu\'à dire qu\'elle ralentit leur chute.', 39, 88, '7d#1f#32#0#1d20+30,76#1f#32#0#1d20+30,70#3#6#0#1d4+2,b6#2#3#0#1d2+1,d5#7#9#0#1d3+6,d6#7#9#0#1d3+6');
INSERT INTO `website_shop_objects_templates` VALUES (2386, 17, 'La Guenille', 'Cette étrange Cape puise toute sa force dans son aspect vétuste. Plus elle sera sale, et plus elle vous servira.', 40, 53, '73#3#a#0#1d8+2,70#3#5#0#1d3+2,ae#33#64#0#1d50+50');
INSERT INTO `website_shop_objects_templates` VALUES (2387, 17, 'La Poilue', 'Il faut avouer que cette Cape possède une forte odeur très désagréable. En essayant de mettre des mots sur cette infection, on peut dire que c\'est tout simplement un mélange de poils de monstres divers qui créent ce magnifique pot pourri.', 41, 63, '75#1#2#0#1d2+0,7c#b#14#0#1d10+10,7d#1f#32#0#1d20+30,d2#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2388, 1, 'L\'Amulette du Puzzle de la Griffe', 'Autrefois, un Ecaflip nommé Dodge, éclata en mille morceaux une carte au trésor gravée sur une pierre. Croyant réussir à reformer la carte, il garda la plus grosse partie pour en faire une Amulette mystérieuse. Nul ne sait ce que le trésor est devenu.', 36, 44, '70#3#5#0#1d3+2,7e#10#1e#0#1d15+15');
INSERT INTO `website_shop_objects_templates` VALUES (2389, 1, 'Amulette du Badoul', 'Dodge adorait exploser tout ce qui avait de la valeur à ses yeux. Il disait que c\'était la preuve qu\'il existait. Chacun son truc.', 37, 32, '7d#1f#32#0#1d20+30,8a#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (2390, 1, 'Amulette de la Boule', 'Cette Amulette est presque parfaite, elle accroît considérablement la sagesse de celui qui la porte autour du cou. Très utile pour paraître plus sage auprès de vos amis, ou vous faire passer pour un écolier modèle.', 38, 49, '7c#15#23#0#1d15+20,d6#4#7#0#1d4+3');
INSERT INTO `website_shop_objects_templates` VALUES (2391, 1, 'Amulette de la Bouboule', 'Un vieux dicton de Sufokia dit: de la Boule un jour, de la Bouboule peut-être un autre jour. Vous pourrez constatez que, plus le dicton est vieux, plus il s\'avère ridicule.', 39, 98, 'b6#1#2#0#1d2+0,8a#b#f#0#1d5+10,7c#15#23#0#1d15+20,d6#3#5#0#1d3+2,d3#3#5#0#1d3+2,b7#6#a#0#1d5+5,b0#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (2392, 1, 'Dragolyre Remaniée', 'Grâce aux multiples talents des artisans d\'Amakna, la Dragolyre Remaniée excelle dans la perfection.', 25, 42, '6f#1#0#0#0d0+1,9b#f#0#0#0d0+15,98#f#0#0#0d0+15,9d#f#0#0#0d0+15,b6#1#2#0#1d2+0,9a#f#0#0#0d0+15');
INSERT INTO `website_shop_objects_templates` VALUES (2393, 1, 'Omelette Amulette', 'L\'osamodas Onehaieuf Bek cherchait absolument à gagner du mérite devant les membres de sa guilde, et décida alors de faire une Amulette révolutionnaire. Il y parvint en préparant un petit déjeuner à ses amis. Étrange.', 40, 17, '7d#b#1e#0#1d20+10,9d#b#1e#0#1d20+10,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2394, 1, 'La Bourgeonette', 'Gorgée de soleil, la Bourgeonette réchauffe les coeurs en plus de procurer une sensation d\'invulnérabilité face à la terre. Elle est aussi tellement légère qu\'on oublie souvent de l\'enlever à l\'heure du coucher.', 41, 32, '9a#10#19#0#1d10+15,76#10#19#0#1d10+15,d2#3#5#0#1d3+2,d9#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2395, 1, 'Le foulard du Lard Fou', 'Le Lard Fou était un petit démon bien vil qui ne pouvait s\'empêcher de rester planté devant les gens sans bouger. Il était aussi résistant à la magie, ce qui imposait le respect à l\'époque. Depuis, le Lard Fou se terre quelque part et attend.', 42, 42, '7d#10#19#0#1d10+15,d6#1#3#0#1d3+0,b7#2#3#0#1d2+1,73#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (2396, 1, 'La Lou Ptiote', 'Sylveline n\'était pas très futée. Sa mère, Lou, lui offrit cette lanterne en disant \"Tiens! Au moins tu seras une lumière !\". Elle non plus n\'était pas une lanterne. Ce qui ne l\'a pas empêchée d\'avoir un éclair de génie qui illumina la vie de sa fille.', 43, 15, '7e#b#11#0#1d7+10,d5#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (2397, 1, 'La Bibelaw', 'Law-bibe était un vieillard qui adorait assembler n\'importe quoi pour en faire un objet. Un jour, il créa ce médaillon aux formes intrigantes. Une fois autour du cou, il ressentit une étrange sensation. Bien étrange sensation même...', 44, 30, 'd3#2#3#0#1d2+1,7d#b#14#0#1d10+10,d2#2#3#0#1d2+1,d4#2#3#0#1d2+1,d5#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (2398, 1, 'L\'Oeil de Kanigrou', 'Offert à Melyonen par le célèbre Kanigrou  Rook Y Balboua, pour la remercier de lui avoir présenté celle qui est maintenant sa femme, Ar d\'rieeeeeeeeeneuh comme il aime à l\'appeler.', 45, 52, '73#2#5#0#1d4+1,70#2#5#0#1d4+1,7d#b#14#0#1d10+10,d6#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (2399, 1, 'La Veaux Doux', 'Jozébo Vez était un berger de Veaux, lointains cousins des Bouftous. Dans son troupeau, quelques bêtes possédaient une fourrure plus douce que les autres. Elle se revendait bien plus cher et pour différencier ses bêtes, il attachait ce collier à leur cou.', 46, 15, 'd2#1#2#0#1d2+0,76#b#11#0#1d7+10');
INSERT INTO `website_shop_objects_templates` VALUES (2400, 11, 'Bottes Animales Sombres', 'On peut le dire, ces Bottes ont un côté comment dire, .....hmmm.... Sombre. Ne vous étonnez donc pas si un Vampire tombe en amour devant vous et vos Bottes. C\'est peut-être la pire chose qui puisse vous arriver.', 23, 122, '80#1#0#0#0d0+1,70#6#a#0#1d5+5,7d#1f#32#0#1d20+30,7c#10#1e#0#1d15+15,b0#6#a#0#1d5+5,b7#b#f#0#1d5+10,d2#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2401, 15, 'Carte de Kwelsh', 'Cette carte est liée au maître Kwelsh. C\'est tout ce que vous savez et que vous devez savoir.', 224, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2402, 6, 'Epée de Sériane-Kerm', 'Cette épée est un cadeau honorifique que l\'on donne uniquement aux mercenaires accomplis. Mais elle coupe très bien aussi.', 25, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (2403, 10, 'Chtévu', 'Autrefois utilisée pour les libertés conditionnelles, la Chtévu possède paraît-il un pouvoir supplémentaire par rapport aux autres ceintures. Mais personne n\'a encore trouvé. Mieux vaut donc garder un oeil sur cette ceinture.', 25, 49, '73#3#7#0#1d5+2,7a#1#2#0#1d2+0,d6#1#5#0#1d5+0,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2404, 10, 'Ceinture du Rat', 'Cette ceinture a appartenu à un Rat d\'Egoût, elle lui allait à merveille, bien moulante au niveau des hanches, elle lui permettait de cacher ses poignées d\'amour.', 27, 55, '76#10#1e#0#1d15+15,7c#10#1e#0#1d15+15,7d#1f#32#0#1d20+30,ae#65#c8#0#1d100+100');
INSERT INTO `website_shop_objects_templates` VALUES (2409, 16, 'Kwakoiffe de Flammes', 'La Kwakoiffe de Flammes vous donne réellement une allure de tombeur, ce qui est très pratique pour mettre à terre vos adversaires, lorsque ceux-ci n\'arrivent plus à tenir debout tellement ils rigolent, en vous voyant affublé de cette coiffe.', 39, 41, '7e#b#f#0#1d5+10,d5#3#5#0#1d3+2,7c#4#7#0#1d4+3');
INSERT INTO `website_shop_objects_templates` VALUES (2410, 16, 'Abracaska', 'L\'Abracaska permet d\'éviter les gueules de bois.', 40, 45, '6f#1#0#0#0d0+1,7d#15#23#0#1d15+20,7f#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2411, 16, 'Coiffe du Bouftou', 'Ce superbe chapeau permet à son porteur de gagner force et intelligence si ce dernier parvient à s\'accommoder de l\'odeur.', 41, 10, '7e#1#28#0#1d40+0,76#1#28#0#1d40+0');
INSERT INTO `website_shop_objects_templates` VALUES (2412, 17, 'Kwape de Flammes', 'Très peu irritante, mais un peu quand même il faut l\'avouer, cette cape ne pourra pas hélas vous faire voler, ni même planer. Même en y cousant un grand \"M\" dessus, ça ne marchera pas, certains y croyaient pourtant dur comme fer. Dommage.', 42, 41, '7e#b#f#0#1d5+10,b6#1#0#0#0d0+1,ae#15#1e#0#1d10+20,d5#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2413, 17, 'Abracapa', 'Vêtu de Feuilles d\'Abraknydes, vous pourrez vous pavaner au beau milieu de la forêt sans que l\'on vous reconnaisse vraiment. Attention toutefois aux Abraknydes en quête de bourgeonnements printaniers.', 43, 45, '6e#1#32#0#1d50+0,76#1#1e#0#1d30+0,b6#1#0#0#0d0+1,70#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (2414, 17, 'Cape Bouffante', 'Cette cape a tout pour plaire : sa résistance, son confort, sa couleur, sa rareté... En revanche son odeur est redoutable pour les parois nasales. Mais bon, on ne peut pas tout avoir non plus.', 44, 10, 'ae#1#12c#0#1d300+0,6e#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (2415, 6, 'Kwaklame de Flammes', 'La Kwaklame de Flammes est une arme vraiment stylée. A défaut de faire peur à votre adversaire, elle vous servira à l\'impressionner, pour ensuite mieux le surprendre par une vieille ruse de fourbe.', 52, 41, '63#10#19#0#1d10+15,7d#b#f#0#1d5+10,7e#b#f#0#1d5+10,73#2#3#0#1d2+1,b0#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (2416, 7, 'Marteau du Bouftou', 'Le manuel de l\'utilisateur explique que ce surprenant marteau est capable de libérer une énergie colossale lorsqu\'il est correctement manié. Encore un manuel Osamodas traduit en Sadida...', 23, 10, '61#4#8#0#1d5+3,63#4#8#0#1d5+3,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2417, 4, 'Abraton', 'Ce bâton a gardé toute l\'agressivité de l\'Abraknyde, mais n\'a pas conservé l\'odeur de bois moisi qui caractérise souvent les vieux Abraknydes.', 23, 45, '64#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (2418, 9, 'Kwakanneau de Flammes', 'Grâce à cet anneau, si vous vous perdez en allant délivrer un message, votre maître pourra peut-être vous retrouver.', 43, 42, 'd5#3#5#0#1d3+2,7e#10#14#0#1d5+15,8a#5#a#0#1d6+4');
INSERT INTO `website_shop_objects_templates` VALUES (2419, 9, 'Anneau de Bouze le Clerc', 'Cet anneau provient du fameux Bouze le Clerc, sauveur des temps modernes. Sa phrase culte parlait d\'un fin Eni et d\'au-delà.', 44, 10, '6e#1#1e#0#1d30+0');
INSERT INTO `website_shop_objects_templates` VALUES (2420, 9, 'Anobra', 'Travailler la Branche d\'Abraknyde n\'est pas chose aisée. Mais avec de la persévérance, on peut finir par obtenir un anneau à la fois sobre, élégant et raffiné. Tout le contraire d\'un Sadida dans une taverne.', 45, 40, '70#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (2421, 11, 'Kwakobottes de Flammes', 'Muni de ces ergots de Kwak de Feu, il ne vous reste plus qu\'à marcher sur des oeufs pour ne pas vous les faire voler par un Sram mal intentionné.', 25, 40, '7d#b#f#0#1d5+10,70#1#0#0#0d0+1,d5#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2422, 11, 'Boufbottes', 'Ces Bottes sont d\'un confort inégalé, l\'intérieur a l\'air d\'être doublé en laine de Bouftou, mais on peut ressentir également comme un liquide circulant entre les orteils. Reste à savoir si c\'est de la Bave ou du Sang de Bouftou. Peu importe.', 26, 10, '8a#1#f#0#1d15+0,6e#1#23#0#1d35+0');
INSERT INTO `website_shop_objects_templates` VALUES (2423, 11, 'Abrabottes', 'Les effets de cette paire de Bottes peuvent aussi parfaitement être retrouvés en se rendant dans une taverne. Il faut ensuite consommer un peu, voire beaucoup pour un effet optimum. Le lendemain vous aurez des jambes aussi lourdes que ces bottes.', 27, 45, '76#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (2424, 1, 'Amukwak de Flammes', 'Avec toutes ces plumes autour du cou, vous ressemblerez à Aldo Rado, grand Sacrieur aventurier en quête d\'une cité d\'or.', 47, 42, '7e#10#14#0#1d5+15,d5#3#5#0#1d3+2,73#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (2425, 1, 'Amulette du Bouftou', 'Une bonne Corne de Bouftou, c\'est une Corne qui procure calme et sagesse. Un Bon pendentif de Bouftou vous procurera donc sagesse et calme. Ou l\'inverse. Ou autre chose. Ou alors rien.', 48, 3, '76#1#a#0#1d10+0,7e#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (2426, 1, 'L\'Araknamu', 'Cette petite Arakne est la preuve vivante que l\'on est pas obligé d\'empailler un animal pour en faire une Amulette. Elle vous chatouillera le cou, et tissera peut-être une toile devant votre bouche, si vous baillez trop souvent, ou si vous avez trop mauvaise haleine.', 49, 20, '75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2427, 10, 'Kwakture de Flammes', 'Pour parader comme un Kwak de Flammes pendant la saison des amours, cette ceinture sera parfaite, à condition de ne porter que ça.', 28, 41, '7e#b#f#0#1d5+10,b0#1#2#0#1d2+0,d5#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2428, 10, 'Ceinture du Bouftou', 'Rapide à équiper, cette ceinture s\'avère tout de même assez légère pour sa taille. La laine donne l\'impression d\'être neuve. Normal, il a fallu selon la légende, dépecer une centaine de bouftons pour avoir cet aspect lisse et soyeux.', 29, 20, '9e#1#1f4#0#1d500+0');
INSERT INTO `website_shop_objects_templates` VALUES (2429, 10, 'Abrature', 'Cette ceinture vous apportera assurance et abdominaux en bois. Un traitement anti-Arakne est néanmoins recommandé tous les ans. Un peu comme la coiffure d\'un Sadida, avec heureusement trois fois moins d\'anti-parasites.', 30, 45, '76#b#1e#0#1d20+10,d6#1#4#0#1d4+0,9e#33#96#0#1d100+50');
INSERT INTO `website_shop_objects_templates` VALUES (2430, 24, 'Flaque de Gelée Bleue', 'Tu as été une vraie brute envers cette Gelée Bleue. Un jour, qui sait, tu paieras pour ce crime.', 91, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2431, 24, 'Flaque de Gelée Citron', 'Tu as été une vraie brute envers cette Gelée Citron. Un jour, qui sait, tu te feras aplatir comme elle.', 90, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2432, 24, 'Flaque de Gelée Fraise', 'Tu as été une vraie brute envers cette Gelée Fraise. Un jour, qui sait, tu ressembleras à une grosse tâche difforme comme elle.', 92, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2433, 24, 'Flaque de Gelée Menthe', 'Tu as été une vraie brute envers cette Gelée Menthe. Un jour, qui sait, il ne restera de toi que des restes, comme elle.', 93, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2435, 11, 'L\'Eni Kère', 'Kère fut le seul Eniripsa à remporter devant les Ecaflips, le grand Marathon d\'Amakna. C\'est grâce à ses bottes artisanales qu\'il traversa la Mèr d\'Asse et distança tous les écaflips médusés de voir un Eni courir sur l\'eau. La classe.', 29, 45, '77#10#1e#0#1d15+15,98#10#1e#0#1d15+15,9d#10#1e#0#1d15+15,b0#2#6#0#1d5+1');
INSERT INTO `website_shop_objects_templates` VALUES (2436, 110, 'Gelée Citron', 'Ce pot de Gelée Citron a une apparence étrange. Selon Elrik Ola, cette gelée proviendrait de chez lui. Plus précisément, de l\'autre coin de la galaxie. Autant dire que ce n\'est pas la porte à côté.', 490, 45, '');
INSERT INTO `website_shop_objects_templates` VALUES (2437, 110, 'Gelée Citron Royale', 'Selon certaines rumeurs, la Gelée Citron Royale est bien meilleure que les autres gelées. Peut-être parce que le citron cache le goût de la gelée.', 491, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (2438, 16, 'Boufcoiffe Royale', 'La Boufcoiffe Royale est un objet indémodable. Elégante, elle procure à son porteur force et intelligence.', 42, 50, '76#1#46#0#1d70+0,7e#1#46#0#1d70+0');
INSERT INTO `website_shop_objects_templates` VALUES (2440, 6, 'Epée Royale du Bouftou', 'Cette épée ne sait pas trop sur quel sabot danser... Elle inflige des dégâts de chaque élément.', 30, 70, '62#4#8#0#1d5+3,61#4#8#0#1d5+3,60#4#8#0#1d5+3,63#4#8#0#1d5+3,9c#b#3c#0#1d50+10');
INSERT INTO `website_shop_objects_templates` VALUES (2441, 9, 'Anneau Royal du Bouftou', 'Cet anneau augmente la vie de son porteur, tout comme l\'odeur de la femelle du Bouftou Royal augmente son charme.', 46, 30, '6e#1#3c#0#1d60+0');
INSERT INTO `website_shop_objects_templates` VALUES (2442, 11, 'Boufbottes Royales', 'Elles brillent, elles respirent la puissance, ces bottes sont en tous points royales.', 30, 50, '6e#1#46#0#1d70+0,70#2#8#0#1d7+1');
INSERT INTO `website_shop_objects_templates` VALUES (2443, 1, 'Amulette Royale du Bouftou', 'Cette amulette augmente la force et l\'intelligence de son porteur.', 50, 50, '76#b#1e#0#1d20+10,7e#b#1e#0#1d20+10');
INSERT INTO `website_shop_objects_templates` VALUES (2444, 10, 'Ceinture Royale du Bouftou', 'Cette magnifique ceinture augmente la vitalité de son porteur et lui permet de porter plus facilement ses objets. Elle si douce qu\'elle permet même de ligoter sa dulcinée lorsque celle-ci refuse de rester à la maison.', 31, 52, '9e#65#320#0#1d700+100,7d#15#46#0#1d50+20,73#1#5#0#1d5+0,70#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (2445, 17, 'Cape Bouffante Royale', 'Cette cape portée par le grand Bouftou Royal confère, en plus d\'un style fabuleux, une force hors du commun.', 46, 50, '76#b#3c#0#1d50+10,d2#4#8#0#1d5+3');
INSERT INTO `website_shop_objects_templates` VALUES (2446, 17, 'Gelocape', 'Dépourvue de fils et de poils, cette Cape reste un mystère pour les têtes pensantes d\'Amakna, ce qui ne doit pas représenter plus d\'une dizaine de personnes.', 47, 60, '75#1#2#0#1d2+0,b0#6#14#0#1d15+5');
INSERT INTO `website_shop_objects_templates` VALUES (2447, 16, 'Gelocoiffe', 'Avec cette coiffe sur la tête, vous pouvez être certain que vos amis rêveront enfin de vous lécher. Voilà un chapeau qui aurait comblé le Captain Chafer à la grande époque.', 43, 60, '7c#1#1e#0#1d30+0,7e#1#28#0#1d40+0,b0#6#14#0#1d15+5');
INSERT INTO `website_shop_objects_templates` VALUES (2448, 15, 'Cervelle de Bouftou', 'Aucun doute, cette Cervelle provient bien du Bouftou. Bien cuisiné, ce plat est le préféré de tous les petits Iops qui veulent devenir grands et forts. Ça rend aussi intelligent, mais si on le disait aux enfants Iops, ils en mangeraient beaucoup moins.', 492, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2449, 15, 'Armée de Tiques', 'Selon les chasseurs, une Armée de Tiques affamées pourrait dévorer toute la Laine d\'un Bouftou en une nuit. Quelques piliers de bar certifient même qu\'elle peut venir à bout de la magnifique crinière d\'un Sadida.', 493, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2451, 47, 'Sabot de Bouftou', 'Autrefois utilisé comme sous-verre, certains alchimistes Eniripsas, assez coquets admettons le, recyclent le Sabot de Bouftou pour en faire des Bols. De quoi donner du goût à leurs céréales préférées.', 495, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2453, 109, 'Oeil de Bouftou', 'Autrefois, on faisait de cet Oeil une soupe extra. Succulente à un point que l\'on a dû bannir la recette des livres, car bon nombre de chasseurs n\'allaient récupérer que les yeux et laissaient fumante la carcasse du pauvre Bouftou.', 497, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2454, 15, 'Estomac de Bouftou', 'Un Estomac de ce genre possède des qualités élastiques efficaces. Par contre, ne vous étonnez pas s\'il reste à l\'intérieur une bouillie de Trèfles, au contraire, réjouissez-vous Mesdemoiselles, cette bouillie est très bonne pour la peau.', 498, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2455, 15, 'Sang de Bouftou', 'Impossible d\'aller chasser sans se passer de ce Sang de Bouftou tellement son odeur attire les Bouftous les plus gros. Il attire aussi très efficacement les Moskitos sans que l\'on sache encore pourquoi.', 499, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2460, 109, 'Oeil de Boufton', 'Ce n\'est pas que ce Boufton garde un Oeil sur vous, mais vous avez quand même l\'impression qu\'il vous en veut.', 500, 2, '');
INSERT INTO `website_shop_objects_templates` VALUES (2462, 15, 'Cervelle de Chef de Guerre Bouftou', 'Forcément, le Chef de Guerre Bouftou dont vous venez d\'extraire la Cervelle, va marcher beaucoup moins bien.', 501, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2463, 47, 'Dent de Chef de Guerre Bouftou', 'Extraire une Dent de Chef de Guerre n\'est pas donnée à tout le monde, il faut l\'avouer. Notez que cette Dent a beaucoup plus de valeur si elle est abîmée. N\'allez pas me demander pourquoi, il paraît que c\'est une histoire d\'équilibre économique.', 502, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2464, 65, 'Queue de Chef de Guerre Bouftou', 'Restez terré dans les Bois, observez patiemment, sans faire de bruit, et là, peut-être, vous verrez un Chef de Guerre Bouftou frétiller de la queue. Mais ce petit geste anodin n\'a lieu que pendant la période d\'accouplement.', 503, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2465, 47, 'Corne de Chef de Guerre Bouftou', 'Moins doux que son congénère, le Chef de Guerre Bouftou a plus de facilité pour embrocher les Srams et autres races téméraires. On peut souvent trouver des bouts de tissus attachés à leurs cornes, un peu comme une sorte de trophée.', 504, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2466, 15, 'Langue de Chef de Guerre Bouftou', 'L\'expression \"avoir une haleine chargée\" tombe à pic pour le Chef de Guerre Bouftou. En effet, on a toujours le sentiment qu\'il a mangé un Trool pas frais.', 505, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2467, 47, 'Sabot de Chef de Guerre Bouftou', 'Selon les cordonniers, ce Sabot est l\'un des plus résistants et le plus malléable de la Province. Reste à savoir ce qu\'ils entendent par \"malléable \". À trop les écouter, on pourrait comprendre qu\'ils peuvent confectionner des bottes à l\'aide de ce Sabot.', 538, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2468, 15, 'Estomac de Chef de Guerre Bouftou', 'À l\'intérieur de cet Estomac se cache une surprise. Petit doigt d\'Enutrof, bout de nez d\'Osamodas... On pourrait quasiment se reconstruire un Héros avec tous ces morceaux.', 506, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2469, 9, 'Gelano', 'Inutile de vous ronger les ongles avec cet anneau, léchez-vous les doigts !', 47, 60, '6f#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2470, 11, 'Gelobottes', 'Ces bottes sont très confortables en été, car elles libèrent une odeur de fraise des bois, couvrant facilement l\'odeur de transpiration qui pourrait se dégager des orteils d\'un vieux Sadida aux pieds poilus.', 31, 60, '80#1#0#0#0d0+1,b0#1#f#0#1d15+0');
INSERT INTO `website_shop_objects_templates` VALUES (2471, 10, 'Geloture', 'Le plus dur avec cette Geloture, c\'est qu\'en cas de fringale, on est vite tenté de croquer dedans.', 32, 60, '7e#b#32#0#1d40+10');
INSERT INTO `website_shop_objects_templates` VALUES (2472, 1, 'Gelamu', 'Voilà une amulette, qui trahira votre goût prononcé pour les orgies de Gelée. On peut trouver mieux pour se mettre en valeur ou briller en société, mais il faut assumer jusqu\'au bout votre faible pour la gelée.', 51, 60, 'b6#1#2#0#1d2+0,75#1#2#0#1d2+0,ae#65#190#0#1d300+100');
INSERT INTO `website_shop_objects_templates` VALUES (2473, 17, 'Cape de l\'Aventurier', 'Classe mais peu performante, cette cape comblera tout de même les jeunes aventuriers.', 48, 1, '76#1#2#0#1d2+0,77#1#2#0#1d2+0,7b#1#2#0#1d2+0,7c#1#2#0#1d2+0,7e#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (2474, 16, 'Chapeau de l\'Aventurier', 'A part faire fuir les nanas, ce chapeau n\'a pas vraiment grande utilité.', 44, 1, '76#1#2#0#1d2+0,77#1#2#0#1d2+0,7b#1#2#0#1d2+0,7c#1#2#0#1d2+0,7e#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (2475, 9, 'Anneau de l\'Aventurier', 'Un petit anneau sympathique pour les débutants, et qui amusera les jeunes enfants, ou les Ecaflips.', 48, 1, '76#1#2#0#1d2+0,77#1#2#0#1d2+0,7b#1#2#0#1d2+0,7c#1#2#0#1d2+0,7e#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (2476, 11, 'Bottes de l\'Aventurier', 'Bottes de simple facture mais idéales pour les jeunes se lançant sur le dur chemin de l\'aventure.', 32, 1, '76#1#2#0#1d2+0,77#1#2#0#1d2+0,7b#1#2#0#1d2+0,7c#1#2#0#1d2+0,7e#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (2477, 10, 'Ceinture de l\'aventurier', 'Une petite ceinture pour les aventuriers en herbe.', 33, 1, '76#1#2#0#1d2+0,77#1#2#0#1d2+0,7b#1#2#0#1d2+0,7c#1#2#0#1d2+0,7e#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (2478, 1, 'Amulette de l\'Aventurier', 'Pas très classe, pas très efficace, mais sympathique lorsque l\'on possède la panoplie.', 52, 1, '7c#1#2#0#1d2+0,76#1#2#0#1d2+0,7e#1#2#0#1d2+0,7b#1#2#0#1d2+0,77#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (2479, 15, 'Crête de Porkass', 'Cette coiffure est signe de maturité chez le Porkass. C\'est pour cela que l\'on voit de temps en temps de jeunes Eniripsas en quête de puberté, se promener avec une crête en ville. Par contre, ils n\'osent pas vraiment aller dans les Plaines Rocheuses avec.', 507, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2480, 56, 'Slip en cuir de Porkass', '\"Un Porkass sans Slip est un Porkass Mort\", telle était l\'expression favorite de Dame Harre, Féca adepte du voyeurisme et du bizutage. Son passe-temps préféré était d\'obliger ses \"amis\" à enfiler sur la tête le Slip pas très propre du Porkass.', 508, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2481, 15, 'Groin de Porkass', 'Ce Groin, rose comme des fesses des nourrissons Osamodas, doit sûrement être utile pour une recette culinaire. Ou alors un joli collier de Groin, mais il faut quand même être courageux pour le porter et assumer les regards amusés des voisins.', 509, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2482, 15, 'Soulier de Porkass', 'Autrefois, un Soulier similaire avait été trouvé sur les marches d\'un grand palais royal. Des rumeurs raconteraient que ce Soulier fut perdu suite au départ pour le moins hâtif d\'une porkassette, qui eut peur de rentrer après les douze coups de minuit.', 510, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2483, 47, 'Dentier de Porkass', 'Certains Porkass naissent sans dents. D\'autres, après s\'être tapés une bonne tranche, se réveillent édentés, sans se souvenir de quoi que ce soit.', 511, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (2484, 15, 'Trident Cassé ', 'Voici un petit souvenir de votre ami Porkass. En espérant qu\'il ne vous en tienne pas rigueur au point de vous traquer à travers la Province. Caractériel comme un cochon, il en est bien capable, méfiez-vous.', 512, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2485, 16, 'Végacoiffe', 'Le top du top de la mode, mais uniquement au nord-est d\'Amakna.', 45, 40, 'b0#1#a#0#1d10+0,77#1#28#0#1d40+0,6e#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (2486, 106, 'Oreille de Porkass', 'Cette Oreille est un bon moyen de se faire respecter, elle fait office de trophée et prouve que vous domptez les Porkass à la baguette. Attention toutefois à ne pas vous la raconter auprès d\'autres Porkass, ils ne vous acclameront sûrement pas, eux.', 513, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2487, 107, 'Carapace de Scorbute', 'Idéal pour confectionner de lourdes armures, le Scorbute était chassé jadis par la Milice de Brâkmar, car leur taux de reproduction faisait exploser tous les records. Même les Gelées n\'arrivaient pas à se reproduire aussi vite.', 514, 36, '');
INSERT INTO `website_shop_objects_templates` VALUES (2488, 15, 'Viscères de Scorbute', 'Au premier abord, il est certain que ces viscères ne sont pas très appétissants. Et vous avez bien raison, les viscères de Scorbute sont infâmes, même cuisinés avec amour.', 445, 36, '');
INSERT INTO `website_shop_objects_templates` VALUES (2489, 17, 'Vegacape', 'Une cape élégante qui vous rendra irrésistible auprès des amateurs de belles plantes.', 49, 58, '70#1#7#0#1d7+0,8a#1#1e#0#1d30+0');
INSERT INTO `website_shop_objects_templates` VALUES (2490, 103, 'Patte de Scorbute', 'Il est peu commun de pouvoir récupérer une Patte de Scorbute dans un état aussi correct. En espérant que vous vous en servirez à bon escient, et non, pour crocheter des portes. Quoique...', 515, 36, '');
INSERT INTO `website_shop_objects_templates` VALUES (2491, 109, 'Oeil d\'Ouginak', 'Inquiétant, mais palpitant, cet Oeil d\'Ouginak ne reflète pas vraiment ce que l\'on attend. Par exemple, au lieu de vous voir dedans, vous voyez votre homologue Dopeul. Allez comprendre.', 516, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (2492, 15, 'Chaîne de l\'Ouginak', 'Cette chienne de Chaîne provient évidemment d\'un Ouginak. Avant qu\'elle ne soit brisée, elle servait probablement à attacher l\'Ouginak pour éviter qu\'il s\'échappe.', 517, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (2493, 15, 'Coeur d\'Ouginak', 'Ce coeur vous restera fidèle. Tant que vous ne le vendrez, ni ne l\'échangerez, il restera avec vous dans le fond de votre sac. Quelle délicate attention.', 518, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (2494, 15, 'Pommeau d\'Epée', 'Il a sûrement fallu un coup surpuissant pour venir à bout de cette Épée mythique. En effet, l\'Épée d\'un Ouginak procure à celui qui l\'utilise, une envie de hurler de joie. Wa-hooooo !', 519, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (2495, 109, 'Oeil de Kolérat', 'Cet Oeil brille la nuit, même une fois arraché à son propriétaire. De quoi s\'éclairer à moindre frais.', 520, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2496, 65, 'Queue de Kolérat', 'Tranchée convenablement, la Queue de Kolérat a le goût de saucisson. Ce qui est étrange, c\'est que si vous coupez de trop grosses tranches, le goût de saucisson disparaît totalement. Encore une énigme culinaire de plus dans ce monde.', 521, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2497, 106, 'Oreille de Kolérat', 'Portez-la à votre oreille, et vous entendrez la mer, parait-il.', 522, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2498, 1, 'Vegamu', 'La Vegamu a parfois tendance à attirer les Moskitos, qui de loin la prennent pour une copine. Ils sont souvent déçus une fois qu\'ils tombent sur le porteur de l\'amulette.', 53, 40, '98#1#14#0#1d20+0,75#1#2#0#1d2+0,7d#b#46#0#1d60+10,9b#1#14#0#1d20+0');
INSERT INTO `website_shop_objects_templates` VALUES (2499, 15, 'Museau de Kolérat', 'Le Kolérat possède un flair hors du commun. Il n\'arrive pas à la cheville de l\'Ouginak, mais arrive à sentir celui-ci à trois cents mètres à la ronde. Et ça, c\'est vraiment très pratique pour éviter ses prédateurs.', 523, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2500, 15, 'Kolérat Mort', 'Vous avez bien fait de le ramasser, il est intact. Mort, mais intact.', 524, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2501, 65, 'Queue de Croc Gland', 'Le Dieu Osamodas ne supporte pas que l\'on touche aux animaux sauvages : \"Ils sont si mignons\" hurle-t-il constamment. Il est marrant, ça se voit qu\'il n\'a jamais subi une ablation de la part du \"mignon\".', 525, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2502, 103, 'Papatte de Croc Gland', 'Les Papattes de Croc Gland sont assez prisées par les gastronomes du coin. Elle possède des vertus magiques, comme celle de porter chance à son possesseur. C\'est déjà pas mal.', 526, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2503, 55, 'Etoffe de Croc Gland', 'Avec ceci, vous pourrez être aussi espiègle que le Croc Gland. Si vos rêves étaient d\'arborer une Étoffe sur votre tête et de vous déplacer de manière féline, eh bien, vous faites de biens drôles de rêves, soit dit entre nous.', 200, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2504, 15, 'Langue de Croc Gland', 'Cette Langue a dû traîner dans pas mal d\'endroits avant de se retrouver dans votre sac.', 527, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2505, 15, 'Croquette', 'Pour attirer un Croc Gland dans les mailles de la domestication, lancez-lui une Croquette, ils en raffolent. Il ne vous l\'avouera pas, mais vous vous serez fait un ami pour la vie.', 528, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2506, 15, 'Grelot', 'Muni d\'un Grelot, le Serpentin s\'entend à des Kilomètres à la ronde. Heureusement d\'ailleurs, car à deux mètres, on pourrait le manquer à cause de la végétation luxuriante des Plaines de Cania.', 529, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (2507, 15, 'Langue Fourchue', 'Armé de cette Langue, vous pourrez fouetter vos amis. Ce sont vos collègues Osamodas et Sacrieurs qui vont être contents.', 530, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (2508, 15, 'Venin de Serpentin', 'Redoutable, ce Venin peut venir à bout d\'une armada de Bouftous enragés. Ils servaient d\'ailleurs autrefois à maîtriser les troupeaux, on en mettait un peu sur un bâton, et le tour était joué.', 531, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (2509, 47, 'Dent de Serpentin', 'Cette Dent appartenait à un Serpentin, cela ne fait aucun doute. On peut le constater en observant de près le bout de la Dent qui s\'avère être on ne peut plus pointu.', 432, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (2510, 15, 'Estomac de Sanglier des Plaines', 'Cet Estomac peut contenir des choses affolantes, une Iopette serait heureuse de voir toutes les Épées qu\'elle pourrait ranger dedans.', 532, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (2511, 56, 'Cuir de Sanglier des Plaines', 'Avec les propriétés de ce Cuir, les artisans cordonniers ont beaucoup hésité avant de confectionner des ceintures et des bottes. Le problème crucial était que ce Cuir ne sentait rien. Bon nombre de clients pensaient avoir affaire à du faux Cuir.', 410, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (2512, 65, 'Queue de Sanglier des Plaines', 'Pas mal de braconniers Brâkmariens collectionnent ce trophé poilu. Encore aujourd\'hui, les raisons de ce pillage restent inconnues.', 536, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (2513, 55, 'Etoffe de Sanglier des Plaines', 'Contrairement à son Cuir, l\'Etoffe du Sanglier des Plaines dispose d\'un fumet radical contre le nez bouché. Pour preuve, cette odeur permettrait même, selon la légende, de réveiller un Sadida en hibernation.', 537, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (2514, 47, 'Sabot de Sanglier des Plaines', 'Généralement, les Sabots de Sanglier sont couverts de boue ou de terre, mais par moment, il ne faut pas s\'étonner d\'y dénicher des Biblops de toutes les couleurs. Oui, comme vous, le Sanglier des Plaines n\'aime pas les Biblops.', 539, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (2515, 15, 'Groin de Sanglier des Plaines', 'À première vue, ce Groin n\'est pas de toute fraîcheur. Et bien détrompez-vous, celui-ci est de loin le plus frais et tendre de tous les groins.', 540, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (2516, 47, 'Défense de Sanglier des Plaines', 'Cette défense vous rappellera que le Sanglier des Plaines est le plus antipathique des Sangliers. En effet, elle est aussi usée qu\'une Dent de Wabbit abîmée par les Cawottes.', 541, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (2517, 17, 'Mégacape', 'Cette cape appartenait à un célèbre héros, connu pour avoir combattu le terrible docteur Wily qui voulait envahir et dominer le monde des douze avec ses propres invocations. Le docteur Wily mourut avant que toutes ses invocations n\'eurent le temps d\'attaquer.', 50, 45, '7b#1#a#0#1d10+0,7d#1#1e#0#1d30+0,70#1#3#0#1d3+0,d3#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (2518, 17, 'Cape Vioutifoule', 'Silvia de Jodaw a cousu elle-même cette surprenante cape à partir de vieux rideaux. Heureusement, ça ne se voit pas trop, puisqu\'elle ressemble à s\'y méprendre à une serpillière bouillie dans du sang de Porkass.', 51, 45, '7e#1#a#0#1d10+0,7d#1#1e#0#1d30+0,70#1#3#0#1d3+0,d5#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (2519, 16, 'Mégacoiffe', 'Pour assurer dans les situations les plus extrêmes, et briller en société, cette coiffe devrait faire l\'affaire.', 46, 44, '7b#1#1e#0#1d30+0,7d#1#1e#0#1d30+0,7c#1#f#0#1d15+0,d3#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (2520, 16, 'Casque Vioutifoule', 'Ce casque a appartenu au bon vieux Jojo, célèbre héros de l\'ancien temps. Connu pour ses divers exploits, on a tout de même du mal à comprendre la passion qui anime ses fans.', 47, 44, '7e#1#1e#0#1d30+0,7d#1#1e#0#1d30+0,7c#1#f#0#1d15+0,d5#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (2521, 11, 'Mégabottes', 'Roll, la gentille sœur du propriétaire de ces bottes, était spécialisée en taxidermie astrale. Jadis, personne n\'était capable de comprendre la différence entre la taxidermie, et la taxidermie astrale. Mais on peut sans peine, imaginer de nos jours, que la taxidermie astrale permet de confectionner des créatures empaillées astrales. Si ça vous paraît évident maintenant, c\'est peut-être parce que vos ancêtres étaient stupides.', 33, 43, '7b#1#14#0#1d20+0,73#1#4#0#1d4+0,8a#1#a#0#1d10+0,ae#1#64#0#1d100+0,d3#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (2522, 11, 'Bottes Vioutifoule', 'Ces bottes permettaient au célèbre Jojo d\'augmenter la puissance de son célèbre coup de pied rotatif, également connu sous le nom de \"coup rouge et chaud\". On se demande toujours pourquoi il était appelé ainsi, puisque ses bottes étaient blanches.', 34, 43, '7e#1#14#0#1d20+0,73#1#4#0#1d4+0,8a#1#a#0#1d10+0,ae#1#64#0#1d100+0,d5#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (2523, 10, 'Mégature', 'Cette ceinture a été spécialement conçue pour protéger les hanches des héros. Elle ne vous sera donc d\'aucune utilité.', 34, 45, '7d#1#14#0#1d20+0,7c#1#f#0#1d15+0,b7#1#5#0#1d5+0,d3#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (2524, 10, 'Ceinture Vioutifoule', 'On raconte que cette ceinture aurait été fabriquée par le capitaine Bloue en personne. A peine croyable, et pourtant vous y croyez tout de même.', 35, 46, '7d#1#14#0#1d20+0,7c#1#f#0#1d15+0,b7#1#5#0#1d5+0,d5#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (2525, 15, 'Coeur du Maitre Corbac', 'Sans son Coeur, son ramage va en prendre un coup. Mais surtout ne lui dites pas, car le Maître Corbac est très susceptible.', 328, 160, '');
INSERT INTO `website_shop_objects_templates` VALUES (2526, 15, 'Faux du Maitre Corbac', 'Cette faux était destinée à la base au fauchage du Iop, mais le Maître Corbac s\'est vite aperçu qu\'elle était si aiguisée, qu\'elle pouvait être utilisée pour faucher tout et n\'importe qui.', 557, 160, '');
INSERT INTO `website_shop_objects_templates` VALUES (2527, 15, 'Clakoss', 'Le Maître est plein de surprises, dans sa poche se tenait un Clakoss, célèbre fromage royal. Le fait qu\'il soit entamé prouve que le Maître Corbac l\'adore. Au niveau de l\'odeur, on ne peut que vous conseiller de ne pas le garder sur vous.', 558, 160, '');
INSERT INTO `website_shop_objects_templates` VALUES (2528, 47, 'Ongle de Kanigrou', 'Il faut être puissant et rapide pour récupérer un Ongle sur un Kanigrou. Puissant pour l\'extraire et rapide pour ne pas se prendre une baffe géante par l\'animal.', 559, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (2529, 26, 'Potion de métal liquide', 'Cette potion permet de redonner un peu de réalité à une lame éthérée.', 13, 1, '2be#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (2530, 11, 'Carabottes', 'Elles sont un peu lourdes, mais ces charmantes Carabottes feront de vous la reine de la nuit.', 35, 60, '6e#1#32#0#1d50+0,7b#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (2531, 16, 'Caracoiffe', 'Comme vous, la tortue a vraiment une toute petite tête. Ca tombe bien, ce chapeau est spécialement prévu pour ça.', 48, 60, '6f#1#0#0#0d0+1,7d#1#50#0#1d80+0');
INSERT INTO `website_shop_objects_templates` VALUES (2532, 17, 'Caracape', 'Une cape pratique et résistante, qui ne fera pas de vous une célébrité, mais comme vous n\'en étiez pas une jusqu\'à maintenant, où est le problème ?', 52, 60, 'b0#1#5#0#1d5+0,73#1#5#0#1d5+0,7b#1#1e#0#1d30+0,7c#6#1e#0#1d25+5');
INSERT INTO `website_shop_objects_templates` VALUES (2534, 17, 'Kwape de Glace', 'Idéale pour se rafraîchir sur l\'île de Moon pendant la saison chaude, et parfaite pour refroidir les ardeurs de vos amis les plus entreprenants, cette cape saura répondre aux attentes de l\'aventurier des temps modernes.', 53, 41, '7b#b#f#0#1d5+10,b6#1#0#0#0d0+1,ae#15#1e#0#1d10+20,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2535, 16, 'Kwakoiffe de Glace', 'Cette Kwakoiffe de Glace vous permettra de toujours avoir des idées fraîches, même lorsque vous serez à court d\'idées. Elle n\'est cependant pas assez puissante pour un Iop.', 49, 41, '7b#b#f#0#1d5+10,d3#3#5#0#1d3+2,7c#4#7#0#1d4+3');
INSERT INTO `website_shop_objects_templates` VALUES (2537, 10, 'Kwakture de Glace', 'Idéale pour vous raffermir les hanches, cette ceinture vous permettra de garder bien au frais ce que vous avez en dessous de la ceinture.', 36, 41, '7b#b#f#0#1d5+10,b0#1#2#0#1d2+0,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2538, 26, 'Potion de métal lourd liquide', 'Cette potion permet de redonner de la réalité à une lame éthérée.', 14, 1, '2be#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (2539, 26, 'Potion de Copeaux de Bois', 'Cette potion permet de redonner un peu de réalité à une oeuvre sculptée étherée.', 16, 1, '2be#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (2540, 26, 'Potion de Copeaux de Bois Solides', 'Cette potion permet de redonner de la réalité à une oeuvre sculptée étherée.', 17, 1, '2be#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (2541, 26, 'Potion de métal précieux liquide', 'Cette potion permet de redonner une grande part de réalité à une lame éthérée.', 15, 1, '2be#7#c#0#1d6+6');
INSERT INTO `website_shop_objects_templates` VALUES (2542, 12, 'Potion de Foyer', 'Cette Potion permet de retourner à n\'importe quel moment dans votre foyer.', 142, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2543, 26, 'Potion de Copeaux de Bois Rares', 'Cette potion permet de redonner une grande part de réalité à une oeuvre sculptée étherée.', 18, 1, '2be#7#c#0#1d6+6');
INSERT INTO `website_shop_objects_templates` VALUES (2544, 6, 'Corbalame', 'Terriblement tranchante et incroyablement classe, cette lame risque de faire des jaloux parmi votre entourage de Corbacs.', 32, 45, '64#b#32#0#1d40+10,65#1#0#0#0d0+1,7f#1#0#0#0d0+1,77#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (2545, 11, 'Corbottes', 'Ces bottes donnent à leur porteur une impression d\'incroyable légèreté, mais aussi un air stupide.', 37, 45, '73#1#5#0#1d5+0,77#1#1e#0#1d30+0,8a#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (2546, 16, 'Corbacoiffe', 'Grâce à cette magnifique coiffe, vous aurez au moins autant de classe que le tristement célèbre Maître Corbac.', 50, 45, '8a#b#14#0#1d10+10,ae#b#d2#0#1d200+10');
INSERT INTO `website_shop_objects_templates` VALUES (2547, 17, 'Corbacape Mastralis', 'Les meilleurs tailleurs d\'Amakna se sont associés jadis pour utiliser les restes de la dépouille du Maître Corbac afin d\'en faire une cape somptueuse. Avec une telle cape sur les épaules, le maître c\'est vous.', 56, 127, '7b#2e#3c#0#1d15+45,b0#6#a#0#1d5+5,75#2#0#0#0d0+2,d6#6#a#0#1d5+5,d3#6#a#0#1d5+5,d2#6#a#0#1d5+5,7d#51#78#0#1d40+80,7c#24#32#0#1d15+35');
INSERT INTO `website_shop_objects_templates` VALUES (2549, 15, 'Boîte de Kanigrou', 'Cette conserve contient du Kanigrou en morceaux, préalablement découpé puis mis en boîte. Très pratique à transporter, le Kanigrou en morceaux est vraiment le meilleur ami de l\'homme.', 560, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (2550, 55, 'Etoffe de Kanigrou', 'Avec cette Étoffe, vous pourrez faire un substitut capillaire de toute beauté. On peut même dire que l\'on vous remarquera de loin, très loin.', 561, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (2551, 106, 'Oreille de Kanigrou', 'Voici le plat préféré de l\'Ouginak: Oreille de Kanigrou sauce nature. Mais traditionnellement, on la cuisine avec beaucoup de menthe sauvage et quelques Ongles pour le goût.', 562, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (2552, 109, 'Oeil de Kanigrou', 'L\'oeil de Kanigrou est devenu un phénomène de mode, il est très courant de voir se promener des aventuriers avec l\'Oeil autour du cou.', 563, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (2553, 15, 'Gros Boulet', 'Voici un véritable Boulet. Lourd à souhait, il ne cessera jamais de vous perforer le crâne quand bon lui semble. Rien de plus ennuyeux qu\'un gros Boulet en quelque sorte.', 564, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (2554, 47, 'Côtes de Porkass', 'Les Côtes de Porkass ont une saveur particulière. Certaines personnes en raffolent avec un jus épicé, d\'autres les préfèrent crues. Le Porkass quant à lui, préfèrera les vôtres. A chacun sa recette.', 159, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (2555, 56, 'Selle en Cuir', 'À croire que le Porkass est douillet et qu\'il ne l\'assume pas, car sous ses fesses, était cachée une selle munie d\'un rembourrage de qualité. Une fois retravaillée, on pourrait faire de cette selle, d\'excellentes pantoufles.', 565, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (2556, 15, 'Pollen de Blop', 'Voici la source de toutes les allergies bénignes de ce monde. Le seul souci, c\'est que toutes les allergies mortelles commencent par une allergie bénigne. En gros, ne traînez pas avec ce Pollen dans vos poches si vous n\'en avez pas besoin.', 566, 34, '');
INSERT INTO `website_shop_objects_templates` VALUES (2557, 35, 'Pétale de Blop', 'Aussi étrange que cela puisse paraître, les Pétales de Blops ne sont pas comestibles, aussi bien cuits que crus. Qui l\'eut cru ?', 567, 34, '');
INSERT INTO `website_shop_objects_templates` VALUES (2558, 15, 'Blop Mort', 'Vous avez bien fait de le ramasser, il est intact. Mort, mais intact.', 568, 34, '');
INSERT INTO `website_shop_objects_templates` VALUES (2559, 15, 'Crinière de Trool', 'Une Crinière comme celle-ci, ça ne court pas les rues. Seuls les Enutrofs les plus riches peuvent se permettre de s\'en faire un substitut capillaire.', 569, 115, '');
INSERT INTO `website_shop_objects_templates` VALUES (2560, 15, 'Epaulette de Trool', 'Il vaut mieux observer cette Épaulette dans ces conditions que de l\'admirer encore accroché sur l\'épaule du Trool. Manquerait plus qu\'il vous fasse un défilé !', 570, 115, '');
INSERT INTO `website_shop_objects_templates` VALUES (2561, 15, 'Bracelet de Force de Trool', 'Comme si le Trool avait besoin d\'un Bracelet de Force... Cette incroyable machine à broyer les os en possède un à chaque poignet.', 571, 115, '');
INSERT INTO `website_shop_objects_templates` VALUES (2562, 56, 'Slip de Trool', 'À voir l\'état de son Slip, le Trool s\'assoit un peu n\'importe où. C\'est aussi grâce à ce Slip que l\'on peut déterminer l\'âge de son propriétaire. A vu de nez, bien sûr...', 572, 115, '');
INSERT INTO `website_shop_objects_templates` VALUES (2563, 38, 'Cale en bois du Tronknyde', 'Pour le Tronknyde, cette Cale sert de pied, car le pied sert de Cale, malheureusement, le Tronknyde est toujours à la recherche d\'un cale-pied.', 573, 35, '');
INSERT INTO `website_shop_objects_templates` VALUES (2564, 38, 'Sourcils de Tronknyde', 'Vous vouliez connaître la technique du Tronknyde pour effrayer les visiteurs imprudents ? Et bien,vous l\'avez dans les mains : une bonne grosse paire de Sourcils bien épais.', 574, 35, '');
INSERT INTO `website_shop_objects_templates` VALUES (2565, 15, 'Tranche de Tronknyde', 'Après vous être taillé une bonne Tranche de ce Tronknyde, il doit bien tirer la tronche à présent.', 575, 35, '');
INSERT INTO `website_shop_objects_templates` VALUES (2566, 15, 'Tranche Magique de Tronknyde', 'Cette Tranche à l\'air différente des autres Tranches de Tronknyde. Au moment ou elle fut coupée, une lumière aveuglante a jailli du Tronknyde et a ensuite disparu, ne laissant au sol que la Tranche.', 576, 35, '');
INSERT INTO `website_shop_objects_templates` VALUES (2567, 29, 'Anticipation', 'Cette bénédiction permet d\'être plus vif pour les prochains combats.', 6, 1, '32b#5#0#0#0d0+5,ae#1f4#0#0#0d0+500');
INSERT INTO `website_shop_objects_templates` VALUES (2568, 30, 'Reflexes Soushumains', 'Cette malédiction vous plonge dans un état de semi-conscience et vos réflexes en sont amoindris pour le prochain combat', 6, 1, 'af#32#0#0#0d0+50,32b#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2569, 14, 'Parchemin de Reflexes Surhumain', 'Ce Parchemin permet d\'être plus vif pour le prochain combat.', 28, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2570, 14, 'Parchemin de Reflexes Soushumains', 'Ce Parchemin permet d\'être un brin inerte pour le prochain combat.', 29, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (2571, 103, 'Patte de Prespic', 'Comment un Prespic, et vous devez vous poser sûrement la même question, fait-il pour être aussi agile avec ces deux malheureux doigts de patte? Le mystère reste entier.', 577, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2572, 15, 'Estomac de Prespic', '\"À force de manger la même chose, tu vas finir par ressembler à ce que tu manges\". Tel était la sage parole du cuisinier Bontarien Jon-kierre Poff. Voilà qui explique pourquoi le Prespic a l\'estomac verdi par le gazon ingéré.', 578, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2573, 65, 'Queue de Prespic', 'Le Prespic fait usage de sa queue très rarement, et fort heureusement d\'ailleurs, car la puissance qui réside dans celle-ci se révèle surprenante. Certains bûcherons ont même vu des Prespic en pleine nuit trimbaler des rondins de Bois avec leurs queues.', 579, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2574, 15, 'Crinière de Prespic', 'Pour les soirées dites \"Vie-Ail-Pie\", cette Crinière sera du plus bel effet. Emmenez un ami Osamodas et on vous prendra pour son invocation.', 580, 18, '');
INSERT INTO `website_shop_objects_templates` VALUES (2575, 15, 'Scalp de Mulou', 'À votre arrivée, le Mulou avait certainement la même intention que vous, c\'est-à-dire de vous extraire avec plus ou moins de diplomatie votre Scalp. Le voilà pris de vitesse.', 581, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (2576, 15, 'Scalp de Milimulou', 'À votre arrivée, le Milimulou avait certainement la même intention que vous, c\'est-à-dire de vous extraire avec plus ou moins de délicatesse votre Scalp. Le voilà bien malin sans le haut de son crâne.', 582, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (2577, 15, 'Scalp de Meulou', 'À votre arrivée, le Meulou avait certainement la même intention que vous, c\'est-à-dire de vous extraire avec plus ou moins de tact votre Scalp. Le voilà prêt à attraper un rhume du cerveau.', 583, 198, '');
INSERT INTO `website_shop_objects_templates` VALUES (2578, 109, 'Oeil de Mulou', 'Même arraché, le regard du Mulou reste porté sur vous. Et si vous regardez attentivement, vous aurez tendance à penser qu\'il vous suit des yeux, ou plutôt de l\'oeil.', 584, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (2579, 109, 'Oeil du Milimulou', 'Même arraché, le regard du Milimulou reste porté sur vous. Et si vous regardez attentivement, l\'oeil cligne encore des paupières. Quelle vitalité ce Milimulou.', 585, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (2580, 109, 'Oeil de Meulou', 'Même arraché, le regard du Meulou reste porté sur vous. Et si vous regardez attentivement, il fronce les sourcils quand vous le pointez du doigt. Décidément, le Meulou n\'est pas la pour la boutade.', 586, 198, '');
INSERT INTO `website_shop_objects_templates` VALUES (2581, 47, 'Dents de Meulou', 'Dans la famille des Mulous, si vous cherchez celui qui a les plus grandes dents, vous venez de faire bonne pioche. C\'est pour mieux vous baver dessus mes enfants.', 587, 198, '');
INSERT INTO `website_shop_objects_templates` VALUES (2582, 15, 'Testicules de Meulou', 'Si le prix des Testicules de Mulou est scandaleux, vous comprendrez que ce que vous avez en main vaut au bas mot une sacrée paire... de lingots.', 588, 198, '');
INSERT INTO `website_shop_objects_templates` VALUES (2583, 109, 'Oeil de Crabe', 'Les marins d\'eau douce sont assez friands de cet Oeil de Crabe, car on peut en capturer sur la terre ferme.', 589, 4, '');
INSERT INTO `website_shop_objects_templates` VALUES (2584, 15, 'Main de Boo', 'Cette Main de Boo est recouverte de boue. À moins qu\'il n\'y ait rien sous cette boue, même pas la Main du Boo.', 590, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2585, 15, 'Coeur de Boue du Boo', 'Muni de son Coeur de Boue, le Boo est dur à classer dans la chaîne alimentaire. En réfléchissant un peu, le Boo viendrait sûrement au bout de la chaîne.', 591, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (2586, 104, 'Aile de Dragodinde Rousse Sauvage', 'Cette Aile sent le soufre. Tout bon éleveur de Dragodindes vous dira que c\'est la partie la plus tendre pour un barbeulcu. Assaisonnez tout de même la viande, car l\'Aile est la partie la plus fade.', 592, 29, '');
INSERT INTO `website_shop_objects_templates` VALUES (2587, 19, 'Hachette de Bûcheron', 'Cette hachette est l\'outil indispensable à tout bûcheron. Non pas qu\'elle soit réellement utile, impossible de couper un arbre avec, mais sa présence à la ceinture les calme et les rassure.', 6, 3, '64#4#9#0#1d6+3,6e#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (2588, 104, 'Aile de Dragodinde', 'On peut dire que la Dragodinde domestique est bien meilleure que sa cousine sauvage. Déjà, elle n\'a pas un arrière-goût de soufre, mais la chair est goûteuse à souhait, ce qui en fait le plat favori de tous les petits.', 593, 29, '');
INSERT INTO `website_shop_objects_templates` VALUES (2589, 19, 'Hachette Hévlalav', 'Cette petite hache ne sait pas couper les arbres, mais peut servir à se défendre contre certains petits monstres. Par contre il vous faudra toujours courir si c\'est un Minotoror.', 7, 6, '64#6#a#0#1d5+5,6e#7#0#0#0d0+7,76#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (2590, 19, 'Hache Vôr\'Om', 'Cette série de haches fut conçue par un bwork apprenti forgeur. Elle est bien équilibrée et relativement puissante. Ce bwork venait de créer LA hache de guerre pour jeune aventurier.', 13, 12, '64#a#e#0#1d5+9,6e#6#f#0#1d10+5,77#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (2591, 65, 'Queue de Dragodinde Rousse Sauvage', 'L\'intérêt de cette queue est simple: posez-la sur un rocher rond et faites tourner la Queue. Quand la Queue s\'arrête, suivez la direction indiquée par la pointe. Telle était la façon de se déplacer des Sadida pendant des millénaires.', 594, 27, '');
INSERT INTO `website_shop_objects_templates` VALUES (2592, 19, 'Coupeuse de Bombu', 'Très légère et maniable, cette hache facilite les gestes amples nécessaires afin de couper le Bombu en toute sécurité.', 15, 39, '64#f#18#0#1d10+14,7e#6#f#0#1d10+5,7c#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (2593, 19, 'Elagueuse d\'Oliviolet', 'Cette hache, faite d\'Oliviolet, est la hache la plus à même à résister aux ondes violettes de l\'Oliviolet. Combattre le mal par le mal en quelque sorte.', 14, 42, '9d#6#f#0#1d10+5,9b#6#f#0#1d10+5,64#10#16#0#1d7+15,7c#b#14#0#1d10+10,6e#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (2594, 65, 'Queue de Dragodinde', 'Étrangement, la Queue de Dragodinde n\'a aucun pouvoir magique. A l\'instar d\'un Crocodaille, la Queue repousse rapidement. Une légende raconte aussi qu\'une Dragodinde avait poussé au bout de la Queue. Vous voilà prévenu.', 595, 17, '');
INSERT INTO `website_shop_objects_templates` VALUES (2595, 19, 'Hache de Pierre', 'Cette hache, très primitive, n\'en reste pas moins efficace. Un peu comme certains vieillards.', 2, 51, '64#10#19#0#1d10+15,76#10#19#0#1d10+15,7d#15#1e#0#1d10+20,7c#6#14#0#1d15+5,ae#32#0#0#0d0+50');
INSERT INTO `website_shop_objects_templates` VALUES (2596, 15, 'Lait de Dragodinde', 'Les éleveurs apprécient le fait de pouvoir traire leurs Dragodindes. Le seul problème, c\'est que ce Lait ne se vend pas, car il est infect. Il sert donc juste à nourrir les Dragodindonettes.', 424, 29, '');
INSERT INTO `website_shop_objects_templates` VALUES (2597, 19, 'Hache de Brèche', 'Cette longue hache se faufile dans les moindres interstices des arbres pour mieux les fendre en deux. Son utilité en combat est la même, l\'adversaire ayant toujours un interstice ou deux à exploiter.', 16, 54, '64#15#19#0#1d5+20,76#10#1e#0#1d15+15,7e#10#1e#0#1d15+15');
INSERT INTO `website_shop_objects_templates` VALUES (2598, 47, 'Pic de Dragodinde Rousse Sauvage', 'Ce Pic n\'est autre qu\'une protubérance osseuse. La Dragodinde s\'en sert tellement peu, que l\'on se demandait comment faisait-elle pour les abîmer autant. Depuis que les Biologistes l\'ont vu se frotter aux Trools, on comprend mieux.', 596, 29, '');
INSERT INTO `website_shop_objects_templates` VALUES (2599, 47, 'Pic de Dragodinde', 'Situé sur le dos de la Dragodinde, ce Pic pourra peut-être vous servir à vous gratter l\'entrejambe, si vous parvenez à monter une Dragodinde.', 597, 29, '');
INSERT INTO `website_shop_objects_templates` VALUES (2600, 19, 'Coupeuse de Sifflet', 'Cette grosse hache fait un bruit mons1ux lorsqu\'elle s\'abat sur quelque chose, ce qui a souvent pour effet de provoquer le silence autour de soi. C\'est toujours ça de pris.', 17, 66, '64#15#1e#0#1d10+20,76#10#1e#0#1d15+15,7d#10#1e#0#1d15+15,77#10#1e#0#1d15+15,7c#10#14#0#1d5+15');
INSERT INTO `website_shop_objects_templates` VALUES (2601, 19, 'Hache Darsson', 'Darsson était un vaillant Enutrof adroit comme ses pieds. Faisant souvent tomber sa pelle en combat, il eût l\'ingénieuse idée d\'attacher une hache de rechange à sa ceinture. Cela lui sauva la vie plusieurs fois, jusqu\'à ce qu\'il fasse tomber sa hache...', 18, 57, '64#12#1b#0#1d10+17,7b#15#1e#0#1d10+20,77#15#1e#0#1d10+20,af#64#0#0#0d0+100,9c#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (2602, 35, 'Pétale de Trukikol', 'Pas plus gros qu\'un Oeil de Crabe, le Pétale de Trukikol est constitué de plusieurs bulles collantes et spongieuses au toucher. Il sert le plus souvent à colmater les trous dans les toits après les rigoureuses tempêtes de fin d\'année.', 598, 12, '');
INSERT INTO `website_shop_objects_templates` VALUES (2603, 19, 'Trancheuse de Partie', 'Cette hache est très utile pour séparer certaines parties récalcitrantes d\'un arbre, notamment les petites boursoufflures du tronc, ceci dans le but d\'avoir un arbre parfaitement lisse et rond.', 2, 66, '64#15#19#0#1d5+20,7c#15#1e#0#1d10+20,74#2#3#0#1d2+1,6e#15#28#0#1d20+20');
INSERT INTO `website_shop_objects_templates` VALUES (2604, 19, 'Bardiche du Milicien', 'Cette bardiche est principalement employée par les miliciens d\'Amakna. Sa longueur et son efficacité doit probablement compenser d\'autres choses.', 3, 78, '64#1a#20#0#1d7+25,6e#15#32#0#1d30+20,7b#15#28#0#1d20+20,7c#6#f#0#1d10+5,76#15#28#0#1d20+20,9b#15#32#0#1d30+20');
INSERT INTO `website_shop_objects_templates` VALUES (2605, 59, 'Peau de Trukikol', 'Ne soyez pas étonné si l\'on vous dit que la Peau de Trukikol colle. Grâce à elle, on arrive à tout faire tenir au plafond. Il faut avouer que c\'est aussi grâce au paysan qui a breveté l\'idée : un dénommé Roulio de Scautche.', 599, 12, '');
INSERT INTO `website_shop_objects_templates` VALUES (2606, 19, 'Hachette Savante', 'Sur cette grosse hachette, de multiples inscriptions gravées rappellent des notions Amakniennes de base. Son inventeur Claus Ansipedi désirait donner un semblant de culture aux brûtasses finies...peine perdue, il est mort le crâne fendu.', 4, 81, '64#17#1d#0#1d7+22,7d#15#32#0#1d30+20,77#15#28#0#1d20+20,7c#6#f#0#1d10+5,7e#15#28#0#1d20+20,af#65#c8#0#1d100+100,9d#15#32#0#1d30+20');
INSERT INTO `website_shop_objects_templates` VALUES (2607, 15, 'Trukikol Mort', 'Vous avez bien fait de le ramasser, il est intact. Mort, mais intact.', 600, 14, '');
INSERT INTO `website_shop_objects_templates` VALUES (2608, 19, 'Francique Basquaise', 'Cette hache fait souvent le tour du monde en commençant par le bas. Et pour cause c\'est dans le sud d\'Amakna que ce type de hache est forgée, par une petite guilde de chasseurs de trésors réputée pour leur efficacité.', 1, 84, '64#1c#20#0#1d5+27,76#1f#32#0#1d20+30,7d#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (2609, 107, 'Carapace Verte Vide', 'Mais où se cache le propriétaire ? Il a dû sortir s\'acheter du pain avec de la tomate dessus.', 601, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (2610, 107, 'Carapace Rouge Vide', 'Mais ou se cache le propriétaire? il a dû déménager depuis peu.', 602, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (2611, 107, 'Carapace Jaune Vide', 'Mais ou se cache le propriétaire ? il fait peut-être une sieste à l\'intérieur.', 603, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (2612, 19, 'Vouge à Poisson', 'Cette longue hache est utilisée par les marins experts pour affronter les poissons géants qui attaquent leurs navires. On imagine assez bien les dégâts qu\'elle peut faire contre des monstres plus petits.', 4, 87, '64#1f#23#0#1d5+30,77#1f#32#0#1d20+30,76#1f#32#0#1d20+30,98#6#19#0#1d20+5');
INSERT INTO `website_shop_objects_templates` VALUES (2613, 107, 'Carapace Bleue Vide', 'Mais où se cache le propriétaire ? il doit être sous la douche.', 604, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (2614, 19, 'Hache de Dame Oise', 'La Dame Oise était une ravissante princesse qui respirait la candeur et la fraîcheur. Tout le monde fut bien surpris lorsque, lors d\'un raid Bwork sur sa cité, elle sortit cette hache et fracassa à elle seule la moitié de l\'armée adverse.', 5, 90, '64#1f#23#0#1d5+30,6e#1f#46#0#1d40+30,76#1f#46#0#1d40+30,af#1f4#0#0#0d0+500');
INSERT INTO `website_shop_objects_templates` VALUES (2615, 19, 'Hache de Lookabeer', 'Cette hache est réputée pour son efficacité à terminer définitivement et très rapidement une querelle entre Enutrofs ivres.', 8, 96, '64#1f#25#0#1d7+30,76#15#1e#0#1d10+20,77#15#1e#0#1d10+20,7b#15#1e#0#1d10+20,7c#15#1e#0#1d10+20,7e#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (2616, 19, 'Halle de Barde', 'Cette hache tire son nom du test qui fut utilisé pour prouver sa terrible efficacité : une hache géante, un mythophobiaque et une halle remplie de bardes.', 7, 99, '64#24#28#0#1d5+35,76#33#3c#0#1d10+50,7d#33#3c#0#1d10+50,8a#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (2617, 15, 'Tranche de Nodkoko', 'Haaa... Enfin un élément qui vous fait penser aux vacances. Cette Agence de Voyages ne paie rien pour attendre.', 605, 14, '');
INSERT INTO `website_shop_objects_templates` VALUES (2618, 15, 'Kokopaille', 'Pour siroter quelque chose de frais, rien de mieux qu\'une paille colorée. Il n\'y a plus qu\'à trouver un trou dans la Nodkoko.', 433, 14, '');
INSERT INTO `website_shop_objects_templates` VALUES (2619, 15, 'Kokolait', 'En voilà une bonne idée: avoir du Kokolait en bouteille, ça permet d\'en boire quand on veut et où que l\'on soit.', 423, 14, '');
INSERT INTO `website_shop_objects_templates` VALUES (2620, 15, 'Rhum de Qualité ', 'Ce Rhum doit sortir d\'une cave très prisée. À moins qu\'il soit resté dans une poche pendant de bonnes générations.', 177, 94, '');
INSERT INTO `website_shop_objects_templates` VALUES (2621, 15, 'Barbe du Chouque', 'Vous venez d\'extraire du menton du Chouque sa Barbe. Bizarrement, les Dents sont venues avec. C\'est ça d\'être mort depuis longtemps, on perd des bouts.', 606, 94, '');
INSERT INTO `website_shop_objects_templates` VALUES (2622, 15, 'Boucle du Chouque', 'Du bout de cette Boucle, sept générations de pirates vous contemplent.', 607, 94, '');
INSERT INTO `website_shop_objects_templates` VALUES (2623, 15, 'Bwak Squelettique', 'Les éleveurs ont toujours cru que les Bwaks s\'envolaient très loin à la fin de leur vie. Toutefois, ce Bwak est une exception à la règle.', 608, 94, '');
INSERT INTO `website_shop_objects_templates` VALUES (2624, 36, 'Feuille de Kokoko', 'De hardis chasseurs veulent coûte que coûte et quoiqu\'il en coûte, récupérer en guise de souvenirs une Feuille de Kokoko, pour ensuite ne jamais revenir sur cette île maudite. Pourquoi pas ?', 609, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (2625, 15, 'Poupée Vaudou Thierry', 'Une force se dégage de cette Poupée, mais vous avez l\'étrange sensation qu\'elle appelle quelqu\'un.', 610, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (2626, 15, 'Poupée Vaudou Jav', 'Une force se dégage de cette Poupée, mais vous avez l\'étrange sensation qu\'elle cherche quelqu\'un.', 611, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (2627, 15, 'Poupée Vaudou Sarbak', 'Une force se dégage de cette Poupée, mais vous avez l\'étrange sensation qu\'elle écoute quelqu\'un.', 612, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (2628, 15, 'Poupée Vaudou Archer', 'Une force se dégage de cette Poupée, mais vous avez l\'étrange sensation qu\'elle attend quelqu\'un.', 613, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (2629, 17, 'Caracape Minotoris', 'Cette cape, d\'allure royale, constitue pourtant une incroyable protection. C\'est ce modèle qui a fait la réputation d\'une célèbre tailleuse, juste avant de mourir de son succès, écrasée par la foule.', 55, 121, 'd4#6#a#0#1d5+5,d2#6#a#0#1d5+5,d5#6#a#0#1d5+5,d3#6#a#0#1d5+5,77#10#14#0#1d5+15,8a#10#14#0#1d5+15,b7#b#f#0#1d5+10,b8#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (2630, 15, 'Pot de Gloutovore', 'À la base, le Gloutovore n\'est pas très généreux. Avec ce Pot rempli à raz bord, vous voila bien chanceux. Reste plus qu\'à lui trouver une utilité.', 614, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (2631, 15, 'Estomac de Gloutovore', 'Voici l\'estomac le plus résistant que vous puissiez voir. Extensible à souhait, vous pourriez même vous cacher dedans si vous le souhaitiez.', 615, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (2632, 15, 'Glouto Rhum', 'Cette Bouteille a été laissée à l\'abandon à l\'intérieur d\'un Gloutovore. Quel gâchis ! Par contre, il a l\'air d\'avoir bien vieilli, il a gagné en arôme. Si les Paysans savaient ça, il y aurait des entrepôts remplis de Gloutovore.', 177, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (2633, 15, 'Rhum Fourbe', 'Alors là, c\'est le piège. La Fourbasse est tellement fourbe qu\'elle a rempli une bouteille de Rhum avec du... bah oui du Rhum, mais il a une odeur repérable à dix mille lieues : le Trukikol séché.', 177, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (2634, 15, 'Lance Cassée', 'Sans sa Lance, la Fourbasse fera moins la maligne. Reste à savoir ce que vous allez en faire.', 616, 24, '');
INSERT INTO `website_shop_objects_templates` VALUES (2635, 33, 'Pain Gre', 'Cette recette a été élaborée par un rival de Xavier le Boulanger, à savoir Danioul Garnioul le Boulanger. Son nom était si stupide que ses clients ne cessaient de se moquer de lui, il se vengeait en pétrissant avec ses pieds.', 13, 80, '6e#97#c8#0#1d50+150,8b#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (2636, 33, 'Pain Tahde', 'Ce pain renferme de délicieuses lichettes de viande, qui ont la saveur et l\'apparence de volaille, mais méfiance il n\'en n\'est rien. En y regardant de plus près, on peut sentir une légère odeur de Tofu.', 13, 100, '6e#c9#fa#0#1d50+200,8b#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (2637, 6, 'La Griffe', 'Cette lame recourbée, faite d\'os, de cartilage et de corne, est aussi tranchante qu\'une griffe d\'Ecaflip. En un peu plus gros et plus propre.', 33, 35, '64#b#14#0#1d10+10,ae#65#96#0#1d50+100,76#1#f#0#1d15+0,77#1#f#0#1d15+0');
INSERT INTO `website_shop_objects_templates` VALUES (2638, 6, 'La Griffe Aiguisée', 'Cent pour cent naturelle, cette épée est comme une sixième griffe pour une main Ecaflip. A ce propos, faites attention à ne pas vous grattouiller le museau avec cette griffe là !', 34, 68, '7d#10#1e#0#1d15+15,77#10#1e#0#1d15+15,76#10#1e#0#1d15+15,ae#c9#12c#0#1d100+200,64#10#1e#0#1d15+15');
INSERT INTO `website_shop_objects_templates` VALUES (2639, 6, 'Fausse Griffe de Ceangal', 'Une forgeuse écaflipette eut l\'idée de forger cette épée après son échec à maitriser la technique ancestrale du même nom. Elle se disait qu\'au moins cette griffe ne lui ferait pas faux bond.', 35, 95, '64#15#28#0#1d20+20,ae#12d#190#0#1d100+300,76#1f#2d#0#1d15+30,77#1f#2d#0#1d15+30,7d#1f#2d#0#1d15+30,b0#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (2640, 4, 'Bâton Carnivore', 'Etrangement sculpté, ce Bâton ne provient pas du coin. Il sent les vieux endroits humides et sombres de Brâkmar.', 24, 30, '5d#4#9#0#1d6+3,77#1#1e#0#1d30+0');
INSERT INTO `website_shop_objects_templates` VALUES (2641, 16, 'Toady', 'Rouge, blanc et surtout somptueusement classe, ce chapeau vous permettra d\'assurer un max lors des soirées de l\'ambassadeur qui sont toujours une réussite.', 51, 30, '77#b#3c#0#1d50+10');
INSERT INTO `website_shop_objects_templates` VALUES (2642, 47, 'Mâchoire de Rib', 'Déjà que le Rib est un tantinet maigrelet, alors s\'il lui manque sa Mâchoire, il va se retrouver aussi offensif qu\'une armée de tiques en hibernation.', 617, 33, '');
INSERT INTO `website_shop_objects_templates` VALUES (2643, 47, 'Défense de Dragon Cochon', 'Cette défense appartient à l\'un des plus célèbres prédateurs des montagnes d\'Amakna: le Dragon Cochon. Des chasseurs seraient prêts à revendre leur famille entière pour posséder ce que vous avez en main. C\'est pour vous l\'occasion rêvée d\'acheter une famille à moindre frais.', 618, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (2644, 65, 'Queue de Dragon Cochon', 'Un régal que ce gros morceau de Queue de Dragon Cochon. Faites le sauter à la poële avec un peu de Graine de Sésame, le tout avec une Sauce hisson, et vos invités ne partiront plus de chez vous. N\'est-ce pas super chouette ? Non ? Bon...', 619, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (2645, 15, 'Groin de Dragon Cochon', 'À vue de Groin, le Dragon Cochon n\'a pas senti le coup venir. C\'est dommage pour lui.', 620, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (2646, 56, 'Slip en cuir de Cochon de Lait', 'Ce slip bien large va à ravir au Cochon de Lait, les coutures sont élastiques et renforcées, pour une plus grande efficacité lors des combats rapprochés. Comme l\'exige la tradition, ce slip ne doit jamais être lavé, sous peine de perdre ses propriétés intrinsèques encore inconnues et redoutées de nos jours.', 621, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (2647, 106, 'Oreille de Cochon de Lait', 'Le Cochon de Lait n\'est pas chassé généralement pour ses Oreilles, mais plutôt pour son ivoire. Mais bon, à défaut d\'Ivoire....', 623, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (2648, 15, 'Griffes de Kwak', 'Le Kwak n\'a rien d\'un charognard, mais il possède tout de même d\'étranges dépôts sous ses griffes qu\'il ne vaut mieux pas décrire.', 624, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (2649, 15, 'Ver de Terre', 'Ce Ver est le plat préféré des Kwaks sauvages. Ce qui est plus étrange, c\'est qu\'il est resté vivant alors qu\'il a été extrait de l\'Estomac du Kwak.', 625, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (2650, 15, 'Ver d\'Eau', 'Ce Ver est le plat préféré des Kwaks sauvages. Ce qui est plus étrange, c\'est qu\'il est resté vivant alors qu\'il a été extrait de l\'estomac du Kwak.', 626, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (2651, 15, 'Ver de Feu', 'Ce Ver est le plat préféré des Kwaks sauvages. Ce qui est plus étrange, c\'est qu\'il est resté vivant alors qu\'il a été extrait de l\'Estomac du Kwak.', 627, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (2652, 15, 'Ver d\'Air', 'Ce Ver est le plat préféré des Kwaks sauvages. Ce qui est plus étrange, c\'est qu\'il est resté vivant alors qu\'il a été extrait de l\'Estomac du Kwak.', 628, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (2653, 15, 'Arakne Majeure Morte', 'Vous avez bien fait de la ramasser, elle est intacte. Morte, mais intacte.', 629, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (2654, 105, 'Oeuf d\'Arakne Majeure', 'Le problème avec les Araknes, c\'est que l\'on peut se retrouver avec plusieurs générations en quelques jours avec la chaleur. Donc si le temps est caniculaire, ne vous promenez pas trop dans la Fôret des Abraknydes.', 630, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (2655, 10, 'Ceinture Corbaquiale', 'Cette ceinture a été confectionnée à partir des restes du Maître Corbac, soigneusement cousus entre eux. Vous devriez vous sentir respecté une fois équipé de celle-ci. Le Chouque a même accepté de prêter sa boucle pour l\'occasion.', 56, 120, '76#1f#32#0#1d20+30,7c#15#28#0#1d20+20,ae#b5#14a#0#1d150+180,d4#3#5#0#1d3+2,b0#6#a#0#1d5+5,d2#3#5#0#1d3+2,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2656, 15, 'Fil Résistant', 'Si les Cordonniers ainsi que les Tailleurs connaissaient l\'existence de ce Fil Résistant, il y aurait la Semaine du Fil Résistant, la Foire du Fil Résistant ainsi que le jour saint du Fil Résistant.', 631, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (2659, 35, 'Pétale de Tournesol Sauvage', 'Ce Pétale bouge. Oui, il bouge en fonction du soleil. Mettez le dans votre poche droite le matin, il sera dans votre poche gauche le soir venu.', 632, 12, '');
INSERT INTO `website_shop_objects_templates` VALUES (2661, 36, 'Feuille de Tournesol Sauvage', 'Cette partie du Tournesol n\'est pas que la Feuille de la plante, c\'est aussi sa voûte plantaire. Ne vous étonnez donc pas si elle sent des pieds.', 633, 12, '');
INSERT INTO `website_shop_objects_templates` VALUES (2662, 15, 'Bave de Rose Démoniaque', 'Une Rose enragée a la fâcheuse habitude de baver sur quiconque ose s\'approcher. Mais il paraît que c\'est un signe d\'affection. Une Rose Démoniaque enragée et affective qui plus est, on aura tout vu.', 634, 8, '');
INSERT INTO `website_shop_objects_templates` VALUES (2663, 15, 'Engrais', 'Toute belle plante a besoin d\'Engrais. Les Enutrofettes sur le déclin peuvent donc s\'en passer.', 635, 8, '');
INSERT INTO `website_shop_objects_templates` VALUES (2664, 47, 'Os de Crocodaille', 'Cet os verdâtre et pour le moins étrange, provient d\'une patte de Crocodaille. Ce dernier a sûrement dû verser des larmes de Crocodaille quand il a compris qu\'il avait une patte en moins.', 636, 36, '');
INSERT INTO `website_shop_objects_templates` VALUES (2665, 36, 'Herbe Folle', 'Voici le genre d\'Herbe que l\'on met dans les enclos pour Bouftous. Cette Herbe est folle car de temps à autres, elle se lève et s\'échappe de l\'enclos, ce qui n\'est pas commun pour une touffe d\'herbe.', 637, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (2666, 47, 'Sabot du Minotoror', 'Il a dû écraser pas mal d\'aventuriers avec ce Sabot. Maintenant, il doit moins faire le malin à danser sur une seule patte. Quoique cela va lui donner une démarche encore plus inquiétante qu\'avant.', 800, 125, '');
INSERT INTO `website_shop_objects_templates` VALUES (2667, 65, 'Queue de Minotoror', 'Cela relève tout de même de l\'exploit de voir une Queue de Minotoror, sans le Minotoror qui va avec. Le pauvre doit chercher partout après. A moins qu\'il ne s\'en soit toujours pas rendu compte, ce qui n\'est pas impossible.', 640, 125, '');
INSERT INTO `website_shop_objects_templates` VALUES (2669, 15, 'Chauve souris', 'Parfois, les Vampires se transforment en Chauve Souris, pour mieux fuir. Mais ils se sentent obligés de lâcher un petit rire avant de s\'échapper. Ca donne à peu près ceci : \"niap nioop niap niap\". Ce rire peut mettre en déroute une armée... de tiques.', 641, 21, '');
INSERT INTO `website_shop_objects_templates` VALUES (2673, 105, 'Oeuf pourri', 'C\'est tout simplement honteux. Comment peut-on pondre un Oeuf de Tofu en décomposition? Il faut vraiment être Maléfique pour avoir des idées pareils.', 642, 3, '');
INSERT INTO `website_shop_objects_templates` VALUES (2674, 46, 'Citrouillette', 'La citrouillette est délicieuse en cette saison. Pas trop petite pour avoir du goût, mais pas trop grosse non plus pour ne pas se transformer en Citwouille, succulente et remboursée par le sec Huh.', 643, 15, '');
INSERT INTO `website_shop_objects_templates` VALUES (2675, 53, 'Plume de Tofu Maléfique', 'Le Tofu Maléfique n\'a vraiment plus beaucoup de Plumes, il va finir par attraper un rhume carabiné, il ne faudra donc pas s\'étonner si vous l\'entendez éternuer la nuit.', 644, 3, '');
INSERT INTO `website_shop_objects_templates` VALUES (2676, 15, 'Noeul Mort', 'Vous avez bien fait de le ramasser, il est intact. Mort, mais intact.', 645, 274, '');
INSERT INTO `website_shop_objects_templates` VALUES (2677, 10, 'Ceinture Chouqueuse', 'Cette ceinture a été confectionnée à partir des éléments les plus puissants du Chouque, notamment son célèbre caleçon. De quoi mettre en émoi toutes les flibustières du bar des pirates.', 41, 98, '7d#33#50#0#1d30+50,76#1f#32#0#1d20+30,70#6#a#0#1d5+5,8a#b#f#0#1d5+10,d5#3#5#0#1d3+2,d2#3#5#0#1d3+2,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2678, 10, 'Ceinture Kokokette', 'Cette ceinture ressemble presque à un pagne, elle conviendra parfaitement si vous voulez vous camoufler parmi les Kokokos de l\'île de Moon, ou tout simplement si vous désirez courtiser un Kokoko.', 40, 42, '76#15#23#0#1d15+20,7e#15#23#0#1d15+20,d6#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2681, 10, 'Ceinture Tortue Jaune', 'Cette petite ceinture est idéale pour protéger les parties sensibles, des coups critiques. \\nVérifiez tout de même que le cordonnier a bien retiré le propriétaire de la carapace avant que vous ne l\'essayez.', 43, 60, 'b0#3#6#0#1d4+2,77#10#23#0#1d20+15,7d#10#1e#0#1d15+15,ae#33#64#0#1d50+50,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2683, 10, 'Ceinture Tortue Bleue', 'Cette petite ceinture est idéale pour protéger les parties sensibles, des coups critiques. \\nVérifiez tout de même que le cordonnier a bien retiré le propriétaire de la carapace avant que vous ne l\'essayez.', 44, 60, 'b0#3#6#0#1d4+2,7b#10#23#0#1d20+15,7d#10#1e#0#1d15+15,ae#33#64#0#1d50+50,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2685, 10, 'Ceinture Tortue Verte', 'Cette petite ceinture est idéale pour protéger les parties sensibles, des coups critiques. \\nVérifiez tout de même que le cordonnier a bien retiré le propriétaire de la carapace avant que vous ne l\'essayez.', 42, 60, 'b0#3#6#0#1d4+2,76#10#23#0#1d20+15,7d#10#1e#0#1d15+15,ae#33#64#0#1d50+50,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2687, 10, 'Ceinture Tortue Rouge', 'Cette petite ceinture est idéale pour protéger les parties sensibles, des coups critiques. \\nVérifiez tout de même que le cordonnier a bien retiré le propriétaire de la carapace avant que vous ne l\'essayez.', 45, 60, 'b0#3#6#0#1d4+2,7e#10#23#0#1d20+15,7d#10#1e#0#1d15+15,ae#33#64#0#1d50+50,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (2688, 10, 'Ceinture Kolante', 'Le moins que l\'on puisse dire, c\'est qu\'une fois enfilée, vous ne risquez plus de perdre cette ceinture. Elle fera le bonheur des étourdis et des victimes récurrentes de vols.', 46, 50, '77#b#f#0#1d5+10,8a#7#b#0#1d5+6,7d#b#f#0#1d5+10,73#2#3#0#1d2+1,b0#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (2689, 10, 'Ceinture Banisation', 'Le cordonnier qui a créé cette ceinture avec les restes d\'un Dragodinde devait vraiment manquer d\'imagination, pour lui donner un nom aussi stupide.', 47, 29, '77#b#14#0#1d10+10,73#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2710, 10, 'Ceinture Banisation Sauvage', 'Comportant des renforts en fer, c\'est une version améliorée de la classique Ceinture Banisation, elle a été spécialement conçue pour chasser les Dragodindes Sauvages dans les contrées sauvages.', 48, 32, '77#b#14#0#1d10+10,73#3#5#0#1d3+2,ae#29#41#0#1d25+40');
