INSERT INTO `website_shop_objects_templates` VALUES (2801, 6, 'Epée de Nopera', '#1', 37, 50, '32c#1a#0#0#0d0+26,61#d#1c#0#1d16+12,98#1#a#0#1d10+0,6e#5#0#0#0d0+5,76#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (2802, 6, 'Epée de Balelen', '#1', 40, 50, '32c#1a#0#0#0d0+26,62#d#1f#0#1d19+12,9d#23#0#0#0d0+35,77#1#2d#0#1d45+0,7b#f#0#0#0d0+15');
INSERT INTO `website_shop_objects_templates` VALUES (2803, 10, 'Ceinture du Kwabe', 'Cette étrange ceinture est entièrement constituée de fragments de pince, et de carapace de crabe. Même en employant une magie très puissante, elle sentira toujours aussi mauvais, il faut vous rendre à l\'évidence.', 49, 8, 'da#b#f#0#1d5+10,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (2804, 10, 'Ceinture Mulante', 'Le célèbre Mulou a fait don de ses plus précieux organes pour aider à la confection de cette ceinture incroyable qui respire la puissance malgrès son apparence assez étrange qui comblerait le plus pervers des Chafers.', 50, 81, 'd2#3#5#0#1d3+2,7d#29#46#0#1d30+40,7c#15#1e#0#1d10+20,d3#3#5#0#1d3+2,ae#97#c8#0#1d50+150,77#1a#28#0#1d15+25,76#1a#28#0#1d15+25');
INSERT INTO `website_shop_objects_templates` VALUES (2805, 15, 'Testicules Magiques du Mulou', 'Personne ne sait exactement quand et comment cela s\'est produit, mais un jour, ces testicules se sont vues dotées de pouvoirs magiques assez obscurs, il faut bien le reconnaître.', 650, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (2806, 15, 'Testicules Magiques du Meulou', 'Aussi étrange que cela puisse paraître, ces testicules sont dotés de pouvoirs magiques. On ne sait pas trop à quoi cela pouvait servir au Meulou, mais mieux vaut ne pas savoir.', 651, 198, '');
INSERT INTO `website_shop_objects_templates` VALUES (2807, 10, 'Ceinture Meulante', 'C\'est Bowisse le Cordonnier en personne, qui a conçu cette ceinture. Il l\'a offerte à Brouce Boulgoure lorsque celui-ci a réussi à déraciner à mains nues le Chêne Mou, il y a de ça très longtemps.', 51, 129, '7c#1f#32#0#1d20+30,70#5#a#0#1d6+4,ae#191#258#0#1d200+400,7d#97#12c#0#1d150+150,f3#b#f#0#1d5+10,f0#b#f#0#1d5+10,f1#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (2808, 10, 'Ceinture Dracochoune', 'Cette ceinture fera de vous une personne irrésistible. Bowisse recommande cependant de ne pas s\'approcher du Dragon Cochon avec cette ceinture, cela pourrait réveiller certaines de ses pulsions les plus tourmentées.', 52, 77, '7b#15#28#0#1d20+20,75#1#2#0#1d2+0,b6#2#3#0#1d2+1,d3#3#5#0#1d3+2,d6#3#5#0#1d3+2,7c#1f#28#0#1d10+30');
INSERT INTO `website_shop_objects_templates` VALUES (2809, 10, 'Ceinture Chafeuse', 'Derrière ce nom assez grotesque, se cache une belle création de Bowisse le Cordonnier qui lors d\'une promenade dans le Donjon des Squelettes a eu l\'idée de récupérer les restes de ses ennemis.', 53, 49, '7d#1f#32#0#1d20+30,76#1a#28#0#1d15+25,73#5#9#0#1d5+4');
INSERT INTO `website_shop_objects_templates` VALUES (2810, 10, 'Ceinture Piquante', 'Cette magnifique ceinture de couleur rousse, vous permettra grâce à ses pouvoirs magiques de mieux vous concentrer et d\'apprendre plus rapidement. Le rêve de tous les cancres d\'Amakna.', 54, 26, '7c#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (2811, 10, 'Ceinture Ouginakale', 'Voilà une ceinture qui saura plaire aux amateurs de sensations fortes. En effet cette dernière a été conçue spécialement pour pouvoir s\'approcher sans risques des Ouginaks. Son efficacité n\'a cependant pas encore été prouvée.', 55, 65, '8a#b#f#0#1d5+10,7b#b#19#0#1d15+10,77#b#19#0#1d15+10,d4#3#5#0#1d3+2,d5#3#5#0#1d3+2,70#1#2#0#1d2+0');
