INSERT INTO `website_shop_objects_templates` VALUES (2998, 57, 'Laine du Minotoror', 'Cette laine exceptionnelle a vécu de grands moments, comme la terrible rencontre avec Vald. Les poils qui la composent sont si drus, qu\'elle lui permet de se protéger mêmes des coups les plus fourbes.', 654, 125, '');
INSERT INTO `website_shop_objects_templates` VALUES (2999, 56, 'Cuir de Minotoror', 'Ce cuir est aussi résistant que les fortifications de Brâkmar. Ses propriétés intrinsèques plutôt méconnues, lui permettent d\'être facilement travaillé pour réaliser les objets les plus prestigieux.', 655, 125, '');
INSERT INTO `website_shop_objects_templates` VALUES (3000, 15, 'Casque cassé de Bwork', 'Dans la tribu Bwork, ce sont les Bworks Mages qui s\'occupent de la forge. Travail de grande qualité, le casque est donné à la naissance pour le protéger très vite des chutes diverses et des coups de marteaux.', 646, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (3001, 15, 'Epaulette de Bwork', 'L\'Epaulette est principale pour l\'éducation, bien que chez eux, ce terme n\'est pas approprié. Ce serait plutôt de l\'entraînement.', 647, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (3002, 15, 'Botte trouée de Bwork', 'Cette botte est inutilisable dans cet état. Une fois correctement rapiécée par un cordonnier expérimenté, vous pourrez peut-être lui trouver une utilité. En attendant, son odeur peut vous servir à repousser les avances des gens un peu trop entreprenants.', 648, 43, '');
