INSERT INTO `website_shop_objects_templates` VALUES (3202, 6, 'Epée de Zemuz', '#1', 40, 150, '62#17#33#0#1d29+22,76#7#1e#0#1d24+6,77#19#78#0#1d96+24,7c#4#f#0#1d12+3,99#2e#3c#0#1d15+45,32c#4c#0#0#0d0+76');
INSERT INTO `website_shop_objects_templates` VALUES (3203, 9, 'Anneau Tribal', 'L\'origine de cet anneau est pour le moins douteuse, on pense qu\'il a appartenu à une tribu de Sadidas Kannibouls végétariens mangeurs de fougères de la pire espèce qui soit. Sûrement une histoire pour faire peur aux jeunes Sadidas.', 49, 51, '7d#6#f#0#1d10+5,7c#6#f#0#1d10+5,73#2#3#0#1d2+1,70#2#0#0#0d0+2,b6#1#0#0#0d0+1,ae#65#96#0#1d50+100');
INSERT INTO `website_shop_objects_templates` VALUES (3204, 10, 'Ceinture Bontarienne', 'C\'est la ceinture la plus à la mode dans les rues de Bonta. Elle est ornée au niveau de la boucle, de l\'insigne d\'une célèbre confrérie de cordonniers.', 37, 53, 'ae#65#96#0#1d50+100,b7#3#5#0#1d3+2,7e#10#1e#0#1d15+15,d5#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (3205, 10, 'Ceinture Brâkmarienne', 'C\'est la ceinture la plus en vogue dans les égouts de Brâkmar. Pour donner l\'impression d\'être un dur à cuir, elle est parfaite. Pour faire de vous un dur à cuir, vous pouvez trouver mieux.', 38, 53, 'ae#65#96#0#1d50+100,b8#3#5#0#1d3+2,76#10#1e#0#1d15+15,d2#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (3206, 10, 'La Xerbo', 'Créée spécialement pour récompenser les guerriers les plus habiles de leurs mains, elle se porte sans sous-vêtements et uniquement en hiver.', 39, 67, '77#15#23#0#1d15+20,76#15#23#0#1d15+20,7c#b#14#0#1d10+10,70#3#5#0#1d3+2,8a#3#5#0#1d3+2,b6#1#0#0#0d0+1,9e#97#fa#0#1d100+150,d4#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (3207, 11, 'Bottes de Satisfaction', 'Ces bottes sont si confortables, si légères, que l\'on ne peut qu\'en être satisfait. Seul un adversaire pourrait ne pas être satisfait si vous lui faites voir vos semelles d\'un peu trop près. Et encore ce n\'est pas dit.', 38, 17, '80#1#0#0#0d0+1,9a#15#32#0#1d30+20,98#15#32#0#1d30+20,9d#15#32#0#1d30+20,9b#15#32#0#1d30+20');
INSERT INTO `website_shop_objects_templates` VALUES (3208, 56, 'Slip de Bwork Archer', 'Le Bwork Archer avait la fâcheuse habitude de se servir de son slip en cuir pour ranger ses flèches. C\'est peut-être finalement ce qui explique pourquoi les flèches du Bwork Archer sont réputées empoisonnées.', 649, 23, '');
INSERT INTO `website_shop_objects_templates` VALUES (3209, 15, 'Scalp de Bwork Mage', 'Très tôt, les jeunes Enutrofs cherchent à s\'approprier un Scalp de Bwork Mage pour dissimuler leur calvitie naissante. Affublés d\'une telle cochonnerie, ils paraissent encore plus ridicules qu\'en temps normal, mais l\'odeur de Bwork qui s\'en dégage permet de couvrir facilement leur haleine régulièrement imprégnée d\'alcool.', 653, 23, '');
