INSERT INTO `website_shop_objects_templates` VALUES (3356, 8, 'Pelle Doudesque', 'Rien de mieux pour avoir la \"doudi-attitude\", que d\'utiliser cette pelle surprenante. On se moquera peut-être de vous, mais qu\'importe, il est temps d\'assumer votre style et vos goûts différents.', 27, 52, '64#b#1e#0#1d20+10,7d#10#23#0#1d20+15,7b#10#23#0#1d20+15,70#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (3357, 7, 'Marteau Tape Doigts', 'En Amakna, lorsque les jeunes écoliers ne sont pas sages ou ne comprennent rien, on leur tape les doigts avec ce marteau. Celui-ci a écrasé surtout des doigts de Iops.', 29, 49, '64#10#19#0#1d10+15,ae#33#64#0#1d50+50,8a#1#5#0#1d5+0,70#1#0#0#0d0+1,7e#10#19#0#1d10+15,76#10#19#0#1d10+15');
