INSERT INTO `website_shop_objects_templates` VALUES (3646, 5, 'Dague de Tuplylo', '#1', 26, 100, '32c#33#0#0#0d0+51,62#b#15#0#1d11+10,9d#1f#28#0#1d10+30,7e#b#14#0#1d10+10,77#b#3c#0#1d50+10,7b#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (3647, 5, 'La Thor-Boyaux', 'Cette dague en forme de faucille, servait à éviscérer les voyageurs égarés. Elle tire son nom, de toutes les beuveries à la taverne que son propriétaire se payait après avoir dépouillé ses pauvres victimes.', 31, 83, '7d#15#28#0#1d20+20,76#15#1e#0#1d10+20,64#e#17#0#1d10+13,77#15#1e#0#1d10+20,70#3#4#0#1d2+2,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (3648, 5, 'Daguette du Captain Chafer', 'Si le Captain Chafer a disparu, sa dague elle, est bien entre vos mains. Si son manche est passé entre les mains du célèbre Captain Chafer, imaginez où la lame a pu passer...', 32, 83, '64#f#16#0#1d8+14,7d#15#28#0#1d20+20,7c#10#19#0#1d10+15,77#15#28#0#1d20+20,73#3#4#0#1d2+2,8a#6#a#0#1d5+5,ae#65#c8#0#1d100+100');
INSERT INTO `website_shop_objects_templates` VALUES (3649, 5, 'Dague Rafeuse', 'C\'est le célèbre artisan Daguiero qui eut l\'idée de créer une telle dague. Plutôt versé dans les jeux d\'argents et activités peu recommandables, ce fut sa dernière création réellement digne d\'intérêt. On peut imaginer pire comme fin de carrière.', 33, 95, '62#6#9#0#1d4+5,64#6#9#0#1d4+5,70#4#6#0#1d3+3,76#15#28#0#1d20+20,77#15#1e#0#1d10+20,7b#15#1e#0#1d10+20,b0#6#a#0#1d5+5,b8#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (3650, 5, 'Dague Régah', 'Ces puissantes dagues sont le fruit d\'une coopération entre les seuls artisans capables de se mettre d\'accord sur l\'avenir de leur profession. Ils ne furent que deux. Ils moururent tous les deux en se disputant à propos du nom de ces dagues.', 34, 120, '62#b#14#0#1d10+10,5f#3#4#0#1d2+2,76#15#28#0#1d20+20,77#15#28#0#1d20+20,70#6#a#0#1d5+5,b0#b#f#0#1d5+10,d4#6#a#0#1d5+5,d5#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (3651, 5, 'Dague Lutination', 'Un ridicule petit artisan du nom de Slaillehine, a eu la brillante idée de bricoler ces superbes dagues. Du jour au lendemain, tout le monde faisait la queue devant sa forge, c\'est comme cela qu\'il a trouvé un nom pour cette dague.', 35, 90, '64#a#e#0#1d5+9,5d#2#4#0#1d3+1,7d#15#28#0#1d20+20,7c#10#19#0#1d10+15,77#10#1e#0#1d15+15,ae#c9#190#0#1d200+200,d6#3#5#0#1d3+2,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (3652, 4, 'Bâton de Marie Aigue', 'Marie Aigue savait y faire avec les hommes, son bâton savait repousser les avances des plus grands chevaliers Iops. Ce fut bien plus tard que l\'on découvrit que Marie Aigue n\'était autre qu\'un garçon, habillé en fille.', 30, 112, '7c#15#23#0#1d15+20,7e#1f#32#0#1d20+30,77#15#28#0#1d20+20,73#6#a#0#1d5+5,8a#6#a#0#1d5+5,b0#6#a#0#1d5+5,d4#3#5#0#1d3+2,64#10#1e#0#1d15+15');
