INSERT INTO `website_shop_objects_templates` VALUES (4241, 6, 'Griffe Rose', 'Cette épée, d\'une couleur peu commune, permet d\'attendrir l\'ennemi avant d\'attendrir sa chair. Comme le ferait une douce Ecaflipette. Sa teinte particulière est obtenue en trempant la lame dans des viscères de monstres pendant plusieurs centaines d\'années.', 41, 100, '61#1f#32#0#1d20+30,76#29#46#0#1d30+40,7c#15#28#0#1d20+20,7d#1f#3c#0#1d30+30');
INSERT INTO `website_shop_objects_templates` VALUES (4242, 6, 'Eventail Tranchant', 'A l\'origine, cette épée était un accessoire utile pour s\'aérer le visage. Il suffisait juste de l\'agiter avec vigueur. Après que quelques têtes sont tombées, il fut admis qu\'utiliser du métal pour ce genre d\'objet n\'était pas une bonne idée.', 24, 75, '64#1a#28#0#1d15+25,76#1f#28#0#1d10+30,7e#1f#28#0#1d10+30,77#1f#28#0#1d10+30,7b#1f#28#0#1d10+30,7c#1f#28#0#1d10+30,b1#1f#28#0#1d10+30');
