INSERT INTO `website_shop_objects_templates` VALUES (4381, 1, 'Amulette Argie', 'Cette étrange amulette, permet à son porteur de s\'endormir pour une bonne sieste en plein combat. Un peu comme un Féca le ferait contre un groupe de Craqueleurs.', 54, 82, 'b7#6#a#0#1d5+5,b8#6#a#0#1d5+5,d5#3#5#0#1d3+2,d3#3#5#0#1d3+2,d4#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (4382, 6, 'Pic à Glace', 'Cette épée, à la lame froide et pointue, fait ressurgir les instincts les plus basiques de celui qui la porte. Chaque geste, si anodin soit-il, est alors exécuté comme un coup bas. Il vous faudra renforcer votre esprit pour résister à cette lame.', 14, 85, '64#1a#1e#0#1d5+25,70#6#a#0#1d5+5,d8#a#f#0#1d6+9');
