INSERT INTO `website_shop_objects_templates` VALUES (6435, 19, 'Hache du Hopap', '#1', 20, 150, '32c#4c#0#0#0d0+76,60#12#27#0#1d22+17,9b#10#14#0#1d5+15,7c#19#5f#0#1d71+24,7b#9#1e#0#1d22+8');
INSERT INTO `website_shop_objects_templates` VALUES (6436, 19, 'Hache de Ucibatev', '#1', 23, 150, '32c#4c#0#0#0d0+76,64#17#26#0#1d16+22,9d#9#a#0#1d2+8,6e#46#0#0#0d0+70,7e#64#0#0#0d0+100,77#3c#0#0#0d0+60');
INSERT INTO `website_shop_objects_templates` VALUES (6437, 19, 'Hache d\'Ikalugi', '#1', 21, 150, '63#16#25#0#1d16+21,77#6#14#0#1d15+5,7c#1a#64#0#1d75+25,6e#32#0#0#0d0+50,9d#33#3c#0#1d10+50,98#33#46#0#1d20+50,32c#4c#0#0#0d0+76');
INSERT INTO `website_shop_objects_templates` VALUES (6438, 3, 'Baguette Molle', 'Cette baguette est constituée d\'éléments plutôt mous, ce qui en fait une baguette difficile à manier. Mais au coeur du combat, cette baguette révèle son véritable pouvoir.', 33, 85, '64#b#f#0#1d5+10,7c#15#28#0#1d20+20,7d#29#3c#0#1d20+40,b0#6#a#0#1d5+5,af#1f4#0#0#0d0+500,74#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6439, 3, 'Baguette Irréelle', 'Des mélanges magiques d\'éléments surnaturels ont permis la création de cette baguette qui vogue aux frontières du réel. Tantôt terrifiante, tantôt délirante, cette baguette est l\'exemple typique de l\'instabilité.', 32, 90, '64#1#28#0#1d40+0,7e#1f#32#0#1d20+30,7c#1#1e#0#1d30+0,b7#1#a#0#1d10+0,b8#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (6440, 3, 'Baguette Velue', 'Cette baguette n\'est pas qu\'un vulgaire amas de poils. Le coeur même de la baguette absorbe l\'essence magique des diverses touffes et les fusionne entre elles. Aussi aberrant que cela puisse paraître, ça marche !', 31, 95, '64#10#15#0#1d6+15,d4#3#5#0#1d3+2,d5#3#5#0#1d3+2,d3#3#5#0#1d3+2,d2#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6441, 54, 'Poils de Moon', 'Ces poils sont incroyablement doux et chauds au toucher. On a l\'impression qu\'ils sont encore vivants.', 656, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (6442, 4, 'Bâton d\'Aga Dou', 'Toujours en quête d\'un moyen de surprendre ses ennemis, le Sadida Aga Dou, a pris soin d\'accrocher une petite poupée au bout de son bâton. Les jeunes Iopettes se jettent dessus pour attraper la poupée et meurent empalées.', 31, 81, '64#10#1b#0#1d12+15,75#1#0#0#0d0+1,7c#10#1e#0#1d15+15,7d#15#28#0#1d20+20,b6#1#0#0#0d0+1,76#15#28#0#1d20+20');
INSERT INTO `website_shop_objects_templates` VALUES (6443, 1, 'Amulette du Renouveau', 'C\'est le célèbre et non moins burlesque artisan Yamato, injustement méprisé pour son arc ridicule, qui le premier, eu l\'audace de tenter d\'enchanter une amulette avec autant d\'effets, chose réputée infaisable depuis des lustres.', 57, 126, '76#1f#32#0#1d20+30,7d#29#46#0#1d30+40,7c#1f#28#0#1d10+30,b0#b#f#0#1d5+10,d2#3#5#0#1d3+2,75#1#0#0#0d0+1,6f#1#0#0#0d0+1,70#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6444, 1, 'Amulette Turquoise', 'De la couleur du célèbre Dofus Turquoise, cette amulette n\'a en fait aucun rapport avec ce dernier, ce qui ne l\'empêche pas d\'être très puissante pour autant. Comme quoi, les apparences ne sont pas toujours trompeuses.', 58, 63, '75#1#0#0#0d0+1,77#10#19#0#1d10+15,7b#10#19#0#1d10+15,7d#15#1e#0#1d10+20,7e#15#28#0#1d20+20,b0#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6445, 2, 'Arc Boutant', 'Cet arc a une forme très étudiée, sa courbure est vraiment parfaite. On raconte à ce sujet que le sculpteur d\'arc s\'est servi d\'un fessier de femelle Bouftou comme patron.', 13, 80, '7d#10#1e#0#1d15+15,7b#10#1e#0#1d15+15,73#3#4#0#1d2+2,8a#b#f#0#1d5+10,d5#3#5#0#1d3+2,64#14#1d#0#1d10+19');
INSERT INTO `website_shop_objects_templates` VALUES (6446, 2, 'Arc Chiduc', 'Chiduc était un sculpteur d\'arcs, réputé pour avoir des problèmes de prononciation. Il était en effet incapable de prononcé le son \"ar\" sans rajouter un \"keu\" derrière. C\'était tout de même un grand arctiste.', 14, 87, '7d#10#1e#0#1d15+15,7c#10#1e#0#1d15+15,75#1#0#0#0d0+1,b0#6#a#0#1d5+5,64#11#1f#0#1d15+16');
INSERT INTO `website_shop_objects_templates` VALUES (6447, 43, 'Potion d\'oubli de Chaferfu', 'Cette potion permet d\'oublier un niveau du sort d\'invocation Chaferfu', 36, 50, '2c6#0#0#0#0d0+0,268#175#0#0#0d0+373');
INSERT INTO `website_shop_objects_templates` VALUES (6448, 43, 'Potion d\'oubli d\'Invocation d\'Arakne', 'Cette potion permet d\'oublier un niveau du sort d\'invocation d\'Arakne.', 36, 50, '2c6#0#0#0#0d0+0,268#172#0#0#0d0+370');
INSERT INTO `website_shop_objects_templates` VALUES (6449, 17, 'Corbacape', 'De quoi ressembler à une ombre, ou se déguiser en Maître Corbac pour impressionner les filles à la sortie de la Boulangerie avant la tombée de la nuit.', 54, 45, '7c#6#14#0#1d15+5,d4#1#7#0#1d7+0,77#15#23#0#1d15+20,70#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (6450, 10, 'Ceinture de l\'Amant d\'Ha', 'La célèbre Cordonnière Ha, avait un amant connu pour lui faire faux bond au dernier moment. Mais l\'amour l\'aveuglant, elle lui offrit tout de même cette magnifique ceinture comme témoin de leur union secrète.', 57, 121, '7d#47#64#0#1d30+70,7c#1f#32#0#1d20+30,d2#4#5#0#1d2+3,d3#4#5#0#1d2+3,d5#4#5#0#1d2+3,b0#9#d#0#1d5+8,b7#6#a#0#1d5+5,70#6#8#0#1d3+5');
INSERT INTO `website_shop_objects_templates` VALUES (6451, 2, 'Arc Ange', 'A propos de cet arc, on est en droit de se demander pourquoi son nom est aussi stupide. Il en est de même pour vous.', 31, 82, '7d#15#23#0#1d15+20,7c#b#14#0#1d10+10,7e#15#23#0#1d15+20,7b#15#23#0#1d15+20,ae#33#64#0#1d50+50,b7#3#5#0#1d3+2,64#11#1f#0#1d15+16');
INSERT INTO `website_shop_objects_templates` VALUES (6452, 2, 'Arc Chitecte', 'Cet arc à l\'apparence complexe est un véritable objet d\'art. Le sculpteur d\'arc qui l\'a créé est également célèbre pour avoir exposé ses modèles les plus controversés dans la fameuse grotte de Loopine, interdite au public non averti depuis des lustres.', 30, 120, '64#13#21#0#1d15+18,76#1f#2d#0#1d15+30,7c#10#23#0#1d20+15,77#1f#2d#0#1d15+30,75#1#0#0#0d0+1,b0#9#a#0#1d2+8,d4#3#5#0#1d3+2,79#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6453, 2, 'Arc du Pêcheur', 'Issu d\'un constat frappant (l\'arc est très utile pour pêcher les poissons volants), cet arc est muni d\'une canne à pêche intégrée qui permet de pêcher d\'autres choses que des poissons volants.', 32, 70, '76#15#28#0#1d20+20,ae#32#64#0#1d51+49,75#1#0#0#0d0+1,73#3#5#0#1d3+2,8a#5#6#0#1d2+4,64#d#16#0#1d10+12');
INSERT INTO `website_shop_objects_templates` VALUES (6454, 4, 'Abraton Sombre', 'Cette branche d\'Abraknyde Sombre est en fait l\'un de ses bras. Excellente pour s\'entraîner au bras de fer, c\'est surtout une excellente arme pour terroriser vos ennemis d\'enfance ou torturer les Tronknydes.', 23, 87, '64#f#1d#0#1d15+14,65#1#0#0#0d0+1,76#15#23#0#1d15+20,7e#15#23#0#1d15+20,77#15#23#0#1d15+20,b6#1#0#0#0d0+1,79#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (6457, 40, 'Kriptonite', 'Voici un alliage remarquable, dont l\'origine semble vraiment lointaine. A défaut d\'être utile, il pourra toujours servir à décorer sa cheminée ou à taper sur le crâne des Iops, ne serait-ce que pour s\'assurer qu\'ils sont bel et bien vides.', 706, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (6458, 40, 'Kobalite', 'De tous les alliages découverts à ce jour, la Kobalite est un des plus surprenants. Les anciens mineurs pensaient avoir trouvé l\'alliage idéal, jusqu\'au jour où l\'on s\'aperçut qu\'il se transformait en poussière au contact de la Bave de Bouftou.', 704, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (6459, 1, 'Amulette du Mineur Sombre', 'La seule chance de survivre dans une mine infestée de Mineurs Sombres, c\'est d\'y voir clair. A défaut de leur voler leur bougie, portez cette amulette, elle vous portera chance.', 61, 39, '7b#15#23#0#1d15+20,b0#6#a#0#1d5+5,d8#6#a#0#1d5+5,d7#6#a#0#1d5+5,d9#6#a#0#1d5+5,da#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6460, 1, 'La Feuille d\'Hiver', 'Cette magnifique broche est un hommage à la célèbre résistance des mineurs de la mine d\'argent de Grimoth, qui passèrent un hiver entier, à combattre un Rockailleux de la pire espèce, pour finalement mourir achevés par un vieux Tofu égaré.', 65, 98, '70#3#7#0#1d5+2,7b#15#28#0#1d20+20,7c#b#14#0#1d10+10,7d#15#28#0#1d20+20,8a#3#5#0#1d3+2,b0#6#f#0#1d10+5,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6461, 1, 'La Feuille de Printemps', 'Cette Amulette spécialement conçue pour les vieux Enutrofs, a permis il y a bien longtemps à Setag, de nettoyer la mine de Grimoth, de tous ses rivaux mineurs. Une méthode certes peu raisonnable, mais terriblement efficace.', 62, 123, '6f#1#0#0#0d0+1,70#6#a#0#1d5+5,75#1#2#0#1d2+0,77#1f#32#0#1d20+30,7d#29#46#0#1d30+40,b0#b#f#0#1d5+10,d3#3#5#0#1d3+2,d5#3#5#0#1d3+2,7b#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (6462, 1, 'La Feuille d\'Eté ', 'Cette petite broche a vraiment du charme, destinée à la base pour les malchanceux fermement décidés à participer aux jeux de la fête foraine, on a vite remarqué, qu\'elle était également bien adaptée pour les chasses épiques.', 63, 45, 'd7#6#a#0#1d5+5,b0#4#a#0#1d7+3,7b#10#1e#0#1d15+15,7e#10#1e#0#1d15+15,da#6#a#0#1d5+5,d9#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6463, 9, 'Anneau Forain', 'Cet anneau a été créé par un célèbre forain, dont personne ne se rappelle le nom. Il est mort lors du concours de tir à l\'arc, en mettant comme cible sur sa tête, une Graine de Tournesol Sauvage à la place de la traditionnelle Citrouille.', 50, 44, 'b7#2#3#0#1d2+1,8a#3#5#0#1d3+2,7b#b#19#0#1d15+10,d4#1#3#0#1d3+0,7d#10#1e#0#1d15+15');
INSERT INTO `website_shop_objects_templates` VALUES (6464, 9, 'Anneau de l\'Invocateur Satisfait', 'Cet anneau est une version améliorée du célèbre Anneau de Satisfaction. Idéal pour laisser à vos petites bestioles le soin de faire le combat à votre place, ou tout simplement pour faire le malin en invoquant une armée de Tofus.', 51, 40, '9b#c8#0#0#0d0+200,98#c8#0#0#0d0+200,9d#c8#0#0#0d0+200,9a#c8#0#0#0d0+200,b6#1#0#0#0d0+1,6f#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6465, 9, 'Anneau de Loopine', 'Loopine a jadis demandé comment créer un tel anneau au monstre qui hante sa grotte en échange de quelques services à rendre, qui l\'ont changé à jamais. Les gens avertis vous diront qu\'il a perdu au change...', 52, 80, '7b#15#1e#0#1d10+20,70#2#4#0#1d3+1,ae#65#c8#0#1d100+100,d2#1#3#0#1d3+0,b0#6#f#0#1d10+5,d4#1#3#0#1d3+0,7c#6#a#0#1d5+5,7d#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (6466, 1, 'Amulette de Shika', 'Cette amulette a permis à de nombreuses reprises à Shika Ingalsse, de survivre aux rebellions des troupeaux de Bouftous bien décidés à lui mener la vie dure.', 60, 29, '7c#6#a#0#1d5+5,7d#b#14#0#1d10+10,ae#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (6467, 9, 'Anneau Nime', 'Personne ne connaît le propriétaire de cet anneau, qui a tenu a garder l\'anonymat suite à un combat humiliant face à une Arackne invoquée. Cependant, il faut avouer que cette dernière venait d\'être compulsée par un Iop.', 53, 70, '7b#10#19#0#1d10+15,7c#6#a#0#1d5+5,7d#10#19#0#1d10+15,7e#10#19#0#1d10+15,ae#1f#32#0#1d20+30,b0#6#a#0#1d5+5,b7#3#5#0#1d3+2,b8#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6468, 9, 'Anneau du Jeune Vald', 'A l\'époque où tous les Iops de son âge recevaient pour leur communion, une monture Tabi, ou une Goultard en bois, Vald lui a reçu cet anneau. C\'est un peu moins marrant pour jouer avec ses petits camarades, mais c\'est plus utile en plein combat.', 54, 59, '73#2#3#0#1d2+1,76#10#19#0#1d10+15,77#10#19#0#1d10+15,7c#b#f#0#1d5+10,7d#10#19#0#1d10+15,b0#2#3#0#1d2+1,d3#2#3#0#1d2+1,d5#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (6469, 9, 'Alliance de Farle', 'Cette alliance a été usée par le frottement des épis d\'escourgeon pendant des centaines de moissons. Elle est également le témoin, de l\'union entre Farle et Shika, lorsqu\'ils se sont mariés au milieu d\'un champs d\'orge de printemps.', 55, 87, '70#3#4#0#1d2+2,73#4#5#0#1d2+3,76#15#1e#0#1d10+20,7c#10#19#0#1d10+15,7d#1a#28#0#1d15+25,8a#4#5#0#1d2+3,b0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6470, 11, 'Bottes de l\'Eleveur de Bouftous', 'Ces magnifiques bottes, sont parfaites pour botter le derrière des Bouftous lorsqu\'il faut les forcer à changer de pâtures et à traverser le village. Elles fonctionnent également pour forcer les enfants Iops à faire leurs devoirs et à aller à l\'école.', 40, 68, '7b#10#19#0#1d10+15,80#1#0#0#0d0+1,7d#15#1e#0#1d10+20,b6#1#2#0#1d2+0,7c#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6471, 11, 'Souliers Vernis de Porkass', 'Ces petits souliers ont été renforcés, remis en état, mais surtout désodorisés. Ils sont surtout utilisés pour attirer les Champ-Champ, tant le substrat laissé par le Porkass leur semble appétissant.', 41, 30, '77#6#a#0#1d5+5,7b#6#a#0#1d5+5,76#6#a#0#1d5+5,7e#6#a#0#1d5+5,7d#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (6472, 16, 'Dragocoiffe Dorée', 'Cette coquille de Dragoeuf Doré rembourrée, vous rend presque insensible aux coups de foudre magiques du Bwork Mage. En revanche, il ne vous protège en rien contre les vrais coups de foudre...', 55, 57, '7d#10#1e#0#1d15+15,7e#10#1e#0#1d15+15,b7#3#5#0#1d3+2,d5#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (6473, 16, 'Dragocoiffe de Saphire', 'Cette coquille de Dragoeuf de Saphire vous ira à merveille si vous savez la porter. Arborer une telle coiffe n\'est pas à la portée de tout le monde, la preuve, les Iops ont tendance à la porter à l\'envers.', 57, 70, '7d#1f#32#0#1d20+30,7b#15#23#0#1d15+20,70#2#3#0#1d2+1,b6#1#2#0#1d2+0,b8#3#5#0#1d3+2,d3#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (6474, 16, 'Dragocoiffe noire', 'Cette coquille de Dragoeuf Noir est idéale pour rester discret la nuit, ou se protéger des chutes de pierres, courantes en montagne, ou lorsque l\'on défie un Craqueleur au lancer de rochers.', 56, 93, '7d#1f#32#0#1d20+30,7c#6#f#0#1d10+5,7b#15#28#0#1d20+20,70#3#7#0#1d5+2,8a#6#a#0#1d5+5,75#1#0#0#0d0+1,b0#6#f#0#1d10+5,d2#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (6475, 15, 'Casque Cassé du Chafer', 'Ce casque est inutilisable dans cet état, il vous ferait bien trop mal à la tête. Un bon Tailleur devrait pouvoir le réparer, mettre un bon rembourrage à l\'intérieur et au passage se faire beaucoup de kamas sur votre dos.', 709, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (6476, 15, 'Bougie Magique du Mineur Sombre', 'Cette bougie brille même lorsqu\'elle est éteinte, et ne dégage pas de chaleur. On peut juste si l\'on tend l\'oreille, entendre un léger crépitement, un peu comme le bruit de certaines céréales dans un bol de lait.', 701, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (6477, 16, 'Chapeau du Mineur Sombre', 'Ce somptueux chapeau vous permet d\'y voir plus clair même lorsqu\'il fait déjà assez clair. Il est également très utile pour éblouir les bêtes qui hantent les mines mal famées, ou tout simplement, pour faire croire aux Iops que vous êtes une lumière.', 90, 103, '7c#15#28#0#1d20+20,7b#1f#32#0#1d20+30,75#1#0#0#0d0+1,b0#6#f#0#1d10+5,70#3#5#0#1d3+2,d5#3#5#0#1d3+2,d3#3#5#0#1d3+2,d2#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6478, 15, 'Makroute Déchiqueté ', 'Ce Makroute magique est vraiment dans un très mauvais état, il n\'a pas supporté la violence de vos attaques et son poil est devenu sombre. Une nouvelle vie pourrait peut-être s\'offrir à lui si vous étiez capable de le soigner.', 702, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (6479, 15, 'Ours Déchiqueté ', 'Cette petite tête d\'Ours est vraiment dans un très mauvais état. Un peu de fil, de tissu et d\'inventivité auront raison de cette horreur et pourront la transformer en un remarquable couvre-chef.', 703, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (6480, 15, 'Osier Sombre', 'Ce morceau d\'osier est sombre comme le plus sombre des fantômes, magique, comme le plus magique des fantômes, résistant comme le plus résistant des fantômes. Rappelez-vous que les fantômes n\'existent pas.', 123, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (6481, 16, 'Dora Bora', 'Ce splendide chapeau a été imaginé sur l\'île de Dora Bora un peu au sud de l\'île de Moon. Parfaitement adapté au combat, il est également très apprécié comme corbeille à fruits, pour entreposer les noix de Kokokos Traumatisées par exemple.', 61, 120, '76#3d#50#0#1d20+60,7c#29#3c#0#1d20+40,7e#3d#50#0#1d20+60,b0#6#f#0#1d10+5,d2#3#5#0#1d3+2,d4#3#5#0#1d3+2,d6#3#5#0#1d3+2,70#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6482, 16, 'Korko Kousto', 'Version retravaillée du Jouik Krampe, ce chapeau utilise les meilleurs ressources de l\'île de Moon, ce qui lui donne un cachet très terroir reconnaissons-le. A défaut de ressembler à un Kanniboul, vous pourrez sortir de très bons coups de boule.', 59, 73, '7d#15#28#0#1d20+20,70#3#7#0#1d5+2,b6#2#3#0#1d2+1,7e#15#28#0#1d20+20,7c#10#19#0#1d10+15,76#15#28#0#1d20+20');
INSERT INTO `website_shop_objects_templates` VALUES (6483, 16, 'Casque du Bwork de Bronze', 'Ce surprenant casque transforme son propriétaire en Bwork de Bronze selon la légende. A essayer d\'urgence sur les gros lourds, vous pourrez les refondre ensuite et en tirer un bon prix.', 91, 144, '7d#97#c8#0#1d50+150,7c#1a#28#0#1d15+25,7e#1f#32#0#1d20+30,7b#1f#32#0#1d20+30,f4#10#14#0#1d5+15,ae#12c#0#0#0d0+300,b0#10#19#0#1d10+15,f3#10#14#0#1d5+15');
INSERT INTO `website_shop_objects_templates` VALUES (6484, 2, 'Arc du Sram Archer', 'Quand les dagues ne suffisent plus, que les dieux se moquent de vous, à vous de rechercher votre propre style de combat. Certains Srams l\'ont bien compris, d\'autres espèrent que les dieux leur viennent en aide.', 40, 90, '64#10#17#0#1d8+15,5d#2#3#0#1d2+1,77#b#14#0#1d10+10,76#b#14#0#1d10+10,7d#15#1e#0#1d10+20,7c#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (6485, 2, 'Arc du Chafer Archer', 'Le Chafer Archer, n\'aura jamais été assez astucieux et habile à cause de ses os tremblants, pour manier un tel arc. Excepté pour le problème des os tremblants, il est probable que vous soyez dans le même cas que ce ridicule Chafer.', 39, 120, '62#7#e#0#1d8+6,64#7#e#0#1d8+6,7c#15#28#0#1d20+20,77#15#28#0#1d20+20,7b#15#28#0#1d20+20,75#1#0#0#0d0+1,b0#b#f#0#1d5+10,70#5#8#0#1d4+4');
INSERT INTO `website_shop_objects_templates` VALUES (6486, 96, 'Ecorce du Chêne Mou', 'Cette écorce est plus résistante que n\'importe quelle autre écorce, elle respire la puissance. En revanche, rien n\'indique que ce n\'est pas une fausse écorce d\'Abraknyde repeinte. Il serait peut-être temps d\'arnaquer à votre tour un ami.', 666, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (6487, 108, 'Bourgeon du Chêne Mou', 'Cet énorme bourgeon gorgé de sève chaude et sirupeuse, devrait vous rappeler vos biberons d\'enfance si vous vous risquez à aspirer son contenu. Dans un deuxième temps, vous vous transformerez peut-être en feuille morte.', 665, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (6488, 98, 'Racine du Chêne Mou', 'Certains tenteront de faire de la bière avec cette racine. C\'est fortement déconseillé, le Chêne Mou ne tenant pas du tout l\'alcool, ces racines risquent de devenir très instables au contact de la moindre goutte d\'alcool. Un peu comme un Sadida.', 667, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (6489, 38, 'Bois de Chêne Mou', 'Ce bois-là a vu la Hache de Brouce Boulgoure, et de très près. Il a également connu d\'autres choses mystérieuses et intrigantes, que même le livre du Bwork Mage se refuse de révéler. On est en droit de s\'imaginer le pire.', 668, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (6490, 50, 'Ambre du Chêne Mou', 'Cette Ambre contient une misérable bestiole prise dans la résine. Ce bijou du Chêne Mou est une pièce de collection, au même titre que les chaussettes rouges et jaunes à petits pois du Chouque.', 669, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (6491, 2, 'Le Tronknydum', 'Cet arc est issu du croisement raté d\'un Tronknyde et d\'un Abraknyde. Pour un Bûcheron, il s\'agit de toute évidence d\'un échec mais pour un Sculpteur d\'Arcs, c\'est une vraie réussite. Vos parents auraient aimé pouvoir en dire autant de vous.', 41, 57, '5f#2#4#0#1d3+1,b6#1#2#0#1d2+0,7d#15#1e#0#1d10+20,70#2#4#0#1d3+1');
INSERT INTO `website_shop_objects_templates` VALUES (6492, 4, 'Bâton du Wobot', 'L\'écart entre les deux pointes de ce bâton correspond à celui des yeux de Lenalds... Mais jusqu\'où iront ces howibles Wabbits ?', 37, 60, '64#e#17#0#1d10+13,77#b#14#0#1d10+10,73#1#0#0#0d0+1,b6#1#0#0#0d0+1,b8#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (6493, 11, 'Tongues Wabbits', 'Adoptez la \"Cawotte attitude\" avec ces tongues wabbits issues de la dernière collection. Elles sont recommandées par tous les experts en claquettes, en danses rituelles, et en Tango rapide du Captain Chafer.', 39, 60, '7e#15#23#0#1d15+20,70#3#5#0#1d3+2,ae#33#64#0#1d50+50,d2#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6494, 3, 'Baguette d\'Elya Wood', 'Utilisée par les plus célèbres Eniripsas d\'Amakna, cette baguette constitue l\'arme idéale pour envoyer un sortilège sur ses adversaires ou tenter de rendre plus intelligents ses propres amis. Ainsi, vous pouvez transformer un Iop en citrouille.', 39, 120, '63#7#b#0#1d5+6,64#7#b#0#1d5+6,7c#15#28#0#1d20+20,7e#15#28#0#1d20+20,70#6#a#0#1d5+5,75#1#0#0#0d0+1,b0#6#a#0#1d5+5,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6495, 3, 'Baguette du Chêne Mou', 'Fabriquée à partir de restes du Chêne Mou ayant repris vie, cette baguette est tout simplement surpuissante. Il suffit de l\'agiter à droite puis à gauche avec le bon rythme, pour déclencher des pluies de crapauds ou passer pour un idiot notoire.', 42, 172, '63#1#19#0#1d25+0,5b#1#f#0#1d15+0,ae#65#c8#0#1d100+100,7e#1f#32#0#1d20+30,7c#1f#32#0#1d20+30,b2#8#a#0#1d3+7,7b#1f#32#0#1d20+30,7d#97#fa#0#1d100+150,d5#6#7#0#1d2+5,d3#6#7#0#1d2+5,d9#6#7#0#1d2+5,d7#6#7#0#1d2+5');
INSERT INTO `website_shop_objects_templates` VALUES (6496, 3, 'Baguette en Racine d\'Abraknyde Sombre', 'Cette baguette a parfois tendance à reprendre vie et se révolter contre son maître. Dans ce cas-là, la meilleure chose à faire reste de la donner à votre ennemi, ou à un Iop qui pensera que vous lui faîtes un cadeau.', 40, 67, '63#c#10#0#1d5+11,7e#b#14#0#1d10+10,7c#1f#28#0#1d10+30,9a#15#28#0#1d20+20,98#15#28#0#1d20+20,9d#15#28#0#1d20+20');
INSERT INTO `website_shop_objects_templates` VALUES (6497, 3, 'Balgourde des Clairettes', 'La femme de Brouce Boulgoure, une Eniripsa, ne cessait de lui voler sa célèbre hache. Pour mettre un terme à ces bêtises, il lui coupa une aile et un bras et pour s\'excuser, il lui offrît cette Baguette. Voilà un homme qui savait y faire avec les femmes.', 43, 63, '63#8#14#0#1d13+7,7e#10#23#0#1d20+15,8a#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (6498, 10, 'Slip Kangouwou du Wabbit GM', 'De taille plus que respectable, ce magnifique slip comporte encore les traces du passage de son ancien propriétaire et quelques poils bien étranges. Sur les fesses ou sur la tête, ce slip fera de vous une personnalité respectée de tout Amakna.', 58, 60, '7d#15#1e#0#1d10+20,7c#b#1e#0#1d20+10,73#3#9#0#1d7+2,b0#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (6499, 1, 'Amulette \"Dents de Wabbits\"', 'Les dents de cette amulette ont rongé plus de Cawottes que Brouce Boulgoure n\'a déraciné d\'arbres, ne vous étonnez donc pas si vous sentez la Cawotte, et si les Tiwabbits cherchent à vous faire des bisous dans le cou.', 59, 60, '76#15#1e#0#1d10+20,7d#15#1e#0#1d10+20,77#15#1e#0#1d10+20,7b#15#1e#0#1d10+20,8a#1#5#0#1d5+0,75#1#0#0#0d0+1,b6#1#0#0#0d0+1,ae#65#c8#0#1d100+100');
INSERT INTO `website_shop_objects_templates` VALUES (6500, 16, 'Oreilles de Wabbits', 'Ces oreilles ne vous permettront pas de mieux entendre, mais permettront à vos amis de mieux vous retrouver dans la foule, et à vos ennemis, de mourir de rire. Une paire d\'oreilles qui s\'avère avec le temps vraiment indispensable.', 52, 60, '7c#b#28#0#1d30+10,7b#10#19#0#1d10+15,b0#1#8#0#1d8+0,d3#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6501, 81, 'Sac-Cawotte', 'Avec ce sac sur les épaules, vous pouvez partir à l\'aventure sans vous soucier des problèmes alimentaires. En effet, même si la Cawotte est vide comme un crâne de Iop, les feuilles du dessus repoussent toutes seules, de quoi se faire de bonnes tisanes.', 57, 60, '9e#1f5#3e8#0#1d500+500,d2#3#5#0#1d3+2,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6503, 7, 'Marteau Polpoulette', 'La Polpoulette est le résultat d\'un croisement entre un Kwak de Feu agressif et un Tofu maladif. Depuis la nuit des temps, la chasse à la Polpoulette est considérée comme un rituel immuable, chasser cette horrible créature est un vrai plaisir.', 35, 57, '63#5#9#0#1d5+4,64#5#9#0#1d5+4,7e#b#14#0#1d10+10,ae#33#64#0#1d50+50,b6#1#0#0#0d0+1,8a#3#7#0#1d5+2');
INSERT INTO `website_shop_objects_templates` VALUES (6504, 7, 'Marteau Fantal', 'On ne connaît que le diminutif de son créateur, un certain Fantal, mais on sait qu\'il avait très mauvais goût. En effet, il appréciait s\'enduire de Gelée Royale pour ensuite se recouvrir de plumes de Tofu Royal. Et oui en plus, il avait des goûts de luxe.', 36, 81, '64#15#26#0#1d18+20,76#15#23#0#1d15+20,7d#15#28#0#1d20+20,7c#10#19#0#1d10+15,b6#1#2#0#1d2+0,b0#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6505, 7, 'Marteau Réhadaure', 'Pour lutter contre les bêtes à cornes, ce marteau est idéal. En revanche, pour planter des clous, ou des choux, même à la mode de chez nous, c\'est une autre histoire.', 37, 100, '60#b#f#0#1d5+10,63#b#f#0#1d5+10,7b#15#28#0#1d20+20,7d#15#28#0#1d20+20,7c#10#1e#0#1d15+15,70#3#5#0#1d3+2,75#1#0#0#0d0+1,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6506, 9, 'Anneau du Mineur Gogorifiant', 'Chez les Enutrofs, on dit qu\'un mineur est gogorifié lorsqu\'il ne supporte plus la lumière du jour, à force de travailler dans sa mine. Ne tentez jamais d\'approcher une bougie d\'un tel mineur, il vous transformerait en bronze.', 40, 84, '70#3#4#0#1d2+2,73#1#2#0#1d2+0,7c#10#19#0#1d10+15,7d#10#19#0#1d10+15,ae#33#64#0#1d50+50,b0#b#f#0#1d5+10,d3#1#3#0#1d3+0,7b#15#23#0#1d15+20');
INSERT INTO `website_shop_objects_templates` VALUES (6507, 7, 'Marteau de la Terps', 'La Terps était une très vilaine créature aussi dangereuse et mal aimée que sa grande rivale, la vieille Liche. Déterminée à la surpasser, elle forgea ce marteau pour lui écraser les orteils, mais elle lui cassa surtout les pieds. Une grande histoire d\'amour naquit.', 38, 90, '64#6#a#0#1d5+5,63#6#a#0#1d5+5,5f#2#6#0#1d5+1,7d#10#1e#0#1d15+15,7c#6#a#0#1d5+5,7e#b#14#0#1d10+10,75#1#0#0#0d0+1,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6508, 7, 'Marteau Pinambour', 'Un marteau exceptionnel, destiné à soigner son petit Prespic adoré, ou ses ennemis si vous êtes un disciple du Chafer Fu.', 39, 50, '5e#3#7#0#1d5+2,51#7#b#0#1d5+6,b6#1#2#0#1d2+0,7d#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (6509, 7, 'Marteau R\'Ticolis', 'Ce somptueux marteau a fait tourner la tête de plus d\'un Osamodas. En effet, il est si puissant, que tout le monde se retourne quand on croise son propriétaire. Ce marteau est depuis ce temps-là, à l\'origine d\'une bien étrange pathologie.', 40, 120, '64#19#2a#0#1d18+24,5f#4#6#0#1d3+3,7c#10#23#0#1d20+15,70#6#9#0#1d4+5,b6#2#3#0#1d2+1,b0#3#5#0#1d3+2,d5#3#5#0#1d3+2,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6510, 7, 'Marteau Kahr', 'Kahr était vraiment à la masse lorsqu\'il s\'agissait de combattre avec un marteau. Heureusement pour lui, il reçut en héritage cette véritable merveille, qui fit de lui une personne respectée et jalousée. Le succès ne tient parfois à rien.', 41, 120, '7d#1f#3c#0#1d30+30,7c#15#23#0#1d15+20,64#19#2a#0#1d18+24,7b#1f#32#0#1d20+30,b0#6#a#0#1d5+5,b7#4#8#0#1d5+3,d5#3#5#0#1d3+2,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6511, 7, 'Marteau Ridhe', 'C\'est le marteau parfait des moments chauds, vous aurez un succès énorme parmi votre entourage si vous savez vous y prendre correctement. De toute évidence, à ne pas mettre entre toutes les mains...', 42, 120, '64#15#2e#0#1d26+20,76#1f#32#0#1d20+30,8a#b#f#0#1d5+10,b0#6#a#0#1d5+5,b8#4#8#0#1d5+3,d5#3#5#0#1d3+2,d3#3#5#0#1d3+2,7e#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (6512, 7, 'Marteau Nitruhant', 'C\'est l\'arme rêvée des Xélors un tantinet rebelles et en manque de sensations fortes. Ca leur permet surtout de compenser une vieille histoire de complexe à propos de leur taille franchement ridicule.', 43, 82, '7b#15#28#0#1d20+20,7e#15#1e#0#1d10+20,7d#1f#32#0#1d20+30,64#13#26#0#1d20+18,73#2#3#0#1d2+1,75#1#0#0#0d0+1,70#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (6513, 7, 'Marteau Réfacteur', 'Ce marteau tire sa puissance d\'un subtile enchantement. Ca ne se voit pas au premier coup d\'oeil, ni au second. C\'est pour cela que l\'on prend la peine de le préciser, histoire d\'augmenter la valeur de cet objet aux yeux des acheteurs un peu naïfs.', 44, 55, '5f#2#4#0#1d3+1,b6#1#0#0#0d0+1,7d#b#14#0#1d10+10,77#b#14#0#1d10+10,8a#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6516, 5, 'Dagues R\'Hoh', 'Aucun Sram ne peut résister à l\'envie d\'agresser un ami avec ces sublimes dagues. Leur principal intérêt est donc de faire baisser de manière considérable l\'insécurité en Amakna, en supprimant un à un les derniers Srams restants.', 41, 121, '7d#29#50#0#1d40+40,64#7#b#0#1d5+6,62#7#b#0#1d5+6,77#1f#32#0#1d20+30,7c#15#1e#0#1d10+20,8a#b#f#0#1d5+10,b0#6#a#0#1d5+5,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6517, 5, 'Dagues Hischantes', 'Ces dagues feraient craquer n\'importe quelle petite Sramette en quête d\'expériences nouvelles. En effet, ses pouvoirs étranges lui permettent d\'accomplir les pires fourberies, aux amis comme aux ennemis. Le Captain Chafer aurait adoré.', 42, 80, '64#d#16#0#1d10+12,75#1#0#0#0d0+1,77#15#28#0#1d20+20,7d#15#28#0#1d20+20,76#b#14#0#1d10+10,51#d#16#0#1d10+12');
INSERT INTO `website_shop_objects_templates` VALUES (6518, 3, 'Amrothiline', 'Conçue par un célèbre Sculpteur, cette baguette a gagné 13 fois le grand concours de la Baguette N\'hi, en réussissant à surpasser les anciens modèles de Boulgourdes aujourd\'hui retirés du marché car trop dangereuses pour les petites Eniripsas.', 44, 120, '64#b#17#0#1d13+10,5f#5#9#0#1d5+4,7d#29#50#0#1d40+40,7c#15#1e#0#1d10+20,7e#15#28#0#1d20+20,8a#b#f#0#1d5+10,b0#6#a#0#1d5+5,d4#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6519, 3, 'Baguette de Kouartz', 'C\'est un sculpteur réputé, connu également pour la ressemblance de son nom avec un des alliages les plus précieux d\'Amakna, qui eut le premier, l\'idée d\'introduire des métaux dans ses créations. La folie mène parfois au succès.', 41, 80, '64#d#1b#0#1d15+12,7d#15#28#0#1d20+20,7c#10#19#0#1d10+15,7e#10#23#0#1d20+15,8a#6#a#0#1d5+5,ae#65#c8#0#1d100+100,6c#9#17#0#1d15+8');
INSERT INTO `website_shop_objects_templates` VALUES (6520, 3, 'La Migraine', 'Le sculpteur de cette baguette, a maintes fois demandé à changer de nom. Trop habitués à passer leurs journées à la Taverne, les responsables du registre d\'Amakna, ont fini par avoir mal à la tête avec toutes ces histoires. Cette baguette leur est dédiée.', 45, 85, '64#b#13#0#1d9+10,7d#29#46#0#1d30+40,7c#b#14#0#1d10+10,8a#6#a#0#1d5+5,b8#3#5#0#1d3+2,ae#97#12c#0#1d150+150');
INSERT INTO `website_shop_objects_templates` VALUES (6521, 4, 'Kelinobranche', 'On raconte que ce bâton permet de faire rougir une femelle Abraknyde, ou de chatouiller les parties intimes du Chêne Mou pour mieux le séduire. Dans tous les cas, on vous déconseille d\'essayer, le Chêne Mou est vraiment très possessif...', 38, 129, '64#10#1e#0#1d15+15,5f#3#6#0#1d4+2,76#1f#32#0#1d20+30,7d#29#50#0#1d40+40,7c#15#28#0#1d20+20,70#6#a#0#1d5+5,b0#6#a#0#1d5+5,d6#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6522, 4, 'La Racine Cinati', 'La légende raconte que cette racine est herbivore : elle aurait tendance à se faufiler très vite sous les feuilles mortes et avaler les jeunes pousses. Très impressionnant. Bon, à part si vous combattez des Pissenlits, ça ne sert à rien.', 39, 120, '61#6#f#0#1d10+5,63#6#f#0#1d10+5,76#1f#32#0#1d20+30,7d#29#50#0#1d40+40,7e#1f#32#0#1d20+30,70#6#a#0#1d5+5,75#1#0#0#0d0+1,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (6523, 4, 'La Racine Hagogue', 'Création élégante et raffinée, cette racine sculptée fera de vous un invocateur confirmé. Pas de quoi frimer en soirée, mais pour rendre folles de vous les Sadidettes d\'Amakna, il n\'y a pas mieux.', 40, 120, '64#10#1e#0#1d15+15,7d#29#50#0#1d40+40,76#10#1e#0#1d15+15,7c#15#23#0#1d15+20,70#6#a#0#1d5+5,75#1#0#0#0d0+1,b6#5#6#0#1d2+4,ae#97#fa#0#1d100+150');
INSERT INTO `website_shop_objects_templates` VALUES (6524, 4, 'Racine Sauvageonne', 'Un Sadida, éperdument amoureux d\'une Sadidette Sauvage a tenté de l\'attirer sous un charme avec cette racine, il a attendu une centaine d\'années. Elle lui a posé une sorte de Wabbit. Depuis ce jour, les Sadidas parlent de poser une Racine.', 41, 54, '64#3#4#0#1d2+2,5f#1#2#0#1d2+0,70#1#2#0#1d2+0,b6#2#0#0#0d0+2,7d#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (6525, 4, 'Bâton du Féca', 'Les habitants d\'Amakna en avaient assez d\'entendre les disciples Fécas se plaindre à longueur de journée de leurs armures. Ils ont donc conçu ce bâton pour espérer les voir parler d\'autre chose à la taverne.', 42, 94, '64#15#25#0#1d17+20,7d#15#28#0#1d20+20,7e#15#28#0#1d20+20,d2#1#5#0#1d5+0,d3#1#5#0#1d5+0,d4#1#5#0#1d5+0,d5#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6526, 8, 'Pelle Hébuse', 'Le forgeur de cette pelle a voulu rester anonyme pour faire le modeste, mais il a pris soin de laisser un indice dans le nom de cette pelle. Certains artisans sont vraiment irrécupérables...', 4, 94, '64#18#29#0#1d18+23,7d#15#28#0#1d20+20,7c#10#1e#0#1d15+15,7b#15#28#0#1d20+20,75#1#0#0#0d0+1,b0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6527, 8, 'Pelle Musicale', '\"Pelle pelle pelle comme euh le jour, pelle pelle pelle comme euh l\'amour\" fredonnait Noh Yèle l\'illustre forgeur d\'épées. Il chantait si faux, que sa femme en est restée marquée à vie lorsqu\'elle lui fabriqua cette pelle.', 38, 52, '64#12#1d#0#1d12+17,7d#15#1e#0#1d10+20,7e#15#1e#0#1d10+20,7b#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (6528, 8, 'Pelle Rinage', 'Cette pelle a traversé les continents, elle a vu le soleil se coucher sur la crête du Mont Crakelour, le soleil se lever là où la Mer d\'Asse et l\'horizon ne font plus qu\'un. Et dire que vous vous n\'êtes jamais allé plus loin que l\'île de Moon, pitoyable.', 4, 88, '64#b#10#0#1d6+10,5b#3#6#0#1d4+2,7c#b#14#0#1d10+10,7e#15#28#0#1d20+20,8a#6#a#0#1d5+5,b0#6#a#0#1d5+5,7b#15#28#0#1d20+20');
INSERT INTO `website_shop_objects_templates` VALUES (6535, 8, 'Pelle Hikule', 'Cette étrange pelle multi-usages, servait à tuer les poux des jeunes Iops, à leur enlever les pellicules, et à leur faire rentrer dans le crâne les bases de l\'arithmétique.', 36, 121, '64#18#2b#0#1d20+23,7d#29#50#0#1d40+40,7c#15#1e#0#1d10+20,7b#1f#32#0#1d20+30,70#6#a#0#1d5+5,8a#b#f#0#1d5+10,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (6536, 8, 'Pelle du Mineur Sombre', 'Le Mineur Sombre se sert de cette pelle de la taille d\'une main de Craqueleur,  essentiellement pour écraser plusieurs Eniripsas d\'un seul coup. On vous encourage à faire de même, histoire de ne pas mourir idiot.', 34, 120, '60#c#15#0#1d10+11,64#c#15#0#1d10+11,7d#29#50#0#1d40+40,7c#15#1e#0#1d10+20,7b#1f#32#0#1d20+30,73#5#8#0#1d4+4,ae#c9#190#0#1d200+200,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (6537, 8, 'Pelle Mairhe', 'Cette pelle est vraiment antipathique. Personne ne sait réellement pourquoi, mais les Pelles Mairhes sont toujours insupportables. Heureusement, qu\'elles ont tout de même des bons côtés, même si on les cherche encore à l\'heure actuelle.', 37, 88, '64#b#14#0#1d10+10,5b#1#8#0#1d8+0,7d#1f#32#0#1d20+30,77#15#28#0#1d20+20,7b#15#28#0#1d20+20,75#1#0#0#0d0+1,b6#1#0#0#0d0+1,b0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6538, 8, 'Pelle Vaidaire', 'Cette pelle permet aux Enutrofs de voir plus loin. Elle est faîte pour qu\'ils puissent la planter et monter dessus pour scruter l\'horizon et se donner des airs intéressants. Idéal pour retrouver son hospice lorsque l\'on est perdu entre deux fougères.', 39, 84, '60#6#d#0#1d8+5,64#6#d#0#1d8+5,7b#15#28#0#1d20+20,70#3#6#0#1d4+2,75#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (6539, 8, 'Pelle Gicque', 'Cette pelle est vraiment différente des autres. Si vous l\'utilisez pour combattre, on risque de beaucoup rire et de faire des blagues sur vous. En effet, les blagues sur la Pelle Gicque sont très populaires du côté de la Taverne.', 35, 71, '64#15#28#0#1d20+20,6c#1#50#0#1d80+0,7c#b#14#0#1d10+10,7e#10#1e#0#1d15+15,7b#15#23#0#1d15+20');
INSERT INTO `website_shop_objects_templates` VALUES (6540, 8, 'La Pelle Hélabète', 'On raconte que celui qui a forgé cette pelle ressemblait à une véritable bête. Une sorte de croisement entre un Sadida et un Mulou. Sa pelle serait tombée amoureuse de lui. Vraiment une histoire débile.', 33, 87, '64#12#25#0#1d20+17,7b#15#23#0#1d15+20,ae#97#fa#0#1d100+150,b0#6#a#0#1d5+5,b8#6#a#0#1d5+5');
