INSERT INTO `website_shop_objects_templates` VALUES (6599, 74, 'Grande Fée d\'Artifice Jaune Virevoltante', 'Idéal pour les petites fêtes de mariage, parfait pour la fête du Slip du Captain Chafer.', 27, 15, '');
INSERT INTO `website_shop_objects_templates` VALUES (6600, 74, 'Grande Fée d\'Artifice Invocatrice de Tofu', 'Idéal pour les petites fêtes de mariage, parfait pour la fête du Slip du Captain Chafer.', 31, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6601, 48, 'Poudre d\'Artifice', 'Lorsque vos invités commencent à s\'ennuyer, la meilleure solution reste l\'utilisation de la célèbre Fée d\'Artifice, à construire vous-même à partir de cette poudre et de divers ingrédients. Cette Fée saura rendre votre soirée franchement explosive.', 670, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6602, 24, 'Sang de rat d\'Hyoactif', 'Les normes de sécurité Bontarienne prévoient de se tenir à une distance de 100 pouces de toute substance Hyoactive sous peine de multiplier son temps de jeu par trois.', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6603, 61, 'Peluche du Bouftou', 'Cette peluche est la réplique exacte d\'un Bouftou, ses créateurs ont même poussé le vice jusqu\'à mettre la propre odeur du Bouftou sur la laine de cette peluche. Ne vous étonnez donc pas, si vous sentez mauvais en vous réveillant le matin.', 671, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6604, 18, 'Kouin-Kouin', 'Au delà du Tofu, du Bouftou où encore du Iop, le Kouin-kouin excelle dans la crétinerie.', 8, 1, '320#a#0#0#0d0+10,b0#14#0#0#0d0+20,ae#c8#0#0#0d0+200');
INSERT INTO `website_shop_objects_templates` VALUES (6605, 61, 'Peluche du Bouftou Royal', 'Cette peluche est en tout point royale, des coutures, jusqu\'au rembourrage, rien n\'a été laissé au hasard. Un excellent cadeau pour les enfants gâtés ou les gosses de riches.', 672, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6606, 61, 'Peluche du Dopeul Sadida', 'Cette peluche contient dans son rembourrage un gros réveil, très utile pour les Sadidas qui ont le réveil difficile. En revanche, il leur est déconseillé de la prendre avec eux lorsqu\'il vont sous un charme, le temps ne compte plus dans ces moments-là !', 673, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6607, 61, 'Peluche du Dopeul Ecaflip', 'Cette petite peluche amuse les Ecaflips de tout âge.', 674, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6608, 61, 'Peluche du Dopeul Iop', 'Cette peluche ressemble dans un certain sens à un vrai Iop, stupide et bête comme ses pieds, son crâne, ne contient même pas de rembourrage.', 675, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6610, 61, 'Peluche du Dopeul Sram', 'Cette peluche a été volée à un jeune Sram, qui lui-même l\'avait dérobée à un de ses camarades.', 677, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6611, 61, 'Peluche du Dopeul Eniripsa', 'Cette peluche pourrait presque voler toute seule si elle si ces ailes n\'étaient pas usées. En effet, cette peluche est loin d\'être de première main. Mais qu\'importe, ça reste un joli un cadeau.', 678, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6612, 61, 'Peluche du Dopeul Enutrof', 'Attention, cette peluche est vraiment très lourde. En effet, elle est rembourrée avec de la Pierre de Bauxite, et des Pépites d\'Or.', 679, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6613, 61, 'Peluche du Dopeul Féca', 'Cette peluche est presque incassable, elle conviendra parfaitement aux jeunes Fécas turbulents et peu soigneux.', 680, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6614, 61, 'Peluche du Dopeul Osamodas', 'On raconte que cette peluche peut invoquer d\'autres petites peluches si elle est correctement entretenue. Une vieille légende pour forcer les jeunes Osamodas à ne pas la manger.', 681, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6615, 61, 'Peluche du Dopeul Crâ ', 'Cette peluche à l\'allure toute fière, est faîte pour être envoyée de très loin sur vos camarades de jeu, une sorte de boomerang, mais qui ne revient pas à l\'envoyeur.', 682, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6616, 61, 'Peluche du Dopeul Xélor', 'Cette peluche fait un bruit étrange. Elle semble contenir dans le rembourrage de sa tête, une horloge. De quoi bercer le sommeil des jeunes Xélors.', 683, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6617, 61, 'Peluche du Sanglier', 'Cette peluche ressemble à s\'y méprendre à une peluche de Sanglier. Impressionnant. Vous noterez que ses poils sont de véritables poils de Sangliers. Un gage de qualité, assurément.', 684, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6618, 61, 'Peluche du Tofu', 'Qui n\'a jamais rêvé de serrer dans ses bras, une réplique de Tofu ? Peut-être vous. Dans ce cas, vous achetez n\'importe quoi ou vos amis ne savent pas vous offrir des cadeaux.', 685, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6619, 61, 'Peluche du Champ', 'Ce champ-là n\'a pas d\'épines douloureuses ou de poison paralysant. Il est tout de même redoutable pour faire peur aux Iops les plus naïfs.', 686, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6620, 61, 'Peluche du Prespic', 'Ce Prespic en peluche n\'enverra pas d\'aiguilles et ne se rendra pas invisible. Mais il remplira son rôle de peluche à merveille et rendra vos amis terriblement jaloux.', 687, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6621, 61, 'Peluche du Wabbit', 'Le Wabbit en peluche reste un incontournable, peut-être parce qu\'il est indémodable. Vous n\'avez pas cette chance.', 688, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6622, 15, 'Hochet du Dark Vlad', 'Ce hochet a appartenu au Dark Vlad en personne, ce qui suffit à le rendre inestimable, même s\'il s\'agit d\'un hochet  classique.', 696, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6624, 61, 'Peluche du Dragon Cochon', 'Cette peluche est vraiment unique en son genre. Mais attention, elle est destinée à un public averti.', 689, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6625, 15, 'Bilboquet Du Maître Corbac', 'Ce magnifique jouet, a appartenu au Maître Corbac en personne. Trop stupide pour comprendre comment il fonctionnait, il s\'en servait pour taper sur la tête de ses chers petits Corbacs. Chacun ses distractions.', 710, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6626, 15, 'Corde à Sauter du Captain Chafer', 'Pour entretenir ses articulations, le Captain Chafer utilisait cette fameuse corde à sauter. Depuis qu\'il a disparu d\'Amakna, elle passe de main en main.', 695, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6627, 74, 'Petite Fée d\'Artifice Multicolore', 'Cette Fée d\'artifice éblouira et étonnera vos amis les plus blasés. Très utile pour fêter le départ de votre guilde.', 30, 1, '');
