INSERT INTO `website_shop_objects_templates` VALUES (6642, 6, 'Puissante Epée d\'Urandal', 'Cette épée est un cadeau honorifique que l\'on donne uniquement aux mercenaires accomplis. Mais elle coupe aussi très bien.', 25, 50, '64#10#1e#0#1d15+15,7d#15#23#0#1d15+20,d6#4#5#0#1d2+3,ae#33#64#0#1d50+50,9c#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (6643, 42, 'Booden glace', 'Cette délicieuse glace est fabriquée artisanalement par la petite ferme Booden qui essaye d\'imposer la Boo dans tous desserts glacés.', 143, 1, '6e#32#0#0#0d0+50');
INSERT INTO `website_shop_objects_templates` VALUES (6644, 42, 'Cône Wayal', 'Cette glace s\'inspire du très célèbre chapeau du Wa pour sa partie supérieure, ce qui donne un effet assez réussi', 144, 1, '6e#28#0#0#0d0+40');
INSERT INTO `website_shop_objects_templates` VALUES (6646, 42, 'Glace Bontarienne', 'Cette glace, subtil mélange de deux parfums fruités, montre \"tout le savoir faire des anges\"...enfin si l\'on en croit la boite', 145, 1, '6e#1e#0#0#0d0+30');
INSERT INTO `website_shop_objects_templates` VALUES (6647, 42, 'Magma Brâkmarien', 'Cette glace, associant le croquant à la douceur, montre \"encore une fois la supériorité de Brâkmar\"...enfin si l\'on en croit la boîte.', 146, 1, '6e#1e#0#0#0d0+30');
INSERT INTO `website_shop_objects_templates` VALUES (6648, 15, 'Ballon rouge', 'Ce ballon est un souvenir de la foire du trooll', 690, 1, '');
