INSERT INTO `website_shop_objects_templates` VALUES (6652, 15, 'Boule à neige foire du trooll', 'cette jolie boule à neige donnera toute sa splendeur sur un rebord de cheminée', 694, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6653, 24, 'Ticket de la foire du Trool', 'Ce ticket vous permet de rentrer dans la foire.', 94, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6654, 11, 'Bottes du Gardien des Egoûts', 'Comble de l\'ironie, le gardien des égoûts s\'est fait dévorer par la Gardienne des Egoûts. Il a été digéré pendant plus de cent ans avant de finir par mourir. Heureusement, ses bottes étaient plus résistantes que lui et sont encore en excellent état.', 28, 83, '7d#1f#32#0#1d20+30,73#3#4#0#1d2+2,70#3#6#0#1d4+2,8a#b#f#0#1d5+10,b0#6#a#0#1d5+5,80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6655, 89, 'Sac Surprise du Chanceux', 'Les personnes qui ont déposé ça dans votre banque sont vraiment généreuses, et ont voulu vous témoigner leur amitié. (DOUBLE CLIC POUR OUVRIR LE SAC)', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6656, 89, 'Sac Surprise du Chanceux', 'Les personnes qui ont déposé ça dans votre banque sont vraiment généreuses, et ont voulu vous témoigner leur amitié. (DOUBLE CLIC POUR OUVRIR LE SAC)', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6657, 89, 'Sac à remplacer', 'ne pas traduire ce texte.', 0, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6658, 61, 'Peluche du Mulou', 'Cette magnifique peluche en véritables poils de Mulou, vous tiendra chaud la nuit, tout en diffusant dans votre chambre, une agréable odeur de transpiration de Mulou mort.', 699, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6659, 15, 'Faux Koinkoin', 'Ne vous y fiez pas, ce koinkoin est un faux, donnez le à Krip Soue à côté du stand de canards pour recevoir une récompense.', 700, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6660, 16, 'Chapeau du Marié ', 'Avec un tel chapeau qui saurait vous dire non ? \\nA vous la gloire et les conquêtes !', 53, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6661, 20, 'Canne à Koinkoin', 'Cette canne vous permet de pêcher un koinkoin dans le stand de la foire du Trool.', 8, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6662, 16, 'Chapeau de la Mariée', 'Faites-le fondre comme une gelée menthe au soleil avec cette merveilleuse coiffe en soie de larve du sud, lavable à l\'eau douce.', 54, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6663, 6, 'Bouquet de Roses démoniaques', 'Avec ce superbe bouquet de pétales de roses démoniaques, vous montrerez à votre bien aimé(e) que vous êtes prêt(e) à braver 1000 et 1 dangers pour sa jolie frimousse. Et cela sans le moindre Bobo, pour une somme modique adaptée aux petits budgets.', 47, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6664, 75, 'Parchemin de Sort Spécial Félintion', '(Double clic pour apprendre le sort) \\nCe parchemin vous permet d\'apprendre le sort Félintion... Réservé aux Ecaflips uniquement.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6666, 42, 'Sucette Tofu', 'Cette délicieuse sucette est aromatisée aux extraits de Tofus. Un régal pour vos papilles, un cataclysme pour votre haleine.', 147, 1, '6e#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6667, 42, 'Sucette Trool', 'Une sucette qui a vraiment du goût et qui est surtout interminable. A consommer entre amis de préférence.', 148, 1, '6e#33#96#0#1d100+50');
INSERT INTO `website_shop_objects_templates` VALUES (6668, 42, 'Hot Dog de Tofu', 'Cette saucisse bien grasse vous permettra, de reprendre des forces, pour pouvoir digérer les autres saucisses que vous venez de consommer.', 150, 1, '8b#1a#4b#0#1d50+25,6e#1a#4b#0#1d50+25');
INSERT INTO `website_shop_objects_templates` VALUES (6669, 42, 'Burger de Trool', 'Cet impressionnant burger, pourrait remettre sur pieds une armée de Chafers affamés. A consommer avec modération, l\'abus de Trool est dangereux pour la santé.', 149, 1, '8b#33#96#0#1d100+50,6e#33#96#0#1d100+50');
INSERT INTO `website_shop_objects_templates` VALUES (6670, 42, 'Frites de Tournesol Sauvage', 'Ces frites sont découpées dans des tiges de Tournesol Sauvage, puis elles sont cuîtes dans l\'huile de Tournesol Sauvage bouillante, histoire qu\'elles se sentent un peu comme chez elles, lorsqu\'elles sont en train de frire.', 151, 1, '8b#33#96#0#1d100+50');
INSERT INTO `website_shop_objects_templates` VALUES (6671, 58, 'Haricot', '...', 471, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6672, 52, 'Farine de Xavier le Boulanger', 'Cette farine est d\'une légèreté et d\'une finesse extraordinaire, elle est tellement douce, qu\'elle est utilisée pour garder les fesses des jeunes Iops bien au sec. Elle est ensuite réutilisée pour donner encore plus de goût aux pains.', 250, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (6673, 24, 'Plume de Tofu Noir', 'Une plume noire de Tofu Noir...', 96, 1, '');
