INSERT INTO `website_shop_objects_templates` VALUES (6677, 6, 'Puissante Epée de Sériane-Kerm', 'Cette épée est un cadeau honorifique que l\'on donne uniquement aux mercenaires accomplis. Mais elle coupe très bien aussi.', 25, 70, '');
