INSERT INTO `website_shop_objects_templates` VALUES (6690, 80, 'Paire de ciseaux abîmée', 'Une paire de ciseaux abîmée, tout ce qu\'il y a de plus classique.', 33, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6706, 15, 'Bandelette de la Momie Nova', 'Ces bandelettes sont aussi vieilles que son propriétaire, lui-même aussi vieux que ses bandelettes. Au fil du temps, elles se sont imprégnées des pouvoirs magiques de la Momie Nova, mais également de son odeur de chaire en décomposition.', 712, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (6707, 17, 'Cape de la Momie Nova', 'Cette cape malodorante est faîte à partir des bandelettes malodorantes de la Momie Nova. De quoi exciter tous les habitants des cimetières alentours.', 63, 75, '7d#29#32#0#1d10+40,7c#b#14#0#1d10+10,7b#1a#23#0#1d10+25,70#2#3#0#1d2+1,ae#97#fa#0#1d100+150,b0#7#9#0#1d3+6');
INSERT INTO `website_shop_objects_templates` VALUES (6708, 24, 'Certificat Dopeul', 'Ce certificat indique la date de votre dernière victoire sur un dopeul.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6712, 17, 'Cape Hucine', 'Cette magnifique cape sent la fleur des bois. Pas de quoi rendre folle de vous une Craêtte, mais suffisant pour couvrir les odeurs d\'un Sadida qui se néglige.', 82, 71, '7d#47#64#0#1d30+70,7c#1f#28#0#1d10+30,6f#1#0#0#0d0+1,b6#1#2#0#1d2+0,d3#6#a#0#1d5+5,f0#6#a#0#1d5+5,9a#65#c8#0#1d100+100,98#65#c8#0#1d100+100,9d#65#c8#0#1d100+100,9b#65#c8#0#1d100+100');
INSERT INTO `website_shop_objects_templates` VALUES (6713, 5, 'Lorsotheuses', 'Imprégnées du sang du terrible Lordsoth, ces dagues lui ont permis de terrasser le roi des Chafers lors du célèbre concours de lancer de dagues de la foire du Trool. Le roi des Chafers n\'a plus jamais osé depuis ce jour, montrer le bout de son slip en cuir, et s\'est exilé avec l\'illustre Captain Chafer dans les environs du cimetière de Pandala.', 34, 100, '6e#14#0#0#0d0+20,76#32#0#0#0d0+50,6f#1#0#0#0d0+1,60#6#f#0#1d10+5,62#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (6716, 18, 'Nomoon', 'Ce petit singe chapardeur semble s\'être attaché à vous maintenant. Très docile, il est cependant très exigeant sur le plan alimentaire et n\'accepte que les végétaux qui poussent sur son île.', 11, 1, 'b0#1#50#0#1d80+0,320#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (6717, 18, 'Chienchien Noir', 'Avec ce petit toutou, vous goûterez aux joies des petites promenades pipi. Fort de ses racines sauvages, il est déconseillé de lui donner à manger, sous peine de perdre une main.  \\n(CE FAMILIER LEGENDAIRE N\'A PAS BESOIN DE MANGER)', 10, 1, '6e#f#0#0#0d0+15');
INSERT INTO `website_shop_objects_templates` VALUES (6718, 18, 'Chacha Blanc', 'Cette petite boule de poil friponne et câline fait craquer la gent féminine toutes classes confondues. Un animal redoutable donc. \\n(CE FAMILIER LÉGENDAIRE N\'A PAS BESOIN DE MANGER)', 9, 1, '6e#f#0#0#0d0+15');
INSERT INTO `website_shop_objects_templates` VALUES (6719, 16, 'Coiffe de l\'Homme Ours', 'Cette étrange coiffe a appartenu au tristement célèbre Homme Ours. Cousue à partir des restes de la tête d\'un ours en décomposition, cette coiffe vous permettra de ne pas passer inaperçu, et surtout, de laisser grâce à son odeur originale, une trace de votre passage.', 64, 20, '7d#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (6720, 17, 'Cape de l\'Homme Ours', 'Cette jolie cape a été portée pendant des années par le célèbre Homme Ours. Elle ne fera pas de vous un ours, mais vous pourrez rivaliser avec les plus grands.', 58, 20, '7d#b#f#0#1d5+10,77#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (6721, 11, 'Bottes de l\'Homme Ours', 'Ces bottes sont rembourrées avec de la fourrure d\'ours. De quoi garder les pieds au chaud même pour ceux qui ont le sang froid.', 51, 20, '77#b#f#0#1d5+10,73#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (6722, 9, 'Alliance de l\'Homme Ours', 'L\'Homme Ours n\'a jamais quitté cette alliance, bien que sa femme fût dévorée sous ses yeux, par un des ours qu\'il venait d\'invoquer, et cela pour impressionner sa dulcinée. Elle a effectivement été très impressionnée.', 66, 20, 'ae#1a#23#0#1d10+25,70#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6723, 1, 'Amulette de l\'Homme Ours', 'L\'Homme Ours portait cette amulette autour du cou, lorsqu\'il a affronté les brigandins de la tanière de Bimdhoul. La légende raconte qu\'elle lui a sauvé la vie, mais quand on la regarde de près, on s\'aperçoit qu\'il s\'agit bien d\'une légende.', 74, 20, 'b7#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (6724, 10, 'Ceinture de l\'Homme Ours', 'Cette petite ceinture recouverte de poils d\'ours, est idéale pour cacher vos poignées d\'amour. Il est donc conseillé de ne jamais l\'enlever, pour ne pas décevoir l\'élu de votre coeur.', 66, 20, 'b7#1#2#0#1d2+0,7d#9#c#0#1d4+8');
INSERT INTO `website_shop_objects_templates` VALUES (6725, 4, 'Bâton de l\'Homme Ours', 'L\'Homme Ours utilisait ce bâton pour dresser ses invocations d\'ours, et parfois pour frapper les doigts de ses enfants, lorsque ces derniers ne faisaient pas leurs devoirs en revenant de l\'école. Voilà un homme qui avait tout compris à l\'éducation des enfants.', 46, 20, '62#8#c#0#1d5+7,77#b#e#0#1d4+10');
INSERT INTO `website_shop_objects_templates` VALUES (6731, 1, 'Amukwak de Glace', 'Avec cette amulette autour du cou, vous pourriez tenter de faire croire à votre entourage que vous avez une haleine fraîche. Laissez tomber, c\'est peine perdue.', 71, 42, 'd3#3#5#0#1d3+2,7b#10#14#0#1d5+15,73#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (6732, 9, 'Kwakanneau de Glace', 'Ce petit anneau était jadis très convoité par les Enutrofettes qui préféraient s\'en servir pour décorer leurs orteils. Une excellente façon de cacher leurs verrues.', 63, 42, 'd3#3#5#0#1d3+2,7b#10#14#0#1d5+15,8a#5#a#0#1d6+4');
INSERT INTO `website_shop_objects_templates` VALUES (6735, 98, 'Racine de Fourbasse', 'Cette minuscule racine incarne parfaitement la fourberie. Personne ne sait pourquoi, mais tout le monde le sait.', 96, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (6736, 108, 'Bourgeon de Fourbasse', 'Ce petit bourgeon de Fourbasse contient une sève sirupeuse et collante. Si vous avez le malheur de marcher sur une vieille Fourbasse tapie dans les herbes hautes, vous risquez de restez accrochée à celle-ci jusqu\'à ce qu\'elle vous dévore entièrement vos bottes. En revanche, si vous arrivez à prélever un bourgeon de Fourbasse intact, vous pourrez faire taire le plus râleur des Fécas, en le lui offrant en guise de pâte à mâcher.', 97, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (6737, 96, 'Ecorce de Fourbasse', 'La Fourbasse n\'a pas réellement de vraies branches comme tout arbre qui se respecte, elle a cependant une fine écorce assez résistante et recouverte d\'une multitude d\'aspérités. Très pratique pour créer des manches d\'outils qui ne glissent pas entre les mains, ou pour donner des coups de bâtons qui arrachent la peau du derrière des enfants les plus effrontés. Dans les deux cas, la satisfaction est maximale. Pour celui qui tient le manche.', 98, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (6738, 47, 'Crâne de Chef Crocodaille', 'Cet énorme crâne témoigne de l\'hygiène dentaire déplorable du Chef Crocodaille. Chose amusante, il semble encore animé d\'une certaine magie, l\'âme du Chef Crocodaille l\'habitant encore. Il lui arrive même parfois de verser de grosses larmes de Crocodaille si vous êtes méchant avec lui.', 637, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (6739, 59, 'Peau de Crocodaille', 'Réussir à avoir un morceau complet de peau de Crocodaille est presque un miracle, bien souvent, les braconniers ne récupèrent que quelques écailles. Idéale pour faire un sac, cette vieille peau saura également contenter les tailleurs de sous-vêtements de combat.', 601, 36, '');
INSERT INTO `website_shop_objects_templates` VALUES (6740, 59, 'Peau de Chef Crocodaille', 'Cette peau constituée d\'une multitude d\'écailles, est en tout point supérieure à une classique peau de Crocodaille. En effet, la face extérieure de la peau du Chef Crocodaille est plus résistante et recouverte d\'écailles acérées très coupantes, alors que la face intérieure est particulièrement douce. On raconte que certains vieux tailleurs confondent les deux faces lors de la confection de sous-vêtements. L\'histoire ne raconte pas si cela leur apporte plus ou moins de clientèle...', 600, 69, '');
INSERT INTO `website_shop_objects_templates` VALUES (6742, 1, 'Fourbamulette', 'Cette amulette est constituée d\'un mélange de feuilles de Fourbasse et de détritus de l\'île de Moon. Elle ressemble plus à un collier de fleurs qu\'à une véritable amulette, mais elle vous permettra de séduire sans trop d\'efforts la faune locale de l\'île de Moon, composée presque exclusivement d\'abominables créatures. Ainsi, plus aucune Fourbasse ne saura vous résister, elles vous sauteront toutes au cou pour vous faire des suçons. Les plus malchanceux en amour sauront s\'en contenter.', 69, 33, '7d#b#f#0#1d5+10,73#1#0#0#0d0+1,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6743, 9, 'Fourballiance', 'Prenez des feuilles de Fourbasse, empilez-les, laissez-les macérer dans de l\'alcool éventé, perforez-les, buvez le reste d\'alcool, collez les feuilles autour d\'un morceau d\'écorce, fixez des morceaux de feuille de Kokoko avec une matière gluante, et voilà, vous avez une magnifique Fourballiance. Elle sent très mauvais, et vous sera particulièrement utile pour justifier et cacher l\'odeur de vos doigts surtout si vous avez tendance à les mettre n\'importe où. Surtout là où il ne faut pas.', 60, 33, '7d#b#f#0#1d5+10,70#1#2#0#1d2+0,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6744, 11, 'Fourbabottes', 'Une fois que vous aurez essayé ces bottes, vous ne serez plus capable de vous en défaire. Non pas parce qu\'elles sont exceptionnelles, mais car elles sont incroyablement collantes. Une caractéristique trop souvent partagée avec les femelles Fourbasses.', 47, 34, '7d#b#f#0#1d5+10,7c#b#f#0#1d5+10,73#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (6745, 10, 'Ceinture Fourbissante', 'Remarquable création artisanale à base de restes de Fourbasses et de détritus ramassés le long des plages de Moon, au milieu de l\'écume nauséabonde, cette ceinture si elle est portée toute seule, vous donnera une allure vraiment surprenante. De quoi décontenancer vos adversaires ou surprendre l\'être aimé, pour mieux tirer partie de cet instant où pour une fois c\'est vous qui aurez le dessus.', 62, 33, '7d#b#f#0#1d5+10,73#1#2#0#1d2+0,8a#b#f#0#1d5+10,ae#29#3c#0#1d20+40');
INSERT INTO `website_shop_objects_templates` VALUES (6746, 1, 'Amukwak de Terre', 'Jadis portée par Oto Mustam, chef des guerriers de Brâkmar, cette petite amulette ne lui servait qu\'à se faire beau lors des orgies organisées à Brâkmar. Tout un programme.', 72, 42, 'd2#3#5#0#1d3+2,76#10#14#0#1d5+15,73#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (6747, 1, 'Amukwak du Vent', 'Lorsque le vent souffle dans ses plumes, le Kwak du Vent se sent libre comme l\'air, et se laisse planer tel une vieille feuille morte emportée par une bourrasque. Contrairement aux idées reçues, c\'est assez impressionnant.', 70, 42, 'd4#3#5#0#1d3+2,77#10#14#0#1d5+15,73#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (6748, 9, 'Kwakanneau de Terre', 'Judicieusement porté, cet anneau vous permettra d\'embellir vos doigts boudinés. Malheureusement pour certains, il n\'est efficace que sur les doigts.', 64, 42, 'd2#3#5#0#1d3+2,76#10#14#0#1d5+15,8a#5#a#0#1d6+4');
INSERT INTO `website_shop_objects_templates` VALUES (6749, 9, 'Kwakanneau de Vent', 'Cet anneau est si léger, qu\'il pourrait s\'envoler au premier coup de vent. Mais ne rêvez pas, si cela se produit, vous ne vous envolerez pas avec lui. On se moquera de vous dans le meilleur des cas.', 62, 42, 'd4#3#5#0#1d3+2,77#10#14#0#1d5+15,8a#5#a#0#1d6+4');
INSERT INTO `website_shop_objects_templates` VALUES (6750, 6, 'Kwaklame de Glace', 'Lame froide et tranchante, elle réveillera les instincts les plus primitifs de ceux qui l\'utilisent.', 51, 41, '60#10#19#0#1d10+15,7d#b#f#0#1d5+10,7b#b#f#0#1d5+10,73#2#3#0#1d2+1,b0#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (6751, 6, 'Kwaklame de Terre', '\"Cette lame aiguisée mais pas déguisée, conviendra parfaitement aux aventuriers déjà expérimentés en quête de nouvelles sensations\". Voici ce que l\'on peut lire sur le manuel de cette épée. Les manuels ne sont plus ce qu\'ils étaient décidément.', 53, 41, '61#10#19#0#1d10+15,7d#b#f#0#1d5+10,76#b#f#0#1d5+10,73#2#3#0#1d2+1,b0#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (6752, 6, 'Kwaklame du Vent', 'Idéale pour couper les nuages, cette lame pourra également vous servir à faire du vent si vous l\'agitez comme un éventail. Une excellente technique pour décimer les Moskitos ou défigurer vos amis.', 50, 41, '62#10#19#0#1d10+15,7d#b#f#0#1d5+10,77#b#f#0#1d5+10,73#2#3#0#1d2+1,b0#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (6753, 11, 'Kwakobottes de Glace', 'Idéales comme patins à glace sur les lacs gelés, ces bottes sont également très utiles pour garder les pieds au frais, ou pour y stocker votre goûter durant les journées de forte chaleur. Il est cependant déconseillé de les faire sécher au coin du feu, sous peine de ne plus jamais les revoir.', 36, 40, '7d#b#f#0#1d5+10,70#1#0#0#0d0+1,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6754, 11, 'Kwakobottes de Terre', '\"Rien de mieux que les Kwakobottes de Terre pour marcher dans la terre\", telles étaient les paroles de Rola Ingalsse la célèbre laboureuse, juste avant de devenir aveugle, en recevant une motte de terre géante dans les yeux.', 49, 40, '7d#b#f#0#1d5+10,70#1#0#0#0d0+1,d2#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6755, 11, 'Kwakobottes du Vent', 'Rudimentaires mais efficaces, ces bottes d\'une légéreté surprenante sont parfois utilisées après avoir été retravaillées, comme manche à air pour indiquer la direction et la force du vent. Il est alors conseillé de se placer du bon côté de la manche à air, pour ne pas mourir asphyxié.', 48, 40, '70#1#0#0#0d0+1,7d#b#f#0#1d5+10,d4#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6756, 17, 'Kwape de Terre', 'Idéale pour se camoufler en motte de terre géante, cette cape vous permettra d\'attaquer par surprise les laboureurs et leur voler leurs richesses. Elle est donc avant tout réservée aux collectionneurs de silex.', 64, 41, '76#b#f#0#1d5+10,b6#1#0#0#0d0+1,ae#15#1e#0#1d10+20,d2#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6757, 17, 'Kwape du Vent', 'Légère et raffinée, cette création peut accessoirement servir de rideau pour les plus dépourvus. Elle était jadis très convoitée par la Momie Nova en personne, qui désirait être correctement habillée pour sortir le soir. Un exemple à suivre pour certains.', 62, 41, '77#b#f#0#1d5+10,b6#1#0#0#0d0+1,ae#15#1e#0#1d10+20,d4#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6758, 10, 'Kwakture de Terre', 'Le Kwak de Terre n\'est pas très social et surtout très chassé pour ses plumes, c\'est bien connu. En portant cette ceinture autour des hanches, vous vous exposez donc à de multiples fourberies de la part des chasseurs de Kwaks de Terre, qui vous prendront de loin pour un vieux Kwak grabataire sur le déclin. Les apparences ne sont finalement pas toujours trompeuses.', 65, 41, '76#b#f#0#1d5+10,b0#1#2#0#1d2+0,d2#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6759, 10, 'Kwakture de Vent', '\"La seule façon d\'attraper un vieux mâle Kwak du Vent contrarié, c\'est de se déguiser en femelle Kwak du Vent contrariée. Dès lors, le mâle tentera de comprendre pourquoi la femelle est contrariée et tentera avec tous les moyens dont il dispose, de satisfaire la femelle. Une fois le mâle satisfait de sa prestation, il faut profiter de sa béatitude pour le plumer.\" Voici ce que l\'on peut lire dans la section douze du tome trois sur la chasse aux Kwaks du Vent. Il y est en outre clairement indiqué, que cette ceinture est un élément indispensable pour se faire passer pour une femelle Kwak du Vent. Vous savez ce qu\'il vous reste à faire.', 63, 41, '77#b#f#0#1d5+10,b0#1#2#0#1d2+0,d4#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6760, 16, 'Kwakoiffe de Terre', 'Cette Kwakoiffe de Terre est tellement lourde qu\'elle vous permettra de garder en permanence les pieds sur terre, mais vous fera également parfois tomber par terre. On ne peut pas tout avoir.', 71, 41, '76#b#f#0#1d5+10,d2#3#5#0#1d3+2,7c#4#7#0#1d4+3');
INSERT INTO `website_shop_objects_templates` VALUES (6761, 16, 'Kwakoiffe du Vent', 'Pour garder les cheveux au vent même une fois équipé d\'une coiffe, rien ne vaut cette sympathique Kwakoiffe du Vent, qui vous permettra sans aucun doute de laisser libre court à votre expression capillaire dans la plupart des circonstances. C\'est suffisant pour réussir à interloquer le plus blasé des Chafers.', 69, 41, '77#b#f#0#1d5+10,d4#3#5#0#1d3+2,7c#4#7#0#1d4+3');
INSERT INTO `website_shop_objects_templates` VALUES (6762, 4, 'Fourbasse-Ton', '\"Pour la baston, rien ne vaut un Fourbasse-Ton\". Voici ce que l\'on pouvait lire sur le dépliant publicitaire de l\'Agence Touristes, qui proposait de reconstruire soi-même ce bâton à partir de diverses ressources cachées un peu partout sur l\'île de Moon. Une sorte de jeu de piste, mais avec aucune piste.', 44, 32, '5f#2#3#0#1d2+1,65#1#0#0#0d0+1,db#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6763, 17, 'Fourbacapa', 'On raconte que les Fourbasses mortes sont très confortables une fois qu\'elles ont pris le temps de se décomposer au soleil. En effet, avec le temps elles deviennent beaucoup plus souples et douces. Beaucoup d\'aventuriers aimeraient pouvoir en dire autant de leur dulcinée.', 61, 33, '70#2#3#0#1d2+1,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6764, 16, 'Fourbacoiffe', 'Avec cette coiffe sur la tête, vous n\'avez vraiment pas l\'air très futé. Mais plus que sans la coiffe, donc autant la garder.', 68, 31, '73#2#3#0#1d2+1,ae#97#c8#0#1d50+150');
INSERT INTO `website_shop_objects_templates` VALUES (6765, 79, 'Lailait', 'Attention, il est bien précisé sur l\'emballage de ne pas donner ce lait à un jeune Chacha, il risquerait de faire quelques tâches dans votre demeure.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6766, 1, 'Epis de Farle', 'Cette amulette d\'apparence rudimentaire a été confectionnée à partir de trois épis de Blé magiques, recouverts de poussière de pierre précieuse, et fauchés dans les plaines de Snossios pendant la treizième moisson d\'Istrabraq. Elle confère un courage hors du commun à son porteur, désormais à même de faucher plaines et vallées sans jamais faillir.', 68, 80, '76#15#1e#0#1d10+20,7d#1a#28#0#1d15+25,7c#b#f#0#1d5+10,73#1#2#0#1d2+0,70#2#3#0#1d2+1,6f#1#0#0#0d0+1,b6#1#0#0#0d0+1,b0#6#7#0#1d2+5');
INSERT INTO `website_shop_objects_templates` VALUES (6767, 9, 'Bracelet Magique de Farle', 'Ce bracelet en pierres précieuses a été recouvert d\'une toile de Chanvre par Shika, pour éviter d\'attirer l\'attention des Corbacs, lorsque Farle semait son orge.', 61, 80, '76#15#1e#0#1d10+20,7d#24#32#0#1d15+35,7c#10#14#0#1d5+15,7e#10#14#0#1d5+15,77#10#14#0#1d5+15,8a#b#f#0#1d5+10,d5#4#5#0#1d2+3,d3#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (6768, 32, 'Soki', 'Vous emmenez ce chacha malheureux afin de le distraire.', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6769, 4, 'Bâton de Farle', 'Ce splendide bâton est muni de très belles dents à son extrémité, ce qui en fait un excellent fourcher. Farle s\'en servait pour créer d\'immenses meules de foin, plus hautes que le plus grand des Ormes qui poussait jadis en forêt de Litneg. On raconte que c\'est Brouce Boulgoure en personne qui aurait coupé le bois nécessaire à la fabrication de ce bâton, en échange des  mons1uses rations quotidiennes de flocons d\'avoine offertes par Shika Ingalsse, qu\'il engouffrait avant de partir raser des forêts complètes.', 43, 80, '5f#2#3#0#1d2+1,64#f#1a#0#1d12+14,7d#1a#23#0#1d10+25,73#1#2#0#1d2+0,70#1#2#0#1d2+0,ae#1f#28#0#1d10+30,8a#4#5#0#1d2+3,76#1a#23#0#1d10+25,70#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (6770, 15, 'Sousouris', 'Cette Sousouris a été dénichée à coup de balai, de la maison de Grand-mère.', 282, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6771, 9, 'Anneau Thé ', 'Cet anneau n\'a pas encore fait ses preuves. Il s\'agit d\'une confection unique faite par un apprenti bijoutier à l\'occasion d\'un test important. Il est fabriqué à partir d\'un anneau de fer classique plongé dans une solution de Thé magique.', 1, 4, '');
INSERT INTO `website_shop_objects_templates` VALUES (6773, 1, 'Amulette Tude', 'Cette amulette est construite de façon Tude, d\'où son nom. C\'est l\'une des premières méthodes de création, car l\'une des plus simples, que l\'on enseigne aux apprentis bijoutiers. Certes le produit n\'est pas puissant mais il ne faut pas en demander trop non plus.', 19, 1, '7e#1#0#0#0d0+1,ae#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (6774, 11, 'Sabots de Farle', 'Ces sabots ont été taillés dans des bois rares, renforcés avec des pièces de cuirs d\'une valeur inestimable, et rembourrés avec des céréales magiques. A la fois légère, élégante, et confortable, cette paire de sabots saura résister aux affres du temps. Beaucoup d\'aventuriers un peu trop misogynes aimeraient pouvoir en dire autant de leur dulcinée.', 46, 80, '76#15#1e#0#1d10+20,7d#24#32#0#1d15+35,77#15#1e#0#1d10+20,73#1#2#0#1d2+0,70#1#2#0#1d2+0,80#1#0#0#0d0+1,b7#3#4#0#1d2+2,d3#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (6775, 17, 'Cape de Farle', 'Cette cape en tissu et en peaux permettait à Farle Ingalsse d\'ensemencer des champs entiers pendant une saison complète sans jamais devoir s\'arrêter. En effet, une fois repliée et utilisée comme une besace, sa capacité semble presque illimitée. Personne ne connaît réellement le tailleur à l\'origine de cette merveille, la légende raconte seulement, qu\'il s\'est retiré de la profession lorsque ses clients ont commencé à confondre ses capes avec des serpillères. Quel triste départ en retraite !', 70, 80, '77#1a#23#0#1d10+25,7c#10#14#0#1d5+15,b6#1#0#0#0d0+1,9e#c9#fa#0#1d50+200,d4#4#5#0#1d2+3,d3#4#5#0#1d2+3,b7#2#3#0#1d2+1,b8#2#3#0#1d2+1,7d#1a#23#0#1d10+25');
INSERT INTO `website_shop_objects_templates` VALUES (6776, 10, 'Farlature', 'Cette ceinture servait également de tablier de boucher à Farle Ingalsse lorsqu\'il devait égorger ses troupeaux de Bouftous. Une tâche ingrate et cruelle, dont il s\'affranchissait pourtant avec un plaisir non dissimulé.', 61, 80, '76#15#1e#0#1d10+20,7c#b#f#0#1d5+10,8a#4#5#0#1d2+3,b0#4#5#0#1d2+3,b7#2#3#0#1d2+1,d4#3#5#0#1d3+2,d5#3#5#0#1d3+2,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6778, 16, 'Farlacoiffe', 'Ce chapeau de paille a été confectionné à l\'aide d\'une multitude d\'épis magiques tressés entre eux, puis l\'intérieur a été rembourré avec divers poils et étoffes cousues à la main par Shika Ingalsse, femme de Farle. Plus classe que le Ploukosse, et plus stylé que le Kraignosse, ce chapeau vous protègera du cagnard comme il l\'a fait pour Farle pendant des centaines de moissons, tout en vous donnant une allure guillerette et vraiment \"cool\". Suffisant pour s\'improviser roi ou reine des champs.', 67, 80, 'b0#8#a#0#1d3+7,75#1#0#0#0d0+1,70#1#2#0#1d2+0,7c#15#1e#0#1d10+20,7d#1a#23#0#1d10+25,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6779, 24, 'Rapport de l\'espion Sram.', 'Rapport de l\'espion Ztiv Oztin, récupéré avec une certaine difficulté des mains de Joe Pierlivet.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6780, 6, 'Épée de l\'initié ', 'Cette arme d\'apparence rudimentaire vous donnera l\'impression de savoir vous battre.', 96, 1, '64#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6781, 3, 'Baguette de l\'Initié ', 'Cette arme d\'apparence rudimentaire vous donnera l\'impression de savoir vous battre.', 8, 1, '64#1#4#0#1d4+0');
INSERT INTO `website_shop_objects_templates` VALUES (6782, 4, 'Bâton de l\'initié ', 'Cette arme d\'apparence rudimentaire vous donnera l\'impression de savoir vous battre.', 1, 1, '64#1#4#0#1d4+0');
INSERT INTO `website_shop_objects_templates` VALUES (6783, 2, 'Arc de l\'initié ', 'Cette arme d\'apparence rudimentaire vous donnera l\'impression de savoir vous battre.', 1, 1, '64#1#4#0#1d4+0');
INSERT INTO `website_shop_objects_templates` VALUES (6784, 5, 'Dagues de l\'initié ', 'Cette arme d\'apparence rudimentaire vous donnera l\'impression de savoir vous battre.', 10, 1, '64#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (6785, 7, 'Marteau de l\'initié ', 'Cette arme d\'apparence rudimentaire vous donnera l\'impression de savoir vous battre.', 1, 1, '64#1#4#0#1d4+0');
INSERT INTO `website_shop_objects_templates` VALUES (6786, 8, 'Pelle de l\'Initié ', 'Cette arme d\'apparence rudimentaire vous donnera l\'impression de savoir vous battre.', 1, 1, '64#1#4#0#1d4+0');
INSERT INTO `website_shop_objects_templates` VALUES (6787, 80, 'Fiche remplie valide', 'Cette petite fiche possède le nom d\'un potentiel candidat pour être livreur du boulanger', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6788, 24, 'Gâteaux', 'Ces gâteaux viennent juste d\'être sortis du four. Il faut les livrer tant qu\'ils sont chauds. Pensez-vous vraiment que vous avez du temps à perdre pour les examiner ainsi ?', 245, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6789, 1, 'Amulette des Champs', 'Cette petite amulette fleurit au printemps, mais se dessèche en été, se fane en automne, et pourrit en hiver. \\nL\'occasion rêvée pour changer de look au fil des saisons.', 73, 10, '77#4#5#0#1d2+3,7d#5#6#0#1d2+4');
INSERT INTO `website_shop_objects_templates` VALUES (6790, 80, 'Fiche à remplir', 'Cette fiche ressemble à une feuille toute simple, cependant au contact de la peau d\'un individu celle ci affiche tout de suite si la personne convient aux critères fournis dans l\'entête.', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6791, 9, 'Anneau Champêtre', 'Avec ce petit anneau autour du doigt, vous pourrez presque essayer de passer inaperçu au milieu des champs.', 65, 10, '7d#5#6#0#1d2+4,7e#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (6792, 4, 'La Plantouze des Champs', 'Ce bâton en forme de fleur a été confectionné à partir des restes de fleurs champêtres ayant succombé durant d\'horribles et cruels combats. Toute la rage et la haine de ces pauvres plantes est contenue dans ce ridicule petit bâton. Cette arme est utilisée par les Srams les plus fourbes, qui tentent de persuader les ignorantes qu\'ils comptent leur offrir un bouquet de fleurs. Une fois à portée, l\'imprudente se retrouve souvent assenée de coups sur la tête bien mérités.', 45, 10, '64#6#a#0#1d5+5,7d#5#6#0#1d2+4');
INSERT INTO `website_shop_objects_templates` VALUES (6793, 9, 'Anneau Thé ', 'Cet anneau a fait ses preuves, une petite marque à l\'intérieur le prouve. Il s\'agit d\'une confection unique faite par un apprenti bijoutier à l\'occasion d\'un test important. Il est fabriqué à partir d\'un anneau de fer classique plongé dans une solution de Thé magique.', 1, 4, '');
INSERT INTO `website_shop_objects_templates` VALUES (6794, 11, 'Bottes Champêtres', 'Rien de mieux que d\'utiliser des bottes confectionnées à partir de restes de fleurs champêtres, pour écraser ces misérables fleurs qui poussent dans vos champs. De plus, ces bottes permettront à vos pieds de dégager une délicieuse odeur de fleur. Dommage qu\'il n\'existe pas un équivalent à ces bottes pour les caleçons.', 50, 10, '7e#4#5#0#1d2+3,7d#5#6#0#1d2+4');
INSERT INTO `website_shop_objects_templates` VALUES (6795, 17, 'Capouze des Champs', 'Si vous voulez être la plus belle ce soir pour aller danser, c\'est la cape qu\'il vous faut.', 65, 10, '7d#5#6#0#1d2+4,ae#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (6796, 10, 'Ceinture Fleurie', 'Avec cette ceinture décorée de petits pétales autour de la taille, vous pourrez sans problème vous faire passer pour une danseuse étoile au milieu d\'un combat perdu d\'avance. De quoi décontenancer une armée de Chafers, pour retourner la situation à votre avantage.', 64, 10, '7d#5#6#0#1d2+4,7e#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (6797, 16, 'Coiffe Champêtre', 'Si vous avez toujours rêvé d\'être fleuriste et d\'avoir une haleine parfumée à l\'eau de rose, c\'est le moment d\'adopter cette étrange coiffe.', 70, 10, 'b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6798, 24, 'Fleur de Dzibi', 'Son parfum est léger, subtil, enivrant ... Mais seuls les Sadidas et les Eniripsas connaissent le secret de ces fleurs.', 117, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6799, 6, 'Lame du Chef Bwork', 'Tranchante comme une lame de Bwork, cette lame du Chef Bwork a l\'avantage de peser beaucoup plus lourd. Elle est certes moins maniable, mais il suffit de la laisser tomber sur son adversaire pour le trancher en deux, telle une vulgaire tranche de Tronknyde. Si votre ennemi ne meurt pas de douleur, il mourra de honte, et vous de rire.', 48, 100, '61#17#39#0#1d35+22,76#15#1e#0#1d10+20,7d#15#1e#0#1d10+20,77#15#1e#0#1d10+20,d3#4#5#0#1d2+3,70#2#3#0#1d2+1,b0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6800, 17, 'Cape Banale', 'Cette cape est faîte de laine de Boufton. Elle ne vous sera guère utile si ce n\'est pour avoir l\'air classe... Et encore...', 15, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6801, 17, 'Cape Hivernale', 'Une jolie doublure très chaude et très odorante a été admirablement cousue sur une cape banale. \\nSur votre dos, ou comme peau de bête devant la cheminée, cette cape aura enfin une vraie utilité.', 18, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6802, 16, 'Cache Oreilles', 'Ce cache oreille très doux tiendra vos feuilles de choux au chaud.', 73, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6803, 24, 'Extrait de fleur de Dzibi', 'Eviter d\'en boire... simplement !', 82, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6804, 1, 'Amulette du Chef Bwork', 'D\'apparence rudimentaire, cette amulette en forme de silex taillé est pourtant dotée d\'une magie très puissante capable de transformer un Bwork en princesse, ou l\'inverse, personne ne sait.', 66, 100, '76#10#19#0#1d10+15,7d#24#32#0#1d15+35,7c#10#19#0#1d10+15,7b#1a#23#0#1d10+25,73#2#4#0#1d3+1,6f#1#0#0#0d0+1,d6#4#5#0#1d2+3,d3#4#5#0#1d2+3,d4#4#5#0#1d2+3,ae#51#64#0#1d20+80');
INSERT INTO `website_shop_objects_templates` VALUES (6805, 9, 'Bracelet du Chef Bwork', 'Muni de ce petit anneau, vous pourrez faire croire à votre entourage que vous avez épousé un grand Chef Bwork et qu\'il vous a offert ce bracelet comme cadeau de mariage. De quoi vous rendre intéressant lors des soirées animées à la Taverne si vous n\'avez pas beaucoup de conversation.', 58, 100, '76#1a#28#0#1d15+25,7d#1a#28#0#1d15+25,77#1a#28#0#1d15+25,d2#4#5#0#1d2+3,8a#3#5#0#1d3+2,b0#6#7#0#1d2+5,d3#4#5#0#1d2+3,d4#4#5#0#1d2+3,b8#6#7#0#1d2+5,b7#6#7#0#1d2+5');
INSERT INTO `website_shop_objects_templates` VALUES (6806, 24, 'Fragment de bois', 'Ce fragment de bois provient d\'une construction récente, vraisemblablement rouge.', 246, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6807, 11, 'Bottes du Chef Bwork', 'De loin, ces bottes ressemblent à de classiques bottes de Bwork. De près aussi. Et pourtant, ce sont des bottes de Chef Bwork. Plus résistantes, plus puissantes, et plus malodorantes, elles sauront faire la différence dans un combat perdu d\'avance.', 44, 100, 'b0#4#5#0#1d2+3,77#15#23#0#1d15+20,7e#15#23#0#1d15+20,7c#10#19#0#1d10+15,7d#24#32#0#1d15+35,d2#4#5#0#1d2+3,d3#4#5#0#1d2+3,d4#4#5#0#1d2+3,80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6808, 24, 'Morceau de tissu arraché ', 'Ce morceau de tissu blanc est à la fois très doux et très taché.', 247, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6809, 24, 'Description approximative', 'Cette description décrit une petite fille habillée d\'une couleur foncée et les cheveux blonds.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6810, 24, 'Rapport d\'activité du quartier', 'Ce rapport stipule qu\'aucun incident n\'a été constaté dans le quartier le jour du vol de la maison. \\nHormis la vision d\'un roublard dans la nuit de l\'incident.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6811, 17, 'Cape du Chef Bwork', 'Cette cape déchirée et pleine de trous vous fera passer pour un très grand guerrier Bwork. Elle est parfaite si vous voulez terroriser les vieux du village. En revanche, pour séduire l\'âme sœur, cela risque d\'être un peu plus difficile, à moins de la porter entièrement nu, ce qui vous permettra en plus, de continuer à faire peur aux vieux du village.', 60, 100, 'b0#4#5#0#1d2+3,77#1a#28#0#1d15+25,7d#24#32#0#1d15+35,d4#4#5#0#1d2+3,d3#4#5#0#1d2+3,d5#4#5#0#1d2+3,7b#1a#28#0#1d15+25,70#3#4#0#1d2+2,b7#3#4#0#1d2+2,b8#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (6812, 10, 'Slip du Chef Bwork', 'Ce slip en cuir violet se suffit à lui-même, vous pouvez vous contenter de ne porter que ça, vous aurez tout de même fière allure, à condition qu\'il soit à votre taille et qu\'il ne vous tombe pas sur les genoux lors d\'une partie de corde à sauter un peu trop mouvementée.', 59, 100, '76#15#23#0#1d15+20,7d#1f#2d#0#1d15+30,7c#10#19#0#1d10+15,77#15#23#0#1d15+20,73#3#4#0#1d2+2,70#3#4#0#1d2+2,b0#4#5#0#1d2+3,d4#4#5#0#1d2+3,da#4#5#0#1d2+3,d3#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (6813, 16, 'Casque du Chef Bwork', 'Si vous voulez réellement avoir une tête de gros débile, ce casque est fait pour vous. Avec un peu de chance, on ne verra même pas la différence lorsque vous l\'enlèverez.', 65, 100, '76#1a#28#0#1d15+25,7d#1a#28#0#1d15+25,7c#10#19#0#1d10+15,77#1a#28#0#1d15+25,7b#15#23#0#1d15+20,70#3#4#0#1d2+2,75#1#0#0#0d0+1,d4#4#5#0#1d2+3,d5#4#5#0#1d2+3,d3#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (6814, 24, 'Ensemble de bouts de bois', 'Cet ensemble de bouts de bois forme un petit lit douillet, idéal pour un Piou.', 248, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6815, 24, 'Seringue de Nibé Lulle', 'Nibé Lulle vous a donné cette seringue pour prélever un échantillon de sang de Radlu Minite le Mineur Sombre.', 31, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6816, 24, 'Echantillon de sang', 'Vous avez enfin réussi à prélever un échantillon de sang sur Radlu Minite. Très appétissant.', 102, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6817, 1, 'Amulette du Chef Crocodaille', 'Cette surprenante amulette a en fait été confectionnée à partir d\'un Bouclier Reptilien dont on a détaché les multiples pierres précieuses. C\'est donc un bijou particulièrement lourd à porter mais vraiment très résistant. Votre cou sera parfaitement protégé des vampires, mais aussi des suçons des villageoises un peu trop entreprenantes.', 67, 70, '6f#1#0#0#0d0+1,b6#1#0#0#0d0+1,d4#4#5#0#1d2+3,d3#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (6818, 35, 'Rose démoniaque coupée', 'Cette fleur, autrefois démoniaque, est à présent un cadeau angélique pour une personne. Cela dit, si vous n\'obtenez en retour qu\'un regard neutre, vous pourrez toujours en faire de la confiture.', 118, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6819, 9, 'Bracelet du Chef Crocodaille', 'Ce bracelet ressemble étrangement à un gant et pourtant ce n\'est pas un gant mais bien un bracelet. Les apparences sont parfois trompeuses.', 59, 70, '7b#15#1e#0#1d10+20,73#1#3#0#1d3+0,b0#4#5#0#1d2+3,d5#4#5#0#1d2+3,d2#4#5#0#1d2+3,77#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (6820, 24, 'Herbe curative', 'Cette herbe est l\'ingrédient principal de vieux remèdes d\'alchimiste. Elle n\'est plus du tout utilisée de nos jours. On lui préfère le trèfle car ce dernier ne provoque pas de démangeaison faciale, ce qui, il faut l\'avouer, est un plus.', 103, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6821, 6, 'Lame du Chef Crocodaille', 'Fabriquée à partir de débris trouvés sur un Chef Crocodaille, cette arme saura se révéler très efficace si vous êtes assez beau, habile, intelligent et fort pour la manier. Avec un peu de chance, vous finirez par trouver quelqu\'un qui acceptera de vous l\'échanger contre une épée de boisaille.', 49, 70, '7d#1a#23#0#1d10+25,77#15#1e#0#1d10+20,7b#15#1e#0#1d10+20,b6#1#0#0#0d0+1,64#15#28#0#1d20+20,5f#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (6822, 24, 'Piqûre de réveil', 'Cette piqûre contient un remède si puissant qu\'il pourrait réveiller un mort. D\'ailleurs il parait que l\'illustre mort-vivant Hyrkul s\'en injectait régulièrement. On ne peut trouver meilleure preuve de son efficacité.', 31, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6823, 24, 'Potion à base de plantes', 'Cette potion, à l\'odeur nauséabonde pourrait réveiller un sadida pendant sa sieste...Ou presque...Si le sadida est jeune et sur le point de se réveiller.', 500, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6824, 24, 'Pierre de Soin Fuyard', 'Cette pierre de soin perd de son pouvoir très rapidement, il faut l\'entourer d\'un métal qui absorbe certaines radiations, afin de confiner l\'effet de la pierre et ainsi de préserver son efficacité. On lui préfère des amulettes standards presque aussi efficaces et surtout bien moins chères.', 104, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6825, 11, 'Pantoufles Crochues du Chef Crocodaille', 'Ces magnifiques pantoufles en peau et en écailles de Chef Crocodaille sont munies de dents acérées à leurs extrémités. Méfiez-vous lorsque vous ferez du pied à votre dulcinée, vous pourriez lui déchirer ses petits bas en laine de Tabi.', 45, 70, '77#10#19#0#1d10+15,80#1#0#0#0d0+1,d4#4#5#0#1d2+3,d3#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (6826, 24, 'Pierre de soin sertie', 'Cette amulette est une pierre de soin fuyard joliement sertie par un morceau de métal rare. La tenir dans sa main procure une sensation de bien-être, la fatigue s\'en va et le cerveau est libéré. Et en plus on peut vous voir dans la nuit avec.', 105, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6827, 24, 'Lettre de Joe Pierlivet', 'Joe t\'a confié cettre lettre afin que tu l\'amènes à un bon ami à lui, Howard le Simaisrien, un Iop euh ... comment dire ... un Iop quoi !', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6828, 24, 'Poignée d\'epée', 'Cette poignée ne vous transformera pas en as du maniement d\'epée mais elle peut vous y aider.', 97, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6829, 24, 'Epée tout juste forgée', 'Cette épée vient tout juste d\'être forgée.', 98, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6830, 81, 'Petit sac d\'écolier du Chef Crocodaille', 'A Amakna aussi, la rentrée scolaire est une épreuve douloureuse pour les jeunes enfants. Surtout pour les jeunes Iops, pour qui la rentrée des classes est synonyme de véritable calvaire, parsemé d\'épreuves insurmontables. Réconfortez-les avec ce magnifique sac d\'écolier en peau et en écailles de Chef Crocodaille, et rembourré d\'une multitude de poils.', 58, 70, '7d#15#1e#0#1d10+20,7c#10#14#0#1d5+15,77#15#1e#0#1d10+20,73#1#2#0#1d2+0,9e#12d#15e#0#1d50+300,d5#3#5#0#1d3+2,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6831, 10, 'Ceinture du Chef Crocodaille', 'Trop rigide pour servir de fouet, cette ceinture recouverte de minuscules pierres précisieuses peut néanmoins être utilisée de manière plus conventionnelle, pour éviter que vos guêtres ne tombent sur vos genoux par exemple.', 60, 70, '77#1a#23#0#1d10+25,7b#1a#23#0#1d10+25,8a#b#f#0#1d5+10,d5#3#5#0#1d3+2,d3#3#5#0#1d3+2,b0#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6832, 32, 'Livreur de Bière', 'Le livreur de bière est aussi important qu\'un convoyeur de banque. A ceci près qu\'il est bien plus hargneux.', 15, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6833, 24, 'Bourse de Kamas douteuse', 'Ces kamas semblent venir d\'un autre temps, il faudrait les fondre rapidement avant qu\'il ne décident de repartir d\'où ils sont venus.', 243, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6834, 16, 'Coiffe du Chef Crocodaille', 'Si vous avez toujours rêvé de ressembler à un Crocodaille sans pour autant vous transformer en Crocodaille, cette coiffe est faîte pour vous. N\'espérez pas pour autant utiliser cette coiffe pour faire croire à vos amis que vous avez un jour réussi à tuer vous-même un Crocodaille. Personne n\'y croira, à part vous peut-être.', 66, 70, '7d#15#1e#0#1d10+20,7c#10#14#0#1d5+15,77#15#1e#0#1d10+20,7b#15#1e#0#1d10+20,75#1#0#0#0d0+1,b6#1#0#0#0d0+1,d5#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (6835, 24, 'Métal transmuté ', 'La bourse de kamas douteuse a été habilement transmutée par Nibé Lulle. Une épée est désormais prête à être créée avec ce métal ...', 241, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6836, 24, 'Epée grossière', 'Voici une épée forgée des mains de Dedoiné, mais elle semble encore trop fragile pour vous. Nibé Lulle l\'Alchimiste devrait pouvoir y faire quelque chose', 98, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6837, 24, 'Epée bondissante', 'Une épée faîte pour vous, légère et redoutable. Mais il y manque une petite touche finale, quelque chose d\'Ecaflip ...', 98, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6838, 24, 'Epée de feu grossière', 'L\'eau de lune semble avoir fait son effet. Cette épée est d\'une solidité à toute épreuve, mais il y manque quelque chose d\'Ecaflip ...', 98, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6839, 6, 'Epée de Yingnitié ', 'Cette arme estampillée par Meow Meow pourrait faire de vous un Ecaflip de légende, éventuellement ...', 18, 1, '64#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6840, 6, 'Epée de Yanguru', 'Cet arme estampillée par Meow Meow pourrait faire de vous une Ecaflip de légende, éventuellement ...', 18, 1, '64#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6841, 55, 'Etoffe d\'Ours', 'Cette étrange étoffe sent l\'Ours. De quoi faire craquer une partie non négligeable de la gente féminine.', 121, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (6842, 47, 'Dent d\'Ours', 'Cette étrange dent a appartenu à un vieil Ours. Ou plutôt, à une invocation d\'Ours, ce qui il faut bien le reconnaître, est totalement différent, puisque qu\'en réalité, vous avez entre vos mains, une dent invoquée. Très intéressant.', 432, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (6843, 47, 'Os d\'Ours', 'Cet os pointu s\'est cassé pendant un terrible combat contre un des Ours invoqués de l\'Homme Ours. Il était trop tard pour mettre un plâtre sur la patte de ce pauvre Ours agonisant et gémissant de douleur à cause de vos attaques répétées. Vous avez préféré l\'achever lentement en l\'étouffant avec de la bave de Bouftou, le dépecer et ensuite lui arracher cet os alors qu\'il était encore conscient. Pas de pitié pour les invocations.', 48, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (6844, 54, 'Poils d\'Ours', 'Parfois, l\'Homme Ours se décide à épiler une de ses invocations d\'Ours pour s\'amuser ou pour passer le temps. Il récupère ensuite les poils pour en faire des sous-vêtements de grande qualité, très prisés des chasseurs solitaires attirés par les sensations et les odeurs fortes.', 195, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (6845, 59, 'Peau d\'Ours', 'Cette peau rugueuse et dépourvue de poils est le fruit d\'un long travail d\'épilation intensive à l\'huile bouillante et au fer rouge. Ne vous étonnez donc pas si elle sent légèrement le roussi.', 35, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (6846, 24, 'Fiole cristal de pâle Anthir', 'Fiole banale au premier regard. Elle possède cependant un pouvoir que seul les Xelors savent exploiter.', 99, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6847, 24, 'Sac de grains d\'Epyss', 'Grain assez rare, qui ne sert pas à grand chose. Qui à dit comme les Xélors ?', 243, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6848, 24, 'Bois fiorituré ', 'Bois de moyenne facture.', 100, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6849, 24, 'Boîte de Suborhube', 'Les seuls à connaître le mode d\'emploi sont les Enutrofs. Peut-être, simplement, parce qu\'on ne préfère pas savoir trop de choses sur leur secrets... Et quels secrets !!!', 56, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6850, 24, 'Pizaille', 'Une des spécialités culinaires d\'Astrub, la pizaille à l\'avantage de pouvoir être mangé n\'importe où et n\'importe quand, à l\'exception peut-être du quartier des bouchers car l\'odeur y est insupportable ...', 107, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6852, 24, 'Peluche de la foire', 'La peluche que Pleur Nycheuz a gagnée à la foire du trool ...', 151, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6853, 24, 'Bois d\'Arash', 'Ce bois a la particularité de pousser tout droit, comme un bâton. Pratique pour le stockage...', 100, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6854, 24, 'Peau de larve bleue', 'Morceau de chair gluant arraché à une pauvre larve sans défense.', 101, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6855, 24, 'Petit arc d\'Enileda', 'Fruit du travail de la célèbre tailleuse d\'arc Enileda, ce petit arc n\'est pas un modèle en soit.', 244, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6856, 20, 'Ciseaux à rose démoniaque', 'La forme de ces ciseaux est spécialement étudiée pour couper la tige de n\'importe quelle rose démoniaque sans abîmer les pétales. Et ceci alors même qu\'elle vous mord le mollet.', 22, 1, '64#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (6857, 37, 'Bière d\'Astrub', 'Une bière classique favorisant le développement de votre muscle abdominal, plus connu sous le nom de l\'Abdo kro.', 4, 1, '6e#1#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (6858, 80, 'Fiche remplie mais non valide', 'Cette petite fiche possède, hélas, le nom d\'un candidat non valide pour être livreur du boulanger. La petite tâche rouge en bas indiquant qu\'il ne possédait soit pas assez de force, soit pas assez d\'agilité pour ce métier.', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6859, 24, 'Paire de ciseaux', 'Une paire de ciseaux qui ne peigne pas de mine... elle aurait même plutôt tendance à couper qu\'à peigner, racontent certains coiffeurs...', 150, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6862, 24, 'Manuscrit de l\'Ours', 'Cet étrange parchemin explique comment l\'Homme Ours a appris a invoquer des Ours. Incroyable.', 95, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6863, 16, 'Casque des Mercenaires d\'Astrub', 'Casque des Mercenaires d\'Astrub.', 72, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6864, 24, 'Fleur de rose Obscure', 'Une fleur de rose si sombre que son ombre parait étincelante en comparaison.', 106, 23, '');
INSERT INTO `website_shop_objects_templates` VALUES (6865, 24, 'Note', '\"Rendez-vous à l\'orée de la forêt pour la livraison\"', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6866, 24, 'Morceau de cape', 'Un morceau de cape bleue de ceux qui vous ont agressé. Mine de rien vous les avez dérouillés.', 249, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6867, 24, 'Note de récolte', 'Pour ne pas oublier l\'heure à laquelle vous devez récolter le Vhan, vous l\'avez noté sur ce papier.', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6868, 95, 'Planche en Châtaignier', 'Cette planche en Châtaignier est parfois utilisée pour construire des habitations, mais le plus souvent on l\'utilise pour faire des pièges à mouche...', 1, 10, '');
