INSERT INTO `website_shop_objects_templates` VALUES (6885, 15, 'Jeton du Bworker', 'Idéal pour jouer à pile ou face ou pour tuer sur place votre ennemi lors d\'un lancer de pièce, ce jeton en or massif fera de vous un joueur heureux, mais peut-être malchanceux.', 90, 100, '');
