INSERT INTO `website_shop_objects_templates` VALUES (6894, 18, 'Surpuissant Chacha de Combat (MJ)', 'Ce surpuissant Chacha de combat incarne à merveille la surpuissance. Très impressionnant. Mais attention, il est réservé aux Maîtres de jeu qui le valent bien.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6895, 18, 'Petit Chacha de Combat (MJ)', 'Moins surpuissant que le surpuissant Chacha de Combat, mais néanmoins très puissant, ce familier reste une valeur sûre pour tout Maître de jeu qui se respecte. En revanche, il faut avouer qu\'il est nettement plus salissant. N\'oubliez pas de le laver vigoureusement à l\'eau bouillante de temps à autre pour qu\'il garde toute sa splendeur.', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6897, 53, 'Plume de Piou Bleu', 'Cette petite plume de Piou a été directement arrachée du derrière d\'un pauvre Piou qui n\'avait rien demandé.', 114, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6898, 53, 'Plume de Piou Violet', 'Cette petite plume de Piou a été directement arrachée du derrière d\'un pauvre Piou qui n\'avait rien demandé.', 115, 1, '');
