INSERT INTO `website_shop_objects_templates` VALUES (6900, 53, 'Plume de Piou Rouge', 'Cette petite plume de Piou a été directement arrachée du derrière d\'un pauvre Piou qui n\'avait rien demandé.', 117, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6902, 53, 'Plume de Piou Jaune', 'Cette petite plume de Piou a été directement arrachée du derrière d\'un pauvre Piou qui n\'avait rien demandé.', 118, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6903, 53, 'Plume de Piou Rose', 'Cette petite plume de Piou a été directement arrachée du derrière d\'un pauvre Piou qui n\'avait rien demandé.', 119, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6904, 15, 'Protection usagée du Bworker', 'L\'amour fait parfois plus de ravages et de dégâts qu\'une guerre. Ce n\'est pas au Bworker que vous apprendrez cela.', 714, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (6905, 89, 'Pack Surprise Bwork', 'L\'ouverture de ce pack requiert de la part de son possesseur, une grande sérénité, qui influencera directement sur la qualité de son contenu.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6906, 14, 'Mercenaire Neophyte', 'Ce parchemin est le formulaire d\'entrée parmi les Mercenaires. Celui à qui il est proposé sera inscrit dans les registres du clan, en tant que néophyte.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6907, 14, 'Neutraliseur', 'Permet de donner l\'alignement neutre au personnage ciblé.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6908, 10, 'Sanglature', 'Poilue mais élégante, cette ceinture devrait parfois vous faire penser à votre dulcinée.', 75, 18, '7d#6#14#0#1d15+5,73#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6909, 11, 'Pieds du Sanglier', 'Ces bottes sont parfaites pour marcher dans la boue et rayer les parquets. Elles sont généralement interdites sur toutes les pistes de danse.', 51, 22, '77#6#f#0#1d10+5,b2#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6910, 9, 'Anneau du Sanglier', 'Cet anneau était placé sur les pattes des sangliers en rut, pour que les éleveurs puissent facilement les reconnaître. Aujourd\'hui, c\'est vous qui portez cet anneau. Toutes les interprétations sont possibles.', 73, 19, '7c#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6911, 9, 'Araknoton', 'Ce ridicule petit anneau vous permettra de combattre plus facilement votre phobie des Araknes.', 76, 5, '77#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (6912, 10, 'Araknoture', 'Confectionnée à partir de vieux restes d\'Araknes en décomposition, cette ceinture a tout pour plaire. Elle reprendra parfois vie et prendra un malin plaisir à vous mordre les hanches. Sales bêtes !', 73, 6, 'ae#b#32#0#1d40+10');
INSERT INTO `website_shop_objects_templates` VALUES (6913, 16, 'L\'Araknacoiffe', 'Affublé de cette coiffe, vous ressemblerez à une Arakne sauvage. Dans le meilleur des cas, vous effraierez les Moskitos un peu naïfs.', 83, 6, '7d#6#f#0#1d10+5,7c#6#f#0#1d10+5,ae#b#1e#0#1d20+10,74#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (6914, 19, 'La Trancheuse d\'Arakne', 'Fait très étrange, l\'Arakne, n\'a que quatre pattes velues, ce qui signifie qu\'avec seulement quatre coups de haches, vous pourrez la transformer en Arakne Tronc.', 31, 8, '64#7#b#0#1d5+6,7d#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (6915, 9, 'Mos Kitano', 'Cet anneau est si léger qu\'il vous permettra de réaliser n\'importe quelle acrobatie avec vos doigts. Très pratique pour humilier un adversaire dix fois plus petit que vous, en lui écrasant la tête avec le pouce.', 71, 21, '7b#1#f#0#1d15+0,b2#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6916, 81, 'Sac du Petit Moskito', 'Ce sac en peau et en ailes de Moskitos faisait jadis fureur à la sortie des écoles. Aujourd\'hui, il est totalement démodé, et a été remplacé dans le coeur des enfants, par le Petit sac d\'écolier du Chef Crocodaille. Du grand n\'importe quoi, quand on voit que ce dernier est largement plus cher, et surtout beaucoup plus laid. Une sombre histoire de mode.', 59, 16, '7b#1#1e#0#1d30+0,9e#1#64#0#1d100+0');
INSERT INTO `website_shop_objects_templates` VALUES (6917, 16, 'Moskitogalurette', 'Cette coiffe doit son nom surprenant à l\'excentricité du premier Enutrof qui l\'a découverte en dépouillant un vieux Moskito malade. Très utile pour les aventuriers qui débutent, elle permet avant tout, de rendre folles de vous les Araknes affamées.', 80, 15, '7c#1#a#0#1d10+0,7b#1#1e#0#1d30+0,9d#b#14#0#1d10+10,7e#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (6918, 1, 'Amulette du Moskito', 'Moins efficace et moins prisée que la célèbre Araknamu, cette petite amulette a pourtant beaucoup de charme lorsqu\'elle est portée toute seule, sur un corps très poilu.', 75, 15, '7b#1#14#0#1d20+0,7d#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (6919, 9, 'Anneau du Champ Champ', 'Le Champ Champ n\'a jamais été connu pour être une créature très sympathique. Il vous empoisonne la vie dès qu\'il peut, il mord assez fort, et a très mauvais caractère. C\'est étonnant comme ces vilaines petites créatures peuvent parfois vous faire penser à un conjoint.', 74, 3, 'b7#1#3#0#1d3+0,9d#1#1e#0#1d30+0,98#1#1e#0#1d30+0');
INSERT INTO `website_shop_objects_templates` VALUES (6920, 9, 'Alliance Du Champ Champ', 'Lorsque le Champ Champ se marie, il offre cette alliance à sa dulcinée. Cette dernière étant dépourvue de bras, l\'alliance est déposée soigneusement sur une de ses épines. En vous équipant de cette alliance, vous briserez les liens du mariage qui unissaient ces deux créatures, et dans le meilleur des cas, le Champ Champ vous prendra pour sa dulcinée.', 75, 3, 'b8#1#3#0#1d3+0,9d#1#1e#0#1d30+0,98#1#1e#0#1d30+0');
INSERT INTO `website_shop_objects_templates` VALUES (6921, 16, 'Champcoiffe', 'Autrefois utilisée en infusion, et parfois même fumée, cette coiffe de Champ Champ a tout pour plaire.', 84, 9, '7c#1#f#0#1d15+0,98#1#1e#0#1d30+0,9d#1#1e#0#1d30+0');
INSERT INTO `website_shop_objects_templates` VALUES (6922, 17, 'Cape du Champ Champ', 'La seule chose qui soit plus impressionnante qu\'un Champ Champ enragé, c\'est un Champ Champ enragé avec une cape. En effet, cette cape incarne une certaine forme de sur-puissance vestimentaire, bien qu\'elle soit avouons-le, assez laide.', 76, 9, '7c#1#a#0#1d10+0,73#2#3#0#1d2+1,9d#1#1e#0#1d30+0,98#1#1e#0#1d30+0,d3#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6923, 1, 'Amulette du Bandit', 'Cette amulette a jadis appartenu au grand bandit \"Thisme\", réputé pour sa cruauté sans limite et sa mort idiote. Sa vie fût digne d\'un conte d\'Eniripsa, il mourût noyé et écrasé dans un pressoir à huile alors qu\'il venait tout juste de purger une peine de prison de plus d\'une centaine d\'années, pour avoir volé une noix de cajou.', 76, 16, '70#1#3#0#1d3+0,db#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (6924, 5, 'Dagues du Bandit', 'Ces dagues aiguisées sont populaires auprès des bandits et impopulaires auprès des jeunes aventuriers pour les mêmes raisons, elles disposent d\'un enchantement leur permettant de voler les kamas de ses adversaires. Une forme d\'impôt assez originale.', 9, 12, '62#3#5#0#1d3+2,8a#3#7#0#1d5+2,82#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6925, 10, 'Ceinture du Bandit', 'Cette ceinture saillante vous ira à ravir si vous rejoignez un jour la cause des bandits de grand chemin. En attendant, elle ne vous rendra que plus ridicule.', 72, 15, '7d#6#14#0#1d15+5,70#1#3#0#1d3+0,73#1#0#0#0d0+1,d8#1#a#0#1d10+0,da#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (6926, 16, 'Coiffe du Prespic', 'Avec cette coiffe de Prespic sur la tête, vous ressemblez presque à Dévie Cloquette, célèbre chasseuse des temps modernes, prête à tout pour cacher sa calvitie naissante. Pas de chance pour vous si vous vouliez faire de même, vous devrez vous contenter d\'une coiffe de couleur rousse, qui de toute évidence, dégagera une horrible odeur dès qu\'il se mettra à pleuvoir.', 81, 36, '7c#1#14#0#1d20+0,70#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (6927, 17, 'Cape du Prespic', 'Cette petite cape rousse peut également faire office de descente de lit, ou de paillasson, de quoi remettre au goût du jour l\'intérieur de votre habitation, de manière économique.', 75, 37, '7c#1#1e#0#1d30+0,70#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (6928, 9, 'Anneau du Prespic', 'A la fois sobre et tout de même original, cet anneau saura séduire les aventuriers avides d\'apparat de luxes mais complètement fauchés, au point d\'aller dépouiller de ridicules petites créatures sauvages pour s\'orner de bijoux. La mesquinerie ne connaît aucune limite.', 72, 38, 'dc#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6929, 10, 'Ceinture du Prespic', 'Idéale pour garder ses hanches au chaud, cette ceinture a tout de même l\'inconvénient d\'irriter et de démanger les peaux douces. A réserver aux durs à cuir.', 71, 33, 'dc#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6930, 16, 'Casque du Craqueleur', 'Ce casque directement taillé dans la pierre vaut son pesant d\'or. Il saura vous protéger des attaques d\'un Craqueboule tout en vous permettant d\'enchaîner des coups de boules dignes du Désiroboule. De quoi faire perdre la boule à tous vos adversaires.', 85, 44, '7d#1#1e#0#1d30+0,b0#1#a#0#1d10+0,b8#1#6#0#1d6+0');
INSERT INTO `website_shop_objects_templates` VALUES (6931, 17, 'Craquelocape', 'Cette cape en pierre est un peu trop rigide, mais elle n\'en reste pas moins une excellente protection contre les jets de pierres, ou plus dangereux encore, contre les crachats de Craqueleurs.', 77, 46, '7c#1#a#0#1d10+0,76#1#1e#0#1d30+0,b7#1#6#0#1d6+0,d5#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6933, 11, 'Bottes du Craqueleur', 'Incroyablement lourdes, mais néanmoins assez efficaces, ces bottes en pierre vous permettront enfin d\'avoir une excuse, lorsque vous traînez des pieds pour défendre votre percepteur dans un combat perdu d\'avance.', 52, 47, '7d#1#1e#0#1d30+0,8a#1#a#0#1d10+0,b8#1#8#0#1d8+0,d2#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6934, 1, 'Craquamulette', 'Cette amulette est aussi lourde qu\'un Blop boulimique, voilà qui devrait décourager les aventuriers un peu trop fragiles de la porter. En revanche, une fois son poids supporté, il faut reconnaître qu\'elle vous donne fière allure.', 77, 46, '76#1#14#0#1d20+0,77#1#14#0#1d20+0,b7#1#8#0#1d8+0,d2#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6935, 10, 'Ceinture du Craqueleur', 'Porter cette ceinture autour des hanches fera de vous un aventurier respecté. La porter sur la tête en guise de bandeau fera de vous la risée du village d\'Astrub.', 74, 45, '7c#1#f#0#1d15+0,9e#1#12c#0#1d300+0,b8#1#5#0#1d5+0,d4#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6936, 16, 'Scaracoiffe Verte', 'Affublé de cette coiffe originale, vous pourrez enfin faire croire à vos amis que vous êtes un chasseur de Scarafeuilles.', 78, 44, '76#1#1e#0#1d30+0,7d#1#1e#0#1d30+0,7c#1#f#0#1d15+0,d2#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6937, 16, 'Scaracoiffe Rouge', 'Affublé de cette coiffe originale, vous pourrez enfin faire croire à vos amis que vous êtes un chasseur de Scarafeuilles.', 77, 44, '7e#1#1e#0#1d30+0,7d#1#1e#0#1d30+0,7c#1#f#0#1d15+0,d5#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6938, 16, 'Scaracoiffe Blanche', 'Affublé de cette coiffe originale, vous pourrez enfin faire croire à vos amis que vous êtes un chasseur de Scarafeuilles.', 79, 44, '77#1#1e#0#1d30+0,7d#1#1e#0#1d30+0,7c#1#f#0#1d15+0,d4#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6939, 16, 'Scaracoiffe Bleue', 'Affublé de cette coiffe originale, vous pourrez enfin faire croire à vos amis que vous êtes un chasseur de Scarafeuilles.', 76, 44, '7b#1#1e#0#1d30+0,7d#1#1e#0#1d30+0,7c#1#f#0#1d15+0,d3#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6940, 17, 'Scaracape Verte', 'Qui n\'a jamais rêvé de revêtir une cape en coquille de Scarafeuilles ? Une fois équipée, vous devriez réussir à vous prendre pour un véritable Scarafeuille, et peut-être arriverez-vous à vous déplacer en glissant et en dérapant. De quoi décontenancer une horde de Trools.', 74, 45, '76#1#a#0#1d10+0,7d#1#1e#0#1d30+0,70#1#3#0#1d3+0,d2#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6941, 17, 'Scaracape Bleue', 'Qui n\'a jamais rêvé de revêtir une cape en coquille de Scarafeuilles ? Une fois équipée, vous devriez réussir à vous prendre pour un véritable Scarafeuille, et peut-être arriverez-vous à vous déplacer en glissant et en dérapant. De quoi décontenancer une horde de Trools.', 73, 45, '7b#1#a#0#1d10+0,7d#1#1e#0#1d30+0,70#1#3#0#1d3+0,d3#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6942, 17, 'Scaracape Rouge', 'Qui n\'a jamais rêvé de revêtir une cape en coquille de Scarafeuilles ? Une fois équipée, vous devriez réussir à vous prendre pour un véritable Scarafeuille, et peut-être arriverez-vous à vous déplacer en glissant et en dérapant. De quoi décontenancer une horde de Trools.', 72, 45, '7e#1#a#0#1d10+0,7d#1#1e#0#1d30+0,70#1#3#0#1d3+0,d5#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6943, 17, 'Scaracape Blanche', 'Qui n\'a jamais rêvé de revêtir une cape en coquille de Scarafeuilles ? Une fois équipée, vous devriez réussir à vous prendre pour un véritable Scarafeuille, et peut-être arriverez-vous à vous déplacer en glissant et en dérapant. De quoi décontenancer une horde de Trools.', 71, 45, '77#1#a#0#1d10+0,7d#1#1e#0#1d30+0,70#1#3#0#1d3+0,d4#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6944, 9, 'Scaranneau Vert', 'Porter cet anneau autour du doigt vous permettra d\'avoir une pensée émue pour tous les Scarafeuilles que vous avez exterminés. Alors peut-être, vous vous demanderez si tout cela en valait réellement la peine.', 69, 43, '73#1#4#0#1d4+0,8a#1#a#0#1d10+0,ae#1#64#0#1d100+0,d2#1#5#0#1d5+0,76#1#14#0#1d20+0');
INSERT INTO `website_shop_objects_templates` VALUES (6945, 9, 'Scaranneau Rouge', 'Porter cet anneau autour du doigt vous permettra d\'avoir une pensée émue pour tous les Scarafeuilles que vous avez exterminés. Alors peut-être, vous vous demanderez si tout cela en valait réellement la peine.', 68, 43, '7e#1#14#0#1d20+0,73#1#4#0#1d4+0,8a#1#a#0#1d10+0,ae#1#64#0#1d100+0,d5#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6946, 9, 'Scaranneau Blanc', 'Porter cet anneau autour du doigt vous permettra d\'avoir une pensée émue pour tous les Scarafeuilles que vous avez exterminés. Alors peut-être, vous vous demanderez si tout cela en valait réellement la peine.', 67, 43, '77#1#14#0#1d20+0,73#1#4#0#1d4+0,8a#1#a#0#1d10+0,ae#1#64#0#1d100+0,d4#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6947, 9, 'Scaranneau Bleu', 'Porter cet anneau autour du doigt vous permettra d\'avoir une pensée émue pour tous les Scarafeuilles que vous avez exterminés. Alors peut-être, vous vous demanderez si tout cela en valait réellement la peine.', 70, 43, '7b#1#14#0#1d20+0,ae#1#64#0#1d100+0,8a#1#a#0#1d10+0,73#1#4#0#1d4+0,d3#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6948, 10, 'Scarature Verte', 'La Scarature servait autrefois à donner une indication sur votre niveau en combat à mains nues. Posséder une Scarature verte signifiait que vous étiez un débutant, une rouge, signifiait que vous léchiez le sang de vos ennemis une fois ceux-ci exterminés, une blanche, signifiait que vous étiez une véritable machine à exterminer les ennemis, et une bleue signifiait que vous n\'aviez pas assez de kamas pour vous acheter une des trois autres Scaratures.', 67, 46, '7d#1#14#0#1d20+0,7c#1#f#0#1d15+0,b7#1#5#0#1d5+0,d2#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6949, 10, 'Scarature Blanche', 'La Scarature servait autrefois à donner une indication sur votre niveau en combat à mains nues. Posséder une Scarature verte signifiait que vous étiez un débutant, une rouge, signifiait que vous léchiez le sang de vos ennemis une fois ceux-ci exterminés, une blanche, signifiait que vous étiez une véritable machine à exterminer les ennemis, et une bleue signifiait que vous n\'aviez pas assez de kamas pour vous acheter une des trois autres Scaratures.', 69, 46, '7d#1#14#0#1d20+0,7c#1#f#0#1d15+0,b7#1#5#0#1d5+0,d4#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6950, 10, 'Scarature Rouge', 'La Scarature servait autrefois à donner une indication sur votre niveau en combat à mains nues. Posséder une Scarature verte signifiait que vous étiez un débutant, une rouge, signifiait que vous léchiez le sang de vos ennemis une fois ceux-ci exterminés, une blanche, signifiait que vous étiez une véritable machine à exterminer les ennemis, et une bleue signifiait que vous n\'aviez pas assez de kamas pour vous acheter une des trois autres Scaratures.', 68, 46, '7d#1#14#0#1d20+0,7c#1#f#0#1d15+0,b7#1#5#0#1d5+0,d5#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6951, 10, 'Scarature Bleue', 'La Scarature servait autrefois à donner une indication sur votre niveau en combat à mains nues. Posséder une Scarature verte signifiait que vous étiez un débutant, une rouge, signifiait que vous léchiez le sang de vos ennemis une fois ceux-ci exterminés, une blanche, signifiait que vous étiez une véritable machine à exterminer les ennemis, et une bleue signifiait que vous n\'aviez pas assez de kamas pour vous acheter une des trois autres Scaratures.', 70, 46, '7d#1#14#0#1d20+0,7c#1#f#0#1d15+0,b7#1#5#0#1d5+0,d3#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6952, 16, 'Coiffe du Mulou', 'Avec cette tête de Mulou sur le crâne, vous ressemblez à Bernaize Mainarht, illustre ménestrel en avance sur son temps, dont la tête fut retrouvée coincée dans la gueule d\'un Mulou agonisant, n\'ayant pas supporté les chansons que le ménestrel avait tenté de lui infliger.', 131, 61, 'b0#1#a#0#1d10+0,b6#1#0#0#0d0+1,70#1#5#0#1d5+0,77#1#28#0#1d40+0,7c#1#14#0#1d20+0,7d#1#28#0#1d40+0');
INSERT INTO `website_shop_objects_templates` VALUES (6953, 11, 'Bottines du Mulou', 'Ces bottines recouvertes de poils de Mulou, sont très pratiques pour nettoyer les parquets poussiéreux, ou tout simplement pour nettoyer la tête de vos adversaires lorsqu\'ils sont au sol en train d\'agoniser.', 76, 61, 'd2#1#5#0#1d5+0,b8#1#5#0#1d5+0,80#1#0#0#0d0+1,77#1#14#0#1d20+0,7d#1#1e#0#1d30+0');
INSERT INTO `website_shop_objects_templates` VALUES (6954, 17, 'Cape du Mulou', 'Cette peau de Mulou constitue une excellente protection contre le froid, mais également contre les aventuriers aux sens olfactifs un peu trop développés.', 99, 64, 'b0#1#5#0#1d5+0,75#1#0#0#0d0+1,b2#1#8#0#1d8+0,7c#2#14#0#1d19+1,7d#5#32#0#1d46+4');
INSERT INTO `website_shop_objects_templates` VALUES (6955, 10, 'String du Mulou', 'Utilisé comme fouet, ce string peut se révéler plus efficace qu\'il n\'y paraît, pour remotiver vos compagnons de route, lorsque l\'amour du risque commence à leur faire défaut.', 92, 49, 'd2#1#5#0#1d5+0,70#1#3#0#1d3+0,7b#2#1e#0#1d29+1,7d#1#14#0#1d20+0,76#1#1e#0#1d30+0');
INSERT INTO `website_shop_objects_templates` VALUES (6956, 9, 'Anneau du Mulou', 'Attention, cet anneau rendra votre doigt particulièrement malodorant. Une odeur qui risque d\'en couvrir une autre. C\'est peut-être pour votre doigt et votre entourage une très bonne chose...', 103, 51, 'f3#1#6#0#1d6+0,b0#1#a#0#1d10+0,77#1#19#0#1d25+0,7c#1#f#0#1d15+0,76#1#19#0#1d25+0');
INSERT INTO `website_shop_objects_templates` VALUES (6957, 6, 'Lame du Craqueleur', 'Cette épée servait autrefois à découper des blocs de granit pour confectionner les murailles des cités prestigieuses telles que Bonta ou Brâkmar. Aujourd\'hui, cette arme est avant tout recherché pour sa capacité à écraser toutes sortes de créatures vivantes, consentantes ou pas.', 54, 37, '61#6#1e#0#1d25+5,76#1#1e#0#1d30+0,73#1#4#0#1d4+0,ae#1#64#0#1d100+0');
INSERT INTO `website_shop_objects_templates` VALUES (6958, 16, 'Géniallissime Coiffe de Torte Hou', 'A peine démodée, cette coiffe vous donnera un style unique et vous permettra de regarder sous les jupes des Crâettes en toute discrétion. Idéale pour les soirées d\'été plutôt arrosées.', 82, 22, '7b#b#32#0#1d40+10');
INSERT INTO `website_shop_objects_templates` VALUES (6961, 9, 'Anneau du Bandit', 'Cet anneau est aussi populaire auprès des dentistes que des bandits, qui s\'en servent pour casser une à une les dents des imprudents. Une forme de prévention comme une autre contre l\'apparition des caries.', 77, 17, '7d#1#f#0#1d15+0,73#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (6962, 89, 'Cadeau Dofusien', 'Pas moyen de vous révéler le contenu de ce cadeau, mais sachez qu\'il vous permettra à la fois de vous éclater et de faire la foire. Lorsque c\'est jour de fête, il faut bien ça.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6963, 12, 'Boules du Minotoboule', 'Ces énormes boules sont vraiment délicieuses. Vous n\'en verrez pas le bout tout de suite, mais qu\'importe.', 143, 1, '8b#65#c8#0#1d100+100');
INSERT INTO `website_shop_objects_templates` VALUES (6964, 12, 'Potion de cité :  Brâkmar', 'Cette potion à base de riz permet à toutes les personnes d\'alignement Brâkmarien, de rejoindre la cité de Brâkmar de manière instantanée.', 145, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6965, 12, 'Potion de cité :  Bonta', 'Cette potion à base de riz permet à toutes les personnes d\'alignement Bontarien, de rejoindre la cité de Bonta de manière instantanée.', 144, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6966, 75, 'Parchemin de Sort Spécial Poisse', '(Double clic pour apprendre le sort) \\nCe parchemin vous permet d\'apprendre le sort Poisse... Réservé aux Srams uniquement.', 14, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6967, 14, 'Parchemin d\'intronisation du Mercenaire Apprenti', 'Ce parchemin est la clé qui permet à un Mercenaire d\'être promu apprenti.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6968, 14, 'Parchemin d\'intronisation chez les Mercenaires', 'Ce parchemin est la clé qui permet à un Mercenaire d\'être promu Mercenaire à part entière.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6969, 14, 'Parchemin d\'intronisation du Grand Mercenaire', 'Ce parchemin est la clé qui permet à un Mercenaire d\'être promu Grand Mercenaire.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6970, 14, 'Parchemin d\'intronisation du Maître Mercenaire', 'Ce parchemin est la clé qui permet à un Mercenaire d\'être promu Maître du Clan des Mercenaires.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6971, 16, 'Clint du disciple mercenaire', 'Ce chapeau est tout de même une assez bonne réplique du célèbre Clint, il conviendra parfaitement aux disciples mercenaires qui voudront se faire passer pour le maître.', 38, 1, '95#0#0#0#0d0+0');
INSERT INTO `website_shop_objects_templates` VALUES (6975, 16, 'Clint du mercenaire néophyte', 'Ce chapeau surpuissant est l\'insigne des mercenaires. Il a le pouvoir de vous protéger de la pluie et du soleil, et c\'est déjà pas mal...', 38, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6978, 18, 'Péki', 'Cette créature ressemble de loin à un Chienchien. Sa tête montre clairement qu\'elle a subi d\'énormes traumatismes qui l\'ont poussée à devenir végétarienne. Elle ne se nourrit donc que de végétaux et plantes qui poussent sur l\'île de Pandala.', 12, 60, '7d#190#0#0#0d0+400');
INSERT INTO `website_shop_objects_templates` VALUES (6980, 23, 'Dofus Vulbis', 'Ce Dofus a été pondu par un dragon qui a décidé de rester anonyme. Les aventuriers les plus avisés se demandent toujours pourquoi.', 4, 6, '80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (6981, 5, 'Dagues Lassay', 'La lame de ces dagues est en glace, ce qui est très pratique pour rafraîchir l\'haleine de vos ennemis, ouvrez-leur la bouche, plantez-y votre grosse dague glacée, et le tour est joué.', 44, 150, '64#8#d#0#1d6+7,62#8#d#0#1d6+7,80#1#0#0#0d0+1,76#1f#32#0#1d20+30,7d#c9#fa#0#1d50+200,77#1f#32#0#1d20+30,e1#10#14#0#1d5+15,e2#10#19#0#1d10+15,ae#12c#0#0#0d0+300,70#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6982, 5, 'Dagues Honies', 'Ces dagues ont baigné dans le sang de nombreuses créatures démoniaques agonisantes, comme des enfants par exemple, ce qui leur donne un cachet franchement original.', 50, 46, '62#6#f#0#1d10+5,77#10#1a#0#1d11+15,7c#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (6983, 5, 'Dagues Réceuses', 'Affûtées une fois par décennie seulement, ces dagues n\'en restent pas moins mortelles. Animées d\'une magie des plus obscures, elles se déplacent parfois toutes seules la nuit, pour aller se planter dans le meilleur des cas, dans le derrière des imprudents... Encore une histoire que l\'on raconte aux jeunes Iops pour leur faire peur.', 47, 143, '64#d#16#0#1d10+12,5d#4#5#0#1d2+3,7d#c9#fa#0#1d50+200,7c#1f#28#0#1d10+30,77#1f#32#0#1d20+30,8a#10#19#0#1d10+15,75#1#0#0#0d0+1,f4#5#8#0#1d4+4,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6984, 5, 'Dagues de l\'Apprenti Tueur de Bouftons', 'Ces dagues ont appartenu à un pauvre Sadida, dont la richesse fulgurante fera date dans l\'histoire d\'Amakna. En effet, ce Sadida avait dédié son existence à la chasse aux Bouftons, ce qui ne manquait pas de faire rire tous les habitants du village. Certains badauds venaient même de loin, pour le regarder chasser ces ridicules créatures et pour se moquer de lui. Sa vengeance fut terrible, car entre temps, il était devenu assez riche pour mettre à prix toutes les sales têtes qui s\'étaient moquées de lui.', 46, 113, '64#c#f#0#1d4+11,5f#3#4#0#1d2+2,77#1f#32#0#1d20+30,7d#47#64#0#1d30+70,7c#1a#28#0#1d15+25,73#2#3#0#1d2+1,b0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6986, 82, 'Bouclier du Mont Kipou brisé ', 'Ce brave bouclier a vu trop de batailles, il n\'est plus bon à rien dans son état. Peut-être que Bouwada, au village Pandala, pourra vous le remplacer.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (6987, 83, 'Petite Pierre d\'âme hasardeuse', 'Cette rune offre une petite chance de capturer des âmes de petite taille.', 1, 1, '2c1#19#0#32');
INSERT INTO `website_shop_objects_templates` VALUES (6988, 16, 'Sulik', 'Autrefois porté par un Xélor sauvage dont la soeur avait été enlevée par des esclavagistes sans scrupules, ce somptueux chapeau fera de vous un sauvage vraiment original.', 92, 172, '7d#12d#190#0#1d100+300,7c#29#32#0#1d10+40,dc#b#19#0#1d15+10,7b#29#3c#0#1d20+40');
INSERT INTO `website_shop_objects_templates` VALUES (6989, 16, 'Krokop', 'Ce chapeau a été confectionné il y a bien longtemps par des apprentis tailleurs qui voulaient se protéger des crises de colères de Mirko le tailleur. Ce dernier avait la fâcheuse habitude de décimer ses apprentis avec des coups de pieds en pleine tête, lorsqu\'ils ne travaillaient pas assez vite. Une façon comme une autre de les remotiver pour qu\'ils se mettent au travail.', 86, 120, '7d#97#c8#0#1d50+150,77#1f#32#0#1d20+30,7e#1f#32#0#1d20+30,b0#10#14#0#1d5+15,f1#6#a#0#1d5+5,d4#6#a#0#1d5+5,d3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6990, 16, 'Phalène', 'Cette coiffe est un hommage aux cousins lointains des Moskitos, les Phalènes. Bien plus gros, mais plus gentils que les Moskitos, les Phalènes avaient une fâcheuse tendance à chercher à se reproduire avec tout et n\'importe quoi, mais surtout avec n\'importe quoi, ce qui a conduit à une extinction progressive de leur espèce. Cette terrible histoire n\'avait laissé personne indifférent, et de nos jours, il est courant d\'insulter un aventurier de Phalène, lorsque l\'on veut insinuer qu\'il choisit très mal ses conjoints...', 87, 113, '7d#65#96#0#1d50+100,7c#15#1e#0#1d10+20,7e#1f#32#0#1d20+30,b2#6#a#0#1d5+5,d4#6#a#0#1d5+5,d3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6991, 16, 'Goyave', 'Cette étrange coiffe ressemble à un gros fruit déshydraté en décomposition, un peu comme vous après une soirée passée à la taverne.', 88, 46, '7d#1f#28#0#1d10+30,7e#10#19#0#1d10+15,b2#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (6992, 16, 'Kannipiou', 'Version embellie du célèbre masque Kanniboule, le Kannipiou vous permettra de passer pour un véritable chasseur de Pious, auprès de vos amis.', 89, 55, '7c#10#19#0#1d10+15,b2#3#7#0#1d5+2');
INSERT INTO `website_shop_objects_templates` VALUES (6993, 17, 'Cape Ricéfini', 'Hirvé Vélard, célèbre ménestrel de son état, aimait chanter à en perdre la voix. Il fut brûlé vif près de la banque de Bonta, après avoir fait scandale avec sa chanson \"Fais-la frire, Mourir ou vivre\".', 79, 46, '7d#b#f#0#1d5+10,b2#3#7#0#1d5+2');
INSERT INTO `website_shop_objects_templates` VALUES (6994, 17, 'Cape Hôte', 'Cette création hybride entre une hôte et une cape, est franchement étonnante. Si elle avait été confectionnée en cuir, le Captain Chafer l\'aurait adorée.', 80, 58, '7d#1a#28#0#1d15+25,7c#b#f#0#1d5+10,7e#15#1e#0#1d10+20,b2#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (6995, 17, 'Cape Houte', 'Cette cape très puissante a renversé plus d\'un imprudent ayant tenté de la porter, une caractéristique partagée avec la Momie Nova.', 81, 105, 'f3#6#a#0#1d5+5,b2#6#a#0#1d5+5,7e#1a#28#0#1d15+25,7c#10#19#0#1d10+15,7d#47#64#0#1d30+70,f2#6#a#0#1d5+5,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (6996, 9, 'Anneau Stradamus', 'Stradamus, était un viel Enutrof, complètement ivre, qui lisait l\'avenir dans les choppes de bière. La légende raconte qu\'à sa demande, il fût enseveli à la verticale dans un des murs de la taverne de Brâkmar, pour \"qu\'aucun poltron ne puisse renverser une bière sur sa tombe\". Le genre de légende colportée au fil des beuveries organisées par les Maîtres Sérianes.', 78, 48, '7d#10#19#0#1d10+15,b2#3#5#0#1d3+2,f0#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (6997, 9, 'Anneau Fioutioure', 'Celle qui a créé cet anneau pensait que la fin du monde était proche, elle passait ses journées à graver sur les tables en bois à l\'aide de son sertisseur, qu\'il n\'y avait plus d\'avenir pour les habitants d\'Amakna. La suite des événements, lui montra qu\'elle avait tort.', 79, 70, '7c#10#19#0#1d10+15,77#15#1e#0#1d10+20,b2#6#8#0#1d3+5,ae#96#0#0#0d0+150');
INSERT INTO `website_shop_objects_templates` VALUES (6998, 9, 'Alliance d\'Elya Wood', 'Cette petite alliance est parfaitement adaptée aux petits doigts des Eniripsas. Elle est en revanche presque inutilisable par les Iops à cause de leurs gros doigts boudinés, et leur incapacité à comprendre où se met une alliance.', 84, 120, '7d#3d#64#0#1d40+60,7e#15#23#0#1d15+20,b2#4#6#0#1d3+3,b0#b#f#0#1d5+10,f3#8#c#0#1d5+7,f0#8#c#0#1d5+7,d5#6#a#0#1d5+5,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (6999, 1, 'Médaille Lahilama', 'Lahilama était un grand chef spirituel qui officiait au fin fond des montagnes. Il s\'ennuyait tellement, qu\'il passait ses journées à coudre des bonnets jaunes pour ses disciples. La folie n\'a pas de limites.', 83, 31, '7d#b#14#0#1d10+10,b2#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (7000, 1, 'Bambamulette', 'Ce ridicule petit morceau de bambou est doté de pouvoirs magiques bien étranges. Il était autrefois porté par les jeunes Pandawas, une fois la puberté passée. Vous devriez peut-être attendre encore quelques années avant de le porter autour du coup...', 78, 40, 'b2#3#5#0#1d3+2,7d#b#14#0#1d10+10,9d#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (7001, 1, 'Talisman du Faucheur d\'Avoine', '\"Je ne suis pas un Tikoko, les Trukikols me collent à la peau, je ne suis pas un Tikoko, un Tikokooooooo...\". Voilà ce que chantait à tue-tête en revenant de ses vacances sur l\'île de Moon, Danioule le célèbre ménestrel paysan, connu pour battre l\'Avoine en chantant.', 84, 55, '7e#15#1e#0#1d10+20,b2#3#5#0#1d3+2,f3#1#5#0#1d5+0,f2#1#5#0#1d5+0,f1#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (7002, 1, 'La Résinette', 'Cette amulette en résine de Bambou diffusera autour de vous une odeur agréable. Très efficace pour dissimuler vos essais de Vents de Panique.', 85, 94, '7d#1f#32#0#1d20+30,7c#10#19#0#1d10+15,b2#4#8#0#1d5+3,70#3#4#0#1d2+2,b0#b#f#0#1d5+10,f4#4#5#0#1d2+3,f3#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7003, 1, 'Talisman d\'Elya Wood', 'Ce Talisman a été confectionné avec de la poussière d\'étoiles et de pierres précieuses, prises dans de l\'ambre d\'Abraknyde Ancestral. Le mélange étant parfois explosif, il est déconseillé d\'en fabriquer une vous-même, laissez cela à un Bijoutier que vous n\'aimez pas.', 86, 135, '7d#65#96#0#1d50+100,7c#1f#28#0#1d10+30,7e#b#1e#0#1d20+10,f3#9#d#0#1d5+8,f0#9#d#0#1d5+8,d4#5#7#0#1d3+4,d3#5#7#0#1d3+4,6f#1#0#0#0d0+1,b2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (7004, 83, 'Moyenne Pierre d\'âme hasardeuse', 'Cette rune offre une petite chance de capturer des âmes relativement importantes.', 8, 1, '2c1#19#0#64');
INSERT INTO `website_shop_objects_templates` VALUES (7005, 83, 'Grande Pierre d\'âme hasardeuse', 'Cette rune offre une petite chance de capturer des âmes particulièrement farouches...', 9, 1, '2c1#19#0#96');
INSERT INTO `website_shop_objects_templates` VALUES (7006, 83, 'Enorme Pierre d\'âme hasardeuse', 'Cette rune offre une petite chance de capturer des âmes extrêmement hargneuses...', 10, 1, '2c1#19#0#c8');
INSERT INTO `website_shop_objects_templates` VALUES (7007, 83, 'Petite Pierre d\'âme', 'Cette rune offre une chance correcte de capturer des âmes de petite taille.', 2, 1, '2c1#32#0#32');
INSERT INTO `website_shop_objects_templates` VALUES (7008, 83, 'Moyenne Pierre d\'âme', 'Cette rune offre une chance correcte de capturer des âmes relativement élevées...', 12, 1, '2c1#32#0#64');
INSERT INTO `website_shop_objects_templates` VALUES (7009, 83, 'Grande Pierre d\'âme', 'Cette rune offre une chance correcte de capturer des âmes particulièrement farouches...', 13, 1, '2c1#32#0#96');
INSERT INTO `website_shop_objects_templates` VALUES (7010, 85, 'Pierre d\'âme pleine', 'Cette pierre d\'âme contient les âmes d\'un groupe de monstres qui ne demandent qu\'à revenir à la vie pour se venger de vous. Elle n\'est cependant utilisable que dans les arènes prévues à cet effet, situées dans les grandes cités.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7011, 17, 'Cape du Désir O\'Boul', 'Cette cape presque vivante en poils de barbe roux est unique en son genre. Animée d\'une magie extraordinaire, elle a tendance à jouer de nombreux tours à son porteur, en se cachant toujours au moment de partir à l\'aventure, lorsqu\'on a besoin d\'elle. Elle compense heureusement sa fourberie, par une puissance en combat à toute épreuve, qui fait d\'elle une \"véwitable meuchine de guewe\" d\'après certains Wabbits.', 83, 67, '73#3#4#0#1d2+2,70#4#5#0#1d2+3,7c#10#1e#0#1d15+15,7d#29#3c#0#1d20+40');
INSERT INTO `website_shop_objects_templates` VALUES (7012, 1, 'La Doubitch O\'Boul', 'Cette amulette est en fait une confiserie. Elle pourrait être mangée si elle n\'avait pas auparavant été roulée sous les aisselles pendant 36 générations, par une horde de femelles Bwork en chaleur.', 87, 77, 'b0#b#f#0#1d5+10,6f#1#0#0#0d0+1,7e#15#23#0#1d15+20,7d#29#3c#0#1d20+40');
INSERT INTO `website_shop_objects_templates` VALUES (7013, 38, 'Bois de Bambou', 'Contrairement aux roseaux, le bambou plie et casse. Heureusement, ce sont souvent les dents des aventuriers imprudents qui cassent sous les coups de bambous. Parfois, même la nature se met au service des dentistes sans scrupules.', 673, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (7014, 38, 'Bois de Bambou Sacré ', 'Contrairement aux apparences, ce bois est sacré. Seuls les meilleurs Pandawas, ont normalement accès à la coupe de ce bois, mais il arrive parfois que des touristes bûcherons, ne se gênent pas pour repartir avec un souvenir local, de leur voyage sur l\'île de Pandala. On parle alors de \"sacrés touristes\".', 671, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7015, 38, 'Pousses de Bambou', 'Ces pousses de bambou sont impropres à la consommation, car elles n\'ont vraiment aucun goût. Il est donc conseillé de les faucher avec une faux rouillée, ou de les laisser macérer quelques années dans du jus de Gloutovore avant de les servir à vos amis. Encore une vieille pratique empruntée aux restaurateurs peu scrupuleux, prêts à tous les subterfuges pour vous faire avaler n\'importe quoi.', 676, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (7016, 38, 'Bois de Bambou Sombre', 'Galthouze le jeune Pandawa avait un jour demandé à son père \"Quelle est la différence entre le Bambou, et le Bambou Sombre papa ?\". Il se prit une bonne claque bien méritée dans la tête pour avoir posé une question aussi stupide, tout le monde sait que ce qui différencie le Bambou du Bambou Sombre, c\'est la taille de leurs graines.', 672, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (7017, 38, 'Bois de Bambou Doré ', 'Galthouze le jeune Pandawa avait un jour demandé à son père \"Quelle est la différence entre le Bambou, et le Bambou Doré papa ?\". Il se prit une bonne fessée bien méritée pour avoir posé une question aussi stupide, tout le monde sait que ce qui différencie le Bambou du Bambou Doré, c\'est la taille de leurs racines.', 669, 45, '');
INSERT INTO `website_shop_objects_templates` VALUES (7018, 34, 'Riz', 'Collant, ou même gluant, le riz a toujours du succès auprès des jeunes Pandawas affamés.', 10, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (7020, 38, 'Fleur de Lotus', 'On raconte que c\'est la plus vieille fleur connue à ce jour, elle symbolise la fécondité, mais aussi le détachement, parce qu\'elle émerge parfois de l\'eau sans se mouiller. Certains chefs Pandawas se servent de ce symbole pour faire comprendre à leurs fidèles qu\'ils doivent vivre dans le monde sans en être affecté.', 141, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (7022, 4, 'Bâton de Sangroku', 'Ce bâton appartenait au grand-père de Sangroku, Sangrokrane, réputé pour avoir la grosse tête. La légende raconte que ce bâton magique est capable de s\'allonger pour atteindre n\'importe quel ennemi, ou tout simplement pour compenser certains complexes d\'infériorité.', 47, 120, '7d#97#c8#0#1d50+150,7c#10#1e#0#1d15+15,77#1f#2d#0#1d15+30,73#4#5#0#1d2+3,ae#97#c8#0#1d50+150,f2#6#8#0#1d3+5,d4#6#8#0#1d3+5,64#a#10#0#1d7+9,62#7#d#0#1d7+6');
INSERT INTO `website_shop_objects_templates` VALUES (7023, 51, 'Pierre d\'Aigue-Marine', 'On trouve généralement cette pierre dans les environs de l\'île de Pandala. Les Pandawas racontent que cette pierre est dotée de pouvoirs particuliers. Tout le monde en parle, mais personne ne les a encore découverts. Un peu comme les Iops intelligents.', 75, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (7024, 51, 'Pierre de Topaze', 'Cette pierre étrange servait il y a très longtemps, de nourriture aux jeunes Craqueboules de certains éleveurs de Pandala. Ces pierres sont devenues si rares, qu\'il est devenu interdit de s\'en servir pour nourrir les Craqueboules.', 76, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (7025, 51, 'Pierre d\'Agathe', 'Cette pierre tire son nom d\'une rivière de Pandala dans laquelle on la trouvait jadis en abondance. Mais les temps ont bien changé, et l\'exploitation intensive de ses gisements, a fini par la rendre presque introuvable.', 128, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (7026, 50, 'Aigue-Marine', 'Cette pierre précieuse transparente et parfois légérement bleutée, est si éclatante, que portée autour du cou, elle permettra de cacher les rides les plus marquées. Les Pandawas n\'hésitent d\'ailleurs pas à lancer aux touristes : \"Avec cette pierre, rendez votre dulcinée heureuse, et acceptez plus facilement les affres du temps qui s\'abattent sur ceux que vous aimez\". Une bonne façon de faire d\'une pierre, deux coups.', 101, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (7027, 50, 'Topaze', 'Très appréciée des bijoutiers pour des raisons un peu douteuses, cette pierre précieuse n\'en reste pas moins une valeur sûre pour attirer l\'attention des Corbacs au milieu des Plaines de Cania.', 102, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (7028, 50, 'Agathe', 'Cette pierre tient son nom d\'une très puissante femelle Pandawa, connue sous le nom d\'Agathe Pahtes, célèbre dans les lieux de débauches peu recommandables, comme le bar des Pirates de Sufokia par exemple, où elle passa ses dernières années à danser enchaînée à un gros mât de bateau planté au milieu du bar.', 103, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (7029, 10, 'Ceinture de Sangroku', 'Lorsque Sangroku avait trop abusé des haricots magiques, il serrait bien fort cette ceinture autour de sa taille, pour contenir au maximum, les vents de panique qui l\'ont rendu célèbre à travers toute la province d\'Amakna.', 80, 86, '77#1c#23#0#1d8+27,7d#2b#38#0#1d14+42,b2#4#6#0#1d3+3,b0#b#d#0#1d3+10,d3#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7030, 59, 'Peau de Kanigrou', 'Une fois épilée, la peau de Kanigrou est très douce, un peu comme pour les femelles Sadidas.', 47, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (7031, 1, 'Pendule du Gudule', 'Le pauvre Gudule a perdu la tête suite à un terrible combat avec Many. Heureusement, son amulette elle n\'a pas été abimée pendant l\'affrontement. Elle a gardé ses pouvoirs hypnotisants, mais aussi laxatifs. A utiliser avec modération.', 90, 46, 'e1#6#7#0#1d2+5,73#2#3#0#1d2+1,77#15#1d#0#1d9+20,7d#20#31#0#1d18+31');
INSERT INTO `website_shop_objects_templates` VALUES (7032, 39, 'Silicate', 'Ce minerai provient sûrement des profondes mines sombres de l\'île de Pandala dans lesquelles Gardan Framine est tombé éperdument amoureux d\'un spectre de femelle Pandawa. Comme quoi, l\'amour ne connaît aucune limite.', 111, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (7033, 39, 'Dolomite', '\"Toujours dur, et incassable\" telles étaient les paroles d\'Irko le Mineur Sombre à propos du Dolomite.', 110, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (7034, 16, 'Casque de Maître Nabur', 'Transmis de générations en générations, ce casque difforme a même été porté par Crail en personne. Beaucoup d\'aventuriers lui prêtent des pouvoirs qu\'il n\'a pas, caractéristique partagée avec beaucoup de divinités et de héros des temps modernes.', 93, 97, '7d#47#64#0#1d30+70,77#24#32#0#1d15+35,e2#10#19#0#1d10+15,ae#c9#190#0#1d200+200,d3#6#a#0#1d5+5,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (7035, 40, 'Pyrute', 'Cet alliage était utilisé pour forger des lames qui ne rouillaient pas au contact du sang et de la bave des ennemis.', 708, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7036, 40, 'Rutile', 'Cet alliage brillant, est très apprécié des bijoutiers ruinés, qui ne peuvent s\'offrir des pierres précieuses et qui en profitent généralement pour confectionner des alliances à un prix défiant toute concurrence. Très pratique lorsque vous tenez à vous marier par intérêt.', 707, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7037, 4, 'Canne de Mamie Bonbon', 'Cette canne appartenait à Mamie Bonbon en personne, une des trois terribles prêtresses de l\'amour. Affûtée à une extrémité et lustrée à une autre, cette canne était surtout célèbre pour sa polyvalence et sa capacité à pouvoir se fourrer n\'importe où. Personne ne pouvait y rester insensible.', 48, 98, '64#1#28#0#1d40+0,5f#2#3#0#1d2+1,7d#51#6e#0#1d30+80,7c#15#1e#0#1d10+20,7b#1f#2d#0#1d15+30,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (7038, 16, 'Couronne du Roi Gelax', 'Cette couronne a appartenu à l\'illustre Roi Gelax, réputé pour son romantisme débordant et son pouvoir de séduction qui a marqué à vie plus d\'une Gelée femelle... On raconte même, qu\'il est plus ou moins le père de toutes les Gelées de la région d\'Amakna, preuve s\'il en est, de son endurance et de sa fertilité légendaire.', 94, 79, '7d#c9#12c#0#1d100+200,73#4#6#0#1d3+3,ae#c8#0#0#0d0+200');
INSERT INTO `website_shop_objects_templates` VALUES (7039, 10, 'Ceinture Noire de Frank Lee Bruce', 'Célèbre combattant du dimanche, Frank s\'est reconverti dans les arts martiaux après avoir lamentablement raté son diplôme de tailleur de pierres.', 81, 47, '76#10#19#0#1d10+15,7c#b#f#0#1d5+10,77#10#19#0#1d10+15,73#2#3#0#1d2+1,e1#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7040, 2, 'Arc de Kuri', 'Cet arc a appartenu à Kuri en personne, célèbre prêtresse de l\'amour, et bras gauche de Mamie Bonbon. Ne tournez jamais le dos à une prêtresse de l\'amour, une seule flèche de cet arc peut suffire à vous déchirer le coeur, voire même les fesses, si vous ne faites pas face à votre adversaire.', 43, 56, '63#1#1e#0#1d30+0,7d#10#1e#0#1d15+15,7e#10#1e#0#1d15+15,b2#2#3#0#1d2+1,6c#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (7041, 30, 'Pandrista', 'Aussi appelée Galop du Pandawa, la Pandrista est une spécialité de Pandala bien connue des voyageurs. Les symptômes : envie pressante de monter sur le trône suivie d\'une incapacité à mouler un étron digne de ce nom.', 8, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7042, 14, 'Couvre-chef Pandawa', 'Contrairement au Pandawa d\'Amakna, le Pandawa de Pandala ne vous donnera pas la grosse tête, juste une grosse envie d\'aller déposer un engrais naturel sur le végétal le plus proche... Ou à défaut, sur un chacha : c\'est tout aussi efficace (pour vous) et surtout plus rigolo.', 31, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7043, 23, 'Dofus des Glaces', 'La légende dit que ce splendide Dofus est sorti du trou givré d\'Aguabrial le dragon de l\'Eau. La légende ne dit pas qu\'il était enrhumé ce jour-là, mais c\'est pourtant facile à deviner.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7044, 24, 'Faux Dofus', 'Ce Dofus ne ressemble pas aux autres Dofus et pourtant...', 256, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7045, 79, 'Une fiole de Pandaburg', 'La Pandaburg est une boisson goûtue, qui a du retour, et qui paraîtrait-il rendrait aveugle, muet et sourd, mais lentement. Ça tombe bien, les Pandawas ne sont pas pressés.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7046, 79, 'Une fiole de Pandapiler', 'Selon l\'érudit Hel Munster, cet authentique nectar ravirait la déesse Pandawa elle-même, la rendant toute euphorique. Tout Pandawa qui se respecte devrait offrir ses Pandapilers à sa déesse vénérée.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7047, 79, 'Une fiole de Pandapils', 'Etrange cette vieille coutume pandawaïenne qui veut que l\'on trinque, une plume de Tofu sur la tête, en chantant : \"Pandapils, Pandapils, lalalaLALEREUH !\". Et encore, ce n\'est pas la pire...', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7055, 79, 'Une fiole de Pandneken', '\"Les pattes du Bwak sont courtes, il est vrai, mais les allonger ne lui apporterait rien\". C\'est à ce genre de réflexions que mène la consommation de Pandneken. C\'est pourquoi les Pandawas préfèrent la réserver aux libations en l\'honneur de Pandawa.', 12, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7056, 16, 'Krépite', 'Ce chapeau unique a appartenu à un Xélor, connu pour ses idées explosives et sa maîtrise du temps. Il est mort d\'une façon assez peu commune en lançant un Vent de Panique décoiffant, et en oubliant que son chapeau lançait de petites étincelles autour de lui. Sa mort fut paraît-il assez douloureuse, mais si lumineuse, qu\'on raconte qu\'il aurait éclairé la cité de Brâkmar toute entière pendant quelques secondes.', 95, 149, '7d#c9#12c#0#1d100+200,7c#1f#28#0#1d10+30,b0#10#1e#0#1d15+15,f3#8#f#0#1d8+7,f2#8#f#0#1d8+7,d5#6#c#0#1d7+5,d4#6#b#0#1d6+5');
INSERT INTO `website_shop_objects_templates` VALUES (7057, 32, 'Assistant du shaman', 'Amenez l\'assistant auprès de la déesse, il vous en sera reconnaissant.', 0, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7058, 16, 'Octovius', 'Cette coiffe a été confectionnée à partir de restes de Kralamoures morts, séchés. Attention, elle risque de reprendre vie si vous vous en servez comme bonnet de bain.', 96, 77, '7d#c9#fa#0#1d50+200,f1#6#8#0#1d3+5,f0#6#8#0#1d3+5');
INSERT INTO `website_shop_objects_templates` VALUES (7059, 58, 'Graine de Pandouille', 'Cette énorme graine est gorgée d\'une huile indigeste, mais magique. Sa coquille est réputée incassable, de nombreux artisans s\'en servent pour enchanter des armes, et d\'autres l\'utilisent comme cochonnet magique pour jouer aux boules.', 67, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7060, 24, 'Pandapiler spéciale', 'Le sage Lenald vous a donné cette Pandapiler pour l\'apporter au Maître Pandawushu de la voie de l\'eau.', 501, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7061, 31, 'Transformation Chacha', 'L\'eau de la source jus-sang-ki-eau du Chacha vous a transformé temporairement en Chacha, le moindre choc vous fera redevenir normal.', 21, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7062, 32, 'Poochan', 'Vous devez amener Poochan où se trouve son futur mari.', 21, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7068, 52, 'Farine de Riz', 'Cette farine est parfaite pour faire du ciment ou de la litière d\'Ouginak.', 7, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (7069, 82, 'Bouclier de Sidimote enfoncé ', 'Ce brave bouclier a vu trop de batailles, il n\'est plus bon à rien dans son état. Peut-être que Bouwada, au village Pandala, pourra vous le remplacer.', 8, 1, 'fe#b#14#0#1d10+10,fb#b#f#0#1d5+10,108#6#8#0#1d3+5');
