INSERT INTO `website_shop_objects_templates` VALUES (7077, 82, 'Bouclier en Mousse', 'Ce bouclier jaune, poreux mais absorbant a été conçu à partir des restes d\'un animal qui avait élu domicile dans un Maskananas tombé au fond de la mer.', 10, 1, 'fb#1#0#0#0d0+1');
