INSERT INTO `website_shop_objects_templates` VALUES (7085, 82, 'Bouclier du Chouque sabordé ', 'Ce brave bouclier a vu trop de batailles, il n\'est plus bon à rien dans son état. Peut-être que Bouwada, au village Pandala, pourra vous le remplacer.', 18, 1, '105#c#e#0#1d3+11,fa#13#19#0#1d7+18,fb#2a#31#0#1d8+41');
