INSERT INTO `website_shop_objects_templates` VALUES (7089, 82, 'Bouclier Pandawa bourré ', 'Ce brave bouclier a vu trop de batailles, il n\'est plus bon à rien dans son état. Peut-être que Bouwada, au village Pandala, pourra vous le remplacer.', 22, 1, '108#6#8#0#1d3+5,fe#9#a#0#1d2+8');
