INSERT INTO `website_shop_objects_templates` VALUES (7091, 82, 'Cadran de Feu déréglé ', 'Ce brave bouclier a vu trop de batailles, il n\'est plus bon à rien dans son état. Peut-être que Bouwada, au village Pandala, pourra vous le remplacer.', 24, 1, '107#8#c#0#1d5+7');
INSERT INTO `website_shop_objects_templates` VALUES (7092, 82, 'Cadran d\'Air déréglé ', 'Ce brave bouclier a vu trop de batailles, il n\'est plus bon à rien dans son état. Peut-être que Bouwada, au village Pandala, pourra vous le remplacer.', 26, 1, '106#8#c#0#1d5+7');
INSERT INTO `website_shop_objects_templates` VALUES (7093, 82, 'Cadran de Terre déréglé ', 'Ce brave bouclier a vu trop de batailles, il n\'est plus bon à rien dans son état. Peut-être que Bouwada, au village Pandala, pourra vous le remplacer.', 27, 1, '104#4#8#0#1d5+3');
INSERT INTO `website_shop_objects_templates` VALUES (7094, 82, 'Cadran d\'Eau déréglé ', 'Ce brave bouclier a vu trop de batailles, il n\'est plus bon à rien dans son état. Peut-être que Bouwada, au village Pandala, pourra vous le remplacer.', 25, 1, '105#5#8#0#1d4+4');
INSERT INTO `website_shop_objects_templates` VALUES (7097, 82, 'Bouclier d\'entraînement', 'Ce bouclier est donné aux disciples qui ne savent pas encore correctement utiliser un bouclier.', 1, 1, '32c#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (7098, 7, 'Marteau du Forgeur de Boucliers', 'Ce marteau est indispensable à la confection de boucliers.', 2, 1, '64#2#3#0#1d2+1,ae#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (7102, 6, 'Epée du Chevalier de Glace', 'Le Chevalier de Glace était connu pour être un des plus grands forgeurs d\'épées de tout Amakna. Seule l\'horrible et impitoyable Liche refusait de reconnaître son immense talent. Vexé qu\'une telle créature puisse ne pas s\'émerveiller devant ses créations, il lui posa un ultimatum : il refusa d\'exercer sa profession tant qu\'elle ne fît pas l\'effort de reconnaître publiquement le talent du forgeur d\'épées. Mais c\'était mal connaître la terrible Liche, qui ne céda point. Le forgeur dû se résoudre à forger à nouveau plusieurs centaines d\'années plus tard. Entre temps, il avait complètement oublié son métier, et cette épée ridicule fut sa dernière création utilisable.', 51, 12, '51#6#d#0#1d8+5,7b#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (7103, 3, 'La Xyothine', 'Cette baguette servait à décapiter tous les ploucs d\'Amakna. Autant dire qu\'elle a beaucoup servi. Il est intéressant de constater qu\'elle ressemble à s\'y méprendre à un bâton, et même peut-être à une canne... Peut-être était-elle utilisée pour assouvir les vieux fantasmes de son propriétaire, qui a fini par lui donner son nom. Personne ne saura jamais le fin mot de cette histoire sordide.', 53, 145, '63#9#d#0#1d5+8,64#9#d#0#1d5+8,5d#4#5#0#1d2+3,7d#65#96#0#1d50+100,7c#15#28#0#1d20+20,7e#1f#32#0#1d20+30,73#3#4#0#1d2+2,b2#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (7104, 11, 'Tongues Baques', 'Ces tongues servaient à pratiquer différents arts martiaux. D\'un aspect peu innovant et artistiquement ratées, elles sont très vite tombées dans l\'oubli, un peu comme vous, mais moins vite tout de même.', 58, 67, '7c#10#19#0#1d10+15,7e#10#19#0#1d10+15,b2#3#5#0#1d3+2,d2#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7105, 24, 'Amulette de Pandala', 'Cette amulette d\'apparence trés simple renferme un mystère que seul un Pandawa sur le point de mourir est capable de comprendre ...', 48, 0, '');
INSERT INTO `website_shop_objects_templates` VALUES (7106, 1, 'Larvamulette', 'Avec cette tête de larve autour du cou, vous ressemblez à Ulrik Holgan célèbre dompteur de larves des temps modernes.', 88, 26, '7d#6#14#0#1d15+5,7e#6#14#0#1d15+5,77#6#13#0#1d14+5');
INSERT INTO `website_shop_objects_templates` VALUES (7107, 11, 'Larvabottes', 'Qui n\'a jamais rêvé d\'enfoncer son pied directement dans les entrailles d\'une larve ? En tout cas sûrement pas vous, alors profitez-en et lâchez-vous.', 53, 33, '7e#6#12#0#1d13+5,b2#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (7108, 81, 'Larvasac', 'Ce sac  original mais sans fioritures était très en vogue il y a bien longtemps. Un exemple typique du mauvais goût de vos ancêtres.', 60, 27, '7d#7#9#0#1d3+6,70#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (7109, 16, 'Larvacoiffe', 'Enfin, l\'opportunité de ressembler à une vraie larve s\'offre à vous. Vous pourrez enfin afficher ouvertement votre mode de vie larvesque.', 103, 34, 'e1#2#3#0#1d2+1,73#2#3#0#1d2+1,7c#6#a#0#1d5+5,7d#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (7110, 3, 'Baguette Larvesque', 'Cette terrifiante baguette est en fait un boyau de larve desséché puis enchanté, et enfin réhydraté. Il ne ressemble plus à rien désormais, un peu comme vous en fait, sauf que vous n\'êtes même pas enchanté.', 19, 40, '65#1#2#0#1d2+0,51#8#c#0#1d5+7');
INSERT INTO `website_shop_objects_templates` VALUES (7112, 23, 'Dofus Tâcheté ', 'Seul l\'accouplement d\'un dragon noir et d\'un dragon blanc a pu permettre la création d\'un tel oeuf. Ou alors il s\'agit d\'une supercherie.', 8, 6, '');
INSERT INTO `website_shop_objects_templates` VALUES (7113, 23, 'Dofawa', 'Ce Dofus ressemble étrangement à un oeuf de Dragodinde sauvage... Pour une fois, les apparences ne sont peut-être pas trompeuses.', 9, 6, '7d#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (7114, 23, 'Dofus Ebène', 'Sombre comme les ténèbres, dur comme le roc, Grougalorasalar le Dragon Noir a créé le Dofus Ebène pour lui tenir compagnie. Il avait simplement oublié qu\'un Œuf, aussi magique fut-il, ne parle pas.', 7, 6, '');
INSERT INTO `website_shop_objects_templates` VALUES (7115, 23, 'Dofus Ivoire', 'Si sa blancheur n\'a pas d\'égal, c\'est que Dardondakal le Dragon blanc, blanchit le Dofus Ivoire à grands coups d\'haleine chaque matin (un vieux truc que lui a refilé sa grand-mère Dragon).', 11, 6, '');
INSERT INTO `website_shop_objects_templates` VALUES (7116, 9, 'Anneau Merta', 'Cet anneau dispose d\'un bien étrange enchantement. En effet, une fois porté autour du doigt, vous ne pourrez plus parler qu\'au Bijoutier qui vous l\'a confectionné.', 91, 59, '7e#10#19#0#1d10+15,77#10#19#0#1d10+15,73#2#3#0#1d2+1,b2#3#4#0#1d2+2,ae#65#96#0#1d50+100,f1#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7117, 9, 'Alliance Ethnique', 'Un groupe de Ménestrels cosmopolites, mais particulièrement mauvais, avaient décidé d\'utiliser cette alliance pour se reconnaître dans la foule qui venait assister à leurs représentations. Finalement, cette alliance ne leur fut d\'aucune utilité car ils n\'eurent aucun succès. Selon certaines mauvaises langues ou bonnes oreilles, c\'était bien mérité.', 92, 53, '7e#15#23#0#1d15+20,7b#15#23#0#1d15+20,b0#4#5#0#1d2+3,f3#3#4#0#1d2+2,f2#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (7118, 9, 'Anneau K\'Tuelle', 'Cet anneau en forme de gros papillon de nuit ne mettra pas vos mains en valeur, mais ce n\'est peut-être pas plus mal...', 94, 90, '7d#33#64#0#1d50+50,77#15#23#0#1d15+20,7b#15#23#0#1d15+20,70#3#4#0#1d2+2,b0#6#a#0#1d5+5,d5#4#5#0#1d2+3,d4#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7119, 9, 'Anneau Ha', 'Le bijoutier à l\'origine de cette oeuvre n\'a contrairement aux apparences aucun lien de parenté avec un célèbre forgeur d\'épées. D\'après son créateur, cet anneau est censé vous rappeler l\'ambiance de la brousse, sans pour autant sentir les secousses. Personne n\'a encore compris de quoi il parlait.', 85, 58, '7d#10#19#0#1d10+15,77#10#19#0#1d10+15,70#4#5#0#1d2+3,e1#4#5#0#1d2+3,e2#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (7120, 9, 'Anneau Hé ', 'Cet anneau appartenait à un vieillard, qui selon certaines rumeurs, aurait sauvé toutes les créatures de l\'île de Moon d\'un terrible déluge, en les amenant sur son radeau. Une autre version des faits raconte qu\'il aurait troqué son radeau contre un petit singe, au lieu de sauver les créatures de l\'île.', 86, 44, '7d#1f#32#0#1d20+30,7c#b#14#0#1d10+10,73#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (7121, 9, 'Anneau Zocomial', 'Cet anneau vivant dispose d\'un terrible envoûtement, capable de rendre malades les aventuriers les plus résistants. On raconte qu\'il était à l\'origine censé soigner celui qui le porte autour de l\'index et qu\'il est devenu dangereux et agressif à force de se retrouver contre sa volonté dans des endroits peu recommandables.', 87, 50, '7d#15#23#0#1d15+20,8a#b#f#0#1d5+10,ae#65#96#0#1d50+100,f1#4#5#0#1d2+3,f2#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7122, 9, 'Anneau Vice', 'Anneau des débutants par excellence, c\'est également l\'anneau symbolisant le mieux un bon nombre de moeurs inavouables. Il semblerait qu\'il vous corresponde dans tous les cas, très bien.', 88, 18, '7c#1#5#0#1d5+0,7d#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (7123, 9, 'Anneau Bsène', 'Réservé aux aventuriers avertis, cet anneau risque de choquer votre entourage s\'il est composé de jeunes créatures innocentes.', 95, 70, '7d#15#23#0#1d15+20,b2#4#5#0#1d2+3,70#4#5#0#1d2+3,b6#1#0#0#0d0+1,d5#1#2#0#1d2+0,d3#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (7124, 42, 'Dofus au lait', 'Cet œuf de Dofus possède un pouvoir hors-pair, celui de vous faire saliver de bonheur.', 27, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7125, 42, 'Dofus au chocolat blanc', 'Cet oeuf de Dofus possède un pouvoir hors-pair, celui de vous faire saliver de bonheur.', 28, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7128, 9, 'Anneau Karina', 'Contrairement à ce que certains pensent, cet anneau n\'a aucun rapport avec la sulfureuse Karina, qui s\'est à maintes reprises, mise en scène d\'une façon assez exotique dans le bar des pirates de Sufokia. En réalité, c\'est un musicien éleveur de Tofus, qui a donné ce nom à cet anneau, capable une fois porté autour du pouce, d\'émettre un son proche de celui que l\'on peut entendre lorsque l\'on tord le cou d\'un Tofu.', 89, 54, 'd2#2#3#0#1d2+1,d4#2#3#0#1d2+1,77#12#1e#0#1d13+17,7d#15#22#0#1d14+20,76#10#1c#0#1d13+15');
INSERT INTO `website_shop_objects_templates` VALUES (7129, 42, 'Panda au chocolat', 'Ne vous méprenez pas, il n\'y a pas que le chocolat qui donne du goût, la forme de la friandise apporte aussi son lot de saveur. Goûtez une Ouassingue au chocolat et vous comprendrez peut-être mieux.', 31, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7130, 24, 'Recette du Dofus en chocolat', 'La recette du Dofus en chocolat, un must pour épater vos amis.', 250, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7131, 9, 'Anneau Piaume', 'Ce bijou a fait rêver plus d\'un aventurier avant vous. En effet, on lui prête énormément de vertus, comme celle de transformer les plus belliqueux en doux rêveurs. La notice indique clairement qu\'il est déconseillé de le mettre au feu, mais elle ne précise pas pourquoi.', 90, 57, 'b0#6#a#0#1d5+5,73#3#4#0#1d2+2,7c#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (7132, 9, 'Anneau Rigami', 'Cet anneau doit son nom aux dernières paroles de son créateur : \"Oh, Rigami mon ami !\" lança-t-il dans un râle de douleur terriblement amusant. Il est important de constater que la confection de cet anneau en Bambou est antérieure à l\'apparition des Bambous. Une énigme de plus qui ne risque pas d\'être résolue avant plusieurs décennies.', 96, 49, '7d#15#28#0#1d20+20,f0#3#5#0#1d3+2,f1#3#5#0#1d3+2,f2#3#5#0#1d3+2,f3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (7133, 30, 'Mixomawose', 'N\'importe quel Wabbit vous le dira, si vous ne voulez pas voir la vie en rouge, évitez comme la peste la Mixomawose.', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7134, 30, 'Rage', 'On raconte que la rage transforme complètement les êtres atteints. Les personnes belliqueuses deviennent dociles, et les personnes calmes deviennent agressives. En revanche, celles qui bavaient déjà avant continueront de baver.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7135, 30, 'Maloria', 'Maladie transmise par les Moskitos qui habitent les régions au climat tropical, la Maloria, est aussi appelée Molaria par certains indigènes, car la maladie semble se transmettre également par les crachats de Moskitos.', 11, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7136, 1, 'Médaille Kido', 'Cette médaille appartenait à un célèbre Pandawa, maître d\'une vieille école d\'arts martiaux qui enseignait à ses disciples la défense en utilisant la force de ses adversaires. Son école a fini par disparaître car ses adversaires n\'étaient plus assez forts.', 89, 125, '7d#65#96#0#1d50+100,7e#15#28#0#1d20+20,7c#1f#28#0#1d10+30,b0#10#14#0#1d5+15,6f#1#0#0#0d0+1,d4#6#a#0#1d5+5,d5#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (7137, 17, 'Cape Huccino', 'Cette cape a été cousue dans un seul et unique but, créer une cape capable de maintenir éveillé son porteur pendant plusieurs jours d\'affilée. Le résultat est bel et bien présent, elle est si rigide, qu\'elle vous gardera debout dans toutes les circonstances. Attention cependant, vous ne serez plus capables de nouer vos lacets.', 15, 44, '7d#15#23#0#1d15+20,7e#15#23#0#1d15+20,70#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (7138, 17, 'Ortiz', 'Portée par les plus grands de ce monde, cette cape est surtout réputée pour sa douceur légendaire, qui lui permet d\'être portée sans aucun sous-vêtement lors des saisons chaudes. Une forme raffinée d\'exhibitionnisme qui en a séduit plus d\'un.', 91, 125, '7e#1a#32#0#1d25+25,7d#97#c8#0#1d50+150,7c#15#23#0#1d15+20,70#5#7#0#1d3+4,b1#b#f#0#1d5+10,d5#6#a#0#1d5+5,d4#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (7139, 10, 'Ceinture Sula', 'Sula la cordonnière aimait perdre son temps à flâner dans les champs, en quête d\'un amour improbable. A défaut de trouver l\'être tant convoité, elle trouva la mort en tombant dans une grande fosse remplie d\'immondices, près de la zone Cochonne. Son corps ne fût retrouvé que 7 décennies plus tard, au moment de vider la fameuse fosse. Son frère se serait alors écrié : \"je me doutais bien qu\'elle était quelque part\", juste avant de tomber lui aussi dans la fosse.', 82, 125, '7d#97#c8#0#1d50+150,77#1f#32#0#1d20+30,e1#10#14#0#1d5+15,e2#10#14#0#1d5+15,b0#10#14#0#1d5+15,f4#9#c#0#1d4+8,d6#5#7#0#1d3+4,d2#5#7#0#1d3+4,7b#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (7140, 10, 'Xénature', 'Contrairement aux apparences, Xéna, n\'était pas une guerrière, mais une cordonnière. Ses formes généreuses et sa passion sans limite pour les tâches ménagères la prédestinaient à une brillante carrière dans les brasseries d\'Amakna. Le destin en a décidé autrement.', 83, 125, '7d#97#c8#0#1d50+150,7e#1f#32#0#1d20+30,77#1f#32#0#1d20+30,b2#3#5#0#1d3+2,ae#12c#0#0#0d0+300,b0#10#14#0#1d5+15,d6#4#5#0#1d2+3,d5#4#5#0#1d2+3,d4#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7141, 16, 'Holoune', 'Ce chapeau étrange vous protègera des rayons du soleil, même la nuit. Attention, il reprend vie une fois toutes les trois décennies, et se retourne contre son maître en tentant de l\'étouffer pendant son sommeil.', 111, 122, '7d#c9#fa#0#1d50+200,7e#1f#32#0#1d20+30,7b#1f#32#0#1d20+30,73#4#5#0#1d2+3,b2#6#a#0#1d5+5,d5#6#a#0#1d5+5,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (7142, 16, 'Piruk', 'Ce chapeau était utilisé par certains Xélors, pour cacher leur calvitie naissante. Certains Enutrofs s\'en servaient même pour cacher leur femme. Une façon habile de cacher deux problèmes majeurs de la vie de tous les jours.', 112, 145, '7d#fb#12c#0#1d50+250,7c#15#28#0#1d20+20,7e#1f#32#0#1d20+30,ae#191#258#0#1d200+400,b0#6#a#0#1d5+5,f3#6#a#0#1d5+5,f2#6#a#0#1d5+5,d3#6#a#0#1d5+5,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (7143, 16, 'Solomonk', 'Le Solomonk était le chapeau d\'un vieux chef d\'une Tribu de Pandawas, experts en potions laxatives. Les Pandawas en question étant souvent obligés de tester eux-mêmes les effets de leurs potions, ils utilisaient ce type de chapeau, qui à défaut de les mettre en valeur, faisait un excellent pot de chambre.', 123, 120, '76#1f#32#0#1d20+30,7d#c9#fa#0#1d50+200,77#1f#32#0#1d20+30,73#5#7#0#1d3+4,70#6#a#0#1d5+5,e1#15#1e#0#1d10+20,8a#10#19#0#1d10+15,ae#12c#0#0#0d0+300');
INSERT INTO `website_shop_objects_templates` VALUES (7144, 16, 'Blémiche', 'Cette coiffe de mariée est passée de mode depuis bien longtemps, peut-être à cause de sa dentelle qui date d\'une autre ère. Recyclée en culotte, et portée sur une tête bien garnie en cheveux, elle pourrait cependant mettre en transe, le plus blasé des Chafers.', 116, 108, '7d#65#96#0#1d50+100,7c#15#23#0#1d15+20,b0#b#f#0#1d5+10,d4#6#a#0#1d5+5,d3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (7145, 16, 'Coiffe du Gaddie', 'Créature étrange sortie d\'un monde imaginaire, le Gaddie se démarquait avant tout par son extraordinaire ruse, son aversion totale pour le règne végétal, et sa faculté à jeûner pendant plusieurs jours en temps de guerre. Une créature aussi complexe à comprendre était de toute évidence impossible à maîtriser, on la laissa donc vivre en paix dans les mines sans fond de Kruup, où elle fit connaissance avec une vieille Liche dévoreuse de Bouftons.', 115, 106, '7d#c9#fa#0#1d50+200,f4#6#a#0#1d5+5,f1#6#a#0#1d5+5,d6#6#a#0#1d5+5,d3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (7146, 16, 'La Bertheuze', 'Cette coiffe surpuissante tient plus de la perruque qu\'autre chose, mais qu\'importe, elle est surpuissante. En effet, son propriétaire aimait se travestir et se faire passer pour les autres, afin de mieux profiter des personnes naïves. Ses jeux lugubres et glauques finirent par être découverts, tout comme son crâne, une fois sa coiffe retirée. Son immense talent d\'artiste lui sauva la vie, puisqu\'il se proposa quelques jours avant sa mise à mort, pour sculpter une statue géante à l\'effigie des parties intimes du Meulou. Il fût tout de même brûlé vif une fois la statue finie.', 114, 81, 'b2#4#6#0#1d3+3,77#10#1e#0#1d15+15,7e#10#1e#0#1d15+15,7d#51#6e#0#1d30+80,f1#6#a#0#1d5+5,f0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (7149, 42, 'Carré de chocolat noir', 'Extrait du cacao brut, ce carré de chocolat en sublime la saveur. Attention à ne pas en abuser sous peine de problème de digestion.', 34, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7150, 16, 'La Bekille', 'Ce chapeau au nom surprenant, appartenait à un pauvre Ecaflip, qui avait perdu l\'usage de la parole suite à un terrible traumatisme. Artiste dans l\'âme, et dans le sang, il fût contraint de suivre une formation de Brasseur. Il se noya dans un fût de bière et de larmes, vers son quatorzième anniversaire. Heureusement, la bière ne fut pas perdue pour autant, puisque le prêtre responsable des obsèques, tomba dans un coma éthylique pendant plusieurs années avant de reprendre son office là où il s\'était arrêté.', 109, 111, '7d#97#c8#0#1d50+150,7e#1f#32#0#1d20+30,77#1f#32#0#1d20+30,73#4#6#0#1d3+3,70#5#8#0#1d4+4,d3#5#8#0#1d4+4,d2#5#8#0#1d4+4');
INSERT INTO `website_shop_objects_templates` VALUES (7151, 16, 'Koloss', 'Le slogan publicitaire de ce casque était : \"Cet imposant casque en argile fera de vous un colosse à la tête d\'argile\". Une étude approfondie de l\'objet vous permettra de vous apercevoir que le casque en question n\'est pas en argile, mais en plomb. De quoi prendre un peu de plomb dans le crâne à moindre frais.', 108, 120, '76#1f#32#0#1d20+30,7d#97#c8#0#1d50+150,77#1f#32#0#1d20+30,e1#c#f#0#1d4+11,e2#c#f#0#1d4+11,b0#10#14#0#1d5+15,d2#6#8#0#1d3+5,d4#6#8#0#1d3+5');
INSERT INTO `website_shop_objects_templates` VALUES (7152, 16, 'Kanistère', 'Ce chapeau en forme de cuve servait aux pompiers d\'Amakna lors des incendies de champs de céréales. De nos jours, il sert avant tout aux Brasseurs et aux serveuses de taverne, qui servent de fûts sur pattes.', 110, 120, '7d#c9#fa#0#1d50+200,73#5#7#0#1d3+4,70#6#a#0#1d5+5,ae#5dc#0#0#0d0+1500');
INSERT INTO `website_shop_objects_templates` VALUES (7153, 7, 'Marteau Hubohu', 'Cet énorme marteau fait un bruit incroyable lorsqu\'il tape sur un crâne de Iop, car il a tendance à amplifier les résonances. Surprenant, mais terriblement efficace.', 51, 126, '64#10#1e#0#1d15+15,5b#6#a#0#1d5+5,7d#97#c8#0#1d50+150,7c#15#28#0#1d20+20,7e#1f#32#0#1d20+30,7b#1f#32#0#1d20+30,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (7154, 7, 'Marteau M\'Pouce', 'Ce léger marteau, était destiné à la base aux petits êtres : les Xélors utilisaient le manche, et les Araknes recevaient la masse sur la tête. Il a vite été détourné de son usage et constitue maintenant un petit jouet pour les jeunes Iops bricoleurs.', 46, 107, '64#9#11#0#1d9+8,63#9#11#0#1d9+8,65#1#0#0#0d0+1,7c#15#28#0#1d20+20,7e#1f#32#0#1d20+30,73#4#5#0#1d2+3,7d#65#96#0#1d50+100');
INSERT INTO `website_shop_objects_templates` VALUES (7155, 7, 'Marteau Nairedeubrest', 'Le célèbre Capitaine Kradoc a utilisé pendant des dizaines d\'années ce terrible marteau afin d\'occire tous ceux qui se mettaient en travers de son chemin, y compris femmes et enfants. Son mauvais caractère légendaire et son goût prononcé pour l\'alcool, en ont tout de même fait une personne très respectée des différents corps d\'armées, ennemis, comme alliés.', 48, 113, '64#6#f#0#1d10+5,5e#3#4#0#1d2+2,65#1#2#0#1d2+0,7d#97#c8#0#1d50+150,7c#15#28#0#1d20+20');
INSERT INTO `website_shop_objects_templates` VALUES (7156, 7, 'Marteau Ronto', 'Ce marteau rouillé est parfait pour éclater les érables, ou les Moskitos.', 50, 107, '64#1#14#0#1d20+0,51#1#50#0#1d80+0,7d#97#c8#0#1d50+150,7e#1a#28#0#1d15+25,7c#1a#28#0#1d15+25,b6#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (7157, 7, 'Marteau Ksain', 'Ce marteau était autrefois utilisé pour faire sonner la cloche de l\'église d\'Amakna. De nos jours, il sert toujours à faire de la musique, en broyant les os des imprudents par exemple.', 49, 124, '64#a#16#0#1d13+9,63#a#16#0#1d13+9,7d#c9#fa#0#1d50+200,7c#15#23#0#1d15+20,f4#5#7#0#1d3+4,f3#5#7#0#1d3+4,d6#4#5#0#1d2+3,d5#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7158, 7, 'Marteau Lahre', 'Conçu par un alchimiste de renom pendant un séjour dans les prisons de Brâkmar, ce marteau devait à l\'origine servir à casser le matériel d\'alchimie de ses concurrents.', 47, 143, '70#4#6#0#1d3+3,73#4#6#0#1d3+3,77#1f#32#0#1d20+30,7c#1a#28#0#1d15+25,7d#fb#12c#0#1d50+250,5d#5#7#0#1d3+4,62#b#14#0#1d10+10,64#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (7159, 7, 'Marteau Pinière', 'Ce marteau de mineur est utilisable comme une pelle ou pioche selon vos besoins. Son utilisation en jardinage est cependant proscrite, car il a tendance à détruire de manière définitive les pelouses.', 52, 135, '64#d#15#0#1d9+12,60#d#15#0#1d9+12,7d#c9#fa#0#1d50+200,7c#10#19#0#1d10+15,77#1f#32#0#1d20+30,7b#1f#32#0#1d20+30,f4#5#7#0#1d3+4,d6#5#7#0#1d3+4,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (7160, 2, 'Arc Hanne', 'Cet arc a été enchanté il y a bien longtemps par une magie des plus obscures. De quoi inquiéter autant son propriétaire que ses ennemis.', 44, 120, '64#10#19#0#1d10+15,5e#2#3#0#1d2+1,65#1#0#0#0d0+1,70#6#a#0#1d5+5,7d#65#96#0#1d50+100,7c#15#23#0#1d15+20,7e#1f#32#0#1d20+30,d4#4#5#0#1d2+3,d3#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7161, 2, 'Arc Assin', 'Cet arc était avant tout utilisé pour chasser les Sangliers des Plaines. En effet, il est si puissant, qu\'il permet à l\'aide d\'une seule flèche, de tuer plusieurs petits marcassins, à condition qu\'ils soient correctement alignés.', 45, 107, '63#6#d#0#1d8+5,64#6#d#0#1d8+5,7e#1f#32#0#1d20+30,77#1f#32#0#1d20+30,73#4#5#0#1d2+3,b0#b#f#0#1d5+10,d6#4#5#0#1d2+3,d5#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7162, 2, 'Arc Lavoine', 'Cet arc appartenait à un ménestrel indépendant, surtout célèbre, pour détruire les oreilles de ses ennemis avec ses chants de guerre. Il fut exilé pendant plusieurs années sur Pandala, à cause de ses chants qui étaient capables de rendre sourds les Corbacs de Brâkmar. Après avoir rendu fous plusieurs générations de Pandawas, il fut tout simplement livré vivant au grand Sorlok, pour être digéré lentement pendant plus de 752 années. Il y découvrit une nouvelle forme de plaisir intense.', 46, 130, '5b#6#14#0#1d15+5,5d#6#14#0#1d15+5,77#15#28#0#1d20+20,7b#15#28#0#1d20+20,70#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (7163, 2, 'Arc Huledela', 'Cet arc était avant tout utilisé comme une arme de dissuasion. Son propriétaire expliquait à qui voulait l\'entendre que ses flèches étaient empoisonnées, ce qui ne manquait pas d\'effrayer la population locale. Ainsi, il arrivait à faire reculer tous les pleutres qui se mettaient en travers de son chemin.', 47, 124, '64#10#19#0#1d10+15,5d#3#4#0#1d2+2,7d#97#c8#0#1d50+150,77#1a#2d#0#1d20+25,73#5#6#0#1d2+4,70#6#7#0#1d2+5,d6#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7164, 2, 'Arc Hisedaisange', 'Cet arc léger et fragile a séduit bon nombre d\'aventuriers, plus attachés aux apparences qu\'à l\'efficacité.', 48, 143, '70#6#a#0#1d5+5,7b#1f#32#0#1d20+30,77#1f#32#0#1d20+30,7e#1f#32#0#1d20+30,7c#15#28#0#1d20+20,7d#97#c8#0#1d50+150,62#6#d#0#1d8+5,63#6#d#0#1d8+5,64#6#d#0#1d8+5,d4#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (7165, 3, 'Baguette Nah', 'Cette baguette explosive a été trempée dans la lave d\'un volcan en éruption avant d\'être sculptée, puis enchantée. Il va sans dire qu\'elle semble très puissante, malgré son apparence ridicule.', 54, 105, '64#9#d#0#1d5+8,5e#4#5#0#1d2+3,7e#15#28#0#1d20+20,b2#4#6#0#1d3+3,f4#5#7#0#1d3+4,d6#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (7167, 3, 'Baguette Cetera', 'L\'artisan à l\'origine de cette baguette avait de nombreux apprentis qu\'il faisait travailler à longueur de journées. Il était censé leur apprendre les ficelles du métier, mais était en fait très mauvais pédagogue, il commençait toujours ses explications, mais ne les finissait jamais.', 50, 43, '64#8#11#0#1d10+7,b2#2#4#0#1d3+1');
INSERT INTO `website_shop_objects_templates` VALUES (7168, 3, 'Baguette Hylique', 'Une fois sculptée, cette baguette a été trempée dans la bière pendant plusieurs années. Elle a déjà commencé à pourrir, mais elle garde cependant encore quelques propriétés magiques, suffisantes pour divertir ou exterminer vos alliés.', 51, 63, '64#5#8#0#1d4+4,63#5#8#0#1d4+4,b2#4#5#0#1d2+3,7e#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (7169, 3, 'Baguette Hincelle', 'Idéale pour allumer le feu, ou animer les mariages ennuyeux, cette baguette vous permettra peut-être une fois dans votre vie, de faire des étincelles. Une occasion à saisir.', 52, 81, '64#b#14#0#1d10+10,5e#3#4#0#1d2+2,7d#15#23#0#1d15+20,7e#10#19#0#1d10+15,b2#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7170, 3, 'Baguette Houffe-Craitien', 'Houffe le pâtissier était fou au point de se marier avec la bûcheronne Craitien, et de l\'étouffer le lendemain avec ses pâtisseries trop grasses. On parle donc depuis cet événement, \"d\'histoire de Houffe\", pour relater les événements les plus fous.', 46, 112, '64#1#5#0#1d5+0,5e#2#3#0#1d2+1,7d#29#46#0#1d30+40,7c#15#23#0#1d15+20,7e#1a#28#0#1d15+25,73#5#6#0#1d2+4,b2#4#6#0#1d3+3,ae#97#fa#0#1d100+150');
INSERT INTO `website_shop_objects_templates` VALUES (7171, 3, 'Baguette Ourderie', 'Le sculpteur de cette baguette avait la fâcheuse habitude d\'oublier ses enfants à l\'école. Sa femme, une mère indigne comme tant d\'autres, s\'en réjouissait. Conscient d\'être trop étourdi, il sculpta cette baguette qui tous les jours, prenait vie et lui rappelait d\'aller chercher ses enfants. Il a par la suite tenté de faire des baguettes similaires pour rappeler à sa femme d\'aller faire le ménage, mais la baguette ne fut jamais assez puissante pour relever ce défi.', 47, 127, '7d#65#96#0#1d50+100,7e#1f#32#0#1d20+30,77#1f#32#0#1d20+30,b2#5#6#0#1d2+4,80#1#0#0#0d0+1,d5#5#6#0#1d2+4,d2#5#6#0#1d2+4,64#6#e#0#1d9+5,63#6#e#0#1d9+5');
INSERT INTO `website_shop_objects_templates` VALUES (7172, 3, 'Baguette Rhon', 'Cette baguette magique est encore de nos jours utilisée pour vider les fosses sceptiques, curer les fossés, et accessoirement pour se curer le nez. Les sculpteurs les plus avertis, vous expliqueront qu\'elle tire toute sa magie, des immondices qu\'elle a pu côtoyer, surtout celles présentes dans votre nez.', 49, 105, '64#6#f#0#1d10+5,5e#1#a#0#1d10+0,7d#65#82#0#1d30+100,7c#15#23#0#1d15+20,7e#15#23#0#1d15+20,6c#1#64#0#1d100+0');
INSERT INTO `website_shop_objects_templates` VALUES (7173, 3, 'Baguette Rangleuse', 'Cette terrifiante baguette est capable de s\'enrouler autour du cou de vos adversaires pour les étrangler lentement mais sûrement. Une façon originale et distinguée de donner la mort aux adversaires que vous respectez un peu.', 48, 27, '63#1#7#0#1d7+0,b2#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (7174, 17, 'Cape Pandawushu', 'Cette cape est indispensable à l\'entraînement au Pandawushu...', 89, 10, '7d#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (7175, 24, 'Certificat shamanique', 'Certificat médical indispensable pour la pratique du Pandawushuka.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7176, 4, 'Racine Cithi', 'C\'est un certain Frank, sculpteur de bâtons de son état, qui serait à l\'origine de cette petite merveille, capable d\'assombrir le ciel et de faire couler le sang des ennemis qui n\'en n\'ont pas. On raconte qu\'il aurait mis plus de mille heures pour la sculpter. Même vos ennemis ne pourront y rester indifférents.', 53, 143, '7d#c9#fa#0#1d50+200,76#1f#32#0#1d20+30,73#5#6#0#1d2+4,8a#10#14#0#1d5+15,65#1#0#0#0d0+1,b0#b#f#0#1d5+10,d4#5#7#0#1d3+4,64#7#10#0#1d10+6,64#7#10#0#1d10+6');
INSERT INTO `website_shop_objects_templates` VALUES (7177, 16, 'Bandeau Pandawushu', 'Avec ce bandeau Pandawushu noué autour du crâne, vous pourrez sans problème effrayer les jeunes Lenalds, en vous faisant passer pour un Maître en arts martiaux. N\'oubliez pas de pousser quelques cris de guerre pour paraître encore plus crédible.', 102, 1, 'ae#33#64#0#1d50+50');
INSERT INTO `website_shop_objects_templates` VALUES (7178, 4, 'Racine Horodon', 'Depuis des générations, les Sadidas utilisent des racines magiques comme bâtons. Cependant, il semblerait que certains d\'entre eux, se refusent encore à utiliser celle-ci, qui serait paraît-il, plus proche du fruit que de la racine. Fruit ou racine, qu\'importe, elle fait très mal là où elle se glisse et c\'est l\'essentiel.', 58, 86, '64#2#b#0#1d10+1,5e#2#3#0#1d2+1,7c#b#f#0#1d5+10,7e#10#1e#0#1d15+15,b2#3#5#0#1d3+2,70#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (7179, 25, 'Route et Chemin : Forêt Maudite', 'Ce livre regroupe les meilleurs itinéraires touristiques à faire dans le labyrinthe de la forêt maudite...un Must ! Du moins c\'est ce que la jaquette annonce.', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7181, 4, 'Racine Sémilla', 'Sémilla était une jeune Sadidette, très intéressée par le jardinage et accessoirement, une piètre chanteuse. Elle prenait d\'ailleurs régulièrement un malin plaisir à recevoir des râteaux, mais bizarrement, beaucoup moins de pelles.', 54, 106, '7d#65#96#0#1d50+100,64#6#12#0#1d13+5,5c#3#5#0#1d3+2,5e#3#5#0#1d3+2,7c#15#23#0#1d15+20');
INSERT INTO `website_shop_objects_templates` VALUES (7182, 4, 'Racine Hécouanone', 'Hécouanone n\'avait pas de chance, son mari était un gros fainéant, incapable d\'assumer son statut (pourtant mérité par sa condition) de chef de famille. Elle était en permanence obligée de lui fixer des conditions : \"Tu auras ta Gelée Fraise, si tu vas faucher les céréales\" ou encore \"Tu pourras fumer des Champs quand tu auras tondu les Bouftous\", pour ne citer que ses phrases les plus connues. Évidemment, cette histoire n\'a aucun rapport avec cette racine très puissante, à moins qu\'elle aussi, à force de côtoyer sa maîtresse, ne vous impose trop de conditions...', 60, 103, '64#b#23#0#1d25+10,7e#1a#28#0#1d15+25,8a#10#14#0#1d5+15,70#2#3#0#1d2+1,73#4#5#0#1d2+3,ae#97#c8#0#1d50+150,7d#65#82#0#1d30+100,6c#1#64#0#1d100+0');
INSERT INTO `website_shop_objects_templates` VALUES (7183, 4, 'Racine Huzohide', 'Cette racine a des formes pures, que certains artisans n\'hésiteront pas à qualifier de parfaites. C\'est peut-être pour cela que certains aventuriers y attachent plus d\'importance qu\'à leur dulcinée.', 55, 88, '64#d#1e#0#1d18+12,7d#15#23#0#1d15+20,7c#10#19#0#1d10+15,7e#15#23#0#1d15+20,b2#4#8#0#1d5+3');
INSERT INTO `website_shop_objects_templates` VALUES (7184, 4, 'Racine Histre', 'Cette terrible racine, est avant tout connue pour déclencher des catastrophes climatiques aux endroits précis où elle est utilisée. Evitez donc de vous en servir pour botter les fesses de vos adversaires, on ne sait pas ce qu\'il pourrait arriver...', 56, 86, '64#d#1e#0#1d18+12,7d#97#c8#0#1d50+150,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (7185, 4, 'Racine Hécure', 'Utiliser cette racine en combat est censé être assez simple. Parfois, elle reprend vie et décide de n\'en faire qu\'à sa tête. C\'est dans ces moments-là qu\'il est possible d\'entendre son propriétaire crier : \"Mais ce n\'est pas une Racine Hécure\". Et pourtant si, c\'en est bien une.', 57, 103, '64#e#1f#0#1d18+13,7d#65#96#0#1d50+100,73#5#7#0#1d3+4,8a#10#19#0#1d10+15,d3#3#5#0#1d3+2,d4#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (7186, 24, 'Passage de grade', 'Sur cette feuille est inscrit la dernière date de votre passage de grade Pandawashuka.', 58, 0, '');
INSERT INTO `website_shop_objects_templates` VALUES (7187, 2, 'Jakchir Arc', 'Cet arc est réputé pour voler l\'argent du peuple à distance, et en toute discrétion. Le plus surprenant c\'est qu\'il reste tout de même très populaire au fil des années. Heureusement pour le peuple, il commence déjà à s\'user.', 50, 124, '5b#5#6#0#1d2+4,65#2#3#0#1d2+1,82#1#1388#0#1d5000+0,7b#1f#32#0#1d20+30,7d#65#96#0#1d50+100,8a#10#14#0#1d5+15');
INSERT INTO `website_shop_objects_templates` VALUES (7188, 5, 'Dagues Rhumes', 'Ces dagues sont parfaites pour couper les fruits, ou pour couper l\'herbe sous les pieds de vos adversaires. Une  façon originale de les surprendre.', 48, 113, '64#d#12#0#1d6+12,5e#3#4#0#1d2+2,7d#65#96#0#1d50+100,7e#1a#28#0#1d15+25,77#1a#28#0#1d15+25,b2#4#5#0#1d2+3,70#4#5#0#1d2+3,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (7189, 4, 'Rod Gerse', 'Ce bâton étrange, est une version améliorée du célèbre God Rod. En effet, ce bâton a été imaginé et confectionné après les nombreux tests du God Rod effectués par les Prêtresses de l\'Amour. Ce modèle a même été utilisé et usé par Kuri en personne, ce qui en fait en quelque sorte une pièce unique.', 59, 176, '63#9#15#0#1d13+8,64#9#15#0#1d13+8,7d#c9#fa#0#1d50+200,7c#15#23#0#1d15+20,7e#1f#32#0#1d20+30,70#6#a#0#1d5+5,d4#5#7#0#1d3+4,d6#5#7#0#1d3+4,d3#5#7#0#1d3+4,d2#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (7190, 5, 'Dagues Maydhyn China', 'Ces dagues sublimes ont été confectionnées sur mesure, pour une Sramette en manque de sensations fortes. En effet, déçue de ne pas trouver de dagues à sa convenance, elle lança un défi à tous les forgeurs de dagues d\'Amakna : celui qui réussirait à lui forger des dagues capables de tuer sur le coup, n\'importe quel Tofu, pourrait passer 3 nuits en sa compagnie. Contrairement à ce qu\'elle pensait, cette annonce n\'eut pas l\'effet escompté, puisque personne ne participa au défi. Elle dut attendre une centaine d\'années, pour qu\'un forgeur de dagues Enutrof à la retraite, soit intéressé par la récompense qui avait bien changé avec le temps...', 45, 100, '64#f#14#0#1d6+14,73#4#5#0#1d2+3,80#1#0#0#0d0+1,77#15#1e#0#1d10+20,7d#1f#32#0#1d20+30,ae#c8#0#0#0d0+200');
INSERT INTO `website_shop_objects_templates` VALUES (7191, 5, 'Sertisseur de Ramougre', 'Ramougre était un vieux Sram, devenu maître dans la confection de bijoux. Il se servait à la fois de ce sertisseur pour ses créations, mais aussi pour assassiner ses propres clients, lorsqu\'il s\'ennuyait trop dans sa bijouterie. Il était connu pour son très mauvais caractère, qui le poussait parfois à détruire avec son sertisseur, ses plus belles créations. Aujourd\'hui, les utilisateurs de ces dagues savent lui rendre hommage, puisqu\'il les utilisent essentiellement pour trancher les bijoux de famille.', 49, 127, '64#5#e#0#1d10+4,5d#5#6#0#1d2+4,65#1#0#0#0d0+1,76#1f#32#0#1d20+30,77#1f#32#0#1d20+30,73#5#6#0#1d2+4,e1#10#14#0#1d5+15,7d#65#96#0#1d50+100');
INSERT INTO `website_shop_objects_templates` VALUES (7192, 6, 'Griffe de Grizmine', 'Grizmine n\'a jamais réussi à utiliser correctement cette griffe. A force de jouer aux cartes et aux jeux d\'argent tout en buvant de la bière, ses muscles ont vite fini par s\'atrophier. Chez certaines personnes, il semblerait que ce type de loisirs puisse même atrophier d\'autres organes.', 59, 111, '61#1f#30#0#1d18+30,76#1f#32#0#1d20+30,7d#65#96#0#1d50+100,77#1f#32#0#1d20+30,d6#5#7#0#1d3+4,70#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7193, 6, 'Epée du Dark Vlad', 'Seul le Dark Vlad en personne est à même de faire ressurgir toute la magie de cette épée, pour la rendre réellement étincelante. En la portant, vous pourrez fièrement montrer que vous n\'avez pas fini comme ces ridicules aventuriers qui ont péri sous sa lame.', 61, 126, '63#12#20#0#1d15+17,64#8#14#0#1d13+7,7d#97#c8#0#1d50+150,7e#1f#32#0#1d20+30,77#15#28#0#1d20+20,8a#10#14#0#1d5+15,b0#b#f#0#1d5+10,d5#4#6#0#1d3+3,d4#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (7194, 2, 'Arc Anum', 'Cet arc est la preuve que l\'association de la technologie et de la magie, peut donner d\'excellents résultats. Pourtant, cet arc est tout de même tombé rapidement dans l\'oubli pour des raisons encore méconnues. L\'artisan à l\'origine de cette arc a d\'ailleurs été contraint de fermer sa boutique, ce qui n\'a pas manqué d\'attrister bon nombre de ses anciens clients.', 49, 96, '64#6#f#0#1d10+5,63#6#f#0#1d10+5,7e#15#28#0#1d20+20,7d#47#64#0#1d30+70,ae#97#fa#0#1d100+150,77#15#28#0#1d20+20,f3#6#8#0#1d3+5,f4#6#8#0#1d3+5');
INSERT INTO `website_shop_objects_templates` VALUES (7195, 6, 'Karnak', 'Cette épée légendaire a été forgée au petit matin, par une armée d\'Enutrofs saouls, dans le fond des mines de Grimoth. Elle dégage une aura de puissance surprenante, mais aussi une odeur de bière éventée.', 60, 158, '7d#c9#fa#0#1d50+200,80#1#0#0#0d0+1,5d#4#6#0#1d3+3,64#1d#2f#0#1d19+28,7c#15#23#0#1d15+20,77#1f#32#0#1d20+30,70#6#8#0#1d3+5,d6#5#7#0#1d3+4,d4#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (7197, 7, 'Marteau Bleuronne', 'Ce marteau servait à l\'origine à casser les tablettes de chocolat, pour en faire de la poudre. Il a donc acquis au fil des années, une odeur et un goût délicieux. Une raison de plus, pour aller le faire goûter à vos ennemis.', 53, 150, '64#12#24#0#1d19+17,5e#5#8#0#1d4+4,65#1#0#0#0d0+1,7d#fb#12c#0#1d50+250,7c#1f#28#0#1d10+30,7e#29#32#0#1d10+40');
INSERT INTO `website_shop_objects_templates` VALUES (7198, 6, 'Razoir du Soir', 'Tous les vieux Enutrofs vous le diront, une belle barbe est une barbe entretenue. Sa lame est si finement aiguisée, qu\'elle conviendra même aux dames un peu trop poilues.', 62, 106, '64#17#25#0#1d15+22,76#1f#32#0#1d20+30,77#1f#32#0#1d20+30,7c#15#23#0#1d15+20,73#5#7#0#1d3+4,7d#65#96#0#1d50+100');
INSERT INTO `website_shop_objects_templates` VALUES (7199, 6, 'Glaive Icération', 'Ce glaive appartenait à Metzger le boucher, qui s\'en servait pour récupérer rapidement les entrailles de ses ennemis pour en faire de la chair à saucisse qu\'il revendait à bon prix sur les marchés de Bonta.', 63, 135, '64#b#14#0#1d10+10,62#b#14#0#1d10+10,76#1f#32#0#1d20+30,7d#97#c8#0#1d50+150,77#1f#32#0#1d20+30,65#1#0#0#0d0+1,ae#12c#0#0#0d0+300,d6#5#7#0#1d3+4,d5#5#7#0#1d3+4,d3#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (7200, 6, 'Sabre Shodanwa', 'Ce magnifique sabre est utilisé par les disciples Pandawushuka lorsqu\'ils réussissent à atteindre le grade Shodanwa sans être morts entre temps.', 55, 40, '64#f#16#0#1d8+14,76#10#19#0#1d10+15,77#10#19#0#1d10+15');
