INSERT INTO `website_shop_objects_templates` VALUES (7207, 4, 'Bâton du Yondanwa', 'Ce bâton est en règle générale utilisé par les disciples Pandawushuka qui ont réussi à atteindre le grade de Yondanwa sans perdre l\'usage de leurs bras entre-temps.', 52, 93, '5c#2#3#0#1d2+1,76#15#23#0#1d15+20,7d#1f#32#0#1d20+30,7c#10#19#0#1d10+15,73#5#6#0#1d2+4,8a#b#f#0#1d5+10,64#12#1b#0#1d10+17');
INSERT INTO `website_shop_objects_templates` VALUES (7208, 19, 'Hache du Shodanwa', 'Cette hache est utilisée par les disciples Pandawushuka, lorsqu\'ils obtiennent le grade de Shodanwa. Elle est également très pratique pour ravager les forêts de Bambous et tous ceux qui s\'y cachent.', 37, 36, '60#6#1e#0#1d25+5,7b#b#14#0#1d10+10,7e#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (7209, 19, 'Hache du Nidanwa', 'Cette hache est utilisée par les disciples Pandawushuka, lorsqu\'ils obtiennent le grade de Nidanwa. Elle est également très pratique pour ravager les forêts de Bambous et tous ceux qui s\'y cachent.', 36, 59, '64#d#25#0#1d25+12,76#15#1e#0#1d10+20,77#15#1e#0#1d10+20,70#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (7210, 19, 'Hache du Sandanwa', 'Cette hache est utilisée par les disciples Pandawushuka, lorsqu\'ils obtiennent le grade de Sandanwa. Elle est également très pratique pour ravager les forêts de Bambous et tous ceux qui s\'y cachent.', 35, 83, '64#b#2d#0#1d35+10,7d#1f#32#0#1d20+30,7c#10#19#0#1d10+15,73#5#6#0#1d2+4,70#2#3#0#1d2+1,ae#64#0#0#0d0+100');
INSERT INTO `website_shop_objects_templates` VALUES (7211, 19, 'Hache du Yondanwa', 'Cette hache est utilisée par les disciples Pandawushuka, lorsqu\'ils obtiennent le grade de Yondanwa. Elle est également très pratique pour ravager les forêts de Bambous et tous ceux qui s\'y cachent.', 34, 98, '64#6#19#0#1d20+5,63#6#19#0#1d20+5,7d#33#50#0#1d30+50,7c#15#23#0#1d15+20,7e#15#28#0#1d20+20,70#5#6#0#1d2+4');
INSERT INTO `website_shop_objects_templates` VALUES (7212, 19, 'La Trancheuse de Bambou', 'Légère et élégante, cette hache vous permettra de progresser facilement dans les forêts de Bambou de Pandala,  et de vous défendre efficacement contre les Pandis les plus fourbes, toujours prêts à attaquer les bûcherons isolés pour de sombres histoires de bourses...', 33, 26, '63#b#14#0#1d10+10,7d#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (7213, 8, 'Pelle Rhon', 'Cette pelle est censée fendre l\'air à une vitesse assez incroyable. Ceux qui savent correctement s\'en servir, fendent surtout les crânes de leurs ennemis avec.', 41, 142, '64#18#2b#0#1d20+23,7d#97#c8#0#1d50+150,7b#1f#32#0#1d20+30,7c#1a#2d#0#1d20+25,8a#b#14#0#1d10+10,b0#10#14#0#1d5+15,5b#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (7214, 11, 'Sandales Macien', 'Ces sandales appartenaient aux Maciens, une tribu d\'Ouginaks, disparue aujourd\'hui. Ces derniers étaient très complices avec les Pandawas, ce qui avait fini au fil des générations, par changer la couleur de leur pelage, qui était devenu blanc, tâcheté de noir. Ils furent tous transformés en manteau par une cruelle tailleuse.', 59, 30, '7d#10#19#0#1d10+15,77#10#18#0#1d9+15,73#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (7215, 11, 'Sandales Humeuses', 'Ces sandales étaient utilisées par certaines femelles Pandits, pour séduire les aventuriers égarés, et les attirer dans d\'horribles pièges.', 60, 121, '7d#65#96#0#1d50+100,7b#1f#28#0#1d10+30,80#1#0#0#0d0+1,d4#4#5#0#1d2+3,d3#4#5#0#1d2+3,d5#4#5#0#1d2+3,d2#4#5#0#1d2+3,b0#b#f#0#1d5+10,7c#15#23#0#1d15+20');
INSERT INTO `website_shop_objects_templates` VALUES (7216, 11, 'Sandales Koliques', 'Ces sandales étaient données aux Pandawas malades, qui avaient besoin de courir très vite lorsqu\'ils avaient contracté le virus de la Pandrista, ou lorsqu\'ils avaient passé une nuit trop arrosée à la taverne.', 61, 58, '7c#10#19#0#1d10+15,73#3#4#0#1d2+2,80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (7217, 11, 'Sandales Hambic', 'Les Pandawas ont toujours été attirés par les boissons alcoolisées, ils ont ainsi au fil du temps, appris à mieux les conserver et les aromatiser. Quant à ces sandales, elles ont été faites spécialement pour les Pandawas alcooliques, elles sont lestées au niveau de la semelle, pour que vous puissiez garder les pieds sur terre plus souvent.', 62, 159, 'e1#10#19#0#1d10+15,b0#10#14#0#1d5+15,7d#c9#fa#0#1d50+200,80#1#0#0#0d0+1,b2#3#6#0#1d4+2,70#3#6#0#1d4+2,d5#4#5#0#1d2+3,d9#4#5#0#1d2+3,7c#15#23#0#1d15+20');
INSERT INTO `website_shop_objects_templates` VALUES (7218, 11, 'Sandales Adin', 'Adin était un jeune Pandawa, grand collectionneur de lampes, mais très loin d\'être un génie.', 63, 76, '7d#65#96#0#1d50+100,7c#b#14#0#1d10+10,73#4#5#0#1d2+3,70#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7219, 11, 'Sandales Ailuya', 'Ces sandales étaient confiées aux Pandits à la fin de rituels religieux. Elles sont de nos jours surtout utilisées dans les championnats de claquettes.', 64, 56, '7c#10#19#0#1d10+15,7e#10#19#0#1d10+15,77#10#19#0#1d10+15,7b#10#19#0#1d10+15,7d#10#19#0#1d10+15,76#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (7220, 15, 'Ticket de loterie', 'Vous avez entre les mains, un superbe ticket de loterie, gardez-le précieusement, il se pourrait que vous soyez l\'heureux élu du très grand tirage au sort !', 717, 2, '');
INSERT INTO `website_shop_objects_templates` VALUES (7221, 1, 'Collier du Tanukouï San', 'Ce collier est porté par le Tanukouï San depuis sa tendre enfance, ce qui lui confère une valeur ajoutée non négligeable lorsque l\'on sait de quoi il était capable, même durant son enfance.', 92, 152, '7d#c9#fa#0#1d50+200,7c#1a#28#0#1d15+25,77#1f#32#0#1d20+30,b2#6#a#0#1d5+5,6f#1#0#0#0d0+1,ae#191#2bc#0#1d300+400,70#6#a#0#1d5+5,d6#8#a#0#1d3+7,f4#8#a#0#1d3+7');
INSERT INTO `website_shop_objects_templates` VALUES (7222, 50, 'Artefact Pandawushu Eau', 'Cet artefact magique est utilisé par les disciples Pandawushu pour enchanter leur équipement.', 104, 1, '');
