INSERT INTO `website_shop_objects_templates` VALUES (7226, 16, 'Chapeau Akwadala', 'Avec ce chapeau sur la tête, vous ressemblez de loin à un Pandawushuka du village d\'Akwadala. De près, vous ne ressemblez à rien.', 146, 43, '7c#6#19#0#1d20+5,7b#b#1e#0#1d20+10,70#2#3#0#1d2+1');
