INSERT INTO `website_shop_objects_templates` VALUES (7230, 17, 'Cape Akwadala', 'Cette cape qui vient du village d\'Akwadala, peut servir de paillasson, ou même de serpillière si vous venez de sortir de l\'eau.', 113, 41, '7d#1f#3c#0#1d30+30,75#1#0#0#0d0+1,7b#b#14#0#1d10+10');
