INSERT INTO `website_shop_objects_templates` VALUES (7232, 17, 'Cape Feudala', 'Cette cape qui vient du village de Feudala, peut servir de paillasson, ou même de serpillière si vous venez de sortir de l\'eau.', 111, 92, '7d#1a#2d#0#1d20+25,7c#10#19#0#1d10+15,73#3#4#0#1d2+2,f0#4#5#0#1d2+3,f1#4#5#0#1d2+3,d3#6#a#0#1d5+5,d2#6#a#0#1d5+5');
