INSERT INTO `website_shop_objects_templates` VALUES (7234, 82, 'Bouclier Akwadala englouti', 'Ce brave bouclier a vu trop de batailles, il n\'est plus bon à rien dans son état. Peut-être que Bouwada, au village Pandala, pourra vous le remplacer.', 31, 1, '105#6#f#0#1d10+5,100#6#7#0#1d2+5');
