INSERT INTO `website_shop_objects_templates` VALUES (7250, 1, 'Amulette Akwadala', 'Seuls les habitants du village d\'Akwadala avaient l\'autorisation de porter cette amulette, qui est censée être un des éléments les plus importants de leur costume traditionnel. En y regardant de plus près, on se demande bien pourquoi.', 79, 41, '7d#b#1e#0#1d20+10,7b#b#1e#0#1d20+10,73#2#3#0#1d2+1,70#1#2#0#1d2+0');
