INSERT INTO `website_shop_objects_templates` VALUES (7254, 4, 'Bâton Akwadala', 'Ce bâton servait à corriger les jeunes Pandawas un peu trop turbulents. Trois coups sur les doigts, quinze sur le derrière, soixante sur la tête, deux dans les yeux, et le tour était joué.', 61, 43, '60#5#d#0#1d9+4,7b#b#1e#0#1d20+10,73#2#3#0#1d2+1,70#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (7255, 19, 'Hache Terrdala', 'Cette hache a été dès le début, pensée pour couper des êtres vivants. Attention, une seule erreur de manipulation de votre part, et vous pourriez vous retrouver diminué de moitié.', 32, 83, '61#b#23#0#1d25+10,5e#3#4#0#1d2+2,76#1a#28#0#1d15+25,7d#1f#32#0#1d20+30,73#3#4#0#1d2+2,8a#10#14#0#1d5+15,d6#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7256, 5, 'Dagues Aerdala', 'Aiguisées comme des griffes de Meulou, ces dagues feront de vous un excellent apprenti assassin.', 51, 62, '62#b#10#0#1d6+10,7d#15#1e#0#1d10+20,77#15#1e#0#1d10+20,73#2#3#0#1d2+1,ae#97#c8#0#1d50+150');
INSERT INTO `website_shop_objects_templates` VALUES (7257, 6, 'Sabre Feudala', 'Ce sabre a été forgé par Hotari Honza en personne. Il parait que c\'est l\'une de ses dernières créations avant sa reconversation en cuisinier. Une véritable pièce de collection en tout cas.', 64, 76, '65#1#0#0#0d0+1,7d#1a#32#0#1d25+25,7e#15#23#0#1d15+20,73#2#3#0#1d2+1,63#b#1e#0#1d20+10,5e#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (7258, 54, 'Poils de Pandikaze', 'Ces poils très fins pourraient provenir de l\'arrière train d\'une Sadidette, mais ne vous y méprenez pas, il n\'en n\'est rien.', 556, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (7259, 55, 'Etoffe de Pandikaze', 'Cet amas de poils est presque intact malgré la punition que vous avez dû infliger au pauvre Pandikaze, pour la lui arracher.', 124, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (7260, 59, 'Peau de Pandikaze', 'Cette peau est encore recouverte d\'un léger duvet, aussi doux que le dessous des aisselles d\'une Eniripsa, mais sans l\'odeur de transpiration.', 40, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (7261, 38, 'Bois de Bambou Magique', 'Chose surprenante, ce morceau de Bambou est imprégné d\'une magie surprenante, à même de lui permettre de se déplacer. Une légende tribale raconte que toutes les nuits, il vient frapper aux portes des habitations dont les propriétaires auraient des activités libertines. Les Pandawas, prennent donc souvent la peine de l\'accrocher à une chaîne avant d\'aller se coucher, pour éviter les déconvenues.', 670, 220, '');
INSERT INTO `website_shop_objects_templates` VALUES (7262, 98, 'Racine de Bulbiflore', 'Cette racine de Bulbiflore n\'est pas comme les autres racines, elle peut être mâchée longuement sans vous faire perdre toutes vos dents. Attention, contrairement aux vraies sucreries, elle a très mauvais goût.', 142, 26, '');
INSERT INTO `website_shop_objects_templates` VALUES (7263, 98, 'Racine de Bulbuisson', 'Cette racine de Bulbuisson n\'est pas comme les autres racines, elle peut être mâchée longuement sans vous faire perdre toutes vos dents. Attention, contrairement aux vraies sucreries, elle a très mauvais goût.', 143, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (7264, 98, 'Racine de Bulbambou', 'Cette racine de Bulbambou n\'est pas comme les autres racines, elle peut être mâchée longuement sans vous faire perdre toutes vos dents. Attention, contrairement aux vraies sucreries, elle a très mauvais goût.', 145, 67, '');
INSERT INTO `website_shop_objects_templates` VALUES (7265, 98, 'Racine de Bulbig', 'Cette racine de Bulbig n\'est pas comme les autres racines, elle peut être mâchée longuement sans vous faire perdre toutes vos dents. Attention, contrairement aux vraies sucreries, elle a très mauvais goût.', 144, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (7266, 35, 'Fleur de Bulbiflore', 'Cette fleur ne pousse qu\'à un seul endroit, sur la tête du Bulbiflore, n\'essayez donc pas avec la vôtre, le substrat n\'est pas aussi riche.', 119, 26, '');
INSERT INTO `website_shop_objects_templates` VALUES (7267, 36, 'Feuille de Bulbuisson', 'Ces feuilles ne pousse qu\'à un seul endroit, sur la tête du Bulbuisson, n\'essayez donc pas de les faire pousser sur la vôtre, elles risqueraient de faner rapidement.', 55, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (7268, 36, 'Pousses de Bulbambou', 'Cette pousse ne vit qu\'à un seul endroit, sur la tête du Bulbambou, n\'essayez donc pas avec la vôtre, elle ne trouverait rien d\'intéressant à manger dessus.', 56, 67, '');
INSERT INTO `website_shop_objects_templates` VALUES (7269, 96, 'Ecorce magique de Bulbig', 'Cette écorce magique est aussi résistante qu\'un Bouclier du Captain Amakna, mais beaucoup moins belle tout de même.', 105, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (7270, 96, 'Ecorce magique de Bulbiflore', 'Cette écorce est si fine et fragile, qu\'elle pourrait servir dans la confection de dentelle ou de sous-vêtements coquins.', 106, 26, '');
INSERT INTO `website_shop_objects_templates` VALUES (7271, 96, 'Ecorce magique de Bulbuisson', 'Cette écorce rugueuse est parfaite pour la confection des semelles anti-dérapantes.', 107, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (7272, 96, 'Ecorce magique de Bulbambou', 'Cette écorce lisse est parfaite pour la confection des parquets ou des pistes de danse.', 108, 67, '');
INSERT INTO `website_shop_objects_templates` VALUES (7273, 59, 'Peau de Cooleuvre', 'Cette peau de Cooleuvre vous glissera entre les doigts comme aucune peau ne l\'avait fait auparavant. Évitez d\'en faire des chaussures, vous n\'arriveriez jamais à les retirer.', 41, 67, '');
INSERT INTO `website_shop_objects_templates` VALUES (7274, 47, 'Dent magique de Cooleuvre', 'Cette dent n\'est pas comme les autres, elle sent plus mauvais que les autres, comme si l\'horrible haleine de la Cooleuvre s\'y était incrustée.', 16, 67, '');
INSERT INTO `website_shop_objects_templates` VALUES (7275, 54, 'Poils de Kitsou Nae', 'Ces poils de Kitsou Nae sont doux comme la croupe d\'une femelle Trool. De quoi vous rappeler de bons souvenirs.', 560, 29, '');
INSERT INTO `website_shop_objects_templates` VALUES (7276, 54, 'Poils de Kitsou Nufeu', 'Ces poils de Kitsou Nufeu sont doux comme la croupe d\'une femelle Trool. De quoi vous rappeler de bons souvenirs.', 557, 111, '');
INSERT INTO `website_shop_objects_templates` VALUES (7277, 54, 'Poils de Kitsou Nere', 'Ces poils de Kitsou Nere sont doux comme la croupe d\'une femelle Trool. De quoi vous rappeler de bons souvenirs.', 558, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (7278, 54, 'Poils de Kitsou Nakwa', 'Ces poils de Kitsou Nakwa sont doux comme la croupe d\'une femelle Trool. De quoi vous rappeler de bons souvenirs.', 559, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (7279, 59, 'Peau de Kitsou Nae', 'Cette peau de Kitsou Nae est d\'une qualité exceptionnelle, découpée en de multiples lanières, elle pourrait faire un excellent fouet. C\'est le cadeau idéal à offrir aux parents dont les enfants sont trop effrontés.', 46, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (7280, 59, 'Peau de Kitsou Nufeu', 'Cette peau de Kitsou Nufeu est d\'une qualité exceptionnelle, découpée en de multiples lanières, elle pourrait faire un excellent fouet. C\'est le cadeau idéal à offrir aux parents dont les enfants sont trop effrontés.', 44, 111, '');
INSERT INTO `website_shop_objects_templates` VALUES (7281, 59, 'Peau de Kitsou Nere', 'Cette peau de Kitsou Nere est d\'une qualité exceptionnelle, découpée en de multiples lanières, elle pourrait faire un excellent fouet. C\'est le cadeau idéal à offrir aux parents dont les enfants sont trop effrontés.', 45, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (7282, 59, 'Peau de Kitsou Nakwa', 'Cette peau de Kitsou Nakwa est d\'une qualité exceptionnelle, découpée en de multiples lanières, elle pourrait faire un excellent fouet. C\'est le cadeau idéal à offrir aux parents dont les enfants sont trop effrontés.', 43, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (7283, 59, 'Peau de Tanukouï San', 'Cette énorme peau distendue de Tanukouï San pourrait faire une excellente bourse pour ranger vos kamas.', 2, 85, '');
INSERT INTO `website_shop_objects_templates` VALUES (7284, 54, 'Poils de Tanukouï San', 'Ces poils de Tanukouï San ne sentent pas très bon, mais qu\'importe, ce sont tout de même des poils de Tanukouï San.', 3, 85, '');
INSERT INTO `website_shop_objects_templates` VALUES (7285, 103, 'Patte d\'Araknawa', 'Cette petite patte va continuer à frétiller encore longtemps. Glissez-là dans la culotte de vos ennemis, pour les déstabiliser en plein combat, vous gagnerez sans peine.', 716, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (7286, 38, 'Bois de Bambouto', 'Le bois de Bambouto vaut presque aussi cher que celui de Culbuto, et pourtant, il est beaucoup plus courant. C\'est à n\'y rien comprendre.', 675, 47, '');
INSERT INTO `website_shop_objects_templates` VALUES (7287, 36, 'Feuille de Bambouto', 'Les feuilles de Bambouto sont larges et épaisses, un peu comme les femelles Bwork, l\'agressivité en moins.', 69, 47, '');
INSERT INTO `website_shop_objects_templates` VALUES (7288, 36, 'Feuille de Bambouto Sacré ', 'Cette grosse feuille est si dure et lourde, qu\'elle pourrait vous écraser vivant si vous vous endormiez sous un Bambouto Sacré en automne.', 68, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (7289, 38, 'Bois de Bambouto Sacré ', 'Ce bois-là n\'est pas à mettre entre toutes les mains, mais personne ne sait encore pourquoi.', 674, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (7290, 98, 'Racine Magique de Bambouto', 'Cette racine permet au Bambouto de puiser toute sa magie dans le sol avant un combat.', 100, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (7291, 98, 'Racine Magique de Bambouto Sacré ', 'Cette racine permet au Bambouto Sacré de puiser toute sa magie dans le sol avant un combat.', 99, 87, '');
INSERT INTO `website_shop_objects_templates` VALUES (7292, 54, 'Poils de Maho Firefoux', 'Ces poils proviennent d\'un Maho Firefoux, une terrible créature à l\'apparence chétive, mais qui possède en réalité de terribles pouvoirs magiques.', 202, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (7293, 54, 'Poils de Soryo Firefoux', 'Ces poils proviennent d\'une petite créature rousse bien malicieuse, comme tant d\'autres.', 203, 130, '');
INSERT INTO `website_shop_objects_templates` VALUES (7294, 54, 'Poils de Yokai Firefoux', 'Ces poils épais et malodorants ont été arrachés avec force et détermination du derrière d\'une horrible créature rousse.', 204, 110, '');
INSERT INTO `website_shop_objects_templates` VALUES (7295, 54, 'Poils de Pandore', 'Ces poils mystérieux permettent en général de tisser des capes ou des chapeaux magiques aux effets inattendus.', 2, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (7297, 54, 'Poils de Pandule', 'Ces poils magiques sont assez puissants pour redonner vie à une horloge cassée.', 206, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (7298, 59, 'Peau de Maho Firefoux', 'Cette peau lisse et fine offre une excellente protection face aux diverses attaques magiques que le Maho Firefoux rencontre lorsque ses sorts se retournent contre lui.', 42, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (7299, 59, 'Peau de Soryo Firefoux', 'Cette peau était autrefois utilisée pour coudre les slips des enfants à la peau sensible. Les slips en peau de Soyo Firefoux sont approuvés par la descendance du Captain Chafer.', 38, 130, '');
INSERT INTO `website_shop_objects_templates` VALUES (7300, 59, 'Peau de Yokai Firefoux', 'Cette peau épaisse offre une excellente protection face aux coups de Bambou.', 37, 110, '');
INSERT INTO `website_shop_objects_templates` VALUES (7301, 59, 'Peau de Léopardo', 'Cette peau était autrefois utilisée par les Pandawas pour confectionner des sous-vêtements légers, et minimalistes.', 36, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (7302, 59, 'Peau de Pandore', 'La peau du Pandore vous réservera beaucoup de surprises si vous êtes cordonnier.', 1, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (7303, 59, 'Peau de Pandule', 'Cette peau rugueuse change de couleur au fil des heures.', 39, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7304, 55, 'Etoffe de Maho Firefoux', 'Cette étoffe magique de couleur rousse est imprégnée d\'une magie surpuissante. On ne peut pas en dire autant de vous.', 11, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (7305, 55, 'Etoffe de Soryo Firefoux', 'Cette étoffe de taille modeste est parfaite pour boucher les trous sous les vieilles portes, lorsque l\'hiver approche.', 10, 130, '');
INSERT INTO `website_shop_objects_templates` VALUES (7306, 55, 'Etoffe de Yokai Firefoux', 'Cette étoffe provient des parties les plus sensibles du Yokai Firefoux, qui sont également les plus malodorantes. Beaucoup d\'aventuriers pensent qu\'il s\'agit de ses moustaches, mais ils se trompent.', 9, 110, '');
INSERT INTO `website_shop_objects_templates` VALUES (7307, 55, 'Etoffe de Pandore', 'Cette étoffe est presque aussi rare qu\'une bonne surprise sortant de la boîte du Pandore.', 125, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (7308, 55, 'Etoffe de Pandule', 'Contrairement aux idées reçues, cette étoffe n\'est pas mangeable. Les derniers qui ont essayé de la cuisiner se sont transformés en Tanukouï San. Une aubaine pour certains d\'entre eux.', 12, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7309, 84, 'Clef des Pandikazes', 'Cette clef permet de rentrer dans le donjon des Pandikazes. Attention, elle sera détruite après utilisation.', 229, 1, '');
