INSERT INTO `website_shop_objects_templates` VALUES (7368, 3, 'Baguette Houalle', 'Le sculpteur de cette baguette voulait qu\'elle puisse détruire les étoiles filantes qui l\'empêchaient de dormir la nuit. La légende raconte qu\'un soir en sortant de la taverne, complètement ivre, il a voulu essayer sa baguette, mais a confondu la lune avec une étoile filante. La baguette étant réellement très puissante, il aurait cassé la lune en deux, et une des deux parties serait tombée en pleine Mer d\'Asse, donnant ainsi naissance à l\'île de Moon telle qu\'on la connaît actuellement. Encore une histoire débile de plus, à raconter entre amis, les soirs de beuverie.', 55, 126, '64#f#18#0#1d10+14,7c#15#28#0#1d20+20,7d#65#96#0#1d50+100,7e#15#23#0#1d15+20,b2#4#5#0#1d2+3,ae#12d#190#0#1d100+300,b0#b#f#0#1d5+10,65#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (7369, 50, 'Ambre de Bambouto', 'Cette ambre est généralement accrochée à la cime du Bambouto, elle lui sert de bijoux, mais aussi pour se donner plus d\'inertie lorsque le Bambouto décide de s\'abattre sur vous afin de vous faire plus mal. Quelle ingénieuse créature.', 2, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (7370, 50, 'Ambre de Bambouto Sacré ', 'Cette ambre constitue la seule richesse du Bambouto Sacré, c\'est peut-être pour cela qu\'il est si aigri, et méchant, avec les touristes qui s\'aventurent sur l\'île de Pandala.', 1, 120, '');
