INSERT INTO `website_shop_objects_templates` VALUES (7379, 55, 'Etoffe de Fantôme Pandikaze', 'Cet amas de poils est presque intact malgré la punition que vous avez dû infliger au pauvre Fantôme Pandikaze, pour la lui arracher.', 4, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7380, 55, 'Etoffe de Fantôme Maho Firefoux', 'Cette étoffe magique de couleur rousse est imprégnée d\'une magie surpuissante. On ne peut pas en dire autant de vous.', 1, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7381, 55, 'Etoffe de Fantôme Soryo Firefoux', 'Cette étoffe de taille modeste est parfaite pour boucher les trous sous les vieilles portes, lorsque l\'hiver approche.', 2, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7382, 55, 'Etoffe de Fantôme Léopardo', 'Cette étoffe n\'est pas aussi douce que la musique du Léopardo, et pourtant, elle devrait pouvoir vous servir. Mais à quoi ? Là est la question.', 7, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7383, 55, 'Etoffe de Fantôme Yokai Firefoux', 'Cette étoffe provient des parties les plus sensibles du Fantôme Yokai Firefoux, qui sont également les plus malodorantes. Beaucoup d\'aventuriers pensent qu\'il s\'agit de ses moustaches, mais ils se trompent.', 3, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7384, 55, 'Etoffe de Fantôme Pandule', 'Contrairement aux idées reçues, cette étoffe n\'est pas mangeable. Les derniers qui ont essayé de la cuisiner se sont transformés en Tanukouï San. Une aubaine pour certains d\'entre eux.', 5, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7385, 55, 'Etoffe de Fantôme Tanukouï San', 'Cette étoffe provient directement des aisselles du Fantôme Tanukouï San, réputées pour leur douceur, mais aussi pour leur odeur, proche dans le meilleur des cas, de celle que dégage la viande de Corbac en putréfaction.', 6, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7386, 15, 'Testicules du Tanukouï San', 'Ces énormes testicules sont recouverts d\'un très doux duvet qui prévient à merveille les attaques magiques, mais aussi des coups d\'échasses que le Tanukouï San se donne lorsqu\'il ne fait pas attention, ou lorsqu\'il entre en transe lors de l\'invocation d\'une femelle Tanuki Chan. Dans tous les cas, vous n\'avez pas n\'importe quoi entre les mains.', 2, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (7387, 25, 'Le clan des Mercenaires', 'Tout, tout, tout vous saurez tout sur les Mercenaires ! Un ouvrage écrit par le fondateur et Grand-Maître du Clan.', 19, 1, '');
