INSERT INTO `website_shop_objects_templates` VALUES (7403, 47, 'Os de Fantôme Léopardo', 'Ce petit os pointu était autrefois utilisé par les Brigandins pour décorer leurs narines. Une façon élégante de mettre en valeur un nez crochu par exemple.', 3, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7404, 47, 'Os de Fantôme Maho Firefoux', 'Cet os est encore imprégné d\'une magie que l\'on peut qualifier d\'artisanale, ne vous étonnez donc pas, si cet os reprend vie et cherche à retrouver les restes de son propriétaire.', 8, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7405, 47, 'Os de Fantôme Pandikaze', 'Cet os est tout ce qu\'il reste du fantôme que vous venez d\'exterminer. Pas de chance pour vous, aucune magie ne semble l\'habiter.', 4, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7406, 47, 'Os de Fantôme Pandore', 'Cet os ne sort pas de la boîte du Pandore et pourtant, tout porte à croire que si.', 5, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7407, 47, 'Os de Fantôme Pandule', 'Finement taillé, cet os peut sans problème, servir d\'aiguille pour une horloge géante. Tout simplement indispensable.', 6, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7408, 47, 'Os de Fantôme Soryo Firefoux', 'La première fois que le Soryo Firefoux s\'est cassé un os, il a tenté de se venger sur le premier venu. Au même moment, Francisque Kabroule, ménestrel de son état, se promenait en chantant et croisait le Soryo Firefoux. La suite de l\'histoire, personne ne la connaît, tout ce que l\'on sait, c\'est qu\'après ça, sa voix était devenue encore plus aiguë.', 7, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7410, 47, 'Os de Fantôme Tanukouï San', 'A force de supporter le poids incommensurable de ses énormes testicules, les os du Tanukouï San ont fini par devenir incroyablement résistants.', 1, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7411, 47, 'Os de Fantôme Yokai Firefoux', 'Cet os aurait pu servir de massue pour fendre les crânes des aventuriers insolents, ou même de marteau pour enfoncer les Enutrofs dans le sol comme de vulgaire asperges. Mais depuis qu\'il est entre vos mains, il semblerait que son destin soit différent...', 2, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (7412, 87, 'Lot de cent parchemins vierges', 'Ce lot permet de \"marquer\" une seule cible pour ensuite pouvoir la traquer plusieurs fois.', 3, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (7413, 25, 'Parchemin \"Pointer du doigt\"', '(Double clic pour apprendre cette emote) \\nCe parchemin vous permet d\'apprendre l\'attitude \"Pointer du doigt\", pour indiquer une direction ou dénoncer ouvertement les tricheurs.', 9, 1, 'a#f#0#0#0d0+15');
INSERT INTO `website_shop_objects_templates` VALUES (7414, 18, 'Petit Chacha Blanc', 'Cette petite boule de poils griffe, mord et pince même la main qui la nourrit. C\'est donc une créature terrifiante, mais tout de même irrésistiblement attachante et fascinante. Toute ressemblance avec des personnes de la gent féminine ne serait pas fortuite. Attention, cette créature en plus de son caractère irascible est très difficile sur le plan alimentaire, puisqu\'elle ne consomme que de la viande issue de créatures chassées.', 9, 1, '320#a#0#0#0d0+10,ae#5#320#0#1d796+4');
INSERT INTO `website_shop_objects_templates` VALUES (7415, 18, 'Petit Chienchien Noir', 'Cette étrange petite créature ne se nourrit que de poissons fraîchement pêchés. Mais ne vous inquiétez pas, sa compagnie agréable compense largement son haleine de poisson déshydraté.', 10, 1, '320#a#0#0#0d0+10,8a#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (7417, 77, 'Certificat de Mise en Chanil : Peki Peki', 'Ce certificat décrit les caractéristiques du Peki Peki que vous avez placé au chanil.', 26, 1, '');
