INSERT INTO `website_shop_objects_templates` VALUES (7421, 44, 'Potion d\'oubli de métier : Forgeur de Bouclier', 'Cette potion vous fera oublier le métier de Forgeur de Bouclier.', 2, 1, '267#3c#0#0#0d0+60');
INSERT INTO `website_shop_objects_templates` VALUES (7422, 16, 'Maskananas', 'Ce masque en forme de fruit exotique est une véritable pièce de collection. Il ne sert à rien, si ce n\'est vous rendre véritablement original et appétissant. C\'est déjà beaucoup.', 117, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7423, 12, 'Oeuf de Larve Dorée', 'Aussi étrange que cela puisse paraître, les oeufs de Larves Dorées ne sont pas pondus par des Larves Dorées, mais par des larves plus communes, de couleur verte, orange ou encore bleue. La nature est décidément pleine de mystères.', 715, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (7425, 32, 'Petite Larve Dorée', 'Cette larve vient de naître d\'un oeuf. Son premier regard s\'étant posé sur vous, elle vous considère comme sa mère.', 5, 1, '');
