INSERT INTO `website_shop_objects_templates` VALUES (7495, 5, 'Coupe Cuir du Cordomage', 'Ce Coupe Cuir magique permet de mieux découper le cuir et gratter les peaux. C\'est l\'outil idéal pour améliorer les vieilles bottes et ceintures.', 53, 1, '62#1#0#0#0d0+1,60#1#0#0#0d0+1,63#1#0#0#0d0+1,61#1#0#0#0d0+1,7c#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (7496, 14, 'Potion de résurrection de masse', 'Cette potion permet de ressusciter tous les alliés présents autour de vous.', 60, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7497, 14, 'Potion de libération de masse', 'Cette potion permet de libérer les âmes de vos ennemis pour les renvoyer directement dans leur cimetière, sans leur permettre de pouvoir se faire ressusciter.', 59, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7498, 14, 'Petite potion de soin de masse', 'Cette potion permet de soigner tous les alliés présents sur la carte.', 58, 1, '');
