INSERT INTO `website_shop_objects_templates` VALUES (7501, 12, 'Potion du Village des Kwaks de Vent', 'Cette potion vous permet de vous téléporter dans le village des Kwaks de Vent, si ce dernier vous appartient.', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7502, 12, 'Potion de Ralliement', 'Cette potion permet de créer un point de ralliement, pour permettre aux aventuriers alignés de vous rejoindre, pour organiser une attaque ou une défense de village par exemple. Cette potion magique permet également de sauvegarder la position des personnes qui vous rejoignent, pour leur permettre de repartir rapidement jusqu\'à leur point de départ initial.', 21, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7505, 44, 'Potion d\'oubli de métier : Costumage', 'Cette potion vous fera oublier le métier de Costumage.', 2, 1, '');
