INSERT INTO `website_shop_objects_templates` VALUES (7508, 50, 'Rune de Signature', 'Cette rune permet aux artisans les plus doués, de signer leurs créations. \\n(à utiliser lors de la fabrication de l\'objet en plus des ingrédients)', 37, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7509, 84, 'Première partie de la clef du labyrinthe du Dragon Cochon', 'Si ce groin ne vous dit rien, alors ne cherchez pas à en faire quelque chose, sous peine de recevoir une claque mortelle, surtout si vous êtes un peu étourdi.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7510, 84, 'Deuxième partie de la clef du labyrinthe du Dragon Cochon', 'Ce morceau est peut-être une partie de la clef qui ouvre le coffre au trésor dont vous avez toujours rêvé. A moins que ce ne soit la clef de votre tombeau.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7511, 84, 'Clef du labyrinthe du Dragon Cochon', 'Si vous espérez rencontrer beaucoup de grosses cochonnes avec cette clef vous vous fourrez le doigt dans l\'oeil. Elle ne vous permettra que d\'ouvrir le labyrinthe du Dragon Cochon. Attention, elle sera détruite après utilisation.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7513, 11, 'Sandales Titude', 'Titude était un modeste Enutrof cordonnier, plus petit encore qu\'un Xélor. On raconte qu\'il aurait confectionné ces sandales pour enfin réussir à embrasser sa dulcinée, une Eniripsa cul-de-jatte, mais que cela ne suffit point, et qu\'il dut se résoudre à ne pas l\'embrasser debout.', 67, 122, '80#1#0#0#0d0+1,7d#97#af#0#1d25+150,7c#15#23#0#1d15+20,77#1f#32#0#1d20+30,7b#1f#32#0#1d20+30,b0#b#f#0#1d5+10,d6#6#7#0#1d2+5,d2#6#7#0#1d2+5');
INSERT INTO `website_shop_objects_templates` VALUES (7514, 11, 'Bottes Harry', 'Harry était un vieux sage, qui passait ses journées à pêcher sur les quais de Sufokia. Sa grande moustache lui donnait un air de Danous Kouaide, célèbre acteur d\'une troupe de théatre qui se produisait régulièrement à la taverne d\'Amakna en guise de prélude à d\'incroyables orgies à base de bière et de Bougnette.', 70, 123, '7c#10#19#0#1d10+15,7d#7e#96#0#1d25+125,77#24#32#0#1d15+35,80#1#0#0#0d0+1,ae#12c#0#0#0d0+300,b0#6#a#0#1d5+5,d5#6#8#0#1d3+5,70#6#a#0#1d5+5,73#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (7515, 17, 'Cape Itaineflam', 'Cette cape ne vient pas de votre galaxie et pourtant,  elle semble assortie à la couleur de vos bas résille en laine de Boufton.', 92, 148, '7c#15#1e#0#1d10+20,7d#97#c8#0#1d50+150,77#1f#32#0#1d20+30,8a#b#14#0#1d10+10,b0#b#14#0#1d10+10,e2#b#14#0#1d10+10,f4#6#a#0#1d5+5,f3#6#a#0#1d5+5,d5#6#a#0#1d5+5,d4#6#a#0#1d5+5,73#2#3#0#1d2+1,d8#6#0#0#0d0+6,ae#c9#12c#0#1d100+200');
INSERT INTO `website_shop_objects_templates` VALUES (7516, 16, 'Coiffe du Bimd\'Oule', 'C\'est un vieil Enutrof, connu sous le nom de Dhy-Ah-Mhanhd, aigri et rongé par des siècles de malchance qui fit le premier, la découverte de cette terrible coiffe, cachée au fond d\'une alcôve dans les grottes de Bimd\'Oule. Plus tard, l\'Enutrof s\'exila loin des terres d\'Amakna pour tenter d\'échapper à l\'ennui et découvrir de nouveaux horizons. La légende raconte qu\'il revient sur ses terres natales une fois par siècle, pour se moquer de ses anciens amis, mais surtout par nostalgie.', 121, 110, '77#1a#28#0#1d15+25,7d#65#96#0#1d50+100,7b#1a#28#0#1d15+25,8a#10#19#0#1d10+15,b6#1#0#0#0d0+1,ae#c9#12c#0#1d100+200,b0#10#14#0#1d5+15,f3#5#7#0#1d3+4,73#2#3#0#1d2+1,d5#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (7517, 37, 'Bière du Ripate', 'Cette bière est si acide, que la chope dans laquelle elle est servie a une espérance de vie digne d\'un Moskito.', 4, 1, '25d#1#1#0#1d1+0');
INSERT INTO `website_shop_objects_templates` VALUES (7518, 18, 'Fotome', 'Cette surprenante créature vient de l\'au-delà et n\'est pas prête d\'y retourner, sauf si malencontreusement, vous deviez l\'y accompagner...', 13, 1, '320#a#0#0#0d0+10,6e#1#96#0#1d150+0');
INSERT INTO `website_shop_objects_templates` VALUES (7519, 18, 'Dragoune Rose', 'Ce petit dragon a la peau aussi rose que les fesses d\'une femelle Bwork. Un bon moyen de vous faire fantasmer à moindre frais et sans risques, ou tout simplement de vous rappeler de bons souvenirs. Heureusement pour lui, ce dragon n\'est pas uniquement l\'objet de vos fantasmes, mais avant tout une créature très puissante et sage. Attention tout de même, sa voracité n\'a d\'égal que la perversité d\'un Chafer les soirs de pleine lune, et il ne se nourrit que d\'autres familiers.', 14, 1, '320#a#0#0#0d0+10,7c#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (7520, 18, 'Croum', 'Ancien soldat de plomb retraité, cette créature en métal est devenue vivante. Elle vous suivra partout et fera tout pour vous défendre au péril de sa vie, si vous prenez la peine de lui donner à manger régulièrement. Mais n\'espérez pas qu\'elle prenne pour autant les coups à votre place, elle ne remplacera donc pas les aventuriers débutants d\'Astrub.', 15, 1, '320#a#0#0#0d0+10,d2#1#14#0#1d20+0,d3#1#14#0#1d20+0,d4#1#14#0#1d20+0,d5#1#14#0#1d20+0,d6#1#14#0#1d20+0');
INSERT INTO `website_shop_objects_templates` VALUES (7521, 89, 'Cadeau Fotome', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, un livre vous expliquant comment l\'élever, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7522, 18, 'Minimino', 'Ce bébé Minotoror apprivoisé et nettoyé peut être approché et caressé, sans risquer de perdre une main. Cependant, restez prudents, la nature reprend parfois ses droits et il se pourrait que l\'instinct destructeur de cette créature refasse surface à un moment où vous comptiez sur lui. Pour éviter les mauvaises surprises, élevez-le comme vos propres enfants, avec des coups de bâtons.', 21, 1, '320#a#0#0#0d0+10,8a#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (7523, 18, 'Chachate Rousse', 'Cette adorable créature rousse est capable de faire craquer tous les matous, même les plus blasés. \\n(CE FAMILIER LÉGENDAIRE N\'A PAS BESOIN DE MANGER)', 40, 1, '6e#f#0#0#0d0+15');
INSERT INTO `website_shop_objects_templates` VALUES (7524, 18, 'Chacha Tigré ', 'Cette surprenante créature résulte du croisement entre un Chacha blanc et un Chacha noir. Elle ne mange que du poisson.', 41, 1, '320#a#0#0#0d0+10,8a#1#32#0#1d50+0');
