INSERT INTO `website_shop_objects_templates` VALUES (7552, 17, 'Capodindo', 'Parfois, lorsqu\'un guerrier et une Dragodinde s\'unissent, il peut se produire de bien étranges événements. \\nCette cape en est la preuve vivante, puisqu\'il s\'agit des ailes d\'une Dragodinde cousues sur une cape. La Dragodinde qui s\'est sacrifiée pour cette cape, l\'a offerte au célèbre ménestrel Lonne Jenone, le jour de leur union. Francisque Kabroule en aurait même fait une chanson.', 90, 50, '80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (7553, 16, 'Chapodindo', 'Vous qui avez toujours rêvé de ressembler à une Dragodinde, c\'est le moment ou jamais. Cependant, si vous voulez conserver votre bonne santé, nous vous conseillons d\'éviter de vous promener dans les rues d\'Amakna durant la période de Noël.', 118, 50, '7c#1#1e#0#1d30+0,b0#1#14#0#1d20+0,7d#1#32#0#1d50+0,70#1#4#0#1d4+0');
INSERT INTO `website_shop_objects_templates` VALUES (7554, 11, 'Botodindo', 'Vos copines vont vous envier ces bottes, car nul doute qu\'elles vous permettront d\'aller croquer les chocolats de l\'ambassadeur durant l\'une des ses merveilleuses soirées.', 65, 50, '70#2#6#0#1d5+1,b2#2#6#0#1d5+1,7d#1#1e#0#1d30+0,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (7555, 9, 'Anodindo', 'Grâce à cet anneau, vos amies diront de vous \"Elle a vraiment tout d\'une dinde\".', 97, 50, '7e#1#19#0#1d25+0,7b#1#19#0#1d25+0,77#1#19#0#1d25+0,76#1#19#0#1d25+0,7c#1#19#0#1d25+0');
INSERT INTO `website_shop_objects_templates` VALUES (7556, 89, 'Cadeau Dindo', 'Ce paquet cadeau contient une partie d\'un célèbre déguisement. De quoi rendre folle de jalousie vos amies les Dragodindes.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7557, 84, 'Clef du Donjon Abraknyde', 'Cette clef en écorce d\'Abraknyde pourrait prendre racine, si vous la déposiez dans un endroit chaud et humide, comme un slip de Bwork par exemple.', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7558, 24, 'Poils deulk de Bworky', 'Ces poils ne resteront pas longtemps dans votre sac... En tout cas c\'est tout ce que l\'on pourrait vous souhaiter.', 29, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7559, 10, 'Goldoture', 'On raconte que lorsque son premier propriétaire enfilait cette ceinture, il tournait à chaque fois sur lui même. Ce qui confirme qu\'il faut être un peu dingue pour porter un truc pareil.', 85, 164, 'f4#6#a#0#1d5+5,b0#b#14#0#1d10+10,70#6#a#0#1d5+5,8a#10#19#0#1d10+15,73#3#4#0#1d2+2,7c#1f#32#0#1d20+30,7d#c9#fa#0#1d50+200,b6#1#2#0#1d2+0');
