INSERT INTO `website_shop_objects_templates` VALUES (7581, 81, 'Sakananas', 'Ce sac ressemble à s\'y méprendre à un ananas magique, peut-être parce qu\'il s\'agit d\'un ananas magique transformé en sac pour des raisons qui restent encore inconnues. Contrairement au sac Cawotte, le Sakananas n\'est pas vidé, vous ne pouvez donc rien y mettre, et il est en permanence très lourd, un peu comme votre ami Iop perdu depuis plusieurs mois dans la taverne d\'Astrub. Contrairement aux apparences, ce sac ne fait pas partie de la célèbre panoplie Ananas. On vous a une fois de plus menti.', 1, 1, '9e#c9#190#0#1d200+200');
