INSERT INTO `website_shop_objects_templates` VALUES (7691, 93, 'Dragofesse en Cuir de Chef de Guerre Bouftou', 'Ce postérieur mécanique recouvert de cuir permet d\'exciter la plus blasée des montures mâles. Il permet en outre de réveiller certains instincts maternels chez les montures femelles. Il semble également très bien fonctionner avec les Iops.', 78, 1, '');
