INSERT INTO `website_shop_objects_templates` VALUES (7703, 18, 'Vilain Petit Corbac', 'Ce sombre volatile est avant tout connu pour apprécier les cimetières et les aventuriers à la peau blanche. Il adore casser avec son gros bec, les ossements qu\'il trouve dans les tombes.', 18, 1, 'b0#1#28#0#1d40+0,320#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (7704, 18, 'Ecureuil Chenapan', 'Cet Ecureuil prendra un malin plaisir à vous casser les noisettes, ce qui est tout de même assez pratique il faut le reconnaître, même si cela pourrait être parfois assez douloureux. Ce familier ne mange que des graines.', 16, 1, '320#a#0#0#0d0+10,8a#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (7705, 18, 'Léopardo', 'Cette splendide créature est un lointain cousin des célèbres Lenalds de l\'île des Wabbits. Plus téméraire, mais également beaucoup plus indisciplinée, elle saura vous apporter son aide durant vos combats, mais également faire preuve d\'une fourberie sans nom si vous ne vous occupez pas assez bien d\'elle. Cette créature mange de la viande.', 27, 1, '320#a#0#0#0d0+10,8a#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (7706, 18, 'Bilby', 'Bilby, ou Bilbiblabalou de son vrai nom, est une petite gelée en quête d\'aventure. Particulièrement attachée à Vald, elle possède des pouvoirs remarquables (du moins, proportionnellement à sa taille). Ce familier ne mange que des fleurs.', 43, 1, '320#a#0#0#0d0+10,70#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (7707, 18, 'Marcassin', 'Ce petit cochon sauvage dispose d\'un groin d\'une taille démesurée, adapté à la recherche active des gros glands. Par chance, il semble vous avoir trouvé assez facilement. Ce dévoreur d\'âmes se nourrit des restes de Porkass, cochons, et sangliers.', 20, 1, '8a#1#32#0#1d50+0,320#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (7708, 18, 'Pioute bleu', 'Ce petit Pioute n\'est pas comme les autres Pious, il suffit de regarder sa couleur pour s\'en apercevoir. En revanche, il partage avec les autres Pious, un goût prononcé pour picorer les postérieurs. Il paraît que certains aiment... Ce familier ne mange que des graines.', 19, 1, '7b#1#50#0#1d80+0,320#a#0#0#0d0+10');
