INSERT INTO `website_shop_objects_templates` VALUES (7714, 18, 'Atouin', 'On raconte que cette tortue aurait été élevée par un Maître en Arts Martiaux, à l\'apparence d\'un Rat d\'Egoutant. Si vous la nourrissez avec du poisson, elle deviendra gentille et vous aidera à soigner les aventuriers blessés. Si vous lui donnez de la viande, elle deviendra plus agressive et vous aidera à combattre vos adversaires.', 17, 1, '320#a#0#0#0d0+10,b2#1#a#0#1d10+0,70#1#a#0#1d10+0');
