INSERT INTO `website_shop_objects_templates` VALUES (7879, 25, 'L\'avènement D\'Hyrkul', 'Les Annales Colossales, Immorales et pas Banales de Domen font froid dans le dos. A lire en respectant les doses prescrites. Effets secondaires : sueurs froides et incontinence nocturne.', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7880, 1, 'Amulette du Boufcoul', 'Cette amulette était jadis portée par tous les aventuriers qui préféraient répandre l\'amour plutôt que de faire la guerre. Chacun ses goûts.', 93, 20, '7b#b#f#0#1d5+10,77#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (7881, 9, 'Anneau du Boufcoul', 'Cet anneau vous permettra de faire encore plus mal, lorsque vous donnerez des fessées bien méritées à vos enfants.', 98, 38, 'f0#4#5#0#1d2+3,f3#4#5#0#1d2+3,7d#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (7882, 7, 'Marteau du Boufcoul', 'Ce marteau est idéal pour imprimer votre pacifisme sur le crâne de vos adversaires.', 54, 41, '62#5#c#0#1d8+4,60#5#c#0#1d8+4,b6#1#0#0#0d0+1,f2#4#5#0#1d2+3,f1#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (7883, 11, 'Bottes du Boufcoul', 'Rembourrées avec de la laine de Boufcoul, ces bottes ont tout pour plaire. Légères, chaudes pendant les saisons froides, et aérées pendant les saisons chaudes, elles sauront satisfaire le plus blasé des aventuriers.', 66, 38, 'f4#4#5#0#1d2+3,7d#1a#28#0#1d15+25,8a#6#14#0#1d15+5');
INSERT INTO `website_shop_objects_templates` VALUES (7884, 17, 'Cape du Boufcoul', 'Si vous aimez prendre la vie du bon côté, cette cape est faite pour vous. En effet, elle est si épaisse et confortable qu\'elle peut servir de lit improvisé si la fatigue commence à vous gagner. Son odeur de Kaliptus fumé lui permet même de repousser les insectes, les créatures indésirables ou encore les belles-mères.', 93, 55, 'ae#c9#12c#0#1d100+200,b2#3#4#0#1d2+2,7d#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (7885, 10, 'Ceinture du Boufcoul', 'Portée autour des hanches, cette ceinture vous permettra de passer pour un aventurier pacifiste et ainsi de mieux surprendre vos adversaires en leur assenant un coup d\'épée dans le dos.', 84, 37, '9e#65#1f4#0#1d400+100,73#2#3#0#1d2+1,7b#b#f#0#1d5+10,77#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (7886, 16, 'Coiffe du Boufcoul', 'Avec cette coiffe sur le crâne, vous n\'aurez pas l\'air plus astucieux qu\'avant, c\'est une certitude. En revanche, vous aurez l\'air beaucoup plus \"cool\", et finalement, c\'est tout ce qui compte.', 119, 47, 'f0#4#5#0#1d2+3,f3#4#5#0#1d2+3,7b#1a#28#0#1d15+25,77#1a#28#0#1d15+25');
INSERT INTO `website_shop_objects_templates` VALUES (7887, 16, 'Coiffe du Koulosse', 'Cette coiffe a appartenu au célèbre Koulosse, réputé pour ses pieds d\'argile et sa bonne humeur légendaire.', 122, 82, 'f3#1#a#0#1d10+0,f4#1#a#0#1d10+0,d5#1#5#0#1d5+0,d6#1#5#0#1d5+0,98#1#64#0#1d100+0,9b#1#64#0#1d100+0,9a#1#64#0#1d100+0,9d#1#64#0#1d100+0,7d#97#12c#0#1d150+150');
INSERT INTO `website_shop_objects_templates` VALUES (7888, 81, 'Sac du Koulosse', 'Ce sac permet au Koulosse de garder au frais ses feuilles de Kaliptus ou d\'étouffer les Koalaks un peu trop entreprenants.', 2, 69, '7d#3f#8d#0#1d79+62,9d#1c#4b#0#1d48+27,9b#17#50#0#1d58+22,9a#22#50#0#1d47+33,98#17#50#0#1d58+22,70#5#7#0#1d3+4,9e#6f#1e1#0#1d371+110,d3#1#5#0#1d5+0,d2#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (7889, 11, 'Bottes du Koulosse', 'Ces bottes ont appartenu au Koulosse, et à défaut de se voir, cela peut se sentir. Ces bottes sont si confortables, qu\'elles vous feront presque oublier votre misérable vie.', 69, 73, '7d#33#96#0#1d100+50,9d#1#64#0#1d100+0,9b#1#64#0#1d100+0,98#1#64#0#1d100+0,b2#5#7#0#1d3+4,80#1#0#0#0d0+1,f2#1#a#0#1d10+0,f0#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (7890, 4, 'Bâton du Koulosse', 'Ce bâton est en réalité un os vidé, d\'un des ancêtres du Koulosse. Percé aux deux extrémités, il peut servir de pipe à Kaliptus, mais aussi de bâton de berger. Rien n\'arrête le progrès.', 62, 75, '7d#33#96#0#1d100+50,9d#1#64#0#1d100+0,98#1#64#0#1d100+0,9a#1#64#0#1d100+0,9b#1#64#0#1d100+0,5d#4#8#0#1d5+3,65#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (7891, 18, 'Mini Wa', 'Ce petit Wabbit, est en réalité un fils caché du tristement célèbre Wa Wabbit. Peut-être qu\'il montera un jour à son tour sur le trône.', 28, 1, '320#a#0#0#0d0+10,76#1#50#0#1d80+0,7e#1#50#0#1d80+0,77#1#50#0#1d80+0,7b#1#50#0#1d80+0');
INSERT INTO `website_shop_objects_templates` VALUES (7892, 18, 'Willy le Relou', 'Willy le Relou est vraiment une méchante créature. Son enfance a semble-t-il été particulièrement difficile. Il vous accompagnera partout et fera fuir vos amis.', 29, 1, '320#a#0#0#0d0+10,8a#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (7893, 90, 'Fantôme de Mini Wa', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 18, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7894, 90, 'Fantôme de Willy le Relou', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 17, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7895, 77, 'Certificat de Mise en Chanil : Mini Wa', 'Ce certificat décrit les caractéristiques du Mini Wa que vous avez placé au chanil.', 34, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7896, 77, 'Certificat de Mise en Chanil : Willy le Relou', 'Ce certificat décrit les caractéristiques du Willy le Relou que vous avez placé au chanil.', 29, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7897, 89, 'Cadeau Mini Wa', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, un livre vous expliquant comment l\'élever, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner. \\n(ATTENTION, ce cadeau contient des objets très lourds, vous risquez d\'être en surcharge lorsque vous l\'ouvrirez, pensez à vous délester de vos objets lourds ou a vous faire aider d\'un ami.)', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7898, 89, 'Cadeau Willy le Relou', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, un livre vous expliquant comment l\'élever, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner. \\n(ATTENTION, ce cadeau contient des objets très lourds, vous risquez d\'être en surcharge lorsque vous l\'ouvrirez, pensez à vous délester de vos objets lourds ou a vous faire aider d\'un ami.)', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7899, 25, 'Le Mini Wa : Bien l\'élever', 'Ce livre écrit par Oshimo Li\'kross Babine explique comment élever un Mini Wa.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7900, 25, 'Willy le Relou : Bien l\'élever', 'Ce livre écrit par Oshimo Li\'kross Babine explique comment élever un Willy le Relou.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7902, 10, 'Ceinture d\'une Femme en Or', 'Une vieille légende extraite du fameux grimoire \"Toute la vérité sur les femmes\", raconte que cette ceinture aurait appartenu à une femme en or, plus intéressée par la richesse que par le pouvoir. Dans la version non censurée du grimoire, on y apprend également qu\'elle était avant tout connue pour son goût prononcé pour les plaisanteries salaces. Elle n\'était finalement pas si différente des autres femmes...', 86, 71, '7d#33#46#0#1d20+50,7e#15#1e#0#1d10+20,9e#12d#1f4#0#1d200+300,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (7903, 36, 'Feuille de Kaliptus', 'Délicatement insérées au fond des narines, ces feuilles déboucheront n\'importe quel nez. Certaines légendes tribales racontent que cette technique fonctionnerait avec d\'autres orifices.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7904, 35, 'Fleur de Kaliptus', 'Une fois brûlée, cette fleur dégage une fumée épaisse aux vertus hallucinogènes. Mâchée, elle a tendance à rendre impuissant. Consommée en infusion, elle peut engendrer d\'importants effets laxatifs. La meilleure solution reste de ne jamais y toucher.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7905, 57, 'Laine du Boufcoul', 'Cette laine ressemble à s\'y méprendre à de la laine de Bouftou et pourtant il n\'en n\'est rien, puisqu\'elle ne sent pas mauvais.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7906, 47, 'Corne du Boufcoul', 'Une vieille légende explique que la poudre extraite de ces cornes aurait des vertus aphrodisiaques. Cette même légende précise qu\'elle peut également être source d\'effets secondaires assez surprenants. Une raison de plus pour essayer.', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7907, 56, 'Cuir du Boufcoul', 'Ce cuir multicolore permet de confectionner des sous-vêtement en cuir multicolores. De quoi rendre jaloux le plus blasé les Chafers.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7908, 84, 'Clef du Donjon du Koulosse', 'Cette clef en os vous permettra d\'accéder au donjon du Koulosse sans y avoir été invité au préalable.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7911, 18, 'Koalak Sanguin', 'Ce petit Koalak a l\'air inoffensif, mais il cache bien son jeu. Martyrisé pendant sa tendre enfance, il a reçu de nombreux boomerangs dans les dents ou même dans le derrière. Il cultive depuis ce temps-là une aversion totale pour les boomerangs, et les dévore sans même les mâcher.', 30, 1, '320#a#0#0#0d0+10,7c#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (7913, 9, 'Le Diviseur (MJ)', 'Cet objet mysterieux, oublié de tous, appartenait à un grand mage... Il permettait parait-il de parler avec certains animaux...', 22, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7917, 89, 'Cadeau de Compensation', 'Afin de s\'excuser des récents problèmes que vous avez rencontrés, l\'équipe d\'Ankama vous offre ce paquet cadeau qui comprend : \\n- 5 Bonbons de Compensation du Sage \\n- 5 Bonbons de Compensation du Chanceux \\n- 10 Bonbons de Compensation Energétiques \\n- 10 Poudres d\'Eniripsas', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7918, 84, 'Clef du Donjon des Tofus', 'Cette clef confectionnée à partir d\'une plume de Tofu, est capable de chatouiller l\'intérieur de certaines serrures... Accessoirement, elle vous permettra d\'accéder au Tofulailler de Farle Ingalsse.', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7919, 15, 'Jeton du Maître de Jeu', 'Ce splendide jeton doit sûrement pouvoir être échangé à la Foire du Trool contre de précieux cadeaux.', 737, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7920, 3, 'Baguette du Tournoi (MJ)', 'Cette modeste baguette permet aux Maîtres de Jeu de téléporter des aventuriers dans une zone réservée aux tournois.', 8, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7921, 16, 'Couronne du Tofu Royal', 'Cette couronne est assez difficile à attraper, elle file entre les doigts. Aucun doute, c\'est bien la Couronne du Tofu Royal. En revanche, elle ne semble pas du tout pouvoir s\'assortir avec votre petite tête, ne parlons même pas de celle d\'un Iop !', 154, 128, '80#1#0#0#0d0+1,77#2e#3c#0#1d15+45,7c#1a#23#0#1d10+25,7d#97#c8#0#1d50+150,d4#6#8#0#1d3+5,d7#6#8#0#1d3+5,65#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (7922, 61, 'Peluche du Dopeul Sacrieur', 'Cette peluche est faite pour les jeunes Sacrieurs, elle est parfaite pour éponger leur sang et se nettoie facilement à n\'importe quelle température.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7923, 61, 'Peluche du Dopeul Pandawa', 'Cette peluche sent l\'alcool et le poil de Pandawa mouillé, comme maman.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7924, 84, 'Clef du Labyrinthe du Minotoror', 'Cette magnifique clef vous permettra de rentrer dans le Labyrinthe du Minotoror, mais pas d\'en sortir...', 7, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7925, 38, 'Bois de Kaliptus', 'Ce bois parfumé permet de construire des maisons qui sentent bon, même si leurs propriétaires sentent mauvais. Malheureusement, ce bois n\'est pas assez souple pour la confection des sous-vêtements.', 1, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (7926, 84, 'Clef du Donjon du Maître Corbac', 'Cette clef vous permettra de rencontrer le Maître Corbac en personne. Ce dernier vous invitera sûrement à partager un morceau de fromage en sa compagnie.', 8, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7927, 84, 'Clef du Donjon des Craqueleurs', 'Cette clef est presque incassable, mais très usée, elle a ouvert de nombreuses portes. Elle semble avoir été confectionnée à partir des parties intimes d\'un Craqueleur. Tout simplement effrayant.', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7929, 25, 'Manuel du Mercenaire d\'Astrub', 'Le Manuel du Mercenaire d\'Astrub, écrit par le fameux Badufron, chef mercenaire d\'Astrub est le livre de chevet de tous ceux qui aiment respecter la loi ou la contourner.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7930, 25, 'Se faire des Amis et les garder', 'Conseils et astuces pour se faire de bons et loyaux amis par Acidrik Fenlapanse', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7931, 25, 'Le temps des dragons - fragments retrouvés III', 'Tome III des Fragments de l\'Histoire du Monde, retrouvés par l\'érudit Acidrik Fenlapanse, et réécrits par lui.', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7932, 25, 'Parchemin Miss Astrub', 'La plantureuse Miss Astrub de cette année nous dévoile les charmes avec lesquels elle a séduit le jury.', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7934, 25, 'Voyager sans jamais perdre le Nord', 'Arpagnagrobis a écrit cet ouvrage pour tous les aventuriers ne sachant point se servir de leur boussole et des zaaps.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7935, 24, 'Broche Saphir', 'Ce bijou est resté accroché pendant des mois dans une chevelure épaisse. Une inscription explique qu\'il peut servir de clef si d\'autres broches sont réunies...', 109, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7936, 24, 'Broche Emeraude', 'Ce bijou est resté accroché pendant des mois dans une chevelure épaisse. Une inscription explique qu\'il peut servir de clef si d\'autres broches sont réunies...', 110, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7937, 24, 'Broche Rubis', 'Ce bijou est resté accroché pendant des mois dans une chevelure épaisse. Une inscription explique qu\'il peut servir de clef si d\'autres broches sont réunies...', 108, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7938, 24, 'Broche Diamant', 'Ce bijou est resté accroché pendant des mois dans une chevelure épaisse. Une inscription explique qu\'il peut servir de clef si d\'autres broches sont réunies...', 111, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7939, 25, 'Le manuel de la parfaite recrue brâkmarienne', 'Une vie de milichien brâkmarien par le sergent recruteur Oto Mustam', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7940, 25, 'Le manuel de la parfaite recrue de Bonta', 'Une vie de milichien, par Amayiro, chef de la Miliche de Bonta', 10, 1, '');
