INSERT INTO `website_shop_objects_templates` VALUES (7996, 100, 'Sac de Bois de Kaliptus', 'Cet énorme sac contient une quantité impressionnante de bois de Kaliptus.', 54, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (7999, 17, 'Capananas', 'Certains aventuriers racontent que cette cape est aussi rugueuse que la peau d\'un Crocodaille, et d\'autres racontent même qu\'elle est encore plus rugueuse que la peau des fesses d\'une femelle Bwork. Quoi qu\'il en soit, faites attention à la porter du bon côté, si vous aussi, vous ne voulez pas finir par avoir les fesses rugueuses.', 94, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8000, 18, 'Bworky', 'Cette petite créature est un Bwork, resté enfermé vivant dans un bocal pendant plusieurs décennies. Il a donc pris la forme du bocal, et restera nain toute sa vie. Sa bonne humeur et son humour légendaire en font le compagnon idéal pour les donjons perdus d\'avance, ou les soirées mondaines endiablées. Attention, c\'est un adepte des apéritifs, et il ne supporte que les noix et noisettes, même s\'il ne rechigne pas avaler un gland de temps en temps.', 31, 1, '9e#a#3e8#0#1d991+9,320#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (8001, 15, 'Bandelette du Guerrier Koalak', 'Cette bandelette normalement enroulée le long des bras du Guerrier Koalak, lui permet de se moucher le nez sans utiliser de mouchoirs. Lorsqu\'elle a beaucoup servi, cette bandelette peut-être accrochée à un plafond pour coller les Moskitos de passage dans les habitations.', 719, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8002, 55, 'Etoffe de Dok Alako', 'Cette étoffe semble imprégnée d\'une magie ancestrale difficilement prévisible et maîtrisable. Encore un point commun avec votre dulcinée.', 720, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8003, 1, 'Amulette du Koalak', 'Cette amulette ne ressemble à aucune autre amulette, tout simplement car aucune amulette ne lui ressemble.', 94, 60, 'd2#3#4#0#1d2+2,d3#3#4#0#1d2+2,7c#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (8004, 9, 'Anneau du Koalak', 'Ce magnifique anneau est porté par les Koalaks les plus téméraires, ceux qui ont été assez courageux pour le voler aux aventuriers d\'Astrub à la sortie de la banque.', 99, 53, 'd5#4#5#0#1d2+3,b6#1#0#0#0d0+1,75#1#0#0#0d0+1,7d#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (8005, 2, 'Arc du Koalak', 'Cet arc surprenant permet de voler la vie de ses adversaires, et parfois même, de voler vos adversaires à la vie, ce qui ne signifie rien en soi, mais reste tout de même très impressionnant.', 52, 61, '70#1#2#0#1d2+0,77#15#1e#0#1d10+20,5d#4#5#0#1d2+3,64#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (8006, 11, 'Bottes du Koalak', 'Ces bottes sont en réalité des pieds de Koalaks, sauvagement arrachés à leur propriétaires, puis vidés de leur contenu avant d\'être rembourrés avec des poils de Koalaks. A la fois terrifiantes et séduisantes, ces bottes feront de vous la terreur d\'Astrub.', 71, 60, 'd6#4#5#0#1d2+3,80#1#0#0#0d0+1,b2#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (8007, 17, 'Cape du Koalak', 'Cette cape vous protégera de la majorité des attaques, mais pas du ridicule.', 95, 61, 'f0#7#a#0#1d4+6,f3#7#a#0#1d4+6,f1#7#a#0#1d4+6,7d#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (8008, 10, 'Ceinture du Koalak', 'Cette ceinture en feuilles de Kaliptus diffuse une délicieuse odeur, capable d\'en masquer d\'autres. Elle est en outre parfaite pour masquer vos rondeurs.', 87, 60, 'ae#c9#fa#0#1d50+200,9e#65#c8#0#1d100+100,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (8009, 16, 'Coiffe du Koalak', 'Cette coiffe est ornée d\'énormes oreilles de Koalak, qui permettent d\'amplifier les sons émis par les créatures qui vous entourent. Attention, elle peut détruire vos tympans si vos amis sont adeptes des vents de panique.', 125, 60, 'b6#1#0#0#0d0+1,70#4#6#0#1d3+3,73#3#4#0#1d2+2,6e#29#3c#0#1d20+40');
INSERT INTO `website_shop_objects_templates` VALUES (8010, 93, 'Démonteur', 'Permet de récupérer un équipement installé dans un enclos.', 96, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8011, 25, 'Les Prophètes, les cultes, la Foi', 'Quelques bonnes histoires de cultes qui raviront le mystique de base.', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8012, 48, 'Poudre de résurrection', 'Cette poudre permet de ramener à la vie un familier fantôme, à condition de savoir comment nourrir un fantôme de familier.', 51, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8013, 27, 'Transformation Fantôme Chacha', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8016, 90, 'Fantôme de Koalak Sanguin', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 43, 1, '');
