INSERT INTO `website_shop_objects_templates` VALUES (8045, 27, 'Transformation Fantôme Koalak Sanguin', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8049, 27, 'Transformation Fantôme Mini Wa', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8050, 59, 'Peau de Koalak Immature', 'Le petit Koalak Immature à qui vous avez arraché cette peau, n\'était pas d\'accord pour vous la donner, mais qu\'importe, vous étiez plus fort et plus cruel que lui.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8052, 59, 'Peau de Maître Koalak', 'Cette peau vielle et usée recouvrait les fesses du Maître Koalak. Elle comporte encore quelques belles traces rouges, témoins d\'une vie agitée et un peu folle.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8053, 59, 'Peau de Chevaucheur Koalak', 'Cette peau déchirée a été usée contre celle de la monture du Chevaucheur Koalak.  De toute évidence, c\'est un  gage de qualité.', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8054, 59, 'Peau de Drakoalak', 'Cette peau devrait vous rappeler l\'odeur des étables du château d\'Amakna. Très pratique pour effrayer les âmes sensibles, et les tuer avant qu\'elles ne décident de vous accompagner dans un donjon.', 7, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8055, 47, 'Os de Mama Koalak', 'La Mama Koalak possède des os particulièrement résistants qui ne cèdent pas sous son poids. On ne peut pas en dire autant de Francisque Kabroule, le célèbre Ménestrel, qui perdit l\'usage de ses deux bras en se faisant écraser par les énormes cuisses de la Mama Koalak. La curiosité est un vilain défaut.', 638, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8056, 47, 'Fémur de Koalak Farouche', 'Une fois taillé en forme de dague, cet os peut faire office de dague, ou de perce-furoncle.', 639, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8057, 47, 'Tibia de Koalak Fossoyeur', 'Cet os peut servir de pelle pour déterrer les cadavres et les dépouiller, si vous aimez passer vos vacances près des cimetières. Accessoirement, il sert de tibia au Koalak Fossoyeur.', 640, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8058, 47, 'Cubitus de Momie Koalak', 'Cet os a gardé toute sa splendeur grâce aux nombreuses bandelettes de la Momie Koalak, qui protègent des attaques magiques les plus puissantes.', 641, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8059, 54, 'Poils de Koalak Griotte', 'Ces poils sont recouverts de pollen de Blop, ce qui leur donne un goût délectable, mais une odeur déplorable.', 660, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8060, 54, 'Poils de Koalak Koko', 'Ces poils sont recouverts de pollen de Blop, ce qui leur donne un goût délectable, mais une odeur déplorable.', 662, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8061, 54, 'Poils de Koalak Reinette', 'Ces poils sont recouverts de pollen de Blop, ce qui leur donne un goût délectable, mais une odeur déplorable.', 661, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8062, 54, 'Poils de Koalak Indigo', 'Ces poils sont recouverts de pollen de Blop, ce qui leur donne un goût délectable, mais une odeur déplorable.', 659, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8063, 65, 'Queue de Koalak Sanguin', 'Cette ridicule petite queue aurait pû vous appartenir, tant vous êtes insignifiant. Et pourtant il n\'en n\'est rien, estimez-vous heureux.', 641, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8064, 15, 'Boomerang du Koalak Sanguin', 'Ce morceau de bois d\'une forme étrange a voyagé longtemps dans les airs et entre les rangs ennemis avant de se briser. On raconte qu\'il revient toujours vers son propriétaire une fois lancé, mais rarement dans ses mains...', 721, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8065, 54, 'Poils de Barbe du Warko Marron', 'Ces poils sont urticants, assez pour transformer les bises du Warko Marron en armes de destruction massives.', 657, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8066, 54, 'Poils de Barbe du Warko Violet', 'Ces poils de barbe sont urticants, ce qui fait de cette barbe à titre de comparaison, une arme de guerre bien plus destructrice que votre haleine de Bwork. Tout simplement effrayant.', 658, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8067, 11, 'Bottes du Champion', 'Certains aventuriers racontent que ces bottes permettent de marcher sur les pièges sans les déclencher. Attention, c\'est peut-être un piège...', 72, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8068, 17, 'Cape du Champion', 'Cette splendide cape dispose d\'épaulettes intégrées afin de vous donner plus de prestance pour enfin ressembler à un véritable champion.', 96, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8069, 16, 'Coiffe du Champion', 'Cette imposante coiffe vous donnera de toute évidence la grosse tête, si vous ne l\'avez pas déjà.', 127, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8070, 10, 'Ceinture du Champion', 'Avec cette ceinture autour des hanches, vous cacherez facilement ce qui ne vous met pas en valeur.', 88, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8071, 18, 'Mini Champion', 'Cette petite créature n\'accepte de suivre que les champions, elle risque donc de vous suivre quelques jours, pour ensuite s\'apercevoir que vous êtes un imposteur. Dès lors, c\'est vous qui la suivrez comme un petit familier.', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8072, 23, 'Dofus Kaliptus', 'Personne ne connaît le dragon à l\'origine de ce Dofus. On raconte juste qu\'il aurait ingéré une quantité effroyable de feuilles de Kaliptus, avant de pondre et de mourir d\'une terrible crise d\'aérophagie.', 10, 6, 'b0#6#1e#0#1d25+5');
INSERT INTO `website_shop_objects_templates` VALUES (8073, 84, 'Clef du Repaire de Skeunk', 'Cette clef vous a été donnée par Rigroulak en échange d\'une panoplie du Koulosse, elle vous permettra de rentrer dans le repaire de Skeunk.', 11, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8075, 15, 'Boomerang du Dok Alako', 'Ce morceau de bois d\'une forme étrange a voyagé longtemps dans les airs et entre les rangs ennemis avant de se briser. On raconte qu\'il revient toujours vers son propriétaire une fois lancé, mais rarement dans ses mains...', 722, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8076, 15, 'Boomerang du Maître Koalak', 'Ce morceau de bois d\'une forme étrange a voyagé longtemps dans les airs et entre les rangs ennemis avant de se briser. On raconte qu\'il revient toujours vers son propriétaire une fois lancé, mais rarement dans ses mains...', 723, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8077, 15, 'Boomerang du Warko Marron', 'Ce morceau de bois d\'une forme étrange a voyagé longtemps dans les airs et entre les rangs ennemis avant de se briser. On raconte qu\'il revient toujours vers son propriétaire une fois lancé, mais rarement dans ses mains...', 724, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8078, 95, 'Planche en Bois de Kaliptus', 'Cette planche permet aux bricoleurs de construire des trucs en bois, comme un cercueil en planches par exemple.', 22, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8079, 27, 'Transformation Fantôme Petit Chacha Blanc', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8080, 27, 'Transformation Fantôme Petit ChienChien Noir', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8081, 100, 'Sac de Bois de Charme', 'Cet énorme sac contient une quantité impressionnante de Bois de Charme.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8082, 55, 'Etoffe du Fauchalak', 'Cette étoffe sent la mort, alors que vous sentez le mort. La différence est notable.', 13, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8083, 47, 'Os de Pékeualak', 'Cet os est spongieux, ce qui lui permet de flotter si le Pékeualak tombe à l\'eau en essayant de remonter une grosse prise.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8084, 59, 'Peau de Piralak', 'Cette peau recouverte de balafres est devenue plus résistante que la roche, tout en gardant une souplesse remarquable. C\'est la peau idéale pour les martinets et les sandales de mauvais goût.', 8, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8085, 54, 'Poils de Koalak Forestier', 'Ces poils sont recouverts de sève de Kaliptus, ce qui leur confère un aspect luisant et brillant. Malheureusement, ils sont inutilisables en haute couture à cause de leur odeur de Dragodinde morte.', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8086, 15, 'Coiffe déchiquetée de Drakoalak', 'Cette étrange coiffe cachait jadis la calvitie naissante du Drakoalak. Avec un peu de travail, elle pourra peut-être bientôt cacher la vôtre.', 725, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8087, 73, 'Sort Maîtrise de la Hache', '(Double clic pour apprendre le sort) \\nCe parchemin vous permettra de faire plus de dégâts en utilisant une hache.', 8, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (8088, 3, 'Baguette Gyver', 'Cette baguette faite de bric et de broc renferme une énergie surprenante. On raconte qu\'elle est capable de se déplacer elle-même, pour choisir sa cible et défendre son maître même lorsque ce dernier est en train d\'agoniser. Le Chouque aurait même dit à propos de cette baguette \"Je crois que votre baguette est ouverte\". Pauvre Chouque.', 56, 128, '63#4#6#0#1d3+3,64#1a#21#0#1d8+25,7e#1f#32#0#1d20+30,7d#97#c8#0#1d50+150,7c#15#28#0#1d20+20,75#1#0#0#0d0+1,b2#5#7#0#1d3+4,d2#6#8#0#1d3+5');
INSERT INTO `website_shop_objects_templates` VALUES (8089, 3, 'Baguette Iots', 'Iots était un perroquet qui répétait toujours tout, on raconte que cette baguette fut sculptée dans son bec.', 57, 138, '5b#1#2#0#1d2+0,5c#1#2#0#1d2+0,5d#1#2#0#1d2+0,5e#1#2#0#1d2+0,b0#6#a#0#1d5+5,7b#15#23#0#1d15+20,76#15#23#0#1d15+20,77#15#23#0#1d15+20,7d#97#c8#0#1d50+150,b2#5#7#0#1d3+4,7e#15#23#0#1d15+20,7c#15#28#0#1d20+20,f2#6#8#0#1d3+5,f3#6#8#0#1d3+5');
INSERT INTO `website_shop_objects_templates` VALUES (8090, 4, 'Bâton des Caraïbes', 'Ce bâton a déjà mordu des gens, ou été mordu par des gens, ou des gens sont mordus de lui, on ne sait pas trop.', 64, 114, '5e#9#14#0#1d12+8,7e#15#28#0#1d20+20,b0#6#a#0#1d5+5,b6#1#0#0#0d0+1,7c#10#1e#0#1d15+15,7d#33#64#0#1d50+50,b2#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8091, 4, 'La Canne Bière', 'Ce bâton vient du sud, et par tous les chemins, il y revient.', 65, 134, '64#7#10#0#1d10+6,62#7#10#0#1d10+6,5e#3#5#0#1d3+2,77#15#23#0#1d15+20,7e#15#19#0#1d5+20,76#15#23#0#1d15+20,7c#10#19#0#1d10+15,7d#51#96#0#1d70+80,70#3#5#0#1d3+2,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (8092, 5, 'Les Dagues du Bouwin', 'Le bouwin n\'est pas fin, le bouwin n\'est pas malin, mais quand il a ses dagues en main, personne ne cherche à provoquer le bouwin.', 56, 135, '64#e#19#0#1d12+13,7d#c9#fa#0#1d50+200,76#1f#32#0#1d20+30,70#6#a#0#1d5+5,e2#b#14#0#1d10+10,77#10#1e#0#1d15+15,65#1#0#0#0d0+1,f4#6#a#0#1d5+5,f2#6#a#0#1d5+5,8a#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8093, 5, 'Dagues Ristocrates', 'Porter ces dagues ne fera pas de vous un héros, mais si vous les rangez dans vos sous-vêtements, vous finirez peut-être par ressembler à une héroïne.', 64, 58, '');
INSERT INTO `website_shop_objects_templates` VALUES (8094, 6, 'L\'Epée Rilleuse', 'Cette épée illustre bien un vieux proverbe Iop, quand l\'ennemi périt, l\'épée rit.', 66, 169, '64#1a#32#0#1d25+25,5c#3#4#0#1d2+2,76#1f#32#0#1d20+30,7d#c9#12c#0#1d100+200,b0#b#14#0#1d10+10,70#6#a#0#1d5+5,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8095, 6, 'Le Sabre Ayassalama', 'Cette épée fut forgée en visant uniquement l\'esthétisme afin de décorer une cheminée de grande valeur, mais son efficacité lors des tueries lui vaut d\'être maniée régulièrement. Les gens n\'ont décidément aucun respect pour l\'art.', 67, 143, '64#1a#28#0#1d15+25,5e#4#6#0#1d3+3,7e#1f#32#0#1d20+30,77#10#1e#0#1d15+15,ae#c9#190#0#1d200+200,7d#c9#fa#0#1d50+200,70#6#a#0#1d5+5,f4#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8096, 7, 'Marteau Mawoque', 'Son précédent propriétaire dansait avec les Mulous. Il est mort dévoré.', 56, 140, '63#e#17#0#1d10+13,60#e#17#0#1d10+13,7b#15#28#0#1d20+20,7d#65#96#0#1d50+100,70#6#a#0#1d5+5,d6#5#7#0#1d3+4,d2#5#7#0#1d3+4,8a#10#19#0#1d10+15,7c#1a#28#0#1d15+25');
INSERT INTO `website_shop_objects_templates` VALUES (8097, 7, 'Marteau Xiko', 'Ce marteau fait voir la vie en rose avant de vous réduire le crâne en bouillie.', 57, 129, '61#15#20#0#1d12+20,76#15#28#0#1d20+20,7d#65#96#0#1d50+100,80#1#0#0#0d0+1,70#6#a#0#1d5+5,ae#65#c8#0#1d100+100,b0#b#f#0#1d5+10,b6#1#0#0#0d0+1,73#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (8098, 19, 'Lame Usicke', 'Cette hache à la forme exceptionnelle, dispose d\'une lame vibrante qui permet d\'achever ses ennemis en musique.', 38, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8099, 19, 'La Hache Menbien', 'Cette arme a été trempée dans une fontaine de foudre pure puis saupoudrée de poussière d\'étoile, mais il paraît que c\'est entièrement faux.', 39, 116, '64#15#20#0#1d12+20,62#7#10#0#1d10+6,7c#b#14#0#1d10+10,b0#6#f#0#1d10+5,77#1f#32#0#1d20+30,f4#6#a#0#1d5+5,f3#6#a#0#1d5+5,f0#6#a#0#1d5+5,f1#6#a#0#1d5+5,f2#6#a#0#1d5+5,70#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8100, 19, 'La Hache Ticot', 'Cette hache est percée de trous en divers endroits, ce qui accompagne ses coups d\'élégants sifflements guillerets, cachant les cris de douleur de vos ennemis. C\'est regrettable.', 40, 112, '64#9#13#0#1d11+8,8a#6#a#0#1d5+5,7d#33#64#0#1d50+50,7c#10#19#0#1d10+15,b0#6#a#0#1d5+5,ae#c9#190#0#1d200+200,76#15#28#0#1d20+20,f4#4#6#0#1d3+3,f3#4#6#0#1d3+3,73#2#3#0#1d2+1,75#1#0#0#0d0+1,64#9#13#0#1d11+8');
INSERT INTO `website_shop_objects_templates` VALUES (8101, 19, 'Le Fendoir Tichaud', 'Cette hache fut forgée par Brouce Boulgoure lorsqu\'il s\'essayait à la boulangerie pour faire plaisir à son ami Xavier le boulanger. Il voulait faire une pelle à tarte.', 41, 128, 'd5#4#6#0#1d3+3,b0#6#a#0#1d5+5,b2#4#6#0#1d3+3,70#6#a#0#1d5+5,7d#65#96#0#1d50+100,7e#15#28#0#1d20+20,64#18#2a#0#1d19+23');
INSERT INTO `website_shop_objects_templates` VALUES (8102, 51, 'Pierre du Craqueleur Légendaire', 'On dit de cette pierre qu\'elle pourrait être le coeur du Craqueleur Légendaire. Ce qui est certain c\'est que le Craqueleur Légendaire n\'avait jamais le coeur lourd, cette pierre est donc d\'une légèreté incroyable, ce qui permet d\'en faire des objets adaptés aux personnages qui recherchent avant tout la mobilité, l\'agilité et protection. Tout simplement génial.', 457, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (8103, 2, 'Arc Rainier', 'Cet arc est en réalité la chevelure fossilisée d\'un Sadida endormi trop profondément, sur laquelle des Araknes ont tissé leurs toiles.', 53, 121, '64#2#15#0#1d20+1,7c#15#28#0#1d20+20,7d#47#5a#0#1d20+70,7b#15#23#0#1d15+20,7e#15#23#0#1d15+20,77#15#23#0#1d15+20,76#15#23#0#1d15+20,8a#b#14#0#1d10+10,79#5#7#0#1d3+4,64#2#15#0#1d20+1');
INSERT INTO `website_shop_objects_templates` VALUES (8104, 2, 'Arc Chtelion', 'Cet arc d\'une couleur discutable est parfait pour parader au Zaap de Bonta et à défaut de vous faire passer pour un coq, il attirera toutes les poulettes. Tantôt renversant, tantôt révulsant, il viendra peut-être à bout de vos ennemis sans que vous ne décochiez la moindre flèche.', 54, 129, '64#d#1b#0#1d15+12,63#5#7#0#1d3+4,7e#15#23#0#1d15+20,7d#33#64#0#1d50+50,b0#6#f#0#1d10+5,75#1#0#0#0d0+1,ae#65#c8#0#1d100+100,70#4#6#0#1d3+3,d3#5#8#0#1d4+4,d2#5#8#0#1d4+4');
INSERT INTO `website_shop_objects_templates` VALUES (8106, 44, 'Potion d\'oubli de métier : Bricoleur', 'Cette potion vous fera oublier le métier de Bricoleur.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8107, 25, 'Livre Honorifique des Bardes', 'Ce livre a été remis solennellement à Nolliuos, pour avoir remporté le concours de Bardise de l\'an 636. Qu\'il soit témoigné ici de ses mérites et de son talent ! Hujikan, Doux-Leurre, et Madahine sont également présents dans ce recueil. Longue vie à eux et à leur plume !', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8108, 1, 'Amulette du Tofu', 'Légère comme une plume de Tofu, cette amulette se porte autour du cou ou du front, pour les aventuriers en quête d\'originalité.', 95, 22, '73#2#3#0#1d2+1,77#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (8109, 9, 'Anneau du Tofu', 'Cet anneau vraiment insignifiant tant il est ridicule, peut tout de même se révéler indispensable. En effet, vos ennemis risquent d\'avoir tellement pitié de vous, qu\'ils vous achèveront, plutôt que de vous laisser souffrir atrocement. Il faut toujours voir le bon côté des choses.', 100, 21, '77#6#f#0#1d10+5,7c#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (8110, 3, 'Baguette du Tofu', 'Contrairement à ce que certains aventuriers peuvent croire, cette baguette n\'est pas utilisée par les Tofus (bien trop stupides pour savoir se servir d\'une telle arme), mais contre les Tofus. En effet, les plumes de Tofu qui la composent permettent aux chasseurs de simuler la parade nuptiale des Tofus pour ensuite mieux les attraper. Mais jusqu\'où iront ces terribles chasseurs pour satisfaire leurs pulsions meurtrières ?', 58, 25, '5e#3#4#0#1d2+2,5d#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (8111, 11, 'Pantoufles du Tofu', 'A la fois souples et légères, ces pantoufles restent chaudes l\'hiver et fraîches l\'été. Malheureusement, elles ne supportent pas les lavages en machine.', 73, 23, '77#6#f#0#1d10+5,7e#6#f#0#1d10+5,7d#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (8112, 17, 'Cape du Tofu', 'Cette étrange cape semble avoir été coupée en deux. Mais pourquoi aurait-elle était coupée en deux ? Personne ne le sait, même si tout le monde a son avis sur la question.', 97, 26, '70#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (8113, 10, 'Ceinture du Tofu', 'Idéale pour étrangler les Tofus, cette ceinture permet également aux chasseurs de fouetter les aventuriers qui s\'aventurent sur leur domaine en période de chasse. Il est donc déconseillé de plaisanter pas avec nos amis les chasseurs, ce ne sont pas forcément les Tofus qui ont un coup dans l\'aile.', 89, 22, '9e#1#c8#0#1d200+0,77#6#f#0#1d10+5,7e#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (8114, 16, 'Kaskofu', 'Ce casque de chantier est devenu un objet de mode incontournable pour les aventurières coquettes. Mais où va le monde ?', 128, 23, '7c#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (8116, 16, 'Scaracoiffe Dorée', 'Cette coiffe est parfaite pour cacher votre acné, ou votre visage de chérubin.', 129, 58, 'd6#1#5#0#1d5+0,b0#1#a#0#1d10+0,b6#1#2#0#1d2+0,73#1#5#0#1d5+0,77#6#1e#0#1d25+5,7e#6#1e#0#1d25+5');
INSERT INTO `website_shop_objects_templates` VALUES (8117, 17, 'Scaracape Dorée', 'Plus dorée qu\'une Scaracape classique et moins noire qu\'une Scaracape Noire, cette cape est parfaite pour cacher vos excroissances. Elle servait autrefois au Scarabosse Doré qui l\'utilisait pour cacher son horrible bosse. De nos jours, cette cape est avant tout utilisée pour cacher les horribles postérieurs. Autant dire que cette cape est populaire.', 98, 58, 'ae#1#c8#0#1d200+0,75#1#0#0#0d0+1,70#1#4#0#1d4+0,7c#6#14#0#1d15+5,7d#6#37#0#1d50+5');
INSERT INTO `website_shop_objects_templates` VALUES (8118, 3, 'Baguette du Scarabosse Doré ', 'Cette baguette magique est parfaite pour dépoussiérer les vieux meubles ou les vieilles personnes.', 59, 59, '8a#6#14#0#1d15+5,b2#1#3#0#1d3+0,6c#b#1e#0#1d20+10');
INSERT INTO `website_shop_objects_templates` VALUES (8119, 10, 'Scarature Dorée', 'Si vous aimez parader entièrement nu sur les plages de l\'île de Moon, vous devriez rapidement tomber amoureux de cette ceinture, réputée pour être un excellent cache-misère.', 90, 51, 'f0#1#3#0#1d3+0,f3#1#3#0#1d3+0,f2#1#3#0#1d3+0,f1#1#3#0#1d3+0,b2#1#3#0#1d3+0,77#6#1e#0#1d25+5,7d#6#37#0#1d50+5');
INSERT INTO `website_shop_objects_templates` VALUES (8120, 1, 'Amulette Scarabosse Doré ', 'Portée sur un torse velu, cette amulette a tout pour plaire tant elle se marie bien avec les touffes de poils.', 96, 45, 'b2#1#3#0#1d3+0,7e#6#f#0#1d10+5,7c#6#f#0#1d10+5,7d#6#2d#0#1d40+5');
INSERT INTO `website_shop_objects_templates` VALUES (8121, 9, 'Anneau du Scarabosse Doré ', 'Le Sacrabosse est une étrange créature. Bossue et laide depuis sa naissance, elle s\'est retrouvée être la risée des autres Scarafeuilles. C\'est peut-être pour cela que vous vous sentez si proche de cette créature.', 101, 43, '70#1#4#0#1d4+0,b2#1#4#0#1d4+0');
INSERT INTO `website_shop_objects_templates` VALUES (8122, 11, 'Scarabottes Dorées', 'Ces bottes crochues permettent d\'escalader facilement les falaises les plus abruptes, ou de labourer les champs sans charrue.', 74, 54, 'f1#1#3#0#1d3+0,f0#1#3#0#1d3+0,f3#1#3#0#1d3+0,f2#1#3#0#1d3+0,80#1#0#0#0d0+1,7c#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (8123, 1, 'Amulette Paysanne', 'Cette amulette est parfumée à l\'huile de Tournesol Sauvage et aux fines herbes. Elle peut donc servir d\'appât pour les ruminants dangereux que vous voudrez piéger, comme les Bouftous, ou les belles-mères par exemple.', 97, 20, 'ae#1#32#0#1d50+0,70#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8124, 10, 'Ceinturemuda du Paysan', 'Cette ceinture est franchement exceptionnelle, puisqu\'un bermuda en fibre de lin y est attaché. C\'est la ceinture idéale pour ceux qui aiment se délester de leurs vêtements rapidement, et passer à l\'action sur le champ. Attention cependant, pour des raisons d\'hygiène, cette ceinture est interdite dans les piscines municipales.', 91, 20, '7b#b#f#0#1d5+10,7d#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (8125, 16, 'Bob du Paysan', 'Pour se protéger du soleil lorsque vous travaillez dans les champs, rien de mieux qu\'un Ploukosse. Pour se protéger du soleil lorsque vous travaillez dans les champs et que vous êtes pauvre, rien de mieux que le célèbre Bob du Paysan.', 130, 19, '7c#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8126, 9, 'Mitaines Mitées du Paysan', 'Ces mitaines mitées sont de véritables bijoux. On raconte qu\'elles sont recouvertes de poussière de diamant, ce qui leur confère une résistance extraordinaire. Elles disposent d\'une face abrasive, idéale pour frotter le derrière des Bouftous, ou celui de votre épouse.', 102, 12, 'd9#4#5#0#1d2+3,b6#1#0#0#0d0+1,b2#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8127, 22, 'Faux usée du Paysan', 'Cette faux robuste mais abîmée a déjà beaucoup servi et coupe assez mal. En revanche, elle est très efficace pour arracher les chaires tendres et superficielles. Très utile pour lutter contre les varices de vos adversaires.', 2, 17, '5b#4#5#0#1d2+3,7d#b#f#0#1d5+10,73#2#3#0#1d2+1,da#b#f#0#1d5+10,d7#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (8128, 11, 'Bottes Paysannes', 'Ces bottes sont rembourrées avec de la paille de blé, ce qui permet d\'absorber la transpiration et de cultiver des champignons toxiques à moindre frais. Grâce à leur semelle molle, ces bottes sont recommandées par les arbitres de la fédération de Boufball.', 75, 18, '7c#1#5#0#1d5+0,7d#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (8129, 1, 'Amuloumulette', 'Derrière ce surnom stupide, se cache en réalité une amulette relativement puissante, confectionnée à partir de crocs, de dents et d\'ossements de Mulous, ce qui explique la terrible odeur qui s\'en dégage. A défaut d\'être assortie à votre cou, elle sera assortie à votre haleine.', 98, 57, 'b0#1#a#0#1d10+0,70#2#5#0#1d4+1,73#2#5#0#1d4+1,77#6#1e#0#1d25+5');
INSERT INTO `website_shop_objects_templates` VALUES (8130, 19, 'Hache du Mulou', 'Cette terrible hache a permis de décapiter plus d\'un aventurier imprudent. Et pourtant, elle coupe assez mal, il faut parfois une dizaine de tentatives pour parvenir à couper un cou un peu résistant.', 42, 55, '61#10#23#0#1d20+15,7d#6#37#0#1d50+5,7c#1#f#0#1d15+0,76#6#1e#0#1d25+5,73#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (8131, 81, 'Sac du Paysan', 'Ce sac très en vogue chez les jeunes écoliers, est idéal pour entreposer des farines animales et végétales. Une fois ouvert, puis déplié et déchiré le long des coutures, il pourra vous servir de jupe si vous n\'avez pas peur de montrer vos cuisses velues.', 3, 19, '9e#65#c8#0#1d100+100,7b#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8132, 10, 'Scarature Noire', 'Cette ceinture manque cruellement d\'originalité. Elle semble cependant assortie à votre coiffure.', 93, 43, 'b0#1#a#0#1d10+0,ae#1#64#0#1d100+0,b6#1#0#0#0d0+1,73#2#4#0#1d3+1');
INSERT INTO `website_shop_objects_templates` VALUES (8133, 16, 'Scaracoiffe Noire', 'C\'est la coiffe parfaite pour ceux qui veulent avoir des idées noires.', 132, 53, '7d#6#2d#0#1d40+5,7c#6#f#0#1d10+5,70#1#4#0#1d4+0,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8134, 17, 'Scaracape Noire', 'Si vous n\'avez pas les moyens de vous acheter une Corbacape Mastralis, mais que vous aimez faire peur aux Araknes en vous habillant en noir, c\'est la cape qu\'il vous faut.', 100, 53, '7d#6#2d#0#1d40+5,70#1#4#0#1d4+0,e2#6#14#0#1d15+5,d6#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (8135, 84, 'Clef du Donjon des Bworks', 'Cette clef surprenante vous permettra de rentrer dans le donjon des Bworks, mais pas d\'en sortir vivant.', 234, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8136, 9, 'Scaranneau Noir', 'Cet anneau magnifique peut être porté autour du gros orteil. Idéal pour cacher vos verrues et vos ongles incarnés.', 104, 48, '7d#6#1e#0#1d25+5,73#1#3#0#1d3+0,b2#1#4#0#1d4+0,d6#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (8137, 15, 'Viscères du Scarabosse Doré ', 'Ces viscères sont en partie responsables des digestions difficiles du Scarabosse Doré. Vous êtes donc autorisé à les faire frire sans remord.', 726, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8138, 107, 'Carapace de Scarafeuille Noir', 'Une fois retournée, cette carapace fera un excellent cendrier.', 727, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8139, 84, 'Clef du Donjon des Scarafeuilles', 'Cette magnifique clef dorée, vous permettra de rentrer dans le donjon des Scarafeuilles. Vous pensiez avoir tout vu ?', 233, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8140, 15, 'Antennes du Scarafeuille Noir', 'Le Scarafeuille noir n\'a jamais trouvé la moindre utilité à ses propres antennes. La nature est vraiment mal faite.', 728, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8141, 104, 'Ailes du Scarafeuille Noir', 'Contrairement à ce que certains aventuriers peuvent penser, les ailes du Scarafeuille Noir ne sont pas noires, mais blanches. Encore un mystère de la nature qui alimente les débats mouvementés de la taverne.', 729, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8142, 84, 'Clef Secrète du Tofulailler Royal', 'Cette clef vous donne accès au Tofulailler Royal. Une bonne dérouillée vous y attend.', 12, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8143, 84, 'Clef des Champs', 'Cette clef ne vous permettra pas de vous évader du Donjon des Champs, mais plutôt de vous y enfermer.', 13, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8144, 15, 'Mojo du Meulou', 'Cette petite fiole contient toute la puissance virile du Meulou. Attention, son contenu n\'est pas comestible.', 730, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8145, 37, 'Bière de Bwork', 'La Bière de Bwork enivre un Féca à 12 pas et un Sadida de quinze pieds. On ne sait pas vraiment si elle est faite par les Bworks, à partir de Bworks, ou les deux.', 1, 1, '8b#1f5#3e8#0#1d1+10');
INSERT INTO `website_shop_objects_templates` VALUES (8146, 11, 'Bottes Du Craqueleur Légendaire', 'Si vous aimez danser et écraser les pieds de vos partenaires, ces bottes sont faites pour vous.', 77, 86, '7e#10#19#0#1d10+15,77#10#19#0#1d10+15,b2#4#5#0#1d2+3,70#4#5#0#1d2+3,f1#5#7#0#1d3+4,f0#5#7#0#1d3+4,80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8147, 16, 'Casque du Craqueleur Légendaire', 'Version améliorée du casque du Craqueleur, ce roc vous protègera efficacement des chutes de pierres, mais pas des chutes de cheveux.', 133, 80, 'f2#5#7#0#1d3+4,f3#5#7#0#1d3+4,ae#65#c8#0#1d100+100,75#1#0#0#0d0+1,8a#b#f#0#1d5+10,73#2#3#0#1d2+1,77#1a#23#0#1d10+25,7c#10#19#0#1d10+15,7d#29#3c#0#1d20+40');
INSERT INTO `website_shop_objects_templates` VALUES (8148, 7, 'Marteau du Craqueleur Légendaire', 'Cet énorme marteau est en fait une épée de Craqueleur, munie d\'une pierre du Craqueleur Légendaire. Cette création surprenante saura surprendre vos adversaires, juste avant de les écraser.', 58, 81, '8a#b#f#0#1d5+10,70#4#5#0#1d2+3,77#1a#23#0#1d10+25,7e#1a#23#0#1d10+25,64#9#e#0#1d6+8,62#d#18#0#1d12+12');
INSERT INTO `website_shop_objects_templates` VALUES (8149, 9, 'Craquanneau Légendaire', 'Ce rocher serti de pierres précieuses est idéal pour marquer les tempes ou le front de vos adversaires de façon définitive.', 105, 80, 'd3#4#5#0#1d2+3,d4#4#5#0#1d2+3,75#1#0#0#0d0+1,7e#10#19#0#1d10+15,77#10#19#0#1d10+15,7d#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (8150, 1, 'Amulette du Craqueleur Légendaire', 'D\'apparence modeste, cette amulette renferme bien des secrets notamment celui précisant quels secrets elle renferme.', 99, 84, '6f#1#0#0#0d0+1,7d#1f#32#0#1d20+30,7c#10#19#0#1d10+15,7e#10#19#0#1d10+15,77#10#19#0#1d10+15,f0#4#5#0#1d2+3,f1#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (8151, 18, 'Bouloute', 'Ce petit monstre vous suivra partout, et se nourrira des restes de ses congénères. Tantôt terrifiant, tantôt amusant, il égayera votre vie, avant de peut-être vous la prendre définitivement.', 35, 1, '6e#1#96#0#1d150+0,320#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (8152, 10, 'Ceinture du Craqueleur Légendaire', 'Le Craqueleur légendaire porte cette ceinture autour de ses orteils, vous autour de la taille, ou des chevilles peut-être...', 94, 80, 'ae#65#96#0#1d50+100,9e#c9#12c#0#1d100+200,b6#1#0#0#0d0+1,70#4#5#0#1d2+3,77#10#19#0#1d10+15,7c#10#19#0#1d10+15,7d#15#23#0#1d15+20');
INSERT INTO `website_shop_objects_templates` VALUES (8153, 18, 'Abra Kadabra', 'Comme vous, ce petit Abraknyde ne supportait plus sa famille, et a décidé de se rebeller. Aujourd\'hui, il vous accompagne et comptabilise tous les membres de sa famille que vous réussirez à exterminer.', 34, 1, '8a#1#32#0#1d50+0,320#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (8154, 18, 'El Scarador', 'Ce charmant petit coléoptère venu du sud est en fait redoutable. Humilié par ses amis lorsqu\'il était jeune, il a décidé de se venger, et vous aidera à botter le derrière de tous les Scarafeuilles que vous rencontrerez.', 36, 1, '320#a#0#0#0d0+10,d2#1#14#0#1d20+0,d3#1#14#0#1d20+0,d4#1#14#0#1d20+0,d5#1#14#0#1d20+0,d6#1#14#0#1d20+0');
INSERT INTO `website_shop_objects_templates` VALUES (8155, 18, 'Tifoux', 'Cette splendide créature est un lointain cousin des célèbres Lenalds de l\'île des Wabbits. Plus téméraire, mais également beaucoup plus indisciplinée, elle saura vous apporter son aide durant vos combats, mais également faire preuve d\'une fourberie sans nom, en vous aidant à vaincre les membres de sa propre famille.', 37, 1, '320#a#0#0#0d0+10,7c#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (8156, 84, 'Clef du Donjon des Canidés', 'Cette clef vous permettra de rentrer dans le terrible donjon des Canidés, et de vous faire par la même occasion, étriper dans la joie et la bonne humeur.', 235, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8157, 35, 'Pétale Magique du Tournesol Affamé ', 'Comme tous les objets magiques, ce pétale impressionne, et dégage une aura de puissance proportionnelle à la crédulité des aventuriers qui l\'observent.', 2, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (8158, 53, 'Plume Graisseuse du Tofu Ventripotent', 'Le Tofu Ventripotent se badigeonne régulièrement de graisse pour que ses plumes ne se détachent jamais de son plumage. Une technique vieille comme le monde, qui permet à certains Enutrofs de garder leurs cheveux, même après la puberté.', 1, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8159, 107, 'Carapace du Scarabosse Doré ', 'Portée sur la tête, cette carapace vous protègera des intempéries et des chutes de guano.', 731, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8160, 15, 'Antennes du Scarabosse Doré ', 'Si vous voulez ressembler à Korgamone le Chapon des Karpates, c\'est très simple, enfoncez-vous ces antennes dans les narines, et chantez à travers la campagne en remuant le postérieur de droite à gauche.', 732, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8161, 104, 'Ailes du Scarabosse Doré ', 'Si vous avez toujours rêvé de voler comme un Piou adipeux, accrochez ces ailes à votre ceinture, et jetez-vous depuis la tour des ordres de Brâkmar. Avec de la chance, vous ressemblerez à un Corbac écrasé, vous offrirez aux Brâkmariens, un très bon moment de rigolade, et aux Corbacs, un excellent repas.', 733, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8162, 16, 'Tête de Citwouille', 'Vous aurez l\'air encore plus stupide que d\'habitude avec cette Citwouille magique sur la tête, mais rappelez-vous de la malédiction d\'Halouine, qui transforme certaines créatures en d\'étranges bêtes difformes... \\nIl semblerait que seule cette coiffe puisse vous prémunir de cette terrible malédiction.', 134, 1, '32c#1#12c#0#1d300+0');
INSERT INTO `website_shop_objects_templates` VALUES (8163, 16, 'Kabuto', 'Porté autrefois par les forces de l\'ordre des plus grandes cités, ce casque est aujourd\'hui utilisé pour effrayer ceux qui contestent l\'ordre établi et cherchent à en apprendre trop sur ce qui régit leur univers.', 135, 101, '8a#15#23#0#1d15+20,70#4#6#0#1d3+3,7d#47#64#0#1d30+70,b6#1#0#0#0d0+1,b2#4#6#0#1d3+3,d2#4#6#0#1d3+3,d3#4#6#0#1d3+3,ae#65#96#0#1d50+100');
INSERT INTO `website_shop_objects_templates` VALUES (8164, 89, 'Cadeau Bouloute', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, un livre vous expliquant comment l\'élever, et des poudres d\'Eniripsa pour le soigner.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8165, 89, 'Cadeau Abra Kadabra', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, un livre vous expliquant comment l\'élever, et des poudres d\'Eniripsa pour le soigner.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8166, 89, 'Cadeau El Scarador', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, un livre vous expliquant comment l\'élever, et des poudres d\'Eniripsa pour le soigner.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8167, 89, 'Cadeau Tifoux', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, un livre vous expliquant comment l\'élever, et des poudres d\'Eniripsa pour le soigner.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8168, 89, 'Cadeau d\'Halouine', 'Halouine était de loin le plus grand cultivateur de Citwouilles de tout le continent. Malheureusement, il était également l\'apprenti d\'un Bwork Mage un peu trop versé dans les arcanes. Afin de gagner le concours de la plus grosse Citwouille cultivée au purin de Porkass, Halouine tricha en faisant appel au Bwork Mage, qui tenta une incantation inédite sur les Citwouilles. Ceux qui goûtèrent ces Citwouilles magiques, finirent transformés en d\'étranges créatures difformes pendant plusieurs jours, et ce chaque année à la même période. Cette malédiction semble même parfois se transmettre aux aventuriers qui s\'approchent trop près des créatures maudites. Pour conjurer le sort, les habitants d\'Amakna et de ses alentours, se mettent une Citwouille sur la tête pendant plusieurs jours, en espérant que cela les sauve. Le plus surprenant c\'est qu\'il semblerait que cela fonctionne.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8169, 27, 'Transformation Bouftou d\'Halouine', 'Vous avez été transformé en Bouftou d\'Halouine. Vous devez essayer de vaincre un autre aventurier pour vous débarrasser de cette terrible malédiction.', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8170, 27, 'Transformation Tofu d\'Halouine', 'Vous avez été transformé en Tofu d\'Halouine. Vous devez essayer de vaincre un autre aventurier pour vous débarrasser de cette terrible malédiction.', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8171, 90, 'Fantôme d\'Abra Kadabra', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 34, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8172, 90, 'Fantôme de Bouloute', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 35, 1, '');
