INSERT INTO `website_shop_objects_templates` VALUES (8175, 77, 'Certificat de Mise en Chanil : Abra Kadabra', 'Ce certificat décrit les caractéristiques de l\'Abra Kadabra que vous avez placé au chanil.', 36, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8176, 77, 'Certificat de Mise en Chanil : Bouloute', 'Ce certificat décrit les caractéristiques du Bouloute que vous avez placé au chanil.', 37, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8178, 77, 'Certificat de Mise en Chanil : El Scarador', 'Ce certificat décrit les caractéristiques du El Scarador que vous avez placé au chanil.', 38, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8179, 77, 'Certificat de Mise en Chanil : Tifoux', 'Ce certificat décrit les caractéristiques du Tifoux que vous avez placé au chanil.', 39, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8180, 77, 'Certificat de Mise en Chanil : Bworky', 'Ce certificat décrit les caractéristiques du Bworky que vous avez placé au chanil.', 40, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8181, 17, 'Craquelocape Légendaire', 'Cette cape épaisse en pierre brute fera de vous une brute épaisse en pierre.', 101, 84, 'f2#5#6#0#1d2+4,f3#5#6#0#1d2+4,b0#4#5#0#1d2+3,73#3#4#0#1d2+2,77#1a#28#0#1d15+25,7c#10#19#0#1d10+15,7d#33#46#0#1d20+50');
INSERT INTO `website_shop_objects_templates` VALUES (8184, 27, 'Transformation Fantôme Tifoux', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8185, 27, 'Transformation Fantôme El Scarador', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8186, 27, 'Transformation Fantôme Bouloute', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8187, 27, 'Transformation Fantôme Abra Kadabra', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8188, 27, 'Transformation Fantôme Bworky', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8211, 18, 'Walk', 'De toute évidence, cette créature s\'est échappée d\'un zoo ou d\'une île lointaine. Elle est connue pour améliorer les dommages de son maître lors des combats. Sa plus grande particularité, (qu\'elle partage parfois avec son maître) est d\'avoir une haleine de poisson moisi. Nous vous recommandons de lui clouer le bec, même si le marteau et les clous sont à commander séparément. Attention, cette petite créature est très exigeante, elle ne mange que du poisson.', 38, 1, '8a#1#32#0#1d50+0,320#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (8213, 1, 'Amulette du Piou Rouge', 'Cette amulette semble avoir été confectionnée à partir d\'une petite tête de Piou desséchée. La coquetterie n\'a aucune limite.', 100, 1, '7e#1#0#0#0d0+1');
