INSERT INTO `website_shop_objects_templates` VALUES (8219, 9, 'Anneau du Piou Rouge', 'Cet anneau permettra à votre maîtresse de vous retrouver, où que vous soyez.', 106, 1, '7e#1#0#0#0d0+1');
