INSERT INTO `website_shop_objects_templates` VALUES (8231, 17, 'Cape du Piou Rouge', 'Si vous êtes suffisamment petit, cette cape confectionnée à partir de quelques plumes de Piou, cachera vos fesses. Une protection assez modeste, mais qui a le mérite d\'attirer l\'attention des passants sur autre chose que vos cheveux gras ou vos grosses verrues.', 103, 1, '7e#1#0#0#0d0+1');
