INSERT INTO `website_shop_objects_templates` VALUES (8237, 10, 'Ceinture du Piou Rouge', 'Cette petite ceinture mettra vos hanches en valeur l\'espace d\'un combat. Elle servira ensuite à contenir vos tripes lorsqu\'un sanglier des plaines un peu énervé vous aura éventré au fin fond des bois.', 96, 1, '7e#1#0#0#0d0+1');
