INSERT INTO `website_shop_objects_templates` VALUES (8243, 16, 'Chapeau du Piou Rouge', 'Muni de ce petit chapeau sur la tête, vous aurez l\'air bien ridicule, mais aussi terriblement irrésistible. La vie est une question de choix.', 137, 1, '7e#1#0#0#0d0+1');
