INSERT INTO `website_shop_objects_templates` VALUES (8249, 53, 'Plume de Buveur', 'Cette plume usée et imbibée d\'alcool fort, est très inflammable. Très pratique pour cuisiner un Buveur rôti.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8250, 54, 'Poil de Renarbo', 'Le Renarbo adore se travestir en Corbac, personne ne sait réellement pourquoi, même si les esprits les plus mal tournés ont leur avis sur la question...', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8251, 54, 'Poil de Péki', 'Qui aurait pu croire que le Péki accepterait de se délester d\'une touffe de poils pour vos beaux yeux ? Personne, à part Joche Banette, célèbre idiot du village d\'Amakna, réputé pour son affection maladive pour les Pékis empaillés.', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8252, 53, 'Plume de Corbac Apprivoisé ', 'Cette plume bien grasse est celle d\'un Corbac Apprivoisé, qui a passé la majeure partie de son existence, enfermé, et gavé jusqu\'à ce qu\'il occupe totalement l\'espace de sa cage.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8253, 1, 'Amulette en Mousse', 'Cette amulette est souvent confondue avec un jouet à trouver dans des pochettes surprises, alors qu\'en fait elle se gagne au stand de tir.', 106, 11, '7d#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (8254, 9, 'Anneau en Mousse', 'Offert en alliance, cet anneau permet de faire passer deux messages à l\'être aimé : \"Je t\'aime\" et \"Va faire la vaisselle\". Idéal pour ne pas perdre son temps en répétant tous les soirs la même chose.', 112, 10, 'b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8255, 8, 'Pelle en Mousse', 'Cette arme terriblement puissante contre les mottes de terre, a marqué plus d\'un aventurier débutant. Une fois mouillée, elle devient molle et peut être roulée, mais il faut généralement être à deux pour y arriver.', 44, 10, '60#1#12#0#1d18+0,7b#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (8256, 11, 'Bottes en Mousse', 'Avec ces bottes, un Eniripsa peut marcher sur l\'eau, ce qui ne sert à rien puisqu\'il peut voler, mais ça impressionne toujours les foules. Les autres pourront toujours se servir de ces bottes pour se gratter les pieds en marchant, ou tout simplement pour les nettoyer.', 84, 11, '77#6#f#0#1d10+5');
INSERT INTO `website_shop_objects_templates` VALUES (8257, 10, 'Ceinture en Mousse', 'Cette ceinture permettait à Vald de prendre son bain sans danger car aucun Iop n\'a encore réussi à apprendre à nager.', 102, 10, '9e#1#c8#0#1d200+0');
INSERT INTO `website_shop_objects_templates` VALUES (8258, 17, 'Cape en Mousse', 'Cette cape est idéale pour le camouflage en milieu naturel, mais uniquement s\'il n\'y a personne pour vous voir.', 109, 10, 'ae#1#64#0#1d100+0');
INSERT INTO `website_shop_objects_templates` VALUES (8259, 16, 'Coiffe en Mousse', 'Sur la notice de cette coiffe, on peut lire :\"Offrez cette coiffe à votre mari, accrochez-la solidement sur sa tête et traînez-le par les pieds dans votre cuisine. Voilà le sol est propre désormais\". Cela résume un peu la conception moderne du ménage et de la répartition des tâches ménagères au sein des couples épanouïs et qui s\'assument.', 143, 11, '7d#1#14#0#1d20+0,70#1#0#0#0d0+1,75#1#0#0#0d0+1,d9#1#5#0#1d5+0,d8#1#5#0#1d5+0,da#1#5#0#1d5+0,db#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (8260, 16, 'Bandeau Kaliptus', 'Avec ce bandeau, les Iops n\'auront jamais été aussi séduisants !', 124, 133, '77#1f#32#0#1d20+30,8a#b#14#0#1d10+10,7d#c9#fa#0#1d50+200,ae#c9#190#0#1d200+200,d6#5#7#0#1d3+4,70#6#a#0#1d5+5,d8#4#6#0#1d3+3,d7#4#6#0#1d3+3,75#1#0#0#0d0+1,7c#15#28#0#1d20+20,73#3#5#0#1d3+2,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (8262, 1, 'La Meulette', 'La Meulette renferme une étrange substance trouvée dans les entrailles du Meulou, d\'aucuns prétendent qu\'il s\'agit de l\'essence du monstre, d\'autres pensent qu\'il avait juste dévoré un Kirboule pas très frais.', 107, 143, '76#1f#32#0#1d20+30,8a#6#f#0#1d10+5,73#2#3#0#1d2+1,6f#1#0#0#0d0+1,b0#b#14#0#1d10+10,7c#15#1e#0#1d10+20,7d#97#c8#0#1d50+150,d4#6#a#0#1d5+5,d3#6#a#0#1d5+5,70#2#4#0#1d3+1');
INSERT INTO `website_shop_objects_templates` VALUES (8263, 9, 'Anneau du Meulou', 'Attention, cet anneau rendra votre doigt particulièrement malodorant. Une odeur qui risque d\'en couvrir une autre. C\'est peut-être pour votre doigt et votre entourage une très bonne chose...', 113, 126, '76#1a#28#0#1d15+25,ae#65#c8#0#1d100+100,b0#6#f#0#1d10+5,77#15#1e#0#1d10+20,7d#47#64#0#1d30+70,79#4#5#0#1d2+3,f4#4#6#0#1d3+3,75#1#0#0#0d0+1,d5#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8264, 11, 'Bottes du Meulou', 'Ces bottes sont encore animées d\'une partie de l\'appétit vorace du Meulou. Si vos pieds sentent le Clakoss, elles risquent de vous les mordre.', 85, 131, '76#1f#32#0#1d20+30,80#1#0#0#0d0+1,7c#10#1e#0#1d15+15,7d#47#78#0#1d50+70,b0#b#f#0#1d5+10,f2#4#8#0#1d5+3,73#2#3#0#1d2+1,8a#4#5#0#1d2+3,b6#1#2#0#1d2+0,d4#6#9#0#1d4+5,f1#4#8#0#1d5+3,d3#6#9#0#1d4+5,d7#4#7#0#1d4+3,ae#65#c8#0#1d100+100,9e#c9#12c#0#1d100+200,f3#4#8#0#1d5+3,f4#4#8#0#1d5+3,f0#4#8#0#1d5+3');
INSERT INTO `website_shop_objects_templates` VALUES (8265, 17, 'Cape du Meulou', 'Le Meulou a la queue si belle et si longue qu\'elle traîne au sol. Certains aventuriers jaloux la lui ont arrachée et la portent, espérant sûrement y gagner en virilité.', 110, 139, '76#1f#32#0#1d20+30,7d#97#c8#0#1d50+150,70#5#7#0#1d3+4,73#2#3#0#1d2+1,ae#c9#190#0#1d200+200,8a#b#f#0#1d5+10,7c#15#1e#0#1d10+20,d5#6#a#0#1d5+5,d6#5#7#0#1d3+4,b0#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (8266, 10, 'Ceinture du Meulou', 'Cette ceinture colorée est dotée d\'une superbe touffe violacée sur le devant, vous pouvez également la porter à l\'envers pour vous travestir en Wabbit.', 103, 125, '76#1f#32#0#1d20+30,7d#97#c8#0#1d50+150,b0#b#14#0#1d10+10,7c#1a#28#0#1d15+25,70#4#6#0#1d3+3,75#1#0#0#0d0+1,d3#3#4#0#1d2+2,d6#3#4#0#1d2+2,d9#4#7#0#1d4+3');
INSERT INTO `website_shop_objects_templates` VALUES (8267, 16, 'Coiffe du Meulou', 'En dépeçant le Meulou, des chasseurs se sont aperçus qu\'il ne possède qu\'une seule grosse corne qui traverse son crâne de part en part, ce qui ne gène nullement les Iops qui la portent avec enthousiasme non dissimulé.', 144, 141, '76#1f#37#0#1d25+30,8a#b#14#0#1d10+10,70#6#a#0#1d5+5,b0#b#14#0#1d10+10,7d#c9#10e#0#1d70+200,7c#15#28#0#1d20+20,73#3#4#0#1d2+2,7e#10#19#0#1d10+15,77#10#19#0#1d10+15,d6#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (8268, 1, 'Collier du Minotoror', 'Ce collier permettait au Minotoror de ne pas avoir de puces, de tiques, ou même de poux. De toute évidence, vous en aviez besoin.', 112, 111, '6f#1#0#0#0d0+1,7d#97#c8#0#1d50+150,7c#15#2d#0#1d25+20,b6#2#3#0#1d2+1,b2#4#6#0#1d3+3,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (8269, 9, 'Anneau du Minotoror', 'Contrairement à ce que certains aventuriers rapportent, cet anneau n\'a jamais été porté par le Minotoror, incapable d\'enfiler un tel anneau autour de ses sabots.', 117, 105, 'ae#33#64#0#1d50+50,7c#b#14#0#1d10+10,f3#4#6#0#1d3+3,f2#4#6#0#1d3+3,b6#1#2#0#1d2+0,b0#7#a#0#1d4+6,7d#3d#64#0#1d40+60');
INSERT INTO `website_shop_objects_templates` VALUES (8270, 9, 'Bracelet du Minotot', 'Ce bracelet permet de protéger entièrement le bras d\'un Eniripsa, mais triple son poids.', 116, 151, '7b#1a#28#0#1d15+25,7d#65#82#0#1d30+100,b0#b#14#0#1d10+10,8a#6#a#0#1d5+5,70#4#6#0#1d3+3,b2#4#6#0#1d3+3,f3#4#7#0#1d4+3,7c#10#1e#0#1d15+15,f0#4#7#0#1d4+3,d3#4#6#0#1d3+3,ae#65#c8#0#1d100+100');
INSERT INTO `website_shop_objects_templates` VALUES (8271, 9, 'Anneau du Dragon Cochon', 'Cet anneau en cuir et en ivoire permet de stimuler plus facilement vos partenaires.', 115, 108, '7b#15#23#0#1d15+20,7d#33#50#0#1d30+50,77#15#23#0#1d15+20,b0#6#a#0#1d5+5,73#3#4#0#1d2+2,8a#3#5#0#1d3+2,7c#10#19#0#1d10+15,ae#65#96#0#1d50+100,70#3#5#0#1d3+2,76#15#23#0#1d15+20');
INSERT INTO `website_shop_objects_templates` VALUES (8272, 1, 'Collier du Minotot', 'Ce collier permettait aux Minotot, de protéger ses cervicales et d\'éviter de périr à cause d\'un stupide coup du Wabbit.', 111, 158, '6f#1#0#0#0d0+1,75#1#0#0#0d0+1,b0#10#19#0#1d10+15,8a#b#f#0#1d5+10,7c#1a#28#0#1d15+25,73#3#4#0#1d2+2,7b#1a#28#0#1d15+25,7e#1a#28#0#1d15+25,7d#b5#e6#0#1d50+180,70#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8273, 1, 'Collier du Dragon Cochon', 'Ce collier dispose d\'une petite boucle, qui permettait d\'accrocher une laisse au cou du Dragon Cochon, lorsque son propriétaire voulait l\'emmener faire une petite promenade nocturne.', 110, 100, '6f#1#0#0#0d0+1,77#15#23#0#1d15+20,7c#10#19#0#1d10+15,7d#1f#32#0#1d20+30,73#2#3#0#1d2+1,8a#10#14#0#1d5+15,b2#3#5#0#1d3+2,70#3#5#0#1d3+2,d4#4#6#0#1d3+3,d2#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8274, 19, 'Hache du Minotoror', 'Cette hache a permis de trancher la tête d\'un des plus dangereux Minotorors que la province d\'Amakna ait connu. Le plus incroyable dans cette histoire c\'est qu\'elle semble vous laisser indifférent.', 44, 109, '5c#3#5#0#1d3+2,64#15#28#0#1d20+20,8a#10#19#0#1d10+15,7d#33#64#0#1d50+50,7c#15#28#0#1d20+20,b0#6#a#0#1d5+5,70#4#6#0#1d3+3,b6#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (8275, 4, 'Sceptre du Minotot', 'Ce Sceptre orné à son extrémité d\'une tête de Serpentin en pierres précieuses, permet d\'effrayer les jeunes aventuriers, afin de les faire fuir, et de botter leurs petites fesses toutes roses.', 67, 151, '64#d#1b#0#1d15+12,5b#3#5#0#1d3+2,5e#3#5#0#1d3+2,7b#15#28#0#1d20+20,7e#15#28#0#1d20+20,7d#47#78#0#1d50+70,7c#b#14#0#1d10+10,b2#4#6#0#1d3+3,b0#10#19#0#1d10+15,d3#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8276, 11, 'Bottes du Minotoror', 'De toute évidence, ces terribles bottes en poils et en cuir de Minotoror, sont bien trop lourdes pour vous faire gagner la légendaire course à pieds de la baie d\'Amakna. Cependant, elles devraient vous permettre d\'écraser facilement les pieds des autres concurrents sur la ligne de départ.', 89, 113, '7d#65#96#0#1d50+100,7c#15#23#0#1d15+20,b0#b#f#0#1d5+10,b6#2#3#0#1d2+1,b2#3#5#0#1d3+2,f0#4#6#0#1d3+3,f4#4#6#0#1d3+3,80#1#0#0#0d0+1,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (8277, 11, 'Sandales du Minotot', 'Ces incroyables sandales vous permettront de vous baigner dans les eaux les plus dangereuses, sans risquer de vous abîmer les pieds. Attention cependant, elles ont la réputation de rayer le fond des baignoires.', 88, 163, '7e#1f#32#0#1d20+30,77#10#1e#0#1d15+15,80#1#0#0#0d0+1,7d#97#c8#0#1d50+150,75#1#0#0#0d0+1,79#6#a#0#1d5+5,b2#4#6#0#1d3+3,7c#b#14#0#1d10+10,b0#b#14#0#1d10+10,d9#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8278, 11, 'Mules du Dragon Cochon', 'Une bonne paire de mules et vous vous sentez de suite plus fort, plus puissant, plus performant. Alors que ce ne sont que des mules.', 87, 93, '7b#1a#28#0#1d15+25,80#1#0#0#0d0+1,7d#2e#46#0#1d25+45,7c#10#19#0#1d10+15,b6#1#0#0#0d0+1,70#2#3#0#1d2+1,b0#6#a#0#1d5+5,f2#6#a#0#1d5+5,f1#6#a#0#1d5+5,f3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8279, 17, 'Cape du Minotoror', 'Prenez un Minotoror, attachez-le fermement, prenez un rabot géant, et pelez-lui (en un seul passage) le dos. Voilà, c\'est fait, vous avez désormais entre les mains, une cape du Minotoror.', 117, 109, '7d#79#aa#0#1d50+120,7c#15#28#0#1d20+20,b0#6#f#0#1d10+5,b6#3#4#0#1d2+2,b2#4#6#0#1d3+3,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8280, 17, 'Cape du Minotot', 'Pour sortir en soirée, ou séduire au bal masqué du Captain Chafer, c\'est la cape qu\'il vous faut.', 116, 156, '7e#1f#32#0#1d20+30,7b#1f#32#0#1d20+30,7d#c9#fa#0#1d50+200,7c#10#19#0#1d10+15,73#3#4#0#1d2+2,b0#10#1e#0#1d15+15,70#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8281, 17, 'Cape du Dragon Cochon', 'Cette cape ne fera pas de vous un petit Cochon de Lait, mais elle vous permettra peut-être de vous travestir l\'espace d\'une soirée, afin de séduire une belle Cochonne.', 118, 103, '7b#1a#28#0#1d15+25,b0#b#f#0#1d5+10,70#4#6#0#1d3+3,7d#51#6e#0#1d30+80,f2#4#5#0#1d2+3,f3#4#5#0#1d2+3,f4#4#5#0#1d2+3,f0#4#5#0#1d2+3,f1#4#5#0#1d2+3,7a#2#4#0#1d3+1,d4#4#6#0#1d3+3,d5#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8282, 10, 'Ceinture du Minotoror', 'Cette ceinture est si souple, qu\'elle peut servir à fouetter les fesses des enfants trop turbulents. Avec un peu de chance, ses ferrures permettront d\'arracher quelques lambeaux de chair, et les terribles garnements qui vous servent de marmaille auront compris une bonne fois pour toute la leçon.', 106, 111, '7d#83#c8#0#1d70+130,7c#1a#28#0#1d15+25,b6#2#3#0#1d2+1,b0#b#14#0#1d10+10,f2#6#8#0#1d3+5,f3#6#8#0#1d3+5,b2#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8283, 10, 'Ceinture du Minotot', 'Cette ceinture rigide, permettait au Minotot, de contenir son énorme bedaine, afin de ne pas basculer en avant au moindre courant d\'air.', 105, 149, '7b#1f#32#0#1d20+30,7e#1f#32#0#1d20+30,7d#b5#fa#0#1d70+180,b0#10#19#0#1d10+15,9e#1f4#0#0#0d0+500,8a#b#f#0#1d5+10,b2#5#8#0#1d4+4,f4#4#6#0#1d3+3,f2#4#6#0#1d3+3,7c#15#28#0#1d20+20,f0#4#6#0#1d3+3,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8284, 16, 'Coiffe du Minotot', 'Cette coiffe se transmet dans la famille du Minotot, de génération en génération. Ce qui explique en partie son odeur de pellicules en décomposition.', 151, 157, '7b#1f#32#0#1d20+30,8a#10#19#0#1d10+15,7e#1f#32#0#1d20+30,7d#c9#10e#0#1d70+200,b2#5#8#0#1d4+4,73#3#5#0#1d3+2,7c#15#23#0#1d15+20,ae#65#c8#0#1d100+100,b0#10#19#0#1d10+15,d5#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8285, 16, 'Coiffe du Dragon Cochon', 'Affublé de cet énorme crâne, vous aurez l\'air d\'un Grizboule à poils durs, mais sans poils. De quoi laisser sans voix vos admiratrices.', 150, 98, '7b#15#23#0#1d15+20,77#15#23#0#1d15+20,73#2#4#0#1d3+1,70#4#6#0#1d3+3,7c#15#1e#0#1d10+20,f2#1#a#0#1d10+0,f1#1#a#0#1d10+0,d3#4#6#0#1d3+3,b0#6#a#0#1d5+5,f3#1#a#0#1d10+0,f0#1#a#0#1d10+0,f4#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (8286, 17, 'Cape Dragoeuf', 'Cette cape recouverte d\'écailles vous protègera d\'après la légende, de la foudre, des haricots, et surtout des femmes fatales.', 115, 127, 'd5#6#8#0#1d3+5,d4#6#8#0#1d3+5,70#4#6#0#1d3+3,b6#2#3#0#1d2+1,7d#65#96#0#1d50+100,75#1#0#0#0d0+1,b0#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (8287, 16, 'Casque Dragoeuf', 'Ce casque absolument terrifiant et d\'une taille démesurée ferait passer un petit chérubin comme vous, pour un impitoyable guerrier venu de l\'au delà. Cloué sur un mur, il fera un excellent porte manteau.', 149, 128, '7d#97#c8#0#1d50+150,d2#6#d#0#1d8+5,d6#6#d#0#1d8+5,d5#6#d#0#1d8+5,d3#6#d#0#1d8+5,d4#6#d#0#1d8+5');
INSERT INTO `website_shop_objects_templates` VALUES (8288, 10, 'Ceinture du Dragoeuf', 'Les esprits les plus pervertis d\'Amakna, racontent que cette ceinture pouvait servir de prothèse. Personne ne comprend pourquoi, et heureusement il n\'en n\'est rien, ce n\'est qu\'une banale ceinture du Dragoeuf.', 104, 124, '7b#1f#32#0#1d20+30,76#1f#32#0#1d20+30,7d#65#96#0#1d50+100,7c#15#28#0#1d20+20,9e#12d#1f4#0#1d200+300,73#2#3#0#1d2+1,b0#b#14#0#1d10+10,ae#65#c8#0#1d100+100,f2#4#5#0#1d2+3,f1#4#5#0#1d2+3,f3#4#5#0#1d2+3,f4#4#5#0#1d2+3,f0#4#5#0#1d2+3,d2#4#6#0#1d3+3,70#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (8289, 9, 'Anneau du Dragoeuf', 'Cet anneau directement taillé dans une écaille géante de Dragoeuf protègera une petite partie d\'une de vos phalanges. Sûrement la plus importante.', 114, 128, '8a#10#19#0#1d10+15,7d#65#96#0#1d50+100,7c#b#14#0#1d10+10,b0#b#f#0#1d5+10,b6#1#0#0#0d0+1,b2#4#6#0#1d3+3,70#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8290, 1, 'Amulette du Dragoeuf', 'Confectionnée à partir d\'écailles de Dragoeufs, cette amulette protégera efficacement votre pomme d\'Adam, ou vos amygdales.  De quoi faire la différence sur un champ de bataille.', 108, 124, '6f#1#0#0#0d0+1,77#1f#32#0#1d20+30,7c#1a#28#0#1d15+25,7d#47#64#0#1d30+70,73#1#2#0#1d2+0,79#5#7#0#1d3+4,e2#b#14#0#1d10+10,f3#4#6#0#1d3+3,d5#4#6#0#1d3+3,ae#c9#12c#0#1d100+200,b0#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (8291, 11, 'Bottes du Dragoeuf', 'Ces bottes sont parfaites pour tuer le Bouftou lors d\'une partie de Boufball ou pour faire souffrir un peu plus vos ennemis lors d\'un botte-fesses.', 86, 129, '7e#1a#2d#0#1d20+25,7b#1a#2d#0#1d20+25,7d#47#78#0#1d50+70,73#3#4#0#1d2+2,70#4#6#0#1d3+3,b0#b#14#0#1d10+10,b2#3#5#0#1d3+2,9e#c9#12c#0#1d100+200,d2#5#8#0#1d4+4,d3#5#8#0#1d4+4,80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8292, 6, 'Epée du Dragoeuf', 'Aiguisée comme le rasoir du soir, cette lame vous permettra tout de même de vous raser le matin, mais uniquement les aisselles.', 68, 127, '62#10#19#0#1d10+15,61#10#19#0#1d10+15,76#1a#2d#0#1d20+25,77#1a#2d#0#1d20+25,7d#47#64#0#1d30+70,b0#6#a#0#1d5+5,d4#5#8#0#1d4+4,d5#5#8#0#1d4+4,7c#1a#28#0#1d15+25');
INSERT INTO `website_shop_objects_templates` VALUES (8293, 19, 'Hache du Dragoeuf', 'Cette hache fend le beurre aussi facilement que les crânes, à moins que ça ne soit l\'inverse.', 43, 126, '5b#4#6#0#1d3+3,64#17#25#0#1d15+22,7d#33#50#0#1d30+50,7c#b#14#0#1d10+10,b0#b#f#0#1d5+10,77#10#19#0#1d10+15,f0#5#7#0#1d3+4,f2#5#7#0#1d3+4,70#4#6#0#1d3+3,73#3#4#0#1d2+2,7b#15#28#0#1d20+20');
INSERT INTO `website_shop_objects_templates` VALUES (8294, 7, 'Marteau du Dragoeuf', 'Plus lourd qu\'un crâne vide de Krokeur, mais moins solide qu\'un fémur de Kirboule des cavernes, ce marteau reste néanmoins une arme redoutable.', 59, 123, '64#15#23#0#1d15+20,5e#3#5#0#1d3+2,7e#1f#32#0#1d20+30,7d#65#96#0#1d50+100,7c#15#1e#0#1d10+20,73#3#4#0#1d2+2,b2#5#8#0#1d4+4,f3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8295, 2, 'Arc du Dragoeuf', 'Cet arc est si puissant qu\'il permet d\'envoyer des oeufs pourris de Dragoeufs au dessus des murailles de Brâkmar. Quel beau gâchis !', 55, 122, '61#12#21#0#1d16+17,8a#6#a#0#1d5+5,76#15#28#0#1d20+20,70#6#a#0#1d5+5,7d#33#64#0#1d50+50,73#3#5#0#1d3+2,7c#b#14#0#1d10+10,b0#b#f#0#1d5+10,f3#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (8296, 3, 'Baguette du Dragoeuf', 'Cette baguette semble plus efficace lorsqu\'elle est utilisée comme un gourdin ou comme une tapette à Moskitos.', 60, 124, '64#10#16#0#1d7+15,7d#65#96#0#1d50+100,b0#6#a#0#1d5+5,70#4#6#0#1d3+3,b2#4#6#0#1d3+3,7c#10#19#0#1d10+15,f3#6#a#0#1d5+5,77#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (8297, 4, 'Bâton du Dragoeuf', 'Ce bâton est muni à son extrémité, d\'une grosse pointe dont personne ne connaît l\'origine. En revanche, les aventuriers avertis connaissent sa destination...', 66, 124, '61#18#2b#0#1d20+23,76#1a#2d#0#1d20+25,7d#51#82#0#1d50+80,b0#b#14#0#1d10+10,7c#b#19#0#1d15+10,70#4#6#0#1d3+3,77#15#28#0#1d20+20,ae#c9#190#0#1d200+200,d5#6#a#0#1d5+5,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8298, 1, 'Epis de Shika', 'Shika assistait Farle lors des moissons, en récupérant les épis magiques qui tombaient sous sa faux. Elle prit l\'habitude au fil des moissons, de les accrocher autour de son cou. Privés de leurs racines et du reste de leur tige, ces épis magiques continuent tout de même de mûrir chaque année à la même période.', 113, 80, 'b0#6#7#0#1d2+5,b6#1#0#0#0d0+1,6f#1#0#0#0d0+1,70#2#3#0#1d2+1,73#1#2#0#1d2+0,7c#b#f#0#1d5+10,7d#1a#28#0#1d15+25,7b#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (8299, 9, 'Bracelet Magique de Shika', 'Ce bracelet couvrait les bras de Shika, la protégeant des coups de soleil, et des coups de bec des Corbacs attirés par sa beauté rayonnante. Ils sont encore imprégnés de sa sueur suave.', 118, 80, '7e#15#1e#0#1d10+20,7d#24#32#0#1d15+35,7c#10#14#0#1d5+15,7b#10#14#0#1d5+15,77#10#14#0#1d5+15,8a#b#f#0#1d5+10,d4#4#5#0#1d2+3,d2#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (8300, 4, 'Bâton de Shika', 'Ce bâton taillé sur mesure, permettait à Shika de créer les meules de foin les plus hautes de tout Amakna. La légende raconte que leur taille était si importante, que les marins s\'en servaient de points de repères pour savoir s\'ils approchaient ou non de la côte d\'Amakna.', 69, 80, '63#f#1a#0#1d12+14,5b#2#3#0#1d2+1,73#1#2#0#1d2+0,70#1#2#0#1d2+0,8a#4#5#0#1d2+3,ae#1f#28#0#1d10+30,7e#1a#23#0#1d10+25,7d#1a#23#0#1d10+25');
INSERT INTO `website_shop_objects_templates` VALUES (8301, 11, 'Sabots de Shika', 'Ces sabots ont été conçus pour permettre à Shika de ne jamais écraser les semis, lorsqu\'elle ensemençait les plaines de Snossios. Elle y fit rajouter des talons hauts, pour qu\'elle puisse courir librement le matin dans les éteules, sans remplir ses sabots de rosée, ou sans abîmer ses chevilles fragiles.', 91, 80, '7e#15#1e#0#1d10+20,7b#15#1e#0#1d10+20,7d#24#32#0#1d15+35,73#1#2#0#1d2+0,70#1#2#0#1d2+0,80#1#0#0#0d0+1,f2#3#4#0#1d2+2,f1#3#4#0#1d2+2,f3#3#4#0#1d2+2,d4#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (8302, 17, 'Cape de Shika', 'Des fleurs des moissons ont été cousues sur cette cape confectionnée à partir de céréales magiques tissées entre elles. Elle est animée d\'une magie si puissante, que Shika s\'en servait de protection contre la foudre, les soirs d\'orage.', 120, 80, 'd2#4#5#0#1d2+3,d5#4#5#0#1d2+3,f0#2#3#0#1d2+1,f4#2#3#0#1d2+1,f3#2#3#0#1d2+1,f1#2#3#0#1d2+1,f2#2#3#0#1d2+1,9e#c9#fa#0#1d50+200,b6#1#0#0#0d0+1,7b#1a#23#0#1d10+25,7c#10#14#0#1d5+15,7d#1a#23#0#1d10+25');
INSERT INTO `website_shop_objects_templates` VALUES (8303, 10, 'Shikature', 'Cette ceinture en cuir protégeait les cuisses de Shika, lorsqu\'elle traversait des champs de blé en courant pour rattraper les Bouftous égarés de son troupeau. Recouverte de pollen de céréales magiques, on raconte qu\'elle brillait au clair de lune, et permettait à Farle de ne pas sectionner les jambes de sa propre femme lorsqu\'il fauchait des champs entiers de céréales une fois la nuit tombée.', 107, 80, '7e#15#1e#0#1d10+20,7c#b#f#0#1d5+10,8a#4#5#0#1d2+3,b0#4#5#0#1d2+3,f2#2#3#0#1d2+1,f1#2#3#0#1d2+1,f3#2#3#0#1d2+1,d5#3#5#0#1d3+2,d2#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (8304, 16, 'Shikacoiffe', 'Recouverte d\'une multitude de fleurs des moissons, cette coiffe donnait une allure guillerette à Shika, lorsqu\'elle partait au petit matin, labourer les collines Koln.', 156, 80, '7d#1a#23#0#1d10+25,7c#15#1e#0#1d10+20,70#1#2#0#1d2+0,75#1#0#0#0d0+1,b0#8#a#0#1d3+7,d4#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (8305, 24, 'Relique du Mominotor', 'Cette étrange relique est indispensable pour pouvoir rencontrer le Minotoror.', 119, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8306, 24, 'Relique du Déminoboule', 'Cette étrange relique est indispensable pour pouvoir rencontrer le Minotoror.', 120, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8307, 84, 'Clef de la salle du Minotot', 'Cette clef construite à partir de diverses ressources, vous permettra de rencontrer l\'incroyable Minotot. Une rencontre qui vous marquera à vie, lorsque le Minotot vous aura envoyé quelques coups de sabots dans le derrière.', 15, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8308, 107, 'Carapace de Scaratos', 'Cette petite carapace luisante est très pratique pour créer de beaux bijoux à moindre frais, que vous revendrez une fortune, une fois que vous aurez persuadé un Astrubien, que c\'est une puissante relique qui permet de voler dans les airs en se rendant invisible.', 735, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8309, 53, 'Plume du Serpiplume', 'Cette plume est recouverte de poussière de pierre magique, ce qui explique qu\'une unité de plume de Serpiplume, pèse plus lourd que trois unités de plume de Tofu. Tout est une question de logique.', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8310, 110, 'Gelée de Dégelée', 'Ce pot de gelée contient une substance à l\'odeur repoussante et au goût épouvantable, et pourtant, vous rêvez tous les jours secrètement de vous enduire de cette substance. Un autre trouble de votre comportement, qui doit en cacher d\'autres...', 736, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8311, 54, 'Poil de Gamino', 'Ce poil semble recouvert d\'une sorte de gomina à base de musc de Bitouf à poils ras, et de graisse de Kirboule des cavernes. On aurait presque envie de les manger.', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8312, 59, 'Peau de Minoskito', 'Cette peau usée par le sable fin et le sel de mer est fine comme une vieille chaussette usée par le sable fin et le sel de mer. De là à dire que le Minoskito ressemble à une vieille chaussette, il n\'y a qu\'un pas, que vous ne franchirez pas.', 604, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8313, 47, 'Fémur du Minotoror', 'Cet os est assez solide pour servir de poutrelle, ou pour casser des briques par lots de dix. Très pratique pour détruire la maison de ses voisins, mais complètement inutile pour les personnes saines d\'esprit.', 644, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8314, 59, 'Peau de Kraméléhon', 'Cette peau brûlée protège efficacement les peaux sensibles, des rayons du soleil. A porter très près du corps.', 603, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8315, 59, 'Peau de Mandrine', 'Cette peau tachetée a la réputation d\'être recouverte d\'un poison capable de transformer n\'importe qui en Karaboule desséché. Inquiétant, mais tout de même tentant.', 602, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8316, 25, 'Le Tifoux : Bien l\'élever', 'Ce livre écrit par Oshimo Li\'kross Babine explique comment élever un Tifoux.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8317, 25, 'El Scarador : Bien l\'élever', 'Ce livre écrit par Oshimo Li\'kross Babine explique comment élever El Scarador.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8318, 25, 'Abra Kadabra : Bien l\'élever', 'Ce livre écrit par Oshimo Li\'kross Babine explique comment élever Abra Kadabra.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8319, 25, 'Bouloute : Bien l\'élever', 'Ce livre écrit par Oshimo Li\'kross Babine explique comment élever Bouloute.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8320, 84, 'Clef de l\'antre du Dragon Cochon', 'Après être entré et vous être perdu dans le labyrinthe du Dragon Cochon, vous vous êtes aperçu que vous aviez oublié de prendre vos clefs de l\'antre du Dragon Cochon. Heureusement, vos amis les Porcos avaient un double des clefs sur eux.', 16, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8321, 54, 'Poil de Déminoboule', 'Inutile d\'insister, ces poils ne sont pas comestibles.', 664, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8322, 54, 'Poil de Mominotor', 'Sous ses bandelettes, le Mominotor cache un duvet très doux qui rendrait jalouse la plus coquette des princesses.', 663, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8323, 56, 'Cuir de Déminoboule', 'Craquelé et rugueux, ce cuir vous rappellera les joues de votre dulcinée.', 657, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8324, 56, 'Cuir de Mominotor', 'Le Mominotor a toujours eu la peau très fragile, c\'est pour cela qu\'il doit se recouvrir de nombreuses bandelettes. Les mauvaises langues racontent que c\'est pour cacher d\'autres choses assez surprenantes...', 656, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8325, 16, 'Coiffe du Mominotor', 'Si vous voulez préserver votre visage des affres du temps, nous vous conseillons cette coiffe. Attention, elle est totalement inefficace pour vous protéger des pertes de mémoire.', 157, 110, '');
INSERT INTO `website_shop_objects_templates` VALUES (8326, 15, 'Bandelette du Mominotor', 'Enroulée autour des cornes, mais surtout des parties intimes du Mominotor, ces bandelettes se sont imprégnées pendant de longues années de toute la magie du Mominotor. A la fois malodorantes et terrifiantes, ces bandelettes ont leur place dans les collections de tous les archéologues de renom.', 734, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8327, 47, 'Corne de Déminoboule', 'Cette corne impressionnante n\'est à première vue d\'aucune utilité, et même en y regardant de plus près, elle se révèle bien peu utile.  Un peu comme une armée de tiques par exemple.', 643, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8328, 47, 'Corne de Mominotor', 'Enroulée dans des bandelettes magiques, cette corne doit de toute évidence valoir très cher, être très précieuse, sentir très mauvais, et être maudite. Un peu comme une momie.', 642, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8330, 16, 'Coiffe du Dragoeuf volant', 'Cette petite coiffe permet au Dragoeuf volant de se jeter sur ses ennemis sans risquer de se faire de jolies bosses sur le crâne. Utilisée depuis longtemps sur les grands chantiers d\'Amakna, cette coiffe a connu un regain de popularité après l\'invasion d\'Astrub par l\'illustre troupe des Meulous débridés de la montagne de Kruup. Il n\'y a aucune logique dans cette histoire, mais quelle importance ?', 152, 72, '7e#1f#2d#0#1d15+30,73#3#4#0#1d2+2,7d#1f#32#0#1d20+30,b6#1#2#0#1d2+0,d4#3#5#0#1d3+2,ae#97#c8#0#1d50+150');
INSERT INTO `website_shop_objects_templates` VALUES (8331, 16, 'Coiffe de la Dragueuse', 'Equipé de cette coiffe, vous pourrez sans peine vous travestir et séduire le premier Astrubien un peu trop crédule que vous voudrez arnaquer, en lui proposant une folle nuit d\'amour derrière un grand orme, pour 100 kamas seulement.', 153, 95, '76#1a#28#0#1d15+25,77#1a#28#0#1d15+25,7d#33#5a#0#1d40+50,b0#6#a#0#1d5+5,70#4#6#0#1d3+3,ae#97#fa#0#1d100+150,73#1#2#0#1d2+0,d5#6#8#0#1d3+5');
INSERT INTO `website_shop_objects_templates` VALUES (8333, 17, 'Cape du Papa Nowel', 'Cette mystérieuse cape fait son apparition lors des saisons froides, et permet aux imposteurs de se faire passer pour un vieillard généreux.', 119, 19, '');
INSERT INTO `website_shop_objects_templates` VALUES (8334, 16, 'Chapeau du Papa Nowel', 'Ce chapeau vous permettra de cacher les cicatrices que vous avez sur le crâne. Vous pourrez enfin plaire aux enfants.', 155, 22, '');
INSERT INTO `website_shop_objects_templates` VALUES (8335, 89, 'Tout petit cadeau de Nowel', 'L\'équipe d\'Ankama vous souhaite de joyeuses et agréables fêtes. Ce cadeau vous rendra heureux comme vous ne l\'avez jamais été.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8336, 89, 'Petit cadeau de Nowel', 'L\'équipe d\'Ankama vous souhaite de joyeuses et agréables fêtes. Ce cadeau vous rendra heureux comme vous ne l\'avez jamais été.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8337, 89, 'Cadeau de Nowel', 'L\'équipe d\'Ankama vous souhaite de joyeuses et agréables fêtes. Ce cadeau vous rendra heureux comme vous ne l\'avez jamais été.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8338, 6, 'Epée de Nowel', 'Cette étrange épée ne vous rendra pas invincible, mais vous pourrez peut-être vous en servir pour tuer des boules de neige.', 69, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8339, 89, 'Grand cadeau de Nowel', 'L\'équipe d\'Ankama vous souhaite de joyeuses et agréables fêtes. Ce cadeau vous rendra heureux comme vous ne l\'avez jamais été.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8340, 89, 'Incroyable cadeau de Nowel', 'L\'équipe d\'Ankama vous souhaite de joyeuses et agréables fêtes. Ce cadeau vous rendra heureux comme vous ne l\'avez jamais été.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8341, 11, 'Bottananas', 'Ces bottes sentent le jus d\'ananas macéré dans du substrat de chaussette trouée. L\'avantage, c\'est qu\'on ne vous demandera jamais de les enlever lorsque vous irez chez un ami.', 90, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8342, 84, 'Clef du Sanctuaire des Dragoeufs', 'Cette clef confectionnée à base de coquilles de Dragoeufs vous permettra d\'accéder au terrible Sanctuaire des Dragoeufs, réputé pour ses habitants peu loquaces.', 18, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8343, 84, 'Clef du Donjon des Dragoeufs', 'Vous pensiez être arrivé au bout de vos peines en rentrant dans le Sanctuaire des Dragoeufs, mais vous vous êtes lamentablement trompé. Cette clef vous mènera peut-être vers une mort certaine.', 17, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8344, 47, 'Corne de Dragoss Noir', 'Moins pointue qu\'une aiguille de Xélor, mais plus solide, cette corne permet aux Dragoss de transformer un botte-fesses, en perce-fesses.', 648, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8345, 47, 'Corne de Dragoss de Saphire', 'Moins pointue qu\'une aiguille de Xélor, mais plus solide, cette corne permet aux Dragoss de transformer un botte-fesses, en perce-fesses.', 647, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8346, 47, 'Corne de Dragoss Blanc', 'Moins pointue qu\'une aiguille de Xélor, mais plus solide, cette corne permet aux Dragoss de transformer un botte-fesses, en perce-fesses.', 646, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8347, 47, 'Corne de Dragoss Doré ', 'Moins pointue qu\'une aiguille de Xélor, mais plus solide, cette corne permet aux Dragoss de transformer un botte-fesses, en perce-fesses.', 645, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8348, 111, 'Coquille de Dragoss Noir', 'Cette coquille peut éventuellement servir à protéger ce que vous avez de plus précieux.', 738, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8349, 111, 'Coquille de Dragoss de Saphir', 'Cette coquille peut éventuellement servir à protéger ce que vous avez de plus précieux.', 739, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8350, 111, 'Coquille de Dragoss Blanc', 'Cette coquille peut éventuellement servir à protéger ce que vous avez de plus précieux.', 740, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8351, 111, 'Coquille de Dragoss Doré ', 'Cette coquille peut éventuellement servir à protéger ce que vous avez de plus précieux.', 741, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8352, 59, 'Ecaille de Dragoss Noir', 'Cette écaille de Dragoss pourrait servir à confectionner de belles bottines, ou des sous-vêtements de combat.', 606, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8353, 59, 'Ecaille de Dragoss de Saphire', 'Cette écaille de Dragoss pourrait servir à confectionner de belles bottines, ou des sous-vêtements de combat.', 608, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8354, 59, 'Ecaille de Dragoss Blanc', 'Cette écaille de Dragoss pourrait servir à confectionner de belles bottines, ou des sous-vêtements de combat.', 607, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8355, 59, 'Ecaille de Dragoss Doré ', 'Cette écaille de Dragoss pourrait servir à confectionner de belles bottines, ou des sous-vêtements de combat.', 605, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8356, 59, 'Peau de Dragueuse', 'Lisse et parfumée avec du sang de jeunes aventuriers, cette peau rend de toute évidence les Dragueuses irrésistibles. Utilisée pour des bottes, ou des ceintures, cette peau a l\'avantage d\'être lavable en machine, à n\'importe quelle température.', 609, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8357, 47, 'Corne de Dragueuse', 'La Dragueuse dispose de deux petites cornes à l\'arrière de son crâne, qui lui permettent de capter plus facilement les ondes amoureuses émises par les autres Dragoeufs pendant la saison des amours, qui rappelons-le, ne s\'arrête jamais chez les Dragoeufs.', 649, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8358, 111, 'Protection de la Dragueuse', 'Cette paire de coquilles de Dragoeuf permet à la Dragueuse de se protéger de ses propres coups de foudre. Cette protection est également utilisable par les mâles, si elle est portée sous la ceinture.', 742, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8359, 104, 'Aile de Dragoeuf Volant', 'Même abimée, déchirée et brûlée, cette aile permet au Dragoeuf Volant de se mouvoir librement au dessus du vide, comme un jeune Moskito insouciant.', 743, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8360, 59, 'Peau de Dragoeuf Volant', 'Cette peau sombre est recouverte d\'une multitude de petites écailles censées améliorer l\'aérodynamisme du Dragoeuf Volant. En réalité, elles servent juste à impressionner les badauds.', 610, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8361, 47, 'Corne de Dragoeuf Volant', 'Cette corne sert de viseur au Dragoeuf Volant afin de ne pas râter ses cibles, lorsqu\'il vole en état d\'ébriété.', 650, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8362, 59, 'Peau de Dragoeuf Guerrier', 'Assez solide pour résister aux coups de sa propre lame, la peau du Dragoeuf Guerrier est surtout réputée pour être comestible, une fois bouillie pendant plusieurs années.', 611, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8363, 47, 'Corne de Dragoeuf Guerrier', 'Le Dragoeuf Guerrier dispose de trois cornes différentes, deux derrières la tête, et une sur le bout du museau. Généralement, après une attaque, une corne se retrouve plantée dans le derrière de ses victimes, et les deux dernières enfoncées profondément dans les narines d\'un imprudent. Mais parfois le Dragoeuf Guerrier confond le derrière et les narines de ses victimes, ce qui pour le coup, leur cause beaucoup plus de tort.', 651, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8364, 15, 'Lanière en cuir du Dragoeuf Guerrier', 'Cette lanière en cuir permet au Dragoeuf Guerrier d\'accrocher son épaulette, ou de remplacer vos bretelles.', 744, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8365, 47, 'Corne brisée de Crocabulia', 'Crocabulia a cassé sa propre corne lors d\'un terrible combat dans lequel elle tentait de protéger l\'oeuf qui donna naissance 15 années plus tard, au Crocoburio.', 652, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8366, 17, 'Cape du Petit Chapon Rouge', 'Cette cape appartenait à un célèbre Chapon, ancien volatile aux longues plumes qui aimait se pavoiser devant le Zaap de Bonta devant sa basse-cour composée de volailles crédules et de poulardes immatures.', 121, 171, 'f3#6#a#0#1d5+5,d5#6#a#0#1d5+5,b0#b#f#0#1d5+10,8a#6#a#0#1d5+5,70#6#a#0#1d5+5,b2#6#a#0#1d5+5,7c#1f#32#0#1d20+30,7e#33#46#0#1d20+50');
INSERT INTO `website_shop_objects_templates` VALUES (8367, 59, 'Peau de Crocabulia', 'Cette peau rouge vous permettra peut-être de confectionner une cape du petit Chapon Rouge, si vous ne redoutez pas les railleries de vos alliés.', 612, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8368, 47, 'Dent de Crocabulia', 'Cette énorme dent a été arrachée in extremis avant que Crocabulia ne referme sa gueule pour toujours.', 653, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8369, 111, 'Fragment de Coquille de Terrakoubiak le Guerrier', 'Ce fragment de coquille appartenant à Terrakoubiak le Guerrier, devrait vous aider à fabriquer une clef pour le sanctuaire des Dragoeufs.', 750, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8370, 111, 'Fragment de Coquille d\'Ignelicrobur le Guerrier', 'Ce fragment de coquille appartenant à Ignelicrobur le Guerrier, devrait vous aider à fabriquer une clef pour le sanctuaire des Dragoeufs.', 749, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8371, 111, 'Fragment de Coquille d\'Aerohouctor le Guerrier', 'Ce fragment de coquille appartenant à Aerohouctor le Guerrier, devrait vous aider à fabriquer une clef pour le sanctuaire des Dragoeufs.', 748, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8372, 111, 'Fragment de Coquille d\'Aquabralak le Guerrier', 'Ce fragment de coquille appartenant à Aquabralak le Guerrier, devrait vous aider à fabriquer une clef pour le sanctuaire des Dragoeufs.', 747, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8373, 51, 'Pierre d\'Ignerkocropos l\'Affamé ', 'Cette pierre, si elle est combinée avec les trois autres manquantes, devrait libérer une onde magique assez puissante pour activer et ouvrir une porte magique.', 463, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8374, 51, 'Pierre d\'Aqualikros l\'Impitoyable', 'Cette pierre, si elle est combinée avec les trois autres manquantes, devrait libérer une onde magique assez puissante pour activer et ouvrir une porte magique.', 460, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8375, 51, 'Pierre de Terraburkal le Perfide', 'Cette pierre, si elle est combinée avec les trois autres manquantes, devrait libérer une onde magique assez puissante pour activer et ouvrir une porte magique.', 461, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8376, 51, 'Pierre d\'Aerotrugobur le Malveillant', 'Cette pierre, si elle est combinée avec les trois autres manquantes, devrait libérer une onde magique assez puissante pour activer et ouvrir une porte magique.', 462, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8377, 88, 'Rune de Bricoleur', 'Cette pierre magique permet aux Bricoleurs de donner leur position aux clients.', 12, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8378, 88, 'Fragment Magique', 'Ce fragment magique, contient une partie de la magie autrefois contenue dans un objet. Avec un peu de chance, vous devriez pouvoir récupérer quelques runes magiques.', 44, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8379, 78, 'Rune Vie', 'Cette petite rune a le pouvoir de rendre plus résistant.', 59, 20, '7d#3#0#0#0d0+3');
INSERT INTO `website_shop_objects_templates` VALUES (8380, 55, 'Etoffe de Péki', 'Cette étoffe recouvrait les fesses poilues du Péki avant que vous ne décidiez de le caresser à rebrousse-poils.', 721, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8381, 65, 'Queue Magique du Péki', 'Cette queue est si magique, qu\'elle frétille encore, même après avoir été coupée, séchée, et empaillée. En cherchant bien, vous pourrez lui trouver une utilité autre que décorative.', 751, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8383, 59, 'Peau de Moon', 'Privé de sa petite peau douce, le pauvre petit Moon s\'est retrouvé bien au dépourvu et à préféré fuir lâchement dans la jungle en hurlant de douleur. Une scène réjouissante que vous ne manquerez pas de raconter à vos enfants le soir, pour les aider à trouver le sommeil.', 613, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8384, 55, 'Etoffe Magique de Moon', 'Cette étoffe ressemble à une étoffe magique, et vous avez du mal à l\'accepter. Pourtant il faudra bien que vous reconnaissiez un jour ou l\'autre, que vous êtes trop stupide pour déterminer vous-même ce qui est magique ou non. Ne suivez pas votre instinct de pourfendeur d\'Astrubiens, faites confiance aux descriptions.', 722, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8385, 59, 'Peau de Shin Larve', 'Cette peau de Shin Larve est encore plus gluante et collante que vous ne l\'imaginiez. Elle vous rappelle la dernière princesse que vous avez délivrée.', 614, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8386, 47, 'Dent de Shin Larve', 'Personne n\'aurait pu croire qu\'une Shin Larve avait la bouche remplie de dents. C\'est peut-être parce que la Shin Larve ne dispose que d\'une seule dent.', 654, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8387, 53, 'Plume Vibrante du Tofu Royal', 'Plus royale que la plume du Tofu Royal, plus vibrante que la plume d\'un Kirboule Vibreur des mines de Kruup, cette plume saura chatouiller qui vous voudrez, et où vous voudrez. Il est expliqué sur la notice, que son entretien est relativement simple.', 645, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8388, 59, 'Peau de Bworkette', 'La Bworkette vous a laissé lui arracher un morceau de peau en échange de votre clémence. Mais elle a oublié de vous dire qu\'elle a prévenu son grand frère le Bworker, qui se fera un plaisir de vous arracher la votre.', 615, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8389, 54, 'Poil de Bworkette', 'La Bworkette a la peau lisse, sauf sous les aisselles. Il faut bien que les gâteaux qu\'elle roule sous ses aisselles soient assaisonnés de temps en temps.', 665, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8390, 59, 'Peau de Cochon de Farle', 'Farle était le plus grand éleveur de cochons et peut-être même de cochonnes, d\'après les éleveurs qui jalousaient Shika. Ce qui est certain, c\'est qu\'il est à l\'origine des Cochons de Farle, à qui il a donné son nom, car ils les avaient créés à son image.', 616, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (8391, 59, 'Peau de Don Dorgan', 'Le Don Dorgan a été une fois de plus très généreux avec vous, malgré son terrible caractère. Il vous a fait don de sa peau avant de partir en grognant comme un gros Porkass. Quel culot !', 617, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (8392, 59, 'Peau de Don Duss Ang', 'Le Don Duss Ang que vous avez dû peler avec une râpe à fromage pour obtenir cette peau très fine, s\'en souviendra toute sa vie. On peut supposer qu\'il vous en voudra longtemps. Ne comptez plus sur lui pour vous indiquer le bon chemin la prochaine fois que vous vous égarerez dans son labyrinthe.', 618, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (8393, 54, 'Poil de Dragon Cochon', 'Vous avez beau chercher, vous n\'arrivez pas à trouver la partie du corps du Dragon Cochon sur laquelle ce poil était planté. Cherchez-mieux, l\'anatomie du Dragon Cochon semble révéler de nombreuses surprises...', 666, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8394, 51, 'Méga Pierre du Craqueleur Légendaire', 'Cette énorme pierre ressemble à une pierre du Craqueleur Légendaire, et pourtant il n\'en n\'est rien, c\'est bien plus encore.', 464, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8396, 15, 'Mojo du Mulou ', 'Cette petite fiole contient toute la puissance virile du Mulou. Attention, son contenu n\'est pas comestible.', 752, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8397, 54, 'Poil du Wa Wabbit', 'Le Wa Wabbit est en règle générale assez avare et rechigne à partager ses poils. Exceptionnellement, pour récompenser votre bravoure (ou acheter votre clémence), il a décidé de vous faire don d\'une partie de son corps. Touchant.', 667, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8398, 55, 'Etoffe du Wa Wabbit', 'Personne ne sait réellement d\'où le Wa Wabbit a sorti cette étoffe, et il semblerait que personne ne cherche à savoir également. A la fois inquiétante et troublante, l\'origine de cette étoffe reste un des plus grands mystères de tout Amakna.', 723, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8399, 54, 'Poil de Maître Pandore', 'Une fois de plus le Maître Pandore a voulu faire le malin, et s\'est pris une bonne leçon qu\'il n\'oubliera pas de si tôt. Il aurait mieux fait de rester au fond de sa boîte.', 668, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8400, 55, 'Etoffe de Maître Pandore', 'Protégeant tantôt sa nuque, tantôt son arrière train, cette étoffe a sauvé la vie du Maître Pandore plus d\'une fois. Mais pas cette fois-ci.', 724, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8401, 59, 'Peau de Maître Pandore', 'Usée par les attaques magiques, desséchée par le vent de l\'île de Pandala, cette peau est désormais d\'une piètre qualité, et pourtant vous semblez vous y attacher, comme si vous cherchiez à garder un précieux souvenir de ce brave Maître Pandore, qui a tout de même failli vous ôter la vie plusieurs fois sans aucun remord. C\'est dans ce genre de situations que l\'on reconnaît un véritable monstre d\'une petite nature.', 619, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8402, 51, 'Pierre du Koulosse', 'Le Koulosse a beau être généreux, il ne vous a pas donné sa grosse pierre de gaieté de cœur, et on peut le comprendre lorsque l\'on sait ce que vous allez en faire.', 465, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8403, 15, 'Tresse du Koulosse', 'Cette énorme tresse a été confectionnée par le Koulosse en personne il y a plusieurs centaines d\'années. Elle est devenue avec le temps, presque aussi rigide qu\'un bloc de pierre. Elle est cependant encore gorgée d\'un liquide gluant et nauséabond qui attire de temps en temps les Moskitos. Le plus surprenant dans tout cela c\'est que cette tresse allait très bien au Koulosse. Comme un gros Ploukosse, vous avez eu l\'idée saugrenue de la lui voler.', 753, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8404, 59, 'Peau de Skeunk', 'Ce morceau de peau semble provenir des talons de Skeunk, ce qui explique sa couleur jaunâtre du plus bel effet. A défaut de vous confectionner des vêtements à la mode avec cette vieille peau, vous pourrez vous confectionner des vêtements d\'une autre époque, et adopter une apparence \"rétro\" qui fera fureur auprès des plus jeunes.', 620, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8405, 54, 'Poil de Skeunk ', 'Qui à part vous, aurait pu croire que Skeunk ne s\'épilait pas entièrement le corps depuis sa tendre enfance ?', 669, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8406, 57, 'Laine du Minotot', 'Cette laine a la particularité d\'être très fine, et permet au Minotot de ne pas avoir de bouclettes le long du corps. Personne ne sait à quoi cela lui sert, vous devriez peut-être essayer de vous confectionner des implants pilaires avec cette laine, vous pourrez ainsi arborer une imposante toison de poils bruns sur votre torse. Même les rêves d\'enfance peuvent se réaliser.', 656, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8407, 56, 'Cuir du Minotot', 'A peine plus rare que le cuir de Bouftou, ce cuir est idéal pour les créations qui nécessitent des coutures souples, comme les masques en cuir par exemple.', 658, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8408, 47, 'Sabot du Minotot', 'Ce sabot a foulé énormément d\'aventuriers, mais aussi de grosses bouses égarées dans le labyrinthe du Minotoror. A la décharge du Minotot, il faut reconnaître qu\'il n\'est parfois pas évident de faire la différence au premier coup d\'oeil.', 754, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8409, 47, 'Corne du Minotot', 'Cette corne ressemble de loin à une corne de Bouftou géante et extrêmement magique. Fait surprenant, de près, elle ressemble à une corne de Minotot.', 655, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8410, 47, 'Fémur du Minotot', 'Cet os imposant a réussi à supporter pendant plusieurs siècles, la surcharge pondérale du Minotot. Un exploit qui méritait d\'être signalé.', 656, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8411, 1, 'Amulette du Mominotor', 'Cette amulette maudite recouverte de bandelettes vous permettra peut-être de survivre à la malédiction du labyrinthe du Minotoror. Mais rien n\'est moins sûr, peut-être n\'est-ce qu\'un bibelot destiné à épater les touristes.', 114, 111, '');
INSERT INTO `website_shop_objects_templates` VALUES (8412, 9, 'Anneau du Mominotor', 'Cet anneau confectionné à partir de bandelettes de Mominotor enroulées sur elles-mêmes, sent plutôt mauvais,  et est assez laid, mais fera un très bon pansement lorsque vous vous coincerez un doigt dans une des portes du labyrinthe du Minotoror.', 119, 111, '');
INSERT INTO `website_shop_objects_templates` VALUES (8413, 7, 'Marteau du Mominotor', 'Le bloc de pierre à l\'extrémité de ce marteau, est enroulé dans des bandelettes du Mominotor afin d\'absorber les fluides qui s\'échapperont des créatures que vous écraserez, ou tout simplement leur faire moins mal, et ne pas les tuer trop rapidement.', 60, 112, '9b#2710#0#0#0d0+10000');
INSERT INTO `website_shop_objects_templates` VALUES (8414, 5, 'Dagues du Dragoeuf', 'Ces dagues sont idéales pour découper le haut d\'un oeuf de Dragoeuf cuit à la coque. Elles sont aussi très légères, ce qui permet de courir vite lorsque le reste de la communauté des Dragoeufs s\'en aperçoit.', 58, 128, '61#5#a#0#1d6+4,63#5#a#0#1d6+4,6f#1#0#0#0d0+1,76#1a#28#0#1d15+25,7e#1a#28#0#1d15+25,77#1a#28#0#1d15+25,b2#4#6#0#1d3+3,79#4#6#0#1d3+3,7d#65#96#0#1d50+100,f1#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8415, 11, 'Bottes du Mominotor', 'Rembourrées et décorées avec des bandelettes de Mominotor, ces bottes sont à la fois très confortables et très chaudes. Elles vous rappellent peut-être quelqu\'un.', 92, 110, '');
INSERT INTO `website_shop_objects_templates` VALUES (8416, 17, 'Cape du Mominotor', 'Confectionnée à partir de bandelettes du Mominotor tressées entre elles, cette cape vous donnera un style tout droit sorti d\'outre-tombe. Vos ennemis risquent de crever de jalousie.', 122, 111, '');
INSERT INTO `website_shop_objects_templates` VALUES (8417, 8, 'Pelle à Gâteau', 'Cette petite pelle a été offerte a un jeune Enutrof, il y est resté si attaché qu\'il l\'utilisait encore juste avant sa mort.', 43, 131, '64#6#e#0#1d9+5,60#6#8#0#1d3+5,7b#15#28#0#1d20+20,7d#65#96#0#1d50+100,b0#b#f#0#1d5+10,8a#6#a#0#1d5+5,76#15#28#0#1d20+20,f1#5#7#0#1d3+4,f0#5#7#0#1d3+4,da#5#7#0#1d3+4,db#5#7#0#1d3+4,70#4#5#0#1d2+3,f2#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8418, 10, 'Ceinture du Mominotor', 'Cette grosse bandelette de Mominotor possède une valeur ajoutée extraordinaire, dont l\'origine reste cependant méconnue. Mais qu\'importe, elle se vendra cher, et sa malédiction accélèrera la putréfaction des hanches des amis à qui vous offrirez cette ceinture, ce qui est il faut bien l\'avouer, tout simplement inestimable.', 108, 112, '');
INSERT INTO `website_shop_objects_templates` VALUES (8419, 8, 'Pelle Moh', 'Avec cette pelle, Le capitaine Machab a éventré Grobill Dick, le grand Kralamoure Blanc.', 42, 115, '5b#9#f#0#1d7+8,b0#b#f#0#1d5+10,7b#1a#28#0#1d15+25,7d#97#c8#0#1d50+150,7c#10#1e#0#1d15+15,ae#65#96#0#1d50+100');
INSERT INTO `website_shop_objects_templates` VALUES (8420, 8, 'Pelle Dragoeuf', 'Les Dragoeufs aiment creuser des galeries, mais ne se servent pas de pelles, la communauté Enutrof a longtemps étudié l\'énigme de celle-ci, et a fini par conclure qu\'il était moins important de savoir d\'où elle venait que de taper avec.', 45, 127, '64#12#21#0#1d16+17,5f#4#6#0#1d3+3,7b#1a#28#0#1d15+25,7d#65#96#0#1d50+100,b0#b#f#0#1d5+10,7c#10#19#0#1d10+15,70#5#8#0#1d4+4');
INSERT INTO `website_shop_objects_templates` VALUES (8421, 77, 'Certificat de Mise en Chanil : Vilain Petit Corbac', 'Ce certificat décrit les caractéristiques du Vilain Petit Corbac que vous avez placé au chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8424, 89, 'Cadeau de compensation de l\'éleveur', 'Ce cadeau destiné aux éleveurs, contient de quoi remplir un enclos avec d\'excellentes machines d\'élevage. \\n(Attention, les objets contenus dans ce cadeau sont très lourds, vous risquez d\'être en surcharge lorsque vous l\'ouvrirez).', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8425, 100, 'Bourse de 10000 Kamas', 'Cette bourse est très lourde, elle contient sûrement une vraie fortune. Un marchand sera ravi de vous l\'échanger contre sa valeur en Kamas.', 56, 1, 'c2#2710#0#0#0d0+10000');
INSERT INTO `website_shop_objects_templates` VALUES (8428, 12, 'Potion d\'invisibilité Nébuleuse', 'Cette potion permet de s\'évaporer pour revenir au dernier point de sauvegarde sans laisser de trace.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8430, 94, 'Ballon Jaune Magique', 'Contrairement aux contrefaçons que l\'on trouve à la foire du Trool, ce ballon-ci sait au moins s\'envoler avec grâce et aisance. Confectionné à la main comme autrefois, en véritable plume de Tofu selon la traditionnelle recette du grand mage Vahy Nez.', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8431, 12, 'Potion fumigène Cyclonique', 'Cette potion fumigène crée un tourbillonnant écran de fumée qui camoufle vos actions avec style.', 29, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8435, 94, 'Ballon Rouge Magique', 'Contrairement aux contrefaçons que l\'on trouve à la foire du Trool, ce ballon-ci sait au moins s\'envoler avec grâce et aisance. Confectionné à la main comme autrefois, en véritable paupière de Gelée Fraise selon la traditionnelle recette du grand mage Vahy Nez.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8436, 84, 'Clef du Donjon du Chêne Mou', 'Cette clef vous permettra d\'accéder aux parties les plus intimes de l\'anatomie du Chêne Mou, sans pour autant comprendre où vous allez. A la fois perturbant et excitant, ce voyage vers l\'infini et l\'au-delà ne vous laissera pas indifférent.', 236, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8437, 84, 'Clef du Donjon Ensablé ', 'Cette clef confectionnée à partir de détritus marins et de coquillages vous permettra d\'accéder à la plage qui dispose du sable le plus fin de toute la côte de la Mer d\'Asse.', 237, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8438, 84, 'Clef du Donjon des Rats de Brâkmar', 'Cette clef vous permettra d\'accéder au donjon des Rats situé dans les égouts de Brâkmar. Inutile de vous déguiser, vous passerez inaperçu, même si vous n\'êtes pas Brâkmarien.', 238, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8439, 84, 'Clef du Donjon des Rats de Bonta', 'Cette clef vous permettra d\'accéder au donjon des Rats situé dans les égouts de Bonta. Inutile de vous déguiser, vous passerez inaperçu, même si vous n\'êtes pas Bontarien.', 239, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8441, 16, 'Billréole', 'Bill voulait une auréole. Il cria si fort et fit si grand caprice qu\'on la lui accorda. Un vrai petit diable.', 159, 100, '7d#33#64#0#1d50+50,ae#1#7d0#0#1d2000+0,b2#6#a#0#1d5+5,75#1#2#0#1d2+0,b6#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (8442, 16, 'Masque du Rat Noir', 'Ce masque a servi à Brouce Boulgoure lorsqu\'il infiltra subtilement un repaire de rats d\'Egoûtants afin de couper un orme en commençant par les racines. Il finit tout de même par massacrer tous les rats du repaire, parce qu\'il n\'était en réalité pas très discret, avec ses gros sabots en bois.', 158, 102, '77#1a#28#0#1d15+25,7c#10#19#0#1d10+15,7d#33#50#0#1d30+50,73#3#4#0#1d2+2,e1#6#a#0#1d5+5,8a#6#a#0#1d5+5,e2#10#19#0#1d10+15,f2#4#6#0#1d3+3,f0#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8443, 17, 'Cape du Rat Noir', 'Cette cape peut être confectionnée avec n\'importe quels poils, à condition qu\'ils soient les plus sales possibles. Ils sont tressés entre eux puis fixés à l\'aide de sécrétions diverses. L\'odeur n\'est pas en option.', 123, 105, '77#1f#28#0#1d10+30,7c#b#14#0#1d10+10,70#4#5#0#1d2+3,7d#29#46#0#1d30+40,e1#6#8#0#1d3+5,e2#b#14#0#1d10+10,d6#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8444, 5, 'Dagues du Rat Noir', 'A la fois tranchantes et abîmées, les lames de ces dagues permettent de trancher les membres de vos adversaires avec une facilité déconcertante, tout en s\'assurant que vous leur retirerez une quantité impressionnante de lambeaux de chair. Dommage qu\'elles ne soient pas rouillées, chauffées à blanc et empoisonnées lorsque vous les utilisez.', 59, 108, '62#11#14#0#1d4+16,82#15#1e#0#1d10+20,77#1a#28#0#1d15+25,70#3#5#0#1d3+2,e1#6#a#0#1d5+5,7d#29#3c#0#1d20+40,73#2#3#0#1d2+1,e2#15#1e#0#1d10+20,ae#64#0#0#0d0+100');
INSERT INTO `website_shop_objects_templates` VALUES (8445, 1, 'Collier du Rat Noir', 'Le rat qui possédait ce collier pensait devenir le chef de son clan. Il s\'est fait manger par un Lenald enragé.', 115, 103, '77#1a#28#0#1d15+25,6f#1#0#0#0d0+1,7d#29#46#0#1d30+40,7c#10#19#0#1d10+15,e1#6#a#0#1d5+5,e2#10#19#0#1d10+15,f3#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8446, 11, 'Bottes du Rat Noir', 'Attention en enfilant ces bottes, il n\'est pas rare qu\'elles contiennent encore un ou deux pieds du propriétaire précédent.', 93, 101, '77#15#23#0#1d15+20,7d#29#3c#0#1d20+40,7c#15#1e#0#1d10+20,e1#6#a#0#1d5+5,e2#10#19#0#1d10+15,d5#3#4#0#1d2+2,80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8447, 10, 'Ceinture du Rat Noir', 'Contrairement à son cousin blanc bontarien, le Rat Noir aime faire dans la discrétion, et porte donc une simple ceinture d\'étoffe. Mais il aime aussi emporter un maximum d\'armes avec lui, qui font un bruit d\'enfer en s\'entrechoquant à chaque pas.', 109, 101, '77#1f#2d#0#1d15+30,7d#29#3c#0#1d20+40,7c#b#f#0#1d5+10,73#3#4#0#1d2+2,75#1#0#0#0d0+1,e1#6#a#0#1d5+5,e2#10#19#0#1d10+15,ae#65#c8#0#1d100+100,d6#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8448, 9, 'Anneau du Rat Noir', 'Tournez cet anneau vers la droite si vous devez serrer la main d\'un ennemi, et vers la gauche si vous devez serrer celle d\'un ami. Dans tous les cas, on vous déconseille d\'applaudir avec cet anneau.', 120, 98, '77#15#1e#0#1d10+20,7c#b#14#0#1d10+10,7d#1f#32#0#1d20+30,70#4#5#0#1d2+3,8a#4#5#0#1d2+3,e1#5#8#0#1d4+4,e2#b#14#0#1d10+10,ae#65#96#0#1d50+100,b0#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (8449, 27, 'Transformation du Donjon Abraknyde', 'Un Abraknyde vous a mordu et vous a transmis une étrange malédiction.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8450, 6, 'Epée du Rat Blanc', 'Cette Arme est le symbole du Rat Blanc. Elle est réputée pour être capable de trancher ennemis et alliés avec la même facilité.', 71, 109, '62#17#26#0#1d16+22,5f#3#5#0#1d3+2,77#1a#23#0#1d10+25,76#b#14#0#1d10+10,7d#1f#32#0#1d20+30,73#3#4#0#1d2+2,70#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (8451, 16, 'Coiffe du Rat Blanc', 'Avec cette coiffe, le Rat Blanc ressemble à un vrai Rat Blanc de Bonta. Sans cette coiffe, il ressemble à un vrai Rat Blanc de Bonta sans coiffe.', 160, 105, '77#1a#23#0#1d10+25,76#10#19#0#1d10+15,7d#33#64#0#1d50+50,7c#b#14#0#1d10+10,73#2#3#0#1d2+1,70#4#6#0#1d3+3,8a#6#a#0#1d5+5,ae#65#c8#0#1d100+100,f3#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8452, 17, 'Cape du Rat Blanc', 'Cette cape est le symbole identifiant un rat blanc du réseau d\'égoûts de Bonta, elle lui est remise après un examen long et difficile, et il la porte fièrement jusqu\'à sa mort, c\'est à dire jamais longtemps.', 124, 102, '77#1a#28#0#1d15+25,76#15#1e#0#1d10+20,7d#29#46#0#1d30+40,7c#b#14#0#1d10+10,f2#4#6#0#1d3+3,f4#4#6#0#1d3+3,d5#4#6#0#1d3+3,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8453, 1, 'Collier du Rat Blanc', 'Si vous le portez comme un collier, il vous protègera des émanations toxiques provenant des égoûts. En revanche, si vous le portez comme une ceinture, ce sont vos alliés qui seront protégés de vos émanations toxiques.', 116, 103, '77#1a#23#0#1d10+25,76#10#19#0#1d10+15,7d#1f#32#0#1d20+30,7c#b#14#0#1d10+10,70#4#6#0#1d3+3,6f#1#0#0#0d0+1,ae#c8#0#0#0d0+200');
INSERT INTO `website_shop_objects_templates` VALUES (8454, 9, 'Gantelet du Rat Blanc', 'Ce gantelet appartenait à Marie Thé, cuisinière du palais de Bonta. Elle s\'en servait pour assommer les Bouftous qui refusaient de se faire égorger, les plantes sauvages qui ne voulaient pas aller dans le saladier, et les clients qui ne voulaient pas les manger.', 121, 101, '77#15#1e#0#1d10+20,76#b#14#0#1d10+10,7d#1f#28#0#1d10+30,7c#b#14#0#1d10+10,70#3#4#0#1d2+2,f2#4#6#0#1d3+3,f1#4#6#0#1d3+3,f3#4#6#0#1d3+3,f4#4#6#0#1d3+3,f0#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8455, 10, 'Ceinture du Rat Blanc', 'Contrairement à ce que pense son cousin noir brâkmarien, le rat blanc aime également faire dans la discrétion. Les raccords métalliques de cette ceinture sont doublés de goudron et ne font aucun bruit, sauf quand son porteur tombe lamentablement, c\'est à dire souvent puisqu\'elle pèse plusieurs tonnes.', 110, 102, '77#1a#28#0#1d15+25,76#10#19#0#1d10+15,7d#33#50#0#1d30+50,70#3#4#0#1d2+2,73#3#4#0#1d2+2,b0#6#a#0#1d5+5,d2#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8456, 11, 'Bottes du Rat Blanc', 'Avec ces bottes, votre équilibre est parfait, même par grand vent vous ne bougerez plus d\'un pouce.', 94, 99, '77#1a#28#0#1d15+25,76#10#19#0#1d10+15,7d#29#3c#0#1d20+40,7c#b#f#0#1d5+10,80#1#0#0#0d0+1,b0#6#a#0#1d5+5,d4#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (8457, 16, 'Coiffe Cérémoniale du Seigneur des Rats', 'Cette coiffe n\'a rien à voir avec un Dora... Absolument rien on vous dit ! Il est donc inutile de répandre de fausses rumeurs à propos du manque d\'inspiration ou de la fainéantise de son concepteur . En revanche elle est très jolie.', 173, 133, '77#1f#32#0#1d20+30,7e#15#1e#0#1d10+20,7c#b#14#0#1d10+10,7d#97#c8#0#1d50+150,b0#6#a#0#1d5+5,70#4#6#0#1d3+3,8a#b#f#0#1d5+10,b2#5#7#0#1d3+4,f0#4#6#0#1d3+3,f1#4#6#0#1d3+3,d2#5#7#0#1d3+4,d3#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8458, 17, 'Cape Cérémoniale du Seigneur des Rats', 'Cette cape colorée fait de vous une cible privilégiée. Seuls les aventuriers vifs et agiles ont su la porter longtemps.', 125, 130, '77#1f#2d#0#1d15+30,7e#10#1e#0#1d15+15,7d#65#96#0#1d50+100,7c#b#14#0#1d10+10,b0#b#f#0#1d5+10,75#1#0#0#0d0+1,70#4#6#0#1d3+3,f2#4#6#0#1d3+3,f3#4#6#0#1d3+3,d4#5#7#0#1d3+4,d5#5#7#0#1d3+4,b2#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8459, 1, 'Collier Cérémonial du Seigneur des Rats', 'Afin d\'éviter qu\'on le lui vole, ce collier est glissé autour du cou de l\'héritier du Seigneur des rats à sa naissance. Ainsi, à l\'âge adulte, le seul moyen de le lui enlever est de lui couper la tête. On le lui vole tout de même.', 117, 134, '6f#1#0#0#0d0+1,77#1a#28#0#1d15+25,7e#10#1e#0#1d15+15,7d#65#96#0#1d50+100,7c#10#19#0#1d10+15,70#6#a#0#1d5+5,ae#c9#190#0#1d200+200,b0#b#f#0#1d5+10,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8460, 9, 'Anneau Cérémonial du Seigneur des Rats', 'Cet anneau a été conçu à une époque où le seigneur des rats s\'était mutilé et n\'avait plus qu\'un doigt. Les malheureux seigneurs suivants avaient encore tous les leurs.', 122, 131, '77#1a#28#0#1d15+25,7d#65#82#0#1d30+100,b0#b#f#0#1d5+10,70#4#6#0#1d3+3,8a#6#a#0#1d5+5,73#3#4#0#1d2+2,f0#5#7#0#1d3+4,f3#5#7#0#1d3+4,d4#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8461, 10, 'Ceinture Cérémoniale du Seigneur des Rats', 'Les motifs sur cette ceinture donnent l\'impression que vous avez le feu au fondement. Le trompe l\'oeil est si bon que la plupart des porteurs y croient eux-mêmes et courent partout en hurlant. Ce qui correspond exactement au rituel de la cérémonie.', 111, 133, '77#1f#32#0#1d20+30,7e#10#1e#0#1d15+15,7d#97#c8#0#1d50+150,7c#10#19#0#1d10+15,70#6#a#0#1d5+5,8a#6#a#0#1d5+5,b0#b#f#0#1d5+10,9e#1f4#0#0#0d0+500,b6#1#0#0#0d0+1,f1#6#a#0#1d5+5,f4#6#a#0#1d5+5,d3#5#8#0#1d4+4');
INSERT INTO `website_shop_objects_templates` VALUES (8462, 11, 'Bottes Cérémoniales du Seigneur des Rats', 'Le tout premier Seigneur des rats est mort en marchant par inadvertance dans une flaque de lave en fusion. Ces bottes sont portées en hommage par ses seigneurs. Attention, elles ne sont pas ignifugées.', 95, 134, '77#1a#28#0#1d15+25,7e#15#23#0#1d15+20,7d#79#aa#0#1d50+120,b0#6#a#0#1d5+5,80#1#0#0#0d0+1,7c#10#19#0#1d10+15,70#5#7#0#1d3+4,b2#5#7#0#1d3+4,f4#4#6#0#1d3+3,d6#4#6#0#1d3+3,d2#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8463, 16, 'Abracaska Ancestral', 'Cette Coiffe fut créée pour Jicé Aouaire car il a la tête plate, aucun soucis d\'équilibre pour l\'arborer donc. \\nIl l\'a faite faire après avoir vaincu l\'Abraknyde Ancestral en brisant ses noisettes entre ses fesses, mais il s\'en vante moins.', 174, 114, '7b#1f#32#0#1d20+30,76#1a#28#0#1d15+25,7c#1a#28#0#1d15+25,7d#97#c8#0#1d50+150,79#5#7#0#1d3+4,8a#6#a#0#1d5+5,b0#6#a#0#1d5+5,d5#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8464, 17, 'Abracapa Ancestrale', 'En été, l\'Abraknyde Ancestral aime se dorer au soleil, mais son bois habitué aux forêts sombres le supporte mal. Cette cape est confectionnée avec les pelures de son écorce.', 126, 114, '76#15#1e#0#1d10+20,7b#1a#2d#0#1d20+25,7d#33#64#0#1d50+50,7c#10#19#0#1d10+15,70#4#5#0#1d2+3,8a#6#a#0#1d5+5,ae#65#c8#0#1d100+100,b0#6#a#0#1d5+5,d4#6#a#0#1d5+5,d3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8465, 1, 'Torque Ancestral', 'Autour du cou, ce torque met en valeur votre barbe. Si vous n\'avez pas de barbe, vous ne pouvez vous en prendre qu\'à vous-même.', 118, 110, '7b#1a#28#0#1d15+25,76#15#1e#0#1d10+20,7d#33#64#0#1d50+50,7c#b#14#0#1d10+10,6f#1#0#0#0d0+1,b0#6#a#0#1d5+5,70#4#6#0#1d3+3,f3#5#7#0#1d3+4,d5#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8466, 9, 'Anneau Ancestral', 'Les soirs où vous aurez trop bu, vous verrez peut-être le Moskito pris dans cet anneau vous faire un clin d\'oeil. Mais évitez d\'en parler à vos amis, il fait seulement semblant.', 123, 113, '7b#1a#28#0#1d15+25,76#15#1e#0#1d10+20,7d#51#82#0#1d50+80,7c#1a#23#0#1d10+25,b0#6#a#0#1d5+5,d3#4#6#0#1d3+3,d2#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8467, 11, 'Protège-Tibias Ancestraux', 'Avec ces protège-tibias en bois massif, vos jambes ne craignent plus rien. Ils sont en revanche incompatibles avec le port de bottes . Vous pourrez les utiliser  pour vous protéger lors des compétitions de Boufball, mais vous ne pourrez plus faire de pointu avec vos bottes coquées.', 96, 110, 'f3#5#7#0#1d3+4,b0#b#f#0#1d5+10,80#1#0#0#0d0+1,70#4#6#0#1d3+3,7c#1a#23#0#1d10+25,7d#51#82#0#1d50+80,76#15#28#0#1d20+20,7b#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (8468, 10, 'Abrature Ancestrale', 'Cette ceinture est censée vous donner la virilité ancestrale. Que ce soit vrai ou pas, l\'effet est périmé.', 112, 111, '7b#1f#2d#0#1d15+30,76#15#23#0#1d15+20,7d#65#96#0#1d50+100,7c#b#14#0#1d10+10,b0#b#f#0#1d5+10,70#4#6#0#1d3+3,73#3#4#0#1d2+2,f0#4#6#0#1d3+3,f2#4#6#0#1d3+3,f1#4#6#0#1d3+3,f3#4#6#0#1d3+3,f4#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8469, 1, 'Talisman du Chêne Mou', 'Cette pièce de bois prélevée au coeur du Chêne mou renferme un grand pouvoir, comme celui de mettre le Chêne Mou en colère.', 119, 138, '76#1a#28#0#1d15+25,7e#1a#28#0#1d15+25,7c#10#19#0#1d10+15,7d#97#c8#0#1d50+150,b0#b#f#0#1d5+10,6f#1#0#0#0d0+1,70#6#a#0#1d5+5,b2#6#8#0#1d3+5,ae#c9#12c#0#1d100+200');
INSERT INTO `website_shop_objects_templates` VALUES (8470, 9, 'Anneau du Chêne Mou', 'Cet anneau est un excrément du Chêne Mou, en bois, mais l\'odeur est la même.', 124, 139, '76#15#1e#0#1d10+20,7e#15#1e#0#1d10+20,7c#10#19#0#1d10+15,7d#65#96#0#1d50+100,73#1#2#0#1d2+0,b0#6#a#0#1d5+5,70#4#6#0#1d3+3,d5#4#6#0#1d3+3,d2#4#6#0#1d3+3,d6#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8471, 11, 'Tongues du dimanche du Chêne Mou', 'Le dimanche, le Chêne Mou fait la sieste, et lorsqu\'il se réveille, il aime qu\'un Tronknyde obéissant lui apporte ses tongues sans qu\'il les demande. Il n\'a malheureusement pas de pieds, elles sont donc encore neuves.', 97, 136, '7e#1f#28#0#1d10+30,76#1f#28#0#1d10+30,7c#15#1e#0#1d10+20,7d#97#c8#0#1d50+150,70#6#a#0#1d5+5,8a#6#a#0#1d5+5,80#1#0#0#0d0+1,b0#6#a#0#1d5+5,f4#6#a#0#1d5+5,d5#4#6#0#1d3+3,d2#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8472, 17, 'Cape Usée du Chêne Mou', 'Il y a plus de 200 ans, une étoffe d\'un tissu anodin s\'est prise dans les branches du Chêne Mou. L\'arbre a poussé autour et au travers, l\'imprégnant ainsi de sa magie. Elle est désormais indissociable de ce gros morceau de bois ce qui la rend peu pratique et inflammable, mais sa puissance est indéniable.', 127, 142, '76#1a#28#0#1d15+25,7e#1a#28#0#1d15+25,7c#10#19#0#1d10+15,7d#c9#fa#0#1d50+200,79#4#6#0#1d3+3,b0#b#f#0#1d5+10,f0#5#7#0#1d3+4,f3#5#7#0#1d3+4,d4#4#6#0#1d3+3,d3#4#6#0#1d3+3,d6#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8473, 10, 'String Automnal du Chêne Mou', 'En automne, le Chêne Mou porte son string pour protéger ses précieux glands. En été, il les trimballe à l\'air.', 113, 141, '76#1a#28#0#1d15+25,7e#1a#28#0#1d15+25,7d#97#c8#0#1d50+150,7c#b#14#0#1d10+10,b0#b#f#0#1d5+10,73#3#4#0#1d2+2,70#6#a#0#1d5+5,b2#3#4#0#1d2+2,75#1#0#0#0d0+1,9e#1f5#258#0#1d100+500,ae#65#c8#0#1d100+100,f2#6#a#0#1d5+5,f4#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8474, 16, 'Coiffe du Chêne Mou', 'Vous pouvez porter cette coiffe dans n\'importe quel sens, on aura toujours l\'impression qu\'elle n\'est pas droite.', 166, 145, '76#1f#32#0#1d20+30,7e#1f#32#0#1d20+30,b0#6#a#0#1d5+5,8a#b#14#0#1d10+10,70#6#8#0#1d3+5,b2#4#5#0#1d2+3,73#4#5#0#1d2+3,7d#c9#fa#0#1d50+200,7c#15#1e#0#1d10+20,d2#4#5#0#1d2+3,d5#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (8476, 24, 'Première clef du Donjon de Sphincter', 'Cette clef ne vous suffira pas pour pénétrer dans le donjon de Sphincter, il vous faut l\'autre clef !', 502, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8477, 24, 'Deuxième clef du Donjon de Sphincter', 'Cette clef ne vous suffira pas pour pénétrer dans le donjon de Sphincter, il vous faut l\'autre clef !', 503, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8478, 12, 'Potion de lèche-bottes', 'Cette potion hautement illégale est redoutée par les plus grands. Une simple gorgée et la personne n\'a qu\'une obsession, lécher les bottes les plus proches. Certains disent que des variantes qui ciblent d\'autres endroits existent. Le malheureux buveur aura alors mauvaise haleine.', 36, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8480, 24, 'Potion de lèche-bottes', 'Cette potion hautement illégale est redoutée même des plus grand. En effet, une petite gorgée et le buveur n\'a plus qu\'une obsession : celle de lécher les bottes les plus proches. Des rumeurs parlent d\'une version alternative qui cible autre chose. Le seul indice quant à cet endroit est la mauvaise haleine des buveurs malchanceux.', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8481, 54, 'Poil de Rat d\'Egoutant', 'Ce poil est sale et malodorant, il a trainé dans les égoûts les plus insalubres de la région. Et pourtant il brille encore.', 670, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (8482, 59, 'Peau de Rat d\'Egoutant', 'Cette peau est recouverte de petites cicatrices qui témoignent de l\'enfance difficile qu\'a connue le Rat d\'Egoutant. Vous pourriez au moins avoir un peu de pitié pour lui !', 621, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (8483, 59, 'Peau de Chaman d\'Egoutant', 'Une fois lavée, cette peau pourra faire office de tapis de sol, ou de paillasson.', 622, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8484, 54, 'Poil de Chaman d\'Egoutant', 'Utilisé autrefois pour les moustaches postiches, ce type de poil convient également parfaitement pour les poils d\'aisselle postiches.', 671, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8485, 55, 'Etoffe du Rat Noir', 'Enroulée autour d\'une lamelle de bois tendre, cette étoffe pourra servir d\'éponge, ou même de gratte-fesses. Il en faut pour tous les goûts.', 725, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8486, 55, 'Etoffe du Rat Blanc', 'Cette étoffe aussi grasse qu\'un poil de Wabbit trempé dans la graisse de Blop, protège efficacement du froid, surtout si vous y mettez le feu.', 726, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8487, 55, 'Etoffe de Sphincter Cell', 'Cette Etoffe semble recouverte d\'un produit chimique étrange aux effets secondaires inconnus. Mieux vaut ne pas garder cette Etoffe trop longtemps entre les mains, un gros poil pourrait y pousser.', 727, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8488, 47, 'Cubitus du Rat Noir', 'Cet os de rat peut être vidé, percé et taillé pour ensuite servir d\'instrument de musique, ou de sarbacane si vous n\'avez pas l\'oreille musicale.', 658, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8489, 47, 'Dent de Rat Blanc', 'Cette dent est en réalité un horrible croc qui permettait au Rat Blanc de transmettre une multitude de maladies à ses victimes lorsqu\'il les mordait. Une façon comme une autre de s\'assurer de la mort de ses victimes, même s\'il ne parvenait pas à les achever. Tous les moyens sont bons lorsque l\'on veut se faire respecter.', 659, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8490, 47, 'Fémur de Sphincter Cell', 'Sphincter n\'était pas du genre à plaisanter avec les os, il les brisait en deux, puis en trois, puis en quatre, et parfois même en cinq, lorsqu\'il fallait ragaillardir les foules endormies pas un combat lassant.', 657, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8491, 59, 'Peau du Rat Noir', 'Le Rat Noir était réputé pour sa mauvaise haleine, mais aussi pour la peau rugueuse de son postérieur. Très pratique pour ne pas glisser sur la cuvette des toilettes. Malheureusement, le Rat Noir ne prenait jamais la peine d\'aller jusqu\'aux toilettes, puisqu\'il vivait directement dans les égouts.', 623, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8492, 59, 'Peau de Rat Blanc', 'Le Rat Blanc prenait un malin plaisir à se morfondre au fond de ses égouts, et à attendre qu\'une personne bien attentionnée vienne le réconforter. Il profitait ensuite de la naïveté et de la crédulité de ses victimes, pour les dépecer vivantes, et les rôtir en les ayant au préalable fourrées avec des noix de cajou. Pauvres noix de cajou.', 624, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8493, 59, 'Peau de Sphincter Cell', 'Qui aurait pu croire que vous seriez un jour capable de tenir entre vos mains, la peau du célèbre Sphincter ? Certainement pas Sphincter. Sa trop grande confiance en lui aura causé sa propre perte.', 625, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8494, 96, 'Ecorce d\'Abraknyde Ancestral', 'Cette écorce s\'est détachée de l\'Abraknyde Ancestral, sans que vous n\'ayez eu besoin de la lui arracher avec les dents.', 667, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8495, 108, 'Bourgeon de l\'Abraknyde Ancestral', 'Ce bourgeon desséché a été jadis entièrement vidé de sa sève par une créature affamée. Si vous le plongez dans l\'eau, vous pourrez le voir reprendre sa forme initiale, gonfler, puis si vous attendez très longtemps, pourrir.', 755, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8496, 98, 'Racine d\'Abraknyde Ancestral', 'Même arrachée à son propriétaire, cette racine peut vous fouetter les fesses ou vous tordre les chevilles. Sale bête !', 668, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8497, 24, 'La recette de la filtounga', 'Ce livre renferme les secrets de la filtounga, le plat mythique imaginé par Mouss Bouff.', 95, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8498, 63, 'Viande de Kanigrou', 'Cette viande est aussi tendre qu\'un cerveau de Boue.', 375, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8499, 63, 'Viande de Koalak', 'La viande de Koalak est en règle générale assez ferme. Il suffit simplement de l\'attendrir en la frappant avec un tronc de Kaliptus. Comme pour les enfants indisciplinés.', 376, 60, '');
INSERT INTO `website_shop_objects_templates` VALUES (8500, 63, 'Viande de Crocodaille', 'Cette viande insipide peut être conservée dans la vase pendant plusieurs années, avant de pourrir et de commencer à avoir du goût.', 377, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8501, 64, 'Viande de Kanigrou Conservée', 'Cette viande de Kanigrou peut maintenant être conservée plusieurs jours avant d\'être utilisée pour un plat.', 387, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8502, 64, 'Viande de Koalak Conservée', 'Cette viande Koalak peut maintenant être conservée plusieurs jours avant d\'être utilisée pour un plat.', 388, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (8503, 64, 'Viande de Crocodaille Conservée', 'Cette viande de Crocodaille peut maintenant être conservée plusieurs jours avant d\'être utilisée pour un plat.', 389, 70, '');
INSERT INTO `website_shop_objects_templates` VALUES (8504, 69, 'Entrecôte de Kanigrou', 'A manger chaude ou froide, cette entrecôte saura rassasier les appétits les plus voraces.', 132, 80, '6e#12c#0#0#0d0+300');
INSERT INTO `website_shop_objects_templates` VALUES (8505, 69, 'Filet de Koalak', 'Ce morceau de viande remplira même les estomacs sans fond.', 133, 120, '6e#1f4#0#0#0d0+500');
INSERT INTO `website_shop_objects_templates` VALUES (8506, 69, 'Entrecôte de Crocodaille', 'Cette part de viande imposante est de toute évidence, très difficile à digérer. Mais la gourmandise l\'emporte toujours sur la raison.', 134, 70, '6e#190#0#0#0d0+400');
INSERT INTO `website_shop_objects_templates` VALUES (8507, 69, 'Plat de Filtounga', 'La Filtounga est une plat unique. Grâce aux ingrédients qui le composent, il garde une saveur ... unique. Servir tiède.', 136, 100, '7d#1#0#0#0d0+1,8b#7d0#0#0#0d0+2000,6e#33#fa#0#1d200+50');
INSERT INTO `website_shop_objects_templates` VALUES (8508, 24, 'Plat de Filtounga', 'Ce plat est pour Paindep la sorcière.', 120, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8509, 25, 'La recette de la bière Bwork', 'Le grand mage Bworknroll dévoile ici la recette sacrée de la bière Bwork. Il n\'épargne aucun secret de fabrication. Il va même jusqu\'à donner la meilleure manière de la déguster. Un régal pour les amateurs, un cauchemar pour ceux qui ont déjà bu de cette bière sans la connaître.', 130, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (8511, 102, 'Arbalète de Surpuissance Ténébreuse de la Mort qui Tue', '....', 0, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8513, 5, 'Scalpel de Bworknroll', 'Pour récolter des « morceaux » de créature, rien ne vaut le scalpel de Bworknroll qui préserve la vitalité des membres arrachés. Il faut l\'utiliser au combat pour récupérer les parties désirées.', 60, 40, '64#6#14#0#1d15+5,af#33#96#0#1d100+50,9d#15#28#0#1d20+20,7d#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (8514, 15, 'Cervelle de vampire', 'Surchargée de globules frais en permanence, la cervelle d\'un vampire aspire vers lui toutes les globules rouges disponibles. C\'est ce qui donne  aux vampires un teint pâle. Chez les Iop, ce sont plutôt les pieds qui attirent leur sang, d\'où leur adresse à bondir au lieu de réfléchir...', 492, 20, '8b#1#14#0#1d20+0');
INSERT INTO `website_shop_objects_templates` VALUES (8515, 47, 'Os de Trooll', 'Lorsque l\'on constate la solidité et le poids d\'un os de Trooll, on comprend mieux pourquoi leurs claques font si mal lors d\'une partie de jeu Trooll.', 640, 5, '');
INSERT INTO `website_shop_objects_templates` VALUES (8516, 15, 'Coeur de Bworkcelhaine', 'Cette Bworkette sans coeur qui a jeté son fils Krazybwork dans une fosse a été maudite par Bworknroll à qui elle a refusé son amour. Enfermée dans une cave, elle se nourrit de son propre coeur chaque jour. Toutes les nuits, il repousse et bat à nouveau de mille feux.', 518, 33, '');
INSERT INTO `website_shop_objects_templates` VALUES (8517, 15, 'Moumoule', 'Cette belle Moumoule fraîche sert aux Bwork esseulés lors qu\'ils partent en rapines loin de leurs compagnes.', 756, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8518, 69, 'Moumoules frites', 'Dans les profondeurs de la Mer d\'Asse, les Moumoules récoltent du varech qu\'elles roulent sous leurs aisselles. Une fois la matière formée en frites, elles se hissent sur la plage pour les faire dorer au soleil avant de les ingérer.', 135, 1, '8b#5#0#0#0d0+5,6e#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (8519, 69, 'Gâtrool', 'Cette galette rituelle fourrée aux krottes de Trool est une vieille recette bwork. Seul un Bwork qui a vaincu un Trool à mains nues a le droit d\'en manger. S\'il a survécu à ce combat, il est prêt à avaler n\'importe quoi !', 136, 5, '25d#a#0#0#0d0+10,8b#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (8520, 60, 'Gratrooll', 'Cette graisse épaisse et nutritive permet de cuire la plupart des aliments dans de vieilles marmites sans accrocher le plat. Certains adeptes Osamodas s\'en servent aussi pour glisser des Tofus dans des endroits que la morale Iop réprouve.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8521, 17, 'La cape rouge', 'La cape rouge est l\'artefact préféré des mégalomanes. Une fois posée sur leurs frêles épaules, ils ont l\'impression d\'incarner Superman ou un magicien surpuissant jusqu\'à ce qu\'ils croisent un Minotoror.', 128, 9, '');
INSERT INTO `website_shop_objects_templates` VALUES (8522, 74, 'Lanceur d\'effet Magique', 'Cet objet surprenant renferme un concentré de magie obscure plutôt instable. Personne ne peut prédire ce qu\'il renferme, mais il est déconseillé de trop attendre avant de l\'utiliser.', 31, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8523, 24, 'La relique des Robill', 'Cet objet familial suinte d\'un flux magique extrêmement puissant. Transmis de génération en génération entre les membres de cette famille, il n\'a rien perdu de son pouvoir. Il n\'existe que peu d\'artéfacts d\'où émane une telle force. Il a peut-être été en contact avec un Dofus...', 714, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8524, 90, 'Fantôme Walk', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 45, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8525, 69, 'Oeuf de piou', 'Les œufs de pious sont un vrai régal pour les amateurs de friandises. Cependant, ils éclosent très vite lorsqu\'ils sont proches d\'une source de chaleur. C\'est pourquoi, il faut éviter de les laisser traîner dans sa poche ou dans sa bouche car au bout de quelques minutes un mini piou peut sortir de sa coquille. Avoir un piou affamé coincé entre vos dents ou se faufilant dans vos vêtements peut vous chatouiller le palais ou d\'autres parties plus intimes de votre anatomie.', 38, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8526, 77, 'Certificat de Mise en Chanil : Koalak Sanguin', 'Ce certificat décrit les caractéristiques du Koalak Sanguin que vous avez placé au chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8527, 11, 'Gobtroteur', 'Ces bottes en peaux de gobelins ont été créées par Planbworksek afin de charger l\'ennemi (si possible dans le dos) avec une grande vélocité. En chaussant ces bottes, il a sauvé plus d\'un camarade Bwork dans la panade.', 98, 14, '7d#10#19#0#1d10+15,76#b#f#0#1d5+10,ae#33#64#0#1d50+50');
INSERT INTO `website_shop_objects_templates` VALUES (8528, 25, 'La recette des crêpes', 'Grâce à Pol Bokuz, vous saurez enfin réussir votre pâte à crêpe pour nourrir vos petits enfants et les envoyer rapidement à la sieste. Le secret de cette recette nourrissante et soporifique : la poudre de perlinpainpain bien sûr !', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8529, 24, 'Le marteau à Zaap', 'Rien ne vaut un bon coup de marteau pour réparer un Zaap déréglé !', 8, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8530, 16, 'Ruskauffe', 'Cette coiffe tient chaud aux oreilles, et absorbe les effluves d\'alcool qui s\'échappent de votre haleine. Que demander de plus ?', 167, 151, 'd2#6#a#0#1d5+5,d6#6#a#0#1d5+5,ae#1#64#0#1d100+0,b6#4#5#0#1d2+3,70#5#7#0#1d3+4,b2#5#7#0#1d3+4,73#2#4#0#1d3+1,7c#1f#2d#0#1d15+30,7d#c9#12c#0#1d100+200');
INSERT INTO `website_shop_objects_templates` VALUES (8531, 16, 'Lapinocoiffe', 'Qui oserait porter une coiffe aussi ridicule ? Personne excepté vous.', 168, 33, '75#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (8532, 17, 'Cape du Lapino Blasé ', 'Avec cette cape sur les épaules, vous pourrez enfin montrer aux personnes à qui vous tournez le dos, que vous êtes blasé par leur stupidité.', 129, 14, '77#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (8533, 16, 'Le Floude', 'Le Floude n\'est pas réellement un chapeau mais un parasite se développant sur le crâne des personnes trop volubiles, excessivement bruyantes, ou simplement verbalement agressives. Son aspect repoussant fait fuir les gens, ce qui pousse son porteur à crier encore plus fort pour se faire entendre, sans succès évidement, puisqu\'il n\'a rien à dire de toute façon.', 169, 1, '70#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8534, 17, 'La Cape S\'loque', 'Cette cape molletonnée absorbe tous les bruits environnants, obligeant son porteur à hurler en permanence.', 130, 1, 'b2#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8535, 11, 'Les Incrustes', 'Ces Getas sont si légères qu\'elles poussent leur propriétaire à courir dans tous les sens et à sauter partout lorsqu\'un combat commence. Les aventuriers expérimentés détestent ces getas, qui permettent aux premiers venus de prendre part à un combat auquel ils n\'ont pas été invités.', 99, 1, 'f4#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8536, 10, 'La Spamette', 'Cette ceinture se porte si serrée qu\'elle force presque son porteur à bégayer, trembloter et faire n\'importe quoi, tant que c\'est en boucle.', 114, 1, 'e1#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8537, 9, 'Le Plussain', 'Ce petit anneau ne sert à rien, sinon à être très voyant, histoire de montrer aux gens que vous existez.', 125, 1, '73#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8538, 1, 'Le S\'Mesme', 'Après plusieurs nuits de dur labeur pour réaliser cette amulette, le plus grand bijoutier d\'Astrub, connu pour avoir été élevé par les Bworks s\'exclama devant une foule ébahie : \"C 1 pur amu tro bi1\". Même l\'illustre historien Champo Gnon ne parvint pas à déchiffrer ce que le bijoutier avait voulu dire.', 120, 1, 'b0#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8539, 19, 'Hache de l\'apprenti bûcheron', 'Même si vous ne savez pas très bien manier la hache, vous ne risquez guère de vous couper avec celle-ci tant la lame est émoussée. Mais bon, en tapant suffisamment fort, vous arriverez bien à couper quelques arbres.', 1, 1, '64#1#3#0#1d3+0,ae#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (8540, 22, 'Faux de l\'apprenti paysan', 'Cette faux est de qualité médiocre mais on vous l\'a offerte, vous n\'avez donc pas à vous plaindre. De plus, elle fauche correctement le blé et on ne lui en demande pas plus.', 1, 1, 'ae#a#0#0#0d0+10,64#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (8541, 20, 'Canne de l\'apprenti pêcheur', 'Cette canne à pêche a connu des jours meilleurs, le fil n\'est plus très solide et l\'hameçon incertain. Parfaite pour la pêche au goujon.', 8, 1, '60#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (8542, 20, 'Gants de l\'apprenti alchimiste', 'Des gants d\'une qualité indiscutable, presque pas de trou, l\'odeur de sueur de l\'ancien propriétaire est tout juste perceptible, des doigts trop courts,  un maintien incertain... C\'est indiscutable, ces gants sont pourris.', 5, 1, '64#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (8543, 79, 'Limonade d\'Incarnam', 'Cette limonade fabriquée par les dieux est un mélange d\'eau, de bulles, et d\'extraits d\'animaux. Elle revigore les jeunes âmes venant justes de s\'incarner dans Incarnam. Pour les autres, c\'est de l\'eau gazeuse tout juste bonne à s\'entraîner pour les concours de rots.', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8544, 77, 'Certificat de Mise en Chanil : Walk', 'Ce certificat décrit les caractéristiques du Walk que vous avez placé au chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8545, 84, 'Clef du Donjon d\'Incarnam', 'Cette clef permet d\'entrer dans le donjon d\'Incarnam, habité par le terrible Milimilou.', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8546, 59, 'Peau de Milimilou', 'De légères bouclettes font de cette peau une belle descente de lit. Il est certain que quelqu\'un sur Incarnam est prêt à troquer contre cette peau. Reste à trouver qui ...', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8547, 31, 'Trinsfirmitik ik Nikiril', 'Lik nisittik miditik sint mivisik pir lik sintik.', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8548, 31, 'Twansfowmation en Wabbit', 'Les cawottes maudites sont mauwaises pouw la santé.', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8557, 53, 'Plume du Batofu', 'Cette plume directement arrachée des aisselles du Batofu diffuse une odeur de Doubitchou ancestral mariné.', 120, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (8558, 16, 'Chapeau du Lapino', 'Si vous envisagez de dialoguer avec les Wabbits, c\'est peut-être la coiffe qu\'il vous faut. Si vous cherchez à séduire, posez cette coiffe sur la tête de vos rivaux.', 170, 6, 'b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8559, 16, 'La HmmMmmMmmm', 'Mmmmm mm mmmmmm mmmmm, mmm mmm mm mmmmmm mmmmm mmmmmmm mmmmmm mmm mmmm\'m mmmmm mmmm mmmmmmm.', 171, 42, '98#2a#0#0#0d0+42,7a#d#0#0#0d0+13,76#2a#0#0#0d0+42,92#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (8561, 18, 'Bébé Pandawa', 'Cet adorable bébé Pandawa adorera vous suivre partout pour découvrir le monde de ses grands yeux ronds. Ce familier apprivoisé mange du riz, mais accepte également les noisettes.', 42, 1, '320#a#0#0#0d0+10,8a#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (8563, 32, 'Titi Gobelait', 'Titi doit rencontrer son futur professeur de magie.', 18, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8564, 77, 'Certificat de Mise en Chanil : Bébé Pandawa', 'Ce certificat décrit les caractéristiques du Bébé Pandawa que vous avez placé au chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8565, 90, 'Fantôme Bébé Pandawa', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 44, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8566, 27, 'Transformation Walk', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8567, 27, 'Transformation Fantôme Bébé Pandawa', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8568, 89, 'Cadeau Bébé Pandawa', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8569, 16, 'Doro le Blak', 'Cette coiffe appartenait à une petite Xélorette, qui prenait un malin plaisir à dérégler l\'écoulement du temps. La légende raconte qu\'elle parvint à voler plusieurs jours aux habitants d\'Amakna. Elle ne s\'est soustraite à la colère de la population qu\'en distribuant de nombreuses friandises.', 172, 129, '7b#29#3c#0#1d20+40,7c#1f#32#0#1d20+30,b0#15#1e#0#1d10+20,70#6#a#0#1d5+5,d6#6#a#0#1d5+5,d5#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8570, 54, 'Poil de Rat Bontarien', 'Ce poil appartenait aux rats des égouts de Bonta, les seuls qui possèdent des touffes de poils assorties aux couleurs des murailles de leur cité.', 672, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8571, 54, 'Poil de Rat Brâkmarien', 'Ce poil appartenait aux rats des égouts de Brâkmar, les seuls qui possèdent des touffes de poils assorties aux couleurs des murailles de leur cité.', 673, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8572, 43, 'Potion d\'oubli : \'Apprivoisement de monture\'', 'Cette potion d\'oubli permet d\'oublier un niveau du sort \"Apprivoisement de monture\".', 36, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8573, 43, 'Potion d\'oubli : \'Boomerang perfide\'', 'Cette potion d\'oubli permet d\'oublier un niveau du sort \'Boomerang perfide\'.', 36, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8574, 23, 'Dofus vinaigrette', 'Avec ou sans lardons, ce Dofus est toujours aussi bon.', 13, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8575, 4, 'Le Ramboton', 'Un célèbre guerrier Féca qui vivait dans la jungle de Pandala disait souvent \"Pour gagner la guerre, il faut devenir la guerre\".', 71, 200, '73#5#0#0#0d0+5,8a#19#0#0#0d0+25,70#a#0#0#0d0+10,80#1#0#0#0d0+1,75#1#0#0#0d0+1,7c#28#0#0#0d0+40,77#1e#0#0#0d0+30,7e#32#0#0#0d0+50,7d#fa#0#0#0d0+250,5e#4#6#0#1d3+3,63#d#14#0#1d8+12');
INSERT INTO `website_shop_objects_templates` VALUES (8576, 24, 'Parchemin de recommandation d\'Yse Vewybad', 'Ce parchemin vous a été remis par Yse Vewybad pour services rendus.', 26, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (8588, 24, 'Insigne Roublard', 'Cet insigne, donné par un roublard, sera peut-être la clef pour rentrer dans le repaire de ces derniers.', 86, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8590, 24, 'Contrat entre Vil Smisse et Yse Vewybad', 'Ce contrat prouve la félonie d\'Yse Vewybad. Il ne reste plus qu\'à le porter à qui de droit.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8593, 27, 'Potion de transformation en Wa Wabbit', 'Cette potion vous a été remise par Uba Tessé. Elle va vous transformer en Wabbit et devrait vous permettre de vous faire passer pour le prétendant d\'Allisteria.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8594, 27, 'Potion de twansfowmation en Wa Wabbit', 'Cette potion vous a été remise par Uba Tessé. Elle va vous transformer en Wabbit et devrait vous permettre de vous faire passer pour le prétendant d\'Allisteria.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8595, 24, 'Oeuf de Tofu Obèse', 'Cet oeuf renferme un tofu obèse, peut-être le futur vainqueur du pwince d\'Wa.', 122, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8596, 6, 'Griffe Pourpre', 'Cette épée acérée a pris cette teinte pourpre si élégante après avoir éviscéré des milliers de Bworks. Alors qu\'avant, elle n\'était que violet foncé.', 72, 145, '8a#1f#32#0#1d20+30,d5#4#6#0#1d3+3,7c#15#23#0#1d15+20,70#5#8#0#1d4+4,73#3#4#0#1d2+2,7d#97#c8#0#1d50+150,5c#3#5#0#1d3+2,64#24#3c#0#1d25+35');
INSERT INTO `website_shop_objects_templates` VALUES (8597, 24, 'Potion de Gavage', 'Cette potion va permettre à Vil Smisse d\'engraisser le tofu obèse que vous lui avez ramené.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8598, 5, 'Dagues Ruyère', 'Ces dagues sont perforées tout au long de la lame, afin d\'émettre un joli sifflement quand on les manie rapidement. Les trous sont également très efficaces pour entraîner les viscères de ses ennemis.', 61, 67, '5f#3#4#0#1d2+2,65#1#0#0#0d0+1,73#3#4#0#1d2+2,77#10#1e#0#1d15+15,7c#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (8599, 5, 'Griffettes', 'Ces dagues ont été forgées pour une écaflipette maniaque de la manucure. Elle trouvait que les lourdes épées s\'accordaient mal à ses jolies griffes vernies.', 62, 69, '64#9#12#0#1d10+8,77#1a#28#0#1d15+25,7c#10#1e#0#1d15+15,7d#1f#32#0#1d20+30,76#1a#28#0#1d15+25');
INSERT INTO `website_shop_objects_templates` VALUES (8600, 30, 'La flemme de monter les escaliers', 'Vous avez attrapé un gros coup de fatigue à force de crier à tous vents, et vous ne vous sentez plus capable de grimper autant de marches avant au moins 6 minutes ...', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8603, 24, 'Livrée de valet du Prince Wabbit.', 'Avec ça, le valet du prince Wabbit sera à la dernière mode.', 715, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8604, 6, 'Epée Doncule', 'Cette épée brillante est idéale pour cueillir des fleurs, même si elles se défendent. Elle est même parfaite pour cueillir des arbres.', 73, 100, 'd5#6#a#0#1d5+5,9a#1f#32#0#1d20+30,98#1f#32#0#1d20+30,9b#1f#32#0#1d20+30,7c#15#23#0#1d15+20,7d#65#96#0#1d50+100,76#1f#32#0#1d20+30,64#2e#41#0#1d20+45');
INSERT INTO `website_shop_objects_templates` VALUES (8605, 6, 'Epée Zervatif', 'Cette lame est lubrifiée afin de glisser plus facilement dans son fourreau. En revanche elle est impossible à nettoyer et doit être jetée après utilisation, surtout si elle est recouverte de sang. N\'oubliez pas qu\'elle sert avant tout à se protéger.', 74, 73, '7d#1f#32#0#1d20+30,7c#b#14#0#1d10+10,77#1a#23#0#1d10+25,76#1a#23#0#1d10+25,7e#1a#23#0#1d10+25,63#6#a#0#1d5+5,62#6#a#0#1d5+5,64#f#16#0#1d8+14');
INSERT INTO `website_shop_objects_templates` VALUES (8606, 24, 'Robe de la mariée', 'La robe de la mariée est soigneusement emballée dans ce beau paquet. Il ne reste plus qu\'à l\'apporter à l\'intendant San Lavalss.', 715, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8607, 4, 'Le Bâton Cloutay', 'C\'est un gros bâton, avec des clous plantés dedans. N\'y cherchez pas autre chose, c\'est la simplicité même, et pourtant, il est diablement efficace pour déchausser les dents de vos adversaires.', 72, 107, '62#9#d#0#1d5+8,63#9#d#0#1d5+8,d4#6#a#0#1d5+5,77#1a#28#0#1d15+25,7e#1a#28#0#1d15+25,7d#33#64#0#1d50+50,b0#6#a#0#1d5+5,b2#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8608, 4, 'La Bastonneuze', 'On raconte qu\'un disciple de Sadida du nom de Fraye a utilisé ce bâton pour défendre sa femme et son fils face à un troupeau de Bouftous enragés. Il est regrettable qu\'il ait confondu sa famille avec les monstres pendant l\'échauffourée.', 73, 85, '64#e#1c#0#1d15+13,8a#15#23#0#1d15+20,73#4#5#0#1d2+3,75#1#0#0#0d0+1,7d#33#46#0#1d20+50,7c#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (8609, 2, 'Geish\'Arc', 'Cet Arc est léger, fin, élégant, et sent bon la fleur de cerisier. Il est également meurtrier si l\'on s\'en sert pour autre chose que se pavaner.', 56, 81, '64#5#c#0#1d8+4,62#5#c#0#1d8+4,77#1a#28#0#1d15+25,7d#1a#28#0#1d15+25,73#3#4#0#1d2+2,7c#10#1e#0#1d15+15');
INSERT INTO `website_shop_objects_templates` VALUES (8610, 2, 'Le Kikoularc', 'Si vous tenez cet arc bien haut et prononcez avec entrain le mot \"Pampulilu !\", vous aurez vraiment l\'air ridicule.', 57, 79, '63#7#c#0#1d6+6,60#7#c#0#1d6+6,7e#15#23#0#1d15+20,7b#15#23#0#1d15+20,6f#1#0#0#0d0+1,70#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (8611, 3, 'Bagdette Café ', 'Cette baguette appartient au célèbre Grinegau, qui fait du très bon café, mais qui ne vendra pas son échelle.', 61, 72, '60#5#8#0#1d4+4,64#5#8#0#1d4+4,7b#10#1e#0#1d15+15,7e#10#1e#0#1d15+15,7d#10#1e#0#1d15+15,7c#10#1e#0#1d15+15,b2#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (8612, 3, 'La Bidjiz', 'Avec la Bidjiz, vous resterez vivant, sûrement parce que vos adversaires se mettront à danser en voyant les multiples facettes de la boule qui orne cette baguette.', 62, 79, '64#d#16#0#1d10+12,80#1#0#0#0d0+1,77#1a#28#0#1d15+25,7c#10#19#0#1d10+15,73#3#5#0#1d3+2,7d#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (8613, 8, 'Pelle Minstère', 'Créée comme une œuvre d\'art de la forgemagie, cette pelle creuse très mal, sauf dans la tête de vos adversaires.', 46, 70, '64#10#18#0#1d9+15,5b#2#3#0#1d2+1,7b#1a#28#0#1d15+25,70#4#6#0#1d3+3,7d#1f#32#0#1d20+30,7c#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (8614, 8, 'Pelle Ripe', 'Magnifique invention, cette pelle deux-en-un permet de creuser une tombe et de la laisser comme croix. A condition de ne perdre qu\'un compagnon à la fois, sous peine de creuser les tombes suivantes avec les mains.', 47, 66, '64#6#c#0#1d7+5,63#6#c#0#1d7+5,7e#1a#23#0#1d10+25,7b#1a#23#0#1d10+25,75#1#0#0#0d0+1,73#3#4#0#1d2+2,7c#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (8615, 7, 'Marteau Mato', 'Ce marteau réduit si facilement les crânes en bouillie qu\'il a pris une élégante teinte rouge tomate.', 61, 83, '64#7#e#0#1d8+6,63#7#e#0#1d8+6,b6#1#0#0#0d0+1,7e#1f#32#0#1d20+30,7c#15#1e#0#1d10+20,7d#29#3c#0#1d20+40,b2#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8616, 7, 'Marteau Minokers', 'Ce marteau a été créé à l\'époque du Roi Stéphane, qui a terrorisé des millions de gens.', 62, 178, '64#1b#2b#0#1d17+26,5e#4#6#0#1d3+3,7e#1f#32#0#1d20+30,7d#c9#fa#0#1d50+200,7c#1a#28#0#1d15+25,b6#2#0#0#0d0+2,70#5#7#0#1d3+4,b2#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8617, 19, 'Hache Ebbah', 'Pour dire je t\'aime.', 45, 62, '64#17#1c#0#1d6+22,7d#29#46#0#1d30+40,7c#10#1e#0#1d15+15');
INSERT INTO `website_shop_objects_templates` VALUES (8618, 19, 'Hache Eulouh', 'Cette étrange hache est profilée de façon à décapiter plus facilement les Bworks. L\'aisance avec laquelle elle décapite aussi les habitants d\'Astrub indique clairement qu\'il existe un lien entre ces deux populations. Mais personne n\'a encore trouvé lequel.', 46, 80, '64#b#11#0#1d7+10,60#b#11#0#1d7+10,7d#1a#28#0#1d15+25,7c#10#19#0#1d10+15,b0#6#a#0#1d5+5,ae#65#c8#0#1d100+100,77#b#14#0#1d10+10,7b#1a#28#0#1d15+25');
INSERT INTO `website_shop_objects_templates` VALUES (8619, 16, 'Casque Keutumedi', 'Grâce à cette coiffe guerrière, les Iops ont vraiment fière allure. Le seul problème est qu\'elle leur cache une partie de leur champ de vision et les empêche d\'entendre correctement les paroles de leurs adversaires. Le casque Keutumedi est vraiment fait pour les gens qui aiment frapper avant de réfléchir.', 175, 40, '11f#91#0#19#0d0+145,119#8d#0#1#0d0+141,11d#9a#0#1#0d0+154,11e#9b#0#1#0d0+155');
INSERT INTO `website_shop_objects_templates` VALUES (8621, 94, 'Cawotte Maudite', 'Cette appétissante cawotte à l\'aiw owdinaiwe mais elle sent le maléfice à plein museau. Wésistewez-vous à la tentation de la cwoquew à pleine dents ?', 6, 21, '');
INSERT INTO `website_shop_objects_templates` VALUES (8624, 94, 'Ballon Bleu Magique', 'Contrairement aux contrefaçons que l\'on trouve à la foire du Trool, ce ballon-ci sait au moins s\'envoler avec grâce et aisance. Il est confectionné à partir d\'une larve bleue, vidée encore remuante, puis gonflée par un Trool, selon la traditionnelle recette du grand mage Vahy Nez.', 7, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8625, 94, 'Ballon Vert Magique', 'Ce ballon vert est le résultat assez étrange qui se produit lorsqu\'une larve verte mange un champignon Luidegît. Notez qu\'après ce repas les yeux de la larve sortent généralement de leur orbite et roulent au sol. Ils sont alors souvent ramassés par les bworks des environs, friands de ces mets pour leur apéritif. Ce ballon a inspiré ses célèbres recettes au grand mage Vahy Nez.', 8, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8626, 94, 'Nisitik Miditik', 'Cittik ippitissintik nisitik ii ik\'ik irdinirik mis illik sik lik milificik ii plinik misik. Risistirik-vis ik lik tintitinik dik lik grinitik ii plinik dints ?', 9, 21, '');
INSERT INTO `website_shop_objects_templates` VALUES (8627, 3, 'Flûte de Sarr Ys', 'Confrère et ami du célèbre Guy-guy (proche parent du Chêne Mou), Sarr Ys est un troubadour dont les notes enchanteresses ont gravées leurs empruntes dans la mémoire d\'Amakna. Malheureusement, ce brillant artiste est décédé tragiquement dans un accident de Koin Koin, lors d\'une beuverie estivale.', 63, 1, 'a#7#0#0#0d0+7,92#1#0#0#0d0+1,62#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (8628, 16, 'Chapeau Leufère', 'Cette coiffe procure assurance et témérité à celui qui la porte. Grâce à elle vous irez toujours de l\'avant, en pensant être capable de réaliser tous les exploits. Pensez toutefois à l\'enlever de temps en temps, sinon elle vous entraînera dans des situations inextricables !', 185, 40, '11f#6d#0#19#0d0+109,11f#66#0#19#0d0+102,122#69#0#1#0d0+105,11d#67#0#1#0d0+103');
INSERT INTO `website_shop_objects_templates` VALUES (8629, 16, 'Chapeau Grave', 'À cause de cette coiffe, les adversaires deviennent souvent muets comme une tombe. On n\'ose demander à quoi est censé ressembler ce couvre-chef, on ne peut plus atypique. Mais ce n\'est pas très grave. Les Srams ne sont guère susceptibles.', 179, 40, '11b#3f#0#f#0d0+63,119#4f#0#2#0d0+79,11d#40#0#1#0d0+64,11e#3e#0#2#0d0+62');
INSERT INTO `website_shop_objects_templates` VALUES (8630, 16, 'Bonnet Nufar', 'Cette coiffe ressemble beaucoup au Sulik et au Piruk. Mais comme elle est très confortable et que les Xélors ne la quittent jamais, même pour dormir, elle est communément nommée Bonnet Nufar. Elle dégage une agréable odeur de nymphéa qui contribue à l\'endormissement. En revanche, les ronflements qu\'elle provoque sont aussi insupportables que les chants de crapaud lors de la saison des amours.', 177, 40, '11b#64#0#f#0d0+100,11f#5c#0#1e#0d0+92,11d#55#0#1#0d0+85,11e#52#0#1#0d0+82');
INSERT INTO `website_shop_objects_templates` VALUES (8631, 16, 'Coiffe Fère', 'Grâce à la Coiffe Fère, les Eniripsas savent toujours comment agir en cas d\'urgence. En effet, la liste des gestes de premiers secours y est discrètement inscrite dans la doublure. Ce couvre-chef leur donne un air doctoral, comme s\'ils venaient de recevoir leur diplôme, alors que personne n\'oserait arborer un chapeau aussi ridicule lors d\'une cérémonie scolaire !', 184, 40, '11b#7a#0#f#0d0+122,11f#7b#0#23#0d0+123,119#80#0#1#0d0+128,121#82#0#1#0d0+130');
INSERT INTO `website_shop_objects_templates` VALUES (8632, 16, 'Chapeau Tyron', 'On aurait pu croire que cette coiffe possédait une jolie couleur orangée. C\'est pas du tout le cas. De plus, cet accessoire de mode tient plus du masque que du chapeau. Alors pourquoi ces créateurs l\'ont-ils nommé Chapeau Tyron ? Sûrement pour faire parler les bavards !', 178, 40, '11c#c0#0#64#0d0+192,11f#c3#0#1e#0d0+195,119#b6#0#3#0d0+182,121#c8#0#1#0d0+200');
INSERT INTO `website_shop_objects_templates` VALUES (8633, 16, 'Bonnet Spairance', 'Les pointes acérées qui sortent de ce bonnet permettent non seulement de blesser l\'adversaire mais aussi d\'avoir plus de chance de se prendre la foudre sur le crâne par temps d\'orage. Les Sacrieurs sont en effet une classe qui aime autant faire souffrir les autres qu\'eux-mêmes. Une bonne odeur de chair grillée : rien de tel pour commencer la journée !', 180, 40, '123#1b2#0#1#0d0+434,121#1b4#0#1#0d0+436,11d#1b9#0#1#0d0+441,11e#e9#0#1#0d0+233');
INSERT INTO `website_shop_objects_templates` VALUES (8634, 16, 'Capuche Apin', 'Grâce à cette coiffe, vous aurez vraiment l\'air d\'une bête à cornes. Nul doute que l\'on se retourne pour admirer la très grosse paire qui orne votre tête. Cette ample capuche permet aussi de conserver au frais des aliments comme le foin pour Bouftou ou le pain pour Tofu.', 181, 40, '11b#18#0#a#0d0+24,11f#20#0#19#0d0+32,11f#1c#0#1e#0d0+28,11d#22#0#1#0d0+34');
INSERT INTO `website_shop_objects_templates` VALUES (8635, 16, 'Chapeau Lithique', 'Cette coiffe a la propriété de faire dire au porteur des promesses qu\'il oublie aussitôt. Est-ce parce qu\'elle exerce une pression sur les zones de la mémoire ou sur celle du langage ? Nul ne le sait précisément. L\'important est de ne prendre en compte que les paroles les moins extravagantes.', 176, 40, '11b#2b2#0#a#0d0+690,11b#2af#0#f#0d0+687,11f#2ae#0#1e#0d0+686,123#2b1#0#1#0d0+689');
INSERT INTO `website_shop_objects_templates` VALUES (8636, 16, 'Coiffe de Robbie Capuche', 'Robbie Capuche était un célèbre Crâ qui vivait dans les bois, d\'où la couleur verte de sa coiffe pour se fondre dans le paysage. Il se prenait pour un justicier et passait tout son temps à dérober l\'argent des riches au profit d\'une bonne cause : la sienne.', 186, 40, '11b#a3#0#f#0d0+163,11b#aa#0#14#0d0+170,11d#ac#0#1#0d0+172,11a#a7#0#1#0d0+167');
INSERT INTO `website_shop_objects_templates` VALUES (8637, 16, 'Bonnet Toual', 'En revêtant cette coiffe, le Féca accroît sa chance et celle de ses alliés. Si votre groupe est guidé par un Féca portant un Bonnet Toual, vous êtes sûr d\'arriver à bon port et ce presque sans une égratignure. Mais l\'odeur est si nauséabonde que cela en fait l\'objet idéal pour se protéger de la veuve et de l\'orphelin.', 182, 40, '11b#3#0#f#0d0+3,121#2#0#1#0d0+2,11d#4#0#1#0d0+4,11a#11#0#1#0d0+17');
INSERT INTO `website_shop_objects_templates` VALUES (8638, 16, 'Chapeau Taufeu', 'Ce couvre-chef sert aussi bien de protection contre les intempéries que d\'accessoire de cuisine, pour mitonner des plats à la bonne température. L\'agitation du chapeau permet d\'apporter l\'afflux d\'air nécessaire à la bonne tenue du feu de cuisson. Et, comme tout le monde sait que le pot au feu est un plat qui se mijote pendant longtemps, on comprend mieux pourquoi les Enutrofs ont des poignets si musclés.', 183, 40, '11b#31#0#14#0d0+49,11c#2f#0#1e#0d0+47,119#35#0#1#0d0+53,11e#2a#0#2#0d0+42');
INSERT INTO `website_shop_objects_templates` VALUES (8639, 17, 'Cape Aurale', 'La cape qui flotte au vent est indispensable pour vous procurer une aura de guerrier, surtout si vous tournez le dos à l\'adversaire. Certains pensent qu\'elle est renforcée par une plaque de métal qui permet de parer tous les coups sournois.', 131, 80, '119#8e#0#1#0d0+142,119#8f#0#1#0d0+143,121#9c#0#1#0d0+156,11d#90#0#1#0d0+144');
INSERT INTO `website_shop_objects_templates` VALUES (8640, 17, 'Cape Aillé ', 'Faite dans un tissu doux et résistant, cette cape donne aux Ecaflips l\'impression qu\'ils sont toujours des as, quoi qu\'il arrive. Lorsqu\'ils remportent la victoire, ils adorent se draper dans ce vêtement avant de réclamer leur récompense : « Et maintenant, t\'as qu\'à payer ! » ', 133, 80, '11b#6b#0#19#0d0+107,11b#78#0#1e#0d0+120,119#68#0#4#0d0+104,11d#73#0#1#0d0+115');
INSERT INTO `website_shop_objects_templates` VALUES (8641, 17, 'Cape Routh', 'Cette cape est si légère et si fine qu\'elle s\'envole à la moindre brise de vent, de n\'importe quel vent. Pas toujours très pratique, surtout lorsque l\'on veut se faire discret, après un repas composé de légumineuses et de diverses boissons fermentées.', 140, 80, '11f#42#0#1e#0d0+66,119#41#0#3#0d0+65,11d#49#0#1#0d0+73,11e#48#0#1#0d0+72');
INSERT INTO `website_shop_objects_templates` VALUES (8642, 17, 'Cape Huchon', 'La couleur sombre de cette cape lui permet d\'être en harmonie avec n\'importe quel vêtement, quel que soit son coloris. Comme elle est très ample, elle permet aussi de protéger la tête et le bout du nez.', 141, 80, '123#54#0#1#0d0+84,119#5b#0#1#0d0+91,119#62#0#2#0d0+98,11d#63#0#1#0d0+99');
INSERT INTO `website_shop_objects_templates` VALUES (8643, 17, 'Cape Sulhit', 'La Cape Sulhit se met délicatement sur les épaules afin de protéger son porteur des tendinites et de l\'enraidissement des articulations. Vêtement aux vertus médicales, il est regardé avec envie par les Pandawas, qui passent beaucoup de temps à porter leur adversaire comme leur allié. Eux-aussi, ils aimeraient avoir un vêtement de ce type.', 134, 80, '119#84#0#4#0d0+132,119#7f#0#2#0d0+127,119#7d#0#1#0d0+125,121#88#0#1#0d0+136');
INSERT INTO `website_shop_objects_templates` VALUES (8644, 17, 'Cape Hitton', 'Cet objet sert à cacher les surcharges pondérales des Sadidas. À force de dormir au lieu de faire de l\'exercice physique, les personnages de cette classe développent une tendance à l\'embonpoint. Si les Sadidettes possèdent des réserves anti-famine, avantageusement placées pour flatter les regards masculins, les Sadidas tentent plutôt de masquer les leurs grâce à cette cape.', 139, 80, '11b#b7#0#f#0d0+183,119#c5#0#4#0d0+197,119#b5#0#3#0d0+181,11a#bd#0#1#0d0+189');
INSERT INTO `website_shop_objects_templates` VALUES (8645, 17, 'Cape Ytale', 'Ce vêtement joue un rôle primordial dans la prestance des Sacrieurs. Ils s\'en servent comme bandage pour panser les plaies, comme serpillière pour essuyer le sang, comme descente de lit pour ne pas avoir froid aux pieds. On ne dira jamais à quel point les personnages de cette classe redoutent les sols gelés !', 138, 80, '119#1bf#0#1#0d0+447,119#1b3#0#2#0d0+435,11d#1b1#0#1#0d0+433,11e#1b6#0#2#0d0+438');
INSERT INTO `website_shop_objects_templates` VALUES (8646, 17, 'Cape Lyne', 'Cette douce cape est parfois employée par les Osamodettes coquettes en guise de couvre-chef aux larges bords. Les Osamodas mâles ne s\'en servent que comme pèlerine. Grâce au dessin qui orne cet habit, cette classe de personnages a hérité d\'une réputation de grande franchise. On ne les voit jamais rire sous cape car le rire est cousu dessus.', 137, 80, '11f#17#0#19#0d0+23,122#1e#0#1#0d0+30,11e#27#0#1#0d0+39,11e#1a#0#3#0d0+26');
INSERT INTO `website_shop_objects_templates` VALUES (8647, 17, 'Cape Wéra', 'Les Pandawas se servent de cette cape comme protection contre les intempéries et comme accessoire de danse. Ils la posent à terre, au centre d\'un cercle de danseurs éméchés. Puis, ils commencent leur chorégraphie improvisée sans que le pied touche le sol en dehors de la zone délimitée par ce vêtement.', 142, 80, '11b#2be#0#f#0d0+702,119#2b2#0#2#0d0+690,121#2b6#0#1#0d0+694,120#2b7#0#1#0d0+695');
INSERT INTO `website_shop_objects_templates` VALUES (8648, 17, 'Cape Hulco', 'La cape Hulco tire son origine du nom d\'un Crâ atypique. Celui-ci possédait un sens de l\'orientation très particulier. Il était capable de se perdre chez lui. Et pourtant ce n\'était pas bien grand ! Son problème résidait dans une déformation des fonctions du cerveau : pour lui, tous les lieux ressemblent une vaste plage, entourée de cocotiers, baignée par la lumière chaude d\'un soleil couchant.', 132, 80, '11f#b2#0#f#0d0+178,11b#a4#0#f#0d0+164,11d#a5#0#1#0d0+165,11e#a2#0#1#0d0+162');
INSERT INTO `website_shop_objects_templates` VALUES (8649, 17, 'Cape Hadosse', 'Les couleurs chaudes et réconfortantes de cette cape peuvent entraîner son porteur dans un voyage imaginaire, dans des contrées ensoleillées, pleines de canyons creusés par l\'érosion, et de décors rupestres taillées dans les roches et les falaises. C\'est extrêmement utile pour oublier le froid et la grisaille par temps de pluie.', 136, 80, '11f#6#0#1e#0d0+6,122#13#0#1#0d0+19,119#c#0#1#0d0+12,11d#b#0#1#0d0+11');
INSERT INTO `website_shop_objects_templates` VALUES (8650, 17, 'Cape Haharnum', 'Les Enutrofs ont pris l\'habitude de dessiner une carte sur leur cape, car ils vivent dans un tel foutoir qu\'il leur est difficile de retrouver le chemin des toilettes. Cela est très problématique, surtout lorsque l\'on est sujet à des envies aussi pressantes qu\'incontrôlables !', 135, 80, '11b#38#0#14#0d0+56,11b#30#0#14#0d0+48,11f#37#0#1e#0d0+55,119#29#0#4#0d0+41');
INSERT INTO `website_shop_objects_templates` VALUES (8651, 10, 'Sangle Hynère', 'Cette magnifique sangle ajoute du prestige à la tenue des Iops. Certains prétendent que la croix centrale peut se transformer en une arme amovible, lorsque l\'épée n\'est pas à portée de main. C\'est bien sûr une légende, car seuls les Srams seraient assez fourbes pour ce genre de pratique.', 116, 130, '119#94#0#3#0d0+148,119#96#0#3#0d0+150,119#97#0#3#0d0+151,11d#9f#0#1#0d0+159');
INSERT INTO `website_shop_objects_templates` VALUES (8652, 10, 'Ceinture Buhlent', 'Lorsqu\'un Ecaflip ne sait pas quoi faire, il dégaine son jeu de carte de sa ceinture et entame un solitaire. En combat, il se sert également de ses cartes en tant que projectiles. Il tire plus vite que son ombre et, après la victoire, il est toujours temps de faire une petite partie !', 117, 130, '119#6c#0#1#0d0+108,119#76#0#4#0d0+118,121#74#0#0#0d0+116,11d#77#0#1#0d0+119');
INSERT INTO `website_shop_objects_templates` VALUES (8653, 10, 'Sangle Glinglin', 'L\'origine du nom de cette ceinture provient du bruit particulier qu\'elle produit. L\'entrechoc des os ornant la sangle empêche les Srams, même invisibles, de passer inaperçus. Aussi, on peut les entendre dire : « Surprendre quelqu\'un avec la Sangle Glinglin ? Tu peux toujours attendre ! ».', 118, 130, '119#46#0#2#0d0+70,119#43#0#1#0d0+67,120#50#0#0#0d0+80,11d#4e#0#1#0d0+78');
INSERT INTO `website_shop_objects_templates` VALUES (8654, 10, 'Ceinture Lupine', 'Le tic-tac incessant du système d\'horlogerie de la Ceinture Lupine empêche les Xélors de s\'endormir lorsque les combats s\'éternisent. Il est donc vivement recommandé d\'enlever cette ceinture avant d\'aller se coucher.', 119, 130, '11f#64#0#1e#0d0+100,122#5d#0#1#0d0+93,119#5e#0#3#0d0+94,120#5d#0#0#0d0+93');
INSERT INTO `website_shop_objects_templates` VALUES (8655, 10, 'Sangle Holon', 'À défaut d\'enrayer les pleurs, la sangle Holon permet de transporter du matériel médical. Inutile de faire jouer les violons de l\'automne qui blessent les tympans d\'une langueur monotone. Les diverses potions utiles pour soigner les maux de gorge et autres affections ORL s\'y trouvent soigneusement rangées. En effet, un Eniripsa à la voix enrouée ne peut pas lancer correctement ses sorts. Lorsqu\'il est aphone, il est aussi utile qu\'une veste polaire en pleine canicule.', 120, 130, '11f#86#0#1e#0d0+134,11f#7e#0#23#0d0+126,11c#87#0#32#0d0+135,11d#8b#0#1#0d0+139');
INSERT INTO `website_shop_objects_templates` VALUES (8656, 10, 'Ceinture Luthe', 'Les raisons qui ont poussé les concepteurs de cet accessoire de mode à placer une tête de poupée près de l\'entrejambe restent mystérieuses. Bien des théories ont été avancées, mais chacun sait que tout ceci n\'est que du pipeau !', 121, 130, '11b#b8#0#a#0d0+184,119#be#0#3#0d0+190,11e#bc#0#1#0d0+188,11d#ba#0#2#0d0+186');
INSERT INTO `website_shop_objects_templates` VALUES (8657, 10, 'Sangle Hans', 'Guerriers d\'une ancienne tribu réputée pour son goût du sang, les Hans seraient les premiers adorateurs de la déesse Sacrieur. Sous son apparence inoffensive, cette ceinture est en réalité un instrument de torture sophistiqué.', 122, 130, '11c#1c1#0#f#0d0+449,11f#1c2#0#1e#0d0+450,11f#1be#0#1e#0d0+446,11d#1b5#0#1#0d0+437');
INSERT INTO `website_shop_objects_templates` VALUES (8658, 10, 'Ceinture Bodiézèle', 'Les Osamodas ont la réputation d\'être un peu impulsif. Ils ont tendance à démarrer au quart de tour. Cette ceinture aux multiples boucles leur sert à refréner cette spontanéité : « Avant d\'allumer ta colère, et d\'avoir les yeux injectés de sang, touche toutes les cornes de ta Ceinture Bodiézèle ! » ', 123, 130, '11b#21#0#14#0d0+33,11f#1d#0#19#0d0+29,11d#26#0#1#0d0+38,11d#1f#0#1#0d0+31');
INSERT INTO `website_shop_objects_templates` VALUES (8659, 10, 'Sangle Huée', 'Cette ceinture aide les Pandawas à se tenir à peu près droit lorsqu\'ils sont saouls, ce qui leur arrive souvent. Dans ces moments-là, ils ont tendance à se sentir englués au sol, alors que la gravité n\'a aucun rapport avec cette sensation de pesanteur. Elle est bien trop occupée à assommer les scientifiques à coup de pommes.', 124, 130, '11f#2bc#0#19#0d0+700,119#2b8#0#1#0d0+696,119#267#0#1#0d0+615,121#2b9#0#0#0d0+697');
INSERT INTO `website_shop_objects_templates` VALUES (8660, 10, 'Sangle Cible', 'Ce ceinturon permet à la fois de retenir les vêtements tombants (pour ne pas effrayer les âmes sensibles) et d\'offrir une mire pour les jeunes Crâ en phase d\'apprentissage. En effet, on leur apprend à ne jamais tirer en dessous de la ceinture, mais juste au milieu.', 125, 130, '11b#af#0#14#0d0+175,123#ae#0#1#0d0+174,120#b1#0#0#0d0+177,11d#a8#0#1#0d0+168');
INSERT INTO `website_shop_objects_templates` VALUES (8661, 10, 'Gaine Hage', 'Prévoyants, les Fécas conservent des provisions de survie dans une petite sacoche. Celles-ci se composent essentiellement de pain en pierre de Craqueboule. C\'est pourquoi cette nourriture dure si longtemps. La Ceinture Deucékurité arrime fermement la sacoche à la taille, car le choc lié à la chute de ce sac de nourriture fait encore trop de blessés graves, par négligence ou inconscience.', 126, 130, '11f#1#0#1e#0d0+1,119#d#0#1#0d0+13,119#8#0#1#0d0+8,11d#5#0#1#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (8662, 10, 'Ceinture Gessant', 'La Ceinture Gessant est un accessoire de mode très utile auprès les Enutrofs mâles. Grâce à la carte qui y est cousue, ils peuvent cacher certains accidents de parcours, lorsqu\'ils se sont perdus sur le chemin des toilettes.', 127, 130, '11f#2c#0#19#0d0+44,11f#3a#0#1e#0d0+58,119#39#0#6#0d0+57,11d#3b#0#1#0d0+59');
INSERT INTO `website_shop_objects_templates` VALUES (8663, 11, 'Bottes Antrin', 'Avec les bottes Antrin aux pieds, les Iops sont toujours les premiers à arriver sur le champ de bataille et à mettre de l\'ambiance. Il faut dire que cette classe de personnages adore amuser la galerie par ses exploits guerriers. Mais elle n\'est jamais prise au sérieux en raison de son intelligence inversement proportionnelle à sa force.', 100, 100, '80#1#0#0#0d0+1,11b#a0#0#1e#0d0+160,11f#95#0#2d#0d0+149,11e#93#0#1#0d0+147,11a#98#0#0#0d0+152');
INSERT INTO `website_shop_objects_templates` VALUES (8664, 11, 'Charentaises à poils', 'On dit que les Sadidas ne se sentent jamais seuls, car ils peuvent invoquer plein de poupées pour leur tenir compagnie. Vous aussi, vous ne souffrirez plus de solitude grâce à ces chaussures ! Non seulement vous pourrez prendre votre pied pour lui parler, mais en plus, grâce à ces charentaises à poils, personne ne pourra plus mettre votre jeu à nu. Une fois qu\'on les a enfilées, on se sent vraiment bien, même si on a un peu honte de sortir avec.', 105, 100, '80#1#0#0#0d0+1,11f#6e#0#1e#0d0+110,122#71#0#1#0d0+113,119#6a#0#4#0d0+106,11d#75#0#1#0d0+117');
INSERT INTO `website_shop_objects_templates` VALUES (8665, 11, 'Bottes Hox', 'Imprégnées d\'un produit repulpant à diffusion lente, ces bottes permettent d\'améliorer le galbe des jambes et de lutter contre le teint naturellement cadavérique des Srams. Cette crème a des effets spectaculaires sur la plastique des Srams femelles, mais semble totalement inefficace sur les mâles. Serait-ce un problème d\'hormone ?', 102, 100, '80#1#0#0#0d0+1,11b#3d#0#a#0d0+61,11f#44#0#1e#0d0+68,119#4c#0#1#0d0+76,120#4d#0#0#0d0+77');
INSERT INTO `website_shop_objects_templates` VALUES (8666, 11, 'Botte Hairo', 'Créées par un artiste Xélor, ces bottes devaient lui permettre de peindre plus rapidement. C\'est le cas ! En revanche, elles ont tendance à déformer la vision et plus précisément le sens des distances. Avec ces bottes, tout paraît plus rond. Appréciés par les Sadidas, les tableaux de ce Xélor ont contribué à rendre populaires les courbes généreuses des femmes un peu fortes.', 103, 100, '80#1#0#0#0d0+1,11f#5f#0#19#0d0+95,11f#60#0#19#0d0+96,119#52#0#3#0d0+82,11a#53#0#0#0d0+83');
INSERT INTO `website_shop_objects_templates` VALUES (8667, 11, 'Botte Ulisme', 'Grâce à ces mi-bottes, vous serez toujours protégés des toxines provenant du sol. On ne se méfie jamais assez des microbes et autres bestioles qui traînent. Selon certains observateurs, ces chaussures ressemblent plus à des pantoufles qu\'à des bottes. Pourtant, les Eniripsas les nomment bien ainsi. Est-ce à cause de leur petite taille qu\'ils voient les choses sous un angle si différent ?', 104, 100, '80#1#0#0#0d0+1,11c#7c#0#f#0d0+124,119#89#0#4#0d0+137,119#83#0#2#0d0+131,119#8a#0#2#0d0+138');
INSERT INTO `website_shop_objects_templates` VALUES (8668, 11, 'Bottes Hanik', 'L\'amour des plantes pousse les Sadidas à s\'équiper des seules chaussures à reconnaissance florale. Grâce à leur système de détection, elles permettent à son porteur d\'éviter d\'écraser les plantes rares. Par contre, elles ne vous empêchent pas de marcher sur des excréments divers et variés, si vous ne regardez pas où vous mettez les pieds.', 101, 100, '80#1#0#0#0d0+1,122#bf#0#1#0d0+191,119#c1#0#2#0d0+193,119#c6#0#2#0d0+198,119#c4#0#3#0d0+196');
INSERT INTO `website_shop_objects_templates` VALUES (8669, 11, 'Tong Aclou', 'Contrairement aux autres classes, les Sacrieurs aiment vivre avec une épine dans le pied plutôt que de l\'enlever du talon. La douleur leur rappelle qu\'ils sont vivants et leur donne la rage de massacrer leur ennemi. De plus les traces de sang laissées en chemin permettent aux Sacrieurs de ne jamais se perdre. Ils sont toujours capables de retourner sur leur pas, ce qui n\'aurait pas été le cas s\'ils avaient des chaussures de mauvaises qualité.', 106, 100, '80#1#0#0#0d0+1,11d#1af#0#1#0d0+431,11e#1bd#0#2#0d0+445,11e#1c0#0#2#0d0+448,11a#1ba#0#0#0d0+442');
INSERT INTO `website_shop_objects_templates` VALUES (8670, 11, 'Bottes Swana', 'Ces chaussures permettent aux Osamodas d\'arpenter de longues distances à travers les continents, même les plus reculés. À part ça, on ne sait pas très bien à quoi elles peuvent servir. Certains estiment qu\'il est possible d\'en faire des nids à Tofus ou d\'élégants vases pour mettre en valeur les fleurs des champs. Tout cela n\'est guère convaincant. Bref, les Bottes Swana sont essentiellement des chaussures.', 107, 100, '80#1#0#0#0d0+1,11f#1b#0#19#0d0+27,11c#19#0#1e#0d0+25,119#24#0#1#0d0+36,121#25#0#0#0d0+37');
INSERT INTO `website_shop_objects_templates` VALUES (8671, 24, 'Relique du Corailleur Magistral', 'Cette impressionnante relique vous permettra peut-être d\'oublier tous vos soucis.', 152, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8672, 24, 'Relique de Gourlo le Terrible', 'Cette impressionnante relique vous permettra peut-être d\'oublier tous vos soucis.', 153, 31, '');
INSERT INTO `website_shop_objects_templates` VALUES (8673, 24, 'Relique du Rasboul Majeur', 'Cette impressionnante relique vous permettra peut-être d\'oublier tous vos soucis.', 154, 61, '');
INSERT INTO `website_shop_objects_templates` VALUES (8674, 24, 'Relique du Tynril', 'Cette impressionnante relique vous permettra peut-être d\'oublier tous vos soucis.', 155, 101, '');
INSERT INTO `website_shop_objects_templates` VALUES (8675, 24, 'Relique du Kimbo', 'Cette impressionnante relique vous permettra peut-être d\'oublier tous vos soucis.', 156, 141, '');
INSERT INTO `website_shop_objects_templates` VALUES (8676, 6, 'Epée qui Pète', 'Vlad était tombé amoureux de cette magnifique épée. Il a participé à la plus terrible des courses de Dragokart afin de pouvoir enfin l\'acheter. Malheureusement, il n\'avait pas compris que cette épée renfermait une terrible malédiction...', 75, 95, '64#15#28#0#1d20+20,ae#12d#190#0#1d100+300,76#1f#2d#0#1d15+30,77#1f#2d#0#1d15+30,7d#1f#2d#0#1d15+30,b0#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (8677, 18, 'Ross', 'Ce magnifique Lapino est le familier préféré du célèbre Maître Noir Jack. Ne vous fiez pas à son apparence, il peut se montrer redoutable en combat. Ce familier ne mange que des Cawottes et des plantes.', 44, 1, '320#a#0#0#0d0+10,b2#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (8678, 16, 'Chapeau de Satanusse', 'Satanusse était jadis un patineur artistique traînant ses patins de Holiboul on Ice en patinoires de seconde zone. C\'est en tombant sur le coccyx qu\'il eut la vision qui allait changer sa vie : son destin était d\'être le conducteur de Dragokart le plus doué de sa génération ! Un petit choc provoque parfois un grand déclic.', 187, 36, '7e#b#3c#0#1d50+10,76#b#3c#0#1d50+10');
INSERT INTO `website_shop_objects_templates` VALUES (8679, 90, 'Fantôme Ross', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 46, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8680, 59, 'Ecaille poisseuse', 'Cette écaille poisseuse et glissante permettait à son propriétaire de ne pas se faire attraper facilement par les aventuriers qui ont décidé de pêcher avec les dents. Malheureusement pour lui, elle ne le protégeait pas du tout contre un bon coup d\'épée rouillée.', 626, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (8681, 59, 'Peau de Raul Mops', 'La vraie faiblesse du Raul Mops, c\'est qu\'il aime se badigeonner d\'eau, de vin, ou même de vinaigre. Mais il aime avant tout se rouler dans des pots en verre autour d\'un oignon. Encore une créature aux moeurs mystérieuses.', 627, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8682, 59, 'Peau de Mob l\'Eponge', 'Cette peau peut être utilisée des deux côtés, le premier est doux et permet de laver les surfaces fragiles, l\'autre côté est beaucoup plus rugueux, il permet par exemple de récurer les parties de son anatomie qui étaient restées inaccessibles.', 628, 10, '');
INSERT INTO `website_shop_objects_templates` VALUES (8683, 89, 'Cadeau Walk', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8684, 77, 'Certificat de Mise en Chanil : Ross', 'Ce certificat décrit les caractéristiques du familier Ross que vous avez placé au chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8685, 77, 'Certificat de Mise en Chanil : Bilby', 'Ce certificat décrit les caractéristiques du familier Bilby que vous avez placé au chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8686, 89, 'Cadeau Ross', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8687, 89, 'Cadeau Bilby', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8688, 27, 'Transformation Fantôme Ross', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8691, 24, 'Marque de victoire.', 'Vous avez vaincu le disciple aisément. Il vous a remis ce parchemin en attestant.', 253, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8692, 24, 'Formule de potion de transformation', 'Ce recueil contient les théories de divers alchimistes sur la possibilité de se transformer en Wabbit. Comme quoi ils n\'ont vraiment rien à faire.', 95, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8693, 18, 'Fëanor', 'Grâce à ce familier, n\'importe quelle personne du sexe opposé vous fera les yeux doux. Un conseil : évitez de triompher. Bien vite, vous vous apercevrez qu\'en réalité, votre prétendant(e) est hypnotisé(e) par Fëanor. N\'espérez pas en profiter : désormais votre soupirant(e) mange du Pichon cru en se frottant contre vos jambes... Côté glamour, on a connu mieux, pas vrai ? Ce familier ne mange que du poisson.', 45, 1, '8a#1#32#0#1d50+0,320#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (8694, 42, 'Piment confit', 'Ce piment confit est enrobé de bonbon rouge surpuissant fondu. Ce mélange explosif entre la confiserie et le piment a permis à la dragodinde Bruyère Blonde, de gagner une des plus célèbres courses de Dragokart. Vous pouvez l\'utiliser comme suppositoire si vous voulez avoir le feu aux fesses ou comme dragée si vous recherchez une haleine chargée.', 111, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8695, 6, 'L\'Épée Nice', 'Comme disait Brice : « Ce n\'est pas sa taille qui compte, mais la façon de s\'en servir. » ', 76, 177, 'd3#6#8#0#1d3+5,d5#6#8#0#1d3+5,d4#6#8#0#1d3+5,f0#6#a#0#1d5+5,f4#6#a#0#1d5+5,ae#c8#0#0#0d0+200,80#1#0#0#0d0+1,73#4#6#0#1d3+3,7d#65#96#0#1d50+100,77#1a#28#0#1d15+25,76#1f#32#0#1d20+30,64#10#1e#0#1d15+15');
INSERT INTO `website_shop_objects_templates` VALUES (8699, 16, 'Coiffe du Tynril', 'Avec cette coiffe sur le crâne, vous aurez toujours une tête en pétard, même si vous n\'êtes pas en colère. Il faut dire que les écorces de la chevelure du Tynril frisent lorsque le temps est humide, ce qui fait de cet animal l\'indicateur météorologique le plus sûr au monde. En revanche, il redoute le feu. Faites donc très attention aux flammes si vous ne voulez pas vous transformer en torche humaine.', 188, 164, '6f#1#0#0#0d0+1,7d#c9#fa#0#1d50+200,7c#1a#28#0#1d15+25,9b#b#1e#0#1d20+10,9a#b#1e#0#1d20+10,98#b#1e#0#1d20+10,9d#b#1e#0#1d20+10,b0#15#1e#0#1d10+20,f2#6#8#0#1d3+5,f1#6#8#0#1d3+5,f3#6#8#0#1d3+5,f4#6#8#0#1d3+5,f0#6#8#0#1d3+5');
INSERT INTO `website_shop_objects_templates` VALUES (8700, 16, 'Coquille Emeraude', 'Cette coiffe semble avoir été fabriquée à partir d\'un Dofus Emeraude brisé. Le Dofus n\'est pas encore complètement vide, vous pourrez profiter de cette coiffe pour vous faire un shampooing aux oeufs.', 189, 21, '6e#15#23#0#1d15+20');
INSERT INTO `website_shop_objects_templates` VALUES (8701, 6, 'Epée Choh', 'Cette somptueuse épée appartenait à un illustre voleur, réputé pour se faire attraper à chaque fois qu\'il commettait un délit.', 77, 95, '');
INSERT INTO `website_shop_objects_templates` VALUES (8704, 16, 'Le Nahitse', 'Si vous agitez vos deux petits grelots rapidement, vous pourrez presque jouer de la musique.', 190, 160, '7c#1f#32#0#1d20+30,77#29#3c#0#1d20+40,7e#29#3c#0#1d20+40,70#6#a#0#1d5+5,b0#b#f#0#1d5+10,f2#8#c#0#1d5+7,f3#8#c#0#1d5+7,d4#8#c#0#1d5+7,d5#8#c#0#1d5+7,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8706, 90, 'Fantôme Fëanor', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 48, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8707, 77, 'Certificat de Mise en Chanil : Fëanor', 'Ce certificat décrit les caractéristiques du Fëanor que vous avez placé au chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8708, 77, 'Certificat de Mise en Chanil : Atouin', 'Ce certificat décrit les caractéristiques d\'Atouin que vous avez placée au chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8709, 27, 'Transformation Fantôme Fëanor', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8711, 89, 'Cadeau Fëanor', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8712, 110, 'Bout de Goldemort', 'Bravo ! Vous avez réussi à dépouiller le cadavre de Goldemort d\'une cuillerée de sa substance. Les vautours sont fiers de vous.', 490, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8713, 11, 'Getas Bernacle', 'Dans certaines contrées, il semble que les Getas Bernacle sont lancées en guise d\'insulte pour provoquer les duels. Même si cela peut prêter à sourire, ce n\'est finalement pas plus stupide que de frapper l\'adversaire avec une paire de gants. L\'avantage des Getas Bernacle est d\'ajouter une commotion olfactive au coup physique. Les Pandawas n\'ont jamais été réputés pour l\'hygiène de leurs pieds...', 108, 100, '80#1#0#0#0d0+1,11f#2be#0#1e#0d0+702,11f#2b4#0#23#0d0+692,121#2b3#0#0#0d0+691,11d#2bd#0#1#0d0+701');
INSERT INTO `website_shop_objects_templates` VALUES (8714, 9, 'Anneau Bhli', 'Porter cet anneau est une marque honorifique. Cela signifie que vous êtes un digne fidèle de la déesse Crâ, la seule qui vous révèle comment bander plus vite afin de tirer efficacement.', 126, 150, '122#b3#0#1#0d0+179,11b#ad#0#f#0d0+173,11e#a6#0#2#0d0+166,11a#b4#0#0#0d0+180');
INSERT INTO `website_shop_objects_templates` VALUES (8715, 9, 'Bague Houx', 'La volubilité des Ecaflips est légendaire. Ils sont capables de vous sortir n\'importe quel baratin pour vous faire jouer. Cette bague célèbre cette loquacité sans faille. Accessoirement, elle peut servir de dé de rechange et elle est également très pratique pour se gratter... à peu près partout.', 127, 150, '11b#72#0#f#0d0+114,11f#70#0#14#0d0+112,11e#6f#0#1#0d0+111,11e#65#0#1#0d0+101');
INSERT INTO `website_shop_objects_templates` VALUES (8716, 9, 'Bague Héra', 'Les Osamodettes adorent la bague Héra qui complète leur démarche féline d\'une touche de grâce. Il faut dire qu\'à force de côtoyer les monstres, elles finissent parfois par se comporter en vraies tigresses. Mais en réalité, elles sont aussi dévouées que des mères louves.', 128, 150, '11f#15#0#14#0d0+21,119#23#0#2#0d0+35,119#28#0#1#0d0+40,11e#16#0#1#0d0+22');
INSERT INTO `website_shop_objects_templates` VALUES (8717, 9, 'Bague Harre', 'Les mauvaises langues prétendent que la bague Harre est l\'accessoire de mode le plus inutile au monde. Les ailes sur le côté sont fort embarrassantes quand vous voulez chercher des mouchoirs dans vos poches. Or, comme les Iops n\'ont ni mouchoir ni poche, tout va bien. De plus, elles permettent de déchiqueter un peu de chair à chaque fois qu\'elles frôlent l\'ennemi. C\'est à se demander si ce n\'est pas un bijou de Sacrieur.', 129, 150, '11f#92#0#19#0d0+146,11b#9e#0#19#0d0+158,121#9d#0#0#0d0+157,11d#99#0#1#0d0+153');
INSERT INTO `website_shop_objects_templates` VALUES (8718, 9, 'Anneau Tassion', 'Les mini boucliers de l\'anneau Tassion servent de pense-bête aux Fécas qui peuvent y glisser des petits mots et des listes de choses à faire. Ce bijou est surnommé le bouclier anti-oubli. En revanche, il ne protège ni du bégaiement ni des lapsus.', 130, 150, '11f#12#0#1e#0d0+18,119#a#0#1#0d0+10,119#10#0#3#0d0+16,11d#7#0#1#0d0+7');
INSERT INTO `website_shop_objects_templates` VALUES (8719, 9, 'Anneau Stalgik', 'Grâce à cet objet, les Enutrofs peuvent à tout moment se remémorer les instants heureux. Un doux parfum s\'en échappe. Il suffit pour cela de retirer la pelle qui y est fichée. Au préalable, il faut bien sûr y mettre l\'odeur que l\'on veut conserver en souvenir, et ce n\'est pas toujours facile.', 131, 150, '11f#2b#0#14#0d0+43,119#32#0#1#0d0+50,11d#34#0#1#0d0+52,11e#2d#0#1#0d0+45');
INSERT INTO `website_shop_objects_templates` VALUES (8720, 9, 'Anneau Zamour', 'Cet objet a été donné par la déesse Eniripsa à ses fidèles en signe d\'alliance spirituelle lors de la séance d\'initiation aux sorts de la classe. Accessoirement, les Eniripsas peuvent aussi s\'en servir comme bracelet mousse pour éponger le sang des alliés.', 132, 150, '11f#79#0#14#0d0+121,119#81#0#2#0d0+129,120#8c#0#0#0d0+140,11d#85#0#1#0d0+133');
INSERT INTO `website_shop_objects_templates` VALUES (8721, 9, 'Anneau Raille', 'Ce bijou a tendance à rendre les Pandawas un peu moqueurs, surtout après la troisième bière. Ils peuvent même aller jusqu\'aux insultes. Mais ce n\'est pas très important car, comme le dit le célèbre proverbe Pandawa, « Ventre imbibé n\'a pas d\'oreille ».', 133, 150, '11f#2bf#0#1e#0d0+703,121#2c0#0#0#0d0+704,121#2b0#0#0#0d0+688,11e#2c1#0#3#0d0+705');
INSERT INTO `website_shop_objects_templates` VALUES (8722, 9, 'Anneau Hell', 'Ce bijou à tête de mort était traditionnellement offert en cadeau, lors d\'une fête récompensant tous les enfants Sram pour leur fourberie et leurs coups bas. Les autres classes ont tendance à déconsidérer cette pratique, qui rend les gamins trop agités. Ils deviennent alors infernaux.', 134, 150, '119#4a#0#1#0d0+74,11d#45#0#1#0d0+69,11d#47#0#1#0d0+71,11e#4b#0#1#0d0+75');
INSERT INTO `website_shop_objects_templates` VALUES (8723, 9, 'Anneau Tilus', 'L\'anneau Tilus est le seul bijou qui donne l\'heure et qui est parfaitement résistant à l\'eau. Certains pensent qu\'en agrandissant les plans de cet objet et en les modifiant, on pourrait en faire un véhicule se déplaçant sous l\'eau. Où peuvent-ils aller chercher tout cela ?', 135, 150, '11b#53#0#f#0d0+83,119#61#0#3#0d0+97,124#b#0#a#0d0+11,11e#59#0#1#0d0+89');
INSERT INTO `website_shop_objects_templates` VALUES (8724, 9, 'Anneau Pwal', 'Contrairement à la rumeur, les Sadidas n\'ont pas de poils dans la main. Non ! Ceux-ci sont en fait ajustés autour d\'un superbe anneau, dont ils renforcent les effets bénéfiques : ils ne doivent en aucun cas être coupés. Grâce à l\'Anneau Pwal, vous serez toujours parfait !', 136, 150, '11f#c2#0#1e#0d0+194,120#b9#0#0#0d0+185,11e#bb#0#1#0d0+187,11e#c7#0#3#0d0+199');
INSERT INTO `website_shop_objects_templates` VALUES (8725, 9, 'Anneau Pitale', 'Si vous voyez un personnage qui n\'est pas Sacrieur mettre un Anneau Pitale, emmenez-le d\'urgence en soins intensif. Ce bijou est en effet extrêmement blessant. En général, les gens perdent leur sang-froid devant le bain d\'hémoglobine provoqué par cet anneau.', 137, 150, '119#1bc#0#3#0d0+444,119#1b0#0#2#0d0+432,119#1b6#0#4#0d0+438,11d#1bb#0#1#0d0+443');
INSERT INTO `website_shop_objects_templates` VALUES (8726, 11, 'Chaussures Lepon-Davignon', 'Ces chaussures permettent à son porteur de danser jusqu\'au bout de la nuit, malgré les cors et les ampoules qu\'elles occasionnent ! Elles bougent toutes seules au bruit de la musique et font des « bip bip » lorsqu\'elles se trouvent à proximité de minerais précieux. C\'est pourquoi les Enutrofs sont souvent appelés les « beat-machines ».', 109, 100, '80#1#0#0#0d0+1,11b#33#0#a#0d0+51,11f#2e#0#19#0d0+46,11d#36#0#1#0d0+54,11d#3c#0#2#0d0+60');
INSERT INTO `website_shop_objects_templates` VALUES (8727, 11, 'Bottes Antouche', 'Lorsque les Fécas sont embarrassés et souhaitent détourner la discussion, ils évoquent toujours leurs bottes Antouche. Ils décrivent de quelle manière ces chaussures leur permettent d\'arpenter tous types de terrains. Lorsque leurs alliés sont en grosse difficulté lors de combats, le confort de ces bottes leur permet de se ressaisir pour détourner la menace.', 110, 100, '80#1#0#0#0d0+1,11f#e#0#1e#0d0+14,121#f#0#0#0d0+15,120#9#0#0#0d0+9,11a#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (8728, 11, 'Bottes Deuradi', 'Les multiples sangles entourant ces chaussures peuvent servir de corde de remplacement, lorsque celle de l\'arc est rompue. Les jeunes femmes Crâ les emploient aussi pour faire des bottes de légumes en cuisine. Il faut croire qu\'elles n\'ont pas peur des odeurs de pieds.', 111, 100, '80#1#0#0#0d0+1,11f#a9#0#1e#0d0+169,11f#a1#0#1e#0d0+161,123#ab#0#1#0d0+171,11d#b0#0#1#0d0+176');
INSERT INTO `website_shop_objects_templates` VALUES (8729, 51, 'Corail usé ', 'Se détachant du Corailleur par temps sec, le corail est bien joli à voir. Certains en font même des bijoux. D\'autres les mangent. Mais ils sont rares et ne le font que lorsqu\'ils le confondent avec des bâtons de crabes sourimis.', 2, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8730, 47, 'Coccyx du Corailleur', 'Situé à un endroit stratégique, cet os permet au Corailleur de s\'installer dignement. Maintenant qu\'il est mort, vous pouvez toujours vous en servir pour asseoir votre autorité sur ses congénères.', 12, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8731, 51, 'Corail Magistral', 'La seule différence entre le Corail usé et le Corail Magistral réside dans la taille et dans l\'usage que l\'on peut en faire. Mais, hélas, un amalgame de Coraux usés ne remplacera jamais un seul Corail Magistral.', 9, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (8732, 51, 'Corail Kouraçao', 'La couleur remarquable de ce corail vient de l\'alimentation déréglée du Crustorail. Encore un qui a oublié de manger son quota de fruits et légumes !', 3, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8733, 51, 'Corail Malibout', 'La couleur remarquable de ce corail vient de l\'alimentation déréglée du Crustorail. Encore un qui a oublié de manger son quota de fruits et légumes !', 4, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8734, 51, 'Corail Passaoh', 'La couleur remarquable de ce corail vient de l\'alimentation déréglée du Crustorail. Encore un qui a oublié de manger son quota de fruits et légumes !', 5, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8735, 51, 'Corail Morito', 'La couleur remarquable de ce corail vient de l\'alimentation déréglée du Crustorail. Encore un qui a oublié de manger son quota de fruits et légumes !', 6, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8736, 51, 'Coeur de pierre poli', 'La seule chose qui distingue un cœur de Craqueleur de celui d\'un Craqueleur poli est la délicatesse avec laquelle l\'objet peut s\'écraser sur vos doigts de pieds quand vous vous y attendez le moins.', 7, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8737, 51, 'Boule polie', 'De quelle partie de l\'anatomie du Craqueboule peut bien venir cette boule ? Et pourquoi est-ce qu\'on en retrouve souvent par paire ?', 8, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8738, 47, 'Sacrum magistral', 'Le Corailleur vous offrait un os de son postérieur. Le Corailleur Magistral vous permet de prendre possession d\'une autre partie de son anatomie, mais à peu près dans le même secteur.', 11, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (8739, 47, 'Humérus du Sparo', 'Bien qu\'on le nomme Humérus, rien n\'indique que cet os vient vraiment du bras de Sparo. Comme tout son squelette a été broyé par les épées transperçant le tonneau, alors tout est un peu en miettes.', 18, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8740, 47, 'Chicot du Flib', 'À votre place, je ne ramasserai pas cet objet provenant d\'une bouche à l\'hygiène plus que douteuse. Mais bon, c\'est vous l\'aventurier !', 19, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8741, 47, 'Bec du Kido', 'Le bec du Kido est si peu solide que les disciples d\'Otomaï s\'en servaient pour faire des flèches d\'entraînement à la pointe émoussée pour ne pas faire de dégâts.', 22, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8744, 47, 'Pince de Crustorail', 'Évitez de serrer la pince du Crustorail ! Vous risquez de perdre la main pour un simple geste de politesse.', 17, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8745, 35, 'Pétale Kouraçao', 'La couleur de ce pétale témoigne de sa provenance douteuse. L\'abus d\'alcool chez les disciples d\'Otomaï se perçoit même dans leurs créations.', 3, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8746, 35, 'Pétale Malibout', 'La couleur de ce pétale témoigne de sa provenance douteuse. L\'abus d\'alcool chez les disciples d\'Otomaï se perçoit même dans leurs créations.', 5, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8747, 35, 'Pétale Passaoh', 'La couleur de ce pétale témoigne de sa provenance douteuse. L\'abus d\'alcool chez les disciples d\'Otomaï se perçoit même dans leurs créations.', 4, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8748, 35, 'Pétale Morito', 'La couleur de ce pétale témoigne de sa provenance douteuse. L\'abus d\'alcool chez les disciples d\'Otomaï se perçoit même dans leurs créations.', 6, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8749, 36, 'Bulbe Kouraçao', 'Le Palmifleur ne naît pas d\'une graine mais d\'un bulbe que l\'on trempe dans l\'alcool. Pourquoi ? Parce que !', 3, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8750, 36, 'Bulbe Malibout', 'Le Palmifleur ne naît pas d\'une graine mais d\'un bulbe que l\'on trempe dans l\'alcool. Pourquoi ? Parce que !', 6, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8751, 36, 'Bulbe Passaoh', 'Le Palmifleur ne naît pas d\'une graine mais d\'un bulbe que l\'on trempe dans l\'alcool. Pourquoi ? Parce que !', 4, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8752, 36, 'Bulbe Morito', 'Le Palmifleur ne naît pas d\'une graine mais d\'un bulbe que l\'on trempe dans l\'alcool. Pourquoi ? Parce que !', 5, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (8753, 36, 'Crinière fleurie', 'Hybridation improbable entre des poils et des pétales de fleurs, cette crinière est doublement allergène. Veillez à rester à distance si vous êtes sensibles à ces deux éléments sous peine d\'expulser votre cerveau en éternuant.', 2, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8754, 54, 'Barbe inexistante du Barbroussa', 'Cette minuscule touffe de poils vous rappellera les vacances grâce à son odeur de sable, de produits solaires et d\'alcool. Dommage qu\'elle pue autant la poudre !', 10, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8755, 54, 'Touffe rousse du Flib', 'On n\'a jamais su si la couleur de cette touffe était naturelle ou si elle était liée à un feu de broussaille intempestif.', 11, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8756, 54, 'Duvet du Kilibriss', 'En raison de sa légèreté, le duvet du Kilibris est très recherché pour la confection de matelas. C\'est pourquoi, en attendant la création d\'une espèce de matelas vivants que l\'on peut tuer lors de safari, les artisans chassent activement le Kilibris.', 12, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8757, 15, 'Maillot de corps de Barbroussa', 'Besoin d\'un répulsif contre les insectes ? Adoptez le Maillot de corps de Barbroussa ! Mais renoncez aussi à toute tentative de fréquentation humaine !', 11, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8758, 15, 'Morceau de caleçon de Gourlo', 'Il n\'a jamais été possible de retrouver un caleçon de Gourlo intact. À force de jouer avec la poudre, il en vient toujours à y mettre le feu.', 12, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8759, 15, 'Coffret maudit du Flib', 'Ce coffre a pris les formes de Flib, à moins que ce ne soit l\'inverse... Dans tous les cas, ça reste un coffre maudit.', 13, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8760, 15, 'Foulard du Sparo', 'Accessoire de mode indispensable été comme hiver, ce foulard vous donnera un look original, mais un peu kitsch. Grâce à sa couleur éclatante, vous êtes sûr d\'exciter les bouftous mâles. Mais est-ce là votre intention ?', 14, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8761, 48, 'Poudre explosive de Gourlo', 'À défaut de se greffer un canon à la place du bras, Gourlo ne sort jamais sans son arme. Mais il n\'est pas capable de tirer son coup très vite, car il lui faut à chaque fois faire sécher sa poudre, signe de sa mauvaise qualité.', 1, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8762, 50, 'Fragment de cerveau poli', 'Grâce à ce fragment de cerveau, vous allez enfin apprendre les bonnes manières à la façon des Craqueleurs : broyage de main en guise de bonjour.', 3, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8763, 15, 'Moustache du Mufafah', 'Plus fournie que celle des poissons chatons, la moustache du Mufafah peut servir à faire des pinceaux pour le peintre Marylork.', 15, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8764, 15, 'Sourcil du Rasboul majeur', 'Afin de prouver qu\'il est bien le Boss, le Rasboul majeur garde toujours les sourcils froncés. Même après la mort, ils le restent.', 16, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8765, 15, 'Bâton du Kilibriss', 'Grâce à sa longueur, ce bâton va vous permettre d\'atteindre tous les endroits difficiles d\'accès et de vous gratter partout.', 17, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8766, 53, 'Plume de fesse du Kido', 'Cette ressource a servi à créer l\'une des plus grandes énigmes d\'Otomaï : qu\'est-ce qui est le plus lourd ? cent pods de plumes du Kido ou cent pods de Pyrute ?', 5, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8767, 104, 'Aile du Bitouf des plaines', 'Le Bitouf n\'a jamais été connu pour ses performances en vol. Vu les ailes qu\'il a, c\'est normal.', 1, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8768, 106, 'Oreille déchirée de Pumbaa', 'En collant cette oreille à la vôtre, vous pourrez entendre le galop du sanglier des plaines à la place du bruit de la mer.', 1, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8769, 111, 'Coco du Bitouf des plaines', 'Dans ce Coco du Bitouf, il n\'y a pas de lait, mais du jus de cerveau et parfois quelques neurones flottant en surface.', 1, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8770, 96, 'Ecorce du Tynril', 'Cette écorce est curieusement recourbée, comme si on l\'avait obtenue par le biais d\'une râpe.', 1, 500, '');
INSERT INTO `website_shop_objects_templates` VALUES (8771, 96, 'Ecorce de Floribonde', 'Cette écorce est curieusement recourbée, comme si on l\'avait obtenue par le biais d\'une râpe.', 2, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (8772, 96, 'Ecorce de Brouture', 'Cette écorce est curieusement recourbée, comme si on l\'avait obtenue par le biais d\'une râpe.', 5, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (8773, 96, 'Ecorce de Nerbe', 'Cette écorce est curieusement recourbée, comme si on l\'avait obtenue par le biais d\'une râpe.', 3, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8774, 96, 'Ecorce de Fécorce', 'Cette écorce est curieusement recourbée, comme si on l\'avait obtenue par le biais d\'une râpe.', 6, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8775, 96, 'Ecorce de Chiendent', 'Cette écorce est curieusement recourbée, comme si on l\'avait obtenue par le biais d\'une râpe.', 4, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8776, 111, 'Coco du Bitouf sombre', 'Dans ce Coco du Bitouf, il n\'y a pas de lait, mais du jus de cerveau et parfois quelques neurones flottant en surface.', 2, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (8777, 36, 'Pistil du Tynril', 'Les fleurs correspondent aux organes sexuels des plantes. Le pistil faisant partie de la fleur, à vous d\'en déduire ce que vous voulez.', 7, 500, '');
INSERT INTO `website_shop_objects_templates` VALUES (8778, 36, 'Etamine de Floribonde', 'Une étamine est l\'organe mâle de la reproduction sexuée chez les végétaux. Eh oui, malgré les apparences, Floribonde serait de sexe masculin.', 8, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8779, 36, 'Carpelle de Brouture', 'Les fleurs correspondent aux organes sexuels des plantes. Le pistil faisant partie de la fleur, et la carpelle étant un élément du pistil, à vous d\'en déduire ce que vous voulez.', 9, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8780, 36, 'Sépale de Nerbe', 'Cette partie du corps de Nerbe reste toujours verte. Est-ce dû à l\'excès de chlorophylle ou à autre chose ?', 10, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8781, 36, 'Calice de Fécorce', 'Ce n\'est pas en utilisant le calice de Fécorce que vous arriverez à boire quoi que ce soit. Malgré sa forme en coupe, elle est percée.', 12, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8782, 36, 'Bractée de Chiendent', 'La Bractée de Chiendent correspond à une zone que la morale nous interdit de nommer.', 11, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8783, 15, 'Amygdales du Bitouf Sombre', 'Une fois qu\'on lui a retiré les amygdales, le Bitouf sombre a moins les boules. C\'est normal, en général l\'opération conduit à sa mort.', 18, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8784, 15, 'Talon d\'achille de l\'Abrakleur sombre', 'Ce n\'est pas en tirant une flèche dans son talon d\'Achille que vous vaincrez l\'Abrakleur sombre. Mais vous pouvez toujours essayer.', 19, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8785, 58, 'Graine de l\'Abrakleur sombre', 'Avec beaucoup de patience, de temps, d\'eau et d\'engrais, vous parviendrez à faire pousser un Abrakleur dans votre jardin pour le combattre en guise d\'entraînement. Mais il est plus simple d\'aller les décimer sur l\'île d\'Otomaï ', 1, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8786, 15, 'Tresse du Poolay', 'Cette tignasse rêche et épaisse peut servir de serpillère à défaut de cacher la calvitie. Mais il faudra auparavant la laver à de nombreuses reprises', 20, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8787, 15, 'Cloaque du Poolay', 'Non ce n\'est pas répugnant, c\'est la nature !', 21, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8788, 15, 'Croupion du Bitouf aérien', 'Ce croupion vous permettra de créer des objets pour ne plus avoir le cul à l\'air.', 22, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8789, 15, 'Chaussette du Kimbo', 'Malgré les apparences, Kimbo porte bien des chaussettes, mais pas aux pieds. Il préfère les rouler en boule et les placer à un endroit stratégique.', 23, 500, '');
INSERT INTO `website_shop_objects_templates` VALUES (8790, 15, 'Rembourrage de Meupette', 'La Nature ayant modestement pourvu la Meupette, celle-ci doit user d\'artifice pour paraître esthétique. Il arrive qu\'elle s\'en serve aussi pour améliorer le moelleux de son lit.', 24, 110, '');
INSERT INTO `website_shop_objects_templates` VALUES (8791, 55, 'Etoffe de Meupette', 'Cette étoffe a une texture bizarre mais elle habille en un rien de temps n\'importe quel monstre un peu pudique.', 16, 110, '');
INSERT INTO `website_shop_objects_templates` VALUES (8792, 111, 'Coco du Bitouf aérien', 'Dans ce Coco du Bitouf, il n\'y a pas de lait, mais du jus de cerveau et parfois quelques neurones flottant en surface.', 3, 110, '');
INSERT INTO `website_shop_objects_templates` VALUES (8793, 111, 'Coquille du Kaskargo', 'Ronde et luisante à la fois, cette coquille a été lustrée avec de la bave pendant plusieurs siècles. Chacun son truc.', 4, 110, '');
INSERT INTO `website_shop_objects_templates` VALUES (8795, 54, 'Perruque du Kimbo', 'Pour masquer sa calvitie naissante, Kimbo met cette perruque ridicule. Heureusement que la noix de coco la cache en grande partie.', 13, 500, '');
INSERT INTO `website_shop_objects_templates` VALUES (8796, 38, 'Noeud de l\'Abrakleur clair', 'C\'est à cause de cette ressource que beaucoup de personnes surnomment l\'Abrakleur « tête de nœud ».', 2, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (8797, 38, 'Souche de l\'Abrakleur clair', 'Une souche différente des autres souches. Et pourtant elle tourne !', 3, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (8798, 65, 'Queue emplumée du Rasboul Majeur', 'Les plumes du Rasboul sont collées sur son appendice caudale, une à une, année après année. Plus la queue est touffue, plus le Rasboul est vieux.', 1, 500, '');
INSERT INTO `website_shop_objects_templates` VALUES (8799, 54, 'Poil d\'aisselle de Pumbaa', 'Même s\'il se les rase souvent, ses poils repoussent drus et gardent constamment une odeur rance. Comme quoi ce n\'est pas la sueur qui est en cause.', 14, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8800, 55, 'Etoffe Zoth', 'Faite dans une matière à la fois résistante et souple, cette étoffe s\'adapte parfaitement à la silhouette des Zoths pour en cacher l\'essentiel.', 17, 110, '');
INSERT INTO `website_shop_objects_templates` VALUES (8801, 55, 'Etoffe de Ouassingue', 'Cette étoffe comporte plus de trous qu\'un gruyère, mais elle est pourtant capable d\'absorber un maximum de déchets pour les régurgiter au moment le moins opportun.', 18, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8802, 47, 'Tibia du Guerrier Zoth', 'Comme tous autres os du Guerrier Zoth, ce tibia a subi de multiples fractures. Il s\'est parfaitement ressoudé et il est devenu plus solide. Comme quoi, s\'il avait eu le don de la parole, lui aussi aurait pu dire : « Ce qui ne me tue pas, me rend plus fort ».', 20, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (8803, 47, 'Rotule du Disciple Zoth', 'À force de donner des coups de genou, la rotule du Disciple Zoth est devenu très résistante et a pris du volume.  Bientôt, il sera possible d\'en faire des boules de pétanque.', 21, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (8804, 15, 'Braguette du Maître Zoth', 'La braguette du Maître Zoth est remarquable, elle a été spécialement étudiée pour ne pas déchirer les chaires. Les aventuriers qui ont été un jour traumatisés par leur braguette comprendront.', 25, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (8805, 15, 'Mouchoir de la Gamine Zoth', 'La Gamine Zoth ne se sert pas de ce mouchoir pour faire des adieux larmoyants, mais pour essuyer le sang de ses ennemis.', 27, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (8806, 15, 'Ecusson du Sergent Zoth', 'Donné par sa mère et brodé sur une étoffe, cet écusson est un cuisant souvenir d\'enfance avant d\'être un insigne militaire.', 757, 120, '');
INSERT INTO `website_shop_objects_templates` VALUES (8807, 15, 'Jus de Ouassingue', 'À moins d\'être totalement saoul, impossible de confondre le jus de Ouassingue avec un quelconque liquide potable. L\'odeur nauséabonde dissuaderait même un aveugle d\'en prendre une gorgée.', 758, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8808, 55, 'Etoffe du Roissingue', 'Cette étoffe comporte plus de trous qu\'un gruyère, mais elle est pourtant capable d\'absorber un maximum de déchets. Là où cette étoffe passe, la crasse trépasse.', 19, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8809, 15, 'Culotte à l\'envers du Roissingue', 'Depuis l\'habitude prise par le Roissingue Dagobert, tous les Roissingues portent la culotte à l\'envers. L\'important est que cette pratique ne leur retourne pas l\'estomac.', 759, 200, '');
INSERT INTO `website_shop_objects_templates` VALUES (8810, 15, 'Tourbe séchée de Tourbassingue', 'Faite à partir de végétaux en décomposition, cette tourbe possède un pouvoir absorbant étonnant. Les Mama Bworks s\'en servent pour régler un problème mensuel.', 760, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8811, 15, 'Faux menton du Bourbassingue', 'Le Bourbassingue passe beaucoup de temps à prendre des bains de boue en espérant maigrir. Au lieu de perdre du poids, il a juste gagné un double menton pour harmoniser sa silhouette.', 761, 80, '');
INSERT INTO `website_shop_objects_templates` VALUES (8812, 15, 'Encre du Kralamoure géant', 'Visqueuse et bien couvrante, l\'encre du Kralamoure peut servir à l\'écriture comme à la peinture des murs d\'une chambre de dépressif.', 762, 999, '');
INSERT INTO `website_shop_objects_templates` VALUES (8813, 15, 'Ventouse du Kralamoure géant', 'Vu la taille de cette ventouse, nul doute que l\'adhérence doit être bonne et, quand on la retire, le bruit de succion est tonitruant.', 763, 999, '');
INSERT INTO `website_shop_objects_templates` VALUES (8814, 100, 'Bourse de 5000 Kamas', 'Cette bourse est très lourde, elle contient sûrement une vraie fortune.', 56, 1, 'c2#1388#0#0#0d0+5000');
INSERT INTO `website_shop_objects_templates` VALUES (8815, 100, 'Bourse de 1000 Kamas', 'Cette bourse est très lourde, elle contient sûrement une vraie fortune. Un marchand sera ravi de vous l\'échanger contre sa valeur en Kamas.', 56, 1, 'c2#3e8#0#0#0d0+1000');
INSERT INTO `website_shop_objects_templates` VALUES (8816, 89, 'Cadeau Epée qui Pète', 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8817, 89, 'Cadeau Chapeau Satanusse', 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8818, 17, 'Cape Souveraine du Roissingue', 'Constituée d\'une étoffe de Roissingue, cette cape comporte des micro trous permettant une meilleure évacuation de la sueur en cas d\'effort intense, comme lors de mêlées belliqueuses en zone marécageuse. Cette cape laisse passer l\'humidité mais garde la chaleur. Ainsi, vous restez sec quelle que soit la situation. Dommage que l\'odeur persistante de moisissure soit inaltérable.', 143, 152, '7d#97#c8#0#1d50+150,7c#1a#28#0#1d15+25,7e#1a#28#0#1d15+25,7b#29#3c#0#1d20+40,77#29#3c#0#1d20+40,73#1#0#0#0d0+1,70#5#7#0#1d3+4,b0#b#f#0#1d5+10,f1#6#a#0#1d5+5,d6#6#a#0#1d5+5,d5#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8819, 17, 'Cape de la Ouassingue', 'Moins performante que la Cape du Roissingue, cette cape présente néanmoins les mêmes avantages quant à l\'évacuation de la sueur. Avec elle, vous allez pouvoir faire face à toutes les situations... Si vous arrivez à combattre en apnée, car vu l\'odeur, il est vraiment impossible de ne pas défaillir.', 144, 97, '7d#33#50#0#1d30+50,7c#15#1e#0#1d10+20,7e#1a#28#0#1d15+25,77#10#19#0#1d10+15,8a#6#a#0#1d5+5,b6#1#0#0#0d0+1,af#65#c8#0#1d100+100,b0#b#f#0#1d5+10,f4#6#a#0#1d5+5,f0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8820, 16, 'Masque du Sergent Zoth', 'Grâce à ce masque, vous affronterez tous les dangers sans aucune crainte ! C\'est normal vu qu\'il obs1 tout le champ de vision.', 191, 133, '7d#97#c8#0#1d50+150,7c#b#14#0#1d10+10,7b#29#3c#0#1d20+40,73#4#5#0#1d2+3,70#5#7#0#1d3+4,ae#c9#190#0#1d200+200,b0#b#14#0#1d10+10,db#6#a#0#1d5+5,d3#6#a#0#1d5+5,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8821, 16, 'Coiffe du Disciple Zoth', 'De loin, cette coiffe ressemble à un abat-jour avec deux trous pour les yeux. De près, aussi.', 192, 128, '7d#c9#12c#0#1d100+200,7c#10#19#0#1d10+15,7e#1f#32#0#1d20+30,9a#15#1e#0#1d10+20,70#4#6#0#1d3+3,75#1#0#0#0d0+1,b0#b#f#0#1d5+10,d9#6#a#0#1d5+5,d5#6#a#0#1d5+5,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8822, 16, 'Masque de l\'Abrakleur clair', 'Ce masque ne permet ni de prévenir ni de guérir la gueule de bois, mais il vous donne au moins l\'occasion de la dissimuler de façon élégante.', 193, 134, '76#1a#28#0#1d15+25,77#1a#28#0#1d15+25,7c#15#1e#0#1d10+20,7d#97#c8#0#1d50+150,70#6#8#0#1d3+5,b0#b#f#0#1d5+10,8a#b#f#0#1d5+10,d4#6#a#0#1d5+5,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8823, 16, 'Masque de l\'Abrakleur sombre', 'Ce masque ne permet ni de prévenir ni de guérir la gueule de bois, mais il vous permet au moins de la dissimuler de façon élégante. La nuance sombre indique juste que vous êtes de mauvaise humeur et qu\'il ne faut pas vous chauffer longtemps pour que vous lanciez à tout le monde une volée de bois vert.', 194, 95, '76#1a#28#0#1d15+25,7e#1a#28#0#1d15+25,7d#33#50#0#1d30+50,7c#10#19#0#1d10+15,70#4#5#0#1d2+3,b0#6#a#0#1d5+5,d3#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8824, 16, 'Kaskargo', 'Avec ça sur le crâne, vous aurez l\'air d\'un Kaskargo. Certes vous serez protégé des coups à la tête, mais est-ce une raison pour baver ainsi ? Vous n\'avez pourtant pas besoin de ça pour vous déplacer !', 195, 123, '76#1f#32#0#1d20+30,7c#1a#28#0#1d15+25,7d#97#c8#0#1d50+150,70#3#4#0#1d2+2,f1#6#a#0#1d5+5,f0#6#a#0#1d5+5,d4#6#a#0#1d5+5,d5#6#a#0#1d5+5,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8825, 7, 'Masse du Corailleur Magistral', 'Plus grande, plus lourde, plus puissante, cette masse s\'abat plus bruyamment sur les ennemis. Mais curieusement, elle est plus légère et d\'une prise en main plus agréable. Le Corailleur dont on s\'est servi pour la confectionner n\'était pas magistral pour rien.', 63, 125, '5d#1#8#0#1d8+0,5b#1#8#0#1d8+0,64#15#23#0#1d15+20,77#1f#32#0#1d20+30,7b#1f#32#0#1d20+30,7d#33#50#0#1d30+50,7c#15#1e#0#1d10+20,70#4#5#0#1d2+3,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (8826, 7, 'Marteau de la Gamine Zoth', 'Malgré sa petite taille, la Gamine Zoth arbore un immense marteau. C\'est une façon comme une autre de renforcer la musculature. Pas besoin de mettre des poids aux pieds ou aux poignets pour augmenter la force : traîner le marteau est bien suffisant !', 64, 132, '62#b#12#0#1d8+10,64#b#12#0#1d8+10,77#1f#32#0#1d20+30,7c#1a#28#0#1d15+25,7d#5b#78#0#1d30+90,70#6#a#0#1d5+5,75#1#0#0#0d0+1,b0#b#f#0#1d5+10,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8827, 19, 'Hache du Guerrier Zoth', 'Le Guerrier Zoth a pris l\'habitude de porter deux haches, car il est incapable de toucher le flanc gauche de son ennemi avec sa main droite. Problème de schéma corporel ou maladresse congénitale ? Difficile de se prononcer là-dessus. Mais avec ses deux haches, il fait feu de tout bois à défaut de s\'en servir pour couper des rondins.', 47, 139, '64#7#d#0#1d7+6,63#7#d#0#1d7+6,60#7#d#0#1d7+6,62#7#d#0#1d7+6,6f#1#0#0#0d0+1,7d#fb#12c#0#1d50+250,7c#1a#23#0#1d10+25,b0#b#f#0#1d5+10,70#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (8828, 16, 'Perruque du Poolay', 'Le Poolay est un volatile malhabile qui a autant de vivacité qu\'une poule atteinte de grippe aviaire et une intelligence comparable à celle du Tofu. Autant dire qu\'il était mal parti pour survivre. Pourtant certains semblent adorer sa curieuse chevelure évoquant une serpillère tressée en nattes par une ménagère teutonne. La nature humaine est décidément bien étrange.', 196, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8829, 16, 'Chapeau de Barbroussa', 'Ce chapeau était suffisamment large pour dissimuler la tête et la barbe ridiculement peu fournie de Barbroussa. Mais il n\'est pas capable de couvrir le crâne de quelqu\'un ayant la grosse tête.', 197, 79, '77#1f#32#0#1d20+30,7c#b#14#0#1d10+10,73#4#5#0#1d2+3,75#1#0#0#0d0+1,ae#c9#12c#0#1d100+200,f0#4#6#0#1d3+3,d2#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8832, 15, 'Bave du Kaskargo', 'La bave du Kaskargo ne peut jamais atteindre le plumage du Bitouf, mais elle peut vous engluer au sol.', 6, 110, '');
INSERT INTO `website_shop_objects_templates` VALUES (8833, 7, 'Masse du Corailleur', 'Ce marteau tire sa jolie couleur des morceaux de Corailleur qui le composent. Contrairement à ce que l\'on pourrait croire, il ne servait pas initialement à écrabouiller les Iops ou les ennemis. En réalité, il s\'agit d\'un objet d\'artisanat laissé par une ancienne civilisation. Cette masse servait de heurtoir pour que les personnes ayant des problèmes d\'audition puissent comprendre que quelqu\'un frappe à la porte.', 65, 85, '60#8#10#0#1d9+7,62#8#10#0#1d9+7,7d#29#46#0#1d30+40,7b#1f#32#0#1d20+30,77#1f#32#0#1d20+30,7c#15#1e#0#1d10+20,70#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (8834, 3, 'Branche de l\'Abrakleur sombre', 'Cette branche servait à racler certaines parties du corps inaccessibles autrement. Mais rassurez-vous, la couleur sombre est d\'origine. Aucun rapport avec les dépôts contenus dans les cavités les plus inaccessibles de l\'Abrakleur.', 64, 97, '5c#1#6#0#1d6+0,63#6#1e#0#1d25+5,76#1a#28#0#1d15+25,7e#1a#28#0#1d15+25,7d#2e#46#0#1d25+45,b2#4#6#0#1d3+3,b0#6#a#0#1d5+5,f0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8835, 3, 'Branche de l\'Abrakleur clair', 'Cette branche servait à racler certaines parties du corps inaccessibles autrement. Ceci explique peut-être l\'odeur étrange de cette branche.', 65, 132, '5c#4#6#0#1d3+3,62#7#10#0#1d10+6,64#7#10#0#1d10+6,77#1a#28#0#1d15+25,76#1a#28#0#1d15+25,7c#1a#28#0#1d15+25,b0#b#f#0#1d5+10,d6#6#8#0#1d3+5,d4#6#8#0#1d3+5,7d#65#96#0#1d50+100');
INSERT INTO `website_shop_objects_templates` VALUES (8836, 4, 'Tige du Brouture', 'Les Broutures se servent de leur tige pour se nettoyer les oreilles. Les sculpteurs de bâton préfèrent les employer comme arme. Comme quoi, les goûts et les couleurs, ça ne discute pas.', 75, 119, '62#7#d#0#1d7+6,63#7#d#0#1d7+6,7d#65#96#0#1d50+100,7e#1a#2d#0#1d20+25,77#1a#2d#0#1d20+25,73#3#4#0#1d2+2,b2#4#6#0#1d3+3,d4#6#a#0#1d5+5,d5#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8837, 4, 'Bâton du Maître Zoth', 'Le Maître Zoth est capable de vaincre n\'importe qui avec son bâton. Aucun adversaire ne lui fait peur ! Et c\'est bien normal. Vu qu\'avec sa coiffe il ne voit rien, il ne peut pas être terrorisé par son ennemi. Cette technique bien pratique au combat est toutefois problématique lorsqu\'il s\'agit de prendre les repas. Ayant un champ de vision limité, le Maître Zoth a toujours eu quelques problèmes pour manger sans en mettre partout.', 76, 158, '65#1#0#0#0d0+1,64#15#28#0#1d20+20,7d#97#c8#0#1d50+150,76#1a#28#0#1d15+25,7c#1a#28#0#1d15+25,7e#1f#32#0#1d20+30,70#6#a#0#1d5+5,b0#b#f#0#1d5+10,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8838, 4, 'Rhizome du Tynril', 'Telle la mauvaise herbe, le Tynril est capable de se reproduire à l\'infini grâce à un simple bout de rhizome. C\'est à partir de cette constatation que certains sculpteurs ont créé un bâton à base de Tynril. Ils espéraient pouvoir le reproduire facilement et à moindre frais pour le revendre au plus offrant. C\'est raté.', 77, 186, '61#7#b#0#1d5+6,5e#4#6#0#1d3+3,64#d#15#0#1d9+12,7d#c9#12c#0#1d100+200,7c#1f#28#0#1d10+30,7e#29#3c#0#1d20+40,b2#5#7#0#1d3+4,b0#6#a#0#1d5+5,d5#4#5#0#1d2+3,d6#4#5#0#1d2+3,d2#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (8839, 16, 'Masque Vaudou Thierry', 'Ce masque Vaudou sert essentiellement à masquer le visage des Kannibouls qui aiment la fronde (comme Thierry), mais qui ratent souvent leur cible. C\'est pourquoi, ils sont toujours un peu verts de rage.', 199, 158, '76#3d#50#0#1d20+60,7c#1f#32#0#1d20+30,99#65#96#0#1d50+100,73#4#5#0#1d2+3,70#b#f#0#1d5+10,8a#b#f#0#1d5+10,75#1#0#0#0d0+1,ae#12d#1f4#0#1d200+300,b0#b#14#0#1d10+10,d2#9#e#0#1d6+8,f0#9#e#0#1d6+8');
INSERT INTO `website_shop_objects_templates` VALUES (8840, 16, 'Masque Vaudou Jav', 'Les Kannibouls Jav ont souvent le \"blues\" et peignent leur coiffe en bleu. Est-ce lié à un chagrin d\'amour ou à une autre raison ? Difficile de connaître le fin mot de cette histoire. Mais ce serait bien qu\'ils se contentent de porter le masque et qu\'ils arrêtent de chanter leur mélancolie.', 200, 158, '7b#3d#50#0#1d20+60,7c#1f#32#0#1d20+30,99#65#96#0#1d50+100,73#4#5#0#1d2+3,70#b#f#0#1d5+10,8a#b#f#0#1d5+10,75#1#0#0#0d0+1,ae#12d#1f4#0#1d200+300,b0#b#14#0#1d10+10,d3#9#e#0#1d6+8,f1#9#e#0#1d6+8');
INSERT INTO `website_shop_objects_templates` VALUES (8841, 16, 'Masque Vaudou Sarbak', 'À force de rire jaune car ils loupent leur objectif, certains Kanniboules ont peint leur masque de cette couleur. Ainsi, même lorsqu\'ils rient de bon cœur, on a l\'impression qu\'ils se forcent.', 201, 158, '77#3d#50#0#1d20+60,7c#1f#32#0#1d20+30,99#65#96#0#1d50+100,73#4#5#0#1d2+3,70#b#f#0#1d5+10,8a#b#f#0#1d5+10,75#1#0#0#0d0+1,ae#12d#1f4#0#1d200+300,d4#9#e#0#1d6+8,f2#9#e#0#1d6+8,b0#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (8842, 16, 'Masque Vaudou Archer', 'Les Kannibouls Archer n\'arrivaient pas à se concentrer et à bien viser sauf lorsqu\'ils étaient très en colère. Ainsi, pour être toujours sur de voir rouge, ils ont peint leur masque dans cette couleur.', 202, 158, '7e#3d#50#0#1d20+60,7c#1f#32#0#1d20+30,99#65#96#0#1d50+100,73#4#5#0#1d2+3,70#b#f#0#1d5+10,8a#b#f#0#1d5+10,75#1#0#0#0d0+1,ae#12d#1f4#0#1d200+300,b0#b#14#0#1d10+10,d5#9#e#0#1d6+8,f3#9#e#0#1d6+8');
INSERT INTO `website_shop_objects_templates` VALUES (8843, 16, 'Chapeau de Crocodaille Dandi', 'Avec ce chapeau sur le crâne, le Crocodaille pense être à la pointe de la mode. Il faudrait que celle-ci soit vraiment bien émoussée pour ce que cela soit possible. Mais il vaut mieux éviter de lui faire remarquer son côté ridicule. Le Crocodaille est très susceptible...', 203, 180, '76#29#3c#0#1d20+40,7b#29#3c#0#1d20+40,9a#1a#28#0#1d15+25,9b#1a#28#0#1d15+25,7d#fb#12c#0#1d50+250,7c#1f#32#0#1d20+30,70#6#a#0#1d5+5,8a#10#14#0#1d5+15,b0#10#19#0#1d10+15,f4#6#a#0#1d5+5,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8844, 16, 'Capuche Souveraine du Roissingue', 'Coiffe royale, cette capuche possède les mêmes vertus que la Cape du Roissingue. Ses micro-aérations contribuent à une meilleure évacuation de la sueur pour toujours garder la tête froide. Hélas, elle possède également les défauts de la cape : son odeur nauséabonde est si présente qu\'on pourrait presque la découper au couteau.', 204, 168, '7d#97#c8#0#1d50+150,7c#29#3c#0#1d20+40,7b#33#46#0#1d20+50,77#33#46#0#1d20+50,ae#c9#190#0#1d200+200,b0#10#14#0#1d5+15,f3#6#a#0#1d5+5,f2#6#a#0#1d5+5,d4#5#7#0#1d3+4,d3#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8845, 16, 'Capuche de la Ouassingue', 'Moins efficace que la Coiffe royale, cette capuche permet toutefois une très bonne évacuation de la sueur. Un peu trop bonne, en fait. Du coup, que l\'on porte la capuche ou qu\'on ne la porte pas ne fait aucune différence.', 205, 104, '7d#47#78#0#1d50+70,7c#15#1e#0#1d10+20,77#10#19#0#1d10+15,7e#1a#28#0#1d15+25,b2#4#6#0#1d3+3,70#4#6#0#1d3+3,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8846, 16, 'Chapeau de la Gamine Zoth', 'Le Chapeau de la Gamine Zoth a la particularité de lui faire voir les choses en double. Ainsi, lorsqu\'elle voit une personne de sa tribu, elle zoth zoth.', 206, 128, '77#29#3c#0#1d20+40,7c#1f#32#0#1d20+30,70#6#a#0#1d5+5,b0#b#14#0#1d10+10,f4#6#a#0#1d5+5,f2#6#a#0#1d5+5,d4#6#a#0#1d5+5,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8847, 16, 'Casque du Guerrier Zoth', 'Ce casque a les mêmes avantages que les autres coiffes Zoth : il protège des coups de soleil même en plein cagnard, il amortit les coups portés à la tête, et il empêche de prendre conscience du danger en restreignant le champ de vision de celui qui le porte. Bref, ceci est le couvre-chef idéal du guerrier.', 207, 134, '76#3d#50#0#1d20+60,7d#12d#190#0#1d100+300,70#6#a#0#1d5+5,b0#6#a#0#1d5+5,db#6#a#0#1d5+5,f0#6#a#0#1d5+5,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8848, 16, 'Coiffe du Maître Zoth', 'La coiffe du Maître Zoth possède l\'immense avantage de restreindre le champ de vision de manière encore plus importante que les autres casques. C\'est grâce à lui que l\'on peut accéder à la fameuse technique de combat dite « de la fouine ». En gros, il suffit de frapper n\'importe où en utilisant toutes ses forces. Étant ainsi totalement imprévisible, vous êtes sûr de vaincre l\'adversaire (ou du moins le surprendre suffisamment pour lui donner des coups bien placés).', 208, 156, '7d#97#c8#0#1d50+150,7c#1f#32#0#1d20+30,73#4#5#0#1d2+3,8a#10#19#0#1d10+15,b2#6#a#0#1d5+5,70#6#a#0#1d5+5,75#1#0#0#0d0+1,b0#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (8849, 4, 'Racine de Fécorce', 'Ce bâton est très branché auprès des femmes troncs. Mais si vous préférez séduire d\'autres types de femmes, cela est aussi possible (même si cela risque d\'être moins efficace).', 78, 138, '60#9#10#0#1d8+8,61#9#10#0#1d8+8,7b#1f#32#0#1d20+30,76#1f#32#0#1d20+30,7d#65#96#0#1d50+100,7c#15#1e#0#1d10+20,70#5#7#0#1d3+4,b6#1#0#0#0d0+1,b0#b#14#0#1d10+10,f3#6#a#0#1d5+5,f1#6#a#0#1d5+5,d5#6#a#0#1d5+5,d3#6#a#0#1d5+5,d9#4#5#0#1d2+3,d7#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (8850, 4, 'Racine de Floribonde', 'Si vous êtes superstitieux et que vous avez toujours besoin de toucher du bois, choisissez cette Racine de Floribonde ! D\'un autre côté, vous pouvez aussi essayer d\'être prudent, de ne pas scier la branche sur laquelle vous êtes assis et de ne surtout pas mettre le doigt entre l\'arbre et l\'écorce.', 79, 144, '5d#1#a#0#1d10+0,7d#fb#12c#0#1d50+250,77#29#3c#0#1d20+40,7c#29#3c#0#1d20+40,70#6#a#0#1d5+5,b0#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (8851, 24, 'Worn Treasure Map', 'Event Shika', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8854, 16, 'Crack Sparrow\'s Own Withered Hat', 'Event Shika', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8855, 82, 'Bouclier Fi\'Squale', 'Certes ce bouclier, vous assure une protection effective mais ne rêvez pas, il ne durera pas.', 35, 10, '32c#5#0#0#0d0+5,108#10#19#0#1d10+15,107#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (8856, 10, 'Ceinture Rasboulaire du Rasboul', 'Lorsque le Rasboul a les boules, il porte sa ceinture Rasboulaire pour envoyer bouler tous les casse-boules.', 115, 182, '7d#fb#12c#0#1d50+250,7c#1f#28#0#1d10+30,77#29#3c#0#1d20+40,73#4#6#0#1d3+3,8a#b#f#0#1d5+10,75#1#0#0#0d0+1,b0#b#f#0#1d5+10,d3#6#a#0#1d5+5,d2#6#a#0#1d5+5,70#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8858, 11, 'Bottes Horchons', 'Ces Bottes émettent un immonde bruit de succion à chaque pas, ce qui n\'est pas sans vous rappeler le chant d\'amour des Trools en rut. Un souvenir douloureux dont vous vous seriez bien passé.', 112, 100, '80#1#0#0#0d0+1,7c#15#1e#0#1d10+20,7e#1a#2d#0#1d20+25,77#10#1e#0#1d15+15,70#4#5#0#1d2+3,75#1#0#0#0d0+1,b0#6#a#0#1d5+5,d3#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8859, 9, 'Sceau Souverain du Roissingue', 'Ce sceau désigne son possesseur comme étant le souverain incontesté de la Tourbière sans fond de l\'île d\'Otomaï. Difficile d\'imaginer un royaume plus bucolique.', 138, 158, '7d#65#96#0#1d50+100,7c#15#23#0#1d15+20,7b#1a#28#0#1d15+25,77#1a#28#0#1d15+25,70#5#7#0#1d3+4,b0#b#f#0#1d5+10,f1#6#a#0#1d5+5,f0#6#a#0#1d5+5,d2#5#7#0#1d3+4,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8860, 9, 'Alliance de Corail', 'Cet anneau a été arraché au doigt encore chaud d\'un jeune Corailleur fraichement massacré. Sa mère l\'attendait pour le repas, jusqu\'à ce qu\'elle s\'aperçoive que son rejeton venait d\'être transformé en pierre tombale.  Même le corail a un coeur, et pas forcément de pierre.', 139, 60, '76#b#14#0#1d10+10,7d#10#19#0#1d10+15,7c#6#a#0#1d5+5,7b#10#1e#0#1d15+15,b0#3#5#0#1d3+2,f1#4#5#0#1d2+3,d3#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (8861, 11, 'Sandales Circulaires du Kimbo', 'Seul le Kimbo et ses pieds totalement loufoques peuvent se sentir à l\'aise dans ces sandales. En revanche il n\'est pas le seul à pouvoir profiter de leur puissance. Attention tout de même de ne pas vous tromper de sens en les enfilant.', 113, 195, '7b#33#46#0#1d20+50,7d#fb#12c#0#1d50+250,7c#1f#32#0#1d20+30,70#6#a#0#1d5+5,73#3#4#0#1d2+2,80#1#0#0#0d0+1,b0#b#14#0#1d10+10,d2#6#a#0#1d5+5,d3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8862, 10, 'Ceinture Bitoufale de Prosper Youpla', 'Prosper Youpla était persuadé de pouvoir voler grâce à cette ceinture ornée d\'ailes de Bitouf. Ignorant que très peu de Bitoufs savent voler, il s\'élançait du haut de l\'arbre Hakam et s\'écrasait systématiquement au sol, tant et si bien qu\'il fût surnommé \"Boum\".', 128, 148, '76#1f#32#0#1d20+30,77#1f#32#0#1d20+30,7c#1f#32#0#1d20+30,73#1#2#0#1d2+0,b2#4#5#0#1d2+3,70#4#5#0#1d2+3,ae#c9#12c#0#1d100+200,b0#b#14#0#1d10+10,d4#6#a#0#1d5+5,d2#6#a#0#1d5+5,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8863, 1, 'Zothulette', 'Cette amulette est un vulgaire morceau de bois et de tissu déchiré, mais les Zoths croient dur comme fer à ses pouvoirs. Les pauvres fous !', 124, 162, '70#6#a#0#1d5+5,8a#1f#32#0#1d20+30,7c#1f#32#0#1d20+30,7d#fb#12c#0#1d50+250,b2#6#a#0#1d5+5,b0#b#14#0#1d10+10,d6#6#a#0#1d5+5,d5#6#a#0#1d5+5,73#4#5#0#1d2+3,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (8864, 2, 'Kask\'Arc Go', 'La corde de cet arc est faite de bave de Kaskargo, plus ou moins sèche, son élasticité est sans pareille, sa texture gluante et visqueuse en revanche rappelle... On ne sait pas trop ce que ça rappelle mais ça n\'est pas agréable.', 58, 122, '64#e#1e#0#1d17+13,5b#2#3#0#1d2+1,7b#1f#32#0#1d20+30,7d#65#96#0#1d50+100,7c#1f#28#0#1d10+30,8a#b#f#0#1d5+10,75#1#0#0#0d0+1,b0#b#f#0#1d5+10,f4#6#a#0#1d5+5,f1#6#a#0#1d5+5,d3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8865, 9, 'Anneau Skargo', 'Sculpté dans une carapace de Kaskargo, cet anneau résiste à n\'importe quoi ou n\'importe qui.', 140, 120, '7b#1a#23#0#1d10+25,7d#51#64#0#1d20+80,73#2#3#0#1d2+1,70#4#6#0#1d3+3,b0#6#a#0#1d5+5,f1#5#7#0#1d3+4,d3#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8866, 17, 'Puissante Cape Fulgurante', 'Tissée dans des étoffes de Zoths, cette cape possède un pouvoir extraordinaire dont l\'origine reste encore inconnue.', 145, 110, '6f#1#0#0#0d0+1,7c#1f#28#0#1d10+30,7d#1f#28#0#1d10+30,70#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (8867, 17, 'Cape de la Meupette', 'En portant cette cape, vous serez pris d\'une furieuse envie de vinaigrette.', 146, 61, '7d#15#23#0#1d15+20,77#15#1e#0#1d10+20,7b#10#14#0#1d5+15,b2#1#3#0#1d3+0,70#1#3#0#1d3+0,f0#2#5#0#1d4+1,f4#2#5#0#1d4+1');
INSERT INTO `website_shop_objects_templates` VALUES (8868, 19, 'Poolache', 'Le fait qu\'un bec de Poolay orne cette arme ne sert absolument à rien, voire handicape l\'utilisateur. Heureusement qu\'elle est puissante.', 48, 137, '5c#3#4#0#1d2+2,5e#3#4#0#1d2+2,61#e#16#0#1d9+13,63#e#16#0#1d9+13,7d#65#96#0#1d50+100,7c#15#1e#0#1d10+20,b0#6#a#0#1d5+5,7e#1a#28#0#1d15+25,76#1a#28#0#1d15+25,d5#6#a#0#1d5+5,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8869, 11, 'Bottines en bois d\'abrakleur', 'Ces bottes sont si lourdes qu\'elles seraient plutôt à classer dans la catégorie des armes tellement les coups de pieds deviennent meurtriers.', 114, 136, '76#1a#28#0#1d15+25,77#1a#28#0#1d15+25,7d#65#96#0#1d50+100,7c#1a#23#0#1d10+25,70#6#8#0#1d3+5,80#1#0#0#0d0+1,f4#6#a#0#1d5+5,f1#6#a#0#1d5+5,d3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8870, 10, 'Ceinture sombre en Abrakleur', 'Taillée dans un Abrakleur sombre, cette ceinture n\'est pas assez flexible pour permettre de bouger librement, mais au moins, elle protège bien.', 129, 92, '73#4#5#0#1d2+3,76#1a#23#0#1d10+25,7e#1a#23#0#1d10+25,7d#29#3c#0#1d20+40,8a#6#a#0#1d5+5,b0#6#a#0#1d5+5,d6#5#7#0#1d3+4,d4#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8871, 10, 'Ceinture Claire en Abrakleur', 'Taillée dans un Abrakleur clair, cette ceinture ne protège pas bien, mais au moins, elle est assez flexible pour bouger librement.', 130, 128, '76#1f#2d#0#1d15+30,77#1f#2d#0#1d15+30,7d#97#c8#0#1d50+150,7c#1f#28#0#1d10+30,8a#6#a#0#1d5+5,ae#c9#12c#0#1d100+200,b0#b#14#0#1d10+10,d6#6#a#0#1d5+5,d5#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8872, 9, 'Palmano', 'Ce bijou n\'est pas très précieux, mais il a la taille idéale pour servir à doser le mourgale dans un bon belgrouth à la glaviouze.', 141, 46, '77#15#23#0#1d15+20,b6#1#2#0#1d2+0,ae#c9#12c#0#1d100+200');
INSERT INTO `website_shop_objects_templates` VALUES (8873, 10, 'Krustoture', 'Enfin une bonne excuse de sentir la marée !', 131, 39, '7d#10#19#0#1d10+15,76#10#19#0#1d10+15,77#10#19#0#1d10+15,73#1#2#0#1d2+0,e2#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (8874, 1, 'Ouassulette', 'Ce bijou essaye parfois de vous voler des aliments au passage pendant votre repas, ne le laissez pas pendre trop bas.', 125, 105, '7d#29#46#0#1d30+40,7c#15#1e#0#1d10+20,7e#1a#28#0#1d15+25,77#15#1e#0#1d10+20,b2#4#6#0#1d3+3,6f#1#0#0#0d0+1,b0#b#f#0#1d5+10,f3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8876, 17, 'Voile d\'encre', 'Cette cape étrange semble faite d\'encre noire, mais étrangement, elle se comporte comme une étoffe et ne coule pas. En revanche elle tâche. Votre arrière train n\'aura jamais été aussi sale.', 147, 191, '7d#fb#15e#0#1d100+250,76#33#46#0#1d20+50,7e#33#46#0#1d20+50,7c#1a#28#0#1d15+25,70#6#a#0#1d5+5,d3#6#a#0#1d5+5,d4#6#a#0#1d5+5,d5#6#a#0#1d5+5,75#1#0#0#0d0+1,73#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (8877, 9, 'Kralano', 'Une fois enfilé, vous ne pourrez plus jamais l\'enlever tellement ses ventouses sont efficaces.', 142, 199, '7d#97#c8#0#1d50+150,7e#1f#32#0#1d20+30,7c#1f#32#0#1d20+30,77#1f#32#0#1d20+30,73#2#3#0#1d2+1,b2#6#a#0#1d5+5,70#4#6#0#1d3+3,75#1#0#0#0d0+1,b0#6#a#0#1d5+5,f4#6#a#0#1d5+5,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8878, 7, 'Kidorteau', 'Ce marteau n\'est pas pratique, pas spécialement beau, pas très ergonomique, pas puissant, pas assez lourd, trop fragile, mal équilibré, il brille trop et sent mauvais. \\nMais il est coloré ! Enfin, un peu de couleurs dans ce monde de brutes.', 66, 79, '62#7#c#0#1d6+6,60#7#c#0#1d6+6,63#7#c#0#1d6+6,7d#1f#28#0#1d10+30,7c#10#19#0#1d10+15,70#2#3#0#1d2+1,b6#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (8879, 9, 'Anneau Poli', 'Cet anneau n\'est malheureusement poli qu\'à l\'extérieur. On y enfile le doigt par un trou orné d\'éclats de roche acérés. Recommandé pour les Sacrieurs.', 143, 66, '76#b#f#0#1d5+10,7d#b#19#0#1d15+10,7e#b#f#0#1d5+10,77#b#f#0#1d5+10,7b#b#f#0#1d5+10,70#2#4#0#1d3+1,8a#6#f#0#1d10+5,75#1#0#0#0d0+1,ae#8d#aa#0#1d30+140,d9#1#5#0#1d5+0,d8#1#5#0#1d5+0,da#1#5#0#1d5+0,d7#1#5#0#1d5+0,db#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (8880, 1, 'Amufafah', 'Ce collier donne une furieuse envie de rugir à son possesseur, simplement parce que les moustaches du Mufafah qui l\'ornent lui chatouillent les tétons.', 126, 84, '76#10#19#0#1d10+15,7d#1f#28#0#1d10+30,7c#b#14#0#1d10+10,77#10#19#0#1d10+15,80#1#0#0#0d0+1,b0#6#a#0#1d5+5,d5#1#3#0#1d3+0,d3#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (8881, 9, 'Anneau Solo', 'Solo était un gentil vaurien, d\'ailleurs il le disait lui-même. Ça ne l\'a pas empêché de mourir pendu sur la place du village après avoir dérobé une petite culotte à la femme du chef. Solo n\'était vraiment pas futé, mais gentil quand-même...', 144, 31, '76#6#f#0#1d10+5,9b#6#f#0#1d10+5,77#6#f#0#1d10+5,73#1#5#0#1d5+0,7a#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (8883, 12, 'Potion de Foyer de Guilde', 'Cette potion vous permet de retourner dans votre foyer de guilde.', 152, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8885, 90, 'Fantôme Chacha Tigré ', 'Ce Chacha Tigré n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 20, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8886, 27, 'Transformation Fantôme Chacha Tigré ', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8887, 77, 'Certificat de Mise en Chanil : Chacha Tigré ', 'Ce certificat décrit les caractéristiques du Chacha Tigré que vous avez placé au chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8888, 77, 'Certificat de Mise en Chanil : Ecureuil Chenapan', 'Ce certificat décrit les caractéristiques de l\'Ecureuil Chenapan que vous avez placé au chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8889, 77, 'Certificat de Mise en Chanil : Léopardo', 'Ce certificat décrit les caractéristiques du Léopardo que vous avez placé au chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8890, 89, 'Cadeau Chacha Tigré ', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 42, 1, '');
