INSERT INTO `website_shop_objects_templates` VALUES (8913, 12, 'Potion Bulbique', 'Cette potion est composée d\'extraits de bulbes macérés dans de la purée de Kloug. Les alchimistes les plus audacieux utilisent de la farine de riz à la place de la purée de Kloug devenue introuvable depuis longtemps. Aussi improbable que cela puisse paraître, vous vous habituerez à son goût.', 23, 110, '6e#191#1f4#0#1d100+400');
INSERT INTO `website_shop_objects_templates` VALUES (8914, 24, 'Fiche descriptive d\'un Bricoleur', 'Cette fiche contient toutes les informations nécessaires pour retrouver le Bricoleur qui y est décrit.', 176, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8915, 80, 'Fiche du Bricoleur à remplir', 'Cette fiche est faite pour y remplir toutes les informations nécessaires pour identifier un Bricoleur.', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8916, 50, 'Ambre du Tynril', 'Cette ambre n\'est pas comme les autres. Si vous l\'agitez de haut en bas, en fermant les yeux, et en dansant un tango rapide du Captain Chafer, vous pourrez peut-être la sentir vibrer et à briller, comme si une âme mystérieuse l\'habitait. Accessoirement, vous aurez l\'air d\'un fou, mais d\'un fou qui brille et qui vibre.', 1, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (8917, 84, 'Clef de la Grotte Hesque', 'Cette clef étrange vous permettra de rentrer dans la Grotte Hesque en un seul morceau.', 244, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8918, 16, 'Casque amélioré ', 'Ce casque amélioré permet en théorie de chevaucher les Scarafeuilles les plus rapides sans perdre sa perruque. Tout simplement inestimable.', 25, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8919, 17, 'Ailes en bois améliorées', 'Ces ailes en bois améliorées ont été rembourrées et rendues plus légères grâce à des plumes et du tissu de qualité. L\'armature étant toujours en bois, vous aurez tout de même du mal à ne pas vous écraser.', 22, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (8922, 24, 'Bourse de kamas', 'Cette bourse contient une importante somme de kamas. Elle est surement destinée à quelque pot-de-vin.', 243, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8923, 24, 'Sac de patates', 'Un sac de patates, il faut vraiment ne pas savoir quoi faire de son temps pour se balader avec ça', 243, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8924, 2, 'Arc à Chon', 'C\'est l\'histoire d\'un homme appelé Chon, il avait un phare. C\'était le Phare à Chon.', 59, 151, '64#9#12#0#1d10+8,7c#1f#28#0#1d10+30,7d#97#c8#0#1d50+150,77#1f#28#0#1d10+30,73#4#5#0#1d2+3,70#6#a#0#1d5+5,b0#b#14#0#1d10+10,f3#6#a#0#1d5+5,f2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8925, 2, 'Arc Oleptik', 'Cet arc étrange a été sculpté par une Sadida pendant une phase de somnambulisme créatrice. Il en émane une envie de sommeil qui affecte autant le porteur que ses cibles.', 60, 185, '62#6#13#0#1d14+5,63#6#13#0#1d14+5,77#1f#32#0#1d20+30,7e#1f#32#0#1d20+30,7c#15#1e#0#1d10+20,7d#97#c8#0#1d50+150,70#5#7#0#1d3+4,75#1#0#0#0d0+1,ae#12d#190#0#1d100+300,b0#b#14#0#1d10+10,d5#4#6#0#1d3+3,d4#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8926, 5, 'Dague Adou', 'Ces dagues sont parfaites pour pousser les ananas ou moudre le café. Certains s\'en servent même pour taper des pommes et des poires.', 65, 175, '62#8#d#0#1d6+7,60#8#d#0#1d6+7,5f#1#2#0#1d2+0,7b#1f#32#0#1d20+30,77#1f#32#0#1d20+30,76#1f#32#0#1d20+30,7c#1f#28#0#1d10+30,7d#97#c8#0#1d50+150,70#4#6#0#1d3+3,e2#15#1e#0#1d10+20,b0#b#14#0#1d10+10,f2#6#a#0#1d5+5,f3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8927, 5, 'Dagues Eudin', 'Eudin était un Sram complètement fou, il volait les pauvres pour donner aux riches.', 66, 171, '61#7#a#0#1d4+6,64#9#e#0#1d6+8,76#1f#32#0#1d20+30,77#1f#32#0#1d20+30,7d#97#c8#0#1d50+150,73#3#4#0#1d2+2,70#6#a#0#1d5+5,e1#b#14#0#1d10+10,ae#c9#190#0#1d200+200,b0#6#a#0#1d5+5,d2#6#a#0#1d5+5,e2#15#1e#0#1d10+20');
INSERT INTO `website_shop_objects_templates` VALUES (8928, 5, 'Dagues Ruik', 'Ruik est meilleur buveur que combattant, et ça ne s\'améliore pas au fil du temps. Il est quand même déconseillé de ressembler à un bouchon quand il porte ses dagues.', 67, 158, '64#1#14#0#1d20+0,77#1f#32#0#1d20+30,7d#c9#fa#0#1d50+200,7c#15#1e#0#1d10+20,73#4#5#0#1d2+3,70#6#a#0#1d5+5,d6#6#a#0#1d5+5,f4#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8929, 5, 'Kriss Toubal', 'A ne pas confondre avec le célèbre bâton au nom semblable, ces lames provoquent des carnages bien plus violents.', 68, 149, '5b#3#6#0#1d4+2,51#1#14#0#1d20+0,5e#3#6#0#1d4+2,7e#1f#32#0#1d20+30,7b#1f#32#0#1d20+30,77#15#1e#0#1d10+20,7c#15#1e#0#1d10+20,7d#97#c8#0#1d50+150,73#3#4#0#1d2+2,70#4#6#0#1d3+3,b6#2#0#0#0d0+2,b0#b#14#0#1d10+10,f3#6#a#0#1d5+5,f1#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8930, 6, 'Fuschia', 'Plus d\'un fier guerrier a refusé cette arme à cause de sa couleur, la majorité d\'entre eux est morte sous sa lame.', 78, 163, 'd5#6#8#0#1d3+5,d4#6#8#0#1d3+5,75#1#0#0#0d0+1,7c#1a#28#0#1d15+25,b2#6#8#0#1d3+5,7d#97#c8#0#1d50+150,7e#1f#32#0#1d20+30,63#10#1c#0#1d13+15,62#10#1c#0#1d13+15,77#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (8931, 6, 'Az\'tech', 'Cette épée appartenait à un vieil Enutrof mégalomane, elle est en or massif, comme l\'était son égo.', 79, 186, 'd4#5#7#0#1d3+4,d3#5#7#0#1d3+4,b0#b#f#0#1d5+10,70#4#5#0#1d2+3,7d#65#96#0#1d50+100,7c#15#1e#0#1d10+20,76#1f#32#0#1d20+30,77#1f#32#0#1d20+30,7b#1f#32#0#1d20+30,65#1#0#0#0d0+1,5b#6#8#0#1d3+5,5d#6#8#0#1d3+5,64#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (8932, 6, 'Kukri Kura', 'Souriez ! Dites cheese ! Voilà, vous êtes coupé en deux.', 80, 179, 'd6#6#a#0#1d5+5,f4#6#a#0#1d5+5,ae#12d#1f4#0#1d200+300,b0#b#f#0#1d5+10,70#5#7#0#1d3+4,73#2#3#0#1d2+1,7d#97#c8#0#1d50+150,7c#1a#28#0#1d15+25,77#15#1e#0#1d10+20,76#1f#32#0#1d20+30,64#a#15#0#1d12+9,64#a#15#0#1d12+9');
INSERT INTO `website_shop_objects_templates` VALUES (8933, 19, 'Hache Sueur Rance', 'Ourag\'han était un vieux Pandawa au derme si doux qu\'on l\'appelait Peau Lisse. Son odeur en revanche était si forte qu\'il a hérité d\'un autre surnom. Il l\'a transmis à sa fidèle hache.', 49, 162, '5c#a#0#0#0d0+10,64#1e#0#0#0d0+30,7d#97#c8#0#1d50+150,7c#1f#28#0#1d10+30,b0#b#f#0#1d5+10,76#1f#2d#0#1d15+30,70#6#a#0#1d5+5,73#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8934, 19, 'Hache Harnée', 'Fâché de s\'être fait voler un grain de riz dans son assiette par un écureuil chenapan pendant ses vacances touristiques sur l\'île de Pandala, Brouce Boulgour s\'est servi de cette hache pour abattre chaque bambou au sommet duquel le voleur se réfugiait, afin de l\'attraper. Les Pandawas du village ont dû le calmer avec la moitié de la réserve d\'alcool de bambou pour éviter qu\'il ne rase la forêt. Sacré Brouce.', 50, 158, '63#d#13#0#1d7+12,60#d#13#0#1d7+12,62#d#13#0#1d7+12,7d#65#96#0#1d50+100,7c#1a#28#0#1d15+25,b0#b#14#0#1d10+10,7e#1a#28#0#1d15+25,77#1a#28#0#1d15+25,75#1#0#0#0d0+1,7b#1a#28#0#1d15+25,d5#5#7#0#1d3+4,d3#5#7#0#1d3+4,d4#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8935, 8, 'la Bêche à Mel', 'Jeune Iopette, Mel se voyait déjà vaincre des dragons. Elle jouait à combattre les rochers du jardin de sa mère avec une pelle en guise d\'épée. La rocaille a appris à redouter l\'ustensile.', 48, 176, '63#6#a#0#1d5+5,60#10#1e#0#1d15+15,7e#1f#32#0#1d20+30,7b#1f#32#0#1d20+30,7c#1a#28#0#1d15+25,7d#65#96#0#1d50+100,70#6#a#0#1d5+5,75#1#0#0#0d0+1,b0#b#f#0#1d5+10,d5#6#8#0#1d3+5,d3#6#8#0#1d3+5');
INSERT INTO `website_shop_objects_templates` VALUES (8936, 8, 'Pelle Shattkitou', 'Cette pelle est sauvage et tente de mordre son propriétaire à chaque utilisation. Elle émet des sons bizarres quand elle est contente et ne se calme qu\'en présence de grelots.', 49, 137, '64#14#22#0#1d15+19,5d#4#6#0#1d3+3,77#1a#28#0#1d15+25,7b#1a#28#0#1d15+25,7c#1a#28#0#1d15+25,7d#47#64#0#1d30+70,73#4#5#0#1d2+3,70#4#5#0#1d2+3,8a#6#a#0#1d5+5,b0#b#14#0#1d10+10,f2#5#7#0#1d3+4,d4#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (8937, 8, 'Pelle Aigante', 'Un Enutrof futé s\'était fait pirate après avoir fait le constat qu\'on ramasse plus de trésor sur un cadavre frais que dans une tombe moisie. Sa pelle rouge sang était son symbole et faisait trembler l\'équipage des bateaux de toutes les mers.', 50, 156, '63#10#1b#0#1d12+15,61#10#1b#0#1d12+15,7b#1a#28#0#1d15+25,76#1f#32#0#1d20+30,7e#1f#32#0#1d20+30,7d#97#c8#0#1d50+150,b2#5#7#0#1d3+4,b6#2#0#0#0d0+2,ae#c9#12c#0#1d100+200,b0#b#14#0#1d10+10,d5#5#7#0#1d3+4,d2#5#7#0#1d3+4');
