INSERT INTO `website_shop_objects_templates` VALUES (8958, 6, 'Patte d\'Ecaflip', 'Le Dieu Ecaflip vous a tendu sa patte, mais vous n\'avez pu saisir qu\'une griffe...  Et encore, elle ne coupait pas aussi bien que vous auriez pu le croire à première vue. En fait, ce n\'était peut-être pas le Dieu Ecaflip, finalement...', 82, 100, '64#8#1b#0#1d20+7,7c#15#28#0#1d20+20,76#29#46#0#1d30+40,7d#1f#3c#0#1d30+30');
