INSERT INTO `website_shop_objects_templates` VALUES (8961, 6, 'Patte d\'Ecaflip', 'Certains superstitieux prétendent que les pattes de lapin apportent chance et fortune. Grâce à cette légendaire épée, vous pourrez briller à leurs yeux. Par ailleurs, son tranchant est très affuté et sa coupe vous rappelle légèrement celle d\'une épée que vous avez déjà connue.', 82, 100, '64#e#21#0#1d20+13,7c#15#28#0#1d20+20,76#29#46#0#1d30+40,7d#1f#3c#0#1d30+30');
