INSERT INTO `website_shop_objects_templates` VALUES (8964, 6, 'Patte d\'Ecaflip', '\"La chance sourit aux audacieux !\" soufflent les adeptes du Dieu Ecaflip. Vous voilà armé comme un as de pique, vous allez pouvoir abattre votre jeu. Cette épée de prestige est d\'une rareté et d\'une pureté exceptionnelle.', 82, 100, '64#14#27#0#1d20+19,7c#15#28#0#1d20+20,76#29#46#0#1d30+40,7d#1f#3c#0#1d30+30');
