INSERT INTO `website_shop_objects_templates` VALUES (8966, 6, 'Patte d\'Ecaflip Parfaite', 'Cette épée constitue l\'incarnation même de la chance du Dieu Ecaflip. Vous tenez entre vos mains la plus pure version de la Patte d\'Ecaflip, qui témoigne de votre chance aussi incroyable qu\'insolente (et donc de votre célibat définitif).', 81, 100, '64#1f#32#0#1d20+30,7c#15#28#0#1d20+20,76#29#46#0#1d30+40,7d#1f#3c#0#1d30+30');
