INSERT INTO `website_shop_objects_templates` VALUES (8985, 116, 'Eupéoh pour Dragoune et Tifoux', 'En utilisant ce comprimé puissant, vous augmenterez les capacités de votre Dragoune ou de votre Tifoux de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 13, 1, '3ac#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (8986, 116, 'Eupéoh pour Bouloute et Fotome', 'En utilisant ce comprimé puissant, vous augmenterez les capacités de votre Bouloute ou de votre Fotome de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 12, 1, '3ac#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (8987, 116, 'Eupéoh pour El Scarador et Croum', 'En utilisant ce comprimé puissant, vous augmenterez les capacités de votre El Scarador ou de votre Croum de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 10, 1, '3ac#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (8988, 116, 'Eupéoh pour Abra Kadabra et Minimino', 'En utilisant ce comprimé puissant, vous augmenterez les capacités de votre Abra Kadabra ou de votre Minimino de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 11, 1, '3ac#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (8989, 16, 'Casque du Bitouf Aérien', 'Avec ce casque sur la tête, vous pouvez espérer vous élever dans les airs si vous tournez sur vous-même à la vitesse de l\'éclair. Pour l\'atterrissage, débrouillez-vous.', 209, 154, '80#1#0#0#0d0+1,7d#97#c8#0#1d50+150,7c#15#1e#0#1d10+20,b2#5#7#0#1d3+4,70#5#7#0#1d3+4,b0#b#14#0#1d10+10,f2#4#6#0#1d3+3,f1#4#6#0#1d3+3,f3#4#6#0#1d3+3,f4#4#6#0#1d3+3,f0#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (8990, 112, 'Prisme de conquête', 'Cet objet magique en pierre rayonne dans toute la zone dans laquelle il est posé. Il permet de marquer votre territoire sans avoir besoin de gâcher votre urine. À utiliser sans modération si vous avez l\'âme d\'un conquérant. Attention, vous ne pouvez poser un prisme de conquête que si vous affichez clairement votre grade (mode joueur contre joueur activé), et si vous êtes dans une zone ne contenant aucun prisme. La zone dans laquelle vous voulez poser un prisme de conquête doit en outre être mitoyenne d\'une zone devenue alliée depuis au moins cinq minutes.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (8991, 9, 'Annolamour', 'Cet anneau vous suce le doigt en permanence, il est gluant et froid, si vous supportez ça vous pourrez profiter de ses immenses pouvoirs.', 145, 189, '76#1f#32#0#1d20+30,7b#1f#32#0#1d20+30,7c#1f#32#0#1d20+30,7d#c9#fa#0#1d50+200,70#6#a#0#1d5+5,8a#b#14#0#1d10+10,ae#1f5#2bc#0#1d200+500,b0#b#f#0#1d5+10,f3#6#a#0#1d5+5,f1#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (8992, 22, 'Faux maudite du Saigneur Guerrier', 'Cette lame fauche vos ennemis comme les blés, mais elle attise également la jalousie de vos alliés. Tel est le destin des puissants.', 3, 200, 'd2#4#5#0#1d2+3,d6#4#5#0#1d2+3,d5#4#5#0#1d2+3,d3#4#5#0#1d2+3,d4#4#5#0#1d2+3,7d#1a#28#0#1d15+25,7c#1a#28#0#1d15+25,7e#1a#28#0#1d15+25,77#1a#28#0#1d15+25,76#1a#28#0#1d15+25,7b#1a#28#0#1d15+25,64#9#12#0#1d10+8,61#9#12#0#1d10+8,63#9#12#0#1d10+8,60#9#12#0#1d10+8,62#9#12#0#1d10+8,11d#16f#0#1#0d0+367,11d#12');
INSERT INTO `website_shop_objects_templates` VALUES (8993, 6, 'Epée Maudite du Saigneur Guerrier', 'Cette épée dégage un pouvoir impressionnant, les carnages qu\'elle augure sont de ceux restant dans les livres d\'histoire. Mais son maniement reste étrangement hasardeux. Il existe peut-être quelqu\'un capable de corriger cela.', 83, 200, '62#9#12#0#1d10+8,60#9#12#0#1d10+8,63#9#12#0#1d10+8,64#9#12#0#1d10+8,61#9#12#0#1d10+8,7b#1a#1e#0#1d5+25,7e#1a#1e#0#1d5+25,76#1a#1e#0#1d5+25,77#1a#1e#0#1d5+25,7c#1a#1e#0#1d5+25,7d#97#a5#0#1d15+150,d4#4#5#0#1d2+3,d3#4#5#0#1d2+3,d5#4#5#0#1d2+3,d6#4#5#0#1d2+3,d2#4#5#0#1d2+3,11d#16f#0#1#0d0+367,11d#16e#0#');
INSERT INTO `website_shop_objects_templates` VALUES (8994, 55, 'Etoffe Corailleuse', 'Cette étoffe humide est restée sous l\'eau pendant plusieurs années. De petites particules de corail ont commencé à la recouvrir. Dommage qu\'elle soit aussi rigide, elle aurait pu servir de mouchoir.', 728, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (8995, 55, 'Etoffe de Gourlo le Terrible', 'Autrefois utilisée comme pansement pour soigner les cloques de Gourlo le Terrible, cette étoffe est encore imbibée d\'un liquide à l\'odeur surprenante. Le plus étrange c\'est que cela semble vous donner de l\'appétit.', 729, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (8996, 59, 'Peau du Rasboul Majeur', 'Cette peau est plus douce que celle que l\'on peut trouver sur les fesses d\'une femelle Kilibriss. Ca vous fait une belle jambe.', 48, 250, '');
INSERT INTO `website_shop_objects_templates` VALUES (8997, 59, 'Peau lacérée du Tynril', 'Cette peau recouvrait sûrement un point sensible du Tynril. Le pauvre.', 629, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (8998, 50, 'Pierre précieuse du Kimbo', 'Pendant des années, le Kimbo a sucé cette pierre précieuse pour la rendre plus lisse et pouvoir l\'introduire plus facilement dans ses narines. La nature est parfois difficile à comprendre.', 109, 900, '');
INSERT INTO `website_shop_objects_templates` VALUES (9001, 82, 'Bouclier de Sidimote', 'Ce bouclier est censé rappeler à vos adversaires que vous avez grandi dans les Landes de Sidimote. Il paraît que cela pourrait suffire à les effrayer.', 8, 1, 'fe#c#f#0#1d4+11,fb#c#f#0#1d4+11,104#8#a#0#1d3+7');
INSERT INTO `website_shop_objects_templates` VALUES (9002, 82, 'Ftalmo', 'Ce bouclier est recouvert de divers yeux, pour permettre à son porteur de fixer plus facilement son adversaire dans les yeux.', 5, 1, 'fd#e#12#0#1d5+13,fb#e#12#0#1d5+13');
INSERT INTO `website_shop_objects_templates` VALUES (9003, 82, 'Bouclier Taverne', 'Le tavernier de la brasserie Feubuk de Bonta devait certainement s\'ennuyer fermement lorsqu\'il eu soudainement l\'idée d\'équiper les videurs de sa taverne avec ces boucliers publicitaires.', 6, 1, 'fd#8#a#0#1d3+7,fc#8#a#0#1d3+7,108#8#a#0#1d3+7,105#8#a#0#1d3+7');
INSERT INTO `website_shop_objects_templates` VALUES (9004, 82, 'Bouclier Akwadala', 'Pour parer les coups de bourre ou les coups tordus, ce bouclier issu du village d\'Akwadala devrait faire l\'affaire.', 31, 1, 'fb#6#8#0#1d3+5,107#8#a#0#1d3+7');
INSERT INTO `website_shop_objects_templates` VALUES (9005, 82, 'Bouclier Ventaille', 'Lorsque vos alliés commencent à s\'essouffler ou même lorsque vous voulez dissiper les effets d\'un Vent de Panique, ce bouclier peut vous sauver la vie, il suffit de l\'agiter vigoureusement dans tous les sens, un peu comme si vous vouliez calmer un nourrisson un peu trop bruyant.', 11, 1, 'fe#10#14#0#1d5+15,fd#c#f#0#1d4+11,fc#10#14#0#1d5+15,105#c#f#0#1d4+11');
INSERT INTO `website_shop_objects_templates` VALUES (9006, 82, 'Bouclier du Sadida', 'Ce bouclier servait à l\'origine de tabouret aux Sadidas lorsque ces derniers devaient se reposer. Une fois les pieds repliés, il vous protègera de beaucoup d\'attaques, mais pas des fous rires de vos adversaires.', 12, 1, 'fe#c#f#0#1d4+11,fa#15#19#0#1d5+20,105#c#f#0#1d4+11');
INSERT INTO `website_shop_objects_templates` VALUES (9007, 82, 'Bouclier en Slip', 'Cette création surprenante, est recouverte d\'un Slip en Cuir du Chafer lancier, bouilli, nettoyé et détendu pour épouser les formes du bouclier, qui sont loin de rappeler celles du Chafer, bien plus avantageuses et aguichantes...', 13, 1, 'fd#f#12#0#1d4+14,fc#f#12#0#1d4+14,108#4#5#0#1d2+3,105#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (9008, 82, 'Bouclier d\'Asse', 'Ce splendide bouclier contient un échantillon d\'eau de la Mer d\'Asse, ce qui en plus de vous porter bonheur, pourra vous servir de gourde, si votre dulcinée ne vous accompagne pas durant vos combats.', 16, 1, 'fc#15#19#0#1d5+20,fb#15#19#0#1d5+20,104#c#f#0#1d4+11,108#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (9009, 82, 'Bouclier Abraknyde', 'Caché derrière ce bouclier, les aventuriers les plus naïfs pourront vous prendre pour un Abraknyde et se sauver en courant. Les autres vous agresseront en pensant récupérer quelques ambres.', 19, 1, 'fe#6#8#0#1d3+5,104#8#a#0#1d3+7');
INSERT INTO `website_shop_objects_templates` VALUES (9010, 82, 'Bouclier Pandawa', 'Idéal pour se faire discret sur Pandala, et pour se faire remarquer partout ailleurs, ce bouclier a surtout l\'avantage d\'être recouvert de poils de Pandawas, réputés pour ne jamais déclencher la moindre allergie. Vous pourrez donc sans crainte ranger ce bouclier directement dans votre slip en cuir.', 22, 1, 'fe#6#8#0#1d3+5,107#8#a#0#1d3+7');
INSERT INTO `website_shop_objects_templates` VALUES (9011, 82, 'Cadran de Feu', 'Ce bouclier original vous protégera de l\'élément Feu, et accessoirement, donnera l\'heure à vos adversaires. Très utile pour les aider à chronométrer leur défaite.', 24, 1, '107#7#9#0#1d3+6');
INSERT INTO `website_shop_objects_templates` VALUES (9012, 82, 'Cadran d\'Air', 'Ce bouclier original vous protègera de l\'élément Air, et accessoirement, donnera l\'heure à vos adversaires. Très utile pour les aider à chronométrer leur défaite.', 26, 1, '106#7#9#0#1d3+6');
INSERT INTO `website_shop_objects_templates` VALUES (9013, 82, 'Cadran de Terre', 'Ce bouclier original vous protégera de l\'élément Terre, et accessoirement, donnera l\'heure à vos adversaires. Très utile pour les aider à chronométrer leur défaite.', 27, 1, '104#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (9014, 82, 'Cadran d\'Eau', 'Ce bouclier original vous protégera de l\'élément Eau, et accessoirement, donnera l\'heure à vos adversaires. Très utile pour les aider à chronométrer leur défaite.', 25, 1, '105#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (9015, 82, 'Bouclier du Bûcheron', 'Ce bouclier servait à l\'origine aux bûcherons qui voulaient se protéger de la chute des arbres. Il a vite été détourné de son usage, et sert maintenant à se protéger des chutes des ennemis qui ont parfois une fâcheuse tendance à vous tomber dessus sans prévenir.', 4, 1, 'fa#5#6#0#1d2+4');
INSERT INTO `website_shop_objects_templates` VALUES (9016, 82, 'Bouclier du Mont Kipou', 'Verdâtre et malodorant, ce bouclier n\'en reste pas moins une protection de choix, lorsqu\'il s\'agît d\'affronter les créatures du Mont Kipou.', 1, 1, 'fe#6#8#0#1d3+5,105#8#a#0#1d3+7');
INSERT INTO `website_shop_objects_templates` VALUES (9017, 82, 'Bouclier des Brigandins', 'Si vous avez toujours rêvé d\'être un vrai Brigandin, c\'est le bouclier qu\'il vous faut. Transmis de générations en générations, il vous permettra de détrousser sans prendre le moindre coup, les jeunes aventuriers d\'Astrub.', 9, 1, 'fe#10#14#0#1d5+15,fd#10#14#0#1d5+15,104#8#a#0#1d3+7,106#8#a#0#1d3+7');
INSERT INTO `website_shop_objects_templates` VALUES (9018, 82, 'Le Karde Coeur', 'Un illustre aventurier collectionneur, a passé sa vie à chercher ce type de bouclier. On raconte qu\'une fois quatre de ces boucliers réunis, on pouvait jouir d\'une meilleure vie.', 7, 1, 'fd#a#c#0#1d3+9,fa#a#c#0#1d3+9');
INSERT INTO `website_shop_objects_templates` VALUES (9019, 82, 'Bouclier du Bawbawe', 'Tous les Wabbits ne sont pas de petites créatures inoffensives. En réalité, tous les Wabbits sont d\'infâmes créatures, certains ont même des moeurs barbares et écrasent les Cawottes avec cet énorme bouclier, pour en faire du jus.', 2, 1, 'fe#a#c#0#1d3+9,fc#a#c#0#1d3+9');
INSERT INTO `website_shop_objects_templates` VALUES (9020, 82, 'Derma Tho', 'Ce bouclier en peau, risque de vous coller à la peau, tellement vous l\'apprécierez. N\'oubliez pas de soigner ses verrues et ses furoncles de temps en temps pour éviter qu\'il ne s\'abîme.', 3, 1, '108#a#c#0#1d3+9,106#a#c#0#1d3+9');
INSERT INTO `website_shop_objects_templates` VALUES (9021, 82, 'Bouclier du Captain Amakna', 'Un jeune aventurier avait voulu s\'enrôler dans la milice de Bonta pour défendre les opprimés. Réformé en raison de sa constitution trop faible, il fut tout de même contacté par un Alchimiste d\'Amakna, déterminé à l\'utiliser comme cobaye pour tester une de ses nouvelles potions magiques. L\'effet fut immédiat, le jeune aventurier devint rapidement un véritable guerrier d\'une force extraordinaire, mais aussi complètement stupide. Il avait en fait été transformé en Iop. Il se fit forger ce bouclier réputé indestructible, et le surnom de Captain Amakna (en hommage à l\'illustre Captain Chafer qui disparut dans des circonstances bien mystérieuses) lui fut attribué pour l\'éternité.', 14, 1, 'fe#15#19#0#1d5+20,fd#15#19#0#1d5+20,fa#10#14#0#1d5+15,105#c#f#0#1d4+11,106#c#f#0#1d4+11');
INSERT INTO `website_shop_objects_templates` VALUES (9022, 82, 'Kloume', 'Cet énorme bouclier a jadis, permis au célèbre aventurier Kloume, de ne pas mourir écrasé sous le poids d\'un Craqueleur qui était tombé amoureux de lui. L\'histoire ne raconte pas s\'il a survécu aux effets secondaires de sa relation passionnée avec le Craqueleur.', 15, 1, 'fc#c#f#0#1d4+11,fb#c#f#0#1d4+11,107#8#a#0#1d3+7');
INSERT INTO `website_shop_objects_templates` VALUES (9023, 82, 'Bouclier Volant', 'Aussi étrange que cela puisse paraître, on raconte que ce bouclier en bois et en poils, permet aux aventuriers les plus légers, de s\'envoler quelques instants dans les airs, pour impressionner une dernière fois ses adversaires avant de s\'écraser stupidement sur le sol.', 17, 1, '107#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (9024, 82, 'Bouclier du Chouque', 'Le Chouque se servait de ce bouclier pour se protéger des gros boulets qui lui étaient régulièrement envoyés. Les histoires les plus folles, racontent même que certains boulets étaient vivants.', 18, 1, 'fb#15#19#0#1d5+20,fa#8#a#0#1d3+7,106#8#a#0#1d3+7');
INSERT INTO `website_shop_objects_templates` VALUES (9025, 82, 'Bouclier du Bouftou', 'Assez inutile mais tout de même impressionnant grâce à l\'odeur qu\'il dégage, ce bouclier sera le compagnon de beaucoup de jeunes aventuriers.', 20, 1, '108#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (9026, 82, 'Bouclier de Bowisse', 'Ce bouclier est clairement un hommage à la cape du Bowisse, elle-même étant un hommage à une célèbre relique composée de trois fragments de forme triangulaire. Encore une histoire à dormir debout.', 21, 1, 'fb#c#f#0#1d4+11,107#5#7#0#1d3+4,108#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (9027, 82, 'Bouclier du Craqueleur', 'Ce bouclier en pierre est en fait une tête de Craqueleur écrasée par le pied d\'un Minotoror. Une façon comme une autre de combiner grosse tête et odeurs de pieds.', 23, 1, '108#7#9#0#1d3+6,106#7#9#0#1d3+6,104#7#9#0#1d3+6');
INSERT INTO `website_shop_objects_templates` VALUES (9028, 82, 'Bouclier Terrdala', 'Pour parer les coups de bourre ou les coups tordus, ce bouclier issu du village de Terrdala devrait faire l\'affaire.', 32, 1, 'fa#f#12#0#1d4+14,105#8#a#0#1d3+7');
INSERT INTO `website_shop_objects_templates` VALUES (9029, 82, 'Bouclier Feudala', 'Pour parer les coups de bourre ou les coups tordus, ce bouclier issu du village de Feudala devrait faire l\'affaire.', 33, 1, 'fd#15#19#0#1d5+20,106#c#f#0#1d4+11');
INSERT INTO `website_shop_objects_templates` VALUES (9030, 82, 'Bouclier Aerdala', 'Pour parer les coups de bourre ou les coups tordus, ce bouclier issu du village d\'Aerdala devrait faire l\'affaire.', 30, 1, 'fc#10#14#0#1d5+15,104#c#f#0#1d4+11');
INSERT INTO `website_shop_objects_templates` VALUES (9031, 9, 'Annobusé de Maître Jarbo', 'En son temps, Maître Jarbo était très fort et il possédait richesses et femmes à foison. Mais il n\'avait guère de mérite puisqu\'il tirait tout son pouvoir de son joli anneau. Un jour, il traversa une route. Et PAF Maître Jarbo. Depuis, son anneau se transmet de main en main entre personnes peu scrupuleuses.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9035, 12, 'Potion d\'enclos de Guilde', 'Cette potion vous permet de retourner dans votre enclos de guilde.', 25, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9036, 12, 'Potion du village des Zoths', 'Cette potion vous permet de vous téléporter dans le village des Zoths, si ce dernier vous appartient.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9037, 14, 'Potion de découverte', 'Cette potion permet de dévoiler les personnages invisibles de votre entourage.', 0, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9038, 14, 'Petite potion d\'agression', 'Cette potion vous permet d\'entrer dans une telle rage que vous attaquez automatiquement les ennemis qui s\'approcheront trop près de vous.', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9039, 12, 'Potion de rappel prismatique', 'Cette potion vous permet de vous téléporter vers le prisme allié le plus proche.', 34, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9040, 14, 'Potion d\'agression Moyenne', 'Cette potion vous permet d\'entrer dans une telle rage que vous attaquez automatiquement les ennemis qui s\'approcheront trop près de vous.', 33, 1, '');
