INSERT INTO `website_shop_objects_templates` VALUES (9060, 24, 'Morceau de papier déchiré ', 'C\'est une partie de lettre que quelqu\'un a déchirée. On peut encore y lire : \'... Comme convenu, je m\'arrangerai pour que l\'enquête sur ce marchand n\'aboutisse pas. Venez me verser la somme prévue à l\'endroit habituel où les femmes sont de charmante compagnie.\' \\nLa lettre est signée X.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9061, 32, 'Exoram', 'Exoram doit être escorté hors du camp gobelin et jusqu\'au temple Sram.', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9062, 24, 'Document sur Xephirès', 'Ce document contient de nombreuses informations intéressantes sur l\'individu nommé Xephirès. Notamment, on y apprend qu\'il passe beaucoup de temps à la taverne du Pandawa Ivre.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9063, 24, 'Liste de Milone', 'Cette liste absolument impressionnante vous a été remise par Milone le bijoutier. Elle décrit les objets nécessaires pour confectionner un somptueux joyaux.', 176, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9064, 24, 'Bave du Bouftou Royal', 'Est-elle vraiment différente d\'une bave ordinaire ? En tout cas, ça n\'en a pas l\'air.', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9065, 24, 'Lettre pour Milone', 'Cette lettre, écrite à la hâte, explique à Milone que le bijou est en danger. D\'ailleurs, pourquoi perdez-vous du temps à la lire au lieu de vous précipiter chez lui ?', 176, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9066, 24, 'Lettre du chef des voleurs', 'Retrouvée sur un des voleurs que vous avez vaincus chez Milone : \\nMilone Corichel le bijoutier vient de créer un joyau de grande valeur. Dérobez-le par tous les moyens possibles. \\nVisiblement, les voleurs ont échoué et en plus au dos du message se trouve l\'emplacement de leur repaire. Une petite visite de courtoisie s\'impose, mais mieux vaut s\'y rendre accompagné.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9067, 24, 'Lettre pour Xephirès', 'Cette lettre d\'Oto Mustam explique en détails le plan pour Xephirès.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9068, 24, 'Joyau de Milone', 'Ce joyau est le résultat de vos efforts et de ceux de Milone le bijoutier. Il vaut assurément une petite fortune... pour ceux que ça peut intéresser.', 717, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9069, 24, 'Nouvelle lettre pour Xephirès', 'Oto y décrit ses conditions pour la corruption de Xephirès.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9070, 24, 'Epée étrange', 'Cette épée est vraiment inhabituelle. Vous n\'en avez jamais vu de telle dans Bonta.', 718, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9071, 24, 'Notes du tavernier Feubuk', 'Le tavernier Feubuk a reçu des Ecaflips louches qui ont prononcé le nom de Loudac.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9072, 24, 'Notes du tavernier Pinchaut', 'Le tavernier Pinchaut a entendu des gardes parler de leurs problèmes avec une bande d\'Ecaflips.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9073, 24, 'Insigne de Bandit Ecaflip', 'Vous avez récupéré cet insigne sur les bandits Ecaflips des plaines de Cania.', 49, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9074, 24, 'Bijou d\'Amayiro', 'Ce bijou servira à appâter le chef des bandits afin de le capturer.', 111, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9075, 24, 'Lettre du Xélor', 'Cette lettre vous a été remise par l\'intermédiaire de Marge la bijoutière : \\nAmenez le bijou à Ekusoyk Ubnan à la Taverne de la Chopenbois. Ce sera plus rapide pour nous et beaucoup plus lucratif pour vous.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9076, 24, 'Bijou d\'Amayiro (faux)', 'Ce bijou ressemble à s\'y méprendre à celui qu\'Amayiro vous a envoyé chercher. D\'ailleurs, il vaudrait mieux qu\'il s\'y méprenne, sinon...', 110, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9077, 47, 'Crâne de Feca', 'Le crâne de Feca fait un excellent presse-livres.', 34, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9078, 47, 'Crâne d\'Osamodas', 'Un Tofu par-ci, un Bwork mage par-là : ce disciple d\'Osamodas en a perdu la tête.', 33, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9079, 47, 'Crâne d\'Enutrof', 'Ce trophée était déjà vieux avant de devenir un trophée.', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9080, 47, 'Crâne de Sram', 'Ce trophée était déjà morbide avant de devenir un trophée.', 31, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9081, 47, 'Crâne de Xélor', 'Ce crâne est souvent confondu avec celui de la célèbre momie de Tut Enkarthon. Ne vous y trompez pas : ces bandelettes-ci ne sont pas en carton, mais en papier mâché.', 30, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9082, 47, 'Crâne d\'Ecaflip', 'À défaut de jouer à pile ou face, on pourra jouer aux osselets.', 29, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9083, 47, 'Crâne d\'Eniripsa', 'Ne soyez pas mauvaise langue : Non, Il ne s\'agit pas d\'un crâne de Piaf !', 28, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9084, 47, 'Crâne de Iop', 'Ce trophée sonne aussi creux que lorsqu\'il était plein.', 27, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9085, 47, 'Crâne de Crâ ', 'On pourrait le croire sorti d\'une fouille archéologique, ce crâne de Crâ mignon !', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9086, 47, 'Crâne de Sadida', 'Qui eût cru qu\'il y eut un crâne sous la touffe de cheveux ?', 25, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9087, 47, 'Crâne de Sacrieur', 'Ce sacrieur fait moins le fier sans ses milliers de points de vie.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9088, 47, 'Crâne de Pandawa', 'On aurait pu croire qu\'après la mise en bière le Pandawa aurait une gueule de bois.', 23, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9089, 24, 'Insigne de la patrouille de Bonta', 'Vous avez récupéré cet insigne lors de la (très facile) bataille d\'escarmouche contre Bonta.', 49, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9090, 24, 'Insigne de la patrouille de Brâkmar', 'Vous avez récupéré cet insigne à grand peine lors de la bataille d\'escarmouche contre Brâkmar.', 76, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9094, 24, 'Poison Bwork', 'Ca ressemble davantage à de la gelée de menthe qu\'à du poison. Les Bworks ne sont assurément pas très doués pour ça : ce qui est plus inquiétant, c\'est que les espions de Brâkmar non plus, apparemment.', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9096, 32, 'Tacticien', 'Le tacticien a accepté de vous suivre jusqu\'à votre chef.', 22, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9097, 24, 'Badge du puissant milicien', 'Vous avez trouvé ce badge sur le milicien particulièrement redoutable qui a vaincu plusieurs guerriers de Brâkmar. Son équipement semblait très particulier.', 49, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9098, 24, 'Marteau de Nara', 'Ce marteau indiquera à Oto que vous avez vaincu le forgeron mercenaire de Bonta.', 8, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9099, 24, 'Demande d\'aide d\'Amayiro', 'Cette lettre, signée par Amayiro, est une demande d\'aide officielle.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9100, 24, 'Caleçon de Lenglad', 'Là, c\'est sûr : Lenglad ne fera plus parler de lui avant un moment.', 84, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9101, 24, 'Caisse d\'outils de Nara', 'Cette caisse contient les outils que Nara le forgeron a oubliés.', 44, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9103, 24, 'Plan d\'attaque', 'Cette lettre, datée d\'il y a une semaine, explique en détails le plan d\'attaque contre Bonta. Il faut toutefois se méfier, car une note en fin de page indique que ce plan n\'est pas encore confirmé et sujet à modification dans les prochains jours par l\'officier Kapi Taigne. Par conséquent, vous devez découvrir ce qu\'il en est à l\'heure actuelle.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9104, 24, 'Insigne de la patrouille du Cimetière', 'Vous avez récupéré cet insigne sur la patrouille brâkmarienne que vous avez attaquée au Cimetière des Torturés.', 76, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9105, 24, 'Lettre de Danathor', 'Quelqu\'un a glissé cette lettre dans votre sac pendant qu\'Amayiro vous donnait la mission : \\nRécupérez les documents, mais apportez-les moi plutôt qu\'à Amayiro. Vous serez récompensé. Danathor', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9106, 24, 'Documents secrets de Bonta', 'Ces documents contiennent un bon nombre d\'informations concernant les défenses et le système de Bonta. Mais à qui allez-vous les donner ?', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9107, 24, 'Consignes pour l\'espion de Bonta', 'Pénètre dans la tour de Brâkmar à minuit et récupère tous les documents que tu trouveras au deuxième étage. Reviens ensuite à Bonta en passant par l\'Est de la route. \\nNon, ce n\'est pas VOUS qui devez le faire, c\'était la consigne pour l\'espion que vous devez sauver.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9108, 24, 'Documents brâkmariens secrets', 'Ces documents contiennent de nombreuses informations sur la Corne Edfrit.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9109, 24, 'Bandana Troué ', 'Ce bandana en mauvais état est couvert de glaire, comme s\'il avait servi de mouchoir à plusieurs générations de Wabbits. Il a sans nul doute appartenu à Turorte, en témoigne son odeur de hareng pourri subtilement camouflée par une odeur de cawotte. Pour sentir aussi mauvais après toutes ces années, il est indubitablement imprégné d\'une puissante magie.', 748, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9110, 24, 'Corne Edfrit', 'Vous avez déjà essayé de souffler dedans, mais il ne se passe rien de spécial...', 720, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9112, 24, 'Consigne pour l\'espion brâkmarien', 'Pénètre dans la tour de Bonta à minuit, égorge tous ceux qui sont sur ton chemin, et récupère tous les documents que tu trouveras au premier étage. Reviens ensuite à Brâkmar passant par la route. \\nNon, ce n\'est pas VOUS qui devez le faire, c\'était la consigne pour l\'espion que vous devez retrouver.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9113, 24, 'Documents secrets volés', 'Les documents que l\'espion blessé a récupéré dans la tour de Bonta.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9114, 24, 'Documents secrets froissés', 'Les documents que l\'espion blessé a récupéré dans la tour de Bonta. Ils ont été un peu abimés pendant votre combat contre les forces de Bonta.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9115, 24, 'Salace fourrée au pollen', 'Cette salace a été préparée dans le chaudron primordial ce qui lui confère des vertus particulières. Pour savoir lesquelles, il faudrait pouvoir y goûter, malheureusement c\'est à Turorte qu\'elle est destinée. La vie est parfois injuste.', 719, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9116, 24, 'Caisse d\'équipement', 'Une arme, un casque, un bouclier : cette caisse contient un équipement rudimentaire mais efficace pour les guerriers.', 44, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9117, 7, 'Ougarteau', 'Ougah a la tête dure, plus dure que n\'importe qui, c\'est pourquoi un marteau créé avec son crâne est idéal pour fracasser celui des autres.', 67, 180, '64#13#23#0#1d17+18,5b#2#7#0#1d6+1,7d#12d#190#0#1d100+300,7c#1f#28#0#1d10+30,70#6#a#0#1d5+5,8a#1f#28#0#1d10+30,b0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9118, 89, 'Cadeau Event Shika', '(cadeau offert aux joueurs de Shika pour l\'event, ne pas traduire)', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9119, 89, 'Cadeau Shika', '(cadeau pour les joueurs abonnés de Shika, ne pas traduire)', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9120, 16, 'Chapeau Shika', '(Chapeau pour les abonnés du serveur Shika, ne pas traduire)', 210, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (9121, 17, 'Cape Shika', '(cape destinée aux joueurs abonnés du serveur Shika, ne pas traduire)', 148, 30, '');
INSERT INTO `website_shop_objects_templates` VALUES (9122, 9, 'Blopanneau Griotte', 'Une fois enfilé au bout d\'un doigt, il n\'est plus possible de se débarrasser de cet anneau. Plus vous y pensez, et plus il vous rappelle quelqu\'un.', 149, 50, 'b6#1#0#0#0d0+1,75#1#0#0#0d0+1,70#2#4#0#1d3+1,7e#10#19#0#1d10+15');
