INSERT INTO `website_shop_objects_templates` VALUES (9126, 9, 'Blopanneau Griotte Royal', 'Kroula avait jadis tenté d\'enfiler cet anneau autour de son gros orteil. Il espérait ainsi que ses ennemis daigneraient lui lécher les pieds dans l\'espoir de récupérer quelques gouttes de jus de Blop Royal.', 153, 80, '7d#15#23#0#1d15+20,7c#b#f#0#1d5+10,7e#10#1e#0#1d15+15,70#4#5#0#1d2+3,ae#65#c8#0#1d100+100,b0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9127, 9, 'Blopanneau Reinette Royal', 'Kroula avait jadis tenté d\'enfiler cet anneau autour de son gros orteil. Il espérait ainsi que ses ennemis daigneraient lui lécher les pieds dans l\'espoir de récupérer quelques gouttes de jus de Blop Royal.', 154, 80, '7d#15#23#0#1d15+20,7c#b#f#0#1d5+10,76#10#1e#0#1d15+15,70#4#5#0#1d2+3,ae#65#c8#0#1d100+100,b0#6#a#0#1d5+5');
