INSERT INTO `website_shop_objects_templates` VALUES (9130, 1, 'Ougamulette', 'Cette réplique approximative du grand Ougah se porte autour du cou, avec un regard noir et une barbe correctement entretenue.', 127, 181, 'd3#6#a#0#1d5+5,b0#b#14#0#1d10+10,ae#1f5#258#0#1d100+500,6f#1#0#0#0d0+1,8a#1f#28#0#1d10+30,70#5#7#0#1d3+4,7c#29#32#0#1d10+40,7d#fb#12c#0#1d50+250');
INSERT INTO `website_shop_objects_templates` VALUES (9131, 9, 'Anneau Colerette', 'Colerette la jeune Crâette, a perdu la tête dans les bois de Litneg. La pauvre fille a reçu une hache lancée par Brouce Boulgoure, qui l\'avait prise par méprise pour une fougère géante. Etre une belle plante ne paie pas toujours.', 146, 188, '77#1f#32#0#1d20+30,7d#65#96#0#1d50+100,7c#1f#28#0#1d10+30,70#5#7#0#1d3+4,75#1#0#0#0d0+1,e1#b#14#0#1d10+10,b0#b#14#0#1d10+10,f4#6#a#0#1d5+5,f1#6#a#0#1d5+5,f0#6#a#0#1d5+5,d3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9132, 9, 'Anneau Chevelu', 'Avec cet anneau, en plus d\'avoir un cheveu sur la langue et un poil dans la main, vous pourrez vous vanter d\'avoir des cheveux autour des doigts.', 147, 180, '76#1f#32#0#1d20+30,7d#97#c8#0#1d50+150,7c#10#19#0#1d10+15,70#4#5#0#1d2+3,73#3#4#0#1d2+2,b0#b#14#0#1d10+10,f1#6#a#0#1d5+5,f0#6#a#0#1d5+5,d6#6#a#0#1d5+5,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9133, 9, 'Alliance Boletée', 'Si vos ennemis sont allergiques aux champignons, laissez-les vous croquer les doigts.', 148, 186, '7d#65#96#0#1d50+100,7c#1f#28#0#1d10+30,7e#1f#32#0#1d20+30,70#4#5#0#1d2+3,b2#6#a#0#1d5+5,b6#2#0#0#0d0+2,b0#b#f#0#1d5+10,f4#6#a#0#1d5+5,f1#6#a#0#1d5+5,d4#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9134, 2, 'Arc à Lamelles', 'Construit à la base pour servir de lattes pour les sommiers de lits, ces lamelles ont fini par être utilisées dans la fabrication de cet arc, qui vous permettra d\'endormir vos ennemis pour l\'éternité.', 61, 187, '61#a#15#0#1d12+9,63#a#15#0#1d12+9,76#1f#32#0#1d20+30,7e#1f#32#0#1d20+30,7c#1f#28#0#1d10+30,7d#fb#12c#0#1d50+250,73#3#4#0#1d2+2,70#5#7#0#1d3+4,ae#12d#190#0#1d100+300,b0#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (9135, 3, 'Baguetterelle', 'A l\'origine, il suffisait de souffler très fort dans cette trompette fongique, pour faire arriver le ménestrel Francisque Kabroule. Ce dernier se mettait alors à chanter, et tous les monstres mourraient sur place. Bon comme c\'était un peu trop facile comme technique pour tuer les monstres, les dieux ont décidé de la boucher et de la transformer en une vulgaire baguette.', 66, 184, '64#9#10#0#1d8+8,62#9#10#0#1d8+8,5e#1#7#0#1d7+0,65#1#0#0#0d0+1,7e#1f#32#0#1d20+30,77#1f#32#0#1d20+30,7d#fb#12c#0#1d50+250,7c#1f#28#0#1d10+30,70#4#5#0#1d2+3,b2#6#a#0#1d5+5,8a#b#f#0#1d5+10,b0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9136, 4, 'Bâton Champmanique', 'Les trois pointes de ce bâton permettent de concentrer les résidus de plasmogrine présents dans la brise quadramentale. Mettez un peu de salive sur les pointes, orientez le bâton dans le sens des aiguilles d\'une montre Xélor inversée, comptez jusqu\'à soixante, ou essayez jusqu\'à six si vous êtes Iop. Restez concentré, serrez les fesses, voilà vous avez une chance sur deux de vous prendre un coup de tonnerre, ou de transformer vos ennemis en Kirboules hirsutes.', 80, 191, '64#12#1b#0#1d10+17,5c#1#8#0#1d8+0,5b#1#8#0#1d8+0,7b#1f#32#0#1d20+30,76#1f#32#0#1d20+30,7e#1f#32#0#1d20+30,7c#15#1e#0#1d10+20,7d#c9#fa#0#1d50+200,70#4#5#0#1d2+3,d6#6#a#0#1d5+5,b6#1#0#0#0d0+1,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (9137, 5, 'Couteaux à Champignons', 'Ces couteaux étaient autrefois utilisés pour retirer les mycoses qui parasitaient les pieds des aventuriers. On leur coupait les pieds juste au niveau du genou.', 69, 187, '64#8#e#0#1d7+7,62#8#e#0#1d7+7,65#1#0#0#0d0+1,77#1f#32#0#1d20+30,7d#c9#fa#0#1d50+200,7c#15#1e#0#1d10+20,73#2#3#0#1d2+1,70#5#7#0#1d3+4,e2#1f#32#0#1d20+30,ae#12d#190#0#1d100+300,b0#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (9138, 19, 'Hache à Lamelles', 'Les différentes lamelles de cette hache permettent de couper très rapidement le saucisson. Un seul coup de hache permet de couper trois tranches. Pour tuer les ennemis, c\'est un peu moins utile, sauf si vous avez l\'habitude de les manger en tranches.', 51, 176, '64#b#17#0#1d13+10,60#b#17#0#1d13+10,7d#c9#fa#0#1d50+200,7c#15#1e#0#1d10+20,b0#b#14#0#1d10+10,f0#6#a#0#1d5+5,70#6#a#0#1d5+5,73#3#4#0#1d2+2,75#1#0#0#0d0+1,7b#29#3c#0#1d20+40');
INSERT INTO `website_shop_objects_templates` VALUES (9139, 11, 'Bottines des sous-bois', 'Ces bottines sont parfaites pour marcher dans les sous-bois, sans écraser les feuilles mortes. Attention cependant, leurs origines végétales les poussent inexorablement à écraser tout ce qui s\'apparente de près ou de loin à du fumier.', 115, 175, '7d#c9#fa#0#1d50+200,7c#1f#28#0#1d10+30,7b#1f#32#0#1d20+30,70#5#7#0#1d3+4,8a#6#a#0#1d5+5,75#1#0#0#0d0+1,80#1#0#0#0d0+1,ae#191#2bc#0#1d300+400,b0#15#1e#0#1d10+20,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9140, 11, 'Chaussons Pignons', 'Ces chaussons sont recouverts de petites aérations qui contrairement aux idées reçues, ne permettent pas à vos pieds de mieux s\'aérer, mais plutôt aux spores des champignons installés sur vos pieds, de s\'enfuir rapidement pour aller parasiter d\'autres aventuriers plus facilement.', 116, 181, '76#33#46#0#1d20+50,7d#fb#12c#0#1d50+250,7c#1f#32#0#1d20+30,80#1#0#0#0d0+1,70#6#a#0#1d5+5,b0#6#a#0#1d5+5,f3#6#a#0#1d5+5,f2#6#a#0#1d5+5,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9141, 17, 'Caprin', 'Si cette cape n\'était pas recouverte de moisissure, elle pourrait servir de nappe. Ce n\'est pas grave, elle pourra toujours vous servir de linceul.', 154, 181, '7d#c9#fa#0#1d50+200,77#29#3c#0#1d20+40,7c#1f#28#0#1d10+30,73#2#3#0#1d2+1,70#6#a#0#1d5+5,b0#15#1e#0#1d10+20,f3#6#a#0#1d5+5,d2#6#a#0#1d5+5,f4#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9142, 17, 'Capignon', 'Cette cape était autrefois réservée aux meilleurs grimpeurs, aux aventuriers qui étaient les plus rapides pour escalader la montagne des Craqueleurs. Aujourd\'hui elle sert surtout à se faire remarquer dans les soirées mondaines.', 150, 190, '7e#1f#32#0#1d20+30,7d#c9#fa#0#1d50+200,7c#1f#28#0#1d10+30,73#1#2#0#1d2+0,70#5#7#0#1d3+4,b2#5#7#0#1d3+4,ae#12d#1f4#0#1d200+300,b0#b#14#0#1d10+10,f4#6#a#0#1d5+5,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9143, 10, 'String Tue-Mouche', 'Comme son nom l\'indique, ce string est particulièrement efficace pour tuer les mouches un peu trop intéressées par votre anatomie. Il est déconseillé de l\'arracher avec les dents, même si vous appréciez cela.', 132, 192, '7d#c9#fa#0#1d50+200,7c#1f#28#0#1d10+30,7e#1f#32#0#1d20+30,73#2#3#0#1d2+1,b2#6#a#0#1d5+5,70#4#5#0#1d2+3,ae#c9#12c#0#1d100+200,b0#b#14#0#1d10+10,d5#5#7#0#1d3+4,d2#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (9144, 10, 'Ceinture Mycosine', 'La meilleure façon de ne pas avoir de champignons dans l\'entrejambe, c\'est de les attirer ailleurs. Comme il n\'y avait déjà plus de place dans vos chaussures pour loger d\'autres champignons, vous pourrez utiliser cette ceinture, véritable substrat pour tout bon champignon digne de ce nom.', 133, 177, '76#29#3c#0#1d20+40,7d#12d#15e#0#1d50+300,7c#15#1e#0#1d10+20,73#3#4#0#1d2+2,70#4#5#0#1d2+3,b6#1#0#0#0d0+1,ae#12d#1f4#0#1d200+300,b0#b#14#0#1d10+10,f1#6#a#0#1d5+5,f0#6#a#0#1d5+5,d5#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9145, 10, 'Tranche des Sous-bois', 'Prenez un Orme, retirez-lui son écorce, laissez-la tremper dans une flaque, enfouissez-la dans la vase pendant plusieurs mois, recouvrez-là de spores de champignons, mettez-là sous votre lit pendant une semaine en la badigeonnant de graisse de Blop tous les soirs, et voilà vous avez une ceinture en écorce qui sent très mauvais. Alors heureux ?', 134, 179, '7b#1f#32#0#1d20+30,7d#15f#190#0#1d50+350,7c#1f#32#0#1d20+30,73#2#3#0#1d2+1,70#6#a#0#1d5+5,b6#1#0#0#0d0+1,b0#15#1e#0#1d10+20,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9146, 10, 'Ougature', 'Sur l\'étiquette de cette ceinture, on peut lire : \"Nous sommes désolés mais ce n\'est pas en portant cette ceinture que vous aurez le déhanchement légendaire d\'Ougah\". Et alors ?', 135, 185, '7d#12d#15e#0#1d50+300,7c#29#32#0#1d10+40,70#6#a#0#1d5+5,8a#1f#28#0#1d10+30,75#1#0#0#0d0+1,b6#2#0#0#0d0+2,b0#b#14#0#1d10+10,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9147, 16, 'Chapignon', 'Prenez un Dora, recouvrez-le de bave de Bouftou et de la sueur de Iop. Laissez le tout moisir pendant quelques semaines, et voilà vous avec une réplique de Chapignon. Attention, ce chapeau donne parfois des hallucinations.', 221, 185, '7d#fb#12c#0#1d50+250,7c#15#1e#0#1d10+20,77#1f#32#0#1d20+30,73#3#5#0#1d3+2,70#6#a#0#1d5+5,8a#b#14#0#1d10+10,b0#b#f#0#1d5+10,d4#6#a#0#1d5+5,d5#6#a#0#1d5+5,b6#1#0#0#0d0+1,ae#c9#12c#0#1d100+200');
INSERT INTO `website_shop_objects_templates` VALUES (9148, 9, 'Blopanneau Multicolore Royal', 'Plutôt que de réduire sa consommation de jus de Blop frelaté, Shika Ingalsse préféra continuer de faucher en état d\'ébriété. C\'est en titubant dans les champs qu\'elle tomba sur cet étrange anneau. Malheureusement, cette histoire ne comporte qu\'une seule chute.', 157, 90, '7d#15#28#0#1d20+20,7c#10#19#0#1d10+15,8a#10#19#0#1d10+15,b2#3#5#0#1d3+2,b6#1#0#0#0d0+1,d4#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (9149, 1, 'Amublop Griotte', 'Quand Lorkos voulut pénétrer dans le Labyrinthe du Minotoror, il n\'hésita pas une seconde à équiper son Amublop. Personne n\'a jamais su pourquoi.', 128, 50, '7d#1a#28#0#1d15+25,7c#b#f#0#1d5+10,7e#10#19#0#1d10+15,73#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (9150, 1, 'Amublop Reinette', 'Quand Lorkos voulut pénétrer dans le Labyrinthe du Minotoror, il n\'hésita pas une seconde à équiper son Amublop. Personne n\'a jamais su pourquoi.', 129, 50, '7d#1a#28#0#1d15+25,7c#b#f#0#1d5+10,76#10#19#0#1d10+15,73#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (9151, 1, 'Amublop Coco', 'Quand Lorkos voulut pénétrer dans le Labyrinthe du Minotoror, il n\'hésita pas une seconde à équiper son Amublop. Personne n\'a jamais su pourquoi.', 130, 50, '7d#1a#28#0#1d15+25,7c#b#f#0#1d5+10,77#10#19#0#1d10+15,73#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (9152, 1, 'Amublop Indigo', 'Quand Lorkos voulut pénétrer dans le Labyrinthe du Minotoror, il n\'hésita pas une seconde à équiper son Amublop. Personne n\'a jamais su pourquoi.', 131, 50, '7d#1a#28#0#1d15+25,7c#b#f#0#1d5+10,73#4#5#0#1d2+3,7b#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (9153, 1, 'Amublop Griotte Royale', 'Cette amulette coûte beaucoup plus cher à fabriquer qu\'une Amublop classique. Mais il faut voir le bon côté des choses, elle peut aussi se revendre plus cher, surtout si vous arnaquez un habitant d\'Astrub.', 132, 80, '7d#10#1e#0#1d15+15,7e#10#1e#0#1d15+15,70#3#5#0#1d3+2,b2#3#5#0#1d3+2,6f#1#0#0#0d0+1,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (9154, 1, 'Amublop Reinette Royale', 'Cette amulette coûte beaucoup plus cher à fabriquer qu\'une Amublop classique. Mais il faut voir le bon côté des choses, elle peut aussi se revendre plus cher, surtout si vous arnaquez un habitant d\'Astrub.', 133, 80, '7d#10#1e#0#1d15+15,76#10#1e#0#1d15+15,70#3#5#0#1d3+2,b2#3#5#0#1d3+2,6f#1#0#0#0d0+1,b6#1#0#0#0d0+1');
