INSERT INTO `website_shop_objects_templates` VALUES (9157, 1, 'Amublop Multicolore Royale', 'Sans additif ni colorant, cette amulette serait tout simplement transparente. Rassurez-vous, personne ne vous demandera de la manger.', 136, 90, '7d#29#46#0#1d30+40,7c#10#1e#0#1d15+15,70#4#6#0#1d3+3,8a#15#1e#0#1d10+20,6f#1#0#0#0d0+1,d5#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (9158, 11, 'Bloptes Griottes', 'Inutile de râler parce que le nom de ces bottes est imprononçable, cette particularité vous sauvera la vie, quand un brigand de grand chemin vous demandera : \"Donne-moi tes Blopetes, non tes Blotpes, non tes Plobtes, non...\". Vous aurez alors tout le temps nécessaire pour vous enfuir en courant.', 117, 50, '7d#15#23#0#1d15+20,7e#b#f#0#1d5+10,8a#b#f#0#1d5+10,b6#1#0#0#0d0+1,ae#65#96#0#1d50+100,b0#1#5#0#1d5+0');
