INSERT INTO `website_shop_objects_templates` VALUES (9162, 11, 'Bloptes Griotte Royales', 'Prononcez dix-huit fois le mot \"Bloptes\" le plus rapidement possible. Voilà, vous avez l\'air d\'un Iop.', 121, 80, '7d#1a#28#0#1d15+25,7e#10#1e#0#1d15+15,73#2#3#0#1d2+1,75#1#0#0#0d0+1,80#1#0#0#0d0+1,b6#1#0#0#0d0+1,d5#5#8#0#1d4+4');
