INSERT INTO `website_shop_objects_templates` VALUES (9165, 11, 'Bloptes Indigo Royales', 'Prononcez dix-huit fois le mot \"Bloptes\" le plus rapidement possible. Voilà, vous avez l\'air d\'un Iop.', 124, 80, '7d#1a#28#0#1d15+25,7b#10#1e#0#1d15+15,73#2#3#0#1d2+1,75#1#0#0#0d0+1,80#1#0#0#0d0+1,b6#1#0#0#0d0+1,d3#5#8#0#1d4+4');
INSERT INTO `website_shop_objects_templates` VALUES (9166, 11, 'Bloptes Multicolores Royales', 'Avec ou sans rembourrage ces bottes restent étranges. Il est donc inutile de les rembourrer avec autre chose que vos pieds.', 125, 90, '7d#1f#32#0#1d20+30,7c#10#19#0#1d10+15,8a#10#1e#0#1d15+15,80#1#0#0#0d0+1,f0#2#a#0#1d9+1,f3#2#a#0#1d9+1,f1#2#a#0#1d9+1,f2#2#a#0#1d9+1,d3#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (9167, 10, 'Blopture Griotte', 'Derrière ce nom stupide, se cache en réalité une ceinture originale, dont on ne connaît pas vraiment les défauts, ni les qualités. On sait tout de même qu\'elle est reconnue d\'utilité publique grâce à la protection exceptionnelle qu\'elle confère aux poignées d\'amour.', 136, 50, '7d#15#23#0#1d15+20,7c#b#f#0#1d5+10,7e#b#f#0#1d5+10,70#1#2#0#1d2+0,9e#65#12c#0#1d200+100');
INSERT INTO `website_shop_objects_templates` VALUES (9168, 10, 'Blopture Reinette', 'Derrière ce nom stupide, se cache en réalité une ceinture originale, dont on ne connaît pas vraiment les défauts, ni les qualités. On sait tout de même qu\'elle est reconnue d\'utilité publique grâce à la protection exceptionnelle qu\'elle confère aux poignées d\'amour.', 137, 50, '7d#15#23#0#1d15+20,7c#b#f#0#1d5+10,76#b#f#0#1d5+10,70#1#2#0#1d2+0,9e#65#12c#0#1d200+100');
INSERT INTO `website_shop_objects_templates` VALUES (9169, 10, 'Blopture Coco', 'Derrière ce nom stupide, se cache en réalité une ceinture originale, dont on ne connaît pas vraiment les défauts, ni les qualités. On sait tout de même qu\'elle est reconnue d\'utilité publique grâce à la protection exceptionnelle qu\'elle confère aux poignées d\'amour.', 138, 50, '7d#15#23#0#1d15+20,7c#b#f#0#1d5+10,77#b#f#0#1d5+10,70#1#2#0#1d2+0,9e#65#12c#0#1d200+100');
INSERT INTO `website_shop_objects_templates` VALUES (9170, 10, 'Blopture Indigo', 'Derrière ce nom stupide, se cache en réalité une ceinture originale, dont on ne connaît pas vraiment les défauts, ni les qualités. On sait tout de même qu\'elle est reconnue d\'utilité publique grâce à la protection exceptionnelle qu\'elle confère aux poignées d\'amour.', 139, 50, '7d#15#23#0#1d15+20,7c#b#f#0#1d5+10,7b#b#f#0#1d5+10,70#1#2#0#1d2+0,9e#65#12c#0#1d200+100');
INSERT INTO `website_shop_objects_templates` VALUES (9171, 10, 'Blopture Griotte Royale', 'Dépourvue de boucle, cette ceinture peut tout de même faire très mal si vous vous en servez comme fouet sur un postérieur à la peau fragile. Les pointes en fer rouillées sont à commander séparément.', 140, 80, '7e#10#1e#0#1d15+15,7d#1a#2d#0#1d20+25,7c#10#19#0#1d10+15,73#2#3#0#1d2+1,9e#c9#190#0#1d200+200,b0#6#a#0#1d5+5,d5#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (9172, 10, 'Blopture Reinette Royale', 'Dépourvue de boucle, cette ceinture peut tout de même faire très mal si vous vous en servez comme fouet sur un postérieur à la peau fragile. Les pointes en fer rouillées sont à commander séparément.', 141, 80, '76#10#1e#0#1d15+15,7d#1a#2d#0#1d20+25,7c#10#19#0#1d10+15,73#2#3#0#1d2+1,9e#c9#190#0#1d200+200,b0#6#a#0#1d5+5,d2#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (9173, 10, 'Blopture Coco Royale', 'Dépourvue de boucle, cette ceinture peut tout de même faire très mal si vous vous en servez comme fouet sur un postérieur à la peau fragile. Les pointes en fer rouillées sont à commander séparément.', 142, 80, '77#10#1e#0#1d15+15,7d#1a#2d#0#1d20+25,7c#10#19#0#1d10+15,73#2#3#0#1d2+1,9e#c9#190#0#1d200+200,b0#6#a#0#1d5+5,d5#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (9174, 10, 'Blopture Indigo Royale', 'Dépourvue de boucle, cette ceinture peut tout de même faire très mal si vous vous en servez comme fouet sur un postérieur à la peau fragile. Les pointes en fer rouillées sont à commander séparément.', 143, 80, '7b#10#1e#0#1d15+15,7d#1a#2d#0#1d20+25,7c#10#19#0#1d10+15,73#2#3#0#1d2+1,9e#c9#190#0#1d200+200,b0#6#a#0#1d5+5,d3#3#5#0#1d3+2');
INSERT INTO `website_shop_objects_templates` VALUES (9175, 10, 'Blopture Multicolore Royale', 'En serrant suffisamment fort cette ceinture, on peut réussir à bloquer entièrement l\'appareil digestif de son propriétaire. Il ne reste ensuite plus qu\'à trouver une utilité à cet acte profondément débile.', 144, 90, '7d#29#3c#0#1d20+40,8a#15#23#0#1d15+20,7c#15#1e#0#1d10+20,70#6#8#0#1d3+5,d2#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (9176, 5, 'Lame Assacre', 'Lorsque le Bworker commença à étriper lentement Francisque Kabroule, ce dernier se mit à chanter : \"Et ça continue encore et encore, c\'est que le début d\'accord, d\'accord...\". Depuis, le Bworker est devenu sourd.', 70, 182, '64#8#11#0#1d10+7,60#6#a#0#1d5+5,63#6#a#0#1d5+5,7d#fb#12c#0#1d50+250,76#1f#32#0#1d20+30,77#1f#32#0#1d20+30,73#2#3#0#1d2+1,70#4#6#0#1d3+3,f2#6#a#0#1d5+5,d4#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9177, 9, 'Bracelet Ventré ', 'Les trois pointes de ce bracelet représentent les trois faiblesses du Bworker : sa soif de vengeance, sa soif de victoire, et sa soif tout court.', 158, 179, '76#1a#28#0#1d15+25,77#1a#28#0#1d15+25,7d#97#c8#0#1d50+150,7c#15#1e#0#1d10+20,73#2#3#0#1d2+1,70#6#a#0#1d5+5,ae#12d#190#0#1d100+300,b0#b#14#0#1d10+10,f3#6#a#0#1d5+5,d5#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9178, 9, 'Anneau Bliteré ', 'Cet anneau est recouvert des mucosités du Bworker. Les petites pointes lui permettent de se curer le nez avec plus d\'efficacité.', 159, 179, '7b#1a#28#0#1d15+25,7e#1a#28#0#1d15+25,7d#97#c8#0#1d50+150,7c#15#1e#0#1d10+20,73#2#3#0#1d2+1,70#6#a#0#1d5+5,ae#12d#190#0#1d100+300,b0#b#14#0#1d10+10,f0#6#a#0#1d5+5,d2#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9179, 1, 'Amulette Ripage', 'Un jour, le Captain Chafer rencontra le Bworker, il prit l\'initiative de lui dire : \"ton postérieur, ta tête, quelle différence ?\". Depuis ce jour, personne n\'a revu le Captain Chafer. Même son célèbre slip moulant en cuir semble avoir disparu.', 137, 184, 'b0#b#14#0#1d10+10,ae#12d#190#0#1d100+300,e2#b#14#0#1d10+10,6f#1#0#0#0d0+1,70#6#a#0#1d5+5,73#1#2#0#1d2+0,7d#c9#fa#0#1d50+200,7c#1f#28#0#1d10+30,77#1f#32#0#1d20+30,76#1f#32#0#1d20+30,f3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9180, 17, 'Cape Erforée', 'On raconte que le Bworker s\'est cousu cette cape avec la peau des fesses de Rushu. Cette histoire aurait pu être crédible si le Bworker savait coudre.', 151, 185, '77#29#3c#0#1d20+40,76#29#3c#0#1d20+40,7c#1f#28#0#1d10+30,7d#c9#fa#0#1d50+200,8a#6#a#0#1d5+5,75#1#0#0#0d0+1,e2#15#1e#0#1d10+20,b0#15#1e#0#1d10+20,d3#6#a#0#1d5+5,70#4#6#0#1d3+3');
INSERT INTO `website_shop_objects_templates` VALUES (9181, 16, 'Casque Harnage', 'Ce magnifique casque renferme bien des secrets, pendant de longues années, lorsqu\'il était le seul compagnon du Bworker, et lorsqu\'il était encore vivant, le Bworker lui aurait confié toutes ses histoires de protections usagées. A force d\'entendre ces atrocités, le casque a fini par mourir.', 212, 189, '7b#29#3c#0#1d20+40,7e#29#3c#0#1d20+40,7c#15#1e#0#1d10+20,7d#c9#fa#0#1d50+200,73#3#4#0#1d2+2,b2#6#a#0#1d5+5,70#6#a#0#1d5+5,b0#15#1e#0#1d10+20,b6#2#0#0#0d0+2,f1#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9182, 11, 'Bottes Répané ', 'Il y a bien longtemps, Danous Kouaide a voulu faire le malin et battre le Bworker dans un concours de blagues : \"Si tes bottes sont recouvertes de boucles d\'oreilles c\'est parce que tu n\'as pas compris que les bottes ne se mettaient pas aux oreilles\". Le Bworker lui a répondu avec un coup de hache sur le crâne.', 126, 184, '7b#1f#32#0#1d20+30,7e#1f#32#0#1d20+30,7d#c9#fa#0#1d50+200,7c#15#1e#0#1d10+20,b0#6#a#0#1d5+5,70#6#a#0#1d5+5,b2#6#a#0#1d5+5,b6#2#0#0#0d0+2,d6#6#a#0#1d5+5,80#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (9183, 10, 'Ceinture Toré ', 'Les deux clous de la ceinture se plantaient directement dans les poignées d\'amour du Bworker. Lorsqu\'il se trémoussait en faisant la danse du ventre pour distraire ses ennemis, on pouvait parfois apercevoir les coutures de ses sous-vêtements en peau de Kilibriss. L\'érotisme exacerbé du Bworker a fait vaciller plus d\'un ennemi. Sa lame s\'est contentée de les achever.', 145, 181, '7b#1f#32#0#1d20+30,7e#1f#32#0#1d20+30,7c#15#1e#0#1d10+20,7d#fb#12c#0#1d50+250,73#1#2#0#1d2+0,70#4#5#0#1d2+3,b2#4#5#0#1d2+3,75#1#0#0#0d0+1,8a#6#a#0#1d5+5,b0#b#14#0#1d10+10,f4#6#a#0#1d5+5,d6#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9184, 16, 'Casque de Galgarion', 'Malgré les apparences, ce casque ne vous permettra pas de mieux entendre... mais de voir plus loin ! En revanche, méfiez-vous des bourrasques inattendues car vous allez finir par vous envoler.', 213, 33, '75#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (9185, 16, 'Coiffe de Goultard', 'Cette coiffe ne vous rendra pas plus féroce et encore moins plus puissant... Et si vous croyez que les aventuriers un peu naïfs vont vous prendre pour Goultard vous vous fourrez le doigt dans l\'œil ! Mais grâce à elle on vous verra arriver de loin, c\'est déjà ça !', 214, 30, '73#3#a#0#1d8+2');
INSERT INTO `website_shop_objects_templates` VALUES (9186, 10, 'Ceinture de Flash Gorgone', 'On ne connait que peu de chose sur Flash Gorgone, hormis sa passion pour les vases en porcelaine. Une légende raconte que ce héros courait tellement vite que même les Tofus ne parvenaient pas à le rattraper. Malheureusement, à force d\'être tout le temps pressé, il arriva un jour où il attacha mal sa ceinture... et s\'empêtra les pieds dedans. Sa collection de porcelaine s\'en souvient encore...', 146, 48, '7c#10#19#0#1d10+15,70#2#4#0#1d3+1');
INSERT INTO `website_shop_objects_templates` VALUES (9187, 16, 'Coiffe de Maître Noir Jack', 'L\'Eniripsa Maître Noir Jack a toujours été passionné par la couture. C\'est ce qui l\'a d\'ailleurs conduit à devenir un expert en points de suture. Ami des tailleurs, il aurait conçu cette coiffure bicolore en s\'inspirant de celle d\'une tailleuse cruelle qui extermina jadis la tribu Ouginak des Maciens... Charmant, non ?', 215, 33, '7c#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (9188, 16, 'Sombrero de Pépitox', 'Ce sombrero est le seul vestige d\'un sombre héros Xélor qui aurait soudainement disparu. La dernière fois qu\'on l\'aurait vu, il venait tout juste de chanter la sérénade à sa belle. On raconte que les frères de la jeune fille ne seraient pas étrangers à cette disparition, mais certains pensent qu\'il aurait été emmené dans une dimension parallèle...  Le mystère reste entier...', 216, 40, '70#3#7#0#1d5+2');
INSERT INTO `website_shop_objects_templates` VALUES (9189, 16, 'Cornes de XVII', 'A force de vouloir encorner les autres aventuriers, c\'est vous qui risquez d\'avoir la tête comme une passoire ! En effet, les Cornes de XVII, le Démon de la dix-septième Heure, ont la faculté extraordinaire de vous faire oublier pratiquement tout... sauf peut-être l\'heure du déjeuner !', 217, 20, '8a#6#14#0#1d15+5');
INSERT INTO `website_shop_objects_templates` VALUES (9190, 16, 'Coiffe de Crâ Cramé ', 'Voici une coiffe parfaitement adaptée aux Crâs qui n\'ont pas peur de passer pour des abrutis. C\'est vrai qu\'en la portant vous n\'aurez pas franchement l\'air très intelligent. D\'ailleurs ceux qui osent l\'arborer sont généralement des Iops ou des aventuriers avec déjà quelques neurones en moins...', 218, 35, '76#b#32#0#1d40+10,7c#b#14#0#1d10+10,9b#1#14#0#1d20+0');
INSERT INTO `website_shop_objects_templates` VALUES (9191, 6, 'Epée de Pym', 'Cette épée semble avoir été arrachée à l\'enseigne d\'un honnête forgeron... Espérons qu\'elle vous enseignera à frapper plus fort qu\'avant ! Sinon il ne vous restera plus qu\'à ouvrir votre propre échoppe.', 84, 35, '64#b#14#0#1d10+10,ae#65#96#0#1d50+100,76#1#f#0#1d15+0,77#1#f#0#1d15+0');
INSERT INTO `website_shop_objects_templates` VALUES (9192, 10, 'Beignature', 'Lorsque vous aurez équipé cette ceinture, vous vous apercevrez rapidement que vos hanches n\'auront jamais été aussi alléchantes.', 147, 45, '7d#1#14#0#1d20+0,7c#1#f#0#1d15+0,b8#1#5#0#1d5+0,d2#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (9193, 1, 'Tartamulette', 'Si vous avez toujours rêvé de distribuer des tartes à vos amis, offrez-leur cette amulette.', 138, 43, '76#1#14#0#1d20+0,73#1#4#0#1d4+0,8a#1#a#0#1d10+0,ae#1#64#0#1d100+0,d2#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (9194, 16, 'Caskogato', 'Autrefois, les poux vous dévoraient le crâne. Avec ce chapeau sur la tête, les Pious vous picoreront le crâne. Parfois, il vaut mieux rester chauve.', 219, 44, '76#1#1e#0#1d30+0,7d#1#1e#0#1d30+0,7c#1#f#0#1d15+0,d2#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (9195, 17, 'Capogato', 'Une fois enroulée autour de fruits confits et recouverte de gelée royale, cette cape peut être dégustée en suppositoire.', 152, 45, '76#1#a#0#1d10+0,7d#1#1e#0#1d30+0,70#1#3#0#1d3+0,d2#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (9196, 17, 'Cape Paupayahn', 'Cette cape confectionnée à partir d\'énormes graines diffuse une odeur persistante d\'aisselle de Bitouf aérien. Il paraît que ça permet d\'exciter son entourage à moindre frais.', 153, 45, '77#1#a#0#1d10+0,7d#1#1e#0#1d30+0,70#1#3#0#1d3+0,d4#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (9197, 16, 'Chapeau Paupayahn', 'Ce chapeau vous permettra d\'étancher vos petites soifs. Le sucre est à commander séparément.', 220, 44, '77#1#1e#0#1d30+0,7d#1#1e#0#1d30+0,7c#1#f#0#1d15+0,d4#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (9198, 9, 'Anneau Paupayahn', 'Lorsque votre eau ou votre bière n\'a plus de goût, trempez-y cet anneau.', 160, 45, '7d#1#14#0#1d20+0,7c#1#f#0#1d15+0,b7#1#5#0#1d5+0,d4#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (9199, 11, 'Bottes Paupayahn', 'Voilà ce qui arrive lorsque l\'on essaye de casser des tasses à coups de bottes.', 127, 43, '7d#1#14#0#1d20+0,73#1#4#0#1d4+0,8a#1#a#0#1d10+0,ae#1#64#0#1d100+0,d4#1#5#0#1d5+0');
INSERT INTO `website_shop_objects_templates` VALUES (9200, 75, 'Parchemin de Sort Invocation de Chaferfu', '(Double clic pour apprendre le sort) \\nCe parchemin vous permettra d\'apprendre le sort d\'invocation de Chaferfu.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9201, 75, 'Pawchemin de la Cawotte', 'Ce pawchemin décwit une méthode simple en 101 leçons, qui vous pewmettwa d\'appwendwe en autodidacte les bases de la fameuse, mais pas si secwète que ça, technique du Wa Wabbit.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9202, 9, 'L\'autre Annobusé de Maître Jarbo', 'Même mort, Maître Jarbo continua à forger des artefact complètement déphasés avec l\'équilibre cosmique du Monde. Quand il eut forgé son second anneau, il se dit avec tristesse que s\'il l\'avait eu plus tôt, il aurait pu traverser les routes sans risques. Un démon le lui vola un jour et le cacha dans le monde des vivants pour les aventuriers en mal de puissance.', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9233, 113, 'Cape Obvijevan', 'Cet objet polymorphe établit une relation de prédateur ou de symbiote avec les capes inanimées. (Vous devez nourrir cette cape vivante en lui donnant à manger d\'autres capes. Vous pouvez lui donner un nouveau repas toutes les douze heures.)', 149, 1, '3cb#1#0#0#0d0+1,3cc#1#0#0#0d0+1,3cd#b#0#0#0d0+11,3ce#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (9234, 113, 'Chapeau Obvijevan', 'Cet objet polymorphe établit une relation de prédateur ou de symbiote avec les couvres-chef inanimés. (Vous devez nourrir ce chapeau vivant en lui donnant à manger d\'autres chapeaux. Vous pouvez lui donner un nouveau repas toutes les douze heures.)', 211, 1, '3cb#1#0#0#0d0+1,3cc#1#0#0#0d0+1,3cd#a#0#0#0d0+10,3ce#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (9247, 84, 'Clef du donjon Fungus', 'Cette clef vous permettra de rentrer dans le terrible donjon Fungus.', 247, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9248, 84, 'Clef du donjon des Blops', 'Cette clef vous permettra de rentrer dans le donjon des Blops.', 248, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9249, 84, 'Morceau de clef Griotte', 'Si vous retrouvez les autres morceaux de cette clef, vous aurez peut-être l\'occasion d\'affronter un Blop multicolore.', 250, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9250, 84, 'Morceau de clef Reinette', 'Si vous retrouvez les autres morceaux de cette clef, vous aurez peut-être l\'occasion d\'affronter un Blop multicolore.', 251, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9251, 84, 'Morceau de clef Coco', 'Si vous retrouvez les autres morceaux de cette clef, vous aurez peut-être l\'occasion d\'affronter un Blop multicolore.', 252, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9252, 84, 'Morceau de clef Indigo', 'Si vous retrouvez les autres morceaux de cette clef, vous aurez peut-être l\'occasion d\'affronter un Blop multicolore.', 249, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9254, 84, 'Clef de l\'antre du Blop Multicolore', 'Cette clef vous permettra d\'affronter un Blop Multicolore. Vous devriez être heureux.', 253, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9255, 113, 'Amulette Obvijevan', 'Cet objet polymorphe établit une relation de prédateur ou de symbiote avec les amulettes inanimées. (Vous devez nourrir cette amulette vivante en lui donnant à manger d\'autres amulettes. Vous pouvez lui donner un nouveau repas toutes les douze heures.)', 139, 1, '3cb#1#0#0#0d0+1,3cc#1#0#0#0d0+1,3cd#1#0#0#0d0+1,3ce#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (9256, 113, 'Anneau Obvijevan\r\n', 'Cet objet polymorphe établit une relation de prédateur ou de symbiote avec les anneaux inanimés. (Vous devez nourrir cet anneau vivant en lui donnant à manger d\'autres anneaux. Vous pouvez lui donner un nouveau repas toutes les douze heures.)', 161, 1, '3cb#1#0#0#0d0+1,3cc#1#0#0#0d0+1,3cd#9#0#0#0d0+9,3ce#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (9263, 96, 'Ecorce de Champaknyde', 'Le Champaknyde est un Abraknyde parasité par des champignons sans scrupules qui s\'incrustent jusque dans son écorce. De temps en temps en se grattant le postérieur, il arrache un morceau de mycélium purulent qui finira par donner vie à un magnifique champignon qui à son tour ira parasiter un Abraknyde.', 109, 113, '');
INSERT INTO `website_shop_objects_templates` VALUES (9265, 24, 'Miteters', 'Voici des Miteters que l\'on trouve parfois sur la tête des Craqueleurs à l\'hygiène douteuse.', 727, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9266, 24, 'Graisse de Gelée Royale', 'Cette graisse a été récupérée sur une gelée royale. C\'est un ingrédient essentiel entrant dans la composition d\'une potion de paralysie.', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9267, 15, 'Trompe de la Tromperelle', 'Encore chargée de l\'haleine putride de son ancien propriétaire, cette surprenante trompe peut servir à jouer de la musique tout en asphyxiant votre auditoire.', 764, 125, '');
INSERT INTO `website_shop_objects_templates` VALUES (9269, 15, 'Langue du Champodonte', 'Pour lécher les spores de ses compagnons, le Champodonte dispose d\'une langue agile et incroyablement souple. C\'est bien la seule chose que l\'on puisse envier au Champodonte.', 765, 134, '');
INSERT INTO `website_shop_objects_templates` VALUES (9277, 109, 'Oeil de Champmane', 'Le Champmane a la fâcheuse habitude de vouloir se gratter les paupières avec son bâton à pointes. Parfois il perd un oeil. Quand il se gratte le cou, il lui arrive de perdre la tête.', 587, 152, '');
INSERT INTO `website_shop_objects_templates` VALUES (9278, 15, 'Lamelle de Champbis', 'Le Champbis possède deux pieds, deux bras, et deux têtes. Ce qui en fait une créature deux fois plus bête que les autres.', 766, 144, '');
INSERT INTO `website_shop_objects_templates` VALUES (9279, 15, 'Bave de Champ à Gnons', 'Gluante mais appétissante, cette bave sert parfois à huiler les armes, ou les corps des aventuriers qui aiment combattre nus dans les arènes.', 45, 149, '');
INSERT INTO `website_shop_objects_templates` VALUES (9280, 15, 'Epine d\'Ougah', 'Ougah ne possède que quatre épines sur la tête, mais elles sont grosses.', 40, 900, '');
INSERT INTO `website_shop_objects_templates` VALUES (9281, 15, 'Fragment d\'Ougalurette', 'Ougah possède une magnifique coiffe, et vous tenez entre vos mains, un de ses fragments.', 41, 900, '');
