INSERT INTO `website_shop_objects_templates` VALUES (9366, 10, 'Tutu Rose', 'Ce tutu rose sera parfait pour la représentation de fin d\'année de votre petite dernière. Fabriqué en coton ancestral et en mousse de Mob l\'éponge extensible, doux et confortable avec une jupe en froufrou, ce tutu sera peut-être le premier d\'une future danseuse étoile.', 148, 49, '73#3#7#0#1d5+2,7c#10#19#0#1d10+15,7d#1f#32#0#1d20+30');
INSERT INTO `website_shop_objects_templates` VALUES (9379, 42, 'Ballotin de chocolat', 'Ce petit paquet est à offrir à celle ou celui que vous aimez. Si vous n\'aimez personne, vous êtes autorisé à le manger.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9380, 74, 'Fée d\'artifice invocatrice de coeurs', 'Cette Fée d\'artifice originale vous permettra de répandre un peu d\'amour dans ce monde de brutes, et un peu de rut dans ce monde d\'amour.', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9381, 35, 'Fleur de Gloutoblop', 'Le Gloutoblop est tellement affamé, qu\'il serait capable de manger ses propres fleurs. Heureusement, il trouve toujours un aventuriers imprudent à portée de dents.', 7, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (9382, 35, 'Fleur de Blopignon', 'Cette fleur vient d\'être arrachée de la tête d\'un Blopignon. Etant donné l\'allure ridicule qu\'elle lui donnait, il ne va pas s\'en plaindre.', 8, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (9383, 98, 'Racine de Tronkoblop', 'Le Tronkoblop possède de longues racines, qui vont puiser dans le sol tout ce que les aventuriers peuvent y rejeter.', 1, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (9384, 35, 'Fleur de Blop Griotte Royal', 'Si cette fleur n\'était pas royale, vous l\'auriez sûrement jetée.', 12, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (9385, 35, 'Fleur de Blop Coco Royal', 'Si cette fleur n\'était pas royale, vous l\'auriez sûrement jetée.', 9, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (9386, 35, 'Fleur de Blop Indigo Royal', 'Si cette fleur n\'était pas royale, vous l\'auriez sûrement jetée.', 11, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (9387, 35, 'Fleur de Blop Reinette Royal', 'Si cette fleur n\'était pas royale, vous l\'auriez sûrement jetée.', 10, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (9388, 36, 'Feuille de Blop Royal', 'Une fois séchée, roulée, puis fumée, cette feuille peut déclencher chez les plus faibles, d\'importantes hallucinations, et une incroyable envie de se soulager. Une consommation excessive entraîne une mort subite.', 13, 100, '');
INSERT INTO `website_shop_objects_templates` VALUES (9389, 36, 'Feuille de Blop Multicolore Royal', 'Cette feuille se nourrit de la matière grise du Blop Multicolore Royal. Heureusement qu\'elle n\'est pas trop gourmande.', 14, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (9391, 35, 'Fleur de Blop Multicolore Royal', 'Cette fleur était cachée à l\'intérieur de la boîte crânienne du Blop Multicolore Royal. Elle lui servait à boucher ses trous de mémoire.', 13, 150, '');
INSERT INTO `website_shop_objects_templates` VALUES (9394, 16, 'Chapblopignon', 'Cette coiffe stylée donne la Mitcho classe à n\'importe qui, ainsi qu\'une odeur de sous-bois dont vos amis se passeraient bien.', 222, 152, '76#29#3c#0#1d20+40,7d#97#c8#0#1d50+150,7c#1f#32#0#1d20+30,70#6#a#0#1d5+5,75#1#0#0#0d0+1,ae#c9#12c#0#1d100+200,b0#b#14#0#1d10+10,f3#6#a#0#1d5+5,d5#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9395, 16, 'Blopronne Royale', 'Ce couvre-chef a été porté par Kuri en personne pendant plusieurs années, jusqu\'à ce qu\'elle décide d\'arrêter de porter des coiffes démodées.', 223, 161, '76#1f#32#0#1d20+30,7e#1f#32#0#1d20+30,7c#1f#32#0#1d20+30,7d#97#c8#0#1d50+150,b2#5#7#0#1d3+4,70#5#7#0#1d3+4,b6#1#2#0#1d2+0,b0#b#f#0#1d5+10,d4#5#7#0#1d3+4,d3#5#7#0#1d3+4');
INSERT INTO `website_shop_objects_templates` VALUES (9396, 9, 'Le sceau des Zewouan', 'En ancien langage Lenald, il se nomme « Zewouan Ling ».  \\nLa rumeur prétend qu\'il aurait été forgé dans un volcan situé sous Pandala Feu, par Zauwon, le Wabbit obscur.', 7, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9401, 59, 'Peau de Bworker', 'Cette peau a traversé toutes les guerres, elle en est sortie indemne. Les épreuves du temps l\'ont à peine écorchée. Ca ne vous a pas empêché de lui faire la peau pour autant.', 9, 400, '');
INSERT INTO `website_shop_objects_templates` VALUES (9402, 11, 'Pantoufrelons', 'Les petites ailes accrochées à ces pantoufles permettent d\'aérer les pieds malodorants. Attention, il est déconseillé d\'utiliser ces pantoufles pour jouer au Boufball, le Bouftou pourrait ne pas apprécier de se faire piquer les fesses.', 128, 34, '7d#b#f#0#1d5+10,7c#b#f#0#1d5+10,73#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (9403, 7, 'Masse O\'dard', 'Les petites ailes accrochées à cette masse permettent de la rendre plus légère et plus facile à manier. Parfois, elle s\'envolera même toute seule et vous frappera pendant votre sommeil, pour rire un peu.', 68, 27, '64#10#14#0#1d5+15,7b#28#0#0#0d0+40,76#14#0#0#0d0+20');
INSERT INTO `website_shop_objects_templates` VALUES (9404, 17, 'Cape Kifébzz', 'Le dard accroché au bout de cette cape, vous empêchera probablement de vous asseoir sans vous faire très mal au postérieur, mais personne n\'osera vous botter les fesses.', 155, 33, '70#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (9405, 16, 'Caskabeille', 'En équipant ce chapeau vous prenez le risque de recevoir des coups de tapette à Moskitos sur les antennes.', 224, 37, '76#b#28#0#1d30+10,7e#b#28#0#1d30+10,7d#b#28#0#1d30+10');
INSERT INTO `website_shop_objects_templates` VALUES (9406, 16, 'Cochobits', 'Ces oreilles de Porkass encore fraîches vous permettront de séduire facilement les Porkass que vous croiserez. Ne rigolez pas, ça pourrait finir par vous servir, on peut parfois se sentir bien seul dans la campagne d\'Amakna.', 225, 36, '7c#1#14#0#1d20+0,70#1#3#0#1d3+0');
INSERT INTO `website_shop_objects_templates` VALUES (9407, 17, 'Cape Bouchon', 'Certains nomment cette cape la Tire-boucape, et vouent une haine farouche à l\'encontre de ceux qui l\'appellent autrement. Qu\'importe, quel que soit le nom que vous donnerez à cette cape, elle ne vous sera d\'aucune utilité pour déboucher les bouteilles.', 156, 37, '7c#1#1e#0#1d30+0,70#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (9408, 9, 'Jambanneau', 'Avec cet anneau, votre doigt fera de vous un véritable petit Porkass, ce qui ne devrait pas déplaire à vos amis les plus proches.', 162, 40, '70#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (9409, 10, 'Ceinture Lardière', 'Votre petite queue en tire-bouchon fera plus d\'un jaloux parmi votre entourage.', 149, 39, '7d#10#19#0#1d10+15,76#10#19#0#1d10+15,77#10#19#0#1d10+15,73#1#2#0#1d2+0,e2#1#a#0#1d10+0');
INSERT INTO `website_shop_objects_templates` VALUES (9410, 16, 'Chapeau du bois de l\'est', 'Moins à la mode que le Clint, mais beaucoup plus raffiné, ce chapeau vous permettra d\'exacerber votre coquetterie sans limite.', 226, 40, 'b0#1#a#0#1d10+0,77#1#28#0#1d40+0,7d#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (9411, 17, 'Cape du bois de l\'est', 'Cette cape protégera vos dos des coups de soleil. Attention elle ne descend pas jusqu\'aux fesses chez tous les aventuriers.', 157, 36, 'ae#97#c8#0#1d50+150,77#10#1e#0#1d15+15,7d#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (9412, 10, 'Ceinture du bois de l\'est', 'La fronde accrochée à cette ceinture est très bien accrochée. Tellement bien accrochée que vous ne pourrez pas la décrocher. Elle ne sert qu\'à impressionner les petits bandits de grand chemin que vous croiserez.', 150, 32, '77#b#14#0#1d10+10,73#3#5#0#1d3+2,ae#29#41#0#1d25+40');
INSERT INTO `website_shop_objects_templates` VALUES (9413, 11, 'Bottes du bois de l\'est', 'Les éperons accrochés à ces bottes, permettent de lacérer le cuir de votre Dragodinde, pour pouvoir la dépecer plus rapidement lorsque vous aurez décidé de la manger.', 129, 30, '76#6#a#0#1d5+5,7d#10#19#0#1d10+15,7e#6#a#0#1d5+5,77#6#a#0#1d5+5,7b#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9414, 16, 'Borsitrono', 'Cet énorme citron vidé accueillera sans problème votre tête et le petit pépin qui se loge dans votre crâne.', 227, 30, '73#3#a#0#1d8+2');
INSERT INTO `website_shop_objects_templates` VALUES (9415, 17, 'Cape Grume', 'Cette cape a été confectionnée à partir d\'une multitude d\'écorces d\'agrumes diverses et variées. Elle est jolie, elle rafraîchit, mais elle ne brille pas dans le noir.', 158, 30, '70#1#2#0#1d2+0,7b#b#1e#0#1d20+10');
INSERT INTO `website_shop_objects_templates` VALUES (9416, 9, 'Anneau Zest', 'Si votre eau n\'a plus assez de goût, trempez-votre doigt avec cet anneau dans votre verre, agitez-le frénétiquement jusqu\'à ce qu\'il se décroche. Et voilà vous avez un délicieux cocktail à l\'orange sanguine et au citron, ainsi qu\'un doigt en moins. On ne peut pas tout avoir.', 163, 20, '7b#b#f#0#1d5+10,7e#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (9417, 4, 'Pailleton', 'Si vous avez rêvé de boire le sang de vos adversaires tout en les frappant vigoureusement, ce bâton est fait pour vous.', 81, 32, '64#2#6#0#1d5+1,73#5#0#0#0d0+5');
INSERT INTO `website_shop_objects_templates` VALUES (9418, 16, 'Coiffe Cristaline', 'Le prochain qui tentera de vous coiffer les cheveux, risque de casser son peigne.', 228, 22, '7b#b#32#0#1d40+10');
INSERT INTO `website_shop_objects_templates` VALUES (9451, 17, 'Cape Cristaline', 'Cet impressionnant morceau de cristal peut servir de cape rigide. Elle ne vous rendra pas nécessairement plus fort, mais vous pouvez être certain que le prochain monstre qui tentera de vous dévorer, risque de s\'étouffer en l\'avalant.', 159, 21, '7e#15#23#0#1d15+20');
INSERT INTO `website_shop_objects_templates` VALUES (9452, 9, 'Anneau Cristalin', 'Avec cet anneau, votre doigt n\'aura jamais été aussi éclatant.', 164, 30, '7b#b#f#0#1d5+10,7c#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (9453, 10, 'Ceinture Cristaline', 'Avec cette ceinture autour des hanches, plus personne n\'osera vous les pincer de peur de se trancher les doigts.', 151, 48, '70#2#4#0#1d3+1,7c#10#19#0#1d10+15');
INSERT INTO `website_shop_objects_templates` VALUES (9454, 1, 'Pompamulette', 'Cette amulette pourra servir de bavoir pour les plus jeunes et les plus vieux.', 140, 27, '7e#b#f#0#1d5+10,7c#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (9455, 9, 'Pompanneau', 'Cet anneau peut être porté à un orteil si vous avez de mauvaises odeurs de pieds à cacher.', 165, 30, '7d#4#0#0#0d0+4,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (9456, 17, 'Pompocape', 'Si vous estimez que votre postérieur n\'a jamais eu l\'attention qu\'il mérite, il n\'est pas trop tard pour revêtir cette longue cape qui le recouvrira et attirera tous les regards.', 160, 33, '8a#6#f#0#1d10+5,7d#15#3c#0#1d40+20');
INSERT INTO `website_shop_objects_templates` VALUES (9457, 16, 'Pompocoiffe', 'Cette coiffe dégage une odeur de rose démoniaque suffisamment forte pour faire fuir tous les poux qui vivent sur votre tête, et tous les parasites qui se font passer pour vos amis.', 229, 33, '75#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (9459, 24, 'Liste de jouets du papa Nowel', 'Le papa Nowel prend toujours soin des listes de jouets qui sont amenées par les enfants qu\'il dévore.  \\nVous n\'aviez pas encore écrit la vôtre, en voilà une.', 41, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9460, 24, 'Pomme de pik', 'Voilà un Pokipik qui ne poussera jamais, vous n\'avez pas honte ?', 123, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9461, 16, 'Le Kim', 'On dit que le Kimbo porte cette perruque en hommage à un bel éphèbe bronzé rencontré un jour sur son île, dont il appréciait le sourire aéré. Il la cache néanmoins sous sa coco parce qu\'il la trouve quand même ridicule.', 230, 196, '73#4#7#0#1d4+3,76#33#50#0#1d30+50,7d#12d#190#0#1d100+300,7c#1f#32#0#1d20+30,70#6#a#0#1d5+5,b6#1#0#0#0d0+1,b0#10#19#0#1d10+15,f2#6#a#0#1d5+5,f0#6#a#0#1d5+5,d5#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9463, 1, 'Amunite', 'Ce bijou dégage une telle puissance qu\'elle tuerait un Moskito à 30 pas, si son odeur n\'empêchait pas ce dernier d\'approcher à moins d\'un kilomètre.', 141, 189, '7d#c9#fa#0#1d50+200,7e#1f#32#0#1d20+30,7c#1f#32#0#1d20+30,70#6#a#0#1d5+5,8a#6#a#0#1d5+5,b2#6#a#0#1d5+5,6f#1#0#0#0d0+1,b0#b#14#0#1d10+10,f3#6#a#0#1d5+5,f0#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9464, 1, 'Kralamansion', 'Cette effrayante amulette est longtemps restée cachée dans un manoir perdu. Autrefois vivante, elle voulait conquérir le monde. Finalement elle n\'aura que votre cou. La pauvre.', 142, 194, '7d#fb#15e#0#1d100+250,7c#1f#28#0#1d10+30,b2#6#a#0#1d5+5,8a#15#1e#0#1d10+20,75#2#0#0#0d0+2,b0#15#1e#0#1d10+20,b6#1#2#0#1d2+0,6f#1#0#0#0d0+1,73#4#5#0#1d2+3,70#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (9468, 8, 'Pelle Emélaka', 'Cette pelle est dangereuse, elle volera votre vitalité, votre jeunesse, l\'eau de votre corps et vos précieux gâtrools.', 51, 191, '60#c#1a#0#1d15+11,64#8#12#0#1d11+7,7b#29#3c#0#1d20+40,7d#fb#12c#0#1d50+250,7c#1f#28#0#1d10+30,70#6#a#0#1d5+5,b0#15#1e#0#1d10+20,d5#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9469, 6, 'Epée Loponèze', 'Cette épée construite à partir de fragments de mycoses, parasitera à merveille les intestins de vos ennemis.', 85, 184, '60#6#1c#0#1d23+5,62#6#1c#0#1d23+5,7b#1f#32#0#1d20+30,77#1f#32#0#1d20+30,7d#c9#fa#0#1d50+200,7c#15#1e#0#1d10+20,ae#191#2bc#0#1d300+400,70#6#a#0#1d5+5,75#1#0#0#0d0+1,d4#6#a#0#1d5+5,d3#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (9471, 16, 'Chapeau de la Sain Ballotin', 'Ballotins, Ballotines, vous qui cherchez l\'âme sœur, ce couvre-chef élégant et sobre sera votre signe de reconnaissance. En effet, ce chapeau magique ne peut être porté que par les aventuriers et les aventurières qui ne sont pas encore mariés. Vous pourrez ainsi facilement distinguer plus facilement celles et ceux dont le cœur n\'est pas encore pris.', 231, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9472, 42, 'Shigekax Passion', 'Réputé pour ses vertus aphrodisiaques, ce bonbon doux et sucré est idéal comme cadeau à offrir à l\'être aimé.', 4, 1, '6e#b#14#0#1d10+10');
INSERT INTO `website_shop_objects_templates` VALUES (9474, 83, 'Sublime Pierre d\'âme hasardeuse', 'Cette rune offre une faible chance de capturer des âmes d\'une puissance tout simplement incroyable.', 17, 1, '2c1#19#0#7d0');
INSERT INTO `website_shop_objects_templates` VALUES (9475, 83, 'Sublime Pierre d\'âme', 'Cette rune offre une chance correcte de capturer des âmes d\'une puissance tout simplement incroyable.', 16, 1, '2c1#32#0#7d0');
INSERT INTO `website_shop_objects_templates` VALUES (9476, 83, 'Sublime Pierre d\'âme heureuse', 'Cette rune offre une bonne chance de capturer des âmes d\'une puissance tout simplement incroyable.', 18, 1, '2c1#4b#0#7d0');
INSERT INTO `website_shop_objects_templates` VALUES (9479, 16, 'Poshocoiffe', 'Le clou planté dans cette coiffe permet de dégonfler la tête de ceux qui l\'ont un peu trop grosse.', 232, 45, '8a#b#14#0#1d10+10,ae#b#d2#0#1d200+10');
INSERT INTO `website_shop_objects_templates` VALUES (9480, 17, 'Poshocape', 'Avec cette jolie cible brodée sur votre cape, vos ennemis n\'auront aucune excuse s\'ils vous ratent.', 161, 33, '75#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (9481, 82, 'Poshoclier', 'Le clou planté dans ce bouclier peut servir d\'arme de corps à corps si vous voulez crever votre adversaire pour qu\'il se dégonfle.', 36, 1, '104#2#3#0#1d2+1,fd#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (9482, 82, 'Cigaloclier', 'Si vous avez peur d\'effrayer vos amis avec votre tête de monstre, vous pourrez toujours vous cacher derrière ce bouclier pour ressembler à quelqu\'un de sympathique.', 37, 1, '107#2#3#0#1d2+1,fb#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (9483, 82, 'Bouclier Boh-Bihn', 'Ce bouclier était utilisé par les jeunes Iops qui y rangeaient les images offertes par leurs instituteurs pour les récompenser de leurs efforts. De temps en temps, ils s\'amusaient à les faire défiler rapidement pour épater leurs camarades de classe.', 38, 1, 'fd#2#3#0#1d2+1,106#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (9484, 82, 'Bouclier Tigré ', 'Ce bouclier ne protège pas totalement son propriétaire, mais il pourra vous défendre efficacement contre les fantômes.', 39, 1, '105#2#3#0#1d2+1,fa#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (9485, 17, 'Cigalocape', 'Les trois petites boules qui ornent cette cape permettent de donner de jolis coups de boules si vous savez faire la toupie.', 162, 30, '7b#b#1e#0#1d20+10,70#1#2#0#1d2+0');
INSERT INTO `website_shop_objects_templates` VALUES (9486, 16, 'Cigalocoiffe', 'Avec ou sans cette coiffe, vous ressemblerez toujours à un bouffon, mais avec cette coiffe vous aurez au moins une bonne excuse.', 233, 33, '7c#f#0#0#0d0+15');
INSERT INTO `website_shop_objects_templates` VALUES (9487, 24, 'Certificat de changement d\'alignement', 'Ce certificat vous a été remis par Morrie Gane. Il contient plusieurs informations vous concernant et atteste de votre changement d\'alignement.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9488, 24, 'Registre de Bonta', 'Ce registre appartient à Morrie Gane et contient de nombreux documents dont comment devenir Bontarien. Il y a une page à remplir par vos soins.', 95, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9489, 24, 'Registre de Brâkmar', 'Ce registre appartient à Morrie Gane et contient de nombreux documents dont comment devenir Brâkmarien. Il y a une page à remplir par vos soins.', 95, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9490, 24, 'Certificat des Ordres numéro 5', 'Ce certificat atteste que vous appartenez à un ordre. Pour en changer, il vous faut attendre sept jours à compter de la date de remise de ce certificat. Vous avez en effet le droit de faire la girouette, mais il ne faut pas exagérer tout de même.', 33, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9491, 30, 'Malédiction du Ballotin', 'Vous voyez désormais la vie en rose, et vous êtes heureux.', 2, 1, '');
