INSERT INTO `website_shop_objects_templates` VALUES (9523, 14, 'Super récompense de Mission Mercenaire', 'Ce super parchemin certifie que vous méritez une super récompense honorifique pour votre engagement tout au long de vos missions chez les mercenaires.', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9524, 89, 'Cadeau Bouclier Tigré ', 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9525, 89, 'Cadeau de la Sain Ballotin', 'Ce cadeau contient un kit de survie pour les opérations amoureuses risquées.', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9526, 24, 'Memo de menaces', 'Vous avez écrit sur ce bout de papier pour vous rappeler qu\'il ne faut pas menacer un astrubien lorsque les mercenaires chargés de la sécurité dans le village se trouvent à proximité.', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9527, 24, 'Poudre d\'ongles incarnés', 'De la vieille poudre d\'ongles incarnés ayant appartenus jadis à des pieds d\'Enutrof. Malgré le passage du temps, l\'odeur de pied persiste. Tout porte à croire que vous avez été berné en beauté.', 37, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9528, 24, 'Amulette de Lear', 'Cette puissante amulette appartenait autrefois à Lear, un chef de culte aujourd\'hui disparu. Il était en contact avec des créatures extra-dimensionnelles et pouvait, dit-on, cloner les âmes incarnées. Il était également doté de la faculté d\'auto-résurrection, un pouvoir bien pratique lorsqu\'aucun prêtre n\'est dans le coin.', 48, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9529, 24, 'Potion de Résurrection Forcée', 'Il arrive parfois qu\'une âme ne puisse pas ou ne veuille pas se réincarner. On utilise alors cette potion pour lui restituer son corps d\'origine contre sa volonté.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9530, 24, 'Canne à Pichon Ensorcelée', 'Avec un peu de chance, cette canne à pichon vous permettra d\'obtenir une langue hiyeu sur un pichon.', 739, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9531, 24, 'Langue Hiyeu', 'Cet étrange organe est parfois utilisé dans la méthode de la Langue Hiyeu. \\nCette méthode sournoise consiste à faire avaler une langue hyieu à la victime qui ne peut alors plus s\'empêcher de parler en gesticulant dans tous les sens comme si elle faisait du smourf ou pire, de la Pektonique, ce qui a pour effet de la fatiguer très rapidement. Ce qui est intéressant c\'est l\'effet secondaire produit lorsque la victime est fatiguée : elle prend la première personne qu\'elle voit pour sa meilleure amie, ce qui la rend plus encline à dévoiler des informations.', 740, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9533, 24, 'Pierre d\'âme adouée', 'Ensorcelée par le maître de l\'Ordre de l\'Oeil Putride en personne, cette pierre d\'âme a la faculté d\'amadouer les âmes pour qu\'elles se laissent capturer de leur plein gré.', 732, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9534, 24, 'Pierre d\'âme de Terra Tibya', 'Cette pierre d\'âme contient l\'âme de l\'Enutrof Terra Tibya. Vous avez intérêt à en prendre soin si vous ne voulez pas que votre âme termine à l\'intérieur.', 732, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9535, 24, 'Potion de Transgénèse', 'Correctement utilisée, cette potion permet d\'accélérer la croissance des céréales en modifiant leurs gênes. Il se pourrait que cela entraîne des effets secondaires lors de leur consommation mais chut ! Les consommateurs ne doivent rien savoir. \\nLa participation de deux paysans et deux alchimistes est nécessaire.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9536, 24, 'Parchemin de Transgénèse', 'Ce parchemin permet d\'activer les effets de la Potion de Transgénèse lorsque cette dernière a été versée sur des céréales d\'avoine.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9537, 24, 'La bénédiction d\'Erazal', 'Ce livre, en plus des histoires loufoques de morts qui marchent et de fantômes qu\'il raconte, décrit le rituel pour forcer une âme à réintégrer son corps.', 95, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9539, 24, 'Badge du chef des renégats', 'Vous avez pris ce badge sur un renégat bontarien qui ne le méritait pas.', 49, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9540, 17, 'Cape du Parrain', 'Cette cape protégera votre cou du frimas, et votre postérieur des coups bas.', 163, 48, '7d#1a#28#0#1d15+25,7e#10#19#0#1d10+15,77#10#19#0#1d10+15,b2#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (9541, 16, 'Borsalino du Parrain', 'Ce chapeau plutôt original permet d\'affirmer avec fierté votre rôle de parrain. Vous auriez tort de vous en priver.', 234, 43, '7d#b#14#0#1d10+10,7c#b#14#0#1d10+10,75#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (9542, 11, 'Souliers laqués du Parrain', 'Ces souliers brillent de mille feux, même lorsqu\'ils sont complètement usés. Très efficace pour éblouir vos adversaires lorsqu\'ils les recevront en pleine tête.', 130, 40, '7d#1a#28#0#1d15+25,77#10#19#0#1d10+15,7b#10#19#0#1d10+15,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (9543, 9, 'Grosse Bagouze du Parrain', 'Cette lourde bague permet de donner un peu plus d\'inertie à vos gifles, et un peu plus de piquant à vos caresses.', 166, 40, '7c#6#a#0#1d5+5,7d#15#1e#0#1d10+20,70#2#0#0#0d0+2');
INSERT INTO `website_shop_objects_templates` VALUES (9544, 114, 'Tourmenteur de Ténèbres', 'Cette terrible arme magique a été confectionnée par le célèbre héros bricoleur Issering. Elle canalise la magie de celui qui l\'utilise pour la faire ressortir sous forme de puissantes décharges. Mais ce n\'est pas tout, puisque cette arme magique change l\'apparence de celui qui l\'utilise, et lui permet d\'utiliser de nouveaux sortilèges. Son propriétaire devient alors une autre personne, et son Tourmenteur devient son seul ami, jusqu\'à ce qu\'il décide de ne plus l\'utiliser.', 1, 30, '62#1#5#0#1d5+0,63#1#5#0#1d5+0,61#1#5#0#1d5+0,60#1#5#0#1d5+0,7d#1#32#0#1d50+0,77#1#19#0#1d25+0,76#1#19#0#1d25+0,7b#1#19#0#1d25+0,7e#1#19#0#1d25+0');
INSERT INTO `website_shop_objects_templates` VALUES (9545, 114, 'Tourmenteur de Flamme', 'Cette terrible arme magique a été confectionnée par le célèbre héros bricoleur Issering. Elle canalise la magie de celui qui l\'utilise pour la faire ressortir sous forme de puissantes décharges. Mais ce n\'est pas tout, puisque cette arme magique change l\'apparence de celui qui l\'utilise, et lui permet d\'utiliser de nouveaux sortilèges. Son propriétaire devient alors une autre personne, et son Tourmenteur devient son seul ami, jusqu\'à ce qu\'il décide de ne plus l\'utiliser.', 2, 30, '63#4#14#0#1d17+3,7e#1#32#0#1d50+0,7d#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (9546, 114, 'Tourmenteur de Feuille', 'Cette terrible arme magique a été confectionnée par le célèbre héros bricoleur Issering. Elle canalise la magie de celui qui l\'utilise pour la faire ressortir sous forme de puissantes décharges. Mais ce n\'est pas tout, puisque cette arme magique change l\'apparence de celui qui l\'utilise, et lui permet d\'utiliser de nouveaux sortilèges. Son propriétaire devient alors une autre personne, et son Tourmenteur devient son seul ami, jusqu\'à ce qu\'il décide de ne plus l\'utiliser.', 3, 30, '61#4#14#0#1d17+3,76#1#32#0#1d50+0,7d#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (9547, 114, 'Tourmenteur de Goutte', 'Cette terrible arme magique a été confectionnée par le célèbre héros bricoleur Issering. Elle canalise la magie de celui qui l\'utilise pour la faire ressortir sous forme de puissantes décharges. Mais ce n\'est pas tout, puisque cette arme magique change l\'apparence de celui qui l\'utilise, et lui permet d\'utiliser de nouveaux sortilèges. Son propriétaire devient alors une autre personne, et son Tourmenteur devient son seul ami, jusqu\'à ce qu\'il décide de ne plus l\'utiliser.', 4, 30, '60#4#14#0#1d17+3,7b#1#32#0#1d50+0,7d#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (9548, 114, 'Tourmenteur de Nuage', 'Cette terrible arme magique a été confectionnée par le célèbre héros bricoleur Issering. Elle canalise la magie de celui qui l\'utilise pour la faire ressortir sous forme de puissantes décharges. Mais ce n\'est pas tout, puisque cette arme magique change l\'apparence de celui qui l\'utilise, et lui permet d\'utiliser de nouveaux sortilèges. Son propriétaire devient alors une autre personne, et son Tourmenteur devient son seul ami, jusqu\'à ce qu\'il décide de ne plus l\'utiliser.', 5, 30, '62#4#14#0#1d17+3,77#1#32#0#1d50+0,7d#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (9549, 10, 'Caleçon à bretelles du Parrain', 'Le slogan du couturier à l\'origine de cette merveille était : \"Même dans le feu de l\'action, ce caleçon restera solidement accroché à votre postérieur, grâce à ses bretelles en lin d\'une qualité supérieure\". Avant d\'être couturier, il était mauvais poète.', 152, 48, '7c#b#14#0#1d10+10,77#10#19#0#1d10+15,7b#10#19#0#1d10+15,73#4#5#0#1d2+3');
INSERT INTO `website_shop_objects_templates` VALUES (9550, 24, 'Emplacement du champ', 'Merlan vous a indiqué où le milicien va utiliser le sort de Transgénèse. Il faut vous dépêcher d\'arriver avant qu\'il ne soit trop tard.', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9551, 24, 'Graine de scorbute modifiée', 'Ces graines de scorbute ont été modifiées mais vous ne voyez pas la différence avec des graines de scorbute classiques. Le vrai problème est que par contre vous voyez clairement la différence entre ces graines et des graines de pavot. Seul un idiot pourrait se méprendre.', 405, 1, '');
