INSERT INTO `website_shop_objects_templates` VALUES (9557, 24, 'Clef du coffre', 'Cette clef sert à ouvrir le coffre qui, selon Terra Tibya, abriterait les statuettes de Sumens.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9558, 14, 'Potion de remouflage', 'Cette potion vous permet de révéler tous les personnages invisibles présents autour de vous.', 73, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9566, 82, 'Bouclier Pararayon', 'C\'est dans les tavernes de Pandala que le bouclier Pararayon fut pour la première fois forgée.  Il est dit que ce bouclier, inspiré par la déesse Pandawa elle-même protégerait des effets du rayon cosmique. Réalité ou opération marketing de forgeurs de boucliers Pandawas, le mystère reste entier.', 34, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9567, 16, 'Coiffe du Black Wab', 'Avec cette coiffe, vous pourrez facilement vous métamorphoser en vengeur masqué, et peut-être même en  mangeur vasqué. A vous de voir.', 235, 49, '7d#15#1e#0#1d10+20,b2#2#3#0#1d2+1,8a#10#19#0#1d10+15,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (9569, 17, 'Cape du Black Wab', 'Le petit pompon accroché à l\'extrémité de cette cape permet de ramasser efficacement les poussières de votre maison, il est normalement assez petit pour passer sous les meubles. N\'oubliez pas de l\'enlever lorsque vous partez travailler aux champs.', 164, 46, '7d#1f#2d#0#1d15+30,73#3#4#0#1d2+2,b2#1#0#0#0d0+1,8a#b#f#0#1d5+10');
INSERT INTO `website_shop_objects_templates` VALUES (9575, 10, 'Ceinture du Black Wab', 'Cette ceinture peut se porter dans les deux sens, suivant ce que vous désirez cacher ou montrer...', 153, 46, '7d#10#1e#0#1d15+15,7c#b#f#0#1d5+10,70#2#3#0#1d2+1');
INSERT INTO `website_shop_objects_templates` VALUES (9576, 11, 'Bottines du Black Wab', 'Ces bottines en peau de fesse de Black Wabbit, vous permettront de prendre une bonne revanche sur ces terribles créatures, en ayant l\'impression de leur botter le derrière à chaque fois que vous taperez dans quelque chose. La vie est parfois faîte de plaisirs simples.', 131, 47, '7c#b#f#0#1d5+10,73#1#2#0#1d2+0,8a#b#f#0#1d5+10,75#1#0#0#0d0+1');
