INSERT INTO `website_shop_objects_templates` VALUES (9582, 97, 'Dragodinde en armure', 'Ce certificat vous permet d\'aller reprendre votre monture dans une étable. \\nAttention, ce certificat n\'est valide que 20 jours, une fois ce délai dépassé, votre monture sera relâchée dans la nature et votre certificat ne sera plus valide, vous ne pourrez plus récupérer votre monture. Pensez à laisser votre monture dans une étable si vous devez vous absenter longtemps.', 1, 60, 'd4#1#5#0#1d5+0,d3#1#5#0#1d5+0,d6#1#5#0#1d5+0,d2#1#5#0#1d5+0,d5#1#5#0#1d5+0,8a#1#32#0#1d50+0');
