INSERT INTO `website_shop_objects_templates` VALUES (9594, 18, 'Bouloute du Parrain', 'Ce bouloute a l\'air tout à fait normal... Pourtant on dirait que sa laine vire au noir par endroits... Laissez-lui un peu de temps et vous pourriez bien avoir une surprise !', 46, 1, '320#a#0#0#0d0+10,7d#1#96#0#1d150+0');
INSERT INTO `website_shop_objects_templates` VALUES (9595, 90, 'Fantôme Bouloute du Parrain', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 35, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9596, 89, 'Cadeau Bouloute du Parrain', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9597, 27, 'Transformation Fantôme Bouloute du Parrain', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9598, 77, 'Certificat de mise en Chanil : Bouloute du Parrain', 'Ce certificat décrit les caractéristiques du familier que vous avez placé au Chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9616, 90, 'Fantôme Marcassin', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 40, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9617, 18, 'Chacha Angora', 'Cette boule de poils est mieux protégée contre le froid que le Chacha classique, elle est plus douce, mais il paraît que son caractère est encore plus insupportable. Cette créature ne mange que de la viande et du poisson.', 50, 1, '320#a#0#0#0d0+10,8a#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (9618, 89, 'Cadeau Grosse Bagouze du Parrain', 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9619, 18, 'Tiwabbit Kiafin', 'Cette créature est un peu stupide, la seule façon de la faire avancer est de lui accrocher dans le dos un bâton soutenant une Cawotte. Heureusement, ce familier a été correctement dressé, et ne tentera pas d\'envoyer des vents de panique. Ce dévoreur d\'âmes se nourrit en mangeant les restes d\'autres Wabbits.', 51, 1, '320#a#0#0#0d0+10,8a#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (9620, 18, 'Miniminotot', 'Cette créature est un Minimino élevé par le Minotot en personne. Il lui a malheureusement transmis son caractère, ainsi qu\'une partie de ses odeurs corporelles à force de le cajoler sous ses aisselles. Ce dévoreur d\'âmes mange les dépouilles des créatures de l\'île du Minotoror.', 49, 1, '8a#1#32#0#1d50+0,320#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (9621, 89, 'Cadeau venu d\'ailleurs', 'Vous êtes sûr que ce sac n\'était pas là il y a encore deux minutes. Mais que peut-il bien contenir ? (DOUBLE-CLIC POUR UTILISER)', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9622, 36, 'Pousse de Tanfouguite', 'L\'existence de cette plante est aussi mystérieuse et improbable que son nom. A la fois ici et ici, mais pas maintenant, heureusement qu\'elle n\'est pas ailleurs, on n\'y comprendrait plus rien. Amenez-la au temple Xelor d\'Amakna (coordonnées 3,1) , seuls des illuminés comme eux peuvent tenter d\'y comprendre quelque chose.', 638, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9623, 18, 'Crocodaille', 'Ne vous méprenez pas, les dents pointues de cette créature finiront un jour ou l\'autre par se planter dans votre postérieur. Ce familier ne mange que de la viande et du poisson.', 47, 1, '320#a#0#0#0d0+10,8a#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (9624, 18, 'Dragoune Noire', 'Prenez une Dragoune Rose, teignez-la en noir, saupoudrez-la de poussière d\'or, trempez-la dans l\'huile, trempez-la dans l\'eau, et vous aurez une Dragoune Noire. Ce dévoreur d\'âmes ne mange que les dépouilles de dragoeufs.', 48, 1, '7c#1#32#0#1d50+0,320#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (9625, 28, 'Shigekax Amande', 'Retrouvez la saveur, et tout le charme des sucreries d\'antan avec ce bonbon préparé de façon traditionnelle. Hmm... Ce Shigekax vous paraît particulièrement fondant sous la langue.', 3, 1, 'b0#1e#0#0#0d0+30,32b#1e#0#0#0d0+30');
