INSERT INTO `website_shop_objects_templates` VALUES (9652, 16, 'Bandeau Papayou', 'Voici le bandeau parfait pour éponger votre front, ou tout simplement pour avoir la \"Papayou attitude\".', 236, 48, '7b#10#19#0#1d10+15,7d#1a#28#0#1d15+25,70#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (9653, 16, 'Kaskwette', 'Les ailes cousues sur ce chapeau protègent vos oreilles des injures, mais uniquement de celles que vous proférez.', 237, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (9654, 17, 'Cape Papayou', 'Cette cape mettra en valeur les courbes de votre postérieur, ou celles de votre dos bossu.', 165, 48, '7c#b#f#0#1d5+10,7b#10#19#0#1d10+15,70#2#3#0#1d2+1,ae#33#4b#0#1d25+50');
INSERT INTO `website_shop_objects_templates` VALUES (9655, 11, 'Sandales Papayou', 'La semelle de ces sandales est renforcée afin de supporter le poids des Papayous les plus lourds.', 132, 49, '7c#b#f#0#1d5+10,7b#10#19#0#1d10+15,70#3#4#0#1d2+2');
INSERT INTO `website_shop_objects_templates` VALUES (9656, 11, 'Les Sleumpettes', 'Les roulettes présentes sur ces bottes permettent de descendre les escaliers sans efforts tout en augmentant considérablement vos chances de vous casser quelques os. A vous de choisir.', 133, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (9657, 4, 'Bâton Poupinateur', 'Qui a osé affubler ce bâton d\'un nom aussi ridicule ? Personne ne le saura jamais, mais vous devrez continuer de l\'appeler ainsi et d\'avoir l\'air ridicule lorsque l\'on vous demandera le nom de votre bâton.', 82, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (9658, 1, 'Amulette Papayou', 'Cette amulette n\'est en réalité qu\'un assortiment de fleurs accrochées autour d\'un fil. Elle est censée diffuser un parfum magique à même de transformer un Papayou en Papayou Lélé.', 144, 47, '7b#10#19#0#1d10+15,70#2#3#0#1d2+1,7d#15#1e#0#1d10+20,7c#6#a#0#1d5+5');
