INSERT INTO `website_shop_objects_templates` VALUES (9760, 115, 'Fragment de force majeur', 'Ce fragment d\'âme provient d\'un des Shushus de Rushu. Si vous disposez d\'une arme Shushette, vous pouvez utiliser ce fragment pour la rendre plus puissante. Si votre arme Shushette dépasse son potentiel maximum, les runes seront toutes retirées et placées dans votre inventaire. \\n(Double clic pour placer ce fragment d\'âme sur une arme Shushette équipée)', 3, 1, '76#28#0#0#0d0+40');
INSERT INTO `website_shop_objects_templates` VALUES (9785, 18, 'Shushu de Rushu', 'Ce démon mineur vous accompagnera durant toutes vos pérégrinations, du Zaap d\'Astrub au cimetière, voire même du cimetière au Zaap d\'Astrub. Cette créature est animée d\'une haine viscérale envers les Ouassingues. Une sombre histoire de ménage paraît-il... Attaquez des Ouassingues, et elle se repaîtra de leurs dépouilles.', 52, 1, '320#a#0#0#0d0+10,6e#1#96#0#1d150+0');
INSERT INTO `website_shop_objects_templates` VALUES (9786, 90, 'Fantôme de Shushu de Rushu', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 49, 1, '');
