INSERT INTO `website_shop_objects_templates` VALUES (9808, 89, 'Cadeau Shushu de Rushu', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, et des poudres d\'Eniripsa pour le soigner.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9809, 27, 'Transformation Fantôme Shushu de Rushu', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9810, 77, 'Certificat de mise en Chanil : Shushu de Rushu', 'Ce certificat décrit les caractéristiques du familier que vous avez placé au Chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9811, 24, 'Formulaire de neutralité ', 'Ce formulaire vous a été remis par Morrie Gane à la milice du château d\'Amakna. Il est nécessaire pour redevenir neutre.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (9812, 24, 'Formulaire de désertion', 'Ce formulaire confirmant votre désertion vous a été remis par Morrie Gane. C\'est un document nécessaire pour redevenir neutre.', 26, 1, '');
