INSERT INTO `website_shop_objects_templates` VALUES (10155, 1, 'Yugolette', 'Cette amulette est censée vous protéger des décapitations aléatoires, et des oblitérations épilatoires.', 147, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (10156, 11, 'Yugoufle', 'Ces pantoufles sont plus confortables que des pantoufles ordinaires, mais vous ne saurez jamais exactement pourquoi. Peut-être que les milliers d\'acariens masseurs qui y vivent y sont pour quelque chose.', 140, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10157, 10, 'Yugure', 'Cette ceinture a été fabriquée à partir de chutes de ficelles de lin. Elle doit pouvoir servir à fermer les sacs poubelles.', 157, 43, '7d#20#0#0#0d0+32,70#4#0#0#0d0+4');
INSERT INTO `website_shop_objects_templates` VALUES (10158, 82, 'Bouclier trophée du Dark Vlad', 'Brandissez-le haut et fort, car même après votre mort, c\'est le seul souvenir qui témoignera de tous vos efforts.', 43, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10159, 82, 'Bouclier trophée du Moon', 'Brandissez-le haut et fort, car même après votre mort, c\'est le seul souvenir qui témoignera de tous vos efforts.', 44, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10160, 82, 'Bouclier trophée du Chêne Mou', 'Brandissez-le haut et fort, car même après votre mort, c\'est le seul souvenir qui témoignera de tous vos efforts.', 45, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10161, 82, 'Bouclier trophée du Dragon Cochon', 'Brandissez-le haut et fort, car même après votre mort, c\'est le seul souvenir qui témoignera de tous vos efforts.', 46, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10162, 82, 'Bouclier trophée du Minotoror', 'Brandissez-le haut et fort, car même après votre mort, c\'est le seul souvenir qui témoignera de tous vos efforts.', 47, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10163, 82, 'Bouclier trophée du Kimbo', 'Brandissez-le haut et fort, car même après votre mort, c\'est le seul souvenir qui témoignera de tous vos efforts.', 48, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10164, 82, 'Bouclier trophée du Wa Wabbit', 'Brandissez-le haut et fort, car même après votre mort, c\'est le seul souvenir qui témoignera de tous vos efforts.', 49, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10165, 82, 'Bouclier trophée du Koulosse', 'Brandissez-le haut et fort, car même après votre mort, c\'est le seul souvenir qui témoignera de tous vos efforts.', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10166, 82, 'Bouclier trophée du Sphincter Cell', 'Brandissez-le haut et fort, car même après votre mort, c\'est le seul souvenir qui témoignera de tous vos efforts.', 51, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10167, 82, 'Bouclier trophée du Bworker', 'Brandissez-le haut et fort, car même après votre mort, c\'est le seul souvenir qui témoignera de tous vos efforts.', 52, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10168, 11, 'Chispottes', 'Ponch cirait ses bottes tous les matins avant de partir en mission sur sa Dragodinde pour sauver la veuve et l\'orphelin, mais surtout la veuve... Un sacré charmeur ce Ponch.', 141, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10169, 82, 'Chispouclier', 'Ponch portait fièrement ce bouclier sur sa dragodinde lorsqu\'il veillait à la sécurité des ruelles de Bonta.', 41, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10170, 16, 'Chispocasque', 'Ce casque permet de se protéger très efficacement des chutes de dragodindes ou de passer pour un idiot sans en être un.', 246, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (10171, 9, 'Mitaines de Chisp', 'Ces mitaines en cuir sont parfaites pour donner des fessées déculottées.', 173, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (10172, 1, 'Collertue', 'Cette amulette peut nourrir une limace vorpale pendant deux jours, ou trois jours si elle l\'accompagne d\'une purée de votre tête.', 148, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10173, 11, 'Libottes', 'La semelle de ces bottes est recouverte d\'une bave collante et l\'intérieur est rempli d\'une bave glissante. A moins que ça ne soit l\'inverse.', 142, 39, '');
INSERT INTO `website_shop_objects_templates` VALUES (10174, 17, 'Limape', 'Une bave gluante sort des pores de cette cape. Prenez un peu d\'élan, allongez-vous sur le dos et laissez-vous glisser.', 169, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10175, 16, 'Limasque', 'Ce masque gluant et baveux alimentera votre cuir chevelu en gomina de façon continue. Les deux yeux accrochés au masque peuvent être connectés à votre crâne si vous acceptez d\'insérer les terminaisons nerveuses dans vos oreilles.', 247, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10180, 1, 'L\'Esteban', 'Ce médaillon est censé servir de clé pour accéder à une mystérieuse cité oubliée.', 149, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10181, 9, 'Anneau solaire', 'Cet anneau a été retrouvé dans une mystérieuse cité dont personne ne soupçonnait réellement l\'existence jusqu\'à ce que l\'on commence à soupçonner son existence.', 174, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10182, 82, 'Bouclier solaire', 'Ce bouclier absorbe les rayons du soleil et les renvoie directement dans le visage de vos adversaires. A défaut de les éblouir avec votre intelligence, vous les aveuglerez temporairement grâce à ce bouclier.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10183, 16, 'Masque solaire', 'Ce masque captera les rayons de soleil et les concentrera sur votre visage pour que vous puissiez rester bronzé toute l\'année, même si vous habitez au nord d\'Amakna.', 248, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10184, 16, 'Masque de Noké ', 'Noké aimait beaucoup revêtir ce masque et se cacher dans les bois pour effrayer les promeneurs égarés. Il est mort de peur il y a bien longtemps en se regardant dans une flaque d\'eau.', 249, 42, '76#15#23#0#1d15+20,73#2#3#0#1d2+1,70#1#2#0#1d2+0,8a#6#a#0#1d5+5');
INSERT INTO `website_shop_objects_templates` VALUES (10185, 17, 'Cape de Noké ', 'Noké rêvait d\'être un grand méchant loup. Même avec cette cape sur les épaules, il ne ressemblait qu\'à un petit méchant.', 170, 41, '76#15#23#0#1d15+20,7d#15#23#0#1d15+20,73#3#6#0#1d4+2');
INSERT INTO `website_shop_objects_templates` VALUES (10186, 1, 'Collier de Noké ', 'Cette amulette en dents de sanglier effraiera les sangliers et par extension votre belle-mère.', 150, 41, '73#1#2#0#1d2+0,70#1#0#0#0d0+1,76#15#23#0#1d15+20,7d#15#28#0#1d20+20');
INSERT INTO `website_shop_objects_templates` VALUES (10187, 5, 'Dagues de Noké ', 'Ces dagues ont servi jadis à dépecer un sanglier belliqueux qui rêvait d\'être un cerf.', 76, 41, '73#1#0#0#0d0+1,76#15#1e#0#1d10+20,7d#15#1e#0#1d10+20,64#8#9#0#1d2+7');
INSERT INTO `website_shop_objects_templates` VALUES (10188, 16, 'Coiffe de la Denrée', 'Cette coiffe fera de vous un excellent Wobot de protocole grâce à son dispositif unique qui permet de traduire à la volée les discussions des choux. C\'est également un excellent casque insonorisant.', 250, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (10189, 9, 'Oxano', 'Cet anneau appartenait à un sabotier connu sous le surnom de \"Le Glaude\", dont il avait hérité après avoir fait un long voyage en trottant. Ses proches l\'avaient surnommé \"Le Glaude trotteur\".', 175, 37, '');
INSERT INTO `website_shop_objects_templates` VALUES (10190, 11, 'Bottines de la Denrée', 'Si vous décidez de planter des choux, à la mode de chez nous, pensez à équiper ces bottines conçues pour ne pas écraser les choux. N\'essayez pas de les utiliser pour danser avec votre partenaire, elles ne permettent pas d\'éviter les écrasements de pieds.', 143, 38, '7d#18#19#0#1d2+23,77#b#c#0#1d2+10,70#1#2#0#1d2+0,b6#1#0#0#0d0+1');
INSERT INTO `website_shop_objects_templates` VALUES (10191, 10, 'L\'oxolature', 'Cette ceinture permet de contenir vos ballonnements après une indigestion de soupe aux choux.', 158, 37, '7d#1d#0#0#0d0+29,7c#7#0#0#0d0+7,b6#1#0#0#0d0+1,ae#36#0#0#0d0+54');
INSERT INTO `website_shop_objects_templates` VALUES (10192, 89, 'Cadeau Cape Siks Won Naïne', 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 42, 1, '');
