INSERT INTO `website_shop_objects_templates` VALUES (10207, 24, 'Trousseau de clefs', 'On le dit doté de longs pênes très agiles. Cependant, ils s\'épuisent vite et leurs magies ne se rechargent qu\'au bout d\'une semaine. Qu\'elles soient à gorges ou à pompes, vous pourrez forcer toutes les serrures des donjons.', 774, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10208, 12, 'Elixir Pandawa', 'Une bonne lampée et vous êtes téléporté au temple de votre classe. Effets secondaires connus : coliques, apparition de belle-mère, chute de cheveux, haleine de chacal, lacets défaits, feux rouges successifs.', 153, 1, '');
