INSERT INTO `website_shop_objects_templates` VALUES (10287, 24, 'Formule magique des quatre frères bandits', 'Cette formule magique a été mise au point par les quatre frères bandits, Boueglione, Leauyal, Pindair et Flamar. Elle permet de détrousser un ennemi ou un jeune fan admiratif comme pas deux ! \\nUne fois la formule prononcée, ses effets s\'étendront à tout le Monde des Douze... avant de se dissiper.', 176, 1, '');
