INSERT INTO `website_shop_objects_templates` VALUES (10414, 16, 'Couronne Koninginnedag', 'Cette couronne est généralement portée le jour de la fête qui commémore l\'anniversaire d\'une illustre reine. Ses pouvoirs magiques sont très puissants, puisqu\'elle permet de changer les couleurs de son porteur pour le rendre intégralement orange et ainsi lui permettre de facilement se cacher parmi tous les gens déguisés de couleur orange.', 251, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10417, 85, 'Pierre d\'âme de gardien de donjon', 'Cette pierre contient les âmes d\'un groupe de monstres qui ne demandent qu\'à revenir à la vie pour se venger de vous. Elle n\'est cependant utilisable que dans les arènes prévues à cet effet, situées dans les grandes cités.', 1, 1, '');
