INSERT INTO `website_shop_objects_templates` VALUES (10507, 75, 'Parchemin de Sort Spécial Retraite anticipée', '(Double clic pour apprendre le sort) \\nCe parchemin vous permet d\'apprendre le sort Retraite anticipée... Réservé aux Enutrofs uniquement.', 9, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10508, 75, 'Parchemin de Sort Spécial Mise en Garde', '(Double clic pour apprendre le sort) \\nCe parchemin vous permet d\'apprendre le sort Mise en garde... Réservé aux Fécas uniquement.', 11, 1, '');
