INSERT INTO `website_shop_objects_templates` VALUES (10510, 75, 'Parchemin de Sort Spécial Ivresse', '(Double clic pour apprendre le sort) \\nCe parchemin vous permet d\'apprendre le sort Ivresse... Réservé aux Pandawas uniquement.', 12, 1, '');
