INSERT INTO `website_shop_objects_templates` VALUES (10513, 75, 'Parchemin de sort Raulebaque', '(Double clic pour apprendre le sort) \\nCe parchemin vous permet d\'apprendre le sort Raulebaque... Réservé aux Xelors uniquement.', 15, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10515, 89, 'Cadeau Couronne Koninginnedag', 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10516, 27, 'Transformation flammèche', 'Voilà ce que c\'est que de vouloir jouer avec le feu. Allez, ce n\'est peut être pas si grave, prenez conseil auprès du Mage Ax.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10518, 24, 'Recette de la Corde d\'escalade', 'Un bricoleur peut bricoler une Corde d\'escalade à l\'aide des ressources suivantes : 30 Chanvres, 5 Fils de Soie et 1 Fil Résistant.', 176, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10519, 24, 'Recette des Pierres de souillure impures', 'Un alchimiste peut fabriquer des Pierres de souillure impures de différentes couleurs avec les ingrédients suivants : \\nBleue : 2 Gelées Bleutées, 1 Potion Ghetto Raide. \\nJaune : 2 Gelées Citrons, 1 Potion Ghetto Raide. \\nVerte : 2 Gelées à la Menthe, 1 Potion Ghetto Raide.', 176, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10520, 24, 'Recette des Pierres de souillure', 'Un mineur peut polir des Pierres de souillure de différentes couleurs avec les ingrédients suivants : \\nBleue : 10 Pierres de souillure bleues impures, 10 Eaux. \\nJaune : 10 Pierres de souillure jaunes impures, 10 Eaux. \\nVerte : 10 Pierres de souillure vertes impures, 10 Eaux.', 176, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10544, 18, 'Gelutin', 'Cette créature venue d\'ailleurs a été dressée par son ancien maître pour ne manger que les monstres issus de la famille des Blops. C\'est peut-être ce qui explique son apparence surprenante ou son haleine de Blop.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10552, 16, 'Yugonnet', 'Cette coiffe surprenante protégera efficacement vos oreilles du froid et des mauvaises blagues de vos amis.', 245, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10553, 16, 'Chapeau de Tolot', 'Seul un boufbowler peut avoir l\'idée saugrenue de se déguiser en tofu pour impressionner son ennemi. A moins qu\'il ne s\'agisse de fendre l\'air comme personne grâce à la forme fuselée de ce chapeau. Quoiqu\'il en soit, vous ne passerez pas inaperçu.', 252, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10554, 16, 'Chapeau de Beneji', 'Les lunettes intégrées dans ce casque vous permettront de voir rouge et de vous sentir plus boufton que jamais.', 253, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10555, 82, 'Bouclier du Real Boitar', 'Cet imposant bouclier porte les traces de nombreux matches. D\'apparence robuste, il n\'est pourtant d\'aucune utilité dans un vrai combat, si ce n\'est pour impressionner vos ennemis ou faire ami-ami avec des bouftous.', 54, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10556, 82, 'Bouclier des Bouftons Rouges', 'Cet imposant bouclier illustre parfaitement la fougue et l\'insolence de la jeunesse. Tout dans l\'apparence et rien dans le ventre. C\'est le cas de le dire, il ne vous protégera de rien dans un vrai combat, sauf si votre adversaire vous attaque à coups de ballon.', 53, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10557, 9, 'Gantelet du Real Boitar', 'Ce gantelet marqué par les années facilite la prise en main de ballon ou toute autre bestiole ronde recouverte de laine. Ce que vous en faites après ne regarde que vous.', 176, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (10558, 9, 'Gantelet des Bouftons Rouges', 'Ce gantelet permettra au jeune Chienchien fou que vous êtes de jouer à la baballe comme un grand boufbowler.', 177, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (10559, 10, 'Ceinture de Tolot', 'Initialement conçue pour absorber les chocs lors de matches de boufbowl musclés, cette ceinture pourra aussi vous servir de bouée si d\'aventure vous souhaitez prendre un bain. Quelle drôle d\'idée.', 159, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10560, 10, 'Ceinture de Mounu', 'Cette ceinture montre à quel point le boufbowl n\'est pas un sport de fillette, d\'où les protections judicieusement placées sous la ceinture pour éviter tout coup bas un peu trop bas. Idéal pour assurer l\'entraînement de petits Srams.', 160, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10561, 11, 'Bottes du Real Boitar', 'Ces bottes ont vécu, et ça se sent. Avec elles, vous pourrez vous faire passer pour un grand boufbowler, et planter vos crampons dans le postérieur de quelques bouftous devant vos fans.', 144, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10562, 11, 'Bottes des Bouftons Rouges', 'Ces bottes dans l\'air du temps feront fureur auprès de tous les jeunes aventuriers fascinés par le boufbowl. Elles facilitent les chutes pour pouvoir plus facilement faire semblant d\'avoir été poussé par un adversaire. Idéal pour apprendre les rudiments du sport.', 145, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10563, 50, 'Orbe reconstituant', 'Cet objet permet de répartir ses points de caractéristiques. Les maîtres des temples de classe savent comment l\'utiliser.', 460, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10564, 89, 'Paquet orbe reconstituant', 'Ce paquet contient un orbe précieusement enveloppé.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10597, 90, 'Fantôme de Gelutin', 'Ce Gelutin n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10598, 89, 'Cadeau Gelutin', 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10599, 77, 'Certificat de mise en chanil : Gelutin', 'Ce certificat décrit les caractéristiques du familier que vous avez placé au Chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10601, 24, 'Certificat de reconstitution', 'Ce document atteste de la remise à zéro de vos caractéristiques.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10602, 75, 'Parchemin de Sort apprivoisement de monture', 'Ce parchemin permet d\'apprendre le sort apprivoisement de monture.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10603, 75, 'Parchemin de Sort  capture d\'âmes', 'Ce parchemin permet d\'apprendre le sort capture d\'âmes.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10604, 75, 'Parchemin de Sort marteau de Moon', 'Ce parchemin permet d\'apprendre le sort marteau de Moon.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10605, 75, 'Parchemin de Sort  boomerang perfide', 'Ce parchemin permet d\'apprendre le sort boomerang perfide.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10606, 85, 'Gemme Spirituelle de Rat Blanc', 'Gagnée en récompense de vos victoires en duel, cette gemme referme l\'âme d\'un monstre. A conserver à l\'abri de la lumière dans un endroit sec. Secouer avant usage.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10608, 12, 'Potion vers Kralamoure Géant', 'Cette potion vous mènera directement vers le monstre indiqué.', 17, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10613, 78, 'Rune Pa Pi', 'Cette rune permet d\'augmenter la puissance de ses pièges.', 23, 20, 'e1#3#0#0#0d0+3');
INSERT INTO `website_shop_objects_templates` VALUES (10615, 78, 'Rune Pa Pi Per', 'Cette rune permet d\'augmenter la puissance de ses pièges.', 24, 20, 'e2#3#0#0#0d0+3');
INSERT INTO `website_shop_objects_templates` VALUES (10616, 78, 'Rune Ra Pi Per', 'Cette rune permet d\'augmenter la puissance de ses pièges.', 24, 30, 'e2#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (10618, 78, 'Rune Pa Do Per', 'Cette rune permet d\'augmenter les dommages causés à ses adversaires.', 16, 30, '8a#3#0#0#0d0+3');
INSERT INTO `website_shop_objects_templates` VALUES (10619, 78, 'Rune Ra Do Per', 'Cette rune permet d\'augmenter les dommages causés à ses adversaires.', 16, 30, '8a#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (10621, 24, 'Ordres des Sacre', 'Ce document déchiré liste les consignes des Sacre. Simples, celles-ci consistent en la traque et l\'exécution d\'une cible. Et surtout, ne pas retourner les voir avant dix minutes et ce, quelque soit le dénouement du combat.', 176, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10622, 6, 'Epée de Grüt', 'Cette épée permettait à Grüt le Bwork de couper les noisettes de ses adversaires en deux, ce qui suffisait généralement pour les faire abandonner le moindre combat. Cette arme magique est encore imprégnée de la personnalité de Grüt. En l\'équipant, vous pourrez peut-être l\'incarner.', 94, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10623, 1, 'Amulette de Grüt', 'Grüt le Bwork n\'était pas très malin. Il était même complètement stupide. Heureusement, les méthodes d\'enseignement ancestrales fonctionnaient aussi bien sur les enfants que sur les Bworks. Quelques coups de bâton bien mérités ont fini par avoir raison de sa stupidité et au fil des années, Grüt est devenu juste un peu bête.', 153, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10624, 10, 'Ceinture de Grüt', 'Ceux qui ont eu à affronter Grüt le Bwork vous le diront, \"ne visez pas la tête, elle est vide\". Ce conseil est valable pour tous ceux qui affrontent les Iops, les gobelins ou les belles-mères.', 163, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (10625, 11, 'Bottes de Grüt', 'Les bottes de Grüt dégagent une odeur tellement répugnante, qu\'elles peuvent étouffer vos adversaires d\'un simple coup de pied à la tête. Ces bottes ont été interdites en combat par la convention de Sufokia il y a très longtemps. Personne ne reviendra sur cette décision qui a permis d\'éviter de nombreuses morts atroces.', 150, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (10626, 6, 'Epée de Kocksis', 'La vie d\'un Chafer Fantassin n\'est pas aussi facile que l\'on pourrait l\'imaginer. Mais comme personne n\'a jamais réussi à imaginer comment vit un Chafer Fantassin, tout le monde s\'en moque et s\'imagine que sa vie est facile. C\'est à cause de raisonnements aussi stupides que celui-ci, que le Chafer Fantassin est devenu un Chafer Fantassin. Cette arme magique est encore imprégnée de la personnalité de Kocksis. En l\'équipant, vous pourrez peut-être l\'incarner.', 95, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10627, 9, 'Anneau de Kocksis', 'Kocksis le Chafer Fantassin avait de nombreux plaisirs plutôt malsains, comme manger des chips au vinaigre avec de la pâte à tartiner ou pire encore, manger des poils de Chacha. Nombreux sont ceux qui ont tenté de le ramener dans le droit chemin et se sont perdus sur le chemin du retour.', 179, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10628, 11, 'Bottes de Kocksis', 'Rien de plus bruyant que le claquement des os sur un parquet en orme. Grâce à ces bottes, Kocksis le Chafer Fantassin pouvait danser l\'Ankarmagniole toute la nuit sans craindre de réveiller les voisins, les morts, ni même les voisins morts.', 149, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10629, 10, 'Ceinture de Kocksis', 'Kocksis le Chafer Fantassin avait deux rêves dans sa vie : gravir la montagne des Craqueleurs et devenir ménestrel. La vie fût très cruelle avec lui, puisqu\'il dû se contenter de faire les premières parties des concerts de Francisque Kabroule. Parfois le sort s\'acharne sur vous. Cette fois-ci il s\'est acharné sur celui de Kocksis.', 164, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10630, 4, 'Bâton de Gobeuf', 'Ce bâton ressemble étrangement à une lance, Gobeuf le Gobelin a fait monter une lame aiguisée au bout de ce bâton afin de pouvoir transpercer les œufs de Tofu à distance. Il est inutile de chercher une explication rationnelle derrière tout cela, les Gobelins ont tout simplement toujours eu des jeux étranges. Cette arme magique est encore imprégnée de la personnalité de Gobeuf. En l\'équipant, vous pourrez peut-être l\'incarner.', 90, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (10631, 1, 'Amulette de Gobeuf', 'Voici une des devises les plus populaires chez les Gobelins : \"parfois, c\'est toi qui cognes le bar et parfois c\'est le bar qui te cogne\". En regardant attentivement les Gobelins, on pourrait résumer cette devise à \"Parfois le bar te cogne\".', 152, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10632, 10, 'Ceinture de Gobeuf', 'Gobeuf le gobelin adorait gober les œufs en état de putréfaction avancée. Si son appareil digestif supportait sans problème cette fâcheuse habitude, les gens situés à proximité de son haleine putride tombaient comme des Mosquitos. Cette ceinture permettait à tous ses proches de se rattraper avant de s\'écrouler lamentablement au sol.', 165, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10633, 9, 'Anneau de Gobeuf', 'Gobeuf le Gobelin était passionné par le jardinage, surtout lorsqu\'il s\'agissait de donner des coups de râteau sur les imprudents qui s\'approchaient de ses terres. Il a trouvé cet anneau en ratissant le doigt d\'un imprudent qui avait marché sur un de ses pieds de Salace.', 180, 44, '');
INSERT INTO `website_shop_objects_templates` VALUES (10634, 2, 'Arc de Laikteur', 'Le Kanniboul Laikteur utilisait cette arme pour chasser ses proies et divertir ses enfants en leur envoyant quelques flèches dans les fesses lorsqu\'il était de bonne humeur. Cette arme magique est encore imprégnée de l\'âme du Kanniboul Laikteur. En l\'équipant, vous pourrez peut-être parvenir à l\'incarner.', 68, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10635, 1, 'Amulette de Laikteur', 'Lorsque les deux petites boules accrochées à cette amulette s\'entrechoquent, elles produisent un léger bruit de claquement qui vous permet d\'être informé de l\'arrivée d\'un Kanniboul. Lorsque vous entendez ce bruit, il est généralement trop tard pour vous enfuir, mais il est encore temps de choisir à quelle sauce vous voulez être dévoré.', 151, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10636, 9, 'Anneau de Laikteur', 'Cet anneau diffuse des épices afin d\'aromatiser facilement le bouillon lorsqu\'il est mélangé avec les mains. Ces épices sont si bonnes, qu\'une fois cet anneau équipé, vous risquez de vous en mordre les doigts.', 178, 42, '');
INSERT INTO `website_shop_objects_templates` VALUES (10637, 11, 'Bottes de Laikteur', 'Le Kanniboul Laikteur a utilisé ces bottes pendant plusieurs années avant de les échanger contre un touriste de l\'île de Moon. La faim justifie les moyens.', 148, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (10638, 6, 'Epée de Rekto Topi', 'Le Pandit Rekto Topi utilisait cette épée en frappant ses adversaires avec le plat de la lame, afin de les assommer sans les taillader. Un seul coup bien placé suffisait généralement pour les envoyer directement au tapis. Cette arme magique est encore imprégnée de l\'âme du Pandit Rekto Topi. En l\'équipant, vous pourrez peut-être parvenir à l\'incarner.', 93, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10639, 1, 'Amulette de Rekto Topi', 'Rekto avait un frère, appelé Verso Litaire. Il aimait voyager seul et explorer les tunnels sombres qui ne sentent pas très bon.', 154, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10640, 10, 'Ceinture de Rekto Topi', 'Cette ceinture est censée être réversible mais personne n\'a jamais osé utiliser l\'autre face de peur de découvrir qu\'elle n\'est en fait pas réversible.', 161, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (10641, 11, 'Bottes de Rekto Topi', 'Rekto Topi a confectionné ces bottes lui-même, à partir de morceaux de bois et d\'un peu de tissu. Elles ne ressemblent pas du tout à des bottes, mais qu\'importe elles sont magiques tout de même.', 147, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10642, 21, 'Pioche de Grizou', 'Grizou le Mineur Sombre a utilisé cette pioche pour creuser la célèbre mine sans fond de Kruup, dans laquelle le Gaddie a vécu plusieurs années. Cette arme est encore imprégnée de l\'âme de Grizou. En l\'équipant, vous pourrez peut-être l\'incarner.', 2, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10643, 9, 'Anneau de Grizou', 'Cet anneau change de couleur lorsqu\'il est trempé dans du jus de Chmoule bouillant. C\'est sûrement ce qui explique pourquoi Grizou le Mineur Sombre tenait autant à cet anneau.', 181, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (10644, 11, 'Bottes de Grizou', 'La semelle magique de ces bottes permet de casser les blocs de charbon en envoyant les vibrations nécessaires à leur fragmentation. La notice indique qu\'elles sont même capables de vibrer toutes seules dès qu\'un son de Bouftonik est joué à proximité.', 146, 41, '');
INSERT INTO `website_shop_objects_templates` VALUES (10645, 10, 'Ceinture de Grizou', 'Cette ceinture renforcée à l\'aide de nombreux métaux était assez solide pour supporter le poids des énormes bourses de Grizou le Mineur Sombre. Elle devrait convenir pour les bourses plus légères.', 162, 43, '');
INSERT INTO `website_shop_objects_templates` VALUES (10647, 89, 'Cadeau Bottes du Real Boitar', 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 42, 1, '');
