INSERT INTO `website_shop_objects_templates` VALUES (10656, 89, 'Cadeau Chapeau de Beneji', 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10657, 18, 'Chercheur d\'Ogrines', 'Cet étrange familier est issu du croisement des meilleurs chercheurs de truffes de tout Amakna. Son énorme groin lui permet de repérer l\'Ogrine, même lorsqu\'elle est cachée sous l\'eau. Otomaï aurait mis plusieurs années à obtenir cette espèce et l\'on raconte qu\'il l\'utiliserait pour réparer une de ses erreurs, retrouver ce qu\'il aurait égaré ou laissé s\'enfuir. Personne ne sait... La recherche d\'Ogrine implique un processus physiologique si complexe et coûteux en énergie, que cette créature est obligée de consommer les âmes des monstres pour grandir. Elle a été élevée sur les plages de l\'île d\'Otomaï et ne dévore que les âmes des créatures qui y vivent.', 56, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10658, 90, 'Fantôme de Chercheur d\'Ogrines', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 56, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10659, 72, 'Oeuf du Chercheur d\'Ogrines', 'Cet œuf étrange contient une petite créature magique. Gardez-le au chaud, il finira sûrement par éclore.', 206, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10660, 89, 'Cadeau Oeuf de Chercheur d\'Ogrines', 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10661, 77, 'Certificat de mise en chanil : Chercheur d\'Ogrines', 'Ce certificat décrit les caractéristiques du familier que vous avez placé au Chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10662, 78, 'Rune Pa Prospe', 'Cette rune permet d\'avoir plus de chance de trouver des objets rares.', 36, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (10663, 33, 'Brioche à la viande de bouftou', 'Il faut avoir l\'estomac bien accroché pour avaler cette brioche. La viande de bouftou utilisée, pas toujours de première fraîcheur, donne une saveur proche des huîtres au chocolat. Un délice pour Bwork.', 71, 20, '');
INSERT INTO `website_shop_objects_templates` VALUES (10664, 94, 'Abragland', 'Très délicat comme tous les glands, il suffit de le frotter légèrement pour qu\'il expulse l\'abraknyde emprisonné en son sein.', 15, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10665, 94, 'Coffre de Jorbak', 'Jorbak ayant perdu toute sa fortune, que peut bien contenir ce coffre étrange ? Ouvrez-le pour le découvrir.', 16, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10667, 24, 'Empreinte de Jorbak', 'Vous avez réussi à noter quand sera visible l\'esprit de Jorbak. Inutile de se précipiter.', 251, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10668, 28, 'Bonne fortune de Jorbak', 'Pendant quelques temps, vous bénéficierez de la chance de Jorbak.', 16, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10669, 12, 'Potion de crapaud-mufle', 'Ça vous apprendra à boire n\'importe quoi !', 18, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10670, 94, 'Parchemin de Persimol', 'Simples à suivre comme une recette de cuisine Wabbit, les indications de ce parchemin révèlent un secret envoutant.', 17, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10673, 12, 'Potion de HmmMmmMmmm', 'HmmMmmMmmm.', 191, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10674, 28, 'Mmmmm', 'Mmmmm mm mmmmmm mmmmm, mmm mmm mm mmmmmm mmmmm mmmmmmm mmmmmm mmm mmmm\'m mmmmm mmmm mmmmmmm.', 18, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10675, 89, 'Cadeau Dofusien', 'Pas moyen de vous révéler le contenu de ce cadeau, mais sachez qu\'il vous permettra à la fois de vous éclater et de faire la foire. Lorsque c\'est jour de fête, il faut bien ça.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10676, 28, 'Double effet Kill Coos', 'Votre prospection et votre sagesse sont augmentées pendant plusieurs combats.', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10677, 42, 'Shigekax Kill Coos', 'Retrouvez la saveur et tout le charme des sucreries d\'antan, avec ce bonbon préparé de façon traditionnelle \\n(Ce bonbon augmente la prospection et la sagesse de 100 points pendant 20 combats).', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10678, 25, 'Voyager sans jamais perdre le Nord', 'Arpagnagrobis a écrit cet ouvrage pour tous les aventuriers ne sachant point se servir de leur boussole et des zaaps.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10680, 24, 'Souvenir sanglant du Goultarminator', 'Vous avez arraché ce coeur à l\'Essence Maléfique de Goultard. Vous pourrez le poser sur votre bureau en guise de souvenir.', 518, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10681, 31, 'Transformation en Crapaud-mufle', 'Bien fait !', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10682, 29, 'Le secret de Persimol', 'Chance et bonheur vont de paire.', 5, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10685, 16, 'Casque du Roks Or', 'Équipée de ce casque en or, votre tête sera rapidement mise à prix et vaudra son pesant d\'or.', 254, 52, '');
INSERT INTO `website_shop_objects_templates` VALUES (10686, 17, 'Cape du Roks Or', 'Cette cape en tissu, recouverte d\'une fine couche d\'or est magique. Elle attire les regards et renvoie la lumière directement dans les pupilles des fourbes qui tenteraient de vous poignarder par derrière. Indispensable si vous avez des amis Srams.', 171, 54, '');
INSERT INTO `website_shop_objects_templates` VALUES (10687, 9, 'Anneau du Roks Or', 'Cet anneau est si lourd qu\'il augmente considérablement l\'inertie de votre poing quand vous distribuez des claques à vos adversaires. Lorsque vous aurez commencé à punir les manants, il vous sera quasiment impossible de vous arrêter.', 182, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (10688, 10, 'Ceinture du Roks Or', 'Cette ceinture est parfaite pour accrocher vos lingots d\'or autour de votre taille, ils passeront inaperçus.', 166, 53, '');
