INSERT INTO `website_shop_objects_templates` VALUES (10715, 48, 'Poudre de Créatoune', 'Suite au sortilège jeté par Silouate, le Minotoror Protecteur du mois d\'Aperirel, pour sauver les familiers de la peste qui les décimait, Créatoune, un humble alchimiste, eut une idée de génie. Il profita du sommeil du Protecteur pour prélever un échantillon de sa masse musculaire et la synthétisa, pour plus tard l\'administrer aux familiers et les rendre plus vigoureux.', 670, 1, '');
