INSERT INTO `website_shop_objects_templates` VALUES (10783, 116, 'Potion d\'Amélioration de Vampyrette', 'En utilisant cette puissante potion, vous augmenterez les capacités de votre familier de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 53, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10784, 1, 'Amulette du débutant', 'Personne ne sait exactement ce que vous apporte cette amulette, mais tout le monde sait ce qu\'elle vous retire : votre crédibilité.', 7, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10785, 9, 'Anneau du débutant', 'Cet anneau protégera vos doigts des crottes de nez de vos adversaires.', 7, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10786, 24, 'Peau parfaite de Koalak Immature', 'Le petit Koalak Immature à qui vous avez arraché cette peau, n\'était pas d\'accord pour vous la donner, mais qu\'importe, vous étiez plus fort et plus cruel que lui.', 811, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10787, 24, 'Aile parfaite de Dragodinde Rousse Sauvage', 'Cette Aile sent le soufre. Tout bon éleveur de Dragodindes vous dira que c\'est la partie la plus tendre pour un barbeulcu. Assaisonnez tout de même la viande, car l\'Aile est la partie la plus fade.', 812, 29, '');
INSERT INTO `website_shop_objects_templates` VALUES (10788, 24, 'Aile parfaite de Dragodinde', 'On peut dire que la Dragodinde domestique est bien meilleure que sa cousine sauvage. Déjà, elle n\'a pas un arrière-goût de soufre, mais la chair est goûteuse à souhait, ce qui en fait le plat favori de tous les petits.', 813, 29, '');
INSERT INTO `website_shop_objects_templates` VALUES (10789, 24, 'Poils irritants de Koalak Forestier', 'Ces poils sont recouverts de sève de Kaliptus, ce qui leur confère un aspect luisant et brillant. Malheureusement, ils sont inutilisables en haute couture à cause de leur odeur de Dragodinde morte.', 814, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10790, 24, 'Os magique de Mama Koalak', 'La Mama Koalak possède des os particulièrement résistants qui ne cèdent pas sous son poids. On ne peut pas en dire autant de Francisque Kabroule, le célèbre Ménestrel, qui perdit l\'usage de ses deux bras en se faisant écraser par les énormes cuisses de la Mama Koalak. La curiosité est un vilain défaut.', 815, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10791, 24, 'Poils de Barbe urticants du Warko Marron', 'Ces poils sont urticants, assez pour transformer les bises du Warko Marron en armes de destruction massives.', 816, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10792, 12, 'Potion de soin du débutant', 'Cette fiole servait autrefois aux analyses d\'urine. Elle contient désormais une potion capable de restaurer les points de vie perdus.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10793, 33, 'Pain du débutant', 'Il est sec, il fait mal aux dents, il sent le slip de Bwork, mais il permet de regagner des points de vie. Arrêtez de faire la fine bouche.', 6, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10794, 11, 'Bottes du débutant', 'Chaudes à l\'intérieur et froides à l\'extérieur, ces bottes vous permettront de botter les fesses des bonshommes de neige sans leur faire fondre le postérieur.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10795, 49, 'Poisson Deukloche du débutant', 'Si vous frappez violemment ce poisson, vous l\'entendrez résonner. Vous pouvez le manger et vous faire frapper pour vous transformer en instrument de musique.', 92, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10796, 69, 'Mexicanos du débutant', 'Cette boulette de viande hachée épicée concentre tout ce qu\'il y a de plus indigeste dans la contrée d\'Amakna, mais c\'est trop bon et votre petit corps en redemande.', 113, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10797, 6, 'Epée Tulante du débutant', 'Sortie de son fourreau, cette épée peut couper le jambon, les Enutrofs, les unijambistes, les danseurs et les Enutrofs unijambistes enroulés dans une tranche de jambon qui dansent un soir de pleine lune. En revanche pour trancher les monstres, elle est plutôt inefficace.', 96, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10798, 82, 'Bouclier du débutant', 'Ce bouclier ne vous protégera pas de votre bêtise.', 55, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10799, 10, 'Ceinture du débutant', 'Vous n\'arriviez pas à cacher votre épée ? Pas de problème, vous pourrez la coincer entre vos poignées d\'amour et cette ceinture.', 10, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10800, 17, 'Cape du débutant', 'Cette cape permet de voler, il suffit de fermer les yeux, serrer les poings, ouvrir la bouche et sauter d\'une falaise en écartant les bras tout en criant \"je vole\". Quelques instants plus tard, vous vous réveillerez avec deux jambes cassées.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10801, 16, 'Chapeau du débutant', 'Ce chapeau cache admirablement votre calvitie. Malheureusement, il n\'en n\'existe pas d\'assez grand pour cacher votre fausse modestie.', 2, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10802, 18, 'Dragoune Dorée', 'Plus dorée que la Dragoune Noire, moins rose que la Dragoune Rose, et plus rare que la Dragoune Squelette, ce familier attirera tous les regards sur vous, même si vous êtes laid comme un Piou. Ce familier dévoreur d\'âmes ne mange que les Dopeuls présents dans les temples de classe.', 57, 1, '320#a#0#0#0d0+10,7c#1#32#0#1d50+0');
INSERT INTO `website_shop_objects_templates` VALUES (10804, 89, 'Cadeau Dragoune Dorée', 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10805, 27, 'Transformation Fantôme Dragoune Dorée', 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 3, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10806, 77, 'Certificat de mise en chanil : Dragoune Dorée', 'Ce certificat décrit les caractéristiques du familier que vous avez placé au Chanil.', 24, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10807, 90, 'Fantôme de Dragoune Dorée', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 61, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10808, 48, 'Hormone de Dragoune Dorée', 'Cette hormone de croissance déshydratée peut être utilisée dans la confection d\'une puissante potion pour améliorer un familier.', 240, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10809, 116, 'Potion d\'Amélioration de Dragoune Dorée', 'En utilisant cette puissante potion, vous augmenterez les capacités de votre familier de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 59, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10810, 48, 'Hormone de Chercheur d\'Ogrines', 'Cette hormone de croissance déshydratée peut être utilisée dans la confection d\'une puissante potion pour améliorer un familier.', 234, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10811, 116, 'Potion d\'Amélioration de Chercheur d\'Ogrines', 'En utilisant cette puissante potion, vous augmenterez les capacités de votre familier de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 54, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10812, 24, 'Message anonyme', '\" Si tu cherches du travail facile et bien rémunéré, rends-toi au nord de la cité, à l\'est de la statue du dieu Sram. Viens seul. \"', 50, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10813, 24, 'Liste de noms', 'Vous avez trouvé cette liste de noms dans la maison de Pandale Douce. Il semblerait qu\'il s\'agisse de Pandawas.', 74, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10814, 24, 'Caisse pour Pandetté ', 'Vous devez livrer cette caisse à Pandetté, au village d\'Akwadala. Son contenu reste un mystère.', 44, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10815, 24, 'Liquide étrange', 'Sel Dawa vous a demandé de quérir l\'aide du Mage Ax pour analyser ce liquide.', 32, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10816, 24, 'Pétale Fané de Rose Démoniaque', 'Ce pétale fripé a perdu de sa superbe et sa texture rappelle la peau des jeunes Enutrofs.', 817, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10817, 24, 'Anti-dépendant', 'Ce prototype d\'antidote devrait pouvoir soigner la dépendance au jus de ouassingue.', 500, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10818, 19, 'Hache de l\'initié ', 'Cette arme d\'apparence rudimentaire vous donnera l\'impression de savoir vous battre.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10825, 30, 'Goulifié ', 'Était-ce vraiment nécessaire de se donner tout ce mal pour en arriver là ?', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10826, 24, 'Avis d\'expulsion', 'Comme vous vous êtes mal comporté avec vote hôte, ce dernier a décidé de vous fermer l\'accès à sa crypte pour les prochaines 24 heures.', 33, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10827, 12, 'Potion de soin larvesque', 'Un liquide orangé avec des bulles, personne ne peut vouloir boire ça.', 192, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10828, 16, 'Casque de boufbowl', 'Il est dit que le ridicule ne tue pas. C\'est exact, mais avec ce casque vous aurez vraiment l\'air ridicule.', 253, 29, '');
INSERT INTO `website_shop_objects_templates` VALUES (10829, 20, 'Kamapêche', 'Grâce à ce bâton les négociations pécuniaires tourneront à votre avantage.', 91, 40, '');
INSERT INTO `website_shop_objects_templates` VALUES (10830, 17, 'Banana Cape', 'Ikko, un célèbre artiste d\'Amakna fut le premier à oser porter cette cape. Tout le monde lui répétait pourtant : \"Quand c\'est trop, c\'est trop Ikko\".', 172, 28, '');
INSERT INTO `website_shop_objects_templates` VALUES (10831, 46, 'Bananagrume', 'Flambée ou en tranche, nappée de chocolat fondu ou nature, ce fruit fait un succulent dessert.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10832, 94, 'Craqueloroche', 'Cette pierre polie renferme un Craqueboule qui lui, ne l\'est pas. Elle ne semble être utilisable qu\'à proximité d\'autres Craqueleurs ou Craqueboules...', 18, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10833, 33, 'Chapain', 'Ce pain est étonnant, quand on mord dedans, il miaule !', 4, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10834, 16, 'Coiffe Wouaf', 'Il faut peu de choses pour que vous ressembliez à un Ouginak. Attention aux puces.', 256, 11, '');
INSERT INTO `website_shop_objects_templates` VALUES (10835, 50, 'Cachet du bizut', 'Piétiné, mâchouillé, écrasé, lavé, repassé, séché, on vous a tout fait. Mais vous n\'êtes plus un bleu;\\r\\n            vous êtes recouvert de bleus.', 707, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10836, 1, 'Boufbamu', 'Vous portez fièrement cette amulette, symbole de votre participation à cette grande manifestation sportive. Il faut ça pour rester fier après être passé sous la mêlée du B.C Trool.', 158, 64, '');
INSERT INTO `website_shop_objects_templates` VALUES (10838, 30, 'Orangé ', 'Vous avez encore bu quelque chose sans savoir ce que c\'était.', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10839, 33, 'Monstre Pain', 'On peut parfois se briser les dents sur du pain trop dur. Mangez celui-ci et vous recevrez un pain à vous faire tomber toutes les dents.', 12, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10840, 33, 'Monstre Pain consommable', 'Celui-ci est plus tendre, bon appétit.', 12, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10841, 30, 'Marron', 'Personne ne vous a prévenu des effets secondaires ?', 1, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10842, 31, 'Transformation en chacha', 'Voilà, il fallait bien que ça arrive ! Si vous recrachez des boules de poils, ne venez pas vous plaindre.', 21, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10843, 24, 'Note sur Krtek', 'Vous avez noté à quelle heure Krtek s\'est pris une raclée. Ainsi, vous pouvez savoir quand retourner lui en mettre une nouvelle.', 176, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10844, 31, 'Mmmmm', 'Mmmmm mm mmmmmm mmmmm, mmm mmm mm mmmmmm mmmmm mmmmmmm mmmmmm mmm mmmm\'m mmmmm mmmm mmmmmmm.', 19, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10846, 17, 'Phéro-Cape', 'Pris d\'une étrange frénésie, les tofus que vous croisez veulent se frotter contre votre jambe. Ce n\'est tout de même pas cette cape qui les attire ?', 173, 61, '');
INSERT INTO `website_shop_objects_templates` VALUES (10847, 11, 'Bottes d\'Hulkrap', 'Hulkrap enfilait ces bottes une fois par an, mais il les enlevait tous les jours. On peut donc en déduire que ces bottes sont magiques.', 151, 53, '');
INSERT INTO `website_shop_objects_templates` VALUES (10848, 11, 'Bottes de Klüme', 'Ces bottes coquées peuvent servir d\'enclumes. Son ancien propriétaire vous conseille vivement de ne pas danser avec.', 152, 52, '');
INSERT INTO `website_shop_objects_templates` VALUES (10849, 10, 'Ceinture d\'Hulkrap', 'Cette ceinture est fabriquée autour d\'une armature métallique aimantée qui attire les bourses des imprudents qui oseraient se frotter à vous.', 169, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (10850, 10, 'Ceinture de Klüme', 'Klüme avait trois faiblesses, les araknes, les chatouilles et les araknes chatouilleuses.', 167, 52, '');
INSERT INTO `website_shop_objects_templates` VALUES (10851, 10, 'Ceinture de Kloug', 'Cette ceinture est encore recouverte de farine. Peut-être parce qu\'elle servait de tablier à Kloug le Boulanger Sombre. A moins que ce ne soit la farine qu\'il utilisait pour se poudrer le postérieur.', 168, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (10852, 1, 'Amulette d\'Hulkrap', 'Hulkrap a jadis volé cette amulette à Gonztipay, un gobelin dénué de toute forme d\'humour, même le plus lourd.', 156, 53, '');
INSERT INTO `website_shop_objects_templates` VALUES (10853, 1, 'Amulette de Kloug', 'Cette amulette vous permet de pétrir la peau de votre cou sans utiliser vos mains.', 155, 53, '');
INSERT INTO `website_shop_objects_templates` VALUES (10854, 9, 'Anneau de Klüme', 'Gontran Klüme le forgeron a échangé cet anneau contre une épée qui appartenait à la Dame Antium.', 183, 54, '');
INSERT INTO `website_shop_objects_templates` VALUES (10855, 9, 'Anneau de Kloug', 'Cet anneau a été trempé dans une multitude de levures différentes. On raconte qu\'il est capable de transformer en moisissure ceux qui le portent. Certains aventuriers ne perçoivent aucune différence après l\'avoir porté.', 184, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (10856, 19, 'Hache d\'Hulkrap', 'Hulkrap était un très mauvais bandit rongé par les remords, il se sentait obligé de rendre ce qu\'il avait volé. Cette arme magique est encore imprégnée de l\'âme du Bandit Hulkrap. En l\'équipant, vous pourrez peut-être parvenir à l\'incarner.', 58, 47, '');
INSERT INTO `website_shop_objects_templates` VALUES (10857, 7, 'Marteau de Klüme', 'Ce marteau a permis de forger une braguette en Kriptonite pour le Captain Chafer. Cette arme magique est encore imprégnée de l\'âme du Forgeron Sombre Klüme. En l\'équipant, vous pourrez peut-être parvenir à l\'incarner.', 724, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (10858, 3, 'Baguette de Kloug', 'Kloug aimait se montrer généreux en distribuant des pains à ceux qui osaient lui parler. Il utilisait cette baguette pour rendre son jugement et punir les innocents. Cette arme est encore imprégnée de la magie de Kloug le Boulanger Sombre. Vous pourrez peut-être réussir à l\'incarner en utilisant cette arme.', 73, 53, '');
INSERT INTO `website_shop_objects_templates` VALUES (10860, 12, 'Potion de changement de nom', 'Cette potion permet de changer de nom. Plus personne ne se souviendra que vous vous appeliez Xx-Roxxor-naruto-killer-féca-xX. Une nouvelle vie sans moqueries s\'offre à vous. Vous allez enfin devenir quelqu\'un.', 718, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10861, 12, 'Potion de changement des couleurs', 'Du rose pour les cheveux, du mauve pour les chaussettes, et du fuchsia pour la peau. La nature ne vous a peut-être pas gâté, mais vous avez enfin l\'opportunité d\'y remédier. L\'occasion rêvée pour voir la vie en caca d\'oie.', 717, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10862, 12, 'Potion de changement de sexe', 'Cette potion à boire directement au goulot vous permettra de devenir lui si vous étiez elle ou de devenir elle si vous étiez lui. A consommer sans modération.', 719, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10863, 18, 'Raknaille', 'Cette Arakne est vraiment très mal élevée, elle saute partout, elle crie, elle mord n\'importe qui, mais vous l\'aimez beaucoup sans savoir pourquoi. La nature l\'a en outre dotée d\'un appétit féroce, ce familier dévoreur d\'âme adore attaquer puis dévorer les Moskitos et les Larves.', 58, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10864, 18, 'Meuch', 'Ce Champ Champ pas comme les autres a été élevé par une meute de Mulous. Ça n\'explique pas pourquoi il a du poil sous les aisselles. Ce familier dévoreur d\'âmes adore les fruits de mer et ne mange que les créatures des plages.', 59, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10865, 18, 'Tofoudre', 'Ce Tofu a reçu la foudre 11 fois durant sa croissance. Vous recevrez des décharges électriques si vous le caressez et il vous foudroiera si vous ne le caressez pas. Pour une fois vous avez le choix. Ce dévoreur d\'âme adore les rats et s\'en nourrit dès que l\'occasion se présente à lui.', 60, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10866, 18, 'Pykur', 'Ce familier aime les cœurs d\'artichauts au sang de Rasboul, les endives aux poils de Bitouf, et les chansons de Francisque Kabroule. Il semble également apprécier votre compagnie. Ce dévoreur d\'âme ne mange que les créatures de la Jungle Obscure.', 61, 1, 'b0#1#50#0#1d80+0,320#a#0#0#0d0+10');
INSERT INTO `website_shop_objects_templates` VALUES (10867, 90, 'Fantôme de Raknaille', 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 57, 1, '');
