INSERT INTO `website_shop_objects_templates` VALUES (10883, 116, 'Potion d\'Amélioration de Raknaille', 'En utilisant cette puissante potion, vous augmenterez les capacités de votre familier de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 56, 1, '');
