INSERT INTO `website_shop_objects_templates` VALUES (10899, 4, 'Bâton du Manitou Zoth', 'Le Manitou Zoth était un ancien manutentionnaire, il déplaçait les problèmes au lieu de les résoudre. Mais qu\'importe, il était craint au sein de la communauté des Zoths et criait plus fort que tous les autres, ce qui suffit pour être chef chez les Zoths. Ce bâton est encore animé par l\'âme du Manitou Zoth. Vous pourrez peut-être réussir à l\'incarner en utilisant cette arme.', 91, 50, '');
INSERT INTO `website_shop_objects_templates` VALUES (10900, 24, 'Eclat de coquille', 'Vous avez en main tout ce qui reste de ces gigantesques coquilles aperçues sur la presqu\'île des dragoeufs. Ca ne peut même pas faire un bon cendrier.', 767, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10901, 24, 'Gigantesque Canine', 'Grasmera et Grozilla se sont affrontés lors d\'un épique combat. Tout ce qu\'il reste est cette canine de taille démesurée. Qui croira que vous y étiez ?', 13, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10902, 24, 'Slip du Manitou Zoth', 'A présent, vous pouvez dire sans mentir que le Manitou Zoth est tout nu sous son pagne.', 621, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10903, 24, 'Clef de l\'antre du Manitou Zoth', 'Cette clef permet d\'aller combattre le Manitou Zoth.', 790, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10904, 1, 'Grozillamu', 'Cette amulette témoigne de votre incontestable capacité à casser les œufs sans faire d\'omelettes.', 157, 51, '');
INSERT INTO `website_shop_objects_templates` VALUES (10906, 82, 'Bouclier draconique', 'Façonné à partir d\'une écaille de Grozilla, ce lourd bouclier est d\'une prestance exceptionnelle. Seuls de rares et redoutables combattants arborent fièrement ce pavois.', 51, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10908, 89, 'Cadeau Donjons Beta-Test DOFUS 2.0', 'Ce cadeau vous a été offert car vous avez passé plus de temps dans les donjons du beta-test DOFUS 2.0 que le commun des mortels.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10909, 48, 'Phéromone de Tofu', 'Cette poudre de phéromone séchée pourrait attirer un Tofu à des kilomètres si vos propres phéromones ne les asphyxiaient pas.', 241, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10910, 89, 'Cadeau Coffret Collector DOFUS 2.0', 'Cette panoplie fera de vous une lumière, à condition de vous taire. Dans le cas contraire, elle pourra toujours impressionner les habitants d\'Astrub.', 42, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10911, 12, 'Potion de Rappel de M. Scouty', 'Deux fois plus crémeuse et deux fois plus onctueuse qu\'une potion de rappel classique, la « Potion de Rappel de M. Scouty » vous permettra de vous téléporter au zaap d\'Astrub depuis n\'importe quel endroit. Le double effet de cette potion vous assure un usage prolongé, qui dure longtemps, vraiment longtemps. \\nLa « Potion de Rappel de M. Scouty » est une marque déposée des entreprises Keurk & Spouky.', 26, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10912, 89, 'Cadeau de Nowel ridicule', 'Tous les cadeaux de Nowel n\'ont pas la même taille. Les aventuriers qui n\'ont pas été très courageux  gagnent des cadeaux ridicules ainsi que le droit de pleurer et d\'être moqués.', 2, 6, '');
INSERT INTO `website_shop_objects_templates` VALUES (10913, 89, 'Cadeau de Nowel satisfaisant', 'Celui qui a fait ce cadeau est bien prétentieux, il était persuadé que son contenu serait satisfaisant.', 2, 7, '');
INSERT INTO `website_shop_objects_templates` VALUES (10914, 89, 'Cadeau de Nowel potentiellement surpuissant', 'Ce cadeau a du potentiel si l\'on fait confiance à ce qui est écrit sur le nœud en tissu. Cependant, tous les aventuriers expérimentés vous le diront : ne faîtes jamais confiance à ce qui est écrit sur les nœuds en tissu.', 2, 8, '');
INSERT INTO `website_shop_objects_templates` VALUES (10915, 24, 'Ordre de mission de Félix Nowel', 'Félix Nowel vous a révélé l\'identité d\'un des cambrioleurs de l\'entrepôt du Père Nowel. Si vous ne parvenez pas à le vaincre d\'ici deux heures, vous pouvez, si vous le souhaitez,  retourner auprès de Félix Nowel pour obtenir un nouvel ordre de mission.', 33, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10916, 24, 'Félicitations de Félix Nowel', 'Votre victoire a été très appréciée par Félix Nowel. Revenez le voir dans 24 heures, il aura encore besoin de vos services si les caisses n\'ont pas toutes été récupérées d\'ici là.', 176, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10917, 24, 'Petite caisse de cadeaux', 'Cette petite caisse provient de l\'entrepôt du Père Nowel. La restituer à son propriétaire fera de vous un héros.', 44, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10918, 24, 'Caisse de cadeaux', 'Cette caisse provient de l\'entrepôt du Père Nowel. La restituer à son propriétaire fera de vous un héros.', 44, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10919, 24, 'Grosse caisse de cadeaux', 'Cette grosse caisse provient de l\'entrepôt du Père Nowel. La restituer à son propriétaire fera de vous un héros.', 44, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10920, 24, 'Biscuits de Nowel', 'Voici de délicieux biscuits cuisinés avec amour. Dommage que vous ne puissiez pas y goûter.', 245, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10921, 24, 'Cadeau scellé du Minotoboule', 'Nul ne sait ce que ce cadeau contient, le Minotoboule ayant emporté ce secret dans sa tombe. Est-il nécessaire de rappeler que c\'est entièrement votre faute ? Vraiment, il y a de quoi avoir les boules.', 715, 1, '');
INSERT INTO `website_shop_objects_templates` VALUES (10922, 82, 'Bouclier du Bûcheron Primordial', 'Ce bouclier permet de montrer à tous les aventuriers que vous êtes un précurseur dans l\'exercice de votre métier.', 57, 1, '');
